	('H40','אֲבִימֶלֶךְ','ʼĂbîymelek','ab-ee-mel\'-ek','from אָב and מֶלֶךְ; father of (the) king; Abimelek, the name of two Philistine kings and of two Israelites; Abimelech.'),
