	('H247','אָזַר','ʼâzar','aw-zar\'','a primitive root; to belt; bind (compass) about, gird (up, with).'),
	('H248','אֶזְרוֹעַ','ʼezrôwaʻ','ez-ro\'-a','a variation for זְרוֹעַ; the arm; arm.'),
	('H249','אֶזְרָח','ʼezrâch','ez-rawkh\'','from זָרַח (in the sense of springing up); a spontaneous growth, i.e. native (tree or persons); bay tree, (home-) born (in the land), of the (one\'s own) country (nation).'),
	('H250','אֶזְרָחִי','ʼEzrâchîy','ez-raw-khee\'','patronymic from חֹבָב; an Ezrachite or descendant of Zerach; Ezrahite.'),
	('H251','אָח','ʼâch','awkh','a primitive word; a brother (used in the widest sense of literal relationship and metaphorical affinity or resemblance (like father)); another, brother(-ly); kindred, like, other. Compare also the proper names beginning with \'Ah-\' or \'Ahi-\'.'),
