	('H253','אָח','ʼâch','awkh','a variation for אֲהָהּ; Oh! (expressive of grief or surprise); ah, alas.'),
	('H254','אָח','ʼâch','awkh','of uncertain derivation; a fire-pot or chafing dish; hearth.'),
