	('H564','אִמֵּר','ʼImmêr','im-mare\'','from אָמַר; talkative; Immer, the name of five Israelites; Immer.'),
	('H565','אִמְרָה','ʼimrâh','im-raw\'','or אֶמְרָה; feminine of אֵמֶר, and meaning the same; {something said}; commandment, speech, word.'),
	('H566','אִמְרִי','ʼImrîy','im-ree\'','from אִמֵּר; Imri, the name of two Israelites; Imri.'),
	('H567','אֱמֹרִי','ʼĔmôrîy','em-o-ree\'','probably a patronymic from an unused name derived from אָמַר in the sense of publicity, i.e. prominence; thus, a mountaineer; an Emorite, one of the Canaanitish tribes; Amorite.'),
	('H568','אֲמַרְיָה','ʼĂmaryâh','am-ar-yaw\'','or prolonged אֲמַרְיָהוּ; from אָמַר and יָהּ; Jah has said (i.e. promised); Amarjah, the name of nine Israelites; Amariah.'),
