	('H581','אִנּוּן','ʼinnûwn','in-noon\'','(Aramaic) or (feminine) אִנִּיןlemma אֵנִּין first vowel, corrected to אִנִּין; (Aramaic), corresponding to הֵם; they; [idiom] are, them, these.'),
	('H582','אֱנוֹשׁ','ʼĕnôwsh','en-oshe\'','from אָנַשׁ; properly, a mortal (and thus differing from the more dignified אָדָם); hence,; a man in general (singly or collectively); another, [idiom] (blood-) thirsty, certain, chap(-man); divers, fellow, [idiom] in the flower of their age, husband, (certain, mortal) man, people, person, servant, some ([idiom] of them), [phrase] stranger, those, [phrase] their trade. It is often unexpressed in the English versions, especially when used in apposition with another word. Compare אִישׁ.'),
	('H583','אֱנוֹשׁ','ʼĔnôwsh','en-ohsh\'','the same as אֱנוֹשׁ; Enosh, a son of Seth; Enos.'),
