	('H585','אֲנָחָה','ʼănâchâh','an-aw-khaw\'','from אֲנָחָה; sighing; groaning, mourn, sigh.'),
	('H586','אֲנַחְנָא','ʼănachnâʼ','an-akh\'-naw','(Aramaic) or אֲנַחְנָה; (Aramaic), corresponding to אֲנַחְנוּ; we; we.'),
	('H587','אֲנַחְנוּ','ʼănachnûw','an-akh\'-noo','apparently from אָנֹכִי; we; ourselves, us, we.'),
