	('H612','אֵסוּר','ʼêçûwr','ay-soor\'','from אָסַר; a bond (especially manacles of a prisoner); band, [phrase] prison.'),
	('H613','אֱסוּר','ʼĕçûwr','es-oor\'','(Aramaic) corresponding to אֵסוּר; {a bond (especially manacles of a prisoner)}; band, imprisonment.'),
