	('H625','אֹסֶף','ʼôçeph','o\'-sef','from אָסַף; a collection (of fruits); gathering.'),
	('H626','אֲסֵפָה','ʼăçêphâh','as-ay-faw\'','from אָסַף; a collection of people (only adverbial); [idiom] together.'),
