	('H647','אֲפִיחַ','ʼĂphîyach','af-ee\'-akh','perhaps from פּוּחַ; breeze; Aphiach, an Israelite; Aphiah.'),
	('H648','אָפִיל','ʼâphîyl','aw-feel\'','from the same as אָפֵל (in the sense of weakness); unripe; not grown up.'),
