	('H800','אֶשָּׁה','ʼeshshâh','esh-shaw\'','feminine of אֵשׁ; fire; fire.'),
	('H801','אִשָּׁה','ʼishshâh','ish-shaw\'','the same as אֶשָּׁה, but used in a liturgical sense; properly, a burnt-offering; but occasionally of any sacrifice; (offering, sacrifice), (made) by fire.'),
	('H802','אִשָּׁה','ʼishshâh','ish-shaw\'','feminine of אִישׁ or אֱנוֹשׁ; irregular plural, נָשִׁים;(used in the same wide sense as אֱנוֹשׁ); a woman; (adulter) ess, each, every, female, [idiom] many, [phrase] none, one, [phrase] together, wife, woman. Often unexpressed in English.'),
	('H803','אֲשׁוּיָה','ʼăshûwyâh','ash-oo-yah\'','feminine passive participle from an unused root meaning to found; foundation; foundation.'),
	('H804','אַשּׁוּר','ʼAshshûwr','ash-shoor\'','or אַשֻּׁר; apparently from אָשַׁר (in the sense of successful); Ashshur, the second son of Shem; also his descendants and the country occupied by them (i.e. Assyria), its region and its empire; Asshur, Assur, Assyria, Assyrians. See אָשֻׁר.'),
	('H805','אֲשׁוּרִי','ʼĂshûwrîy','ash-oo-ree\'','or אַשּׁוּרִי; from a patrial word of the same form as אַשּׁוּר; an Ashurite (collectively) or inhabitant of Ashur, a district in Palestine; Asshurim, Ashurites.'),
	('H806','אַשְׁחוּר','ʼAshchûwr','ash-khoor\'','probably from שָׁחַר; black; Ashchur, an Israelite; Ashur.'),
	('H807','אַשִׁימָא','ʼAshîymâʼ','ash-ee-maw\'','of foreign origin; Ashima, a deity of Hamath; Ashima.'),
	('H808','אָשִׁישׁ','ʼâshîysh','aw-sheesh\'','from the same as אֵשׁ (in the sense of pressing down firmly; compare אֲשׁוּיָה); a (ruined) foundation; foundation.'),
	('H809','אֲשִׁישָׁה','ʼăshîyshâh','ash-ee-shaw\'','feminine of אָשִׁישׁ; something closely pressed together, i.e. a cake of raisins or other comfits; flagon.'),
	('H810','אֶשֶׁךְ','ʼeshek','eh\'-shek','from an unused root (probably meaning to bunch together); a testicle (as a lump); stone.'),
	('H811','אֶשְׁכּוֹל','ʼeshkôwl','esh-kole\'','or אֶשְׁכֹּל; probably prolonged from אֶשֶׁךְ; a bunch of grapes or other fruit; cluster (of grapes).'),
	('H812','אֶשְׁכֹּל','ʼEshkôl','esh-kole\'','the same as אֶשְׁכּוֹל; Eshcol, the name of an Amorite, also of a valley in Palestine; Eshcol.'),
	('H813','אַשְׁכְּנַז','ʼAshkᵉnaz','ash-ken-az\'','of foreign origin; Ashkenaz, a Japhethite, also his descendants; Ashkenaz.'),
	('H814','אֶשְׁכָּר','ʼeshkâr','esh-cawr\'','for שָׂכָר; a gratuity; gift, present.'),
	('H815','אֵשֶׁל','ʼêshel','ay\'-shel','from a root of uncertain signification; a tamarisk tree; by extension, a grove of any kind; grove, tree.'),
	('H816','אָשַׁם','ʼâsham','aw-sham\'','or אָשֵׁם; a primitive root; to be guilty; by implication to be punished or perish; [idiom] certainly, be(-come, made) desolate, destroy, [idiom] greatly, be(-come, found, hold) guilty, offend (acknowledge offence), trespass.'),
	('H817','אָשָׁם','ʼâshâm','aw-shawm\'','from אָשַׁם; guilt; by implication, a fault; also a sin-offering; guiltiness, (offering for) sin, trespass (offering).'),
	('H818','אָשֵׁם','ʼâshêm','aw-shame\'','from אָשַׁם; guilty; hence, presenting asin-offering; one which is faulty, guilty.'),
	('H819','אַשְׁמָה','ʼashmâh','ash-maw\'','feminine of אָשָׁם; guiltiness, a fault, the presentation of asin-offering; offend, sin, (cause of) trespass(-ing, offering).'),
	('H820','אַשְׁמָן','ʼashmân','ash-mawn\'','probably from שֶׁמֶן; a fat-field; desolate place.'),
	('H821','אַשְׁמֻרָה','ʼashmurâh','ash-moo-raw\'','or אַשׁמוּרָה; or אַשׁמֹרֶת; (feminine) from שָׁמַר; a night watch; watch.'),
	('H822','אֶשְׁנָב','ʼeshnâb','esh-nawb\'','apparently from an unused root (probably meaning to leave interstices); a latticed window; casement, lattice.'),
	('H823','אַשְׁנָה','ʼAshnâh','ash-naw\'','probably a variation for יְשָׁנָה; Ashnah, the name of two places in Palestine; Ashnah.'),
	('H824','אֶשְׁעָן','ʼEshʻân','esh-awn\'','from שָׁעַן; support; Eshan, a place in Palestine; Eshean.'),
	('H825','אַשָּׁף','ʼashshâph','ash-shawf\'','from an unused root (probably meaning to lisp, i.e. practice enchantment); a conjurer; astrologer.'),
	('H826','אַשָּׁף','ʼashshâph','ash-shawf\'','(Aramaic) corresponding to אַשָּׁף; {a conjurer}; astrologer.'),
	('H827','אַשְׁפָּה','ʼashpâh','ash-paw\'','perhaps (feminine) from the same as אַשָּׁף (in the sense of covering); a quiver or arrow-case; quiver.'),
	('H828','אַשְׁפְּנַז','ʼAshpᵉnaz','ash-pen-az\'','of foreign origin; Ashpenaz, a Babylonian eunuch; Ashpenaz.'),
	('H829','אֶשְׁפָּר','ʼeshpâr','esh-pawr\'','of uncertain derivation; a measured portion; good piece (of flesh).'),
	('H830','אַשְׁפֹּת','ʼashpôth','ash-pohth\'','or אַשְׁפּוֹת; or שְׁפֹת; (contraction) plural of a noun of the same form as אַשְׁפָּה, from שָׁפָה (in the sense of scraping); a heap of rubbish or filth; dung (hill).'),
	('H831','אַשְׁקְלוֹן','ʼAshqᵉlôwn','ash-kel-one\'','probably from שָׁקַל in the sense of weighing-place (i.e. mart); Ashkelon, a place in Palestine; Ashkelon, Askalon.'),
	('H832','אֶשְׁקְלוֹנִי','ʼEshqᵉlôwnîy','esh-kel-o-nee\'','patrial from אַשְׁקְלוֹן; Ashkelonite (collectively) or inhabitant of Ashkelon; Eshkalonites.'),
	('H833','אָשַׁר','ʼâshar','aw-shar\'','or אָשֵׁר; a primitive root; to be straight (used in the widest sense, especially to be level, right, happy); figuratively, to go forward, be honest, proper; (call, be) bless(-ed, happy), go, guide, lead, relieve.'),
	('H834','אֲשֶׁר','ʼăsher','ash-er\'','a primitive relative pronoun (of every gender and number); who, which, what, that; also (as an adverb and a conjunction) when, where, how, because, in order that, etc.; [idiom] after, [idiom] alike, as (soon as), because, [idiom] every, for, [phrase] forasmuch, [phrase] from whence, [phrase] how(-soever), [idiom] if, (so) that ((thing) which, wherein), [idiom] though, [phrase] until, [phrase] whatsoever, when, where ([phrase] -as, -in, -of, -on, -soever, -with), which, whilst, [phrase] whither(-soever), who(-m, -soever, -se). As it is indeclinable, it is often accompanied by the personal pronoun expletively, used to show the connection.'),
	('H835','אֶשֶׁר','ʼesher','eh\'-sher','from אָשַׁר; happiness; only in masculine plural construction as interjection, how happy!; blessed, happy.'),
	('H836','אָשֵׁר','ʼÂshêr','aw-share\'','from אָשַׁר,; happy; Asher, a son of Jacob, and the tribe descended from him, with its territory; also a place in Palestine; Asher'),
	('H837','אֹשֶׁר','ʼôsher','o\'-sher','from אָשַׁר; happiness; happy.'),
	('H838','אָשֻׁר','ʼâshur','aw-shoor\'','or אַשֻּׁר; from אָשַׁר in the sense of going; a step; going, step.'),
	('H839','אֲשֻׁר','ʼăshur','ash-oor\'','contracted for תְּאַשּׁוּר; the cedar tree or some other light elastic wood; Ashurite.'),
	('H840','אֲשַׂרְאֵל','ʼĂsarʼêl','as-ar-ale\'','by orthographical variation from אָשַׁר and אֵל; right of God; Asarel, an Israelite; Asareel.'),
	('H841','אֲשַׂרְאֵלָה','ʼĂsarʼêlâh','as-ar-ale\'-aw','from the same as אֲשַׂרְאֵל; right toward God; Asarelah, an Israelite; Asarelah. Compare יְשַׂרְאֵלָה.'),
	('H842','אֲשֵׁרָה','ʼăshêrâh','ash-ay-raw\'','or אֲשֵׁירָה; from אָשַׁר; happy; Asherah (or Astarte) a Phoenician goddess; also an image of the same; grove. Compare עַשְׁתֹּרֶת.'),
	('H843','אָשֵׁרִי','ʼÂshêrîy','aw-shay-ree\'','patronymic from אָשֵׁר; an Asherite (collectively) or descendant of Asher; Asherites.'),
	('H844','אַשְׂרִיאֵל','ʼAsrîyʼêl','as-ree-ale\'','an orthographical variation for אֲשַׂרְאֵל; Asriel, the name of two Israelites; Ashriel, Asriel.'),
	('H845','אַשְׂרִאֵלִי','ʼAsriʼêlîy','as-ree-ale-ee\'','patronymic from אַשְׂרִיאֵל; an Asrielite (collectively) or descendant of Asriel; Asrielites.'),
	('H846','אֻשַּׁרְנָא','ʼushsharnâʼ','oosh-ar-naw\'','(Aramaic) from a root corresponding to אָשַׁר; a wall (from its uprightness); wall.'),
	('H847','אֶשְׁתָּאֹל','ʼEshtâʼôl','esh-taw-ole\'','or אֶשְׁתָּאוֹל; probably from שָׁאַל; intreaty; Eshtaol, a place in Palestine; Eshtaol.'),
	('H848','אֶשְׁתָּאֻלִי','ʼEshtâʼulîy','esh-taw-oo-lee\'','patrial from אֶשְׁתָּאֹל; an Eshtaolite (collectively) or inhabitant of Eshtaol; Eshtaulites.'),
	('H849','אֶשְׁתַּדּוּר','ʼeshtaddûwr','esh-tad-dure\'','(Aramaic) from שְׁדַר (in a bad sense); rebellion; sedition.'),
	('H850','אֶשְׁתּוֹן','ʼEshtôwn','esh-tone\'','probably from the same as שׁוּנִי; restful; Eshton, an Israelite; Eshton.'),
	('H851','אֶשְׁתְּמֹעַ','ʼEshtᵉmôaʻ','esh-tem-o\'-ah','or אֶשְׁתְּמוֹעַ; or אֶשְׁתְּמֹה; from שָׁמַע (in the sense of obedience); Eshtemoa or Eshtemoh, a place in Palestine; Eshtemoa, Eshtemoh.'),
	('H852','אָת','ʼâth','awth','(Aramaic) corresponding to אוֹת; a portent; sign.'),
	('H853','אֵת','ʼêth','ayth','apparent contracted from אוֹת in the demonstrative sense of entity; properly, self (but generally used to point out more definitely the object of a verb or preposition, even or namely); (as such unrepresented in English).'),
	('H854','אֵת','ʼêth','ayth','probably from אָנָה; properly, nearness (used only as a preposition or an adverb), near; hence, generally, with, by, at, among, etc.; against, among, before, by, for, from, in(-to), (out) of, with. Often with another prepositional prefix.'),
	('H855','אֵת','ʼêth','ayth','of uncertain derivation; a hoe or other digging implement; coulter, plowshare.'),
	('H856','אֶתְבַּעַל','ʼEthbaʻal','eth-bah\'-al','from אֵת and בַּעַל; with Baal; Ethbaal, a Phoenician king; Ethbaal.'),
	('H857','אָתָה','ʼâthâh','aw-thaw\'','or אָתָא; a primitive root (collateral to אוּת contraction); to arrive; (be-, things to) come (upon), bring.'),
	('H858','אָתָה','ʼâthâh','aw-thaw\'','(Aramaic) or אָתָא; (Aramaic), corresponding to אָתָה; {to arrive}; (be-) come, bring.'),
	('H859','אַתָּה','ʼattâh','at-taw\'','or (shortened); אַתָּ; or אַת; feminine (irregular) sometimes אַתִּי; plural masculine אַתֶּם; feminine אַתֶּן; or אַתֵּנָהlemma אתֵּנָה missing vowel, corrected to אַתֵּנָה; or אַתֵּנָּה; a primitive pronoun of the second person; thou and thee, or (plural) ye and you; thee, thou, ye, you.'),
	('H860','אָתוֹן','ʼâthôwn','aw-thone\'','probably from the same as אֵיתָן (in the sense of patience); a female donkey (from its docility); (she) ass.'),
	('H861','אַתּוּן','ʼattûwn','at-toon\'','(Aramaic) probably from the corresponding to אֵשׁ; probably a fire-place, i.e. furnace; furnace.'),
	('H862','אַתּוּק','ʼattûwq','at-tooke\'','or אַתִּיק; from נָתַק in the sense of decreasing; a ledge or offset in abuilding; gallery.'),
	('H863','אִתַּי','ʼIttay','it-tah\'ee','or אִיתַי; from אֵת; near; Ittai or Ithai, the name of a Gittite and of an Israelite; Ithai, Ittai.'),
	('H864','אֵתָם','ʼÊthâm','ay-thawm\'','of Egyptian derivation; Etham, a place in the Desert; Etham.'),
	('H865','אֶתְמוֹל','ʼethmôwl','eth-mole\'','or אִתְמוֹל; or אֶתְמוּל; probably from אֵת or אֵת and מוּל; heretofore; definitely yesterday; [phrase] before (that) time, [phrase] heretofore, of late (old), [phrase] times past, yester(day).'),
	('H866','אֶתְנָה','ʼethnâh','eth-naw\'','from תָּנָה; a present (as the price of harlotry); reward.'),
	('H867','אֶתְנִי','ʼEthnîy','eth-nee\'','perhaps from אֶתְנָה; munificence; Ethni, an Israelite; Ethni.'),
	('H868','אֶתְנַן','ʼethnan','eth-nan\'','the same as אֶתְנָה; a gift (as the price of harlotry or idolatry); hire, reward.'),
	('H869','אֶתְנַן','ʼEthnan','eth-nan\'','the same as אֶתְנַן in the sense of אֶתְנִי; Ethnan, an Israelite; Ethnan.'),
	('H870','אֲתַר','ʼăthar','ath-ar\'','(Aramaic) from a root corresponding to that of אֲתָרִים; a place; (adverb) after; after, place.'),
	('H871','אֲתָרִים','ʼĂthârîym','ath-aw-reem\'','plural from an unused root (probably meaning to step); places; Atharim, a place near Palestine; spies. b'),
	('H872','בְּאָה','bᵉʼâh','be-aw\'','from בּוֹא; an entrance to a building; entry.'),
	('H873','בִּאוּשׁ','biʼûwsh','be-oosh\'','(Aramaic) from בְּאֵשׁ; wicked; bad.'),
	('H874','בָּאַר','bâʼar','baw-ar\'','a primitive root; to dig; by analogy, to engrave; figuratively, to explain; declare, (make) plain(-ly).'),
