	('H880','בְּאֵרָה','Bᵉʼêrâh','be-ay-raw\'','the same as בְּאֵרָא; Beerah, an Israelite; Beerah.'),
	('H881','בְּאֵרוֹת','Bᵉʼêrôwth','be-ay-rohth\'','feminine plural of בְּאֵר; wells; Beeroth, a place in Palestine; Beeroth.'),
	('H882','בְּאֵרִי','Bᵉʼêrîy','be-ay-ree\'','from בְּאֵר; fountained; Beeri, the name of a Hittite and of an Israelite; Beeri.'),
