	('H884','בְּאֵר שֶׁבַע','Bᵉʼêr Shebaʻ','be-ayr\' sheh\'-bah','from בְּאֵר and שֶׁבַע (in the sense of שָׁבַע); well of an oath; Beer-Sheba, a place in Palestine; Beer-shebah.'),
