	('H886','בְּאֵרֹתִי','Bᵉʼêrôthîy','be-ay-ro-thee\'','patrial from בְּאֵרוֹת; a Beerothite or inhabitant of Beeroth; Beerothite.'),
	('H887','בָּאַשׁ','bâʼash','baw-ash\'','a primitive root; to smell bad; figuratively, to be offensive morally; (make to) be abhorred (had in abomination, loathsome, odious), (cause a, make to) stink(-ing savour), [idiom] utterly.'),
	('H888','בְּאֵשׁ','bᵉʼêsh','be-aysh\'','(Aramaic) corresponding to בָּאַשׁ; {to smell bad; figuratively, to be offensive morally}; displease.'),
	('H889','בְּאֹשׁ','bᵉʼôsh','be-oshe\'','from בֹּאר; a stench; stink.'),
	('H890','בׇּאְשָׁה','boʼshâh','bosh-aw\'','feminine of בְּאֹשׁ; stink-weed or any other noxious or useless plant; cockle.'),
	('H891','בְּאֻשִׁים','bᵉʼushîym','be-oo-sheem\'','plural of בְּאֹשׁ; poison-berries; wild grapes.'),
	('H892','בָּבָה','bâbâh','baw-baw\'','feminine active participle of an unused root meaning to hollow out; something hollowed (as a gate), i.e. pupil of the eye; apple (of the eye).'),
	('H893','בֵּבַי','Bêbay','bay-bah\'ee','probably of foreign origin; Bebai, an Israelite; Bebai.'),
	('H894','בָּבֶל','Bâbel','baw-bel\'','from בָּלַל; confusion; Babel (i.e. Babylon), including Babylonia and the Babylonian empire; Babel, Babylon.'),
	('H895','בַּבֶל','Babel','baw-bel\'','(Aramaic) corresponding to בָּבֶל; {Babel (i.e. Babylon), including Babylonia and the Babylonian empire}; Babylon.'),
	('H896','בַּבְלִי','Bablîy','bab-lee\'','(Aramaic) patrial from בַּבֶל; a Babylonian; Babylonia.'),
	('H897','בַּג','bag','bag','a Persian word; food; spoil (from the margin for בַּז.)'),
	('H898','בָּגַד','bâgad','baw-gad\'','a primitive root; to cover (with a garment); figuratively, to act covertly; by implication, to pillage; deal deceitfully (treacherously, unfaithfully), offend, transgress(-or), (depart), treacherous (dealer, -ly, man), unfaithful(-ly, man), [idiom] very.'),
	('H899','בֶּגֶד','beged','behg\'-ed','from בָּגַד; a covering, i.e. clothing; also treachery or pillage; apparel, cloth(-es, ing), garment, lap, rag, raiment, robe, [idiom] very (treacherously), vesture, wardrobe.'),
	('H900','בֹּגְדוֹת','bôgᵉdôwth','bohg-ed-ohth','feminine plural active participle of בָּגַד; treacheries; treacherous.'),
	('H901','בָּגוֹד','bâgôwd','baw-gode\'','from בָּגַד; treacherous; treacherous.'),
