	('H1048','בֵּית פַּצֵּץ','Bêyth Patstsêts','bayth pats-tsates\'','from בַּיִת and a derivative from פּוּץ; house of dispersion; Beth-Patstsets, a place in Palestine; Beth-pazzez.'),
	('H1049','בֵּית צוּר','Bêyth Tsûwr','bayth tsoor\'','from בַּיִת and צוּר; house of (the) rock; Beth-Tsur, a place in Palestine; Beth-zur.'),
