	('H1055','בִּיתָן','bîythân','bee-thawn\'','probably from בַּיִת; a palace (i.e. large house); palace.'),
	('H1056','בָּכָא','Bâkâʼ','baw-kaw\'','from בָּכָה, weeping; Baca, a valley in Palestine; Baca.'),
	('H1057','בָּכָא','bâkâʼ','baw-kaw\'','the same as בָּכָא; the weeping tree (some gum-distilling tree, perhaps the balsam); mulberry tree.'),
