	('H1086','בָּלָה','bâlâh','baw-law\'','a primitive root; to fail; by implication to wear out, decay (causatively, consume, spend); consume, enjoy long, become (make, wax) old, spend, waste.'),
	('H1087','בָּלֶה','bâleh','baw-leh\'','from בָּלָה; worn out; old.'),
	('H1088','בָּלָה','Bâlâh','baw-law\'','feminine of בָּלֶה; failure; Balah, a place in Palestine; Balah.'),
	('H1089','בָּלַהּ','bâlahh','baw-lah\'','a primitive root (rather by transposition for בָּהַל); to palpitate; hence, (causatively) to terrify; trouble.'),
