	('H1097','בְּלִי','bᵉlîy','bel-ee\'','from בָּלָה; properly, failure, i.e. nothing or destruction; usually (with preposition) without, not yet, because not, as long as, etc.; corruption, ig(norantly), for lack of, where no...is, so that no, none, not, un(awares), without.'),
	('H1098','בְּלִיל','bᵉlîyl','bel-eel\'','from בָּלַל; mixed, i.e. (specifically) feed (for cattle); corn, fodder, provender.'),
	('H1099','בְּלִימָה','bᵉlîymâh','bel-ee-mah\'','from בְּלִי and מָה; (as indefinitely) nothing whatever; nothing.'),
	('H1100','בְּלִיַּעַל','bᵉlîyaʻal','bel-e-yah\'-al','from בְּלִי and יַעַל;(often in connection with אִישׁ, אִשָּׁה, בֵּן, etc.); without profit, worthlessness; by extension, destruction, wickedness; Belial, evil, naughty, ungodly (men), wicked.'),
	('H1101','בָּלַל','bâlal','baw-lal\'','a primitive root; (also  denominatively from בְּלִיל) to fodder; to overflow (specifically with oil.); by implication, to mix; to fodder; anoint, confound, [idiom] fade, mingle, mix (self), give provender, temper.'),
	('H1102','בָּלַם','bâlam','baw-lam\'','a primitive root; to muzzle; be held in.'),
	('H1103','בָּלַס','bâlaç','baw-las\'','a primitive root; to pinch sycamore figs (a process necessary to ripen them); gatherer.'),
	('H1104','בָּלַע','bâlaʻ','baw-lah\'','a primitive root; to make away with (specifically by swallowing); generally, to destroy; cover, destroy, devour, eat up, be at end, spend up, swallow down (up).'),
	('H1105','בֶּלַע','belaʻ','beh\'-lah','from בָּלַע; a gulp; figuratively, destruction; devouring, that which he hath swallowed up.'),
	('H1106','בֶּלַע','Belaʻ','beh\'-lah','the same as בֶּלַע; Bela, the name of a place, also of an Edomite and of two Israelites; Bela.'),
	('H1107','בִּלְעֲדֵי','bilʻădêy','bil-ad-ay\'','or בַּלְעֲדֵי; constructive plural from בַּל and עַד, not till, i.e. (as preposition or adverb); except, without, besides; beside, not (in), save, without.'),
	('H1108','בַּלְעִי','Balʻîy','bel-ee\'','patronymically from בֶּלַע; a Belaite (collectively) or descendants of Bela; Belaites.'),
	('H1109','בִּלְעָם','Bilʻâm','bil-awm\'','probably from בַּל and עַם; not (of the) people, i.e. foreigner; Bilam, a Mesopotamian prophet; also a place in Palestine; Balaam, Bileam.'),
	('H1110','בָּלַק','bâlaq','baw-lak\'','a primitive root; to annihilate; (make) waste.'),
