	('H1654','גֶּשֶׁם','Geshem','gheh\'-shem','or (prolonged) גַּשְׁמוּ; the same as גֶּשֶׁם; Geshem or Gashmu, an Arabian; Geshem, Gashmu.'),
	('H1655','גֶּשֶׁם','geshem','gheh\'-shem','(Aramaic) apparently the same as גֶּשֶׁם; used in a peculiar sense, the body (probably for the (figuratively) idea of a hard rain); body.'),
	('H1656','גֹּשֶׁם','gôshem','go\'-shem','from גָּשַׁם; equivalent to גֶּשֶׁם; {a shower}; rained upon.'),
	('H1657','גֹּשֶׁן','Gôshen','go\'-shen','probably of Egyptian origin; Goshen, the residence of the Israelites in Egypt; also a place in Palestine; Goshen.'),
	('H1658','גִּשְׁפָּא','Gishpâʼ','ghish-paw\'','of uncertain derivation; Gishpa, an Israelite; Gispa.'),
	('H1659','גָּשַׁשׁ','gâshash','gaw-shash\'','a primitive root; apparently; to feel about; grope.'),
	('H1660','גַּת','gath','gath','probably from נָגַן (in the sense of treading out grapes); a wine-press (or vat for holding the grapes in pressing them); (wine-) press (fat).'),
	('H1661','גַּת','Gath','gath','the same as גַּת; Gath, a Philistine city; Gath.'),
	('H1662','גַּת־הַחֵפֶר','Gath-ha-Chêpher','gath-hah-khay\'-fer','or (abridged) גִּתָּה־חֵפֶר; from גַּת and חָפַר with the article inserted; wine-press of (the) well; Gath-Chepher, a place in Palestine; Gath-kephr, Gittah-kephr.'),
	('H1663','גִּתִּי','Gittîy','ghit-tee\'','patrial from גַּת; a Gittite or inhabitant of Gath; Gittite.'),
	('H1664','גִּתַּיִם','Gittayim','ghit-tah\'-yim','dual of גַּת; double winepress; Gittajim, a place in Palestine; Gittaim.'),
	('H1665','גִּתִּית','Gittîyth','ghit-teeth\'','feminine of גִּתִּי; a Gittite harp; Gittith.'),
	('H1666','גֶּתֶר','Gether','gheh\'-ther','of uncertain derivation; Gether, a son of Aram, and the region settled by him; Gether.'),
	('H1667','גַּת־רִמּוֹן','Gath-Rimmôwn','gath-rim-mone\'','from גַּת and רִמּוֹן; wine-press of (the) pomegranate; Gath-Rimmon, a place in Palestine; Gath-rimmon. d'),
	('H1668','דָּא','dâʼ','daw','(Aramaic) corresponding to זֶה; this; one..another, this.'),
	('H1669','דָּאַב','dâʼab','daw-ab\'','a primitive root; to pine; mourn, sorrow(-ful).'),
	('H1670','דְּאָבָה','dᵉʼâbâh','deh-aw-baw\'','from דָּאַב; properly, pining; by analogy, fear; sorrow.'),
	('H1671','דְּאָבוֹן','dᵉʼâbôwn','deh-aw-bone\'','from דָּאַב; pining; sorrow.'),
	('H1672','דָּאַג','dâʼag','daw-ag\'','a primitive root; be anxious; be afraid (careful, sorry), sorrow, take thought.'),
	('H1673','דֹּאֵג','Dôʼêg','do-ayg\'','or (fully) דּוֹאֵג; active participle of דָּאַג; anxious; Doeg, an Edomite; Doeg.'),
	('H1674','דְּאָגָה','dᵉʼâgâh','deh-aw-gaw\'','from דָּאַג; anxiety; care(-fulness), fear, heaviness, sorrow.'),
	('H1675','דָּאָה','dâʼâh','daw-aw\'','a primitive root; to dart, i.e. fly rapidly; fly.'),
	('H1676','דָּאָה','dâʼâh','daw-aw\'','from דָּאָה; the kite (from its rapid flight); vulture. See רָאָה.'),
	('H1677','דֹּב','dôb','dobe','or (fully) דּוֹב; from דָּבַב; the bear (as slow); bear.'),
	('H1678','דֹּב','dôb','dobe','(Aramaic) corresponding to דֹּב; {the bear (as slow)}; bear.'),
	('H1679','דֹּבֶא','dôbeʼ','do\'-beh','from an unused root (compare דָּבַב) (probably meaning to be sluggish, i.e. restful); quiet; strength.'),
	('H1680','דָּבַב','dâbab','daw-bab\'','a primitive root (compare דֹּבֶא); to move slowly, i.e. glide; cause to speak.'),
	('H1681','דִּבָּה','dibbâh','dib-baw\'','from דָּבַב (in the sense of furtive motion); slander; defaming, evil report, infamy, slander.'),
	('H1682','דְּבוֹרָה','dᵉbôwrâh','deb-o-raw\'','or (shortened) דְּבֹרָה; from דָבַר (in the sense of orderly motion); the bee (from its systematic instincts); bee.'),
	('H1683','דְּבּוֹרָה','Dᵉbôwrâh','deb-o-raw\'','or (shortened) דְּבֹרָה; the same as דְּבוֹרָה; Deborah, the name of two Hebrewesses; Deborah.'),
	('H1684','דְּבַח','dᵉbach','deb-akh\'','(Aramaic) corresponding to זָבַח; to sacrifice (an animal); offer (sacrifice).'),
	('H1685','דְּבַח','dᵉbach','deb-akh\'','(Aramaic) from דְּבַח; a sacrifice; sacrifice.'),
	('H1686','דִּבְיוֹן','dibyôwn','dib-yone\'','in the margin for the textual reading, חֶרְיוֹן; both, (in the plural only and) of uncertain derivation,; probably some cheap vegetable, perhaps a bulbous root; dove\'s dung.'),
	('H1687','דְּבִיר','dᵉbîyr','deb-eer\'','or (shortened) דְּבִר; from דָבַר (apparently in the sense of oracle); the shrine or innermost part of the sanctuary; oracle.'),
	('H1688','דְּבִיר','Dᵉbîyr','deb-eer\'','or (shortened) דְּבִר; (Joshua 13:26 (but see לֹא דְבַר)), the same as דְּבִיר; Debir, the name of an Amoritish king and of two places in Palestine; Debir.'),
	('H1689','דִּבְלָה','Diblâh','dib-law\'','probably an orthographical error for רִבְלָה; Diblah, a place in Syria; Diblath.'),
	('H1690','דְּבֵלָה','dᵉbêlâh','deb-ay-law\'','from an unused root (akin to זָבַל) probably meaning to press together; a cake of pressed figs; cake (lump) of figs.'),
	('H1691','דִּבְלַיִם','Diblayim','dib-lah\'-yim','dual from the masculine of דְּבֵלָה; two cakes; Diblajim, a symbolic name; Diblaim.'),
	('H1692','דָּבַק','dâbaq','daw-bak\'','a primitive root; properly, to impinge, i.e. cling or adhere; figuratively, to catch by pursuit; abide fast, cleave (fast together), follow close (hard after), be joined (together), keep (fast), overtake, pursue hard, stick, take.'),
	('H1693','דְּבַק','dᵉbaq','deb-ak\'','(Aramaic) corresponding to דָּבַק; to stick to; cleave.'),
	('H1694','דֶּבֶק','debeq','deh\'-bek','from דָּבַק; a joint; by implication, solder; joint, solder.'),
	('H1695','דָּבֵק','dâbêq','daw-bake\'','from דָּבַק; adhering; cleave, joining, stick closer.'),
	('H1696','דָבַר','dâbar','daw-bar\'','a primitive root; perhaps properly, to arrange; but used figuratively (of words), to speak; rarely (in a destructive sense) to subdue; answer, appoint, bid, command, commune, declare, destroy, give, name, promise, pronounce, rehearse, say, speak, be spokesman, subdue, talk, teach, tell, think, use (entreaties), utter, [idiom] well, [idiom] work.'),
	('H1697','דָּבָר','dâbâr','daw-baw\'','from דָבַר; a word; by implication, a matter (as spoken of) or thing; adverbially, a cause; act, advice, affair, answer, [idiom] any such (thing), because of, book, business, care, case, cause, certain rate, [phrase] chronicles, commandment, [idiom] commune(-ication), [phrase] concern(-ing), [phrase] confer, counsel, [phrase] dearth, decree, deed, [idiom] disease, due, duty, effect, [phrase] eloquent, errand, (evil favoured-) ness, [phrase] glory, [phrase] harm, hurt, [phrase] iniquity, [phrase] judgment, language, [phrase] lying, manner, matter, message, (no) thing, oracle, [idiom] ought, [idiom] parts, [phrase] pertaining, [phrase] please, portion, [phrase] power, promise, provision, purpose, question, rate, reason, report, request, [idiom] (as hast) said, sake, saying, sentence, [phrase] sign, [phrase] so, some (uncleanness), somewhat to say, [phrase] song, speech, [idiom] spoken, talk, task, [phrase] that, [idiom] there done, thing (concerning), thought, [phrase] thus, tidings, what(-soever), [phrase] wherewith, which, word, work.'),
	('H1698','דֶּבֶר','deber','deh\'-ber','from דָבַר (in the sense of destroying); a pestilence; murrain, pestilence, plague.'),
	('H1699','דֹּבֶר','dôber','do\'-ber','from דָבַר (in its original sense); a pasture (from its arrangement of the flock); fold, manner.'),
	('H1700','דִּבְרָה','dibrâh','dib-raw\'','feminine of דָּבָר; a reason, suit or style; cause, end, estate, order, regard.'),
	('H1701','דִּבְרָה','dibrâh','dib-raw\'','(Aramaic) corresponding to דִּבְרָה; {a reason, suit or style}; intent, sake.'),
	('H1702','דֹּבְרָה','dôbᵉrâh','do-ber-aw\'','feminine active participle of דָבַר in the sense of driving (compare דֹּבֶר); a raft; float.'),
	('H1703','דַּבָּרָה','dabbârâh','dab-baw-raw\'','intensive from דָבַר; a word; word.'),
	('H1704','דִּבְרִי','Dibrîy','dib-ree\'','from דָּבָר; wordy; Dibri, an Israelite; Dibri.'),
	('H1705','דֲּבְרַת','Dăbrath','daw-ber-ath\'','from דָּבָר (perhaps in the sense of דֹּבֶר); Daberath, a place in Palestine; Dabareh, Daberath.'),
	('H1706','דְּבַשׁ','dᵉbash','deb-ash\'','from an unused root meaning to be gummy; honey (from its stickiness); by analogy, syrup; honey(-comb).'),
	('H1707','דַּבֶּשֶׁת','dabbesheth','dab-beh\'-sheth','intensive from the same as דְּבַשׁ; a sticky mass, i.e. the hump of acamel; hunch (of a camel).'),
	('H1708','דַּבֶּשֶׁת','Dabbesheth','dab-beh\'-sheth','the same as דַּבֶּשֶׁת; Dabbesheth, a place in Palestine; Dabbesheth.'),
	('H1709','דָּג','dâg','dawg','or (fully) דָּאג; (Nehemiah 13:16), from דָּגָה; a fish (as prolific); or perhaps rather from דָּאַג (as timid); but still better from דָּאַג (in the sense of squirming, i.e. moving by the vibratory action of the tail); a fish (often used collectively); fish.'),
	('H1710','דָּגָה','dâgâh','daw-gaw\'','feminine of דָּג, and meaning the same; {a fish (often used collectively)}; fish.'),
	('H1711','דָּגָה','dâgâh','daw-gaw\'','a primitive root; to move rapidly; used only as a denominative from דָּג; to spawn, i.e. become numerous; grow.'),
	('H1712','דָּגוֹן','Dâgôwn','daw-gohn\'','from דָּג; the fish-god; Dagon, a Philistine deity; Dagon.'),
	('H1713','דָּגַל','dâgal','daw-gal\'','a primitive root; to flaunt, i.e. raise a flag; figuratively, to be conspicuous; (set up, with) banners, chiefest.'),
	('H1714','דֶּגֶל','degel','deh\'-gel','from דָּגַל; a flag; banner, standard.'),
	('H1715','דָּגָן','dâgân','daw-gawn\'','from דָּגָה; properly, increase, i.e. grain; corn (floor), wheat.'),
	('H1716','דָּגַר','dâgar','daw-gar\'','a primitive root,; to brood over eggs or young; gather, sit.'),
	('H1717','דַּד','dad','dad','apparently from the same as דּוֹד; the breast (as the seat of love, or from its shape); breast, teat.'),
	('H1718','דָּדָה','dâdâh','daw-daw\'','a doubtful root; to walk gently; go (softly, with).'),
	('H1719','דְּדָן','Dᵉdân','ded-awn\'','or (prolonged) דְּדָנֶה; (Ezekiel 25:13), of uncertain derivation; Dedan, the name of two Cushites and of their territory; Dedan.'),
	('H1720','דְּדָנִים','Dᵉdânîym','ded-aw-neem\'','plural of דְּדָן (as patrial); Dedanites, the descendants or inhabitants of Dedan; Dedanim.'),
	('H1721','דֹּדָנִים','Dôdânîym','do-daw-neem\'','or (by orthographical error) רֹדָנִים (1 Chronicles 1:7); a plural of uncertain derivation; Dodanites, or descendants of a son of Javan; Dodanim.'),
	('H1722','דְּהַב','dᵉhab','deh-hab\'','(Aramaic) corresponding to זָהָב; gold; gold(-en).'),
	('H1723','דַּהֲוָא','Dahăvâʼ','dah-hav-aw\'','(Aramaic) of uncertain derivation; Dahava, a people colonized in Samaria; Dehavites.'),
	('H1724','דָּהַם','dâham','daw-ham\'','a primitive root (compare דּוּחַ); to be dumb, i.e. (figuratively) dumbfounded; astonished.'),
	('H1725','דָּהַר','dâhar','daw-har\'','a primitive root; to curvet or move irregularly; pause.'),
	('H1726','דַּהֲהַר','dahăhar','dah-hah-har\'','by reduplication from דָּהַר; a gallop; pransing.'),
	('H1727','דּוּב','dûwb','doob','a primitive root; to mope, i.e. (figuratively) pine; sorrow.'),
	('H1728','דַּוָּג','davvâg','dav-vawg\'','an orthographical variation of דָּג as a denominative (דַּיָּג); a fisherman; fisher.'),
	('H1729','דּוּגָה','dûwgâh','doo-gaw\'','feminine from the same as דַּוָּג; properly, fishery, i.e. a hook forfishing; fish (hook).'),
	('H1730','דּוֹד','dôwd','dode','or (shortened) דֹּד; from an unused root meaning properly, to boil, i.e.; (figuratively) to love; by implication, a love-token, lover, friend; specifically an uncle; (well-) beloved, father\'s brother, love, uncle.'),
	('H1731','דּוּד','dûwd','dood','from the same as דּוֹד; a pot (for boiling); also (by resemblance of shape) a basket; basket, caldron, kettle, (seething) pot.'),
	('H1732','דָּוִד','Dâvid','daw-veed\'','rarely (fully); דָּוִיד; from the same as דּוֹד; loving; David, the youngest son of Jesse; David.'),
	('H1733','דּוֹדָה','dôwdâh','do-daw\'','feminine of דּוֹד; an aunt; aunt, father\'s sister, uncle\'s wife.'),
	('H1734','דּוֹדוֹ','Dôwdôw','do-do\'','from דּוֹד; loving; Dodo, the name of three Israelites; Dodo.'),
	('H1735','דּוֹדָוָהוּ','Dôwdâvâhûw','do-daw-vaw\'-hoo','from דּוֹד and יָהּ; love of Jah; Dodavah, an Israelite; Dodavah.'),
	('H1736','דּוּדַי','dûwday','doo-dah\'-ee','from דּוּד; a boiler or basket; also the mandrake (as an aphrodisiac); basket, mandrake.'),
	('H1737','דּוֹדַי','Dôwday','do-dah\'ee','formed like דּוּדַי; amatory; Dodai, an Israelite; Dodai.'),
	('H1738','דָּוָה','dâvâh','daw-vaw\'','a primitive root; to be sick (as if in menstruation); infirmity.'),
	('H1739','דָּוֶה','dâveh','daw-veh\'','from דָּוָה; sick (especially in menstruation); faint, menstruous cloth, she that is sick, having sickness.'),
	('H1740','דּוּחַ','dûwach','doo\'-akh','a primitive root; to thrust away; figuratively, to cleanse; cast out, purge, wash.'),
	('H1741','דְּוַי','dᵉvay','dev-ah\'ee','from דָּוֶה; sickness; figuratively, loathing; languishing, sorrowful.'),
	('H1742','דַּוָּי','davvây','dav-voy\'','from דָּוֶה; sick; figuratively, troubled; faint.');
