	('H1745','דּוּמָה','dûwmâh','doo-maw\'','from an unused root meaning to be dumb (compare דָּמָה); silence; figuratively, death; silence.'),
	('H1746','דּוּמָה','Dûwmâh','doo-maw\'','the same as דּוּמָה; Dumah, a tribe and region of Arabia; Dumah.'),
	('H1747','דּוּמִיָּה','dûwmîyâh','doo-me-yaw\'','from דָּמָה; stillness; adverbially, silently; abstractly quiet, trust; silence, silent, waiteth.'),
	('H1748','דּוּמָם','dûwmâm','doo-mawm\'','from דָּמַם; still; adverbially, silently; dumb, silent, quietly wait.'),
