	('H1750','דּוּץ','dûwts','doots','a primitive root; to leap; be turned.'),
	('H1751','דּוּק','dûwq','dook','(Aramaic) corresponding to דָּקַק; to crumble; be broken to pieces.'),
	('H1752','דּוּר','dûwr','dure','a primitive root; properly, to gyrate (or move in a circle), i.e. to remain; dwell.'),
	('H1753','דּוּר','dûwr','dure','(Aramaic) corresponding to דּוּר; to reside; dwell.'),
	('H1754','דּוּר','dûwr','dure','from דּוּר; a circle, ball or pile; ball, turn, round about.'),
	('H1755','דּוֹר','dôwr','dore','or (shortened) דֹּר; from דּוּר; properly, a revolution of time, i.e. an age or generation; also a dwelling; age, [idiom] evermore, generation, (n-) ever, posterity.'),
	('H1756','דּוֹר','Dôwr','dore','or (by permutation) דֹּאר; (Joshua 17:11; 1 Kings 4:11), from דּוֹר; dwelling; Dor, a place in Palestine; Dor.'),
	('H1757','דּוּרָא','Dûwrâʼ','doo-raw\'','(Aramaic) probably from דּוּר; circle or dwelling; Dura, a place in Babylonia; Dura.'),
	('H1758','דּוּשׁ','dûwsh','doosh','or דּוֹשׁ; or דִּישׁ; a primitive root; to trample or thresh; break, tear, thresh, tread out (down), at grass (Jeremiah 50:11, by mistake for דֶּשֶׁא).'),
	('H1759','דּוּשׁ','dûwsh','doosh','(Aramaic) corresponding to דּוּשׁ; to trample; tread down.'),
	('H1760','דָּחָה','dâchâh','daw-khaw\'','or דָּחַח; (Jeremiah 23:12), a primitive root; to push down; chase, drive away (on), overthrow, outcast, [idiom] sore, thrust, totter.'),
	('H1761','דַּחֲוָה','dachăvâh','dakh-av-aw\'','(Aramaic) from the equivalent of דָּחָה; probably a musical instrument (as being struck); instrument of music.'),
	('H1762','דְּחִי','dᵉchîy','deh-khee\'','from דָּחָה; a push, i.e. (by implication) a fall; falling.'),
	('H1763','דְּחַל','dᵉchal','deh-khal\'','(Aramaic) corresponding to זָחַל; to slink, i.e. (by implication) to fear, or (causatively) be formidable; make afraid, dreadful, fear, terrible.'),
	('H1764','דֹּחַן','dôchan','do\'-khan','of uncertain derivation; millet; millet.'),
	('H1765','דָּחַף','dâchaph','daw-khaf\'','a primitive root; to urge, i.e. hasten; (be) haste(-ned), pressed on.'),
	('H1766','דָּחַק','dâchaq','daw-khak\'','a primitive root; to press, i.e. oppress; thrust, vex.'),
	('H1767','דַּי','day','dahee','of uncertain derivation; enough (as noun or adverb), used chiefly with preposition in phrases; able, according to, after (ability), among, as (oft as), (more than) enough, from, in, since, (much as is) sufficient(-ly), too much, very, when.'),
	('H1768','דִּי','dîy','dee','(Aramaic) apparently for דָּא; that, used as relative conjunction, and especially (with a preposition) in adverbial phrases; also as preposition of; [idiom] as, but, for(-asmuch [phrase]), [phrase] now, of, seeing, than, that, therefore, until, [phrase] what (-soever), when, which, whom, whose.'),
