	('H2623','חָסִיד','châçîyd','khaw-seed\'','from חָסַד; properly, kind, i.e. (religiously) pious (a saint); godly (man), good, holy (one), merciful, saint, (un-) godly.'),
	('H2624','חֲסִידָה','chăçîydâh','khas-ee-daw\'','feminine of חָסִיד; the kind (maternal) bird, i.e. a stork; [idiom] feather, stork.'),
	('H2625','חָסִיל','châçîyl','khaw-seel\'','from חָסַל; the ravager, i.e. a locust; caterpillar.'),
	('H2626','חֲסִין','chăçîyn','khas-een\'','from חָסַן; properly, firm, i.e. (by implication) mighty; strong.'),
	('H2627','חַסִּיר','chaççîyr','khas-seer\'','(Aramaic) from a root corresponding to חָסֵר; deficient; wanting.'),
	('H2628','חָסַל','châçal','khaw-sal\'','a primitive root; to eat off; consume.'),
	('H2629','חָסַם','châçam','khaw-sam\'','a primitive root; to muzzle; by analogy, to stop the nose; muzzle, stop.'),
	('H2630','חָסַן','châçan','khaw-san\'','a primitive root; properly, to (be) compact; by implication, to hoard; lay up.'),
	('H2631','חֲסַן','chăçan','khas-an\'','(Aramaic) corresponding to חָסַן; to hold in occupancy; possess.'),
	('H2632','חֵסֶן','chêçen','khay\'-sen','(Aramaic) from חֲסַן; strength; power.'),
	('H2633','חֹסֶן','chôçen','kho\'-sen','from חָסַן; wealth; riches, strength, treasure.'),
	('H2634','חָסֹן','châçôn','khaw-sone\'','from חָסַן; powerful; strong.'),
	('H2635','חֲסַף','chăçaph','khas-af\'','(Aramaic) from a root corresponding to that of חַסְפַּס; a clod; clay.'),
	('H2636','חַסְפַּס','chaçpaç','khas-pas\'','reduplicated from an unused root meaning apparently to peel; a shred or scale; round thing.'),
	('H2637','חָסֵר','châçêr','khaw-sare\'','a primitive root; to lack; by implication, to fail, want, lessen; be abated, bereave, decrease, (cause to) fail, (have) lack, make lower, want.'),
	('H2638','חָסֵר','châçêr','khaw-sare\'','from חָסֵר; lacking; hence, without; destitute, fail, lack, have need, void, want.'),
	('H2639','חֶסֶר','cheçer','kheh\'-ler','from חָסֵר; lack; hence, destitution; poverty, want.'),
	('H2640','חֹסֶר','chôçer','kho\'-ser','from חָסֵר; poverty; in want of.'),
	('H2641','חַסְרָה','Chaçrâh','khas-raw\'','from חָסֵר; want; Chasrah, an Israelite; Hasrah.'),
	('H2642','חֶסְרוֹן','cheçrôwn','khes-rone\'','from חָסֵר; deficiency; wanting.'),
	('H2643','חַף','chaph','khaf','from חׇפַף (in the moral sense of covered from soil); pure; innocent.'),
	('H2644','חָפָא','châphâʼ','khaw-faw\'','an orthographical variation of חָפָה; properly, to cover, i.e. (in a sinister sense) to act covertly; do secretly.'),
	('H2645','חָפָה','châphâh','khaw-faw\'','a primitive root (compare חָפָא, חׇפַף); to cover; by implication, to veil, to encase, protect; ceil, cover, overlay.'),
	('H2646','חֻפָּה','chuppâh','khoop-paw\'','from חָפָה; a canopy; chamber, closet, defence.'),
	('H2647','חֻפָּה','Chuppâh','khoop-paw\'','the same as חֻפָּה; Chuppah, an Israelite; Huppah.'),
	('H2648','חָפַז','châphaz','khaw-faz\'','a primitive root; properly, to start up suddenly, i.e. (by implication) to hasten away, to fear; (make) haste (away), tremble.'),
	('H2649','חִפָּזוֹן','chippâzôwn','khip-paw-zone\'','from חֻלְדָּה; hasty flight; haste.'),
	('H2650','חֻפִּים','Chuppîym','khoop-peem\'','plural of חֻפָּה (compare חוּפָם); Chuppim, an Israelite; Huppim.'),
	('H2651','חֹפֶן','chôphen','kho\'-fen','from an unused root of uncertain signification; a fist (only in the dual); fists, (both) hands, hand(-ful).'),
	('H2652','חׇפְנִי','Chophnîy','khof-nee\'','from חֹפֶן; perhaps pugilist; Chophni, an Israelite; Hophni.'),
	('H2653','חׇפַף','chophaph','khaw-faf\'','a primitive root (compare חָפָה, יָחֵף); to cover (in protection); cover.'),
	('H2654','חָפֵץ','châphêts','khaw-fates\'','a primitive root; properly, to incline to; by implication (literally but rarely) to bend; figuratively, to be pleased with, desire; [idiom] any at all, (have, take) delight, desire, favour, like, move, be (well) pleased, have pleasure, will, would.'),
	('H2655','חָפֵץ','châphêts','khaw-fates\'','from חָפֵץ; pleased with; delight in, desire, favour, please, have pleasure, whosoever would, willing, wish.'),
	('H2656','חֵפֶץ','chêphets','khay\'-fets','from חָפֵץ; pleasure; hence (abstractly) desire; concretely, a valuable thing; hence (by extension) a matter (as something in mind); acceptable, delight(-some), desire, things desired, matter, pleasant(-ure), purpose, willingly.'),
	('H2657','חֶפְצִי בָּהּ','Chephtsîy bâhh','khef-tsee\'baw','from חֵפֶץ with suffixes; my delight (is) in her; Cheptsi-bah, a fanciful name for Palestine; Hephzi-bah.'),
	('H2658','חָפַר','châphar','khaw-far\'','a primitive root; properly, to pry into; by implication, to delve, to explore; dig, paw, search out, seek.'),
	('H2659','חָפֵר','châphêr','khaw-fare\'','a primitive root (perhaps rather the same as חָפַר through the idea of detection); to blush; figuratively, to be ashamed, disappointed; causatively, to shame, reproach; be ashamed, be confounded, be brought to confusion (unto shame), come (be put to) shame, bring reproach.'),
	('H2660','חֵפֶר','Chêpher','khay\'-fer','from חָפַר or חָפֵר; a pit of shame; Chepher, a place in Palestine; also the name of three Israelites; Hepher.'),
	('H2661','חֲפֹר','chăphôr','khaf-ore\'','from חָפַר; a hole; only in connection with פֵּרָה, which ought rather to be joined as one word, thus חַפַרְפֵּרָה; by reduplication from חָפַר; a burrower, i.e. probably a rat; [phrase] mole.'),
	('H2662','חֶפְרִי','Chephrîy','khef-ree\'','patronymically from חֵפֶר; a Chephrite (collectively) or descendants of Chepher; Hepherites.'),
	('H2663','חֲפָרַיִם','Chăphârayim','khaf-aw-rah\'-yim','dual of חֵפֶר; double pit; Chapharajim, a place in Palestine; Haphraim.'),
	('H2664','חָפַשׂ','châphas','khaw-fas\'','a primitive root; to seek; causatively, to conceal oneself (i.e. let be sought), or mask; change, (make) diligent (search), disquise self, hide, search (for, out).'),
	('H2665','חֵפֶשׂ','chêphes','khay\'-fes','from חָפַשׂ; something covert, i.e. a trick; search.'),
	('H2666','חָפַשׁ','châphash','khaw-fash\'','a primitive root; to spread loose; figuratively, to manumit; be free.'),
	('H2667','חֹפֶשׁ','Chôphesh','kho\'-fesh','from חָפַשׁ; something spread loosely, i.e. a carpet; precious.'),
	('H2668','חֻפְשָׁה','chuphshâh','khoof-shaw\'','from חָפַשׁ; liberty (from slavery); freedom.'),
	('H2669','חׇפְשׁוּת','chophshûwth','khof-shooth\'','and חׇפְשִׁית; from חָפַשׁ; (with בַּיִת, a hospital); prostration by sickness; several.'),
	('H2670','חׇפְשִׁי','chophshîy','khof-shee\'','from חָפַשׁ; exempt (from bondage, tax or care); free, liberty.'),
	('H2671','חֵץ','chêts','khayts','from חָצַץ; also by interchange for עֵץ; properly, a piercer, i.e. an arrow; by implication, a wound; figuratively, (of God) thunderbolt; the shaft of aspear; [phrase] archer, arrow, dart, shaft, staff, wound.'),
	('H2672','חָצַב','châtsab','khaw-tsab\'','or חָצֵב; a primitive root; to cut or carve (wood, stone or other material); by implication, to hew, split, square, quarry, engrave; cut, dig, divide, grave, hew (out, -er), made, mason.'),
	('H2673','חָצָה','châtsâh','khaw-tsaw\'','lemma חָעָה ayin, corrected to חָצָה; a primitive root (compare זֵד)); to cut or split in two; to halve; divide, [idiom] live out half, reach to the midst, participle'),
	('H2674','חָצוֹר','Châtsôwr','khaw-tsore\'','a collective form of חָצֵר; village; Chatsor, the name (thus simply) of two places in Palestine and of one in Arabia; Hazor.'),
	('H2675','חָצוֹר חֲדַתָּה','Châtsôwr Chădattâh','khaw-tsore\' khad-attaw\'','from חָצוֹר and a Aramaizing form of the feminine of חָדָשׁ (compare חֲדָת); new Chatsor, a place in Palestine; Hazor, Hadattah (as if two places).'),
	('H2676','חָצוֹת','châtsôwth','khaw-tsoth\'','lemma חָעוֹת ayin, corrected to חָצוֹת; from חָצָהlemma חָעָה ayin, corrected to חָצָה; the middle (of the night); mid(-night).'),
	('H2677','חֵצִי','chêtsîy','khay-tsee\'','from חָצָהlemma חָעָה ayin, corrected to חָצָה; the half or middle; half, middle, mid(-night), midst, part, two parts.'),
	('H2678','חִצִּי','chitstsîy','khits-tsee\'','or חֵצִי; prolongation from חֵץ; an arrow; arrow.'),
	('H2679','חֲצִי הַמְּנֻחוֹת','Chătsîy ham-Mᵉnuchôwth','chat-tsee\' hammen-oo-khoth\'','from חֵצִי and the plural of מְנוּחָה, with the article interposed; midst of the resting-places; Chatsi-ham-Menuchoth, an Israelite; half of the Manahethites.'),
	('H2680','חֲצִי הַמְּנַחְתִּי','Chătsîy ham-Mᵉnachtîy','khat-see\' ham-menakh-tee\'','patronymically from חֲצִי הַמְּנֻחוֹת; a Chatsi-ham-Menachtite or descendant of Chatsi-ham-Menuchoth; half of the Manahethites.'),
	('H2681','חָצִיר','châtsîyr','khaw-tseer\'','a collateral form of חָצֵר; a court or abode; court.'),
	('H2682','חָצִיר','châtsîyr','khaw-tseer\'','perhaps originally the same as חָצִיר, from the greenness of a courtyard; grass; also a leek (collectively); grass, hay, herb, leek.'),
	('H2683','חֵצֶן','chêtsen','khay\'-tsen','from an unused root meaning to hold firmly; the bosom (as comprised between the arms); bosom.'),
	('H2684','חֹצֶן','chôtsen','kho\'tsen','a collateral form of חֵצֶן, and meaning the same; {the bosom (as comprised between the arms)}; arm, lap.'),
	('H2685','חֲצַף','chătsaph','khats-af\'','(Aramaic) a primitive root; properly, to shear or cut close; figuratively, to be severe; hasty, be urgent.'),
	('H2686','חָצַץ','châtsats','khaw-tsats\'','a primitive root (compare חָצָהlemma חָעָה ayin, corrected to חָצָה); also as denominative from חֵץ; properly, to chop into, pierce or sever; hence, to curtail, to distribute (into ranks);  to shoot an arrow; archer, [idiom] bands, cut off in the midst.'),
	('H2687','חָצָץ','châtsâts','khaw-tsawts\'','from חָצָץ;  also like חֵץ; properly, something cutting; hence, gravel (as grit); an arrow; arrow, gravel (stone).'),
	('H2688','חַצְצוֹן תָּמָר','Chatsᵉtsôwn Tâmâr','khats-ets-one\' taw-mawr\'','or חַצֲצֹן תָּמָר; from חָצַץ and תָּמָר; division (i.e. perhaps row) of (the) palm-tree; Chatsetson-tamar, a place in Palestine; Hazezon-tamar.'),
	('H2689','חֲצֹצְרָה','chătsôtsᵉrâh','khats-o-tser-aw\'','by reduplication from חָצַר; a trumpet (from its sundered or quavering note); trumpet(-er).'),
	('H2690','חָצַר','châtsar','khaw-tsar\'','a primitive root; properly, to surround with a stockade, and thus separate from the open country; but used only in the reduplicated form חֲצֹצֵר; or (2 Chronicles 5:12) חֲצֹרֵר; as dem. from חֲצֹצְרָה; to trumpet, i.e. blow on that instrument; blow, sound, trumpeter.'),
	('H2691','חָצֵר','châtsêr','khaw-tsare\'','(masculine and feminine); from חָצַר in its original sense; a yard (as inclosed by a fence); also a hamlet (as similarly surrounded with walls); court, tower, village.'),
	('H2692','חֲצַר אַדָּר','Chătsar ʼAddâr','khats-ar\' addawr\'','xlit Addâr corrected to ʼAddâr; from חָצֵר and אַדָּר; (the) village of Addar; Chatsar-Addar, a place in Palestine; Hazar-addar.'),
	('H2693','חֲצַר גַּדָּה','Chătsar Gaddâh','khats-ar\' gad-daw\'','from חָצֵר and a feminine of גַּד; (the) village of (female) Fortune; Chatsar-Gaddah, a place in Palestine; Hazar-gaddah.'),
	('H2694','חֲצַר הַתִּיכוֹן','Chătsar hat-Tîykôwn','khats-ar\' hat-tee-kone\'','from חָצֵר and תִּיכוֹן with the article interposed; village of the middle; Chatsar-hat-Tikon, a place in Palestine; Hazar-hatticon.'),
	('H2695','חֶצְרוֹ','Chetsrôw','khets-ro\'','by an orthographical variation for חֶצְרוֹן; enclosure; Chetsro, an Israelite; Hezro, Hezrai.'),
	('H2696','חֶצְרוֹן','Chetsrôwn','khets-rone\'','from חָצֵר; court-yard; Chetsron, the name of a place in Palestine; also of two Israelites; Hezron.'),
	('H2697','חֶצְרוֹנִי','Chetsrôwnîy','khets-ro-nee\'','patronymically from חֶצְרוֹן; a Chetsronite or (collectively) descendants of Chetsron; Hezronites.'),
	('H2698','חֲצֵרוֹת','Chătsêrôwth','khats-ay-roth\'','feminine plural of חָצֵר; yards; Chatseroth, a place in Palestine; Hazeroth.'),
	('H2699','חֲצֵרִים','Chătsêrîym','khats-ay-reem\'','plural masculine of חָצֵר; yards; Chatserim, a place in Palestine; Hazerim.'),
	('H2700','חֲצַרְמָוֶת','Chătsarmâveth','khats-ar-maw\'-veth','from חָצֵר and מָוֶת; village of death; Chatsarmaveth, a place in Arabia; Hazarmaveth.'),
	('H2701','חֲצַר סוּסָה','Chătsar Çûwçâh','khats-ar\'soo-saw\'','from חָצֵר and סוּסָה; village of cavalry; Chatsar-Susah, a place in Palestine; Hazar-susah.'),
	('H2702','חֲצַר סוּסִים','Chătsar Çûwçîym','khats-ar\' soo-seem\'','from חָצֵר and the plural of סוּס; village of horses; Chatsar-Susim, a place in Palestine; Hazar-susim.'),
	('H2703','חֲצַר עֵינוֹן','Chătsar ʻÊynôwn','khats-ar\' ay-none\'','from חָצֵר and a derivative of עַיִן; village of springs; Chatsar-Enon, a place in Palestine; Hazar-enon.'),
	('H2704','חֲצַר עֵינָן','Chătsar ʻÊynân','khats-ar\' ay-nawn\'','from חָצֵר and the same as עֵינָן; village of springs; Chatsar-Enan, a place in Palestine; Hazar-enan.'),
	('H2705','חֲצַר שׁוּעָל','Chătsar Shûwʻâl','khats-ar\' shoo-awl\'','from חָצֵר and שׁוּעָל; village of (the) fox; Chatsar-Shual, a place in Palestine; Hazar-shual.'),
	('H2706','חֹק','chôq','khoke','from חָקַק; an enactment; hence, an appointment (of time, space, quantity, labor or usage); appointed, bound, commandment, convenient, custom, decree(-d), due, law, measure, [idiom] necessary, ordinance(-nary), portion, set time, statute, task.'),
	('H2707','חָקָה','châqâh','khaw-kaw\'','a primitive root; to carve; by implication, to delineate; also to entrench; carved work, portrayed, set a print.'),
	('H2708','חֻקָּה','chuqqâh','khook-kaw\'','feminine of חֹק, and meaning substantially the same; {an enactment; hence, an appointment (of time, space, quantity, labor or usage)}; appointed, custom, manner, ordinance, site, statute.'),
	('H2709','חֲקוּפָא','Chăqûwphâʼ','khah-oo-faw\'','from an unused root probably meaning to bend; crooked; Chakupha, one of the Nethinim; Hakupha.'),
	('H2710','חָקַק','châqaq','khaw-kak\'','a primitive root; properly, to hack, i.e. engrave (Judges 5:14, to be a scribe simply); by implication, to enact (laws being cut in stone or metal tablets in primitive times) or (gen.) prescribe; appoint, decree, governor, grave, lawgiver, note, pourtray, print, set.'),
	('H2711','חֵקֶק','chêqeq','khay\'-kek','from חָקַק; an enactment, a resolution; decree, thought.'),
	('H2712','חֻקֹּק','Chuqqôq','Khook-koke\'','or (fully) חוּקֹק; from חָקַק; appointed; Chukkok or Chukok, a place in Palestine; Hukkok, Hukok.'),
	('H2713','חָקַר','châqar','khaw-kar\'','a primitive root; properly, to penetrate; hence, to examine intimately; find out, (make) search (out), seek (out), sound, try.'),
	('H2714','חֵקֶר','chêqer','khay\'-ker','from חָקַר; examination, enumeration, deliberation; finding out, number, (un-) search(-able, -ed, out, -ing).'),
	('H2715','חֹר','chôr','khore','or (fully) חוֹר; from חָרַר; (compare חֹרִי); properly, white or pure (from the cleansing or shining power of fire; hence (figuratively) noble (in rank); noble.'),
	('H2716','חֶרֶא','chereʼ','kheh\'-reh','from an unused (and vulgar) root probably meaning to evacuate the bowels; excrement; dung. Also חֲרִי.'),
	('H2717','חָרַב','chârab','khaw-rab\'','or חֲרֵב; a primitive root; to parch (through drought) i.e. (by analogy,) to desolate, destroy, kill; decay, (be) desolate, destroy(-er), (be) dry (up), slay, [idiom] surely, (lay, lie, make) waste.'),
	('H2718','חֲרַב','chărab','khar-ab\'','(Aramaic) a root corresponding to חָרַב; to demolish; destroy.'),
	('H2719','חֶרֶב','chereb','kheh\'-reb','from חָרַב; drought; also a cutting instrument (from its destructive effect), as a knife, sword, or other sharp implement; axe, dagger, knife, mattock, sword, tool.'),
	('H2720','חָרֵב','chârêb','khaw-rabe\'','from חָרַב; parched or ruined; desolate, dry, waste.'),
	('H2721','חֹרֶב','chôreb','kho\'-reb','a collaterally form of חֶרֶב; drought or desolation; desolation, drought, dry, heat, [idiom] utterly, waste.'),
	('H2722','חֹרֵב','Chôrêb','kho-rabe\'','from חָרַב; desolate; Choreb, a (generic) name for the Sinaitic mountains; Horeb.'),
	('H2723','חׇרְבָּה','chorbâh','khor-baw\'','feminine of חֹרֶב; properly, drought, i.e. (by implication) a desolation; decayed place, desolate (place, -tion), destruction, (laid) waste (place).'),
	('H2724','חָרָבָה','chârâbâh','khaw-raw-baw\'','feminine of חָרֵב; a desert; dry (ground, land).'),
	('H2725','חֲרָבוֹן','chărâbôwn','khar-aw-bone\'','from חָרַב; parching heat; drought.'),
	('H2726','חַרְבוֹנָא','Charbôwnâʼ','khar-bo-naw\'','or חַרְבוֹנָה; of Persian origin; Charbona or Charbonah, a eunuch of Xerxes; Harbona, Harbonah.'),
	('H2727','חָרַג','chârag','khaw-rag\'','a primitive root; properly, to leap suddenly, i.e. (by implication) to be dismayed; be afraid.'),
	('H2728','חָרְגֹּל','chârᵉgôl','khar-gole\'','from חָרַג; the leaping insect, i.e. a locust; beetle.'),
	('H2729','חָרַד','chârad','khaw-rad\'','a primitive root; to shudder with terror; hence, to fear; also to hasten (with anxiety); be (make) afraid, be careful, discomfit, fray (away), quake, tremble.'),
	('H2730','חָרֵד','chârêd','khaw-rade\'','from חָרַד; fearful; also reverential; afraid, trembling.'),
	('H2731','חֲרָדָה','chărâdâh','khar-aw-daw\'','feminine of חָרֵד; fear, anxiety; care, [idiom] exceedingly, fear, quaking, trembling.'),
	('H2732','חֲרָדָה','Chărâdâh','khar-aw-daw\'','the same as חֲרָדָה; Charadah, a place in the Desert; Haradah.'),
	('H2733','חֲרֹדִי','Chărôdîy','khar-o-dee\'','patrial from a derivative of חָרַד (compare עֵין חֲרֹד); a Charodite, or inhabitant of Charod; Harodite.'),
	('H2734','חָרָה','chârâh','khaw-raw\'','a primitive root (compare חָרַר); to glow or grow warm; figuratively (usually) to blaze up, of anger, zeal, jealousy; be angry, burn, be displeased, [idiom] earnestly, fret self, grieve, be (wax) hot, be incensed, kindle, [idiom] very, be wroth. See תַּחָרָה.'),
	('H2735','חֹר הַגִּדְגָּד','Chôr hag-Gidgâd','khore hag-ghid-gawd\'','from חוֹר and a collateral (masculine) form of גֻּדְגֹּדָה, with the article interposed; hole of the cleft; Chor-hag-Gidgad, a place in the Desert; Hor-hagidgad.'),
	('H2736','חַרְהֲיָה','Charhăyâh','khar-hah-yaw\'','; from חָרָה and יָהּ; fearing Jah; Charhajah, an Israelite; Harhaiah.'),
	('H2737','חָרוּז','chârûwz','khaw-rooz\'','from an unused root meaning to perforate; properly, pierced, i.e. a bead of pearl, gems or jewels (as strung); chain.'),
	('H2738','חָרוּל','chârûwl','khaw-rool\'','or (shortened) חָרֻל; apparently, a passive participle of an unused root probably meaning to be prickly; properly, pointed, i.e. a bramble or other thorny weed; nettle.'),
	('H2739','חֲרוּמַף','chărûwmaph','khar-oo-maf\'','from passive participle of חָרַם and אַף; snub-nosed; Charumaph, an Israelite; Harumaph.'),
	('H2740','חָרוֹן','chârôwn','khaw-rone\'','or (shortened) חָרֹן; from חָרָה; a burning of anger; sore displeasure, fierce(-ness), fury, (fierce) wrath(-ful).'),
	('H2741','חֲרוּפִי','Chărûwphîy','khar-oo-fee\'','a patrial from (probably) a collateral form of חָרִיף; a Charuphite or inhabitant of Charuph (or Chariph); Haruphite.'),
	('H2742','חֲרוּץ','chărûwts','khaw-roots\'','or חָרֻץ; passive participle of חָרַץ; properly, incised or (active) incisive; hence (as noun masculine or feminine) a trench (as dug), gold (as mined), a threshing-sledge (having sharp teeth); (figuratively) determination; also eager; decision, diligent, (fine) gold, pointed things, sharp, threshing instrument, wall.'),
	('H2743','חָרוּץ','Chârûwts','khaw-roots\'','the same as חֲרוּץ; earnest; Charuts, an Israelite; Haruz.'),
	('H2744','חַרְחוּר','Charchûwr','khar-khoor\'','a fuller form of חַרְחֻר; inflammation; Charchur, one of the Nethinim; Harhur.'),
	('H2745','חַרְחַס','Charchaç','khar-khas\'','from the same as חֶרֶס; perhaps shining; Charchas, an Israelite; Harhas.'),
	('H2746','חַרְחֻר','charchur','khar-khoor\'','from חָרַר; fever (as hot); extreme burning.'),
	('H2747','חֶרֶט','chereṭ','kheh\'-ret','from a primitive root meaning to engrave; a chisel or graver; also a style forwriting; graving tool, pen.'),
	('H2748','חַרְטֹם','charṭôm','khar-tome\'','from the same as חֶרֶט; a horoscopist (as drawing magical lines or circles); magician.'),
	('H2749','חַרְטֹם','charṭôm','khar-tome\'','(Aramaic) the same as חַרְטֹם; {a horoscopist (as drawing magical lines or circles)}; magician.'),
	('H2750','חֳרִי','chŏrîy','khor-ee\'','from חָרָה; a burning (i.e. intense) anger; fierce, [idiom] great, heat.'),
	('H2751','חֹרִי','chôrîy','kho-ree\'','from the same as חוּר; white bread; white.'),
	('H2752','חֹרִי','Chôrîy','kho-ree\'','from חוֹר; cave-dweller or troglodyte; a Chorite or aboriginal Idumaean; Horims, Horites.'),
	('H2753','חֹרִי','Chôrîy','kho-ree\'','or חוֹרִי; the same as חֹרִי; Chori, the name of two men; Hori.'),
	('H2754','חָרִיט','chârîyṭ','khaw-reet\'','or חָרִט; from the same as חֶרֶט; properly, cut out (or hollow), i.e. (by implication) a pocket; bag, crisping pin.'),
	('H2755','חֲרֵי־יוֹנִים','chărêy-yôwnîym','khar-ay\'-yo-neem\'','from the plural of חֶרֶא and the plural of יוֹנָה; or perhaps rather the plural of a single word חֲרָאיוֹן, probably a kind of vegetable; excrements of doves {or a vegetable}; doves\' dung.'),
	('H2756','חָרִיף','Chârîyph','khaw-reef\'','from חָרַף; autumnal; Chariph, the name of two Israelites; Hariph.'),
	('H2757','חָרִיץ','chârîyts','khaw-reets\'','or חֲרִץ; from חָרַץ; (compare חֲרוּץ); properly, incisure or (passively) incised; hence, a threshing-sledge (with sharp teeth); also a slice (as cut); [phrase] cheese, harrow.'),
	('H2758','חָרִישׁ','chârîysh','khaw-reesh\'','from חָרַשׁ; ploughing or its season; earing (time), ground.'),
	('H2759','חֲרִישִׁי','chărîyshîy','khar-ee-shee\'','from חָרַשׁ in the sense of silence; quiet, i.e. sultry (as feminine noun, the sirocco or hot east wind); vehement.'),
	('H2760','חָרַךְ','chârak','khaw-rak\'','a primitive root; to braid (i.e. to entangle or snare) or catch (game) in anet; roast.'),
	('H2761','חֲרַךְ','chărak','khar-ak\'','(Aramaic) a root probably allied to the equivalent of חָרַר; to scorch; singe.'),
	('H2762','חֶרֶךְ','cherek','kheh\'-rek','from חָרַךְ; properly, a net, i.e. (by analogy) lattice; lattice.'),
	('H2763','חָרַם','châram','khaw-ram\'','a primitive root; to seclude; specifically (by a ban) to devote to religious uses (especially destruction); physical and reflexive, to be blunt as to the nose; make accursed, consecrate, (utterly) destroy, devote, forfeit, have a flat nose, utterly (slay, make away).'),
	('H2764','חֵרֶם','chêrem','khay\'-rem','or (Zechariah 14:11) חֶרֶם; from חָרַם; physical (as shutting in) a net (either literally or figuratively); usually a doomed object; abstractly extermination; (ac-) curse(-d, -d thing), dedicated thing, things which should have been utterly destroyed, (appointed to) utter destruction, devoted (thing), net.'),
	('H2765','חֳרֵם','Chŏrêm','khor-ame\'','from חָרַם; devoted; Chorem, a place in Palestine; Horem.'),
	('H2766','חָרִם','Chârim','khaw-reem\'','from חָרַם; snub-nosed; Charim, an Israelite; Harim.'),
	('H2767','חׇרְמָה','Chormâh','khor-maw\'','from חָרַם; devoted; Chormah, a place in Palestine; Hormah.'),
	('H2768','חֶרְמוֹן','Chermôwn','kher-mone\'','from חָרַם; abrupt; Chermon, a mount of Palestine; Hermon.'),
	('H2769','חֶרְמוֹנִים','Chermôwnîym','kher-mo-neem\'','plural of חֶרְמוֹן; Hermons, i.e. its peaks; the Hermonites.'),
	('H2770','חֶרְמֵשׁ','chermêsh','kher-mashe\'','from חָרַם; a sickle (as cutting); sickle.'),
	('H2771','חָרָן','Chârân','kaw-rawn\'','from חָרַר; parched; Charan, the name of a man and also of a place; Haran.'),
	('H2772','חֹרֹנִי','Chôrônîy','kho-ro-nee\'','patrial from חֹרֹנַיִם; a Choronite or inhabitant of Choronaim; Horonite.'),
	('H2773','חֹרֹנַיִם','Chôrônayim','kho-ro-nah\'-yim','dual of a derivative from חוֹר; double cave-town; Choronajim, a place in Moab; Horonaim.'),
	('H2774','חַרְנֶפֶר','Charnepher','khar-neh\'fer','of uncertain derivation; Charnepher, an Israelite; Harnepher.'),
	('H2775','חֶרֶס','chereç','kheh\'-res','or (with a directive enclitic) חַרְסָה; from an unused root meaning to scrape; also perhaps from the mediating idea of חַרְסוּת; the itch; the sun; itch, sun.'),
	('H2776','חֶרֶס','Chereç','kheh\'-res','the same as חֶרֶס; shining; Cheres, a mountain in Palestine; Heres.'),
	('H2777','חַרְסוּת','charçûwth','khar-sooth\'','from חֶרֶס (apparently in the sense of a red tile used for scraping); a potsherd, i.e. (by implication) a pottery; the name of a gate at Jerusalem; east.'),
	('H2778','חָרַף','châraph','khaw-raf\'','a primitive root; also  denominative (from חֹרֶף); to pull off, i.e. (by implication) to expose (as by stripping); specifically, to betroth (as if a surrender); figuratively, to carp at, i.e. defame; to spend the winter; betroth, blaspheme, defy, jeopard, rail, reproach, upbraid.'),
	('H2779','חֹרֶף','chôreph','kho\'-ref','from חָרַף; properly, the crop gathered, i.e. (by implication) the autumn (and winter) season; figuratively, ripeness of age; cold, winter (-house), youth.'),
	('H2780','חָרֵף','Chârêph','khaw-rafe\'','from חָרַף; reproachful; Chareph, an Israelite; Hareph.'),
	('H2781','חֶרְפָּה','cherpâh','kher-paw\'','from חָרַף; contumely, disgrace, the pudenda; rebuke, reproach(-fully), shame.'),
	('H2782','חָרַץ','chârats','khaw-rats\'','a primitive root; properly, to point sharply, i.e. (literally) to wound; figuratively, to be alert, to decide; bestir self, decide, decree, determine, maim, move.'),
	('H2783','חֲרַץ','chărats','khar-ats\'','(Aramaic) from a root corresponding to חָרַץ in the sense of vigor; the loin (as the seat of strength); loin.'),
	('H2784','חַרְצֻבָּה','chartsubbâh','khar-tsoob-baw\'','of uncertain derivation; a fetter; figuratively, a pain; band.'),
	('H2785','חַרְצַן','chartsan','kchar-tsan\'','from חָרַץ; a sour grape (as sharp in taste); kernel.'),
	('H2786','חָרַק','châraq','khaw-rak\'','a primitive root; to grate the teeth; gnash.'),
	('H2787','חָרַר','chârar','khaw-rar\'','a primitive root; to glow, i.e. literally (to melt, burn, dry up) or figuratively (to show or incite passion); be angry, burn, dry, kindle.'),
	('H2788','חָרֵר','chârêr','khaw-rare\'','from חָרַר; arid; parched place.'),
	('H2789','חֶרֶשׂ','cheres','kheh\'-res','a collateral form mediating between חֶרֶס and חֶרֶשׁ; a piece of pottery; earth(-en), (pot-) sherd, [phrase] stone.'),
	('H2790','חָרַשׁ','chârash','khaw-rash\'','a primitive root; to scratch, i.e. (by implication) to engrave, plough; hence (from the use of tools) to fabricate (of any material); figuratively, to devise (in a bad sense); hence (from the idea of secrecy) to be silent, to let alone; hence (by implication) to be deaf (as an accompaniment of dumbness); [idiom] altogether, cease, conceal, be deaf, devise, ear, graven, imagine, leave off speaking, hold peace, plow(-er, man), be quiet, rest, practise secretly, keep silence, be silent, speak not a word, be still, hold tongue, worker.'),
	('H2791','חֶרֶשׁ','cheresh','kheh\'-resh','from חָרַשׁ; magical craft; also silence; cunning, secretly.'),
	('H2792','חֶרֶשׁ','Cheresh','kheh\'-resh','the same as חֶרֶשׁ; Cheresh, a Levite; Heresh.'),
	('H2793','חֹרֶשׁ','chôresh','kho\'-resh','from חָרַשׁ; a forest (perhaps as furnishing the material for fabric); bough, forest, shroud, wood.'),
	('H2794','חֹרֵשׁ','chôrêsh','kho-rashe\'','active participle of חָרַשׁ; a fabricator or mechanic; artificer.'),
	('H2795','חֵרֵשׁ','chêrêsh','khay-rashe\'','from חָרַשׁ; deaf (whether literally or spiritual); deaf.'),
	('H2796','חָרָשׁ','chârâsh','khaw-rawsh\'','from חָרַשׁ; a fabricator or any material; artificer, ([phrase]) carpenter, craftsman, engraver, maker, [phrase] mason, skilful, ([phrase]) smith, worker, workman, such as wrought.'),
	('H2797','חַרְשָׁא','Charshâʼ','khar-shaw\'','from חֶרֶשׁ; magician; Charsha, one of the Nethinim; Harsha.'),
	('H2798','חֲרָשִׁים','Chărâshîym','khar-aw-sheem\'','plural of חָרָשׁ; mechanics, the name of a valley in Jerusalem; Charashim, craftsmen.'),
	('H2799','חֲרֹשֶׁת','chărôsheth','khar-o\'-sheth','from חָרַשׁ; mechanical work; carving, cutting.'),
	('H2800','חֲרֹשֶׁת','Chărôsheth','khar-o\'-sheth','the same as חֲרֹשֶׁת; Charosheth, a place in Palestine; Harosheth.'),
	('H2801','חָרַת','chârath','khaw-rath\'','a primitive root; to engrave; graven.'),
	('H2802','חֶרֶת','Chereth','kheh\'-reth','from חָרַת (but equivalent to חֹרֶשׁ); forest; Chereth, a thicket in Palestine; Hereth.'),
	('H2803','חָשַׁב','châshab','khaw-shab\'','a primitive root; properly, to plait or interpenetrate, i.e. (literally) to weave or (generally) to fabricate; figuratively, to plot or contrive (usually in a malicious sense); hence (from the mental effort) to think, regard, value, compute; (make) account (of), conceive, consider, count, cunning (man, work, workman), devise, esteem, find out, forecast, hold, imagine, impute, invent, be like, mean, purpose, reckon(-ing be made), regard, think.'),
	('H2804','חֲשַׁב','chăshab','khash-ab\'','(Aramaic) corresponding to חָשַׁב; to regard; repute.'),
	('H2805','חֵשֶׁב','chêsheb','khay\'-sheb','from חָשַׁב; a belt or strap (as being interlaced); curious girdle.'),
	('H2806','חַשְׁבַּדָּנָה','Chashbaddânâh','khash-bad-daw\'-naw','from חָשַׁב and דִּין; considerate judge; Chasbaddanah, an Israelite; Hasbadana.'),
	('H2807','חֲשֻׁבָה','Chăshubâh','khash-oo-baw\'','from חָשַׁב; estimation; Cashubah, an Israelite; Hashubah.'),
	('H2808','חֶשְׁבּוֹן','cheshbôwn','khesh-bone\'','from חָשַׁב; properly, contrivance; by implication, intelligence; account, device, reason.'),
	('H2809','חֶשְׁבּוֹן','Cheshbôwn','khesh-bone\'','the same as חֶשְׁבּוֹן; Cheshbon, a place East of the Jordan; Heshbon.'),
	('H2810','חִשָּׁבוֹן','chishshâbôwn','khish-shaw-bone\'','from חָשַׁב; a contrivance, i.e. actual (a warlike machine) or mental (a machination); engine, invention.'),
	('H2811','חֲשַׁבְיָה','Chăshabyâh','khash-ab-yaw\'','or חֲשַׁבְיָהוּ; from חָשַׁב and יָהּ; Jah has regarded; Chashabjah, the name of nine Israelites; Hashabiah.'),
	('H2812','חֲשַׁבְנָה','Chăshabnâh','khash-ab-naw\'','feminine of חֶשְׁבּוֹן; inventiveness; Chashnah, an Israelite; Hashabnah.'),
	('H2813','חֲשַׁבְנְיָה','Chăshabnᵉyâh','khash-ab-neh-yaw\'','from חֶשְׁבּוֹן and יָהּ; thought of Jah; Chashabnejah, the name of two Israelites; Hashabniah.'),
	('H2814','חָשָׁה','châshâh','khaw-shaw\'','a primitive root; to hush or keep quiet; hold peace, keep silence, be silent, (be) still.'),
	('H2815','חַשּׁוּב','Chashshûwb','khash-shoob\'','lemma חַשְּׁוּב extra sheva, corrected to חַשּׁוּב; from חָשַׁב; intelligent; Chashshub, the name of two or three Israelites; Hashub, Hasshub.'),
	('H2816','חֲשׁוֹךְ','chăshôwk','khash-oke\'','(Aramaic) from a root corresponding to חָשַׁךְ; the dark; darkness.'),
	('H2817','חֲשׂוּפָא','Chăsûwphâʼ','khas-oo-faw\'','or חֲשֻׂפָא; from חָשַׂף; nakedness; Chasupha, one of the Nethinim; Hashupha, Hasupha.'),
	('H2818','חֲשַׁח','chăshach','khash-akh\'','(Aramaic) a collateral root to one corresponding to חוּשׁ in the sense of readiness; to be necessary (from the idea of convenience) or (transitively) to need; careful, have need of.'),
	('H2819','חַשְׁחוּת','chashchûwth','khash-khooth\'','from a root corresponding to חֲשַׁח; necessity; be needful.'),
	('H2820','חָשַׂךְ','châsak','khaw-sak\'','a primitive root; also interchangeable  with חָשַׁךְ; to restrain or (reflex.) refrain; by implication, to refuse, spare, preserve; to observe; assuage, [idiom] darken, forbear, hinder, hold back, keep (back), punish, refrain, reserve, spare, withhold.'),
	('H2821','חָשַׁךְ','châshak','khaw-shak\'','a primitive root; to be dark (as withholding light); transitively, to darken; be black, be (make) dark, darken, cause darkness, be dim, hide.'),
	('H2822','חֹשֶׁךְ','chôshek','kho-shek\'','from חָשַׁךְ; the dark; hence (literally) darkness; figuratively, misery, destruction, death, ignorance, sorrow, wickedness; dark(-ness), night, obscurity.'),
	('H2823','חָשֹׁךְ','châshôk','khaw-shoke\'','from חָשַׁךְ; dark (figuratively, i.e. obscure); meaning'),
	('H2824','חֶשְׁכָה','cheshkâh','khesh-kaw\'','from חָשַׁךְ; darkness; dark.'),
	('H2825','חֲשֵׁכָה','chăshêkâh','khash-ay-kaw\'','or חֲשֵׁיכָהxlit chăshêkâh corrected to chăshêykâh; from חָשַׁךְ; darkness; figuratively, misery; darkness.'),
	('H2826','חָשַׁל','châshal','khaw-shal\'','a primitive root; to make (intrans. be) unsteady, i.e. weak; feeble.'),
	('H2827','חֲשַׁל','chăshal','khash-al\'','(Aramaic) a root corresponding to חָשַׁל; to weaken, i.e. crush; subdue.'),
	('H2828','חָשֻׁם','Châshum','khaw-shoom\'','from the same as חַשְׁמַן; enriched; Chashum, the name of two or three Israelites; Hashum.'),
	('H2829','חֶשְׁמוֹן','Cheshmôwn','klesh-mone\'','the same as חַשְׁמַן; opulent; Cheshmon, a place in Palestine; Heshmon.'),
	('H2830','חַשְׁמַל','chashmal','khash-mal\'','of uncertain derivation; probably bronze or polished spectrum metal; amber.'),
	('H2831','חַשְׁמַן','chashman','khash-man\'','from an unused root (probably meaning firm or capacious in resources); apparently; wealthy; princes.'),
	('H2832','חַשְׁמֹנָה','Chashmônâh','khash-mo-naw\'','feminine of חַשְׁמַן; fertile; Chasmonah, a place in the Desert; Hashmonah.'),
	('H2833','חֹשֶׁן','chôshen','kho\'-shen','from an unused root probably meaning to contain or sparkle; perhaps a pocket (as holding the Urim and Thummim), or rich (as containing gems), used only of the gorget of the highpriest; breastplate.'),
	('H2834','חָשַׂף','châsaph','khaw-saf\'','a primitive root; to strip off, i.e. generally to make naked (for exertion or in disgrace), to drain away or bail up (a liquid); make bare, clean, discover, draw out, take, uncover.'),
	('H2835','חָשִׂף','châsiph','khaw-seef\'','from חָשַׂף; properly, drawn off, i.e. separated; hence, a small company (as divided from the rest); little flock.'),
	('H2836','חָשַׁק','châshaq','khaw-shak\'','a primitive root; also interchangeable for חָשַׂךְ; to cling, i.e. join, (figuratively) to love, delight in; elliptically; to deliver; have a delight, (have a) desire, fillet, long, set (in) love.'),
	('H2837','חֵשֶׁק','chêsheq','khay\'-shek','from חָשַׁק; delight; desire, pleasure.'),
	('H2838','חָשֻׁק','châshuq','khaw-shook\'','or חָשׁוּק; past participle of חָשַׁק; attached, i.e. a fence-rail or rod connecting the posts or pillars; fillet.'),
	('H2839','חִשֻּׁק','chishshuq','khish-shook\'','from חָשַׁק; conjoined, i.e. a wheel-spoke or rod connecting the hub with the rim; felloe.'),
	('H2840','חִשֻּׁר','chishshur','khish-shoor\'','from an unused root meaning to bind together; combined, i.e. the nave or hub of awheel (as holding the spokes together); spoke.'),
	('H2841','חַשְׁרָה','chashrâh','khash-raw\'','from the same as חִשֻּׁר; properly, a combination or gathering, i.e. of watery clouds; dark.'),
	('H2842','חָשַׁשׁ','châshash','khaw-shash\'','by variation for קַשׁ; dry grass; chaff.'),
