	('H2847','חִתָּה','chittâh','khit-taw\'','from חָתַת; fear; terror.'),
	('H2848','חִתּוּל','chittûwl','khit-tool\'','from חָתַל; swathed, i.e. a bandage; roller.'),
	('H2849','חַתְחַת','chathchath','khath-khath\'','from חַת; terror; fear.'),
	('H2850','חִתִּי','Chittîy','khit-tee\'','patronymically from חֵת; a Chittite, or descendant of Cheth; Hittite, Hittities.'),
	('H2851','חִתִּית','chittîyth','khit-teeth\'','from חָתַת; fear; terror.'),
	('H2852','חָתַךְ','châthak','khaw-thak\'','a primitive root; properly, to cut off, i.e. (figuratively) to decree; determine.'),
	('H2853','חָתַל','châthal','khaw-thal\'','a primitive root; to swathe; [idiom] at all, swaddle.'),
	('H2854','חֲתֻלָּה','chăthullâh','khath-ool-law\'','from חָתַל; a swathing cloth (figuratively); swaddling band.'),
	('H2855','חֶתְלֹן','Chethlôn','kheth-lone\'','from חָתַל; enswathed; Chethlon, a place in Palestine; Hethlon.'),
	('H2856','חָתַם','châtham','khaw-tham\'','a primitive root; to close up; especially to seal; make an end, mark, seal (up), stop.'),
