	('H2858','חֹתֶמֶת','chôthemeth','kho-the-meth','feminine active participle of חָתַם; a seal; signet.'),
	('H2859','חָתַן','châthan','khaw-than\'','a primitive root; to give (a daughter) away in marriage; hence (generally) to contract affinity by marriage; join in affinity, father in law, make marriages, mother in law, son in law.'),
	('H2860','חָתָן','châthân','khaw-thawn\'','from חָתַן; a relative by marriage (especially through the bride); figuratively, a circumcised child (as a species of religious espousal); bridegroom, husband, son in law.'),
	('H2861','חֲתֻנָּה','chăthunnâh','khath-oon-naw\'','from חָתַן; a wedding; espousal.'),
