	('H2863','חֶתֶף','chetheph','kheh\'-thef','from חָתַף; properly, rapine; figuratively, robbery; prey.'),
	('H2864','חָתַר','châthar','khaw-thar\'','a primitive root; to force a passage, as by burglary; figuratively, with oars; dig (through), row.'),
	('H2865','חָתַת','châthath','khaw-thath\'','a primitive root; properly, to prostrate; hence, to break down, either (literally) by violence, or (figuratively) by confusion and fear; abolish, affright, be (make) afraid, amaze, beat down, discourage, (cause to) dismay, go down, scare, terrify.'),
	('H2866','חֲתַת','chăthath','khath-ath\'','from חָתַת; dismay; casting down.'),
	('H2867','חֲתַת','Chăthath','khath-ath\'','the same as חֲתַת; Chathath, an Israelite; cathath. f'),
	('H2868','טְאֵב','ṭᵉʼêb','teh-abe\'','a primitive root; to rejoice; be glad'),
	('H2869','טָב','ṭâb','teh-abe\'','the same as טוֹב; good; fine, good.'),
	('H2870','טָבְאֵל','ṭâbᵉʼêl','taw-beh-ale\'','from טוֹב and אֵל; pleasing (to) God; Tabeel, the name of a Syrian and of a Persian; Tabeal, Tabeel.'),
	('H2871','טָבוּל','ṭâbûwl','taw-bool\'','passive participle of טָבַל; properly, dyed, i.e. a turban (probably as of colored stuff); dyed attire.'),
	('H2872','טַבּוּר','ṭabbûwr','tab-boor\'','from an unused root meaning to pile up; properly, accumulated; i.e. (by implication) a summit; middle, midst.'),
	('H2873','טָבַח','ṭâbach','taw-bakh\'','a primitive root; to slaughter (animals or men); kill, (make) slaughter, slay.'),
	('H2874','טֶבַח','ṭebach','teh\'-bakh','from טָבַח; properly, something slaughtered; hence, a beast (or meat, as butchered); abstractly butchery (or concretely, a place of slaughter); [idiom] beast, slaughter, [idiom] slay, [idiom] sore.'),
	('H2875','טֶבַח','Ṭebach','teh\'-bakh','the same as טֶבַח; massacre; Tebach, the name of a Mesopotamian and of an Israelite; Tebah.'),
	('H2876','טַבָּח','ṭabbâch','tab-bawkh\'','from טָבַח; properly, a butcher; hence, a lifeguardsman (because he was acting as an executioner); also a cook (usually slaughtering the animal for food); cook, guard.'),
	('H2877','טַבָּח','ṭabbâch','tab-bawkh\'','(Aramaic) the same as טַבָּח; a lifeguardsman; guard.'),
	('H2878','טִבְחָה','ṭibchâh','tib-khaw\'','feminine of טֶבַח and meaning the same; {properly, something slaughtered; hence, a beast (or meat, as butchered); abstractly butchery (or concretely, a place of slaughter)}; flesh, slaughter.'),
	('H2879','טַבָּחָה','ṭabbâchâh','tab-baw-khaw\'','feminine of טַבָּח; a female cook; cook.'),
	('H2880','טִבְחַת','Ṭibchath','tib-khath\'','lemma טבְחַת missing vowel, corrected to טִבְחַת; from טִבְחָה; slaughter; Tibchath, a place in Syria; Tibhath.'),
	('H2881','טָבַל','ṭâbal','taw-bal\'','a primitive root; to dip, to immerse; dip, plunge.'),
	('H2882','טְבַלְיָהוּ','Ṭᵉbalyâhûw','teb-al-yaw\'-hoo','from טָבַל and יָהּ; Jah has dipped; Tebaljah, an Israelite; Tebaliah.'),
	('H2883','טָבַע','ṭâbaʻ','taw-bah\'','a primitive root; to sink; drown, fasten, settle, sink.'),
