	('H2885','טַבַּעַת','ṭabbaʻath','tab-bah\'-ath','from טָבַע; properly, a seal (as sunk into the wax), i.e. signet (for sealing); hence (generally) a ring of any kind; ring.'),
	('H2886','טַבְרִמּוֹן','Ṭabrimmôwn','tab-rim-mone\'','from טוֹב and רִמּוֹן; pleasing (to) Rimmon; Tabrimmon, a Syrian; Tabrimmon.'),
	('H2887','טֵבֶת','Ṭêbeth','tay\'-beth','probably of foreign derivation; Tebeth, the tenth Hebrew month; Tebeth.'),
	('H2888','טַבַּת','Ṭabbath','tab-bath\'','of uncertain derivation; Tabbath, a place East of the Jordan; Tabbath.'),
	('H2889','טָהוֹר','ṭâhôwr','taw-hore\'','or טָהֹר; from טָהֵר; pure (in a physical, chemical, ceremonial or moral sense); clean, fair, pure(-ness).'),
