	('H2891','טָהֵר','ṭâhêr','taw-hare\'','a primitive root; properly, to be bright; i.e. (by implication); to be pure (physical sound, clear, unadulterated; Levitically, uncontaminated; morally, innocent or holy); be (make, make self, pronounce) clean, cleanse (self), purge, purify(-ier, self).'),
	('H2892','טֹהַר','ṭôhar','to\'-har','from טָהֵר; literally brightness; ceremonially purification; clearness, glory, purifying.'),
	('H2893','טׇהֳרָה','ṭohŏrâh','toh-or-aw\'','feminine of טֹהַר; ceremonial purification; moral purity; [idiom] is cleansed, cleansing, purification(-fying).'),
	('H2894','טוּא','ṭûwʼ','too','a primitive root; to sweep away; sweep.'),
	('H2895','טוֹב','ṭôwb','tobe','a primitive root,; to be (transitively, do or make) good (or well) in the widest sense; be (do) better, cheer, be (do, seem) good, (make) goodly, [idiom] please, (be, do, go, play) well.'),
	('H2896','טוֹב','ṭôwb','tobe','from טוֹב; good (as an adjective) in the widest sense; used likewise as a noun, both in the masculine and the feminine, the singular and the plural (good, a good or good thing, a good man or woman; the good, goods or good things, good men or women), also as an adverb (well); beautiful, best, better, bountiful, cheerful, at ease, [idiom] fair (word), (be in) favour, fine, glad, good (deed, -lier, -liest, -ly, -ness, -s), graciously, joyful, kindly, kindness, liketh (best), loving, merry, [idiom] most, pleasant, [phrase] pleaseth, pleasure, precious, prosperity, ready, sweet, wealth, welfare, (be) well(-favoured).'),
	('H2897','טוֹב','Ṭôwb','tobe','the same as טוֹב; good; Tob, a region apparently East of the Jordan; Tob.'),
	('H2898','טוּב','ṭûwb','toob','from טוֹב; good (as a noun), in the widest sense, especially goodness (superlative concretely, the best), beauty, gladness, welfare; fair, gladness, good(-ness, thing, -s), joy, go well with.'),
