	('H2900','טוֹבִיָּה','Ṭôwbîyâh','to-bee-yaw\'','or טוֹבִיָּהוּ; from טוֹב and יָהּ; goodness of Jehovah; Tobijah, the name of three Israelites and of one Samaritan; Tobiah, Tobijah.'),
	('H2901','טָוָה','ṭâvâh','taw-vaw\'','a primitive root; to spin; spin.'),
	('H2902','טוּחַ','ṭûwach','too\'-akh','a primitive root; to smear, especially with lime; daub, overlay, plaister, smut.'),
