	('H2913','טַחֲנָה','ṭachănâh','takh-an-aw\'','from טָחַן; a hand mill; hence (figuratively) chewing; grinding.'),
	('H2914','טְחֹר','ṭᵉchôr','tekh-ore\'','from an unused root meaning to burn; a boil or ulcer (from the inflammation), especially a tumorin the anus or pudenda (the piles); emerod.'),
	('H2915','טִיחַ','ṭîyach','tee\'akh','from (the equiv. of) טוּחַ; mortar or plaster; daubing.'),
	('H2916','טִיט','ṭîyṭ','teet','from an unused root meaning apparently to be sticky (rather perb. a demonstrative); from טוּא, through the idea of dirt to be swept away); mud or clay; figuratively, calamity; clay, dirt, mire.'),
