	('H2919','טַל','ṭal','tal','from טָלַל; dew (as covering vegetation); dew.'),
	('H2920','טַל','ṭal','tal','(Aramaic) the same as טַל; {dew (as covering vegetation)}; dew.'),
	('H2921','טָלָא','ṭâlâʼ','taw-law\'','a primitive root; properly, to cover with pieces; i.e. (by implication) to spot or variegate (as tapestry); clouted, with divers colours, spotted.'),
	('H2922','טְלָא','ṭᵉlâʼ','tel-aw\'','apparently from טָלָא in the (orig.) sense of covering (for protection); (compare טָלֶה); a lamb; lamb.'),
