	('H2934','טָמַן','ṭâman','taw-man\'','a primitive root; to hide (by covering over); hide, lay privily, in secret.'),
	('H2935','טֶנֶא','ṭeneʼ','teh\'-neh','from an unused root probably meaning to weave; a basket (of interlaced osiers); basket.'),
	('H2936','טָנַף','ṭânaph','taw-naf\'','a primitive root; to soil; defile.'),
	('H2937','טָעָה','ṭâʻâh','taw-aw\'','a primitive root; to wander; causatively to lead astray; seduce.'),
	('H2938','טָעַם','ṭâʻam','taw-am\'','a primitive root; to taste; figuratively, to perceive; [idiom] but, perceive, taste.'),
	('H2939','טְעַם','ṭᵉʻam','teh-am\'','(Aramaic) corresponding to טָעַם; to taste; causatively to feed; make to eat, feed.'),
	('H2940','טַעַם','ṭaʻam','tah\'-am','from טָעַם; properly, a taste, i.e. (figuratively) perception; by implication, intelligence; transitively, a mandate; advice, behaviour, decree, discretion, judgment, reason, taste, understanding.'),
	('H2941','טַעַם','ṭaʻam','tah\'-am','(Aramaic) from טְעַם; compare טַעַם); properly, a taste, i.e.  ajudicial sentence; account, [idiom] to be commanded, commandment, matter.'),
	('H2942','טְעֵם','ṭᵉʻêm','teh-ame\'','(Aramaic) from טְעַם, and equivalent to טַעַם; properly, flavor; figuratively, judgment (both subjective and objective); hence, account (both subjectively and objectively); [phrase] chancellor, [phrase] command, commandment, decree, [phrase] regard, taste, wisdom.'),
	('H2943','טָעַן','ṭâʻan','taw-an\'','a primitive root; to load a beast; lade.'),
	('H2944','טָעַן','ṭâʻan','taw-an\'','a primitive root; to stab; thrust through.'),
	('H2945','טַף','ṭaph','taf','from טָפַף (perhaps referring to the tripping gait of children); a family (mostly used collectively in the singular); (little) children (ones), families.'),
	('H2946','טָפַח','ṭâphach','taw-fakh\'','a primitive root; or perhaps a denominative from טֵפַח, from dandling on the palms; to flatten out or extend (as a tent); figuratively, to nurse achild (as promotive of growth); span, swaddle.'),
	('H2947','טֵפַח','ṭêphach','tay\'-fakh','from טָפַח; a spread of the hand, i.e. a palm-breadth (not \'span\' of the fingers); architecturally, a corbel (as a supporting palm); coping, hand-breadth.'),
	('H2948','טֹפַח','ṭôphach','to\'-fakh','from טָפַח (the same as טֵפַח); {a spread of the hand, i.e. a palm-breadth (not \'span\' of the fingers); architecturally, a corbel (as a supporting palm)}; hand-breadth (broad).'),
	('H2949','טִפֻּח','ṭippuch','tip-pookh\'','from טָפַח; nursing; span long.'),
	('H2950','טָפַל','ṭâphal','taw-fal\'','a primitive root; properly, to stick on as apatch; figuratively, to impute falsely; forge(-r), sew up.'),
	('H2951','טִפְסַר','ṭiphçar','tif-sar\'','of foreign derivation; a military governor; captain.'),
	('H2952','טָפַף','ṭâphaph','taw-faf\'','a primitive root; apparently; to trip (with short steps) coquettishly; mince.'),
	('H2953','טְפַר','ṭᵉphar','tef-ar\'','(Aramaic) from a root corresponding to צָפַר, and meaning the same as צִפֹּרֶן; a finger-nail; also a hoof or claw; nail.'),
	('H2954','טָפַשׁ','ṭâphash','taw-fash\'','a primitive root; properly, apparently to be thick; figuratively, to be stupid; be fat.'),
	('H2955','טָפַת','Ṭâphath','taw-fath\'','probably from נָטַף; a dropping (of ointment); Taphath, an Israelitess; Taphath.'),
	('H2956','טָרַד','ṭârad','taw-rad\'','a primitive root; to drive on; figuratively, to follow close; continual.'),
	('H2957','טְרַד','ṭᵉrad','ter-ad\'','(Aramaic) corresponding to טָרַד; to expel; drive.'),
	('H2958','טְרוֹם','ṭᵉrôwm','ter-ome\'','a variation of טֶרֶם; not yet; before.'),
	('H2959','טָרַח','ṭârach','taw-rakh\'','a primitive root; to overburden; weary.'),
