	('H2961','טָרִי','ṭârîy','taw-ree\'','from an unused root apparently meaning to be moist; properly, dripping; hence, fresh (i.e. recently made such); new, putrefying.'),
	('H2962','טֶרֶם','ṭerem','teh\'-rem','from an unused root apparently meaning to interrupt or suspend; properly, non-occurrence; used adverbially, not yet or before; before, ere, not yet.'),
	('H2963','טָרַף','ṭâraph','taw-raf\'','a primitive root; to pluck off or pull to pieces; causatively to supply with food (as in morsels); catch, [idiom] without doubt, feed, ravin, rend in pieces, [idiom] surely, tear (in pieces).'),
