	('H3161','יָחַד','yâchad','yaw-khad\'','a primitive root; to be (or become) one; join, unite.'),
	('H3162','יַחַד','yachad','yakh\'-ad','from יָחַד; properly, a unit, i.e. (adverb) unitedly; alike, at all (once), both, likewise, only, (al-) together, withal.'),
	('H3163','יַחְדוֹ','Yachdôw','yakh-doe\'','from יַחַד with pronominal suffix; his unity, i.e. (adverb) together; Jachdo, an Israelite; Jahdo.'),
	('H3164','יַחְדִּיאֵל','Yachdîyʼêl','yakh-dee-ale\'','from יַחַד and אֵל; unity of God; Jachdiel, an Israelite; Jahdiel.'),
	('H3165','יֶחְדִּיָּהוּ','Yechdîyâhûw','yekh-dee-yaw\'-hoo','from יַחַד and יָהּ; unity of Jah; Jechdijah, the name of two Israelites; Jehdeiah.'),
	('H3166','יַחֲזִיאֵל','Yachăzîyʼêl','yakh-az-ee-ale\'','from חָזָה and אֵל; beheld of God; Jachaziel, the name of five Israelites; Jahaziel, Jahziel.'),
	('H3167','יַחְזְיָה','Yachzᵉyâh','yakh-zeh-yaw\'','from חָזָה and יָהּ; Jah will behold; Jachzejah, an Israelite; Jahaziah.'),
	('H3168','יְחֶזְקֵאל','Yᵉchezqêʼl','yekh-ez-kale\'','from חָזַק and אֵל; God will strengthen; Jechezkel, the name of two Israelites; Ezekiel, Jehezekel.'),
	('H3169','יְחִזְקִיָּה','Yᵉchizqîyâh','yekh-iz-kee-yaw\'','or יְחִזְקִיָּהוּ; from יְרוּשָׁא and יָהּ; strengthened of Jah; Jechizkijah, the name of five Israelites; Hezekiah, Jehizkiah. Compare חִזְקִיָּה.'),
	('H3170','יַחְזֵרָה','Yachzêrâh','yakh-zay-raw\'','from the same as חֲזִיר; perhaps protection; Jachzerah, an Israelite; Jahzerah.'),
	('H3171','יְחִיאֵל','Yᵉchîyʼêl','yekh-ee-ale\'','or (2 Chronicles 29:14) יְחַוְאֵל; from חָיָה and אֵל; God will live; Jechiel (or Jechavel), the name of eight Israelites; Jehiel.'),
	('H3172','יְחִיאֵלִי','Yᵉchîyʼêlîy','yekh-ee-ay-lee\'','patronymically from יְחִיאֵל; a Jechielite or descendant of Jechiel; Jehieli.'),
	('H3173','יָחִיד','yâchîyd','yaw-kheed\'','from יָחַד; properly, united, i.e. sole; by implication, beloved; also lonely; (feminine) the life (as not to be replaced); darling, desolate, only (child, son), solitary.'),
	('H3174','יְחִיָּה','Yᵉchîyâh','yekh-ee-yaw\'','from חָיָה and יָהּ; Jah will live; Jechijah, an Israelite; Jehiah.'),
	('H3175','יָחִיל','yâchîyl','yaw-kheel\'','from יָחַל; expectant; should hope.'),
	('H3176','יָחַל','yâchal','yaw-chal\'','a primitive root; to wait; by implication, to be patient, hope; (cause to, have, make to) hope, be pained, stay, tarry, trust, wait.'),
	('H3177','יַחְלְאֵל','Yachlᵉʼêl','yakh-leh-ale\'','from יָחַל and אֵל; expectant of God; Jachleel, an Israelite; Jahleel.'),
	('H3178','יַחְלְאֵלִי','Yachlᵉʼêlîy','yakh-leh-ay-lee\'','patronymically from יַחְלְאֵל; a Jachleelite or descendant of Jachleel; Jahleelites.'),
	('H3179','יָחַם','yâcham','yaw-kham\'','a primitive root; probably to be hot; figuratively, to conceive; get heat, be hot, conceive, be warm.'),
	('H3180','יַחְמוּר','yachmûwr','yakh-moor\'','from חָמַר; a kind of deer; fallow deer.'),
	('H3181','יַחְמַי','Yachmay','yakh-mah\'-ee','probably from יָחַם; hot; Jachmai, an Israelite; Jahmai.'),
	('H3182','יָחֵף','yâchêph','yaw-khafe\'','from an unused root meaning to take off the shoes; unsandalled; barefoot, being unshod.'),
	('H3183','יַחְצְאֵל','Yachtsᵉʼêl','yakh-tseh-ale\'','from חָצָהlemma חָעָה ayin, corrected to חָצָה and אֵל; God will allot; Jachtseel, an Israelite; Jahzeel. Compare יַחְצִיאֵל.'),
	('H3184','יַחְצְאֵלִי','Yachtsᵉʼêlîy','yakh-tseh-ay-lee\'','patronymically from יַחְצְאֵל; a Jachtseelite (collectively) or descendants of Jachtseel; Jahzeelites.'),
	('H3185','יַחְצִיאֵל','Yachtsîyʼêl','yakh-tsee-ale\'','from חָצָהlemma חָעָה ayin, corrected to חָצָה and אֵל; allotted of God; Jachtsiel, an Israelite; Jahziel. Compare יַחְצְאֵל.'),
	('H3186','יָחַר','yâchar','yaw-khar\'','a primitive root; to delay; tarry longer.'),
	('H3187','יָחַשׂ','yâchas','yaw-khas\'','a primitive root; to sprout; used only as denominative from יַחַשׂ; to enroll by pedigree; (number after, number throughout the) genealogy (to be reckoned), be reckoned by genealogies.'),
	('H3188','יַחַשׂ','yachas','yakh\'-as','from יָחַשׂ; a pedigree or family list (as growing spontaneously); genealogy.'),
	('H3189','יַחַת','Yachath','yakh\'-ath','from יָחַד; unity; Jachath, the name of four Israelites; Jahath.'),
	('H3190','יָטַב','yâṭab','yaw-tab\'','a primitive root; to be (causative) make well, literally (sound, beautiful) or figuratively (happy, successful, right); be accepted, amend, use aright, benefit, be (make) better, seem best, make cheerful, be comely, [phrase] be content, diligent(-ly), dress, earnestly, find favour, give, be glad, do (be, make) good(-ness), be (make) merry, please ([phrase] well), shew more (kindness), skilfully, [idiom] very small, surely, make sweet, thoroughly, tire, trim, very, be (can, deal, entreat, go, have) well (said, seen).'),
	('H3191','יְטַב','yᵉṭab','yet-ab\'','(Aramaic) corresponding to יָטַב; {to be (causative) make well, literally (sound, beautiful) or figuratively (happy, successful, right)}; seem good.'),
	('H3192','יׇטְבָה','Yoṭbâh','yot-baw\'','from יָטַב; pleasantness; Jotbah, a place in Palestine; Jotbah.'),
	('H3193','יׇטְבָתָה','Yoṭbâthâh','yot-baw\'-thaw','from יׇטְבָה; Jotbathah, a place in the Desert; Jotbath, Jotbathah.'),
	('H3194','יֻטָּה','Yuṭṭâh','yoo-taw\'','or יוּטָה; from נָטָה; extended; Juttah (or Jutah), a place in Palestine; Juttah.'),
	('H3195','יְטוּר','Yᵉṭûwr','yet-oor\'','probably from the same as טוּר; encircled (i.e. inclosed); Jetur, a son of Ishmael; Jetur.'),
	('H3196','יַיִן','yayin','yah\'-yin','from an unused root meaning to effervesce; wine (as fermented); by implication, intoxication; banqueting, wine, wine(-bibber).'),
	('H3197','יַךְ','yak','yak','by erroneous transcription for יָד; a hand or side; (way-) side.'),
	('H3198','יָכַח','yâkach','yaw-kahh\'','a primitive root; to be right (i.e. correct); reciprocal, to argue; causatively, to decide, justify or convict; appoint, argue, chasten, convince, correct(-ion), daysman, dispute, judge, maintain, plead, reason (together), rebuke, reprove(-r), surely, in any wise.'),
	('H3199','יָכִין','Yâkîyn','yaw-keen\'','lemma יִכִין first vowel, corrected to יָכִין; from כּוּן; he (or it) will establish; Jakin, the name of three Israelites and of a temple pillar; Jachin.'),
	('H3200','יָכִינִי','Yâkîynîy','yaw-kee-nee\'','patronymically from יָכִיןlemma יִכִין first vowel, corrected to יָכִין; a Jakinite (collectively) or descendants of Jakin; Jachinites.'),
	('H3201','יָכֹל','yâkôl','yaw-kole\'','or (fuller) יָכוֹל; a primitive root; to be able, literally (can, could) or morally (may, might); be able, any at all (ways), attain, can (away with, (-not)), could, endure, might, overcome, have power, prevail, still, suffer.'),
	('H3202','יְכֵל','yᵉkêl','yek-ale\'','(Aramaic) or יְכִיל; (Aramaic), to יָכֹל; {to be able, literally (can, could) or morally (may, might)}; be able, can, couldest, prevail.'),
	('H3203','יְכׇלְיָה','Yᵉkolyâh','yek-ol-yaw\'','and יְכׇלְיָהוּ; or (2 Chronicles 26:3) יְכִילְיָה; from יָכֹל and יָהּ; Jah will enable; Jekoljah or Jekiljah, an Israelitess; Jecholiah, Jecoliah.'),
	('H3204','יְכׇנְיָה','Yᵉkonyâh','yek-on-yaw\'','and יְכׇנְיָהוּ; or (Jeremiah 27:20) יְכוֹנְיָה; from כּוּן and יָהּ; Jah will establish; Jekonjah, a Jewish king; Jeconiah. Compare כׇּנְיָהוּ.'),
	('H3205','יָלַד','yâlad','yaw-lad\'','a primitive root; to bear young; causatively, to beget; medically, to act as midwife; specifically, to show lineage; bear, beget, birth(-day), born, (make to) bring forth (children, young), bring up, calve, child, come, be delivered (of a child), time of delivery, gender, hatch, labour, (do the office of a) midwife, declare pedigrees, be the son of, (woman in, woman that) travail(-eth, -ing woman).'),
	('H3206','יֶלֶד','yeled','yeh\'-led','from יָלַד; something born, i.e. a lad or offspring; boy, child, fruit, son, young man (one).'),
	('H3207','יַלְדָּה','yaldâh','yal-daw\'','feminine of יֶלֶד; a lass; damsel, girl.'),
	('H3208','יַלְדוּת','yaldûwth','yal-dooth\'','abstractly from יֶלֶד; boyhood (or girlhood); childhood, youth.'),
	('H3209','יִלּוֹד','yillôwd','yil-lode\'','passive from יָלַד; born; born.'),
	('H3210','יָלוֹן','Yâlôwn','yaw-lone\'','from לוּן; lodging; Jalon, an Israelite; Jalon.'),
	('H3211','יָלִיד','yâlîyd','yaw-leed\'','from יָלַד; born; (home-) born, child, son.'),
	('H3212','יָלַךְ','yâlak','yaw-lak\'','a primitive root (compare הָלַךְ); to walk (literally or figuratively); causatively, to carry (in various senses); [idiom] again, away, bear, bring, carry (away), come (away), depart, flow, [phrase] follow(-ing), get (away, hence, him), (cause to, made) go (away, -ing, -ne, one\'s way, out), grow, lead (forth), let down, march, prosper, [phrase] pursue, cause to run, spread, take away (-journey), vanish, (cause to) walk(-ing), wax, [idiom] be weak.'),
	('H3213','יָלַל','yâlal','yaw-lal\'','a primitive root; to howl (with a wailing tone) or yell (with a boisterous one); (make to) howl, be howling.'),
	('H3214','יְלֵל','yᵉlêl','yel-ale\'','from יָלַל; a howl; howling.'),
	('H3215','יְלָלָה','yᵉlâlâh','yel-aw-law\'','feminine of יְלֵל; {a howl}; a howling.'),
	('H3216','יָלַע','yâlaʻ','yaw-lah\'','a primitive root; to blurt or utter inconsiderately; devour.'),
	('H3217','יַלֶּפֶת','yallepheth','yal-leh\'-feth','from an unused root apparently meaning to stick or scrape; scurf or tetter; scabbed.'),
	('H3218','יֶלֶק','yeleq','yeh\'-lek','from an unused root meaning to lick up; a devourer; specifically, the young locust; cankerworm, caterpillar.'),
	('H3219','יַלְקוּט','yalqûwṭ','yal-koot\'','from לָקַט; a travelling pouch (as if for gleanings); scrip.'),
	('H3220','יָם','yâm','yawm','from an unused root meaning to roar; a sea (as breaking in noisy surf) or large body of water; specifically (with the article), the Mediterranean Sea; sometimes a large river, or an artifical basin; locally, the west, or (rarely) the south; sea ([idiom] -faring man, (-shore)), south, west (-ern, side, -ward).'),
	('H3221','יָם','yâm','yawm','(Aramaic) corresponding to יָם; {a sea (as breaking in noisy surf) or large body of water; specifically (with the article), the Mediterranean Sea; sometimes a large river, or an artifical basin; locally, the west, or (rarely) the south}; sea.'),
	('H3222','יֵם','yêm','yame','from the same as יוֹם; a warm spring; mule.'),
	('H3223','יְמוּאֵל','Yᵉmûwʼêl','yem-oo-ale\'','from יוֹם and אֵל; day of God; Jemuel, an Israelite; Jemuel.'),
	('H3224','יְמִימָה','Yᵉmîymâh','yem-ee-maw\'','perhaps from the same as יוֹם; properly, warm, i.e. affectionate; hence, dove (compare יוֹנָה); Jemimah, one of Job\'s daughters; Jemimah.'),
	('H3225','יָמִין','yâmîyn','yaw-meen\'','from יָמַן; the right hand or side (leg, eye) of a person or other object (as the stronger and more dexterous); locally, the south; [phrase] left-handed, right (hand, side), south.'),
	('H3226','יָמִין','Yâmîyn','yaw-meen\'','the same as יָמִין; Jamin, the name of three Israelites; Jamin. See also בִּנְיָמִין.'),
	('H3227','יְמִינִי','yᵉmîynîy','yem-ee-nee\'','for יָמִין; right; (on the) right (hand).'),
	('H3228','יְמִינִי','Yᵉmîynîy','yem-ee-nee\'','patronymically from יָמִין; a Jeminite (collectively) or descendants of Jamin; Jaminites. See also בֶּן־יְמִינִי.'),
	('H3229','יִמְלָא','Yimlâʼ','yeem-law\'','or יִמְלָה; from מָלֵא; full; Jimla or Jimlah, an Israelite; Imla, Imlah.'),
	('H3230','יַמְלֵךְ','Yamlêk','yam-lake\'','from מָלַךְ; he will make king; Jamlek, an Israelite; Jamlech.'),
	('H3231','יָמַן','yâman','yaw-man\'','a primitive root; to be (physically) right (i.e. firm); but used only as denominative from יָמִין and transitive,; to be right-handed or take the right-hand side; go (turn) to (on, use) the right hand.'),
	('H3232','יִמְנָה','Yimnâh','yim-naw\'','from יָמַן; prosperity (as betokened by the right hand); Jimnah, the name of two Israelites; also (with the article) of the posterity of one of them; Imna, Imnah, Jimnah, Jimnites.'),
	('H3233','יְמָנִי','yᵉmânîy','yem-aw-nee\'','from יָמַן; right (i.e. at the right hand); (on the) right (hand).'),
	('H3234','יִמְנָע','Yimnâʻ','yim-naw\'','from מָנַע; he will restrain; Jimna, an Israelite; Imna.'),
	('H3235','יָמַר','yâmar','yaw-mar\'','a primitive root; to exchange; by implication, to change places; boast selves, change.'),
	('H3236','יִמְרָה','Yimrâh','yim-raw\'','probably from יָמַר; interchange; Jimrah, an Israelite; Imrah.'),
	('H3237','יָמַשׁ','yâmash','yaw-mash\'','a primitive root; to touch; feel.'),
	('H3238','יָנָה','yânâh','yaw-naw\'','a primitive root; to rage or be violent; by implication, to suppress, to maltreat; destroy, (thrust out by) oppress(-ing, -ion, -or), proud, vex, do violence.'),
	('H3239','יָנוֹחַ','Yânôwach','yaw-no\'-akh or (with enclitic) Yanowchah yaw-no\'-khaw','from יָנַח; quiet; Janoach or Janochah, a place in Palestine; Janoah, Janohah.'),
	('H3240','יָנַח','yânach','yaw-nakh\'','a primitive root; to deposit; by implication, to allow to stay; bestow, cast down, lay (down, up), leave (off), let alone (remain), pacify, place, put, set (down), suffer, withdraw, withhold. (The Hiphil forms with the dagesh are here referred to, in accordance with the older grammarians; but if any distinction of the kind is to be made, these should rather be referred to נוּחַ, and the others here.)'),
	('H3241','יָנִים','Yânîym','yaw-neem\'','from נוּם; asleep; Janim, a place in Palestine; Janum (from the margin).'),
	('H3242','יְנִיקָה','yᵉnîyqâh','yen-ee-kaw\'','from יָנַק; a sucker or sapling; young twig.'),
	('H3243','יָנַק','yânaq','yaw-nak\'','a primitive root; to suck; causatively, to give milk; milch, nurse(-ing mother), (give, make to) suck(-ing child, -ling).'),
	('H3244','יַנְשׁוּף','yanshûwph','yan-shoof\'','or יַנְשׁוֹף; apparently from נָשַׁף; (compare נֶשֶׁף); an unclean (acquatic) bird; probably the heron (perhaps from its blowing cry, or because the nightheron is meant )); (great) owl.s'),
	('H3245','יָסַד','yâçad','yaw-sad\'','a primitive root; to set (literally or figuratively); intensively, to found; reflexively, to sit down together, i.e. settle, consult; appoint, take counsel, establish, (lay the, lay for a) found(-ation), instruct, lay, ordain, set, [idiom] sure.'),
	('H3246','יְסֻד','yᵉçud','yes-ood\'','from יָסַד; a foundation (figuratively, i.e. beginning); [idiom] began.'),
	('H3247','יְסוֹד','yᵉçôwd','yes-ode\'','from יָסַד; a foundation (literally or figuratively); bottom, foundation, repairing'),
	('H3248','יְסוּדָה','yᵉçûwdâh','yes-oo-daw\'','feminine of יְסֻד; a foundation; foundation.'),
	('H3249','יָסוּר','yâçûwr','yaw-soor\'','from סוּר; departing; they that depart'),
	('H3250','יִסּוֹר','yiççôwr','yis-sore\'','from יָסַר; a reprover; instruct.'),
	('H3251','יָסַךְ','yâçak','yaw-sak\'','a primitive root; to pour (intransitive); be poured.'),
	('H3252','יִסְכָּה','Yiçkâh','yis-kaw\'','from an unused root meaning to watch; observant; Jiskah, sister of Lot; Iscah.'),
	('H3253','יִסְמַכְיָהוּ','Yiçmakyâhûw','yis-mak-yaw-hoo\'','from סָמַךְ and יָהּ; Jah will sustain; Jismakjah, an Israelite; Ismachiah.'),
	('H3254','יָסַף','yâçaph','yaw-saf\'','a primitive root; to add or augment (often adverbial, to continue to do a thing); add, [idiom] again, [idiom] any more, [idiom] cease, [idiom] come more, [phrase] conceive again, continue, exceed, [idiom] further, [idiom] gather together, get more, give more-over, [idiom] henceforth, increase (more and more), join, [idiom] longer (bring, do, make, much, put), [idiom] (the, much, yet) more (and more), proceed (further), prolong, put, be (strong-) er, [idiom] yet, yield.'),
	('H3255','יְסַף','yᵉçaph','yes-af\'','(Aramaic) corresponding to יָסַף; {to add or augment (often adverbial, to continue to do a thing)}; add.'),
	('H3256','יָסַר','yâçar','yaw-sar\'','a primitive root; to chastise, literally (with blows) or figuratively (with words); hence, to instruct; bind, chasten, chastise, correct, instruct, punish, reform, reprove, sore, teach.'),
	('H3257','יָע','yâʻ','yaw','from יָעָה; a shovel; shovel.'),
	('H3258','יַעְבֵּץ','Yaʻbêts','yah-bates\'','from an unused root probably meaning to grieve; sorrowful; Jabets, the name of an Israelite, and also of a place in Palestine; Jabez.'),
	('H3259','יָעַד','yâʻad','yaw-ad\'','a primitive root; to fix upon (by agreement or appointment); by implication, to meet (at a stated time), to summon (to trial), to direct (in a certain quarter or position), to engage (for marriage); agree,(maxke an) appoint(-ment, a time), assemble (selves), betroth, gather (selves, together), meet (together), set (a time).'),
	('H3260','יֶעְדִּי','Yeʻdîy','yed-ee\'','from יָעַד; appointed; Jedi, an Israelite; Iddo (from the margin) See יִדּוֹ.'),
	('H3261','יָעָה','yâʻâh','yaw-aw\'','a primitive root; apparently; to brush aside; sweep away.'),
