	('H3369','יָקֹשׁ','yâqôsh','yaw-koshe\'','a primitive root; to ensnare (literally or figuratively); fowler (lay a) snare.'),
	('H3370','יׇקְשָׁן','Yoqshân','yok-shawn\'','from יָקֹשׁ; insidious; Jokshan, an Arabian patriarch; Jokshan.'),
	('H3371','יׇקְתְאֵל','Yoqthᵉʼêl','yok-theh-ale\'','probably from the same as יָקֶה and אֵל; veneration of God (compare יְקוּתִיאֵל); Joktheel, the name of a place in Palestine, and of one in Idumaea; Joktheel.'),
	('H3372','יָרֵא','yârêʼ','yaw-ray\'','a primitive root; to fear; morally, to revere; caus. to frighten; affright, be (make) afraid, dread(-ful), (put in) fear(-ful, -fully, -ing), (be had in) reverence(-end), [idiom] see, terrible (act, -ness, thing).'),
	('H3373','יָרֵא','yârêʼ','yaw-ray\'','from יָרֵא; fearing; morally, reverent; afraid, fear (-ful).'),
	('H3374','יִרְאָה','yirʼâh','yir-aw\'','feminine of יָרֵא; fear (also used as infinitive); morally, reverence; [idiom] dreadful, [idiom] exceedingly, fear(-fulness).'),
	('H3375','יִרְאוֹן','Yirʼôwn','yir-ohn\'','xlit Yirôwn corrected to Yirʼôwn; from יָרֵא; fearfulness; Jiron, a place in Palestine; Iron.'),
	('H3376','יִרְאִיָּיה','Yirʼîyâyh','yir-ee-yaw\'','from יָרֵא and יָהּ; fearful of Jah; Jirijah, an Israelite; Irijah.'),
	('H3377','יָרֵב','Yârêb','yaw-rabe\'','from רִיב; he will contend; Jareb, a symbolical name for Assyria; Jareb. Compare יָרִיב.'),
	('H3378','יְרֻבַּעַל','Yᵉrubbaʻal','yer-oob-bah\'-al','from רִיב and בַּעַל; Baal will contend; Jerubbaal, a symbolic name of Gideon; Jerubbaal.'),
	('H3379','יָרׇבְעָם','Yârobʻâm','yaw-rob-awm\'','from רִיב and עַם; (the) people will contend; Jarobam, the name of two Israelite kings; Jeroboam.'),
	('H3380','יְרֻבֶּשֶׁת','Yᵉrubbesheth','yer-oob-beh\'-sheth','from רִיב and בֹּשֶׁת; shame (i.e. the idol) will contend; Jerubbesheth, a symbolic name for Gideon; Jerubbesheth.'),
	('H3381','יָרַד','yârad','yaw-rad\'','a primitive root; to descend (literally, to go downwards; or conventionally to a lower region, as the shore, a boundary, the enemy, etc.; or figuratively, to fall); causatively, to bring down (in all the above applications); [idiom] abundantly, bring down, carry down, cast down, (cause to) come(-ing) down, fall (down), get down, go(-ing) down(-ward), hang down, [idiom] indeed, let down, light (down), put down (off), (cause to, let) run down, sink, subdue, take down.'),
	('H3382','יֶרֶד','Yered','yeh\'-red','from יָרַד; a descent; Jered, the name of an antediluvian, and of an Israelite; Jared.'),
	('H3383','יַרְדֵּן','Yardên','yar-dane\'','from יָרַד; a descender; Jarden, the principal river of Palestine; Jordan.'),
	('H3384','יָרָה','yârâh','yaw-raw\'','or (2 Chronicles 26:15) יָרָא; a primitive root; properly, to flow as water (i.e. to rain); transitively, to lay or throw (especially an arrow, i.e. to shoot); figuratively, to point out (as if by aiming the finger), to teach; ([phrase]) archer, cast, direct, inform, instruct, lay, shew, shoot, teach(-er,-ing), through.'),
	('H3385','יְרוּאֵל','Yᵉrûwʼêl','yer-oo-ale\'','from יָרָה and אֵל; founded of God; Jeruel, a place in Palestine; Jeruel.'),
	('H3386','יָרוֹחַ','Yârôwach','yaw-ro\'-akh','perhaps denominative from יָרֵחַ; (born at the) new moon; Jaroach, an Israelite; Jaroah.'),
	('H3387','יָרוֹק','yârôwq','yaw-roke\'','from יָרָק; green, i.e. an herb; green thing.'),
	('H3388','יְרוּשָׁא','Yᵉrûwshâʼ','yer-oo-shaw\'','or יְרוּשָׁה feminine passive participle of יָרַשׁ; possessed; Jerusha or Jerushah, as Israelitess; Jerusha, Jerushah.'),
	('H3389','יְרוּשָׁלַ͏ִם','Yᵉrûwshâlaim','yer-oo-shaw-lah\'-im','rarely יְרוּשָׁלַיִם; a dual (in allusion to its two main hills (the true pointing, at least of the former reading, seems to be that of יְרוּשָׁלֵם)); probably from (the passive participle of) יָרָה and שָׁלַם; founded peaceful; Jerushalaim or Jerushalem, the capital city of Palestine; Jerusalem.'),
	('H3390','יְרוּשָׁלֵם','Yᵉrûwshâlêm','yer-oo-shaw-lame\'','(Aramaic) corresponding to יְרוּשָׁלַ͏ִם; {Jerusalem}; {Jerusalem}'),
	('H3391','יֶרַח','yerach','yeh\'-rakh','from a unused root of uncertain signification; a lunation, i.e. month; month, moon.'),
	('H3392','יֶרַח','Yerach','yeh\'-rakh','the same as יֶרַח; Jerach, an Arabian patriarch; Jerah.'),
	('H3393','יְרַח','yᵉrach','yeh-rakh\'','(Aramaic) corresponding to יֶרַח; a month; month.'),
	('H3394','יָרֵחַ','yârêach','yaw-ray\'-akh','from the same as יֶרַח; the moon; moon. Yrechow. See יְרִיחוֹ.'),
	('H3395','יְרֹחָם','Yᵉrôchâm','yer-o-khawm\'','from רָחַם; compassionate; Jerocham, the name of seven or eight Israelites; Jeroham.'),
	('H3396','יְרַחְמְאֵל','Yᵉrachmᵉʼêl','yer-akh-meh-ale\'','from רָחַם and אֵל; God will compassionate; Jerachmeel, the name of three Israelites; Jerahmeel.'),
	('H3397','יְרַחְמְאֵלִי','Yᵉrachmᵉʼêlîy','yer-akh-meh-ay-lee\'','patronymically from יְרַחְמְאֵל; a Jerachmeelite or descendant of Jerachmeel; Jerahmeelites.'),
	('H3398','יַרְחָע','Yarchâʻ','yar-khaw\'','probably of Egyptian origin; Jarcha, an Egyptian; Jarha.'),
	('H3399','יָרַט','yâraṭ','yaw-rat\'','a primitive root; to precipitate or hurl (rush) headlong; (intransitively) to be rash; be perverse, turn over.'),
	('H3400','יְרִיאֵל','Yᵉrîyʼêl','yer-ee-ale\'','from יָרָה and אֵל; thrown of God; Jeriel, an Israelite; Jeriel. Compare יְרוּאֵל.'),
	('H3401','יָרִיב','yârîyb','yaw-rebe\'','from רִיב; literally he will contend; properly, adjective, contentious; used as noun, an adversary; that content(-eth), that strive.'),
	('H3402','יָרִיב','Yârîyb','yaw-rebe\'','the same as יָרִיב; Jarib, the name of three Israelites; Jarib.'),
	('H3403','יְרִיבַי','Yᵉrîybay','yer-eeb-ah\'ee','from יָרִיב; contentious; Jeribai, an Israelite; Jeribai.'),
	('H3404','יְרִיָּה','Yᵉrîyâh','yer-ee-yaw\'','or יְרִיָּהוּ; from יָרָה and יָהּ; Jah will throw; Jerijah, an Israelite; Jeriah, Jerijah.'),
	('H3405','יְרִיחוֹ','Yᵉrîychôw','yer-ee-kho\'','or יְרֵחוֹ; or variation (1 Kings 16:34) יְרִיחֹה; perhaps from יָרֵחַ; its month; or else from רוּחַ; fragrant; Jericho or Jerecho, a place in Palestine; Jericho.'),
	('H3406','יְרִימוֹת','Yᵉrîymôwth','yer-ee-mohth\'','or יְרֵימוֹת; or יְרֵמוֹת; feminine plural from רוּם; elevations; Jerimoth or Jeremoth, the name of twelve Israelites; Jermoth, Jerimoth, and Ramoth (from the margin).'),
	('H3407','יְרִיעָה','yᵉrîyʻâh','yer-ee-aw\'','from יָרַע; a hanging (as tremulous); curtain.'),
	('H3408','יְרִיעוֹת','Yᵉrîyʻôwth','yer-ee-ohth\'','plural of יְרִיעָה; curtains; Jerioth, an Israelitess; Jerioth.'),
	('H3409','יָרֵךְ','yârêk','yaw-rake\'','from an unused root meaning to be soft; the thigh (from its fleshy softness); by euphemistically the generative parts; figuratively, a shank, flank, side; [idiom] body, loins, shaft, side, thigh.'),
	('H3410','יַרְכָא','yarkâʼ','yar-kaw\'','(Aramaic) corresponding to יְרֵכָה; a thigh; thigh.'),
	('H3411','יְרֵכָה','yᵉrêkâh','yer-ay-kaw\'','feminine of יָרֵךְ; properly, the flank; but used only figuratively, the rear or recess; border, coast, part, quarter, side.'),
	('H3412','יַרְמוּת','Yarmûwth','yar-mooth\'','from רוּם; elevation; Jarmuth, the name of two places in Palestine; Jarmuth.'),
	('H3413','יְרֵמַי','Yᵉrêmay','yer-ay-mah\'-ee','from רוּם; elevated; Jeremai, an Israelite; Jeremai.'),
	('H3414','יִרְמְיָה','Yirmᵉyâh','yir-meh-yaw\'','or יִרְמְיָהוּ; from רוּם and יָהּ; Jah will rise; Jirmejah, the name of eight or nine Israelites; Jeremiah.'),
	('H3415','יָרַע','yâraʻ','yaw-rah\'','a primitive root; properly, to be broken up (with any violent action) i.e. (figuratively) to fear; be grevious (only Isaiah 15:4; the rest belong to רָעַע).'),
	('H3416','יִרְפְּאֵל','Yirpᵉʼêl','yir-peh-ale\'','from רָפָא and אֵל; God will heal; Jirpeel, a place in Palestine; Irpeel.'),
	('H3417','יָרָק','yârâq','yaw-rak\'','a primitive root; to spit; [idiom] but, spit.'),
	('H3418','יֶרֶק','yereq','yeh\'-rek','from יָרָק (in the sense of vacuity of color); properly, pallor, i.e. hence, the yellowish green of young and sickly vegetation; concretely, verdure, i.e. grass or vegetation; grass, green (thing).'),
	('H3419','יָרָק','yârâq','yaw-rawk\'','from the same as יֶרֶק; properly, green; concretely, a vegetable; green, herbs.'),
	('H3420','יֵרָקוֹן','yêrâqôwn','yay-raw-kone\'','from יֶרֶק; paleness, whether of persons (from fright), or of plants (from drought); greenish, yellow.'),
	('H3421','יׇרְקְעָם','Yorqᵉʻâm','yor-keh-awm\'','from רוּק and עַם; people will be poured forth; Jorkeam, a place in Palestine; Jorkeam.'),
	('H3422','יְרַקְרַק','yᵉraqraq','yer-ak-rak\'','from the same as יֶרֶק; yellowishness; greenish, yellow.'),
	('H3423','יָרַשׁ','yârash','yaw-rash\'','or יָרֵשׁ; a primitive root; to occupy (by driving out previous tenants, and possessing in their place); by implication, to seize, to rob, to inherit; also to expel, to impoverish, to ruin; cast out, consume, destroy, disinherit, dispossess, drive(-ing) out, enjoy, expel, [idiom] without fail, (give to, leave for) inherit(-ance, -or) [phrase] magistrate, be (make) poor, come to poverty, (give to, make to) possess, get (have) in (take) possession, seize upon, succeed, [idiom] utterly.'),
	('H3424','יְרֵשָׁה','yᵉrêshâh','yer-ay-shaw\'','from יָרַשׁ; occupancy; possession.'),
	('H3425','יְרֻשָּׁה','yᵉrushshâh','yer-oosh-shaw\'','from יָרַשׁ; something occupied; a conquest; also a patrimony; heritage, inheritance, possession.'),
	('H3426','יֵשׁ','yêsh','yaysh','perhaps from an unused root meaning to stand out, or exist; entity; used adverbially or as a copula for the substantive verb (הָיָה); there is or are (or any other form of the verb to be, as may suit the connection); (there) are, (he, it, shall, there, there may, there shall, there should) be, thou do, had, hast, (which) hath, (I, shalt, that) have, (he, it, there) is, substance, it (there) was, (there) were, ye will, thou wilt, wouldest.'),
	('H3427','יָשַׁב','yâshab','yaw-shab\'','a primitive root; properly, to sit down (specifically as judge. in ambush, in quiet); by implication, to dwell, to remain; causatively, to settle, to marry; (make to) abide(-ing), continue, (cause to, make to) dwell(-ing), ease self, endure, establish, [idiom] fail, habitation, haunt, (make to) inhabit(-ant), make to keep (house), lurking, [idiom] marry(-ing), (bring again to) place, remain, return, seat, set(-tle), (down-) sit(-down, still, -ting down, -ting (place) -uate), take, tarry.'),
	('H3428','יֶשֶׁבְאָב','Yeshebʼâb','yeh-sheb-awb\'','from יָשַׁב and אָב; seat of (his) father; Jeshebab, an Israelite; Jeshebeab.'),
	('H3429','יֹשֵׁב בַּשֶּׁבֶת','Yôshêb bash-Shebeth','yo-shabe\' bash-sheh\'-beth','from the active participle of יָשַׁב and שֶׁבֶת, with a preposition and the article interposed; sitting in the seat; Joshebbash-Shebeth, an Israelite; that sat in the seat.'),
	('H3430','יִשְׁבּוֹ בְּנֹב','Yishbôw bᵉ-Nôb','yish-bo\'beh-nobe','from יָשַׁב and נֹב, with a pronominal suffix and a preposition interposed; his dwelling (is) in Nob; Jishbo-be-Nob, a Philistine; Ishbi-benob (from the margin).'),
	('H3431','יִשְׁבַּח','Yishbach','yish-bakh\'','from שָׁבַח; he will praise; Jishbach, an Israelite; Ishbah.'),
	('H3432','יָשֻׁבִי','Yâshubîy','yaw-shoo-bee\'','patronymically from יָשׁוּב; a Jashubite, or descendant of Jashub; Jashubites.'),
	('H3433','יָשֻׁבִי לֶחֶם','Yâshubîy Lechem','yaw-shoo-bee\' leh\'-khem','from שׁוּב and לֶחֶם; returner of bread; Jashubi-Lechem, an Israelite; Jashubi-lehem. (Prob. the text should be pointed יֹשְׁבֵי לֶחֶם and rendered \'(they were) inhabitants of Lechem,\' i.e. of Bethlehem (by contraction). Compare לַחְמִי).'),
	('H3434','יָשׇׁבְעָם','Yâshobʻâm','yaw-shob-awm\'','from שׁוּב and עַם; people will return; Jashobam, the name of two or three Israelites; Jashobeam.'),
	('H3435','יִשְׁבָּק','Yishbâq','yish-bawk\'','from an unused root corresponding to שְׁבַק; he will leave; Jishbak, a son of Abraham; Ishbak.'),
	('H3436','יׇשְׁבְּקָשָׁה','Yoshbᵉqâshâh','yosh-bek-aw-shaw\'','from יָשַׁב and קָשֶׁה; a hard seat; Joshbekashah, an Israelite; Joshbekashah.'),
	('H3437','יָשׁוּב','Yâshûwb','yaw-shoob\'','or יָשִׁיב; from שׁוּב; he will return; Jashub, the name of two Israelites; Jashub.'),
	('H3438','יִשְׁוָה','Yishvâh','yish-vaw\'','from שָׁוָה; he will level; Jishvah, an Israelite; Ishvah, Isvah.'),
	('H3439','יְשׁוֹחָיָה','Yᵉshôwchâyâh','yesh-o-khaw-yaw\'','from the same as יֶשַׁח and יָהּ; Jah will empty; Jeshochajah, an Israelite; Jeshoaiah.'),
	('H3440','יִשְׁוִי','Yishvîy','yish-vee\'','from שָׁוָה; level; Jishvi, the name of two Israelites; Ishuai, Ishvi, Isui, Jesui.'),
	('H3441','יִשְׁוִי','Yishvîy','yish-vee\'','patronymically from יִשְׁוִי; a Jishvite (collectively) or descendants of Jishvi; Jesuites.'),
	('H3442','יֵשׁוּעַ','Yêshûwaʻ','yay-shoo\'-ah','for יְהוֹשׁוּעַ; he will save; Jeshua, the name of ten Israelites, also of a place in Palestine; Jeshua.'),
	('H3443','יֵשׁוּעַ','Yêshûwaʻ','yay-shoo\'-ah','(Aramaic) corresponding to יֵשׁוּעַ; {Jeshua, the name of ten Israelites, also of a place in Palestine}; Jeshua.'),
	('H3444','יְשׁוּעָה','yᵉshûwʻâh','yesh-oo\'-aw','feminine passive participle of יָשַׁע; something saved, i.e. (abstractly) deliverance; hence, aid, victory, prosperity; deliverance, health, help(-ing), salvation, save, saving (health), welfare.'),
	('H3445','יֶשַׁח','yeshach','yeh\'-shakh','from an unused root meaning to gape (as the empty stomach); hunger; casting down.'),
	('H3446','יִשְׂחָק','Yischâq','yis-khawk\'','from שַׁחֲצוֹם; he will laugh; Jischak, the heir of Abraham; Isaac. Compare יִצְחָק.'),
	('H3447','יָשַׁט','yâshaṭ','yaw-shat\'','a primitive root; to extend; hold out.'),
	('H3448','יִשַׁי','Yishay','yee-shah\'-ee','by Aramaic אִישַׁי; from the same as יֵשׁ; extant; Jishai, David\'s father; Jesse.'),
	('H3449','יִשִּׁיָּה','Yishshîyâh','yish-shee-yaw\'','or יִשִּׁיָּהוּ; from נָשָׁה and יָהּ; Jah will lend; Jishshijah, the name of five Israelites; Ishiah, Isshiah, Ishijah, Jesiah.'),
	('H3450','יְשִׁימָאֵל','Yᵉshîymâʼêl','yes-eem-aw-ale\'','from שׂוּם and אֵל; God will place; Jesimael, an Israelite; Jesimael.'),
	('H3451','יְשִׁימַה','yᵉshîymah','yesh-ee-maw\'','from יָשַׁם; desolation; let death seize (from the margin).'),
	('H3452','יְשִׁימוֹן','yᵉshîymôwn','yesh-ee-mone\'','from יָשַׁם; a desolation; desert, Jeshimon, solitary, wilderness.'),
	('H3453','יָשִׁישׁ','yâshîysh','yaw-sheesh\'','from יָשֵׁשׁ; an old man; (very) aged (man), ancient, very old.'),
	('H3454','יְשִׁישָׁי','Yᵉshîyshây','yesh-ee-shah\'-ee','from יָשִׁישׁ; aged; Jeshishai, an Israelite; Jeshishai.'),
	('H3455','יָשַׂם','yâsam','yaw-sam\'','a primitive root; to place; intransitively, to be placed; be put (set).'),
	('H3456','יָשַׁם','yâsham','yaw-sham\'','a primitive root; to lie waste; be desolate.'),
	('H3457','יִשְׁמָא','Yishmâʼ','yish-maw\'','from יָשַׁם; desolate; Jishma, an Israelite; Ishma.'),
	('H3458','יִשְׁמָעֵאל','Yishmâʻêʼl','yish-maw-ale\'','from שָׁמַע and אֵל; God will hear; Jishmael, the name of Abraham\'s oldest son, and of five Israelites; Ishmael.'),
	('H3459','יִשְׁמָעֵאלִי','Yishmâʻêʼlîy','yish-maw-ay-lee\'','patronymically from יִשְׁמָעֵאל; a Jishmaelite or descendant of Jishmael; Ishmaelite.'),
	('H3460','יִשְׁמַעְיָה','Yishmaʻyâh','yish-mah-yaw\'','or יִשְׁמַעְיָהוּlemma יְשְׁמַעְיָהוּ first vowel, corrected to יִשְׁמַעְיָהוּ; from שָׁמַע and יָהּ; Jah will hear; Jishmajah, the name of two Israelites; Ishmaiah.'),
	('H3461','יִשְׁמְרַי','Yishmᵉray','yish-mer-ah\'-ee','from שָׁמַר; preservative; Jishmerai, an Israelite; Ishmerai.'),
	('H3462','יָשֵׁן','yâshên','yaw-shane\'','a primitive root; properly, to be slack or languid, i.e. (by implication) sleep (figuratively, to die); also to grow old, stale or inveterate; old (store), remain long, (make to) sleep.'),
	('H3463','יָשֵׁן','yâshên','yaw-shane\'','from יָשֵׁן; sleepy; asleep, (one out of) sleep(-eth, -ing), slept.'),
	('H3464','יָשֵׁן','Yâshên','yaw-shane\'','the same as יָשֵׁן; Jashen, an Israelite; Jashen.');
INSERT INTO `strongs` (`number`, `lemma`, `xlit`, `pronounce`, `description`)
VALUES
	('H3465','יָשָׁן','yâshân','yaw-shawn\'','from יָשֵׁן; old; old.'),
	('H3466','יְשָׁנָה','Yᵉshânâh','yesh-aw-naw\'','feminine of יָשָׁן; Jeshanah, a place in Palestine; Jeshanah.'),
	('H3467','יָשַׁע','yâshaʻ','yaw-shah\'','a primitive root; properly, to be open, wide or free, i.e. (by implication) to be safe; causatively, to free or succor; [idiom] at all, avenging, defend, deliver(-er), help, preserve, rescue, be safe, bring (having) salvation, save(-iour), get victory.'),
	('H3468','יֶשַׁע','yeshaʻ','yeh\'-shah','or יֵשַׁע; from יָשַׁע; liberty, deliverance, prosperity; safety, salvation, saving.'),
	('H3469','יִשְׁעִי','Yishʻîy','yish-ee\'','from יָשַׁע; saving; Jishi, the name of four Israelites; Ishi.'),
	('H3470','יְשַׁעְיָה','Yᵉshaʻyâh','yesh-ah-yaw\'','or יְשַׁעְיָהוּ; from יָשַׁע and יָהּ; Jah has saved; Jeshajah, the name of seven Israelites; Isaiah, Jesaiah, Jeshaiah.'),
	('H3471','יָשְׁפֵה','yâshᵉphêh','yaw-shef-ay\'','from an unused root meaning to polish; a gem supposed to be jasper (from the resemblance in name); jasper.'),
	('H3472','יִשְׁפָּה','Yishpâh','yish-paw\'','perhaps from שָׁפָה; he will scratch; Jishpah, an Israelite; Ispah.'),
	('H3473','יִשְׁפָּן','Yishpân','yish-pawn\'','probably from the same as שָׁפָן; he will hide; Jishpan, an Israelite; Ishpan.'),
	('H3474','יָשַׁר','yâshar','yaw-shar\'','a primitive root; to be straight or even; figuratively, to be (causatively, to make) right, pleasant, prosperous; direct, fit, seem good (meet), [phrase] please (will), be (esteem, go) right (on), bring (look, make, take the) straight (way), be upright(-ly).'),
	('H3475','יֵשֶׁר','Yêsher','yay\'-sher','from יָשַׁר; the right; Jesher, an Israelite; Jesher.'),
	('H3476','יֹשֶׁר','yôsher','yo\'-sher','from יָשַׁר; the right; equity, meet, right, upright(-ness).'),
	('H3477','יָשָׁר','yâshâr','yaw-shawr\'','from יָשַׁר; straight (literally or figuratively); convenient, equity, Jasher, just, meet(-est), [phrase] pleased well right(-eous), straight, (most) upright(-ly, -ness).'),
	('H3478','יִשְׂרָאֵל','Yisrâʼêl','yis-raw-ale\'','from שָׂרָה and אֵל; he will rule as God; Jisrael, a symbolical name of Jacob; also (typically) of his posterity; Israel.'),
	('H3479','יִשְׂרָאֵל','Yisrâʼêl','yis-raw-ale\'','(Aramaic) corresponding to יִשְׂרָאֵל; {Jisrael, a symbolical name of Jacob; also (typically) of his posterity}; Israel.'),
	('H3480','יְשַׂרְאֵלָה','Yᵉsarʼêlâh','yes-ar-ale\'-aw','by variation from יָשָׁר and אֵל with directive enclitic; right towards God; Jesarelah, an Israelite; Jesharelah.'),
	('H3481','יִשְׂרְאֵלִי','Yisrᵉʼêlîy','yis-reh-ay-lee\'','patronymically from יִשְׂרָאֵל; a Jisreelite or descendant of Jisrael; of Israel, Israelite.'),
	('H3482','יִשְׂרְאֵלִית','Yisrᵉʼêlîyth','yis-reh-ay-leeth\'','feminine of יִשְׂרְאֵלִי; a Jisreelitess or female descendant of Jisrael; Israelitish.'),
	('H3483','יִשְׁרָה','yishrâh','yish-raw\'','feminine of יָשָׁר; rectitude; uprightness.'),
	('H3484','יְשֻׁרוּן','Yᵉshurûwn','yesh-oo-roon\'','from יָשַׁר; upright; Jeshurun, a symbolic name for Israel; Jeshurun.'),
	('H3485','יִשָּׂשכָר','Yissâˢkâr','yis-saw-kawr\'','(strictly yis-saws-kawr\'); from נָשָׂא and שָׂכָר; he will bring a reward; Jissaskar, a son of Jacob; Issachar.'),
	('H3486','יָשֵׁשׁ','yâshêsh','yaw-shaysh\'','from an unused root meaning to blanch; gray-haired, i.e. an aged man; stoop for age.'),
	('H3487','יַת','yath','yath','(Aramaic) corresponding to אֵת; a sign of the object of a verb; [phrase] whom.'),
	('H3488','יְתִב','yᵉthib','yeth-eeb\'','xlit yᵉthiyb corrected to yᵉthib; (Aramaic) corresponding to יָשַׁב; to sit or dwell; dwell, (be) set, sit.'),
	('H3489','יָתֵד','yâthêd','yaw-thade\'','from an unused root meaning to pin through or fast; a peg; nail, paddle, pin, stake.'),
	('H3490','יָתוֹם','yâthôwm','yaw-thome\'','from an unused root meaning to be lonely; a bereaved person; fatherless (child), orphan.'),
	('H3491','יָתוּר','yâthûwr','yaw-thoor\'','passive participle of יָתַר; properly, what is left, i.e. (by implication) a gleaning; range.'),
	('H3492','יַתִּיר','Yattîyr','yat-teer\'','from יָתַר; redundant; Jattir, a place in Palestine; Jattir.'),
	('H3493','יַתִּיר','yattîyr','yat-teer\'','(Aramaic) corresponding to יַתִּיר; preeminent; as an adverb, very; exceeding(-ly), excellent.'),
	('H3494','יִתְלָה','Yithlâh','yith-law\'','probably from תָּלָה; it will hang, i.e. be high; Jithlah, a place in Palestine; Jethlah.'),
	('H3495','יִתְמָה','Yithmâh','yith-maw\'','from the same as יָתוֹם; orphanage; Jithmah, an Israelite; Ithmah.'),
	('H3496','יַתְנִיאֵל','Yathnîyʼêl','yath-nee-ale\'','from an unused root meaning to endure, and אֵל; continued of God; Jathniel, an Israelite; Jathniel.'),
	('H3497','יִתְנָן','Yithnân','yith-nawn\'','lemma יְתְנָן first vowel, corrected to יִתְנָן; from the same as תַּנִּין; extensive; Jithnan, a place in Palestine; Ithnan.'),
	('H3498','יָתַר','yâthar','yaw-thar\'','a primitive root; to jut over or exceed; by implication, to excel; (intransitively) to remain or be left; causatively, to leave, cause to abound, preserve; excel, leave (a remnant), left behind, too much, make plenteous, preserve, (be, let) remain(-der, -ing, -nant), reserve, residue, rest.'),
	('H3499','יֶתֶר','yether','yeh\'-ther','from יָתַר; properly, an overhanging, i.e. (by implication) an excess, superiority, remainder; also a small rope (as hanging free); [phrase] abundant, cord, exceeding, excellancy(-ent), what they leave, that hath left, plentifully, remnant, residue, rest, string, with.'),
	('H3500','יֶתֶר','Yether','yeh\'-ther','the same as יֶתֶר; Jether, the name of five or six Israelites and of one Midianite; Jether, Jethro. Compare יִתְרוֹ.'),
	('H3501','יִתְרָא','Yithrâʼ','yith-raw\'','by variation for יִתְרָה; Jithra, an Israelite (or Ishmaelite); Ithra.'),
	('H3502','יִתְרָה','yithrâh','yith-raw\'','feminine of יֶתֶר; properly, excellence, i.e. (by implication) wealth; abundance, riches.'),
	('H3503','יִתְרוֹ','Yithrôw','yith-ro\'','from יֶתֶר with pron. suffix; his excellence; Jethro, Moses\' father-in-law; Jethro. Compare יֶתֶר.'),
	('H3504','יִתְרוֹן','yithrôwn','yith-rone\'','from יָתַר; preeminence, gain; better, excellency(-leth), profit(-able).'),
	('H3505','יִתְרִי','Yithrîy','yith-ree\'','patronymically from יֶתֶר; a Jithrite or descendant of Jether; Ithrite.'),
	('H3506','יִתְרָן','Yithrân','yith-rawn\'','from יָתַר; excellent; Jithran, the name of an Edomite and of an Israelite; Ithran.'),
	('H3507','יִתְרְעָם','Yithrᵉʻâm','yith-reh-awm\'','from יֶתֶר and עַם; excellence of people; Jithream, a son of David; Ithream.'),
	('H3508','יֹתֶרֶת','yôthereth','yo-theh\'-reth','feminine active participle of יָתַר; the lobe or flap of the liver (as if redundant or outhanging); caul.'),
	('H3509','יְתֵת','Yᵉthêth','yeh-thayth\'','of uncertain derivation; Jetheth, an Edomite; Jetheth. k'),
	('H3510','כָּאַב','kâʼab','kaw-ab\'','a primitive root; properly, to feel pain; by implication, to grieve; figuratively, to spoil; grieving, mar, have pain, make sad (sore), (be) sorrowful.'),
	('H3511','כְּאֵב','kᵉʼêb','keh-abe\'','from כָּאַב; suffering (physical or mental), adversity; grief, pain, sorrow.'),
	('H3512','כָּאָה','kâʼâh','kaw-aw\'','a primitive root; to despond; causatively, to deject; broken, be grieved, make sad.'),
	('H3513','כָּבַד','kâbad','kaw-bad\'','or כָּבֵד; a primitive root; to be heavy, i.e. in a bad sense (burdensome, severe, dull) or in a good sense (numerous, rich, honorable; causatively, to make weighty (in the same two senses); abounding with, more grievously afflict, boast, be chargeable, [idiom] be dim, glorify, be (make) glorious (things), glory, (very) great, be grievous, harden, be (make) heavy, be heavier, lay heavily, (bring to, come to, do, get, be had in) honour (self), (be) honourable (man), lade, [idiom] more be laid, make self many, nobles, prevail, promote (to honour), be rich, be (go) sore, stop.'),
	('H3514','כֹּבֶד','kôbed','ko\'-bed','from כָּבַד; weight, multitude, vehemence; grievousness, heavy, great number.'),
	('H3515','כָּבֵד','kâbêd','kaw-bade\'','from כָּבַד; heavy; figuratively in a good sense (numerous) or in a bad sense (severe, difficult, stupid); (so) great, grievous, hard(-ened), (too) heavy(-ier), laden, much, slow, sore, thick.'),
	('H3516','כָּבֵד','kâbêd','kaw-bade\'','the same as כָּבֵד; the liver (as the heaviest of the viscera); liver.'),
	('H3517','כְּבֵדֻת','kᵉbêduth','keb-ay-dooth\'','feminine of כָּבֵד; difficulty; [idiom] heavily.'),
	('H3518','כָּבָה','kâbâh','kaw-baw\'','a primitive root; to expire or (causatively) to extinguish (fire, light, anger); go (put) out, quench.'),
	('H3519','כָּבוֹד','kâbôwd','kaw-bode\'','rarely כָּבֹד; from כָּבַד; properly, weight, but only figuratively in a good sense, splendor or copiousness; glorious(-ly), glory, honour(-able).'),
	('H3520','כְּבוּדָּה','kᵉbûwddâh','keb-ood-daw\'','irregular feminine passive participle of כָּבַד; weightiness, i.e. magnificence, wealth; carriage, all glorious, stately.'),
	('H3521','כָּבוּל','Kâbûwl','kaw-bool\'','from the same as כֶּבֶל in the sense of limitation; sterile; Cabul, the name of two places in Palestine; Cabul.'),
	('H3522','כַּבּוֹן','Kabbôwn','kab-bone\'','from an unused root meaning to heap up; hilly; Cabon, a place in Palestine; Cabbon.'),
	('H3523','כְּבִיר','kᵉbîyr','keb-eer','from כָּבַר in the original sense of plaiting; a matrass (of intertwined materials); pillow.'),
	('H3524','כַּבִּיר','kabbîyr','kab-beer\'','from כָּבַר; vast, whether in extent (figuratively, of power, mighty; of time, aged), or in number, many; [phrase] feeble, mighty, most, much, strong, valiant.'),
	('H3525','כֶּבֶל','kebel','keh\'-bel','from an unused root meaning to twine or braid together; a fetter; fetter.'),
	('H3526','כָּבַס','kâbaç','kaw-bas\'','a primitive root; to trample; hence, to wash (properly, by stamping with the feet), whether literal (including the fulling process) or figurative; fuller, wash(-ing).'),
	('H3527','כָּבַר','kâbar','kaw-bar\'','a primitive root; properly, to plait together, i.e. (figuratively) to augment (especially in number or quantity, to accumulate); in abundance, multiply.'),
	('H3528','כְּבָר','kᵉbâr','keb-awr\'','from כָּבַר; properly, extent of time, i.e. a great while; hence, long ago, formerly, hitherto; already, (seeing that which), now.'),
	('H3529','כְּבָר','Kᵉbâr','keb-awr\'','the same as כְּבָר; length; Kebar, a river of Mesopotamia; Chebar. Compare חָבוֹר.'),
	('H3530','כִּבְרָה','kibrâh','kib-raw\'','feminine of כְּבָר; properly, length, i.e. a measure (of uncertain dimension); [idiom] little.'),
	('H3531','כְּבָרָה','kᵉbârâh','keb-aw-raw\'','from כָּבַר in its original sense; a sieve (as netted); sieve.'),
	('H3532','כֶּבֶשׂ','kebes','keh-bes\'','from an unused root meaning to dominate; a ram (just old enough to butt); lamb, sheep.'),
	('H3533','כָּבַשׁ','kâbash','kaw-bash\'','a primitive root; to tread down; hence, negatively, to disregard; positively, to conquer, subjugate, violate; bring into bondage, force, keep under, subdue, bring into subjection.'),
	('H3534','כֶּבֶשׁ','kebesh','keh\'-besh','from כָּבַשׁ; a footstool (as trodden upon); footstool.'),
	('H3535','כִּבְשָׂה','kibsâh','kib-saw\'','or כַּבְשָׂה; feminine of כֶּבֶשׂ; a ewe; (ewe) lamb.'),
	('H3536','כִּבְשָׁן','kibshân','kib-shawn\'','from כָּבַשׁ; a smelting furnace (as reducing metals); furnace.'),
	('H3537','כַּד','kad','kad','from an unused root meaning to deepen; properly, a pail; but generally of earthenware; a jar  for domestic purposes; barrel, pitcher.'),
	('H3538','כְּדַב','kᵉdab','ked-ab\'','(Aramaic) from a root corresponding to כָּזַב; false; lying.'),
	('H3539','כַּדְכֹּד','kadkôd','kad-kode\'','from the same as כַּד in the sense of striking fire from a metal forged; a sparkling gem, probably the ruby; agate.'),
	('H3540','כְּדׇרְלָעֹמֶר','Kᵉdorlâʻômer','ked-or-law-o\'-mer','of foreign origin; Kedorlaomer, an early Persian king; Chedorlaomer.'),
	('H3541','כֹּה','kôh','ko','from the prefix k and הוּא; properly, like this, i.e. by implication, (of manner) thus (or so); also (of place) here (or hither); or (of time) now; also, here, + hitherto, like, on the other side, so (and much), such, on that manner, (on) this (manner, side, way, way and that way), + mean while, yonder.'),
	('H3542','כָּה','kâh','kaw','(Aramaic) corresponding to כֹּה; {properly, like this, i.e. by implication, (of manner) thus (or so); also (of place) here (or hither); or (of time) now}; hitherto.'),
	('H3543','כָּהָה','kâhâh','kaw-haw\'','a primitive root; to be weak, i.e. (figuratively) to despond (causatively, rebuke), or (of light, the eye) to grow dull; darken, be dim, fail, faint, restrain, [idiom] utterly.'),
	('H3544','כֵּהֶה','kêheh','kay-heh\'','from כָּהָה; feeble, obscure; somewhat dark, darkish, wax dim, heaviness, smoking.'),
	('H3545','כֵּהָה','kêhâh','kay-haw\'','feminine of כֵּהֶה; properly, a weakening; figuratively, alleviation, i.e. cure; healing.'),
	('H3546','כְּהַל','kᵉhal','keh-hal\'','(Aramaic) a root corresponding to and כּוּל; to be able; be able, could.'),
	('H3547','כָּהַן','kâhan','kaw-han\'','a primitive root, apparently meaning to mediate in religious services; but used only as denominative from כֹּהֵן; to officiate as a priest; figuratively, to put on regalia; deck, be (do the office of a, execute the, minister in the) priest(\'s office).'),
	('H3548','כֹּהֵן','kôhên','ko-hane\'','active participle of כָּהַן; literally one officiating, a priest; also (by courtesy) an acting priest (although a layman); chief ruler, [idiom] own, priest, prince, principal officer.'),
	('H3549','כָּהֵן','kâhên','kaw-hane\'','(Aramaic) corresponding to כֹּהֵן; {one officiating, a priest; also (by courtesy) an acting priest (although a layman)}; priest.'),
	('H3550','כְּהֻנָּה','kᵉhunnâh','keh-hoon-naw\'','from כָּהַן; priesthood; priesthood, priest\'s office.'),
	('H3551','כַּו','kav','kav','(Aramaic) from a root corresponding to לַהַג in the sense of piercing; a window (as a perforation); window.'),
	('H3552','כּוּב','Kûwb','koob','of foreign derivation; Kub, a country near Egypt; Chub.'),
	('H3553','כּוֹבַע','kôwbaʻ','ko\'-bah','from an unused root meaning to be high or rounded; a helmet (as arched); helmet. Compare קוֹבַע.'),
	('H3554','כָּוָה','kâvâh','kaw-vaw\'','a primitive root; properly, to prick or penetrate; hence, to blister (as smarting or eating into); burn.'),
	('H3555','כְּוִיָּה','kᵉvîyâh','kev-ee-yaw\'','from כָּוָה; a branding; burning.'),
	('H3556','כּוֹכָב','kôwkâb','ko-kawb\'','probably from the same as כַּבּוֹן (in the sense of rolling) or כָּוָה (in the sense of blazing); a star (as round or as shining); figuratively, a prince; star(-gazer).'),
	('H3557','כּוּל','kûwl','kool','a primitive root; properly, to keep in; hence, to measure; figuratively, to maintain (in various senses); (be able to, can) abide, bear, comprehend, contain, feed, forbearing, guide, hold(-ing in), nourish(-er), be present, make provision, receive, sustain, provide sustenance (victuals).'),
	('H3558','כּוּמָז','kûwmâz','koo-mawz\'','from an unused root meaning to store away; a jewel (probably gold beads); tablet.'),
	('H3559','כּוּן','kûwn','koon','a primitive root; properly, to be erect (i.e. stand perpendicular); hence (causatively) to set up, in a great variety of applications, whether literal (establish, fix, prepare, apply), or figurative (appoint, render sure, proper or prosperous); certain(-ty), confirm, direct, faithfulness, fashion, fasten, firm, be fitted, be fixed, frame, be meet, ordain, order, perfect, (make) preparation, prepare (self), provide, make provision, (be, make) ready, right, set (aright, fast, forth), be stable, (e-) stablish, stand, tarry, [idiom] very deed.'),
	('H3560','כּוּן','Kûwn','koon','probably from כּוּן; established; Kun, a place in Syria; Chun.'),
	('H3561','כַּוָּן','kavvân','kav-vawn\'','from כּוּן; something prepared, i.e. a sacrificial wafer; cake.'),
	('H3562','כּוֹנַנְיָהוּ','Kôwnanyâhûw','ko-nan-yaw\'-hoo','from כּוּן and יָהּ; Jah has sustained; Conanjah, the name of two Israelites; Conaniah, Cononiah. Compare כְּנַנְיָה.'),
	('H3563','כּוֹס','kôwç','koce','from an unused root meaning to hold together; a cup (as a container), often figuratively, a lot (as if a potion); also some unclean bird, probably an owl (perhaps from the cup-like cavity of its eye); cup, (small) owl. Compare כִּיס.'),
	('H3564','כּוּר','kûwr','koor','from an unused root meaning properly, to dig through; a pot or furnace (as if excavated); furnace. Compare כִּיר.'),
	('H3565','כּוֹר עָשָׁן','Kôwr ʻÂshân','kore aw-shawn\'','from כּוּר and עָשָׁן; furnace of smoke; Cor-Ashan, a place in Palestine; Chorashan.'),
	('H3566','כּוֹרֶשׁ','Kôwresh','ko\'-resh','or (Ezra 1:1 (last time),2) כֹּרֶשׁ; from the Persians; Koresh (or Cyrus), the Persian king; Cyrus.'),
	('H3567','כּוֹרֶשׁ','Kôwresh','ko\'-resh','(Aramaic) corresponding to כּוֹרֶשׁ; {Koresh (or Cyrus), the Persian king}; Cyrus.'),
	('H3568','כּוּשׁ','Kûwsh','koosh','probably of foreign origin; Cush (or Ethiopia), the name of a son of Ham, and of his territory; also of an Israelite; Chush, Cush, Ethiopia.'),
	('H3569','כּוּשִׁי','Kûwshîy','koo-shee\'','patronymically from כּוּשׁ; a Cushite, or descendant of Cush; Cushi, Cushite, Ethiopian(-s).'),
	('H3570','כּוּשִׁי','Kûwshîy','koo-shee\'','the same as כּוּשִׁי; Cushi, the name of two Israelites; Cushi.'),
	('H3571','כּוּשִׁית','Kûwshîyth','koo-sheeth\'','feminine of כּוּשִׁי; a Cushite woman; Ethiopian.'),
	('H3572','כּוּשָׁן','Kûwshân','koo-shawn\'','perhaps from כּוּשׁ; Cushan, a region of Arabia; Cushan.'),
	('H3573','כּוּשַׁן רִשְׁעָתַיִם','Kûwshan Rishʻâthayim','koo-shan\' rish-awthah\'-yim','apparently from כּוּשָׁן and the dual of רִשְׁעָה; Cushan of double wickedness; Cushan-Rishathajim, a Mesopotamian king; Chushan-rishathayim.'),
	('H3574','כּוֹשָׁרָה','kôwshârâh','ko-shaw-raw\'','from כָּשֵׁר; prosperity; in plural freedom; [idiom] chain.'),
	('H3575','כּוּת','Kûwth','kooth','or (feminine) כּוּתָה; of foreign origin; Cuth or Cuthah, a province of Assyria; Cuth.'),
	('H3576','כָּזַב','kâzab','kaw-zab\'','a primitive root; to lie (i.e. deceive), literally or figuratively; fail, (be found a, make a) liar, lie, lying, be in vain.'),
	('H3577','כָּזָב','kâzâb','kaw-zawb\'','from כָּזַב; falsehood; literally (untruth) or figuratively (idol); deceitful, false, leasing, + liar, lie, lying.'),
	('H3578','כֹּזְבָא','Kôzᵉbâʼ','ko-zeb-aw\'','from כָּזַב; fallacious; Cozeba, a place in Palestine; Choseba.'),
	('H3579','כֹּזְבִי','Kôzᵉbîy','koz-bee\'','from כָּזַב; false; Cozbi, a Midianitess; Cozbi.'),
	('H3580','כְּזִיב','Kᵉzîyb','kez-eeb\'','from כָּזַב; falsified; Kezib, a place in Palestine; Chezib.'),
	('H3581','כֹּחַ','kôach','ko\'-akh','or (Daniel 11:6) כּוֹחַ; from an unused root meaning to be firm; vigor, literally (force, in a good or a bad sense) or figuratively (capacity, means, produce); also (from its hardiness) a large lizard; ability, able, chameleon, force, fruits, might, power(-ful), strength, substance, wealth.'),
	('H3582','כָּחַד','kâchad','kaw-khad\'','a primitive root; to secrete, by act or word; hence (intensively) to destroy; conceal, cut down (off), desolate, hide.'),
	('H3583','כָּחַל','kâchal','kaw-khal\'','a primitive root; to paint (with stibium); paint.'),
	('H3584','כָּחַשׁ','kâchash','kaw-khash\'','a primitive root; to be untrue, in word (to lie, feign, disown) or deed (to disappoint, fail, cringe); deceive, deny, dissemble, fail, deal falsely, be found liars, (be-) lie, lying, submit selves.'),
	('H3585','כַּחַשׁ','kachash','kakh\'-ash','from כָּחַשׁ; literally a failure of flesh, i.e. emaciation; figuratively, hypocrisy; leanness, lies, lying.'),
	('H3586','כֶּחָשׁ','kechâsh','kekh-awsh\'','from כָּחַשׁ; faithless; lying.'),
	('H3587','כִּי','kîy','kee','from כָּוָה; a brand or scar; burning.'),
	('H3588','כִּי','kîy','kee','a primitive particle (the full form of the prepositional prefix) indicating causal relations of all kinds, antecedent or consequent; (by implication) very widely used as a relative conjunction or adverb (as below); often largely modified by other particles annexed; and, + (forasmuch, inasmuch, where-) as, assured(-ly), + but, certainly, doubtless, + else, even, + except, for, how, (because, in, so, than) that, + nevertheless, now, rightly, seeing, since, surely, then, therefore, + (al-) though, + till, truly, + until, when, whether, while, whom, yea, yet.'),
	('H3589','כִּיד','kîyd','keed','from a primitive root meaning to strike; a crushing; figuratively, calamity; destruction.'),
	('H3590','כִידוֹד','kîydôwd','kee-dode\'','from the same as כִּיד (compare כַּדְכֹּד); properly, something struck off, i.e. a spark (as struck); spark.'),
	('H3591','כִּידוֹן','kîydôwn','kee-dohn\'','from the same as כִּיד; (perhaps smaller than חֲנִיתlemma חֲניִת second vowel, corrected to חֲנִית); properly, something to strike with, i.e. a dart; lance, shield, spear, target.'),
	('H3592','כִּידוֹן','Kîydôwn','kee-dohn\'','the same as כִּידוֹן; Kidon, a place in Palestine; Chidon.'),
	('H3593','כִּידוֹר','kîydôwr','kee-dore\'','of uncertain derivation; perhaps tumult; battle.'),
	('H3594','כִּיּוּן','Kîyûwn','kee-yoon\'','from כּוּן; properly, a statue, i.e. idol; but used (by euphemism) forsome heathen deity (perhaps corresponding to Priapus or Baal-peor); Chiun.'),
	('H3595','כִּיּוֹר','kîyôwr','kee-yore\'','or כִּיֹּר; from the same as כּוּר; properly, something round (as excavated or bored), i.e. a chafing-dish forcoals or a caldron forcooking; hence (from similarity of form) a washbowl; also (for the same reason) a pulpit or platform; hearth, laver, pan, scaffold.'),
	('H3596','כִּילַי','kîylay','kee-lah\'-ee','or כֵּלַי; from כּוּל in the sense of withholding; niggardly; churl.'),
	('H3597','כֵּילַף','kêylaph','kay-laf\'','from an unused root meaning to clap or strike with noise; a club or sledge-hammer; hammer.'),
	('H3598','כִּימָה','Kîymâh','kee-maw\'','from the same as כּוּמָז; a cluster of stars, i.e. the Pleiades; Pleiades, seven stars.'),
	('H3599','כִּיס','kîyç','keece','a form for כּוֹס; a cup; also a bag formoney or weights; bag, cup, purse.'),
	('H3600','כִּיר','kîyr','keer','a form for כּוּר (only in the dual); a cooking range (consisting of two parallel stones, across which the boiler is set); ranges for pots.'),
	('H3601','כִּישׁוֹר','kîyshôwr','kee-shore\'','from כָּשֵׁר; compare פֶּלֶךְ; literally a director, i.e. the spindle or shank of adistaff, by which it is twirled; spindle.'),
	('H3602','כָּכָה','kâkâh','kaw\'-kaw','from כֹּה; just so, referring to the previous or following context; after that (this) manner, this matter, (even) so, in such a case, thus.'),
	('H3603','כִּכָּר','kikkâr','kik-kawr\'','from כָּרַר; a circle, i.e. (by implication) a circumjacent tract or region, especially the Ghor or valley of the Jordan; also a (round) loaf; also a talent (or large [round] coin); loaf, morsel, piece, plain, talent.'),
	('H3604','כִּכֵּר','kikkêr','kik-kare\'','(Aramaic) corresponding to כִּכָּר; a talent; talent.'),
	('H3605','כֹּל','kôl','kole','or (Jeremiah 33:8) כּוֹל; from כָּלַל; properly, the whole; hence, all, any or every (in the singular only, but often in a plural sense); (in) all (manner, (ye)), altogether, any (manner), enough, every (one, place, thing), howsoever, as many as, (no-) thing, ought, whatsoever, (the) whole, whoso(-ever).'),
	('H3606','כֹּל','kôl','kole','(Aramaic) corresponding to כֹּל; {properly, the whole; hence, all, any or every (in the singular only, but often in a plural sense)}; all, any, + (forasmuch) as, + be-(for this) cause, every, + no (manner, -ne), + there (where) -fore, + though, what (where, who) -soever, (the) whole.'),
	('H3607','כָּלָא','kâlâʼ','kaw-law\'','a primitive root; to restrict, by act (hold back or in) or word (prohibit); finish, forbid, keep (back), refrain, restrain, retain, shut up, be stayed, withhold.'),
	('H3608','כֶּלֶא','keleʼ','keh\'-leh','from כָּלָא; a prison; prison. Compare כִּלְאַיִם, כְּלִיא.'),
	('H3609','כִּלְאָב','Kilʼâb','kil-awb\'','apparently from כָּלָא and אָב; restraint of (his) father; Kilab, an Israelite; Chileab.'),
	('H3610','כִּלְאַיִם','kilʼayim','kil-ah\'-yim','dual of כֶּלֶא in the original sense of separation; two heterogeneities; divers seeds (-e kinds), mingled (seed).'),
	('H3611','כֶּלֶב','keleb','keh\'-leb','from an unused root means. to yelp, or else to attack; a dog; hence (by euphemism) a male prostitute; dog.'),
	('H3612','כָּלֵב','Kâlêb','kaw-labe\'','perhaps a form of כֶּלֶב, or else from the same root in the sense of forcible; Caleb, the name of three Israelites; Caleb.'),
	('H3613','כָּלֵב אֶפְרָתָה','Kâlêb ʼEphrâthâh','kaw-labe\' ef-raw\'-thaw','from כָּלֵב and אֶפְרָת; Caleb-Ephrathah, a place in Egypt (if the text is correct); Caleb-ephrathah.'),
	('H3614','כָּלִבּוֹ','Kâlibbôw','kaw-lib-bo\'','probably by erroneous transcription for כָּלֵבִי; patronymically from כָּלֵב; a Calebite or descendant of Caleb; of the house of Caleb.'),
	('H3615','כָּלָה','kâlâh','kaw-law\'','a primitive root; to end, whether intransitive (to cease, be finished, perish) or transitived (to complete, prepare, consume); accomplish, cease, consume (away), determine, destroy (utterly), be (when... were) done, (be an) end (of), expire, (cause to) fail, faint, finish, fulfil, [idiom] fully, [idiom] have, leave (off), long, bring to pass, wholly reap, make clean riddance, spend, quite take away, waste.'),
	('H3616','כָּלֶה','kâleh','kaw-leh\'','from כָּלָה; pining; fail.'),
	('H3617','כָּלָה','kâlâh','kaw-law\'','from כָּלָה; a completion; adverb, completely; also destruction; altogether, (be, utterly) consume(-d), consummation(-ption), was determined, (full, utter) end, riddance.'),
	('H3618','כַּלָּה','kallâh','kal-law\'','lemma כַּלָה missing dagesh, corrected to כַּלָּה; from כָּלַל; a bride (as if perfect); hence, a son\'s wife; bride, daughter-in-law, spouse.'),
	('H3619','כְּלוּב','kᵉlûwb','kel-oob\'','xlit kᵉlûb corrected to kᵉlûwb; from the same as כֶּלֶב; a bird-trap (as furnished with a clap-stick or treadle to spring it); hence, a basket (as resembling a wicker cage); basket, cage.'),
	('H3620','כְּלוּב','Kᵉlûwb','kel-oob\'','the same as כְּלוּבxlit kᵉlûb corrected to kᵉlûwb; Kelub, the name of two Israelites; Chelub.'),
	('H3621','כְּלוּבַי','Kᵉlûwbay','kel-oo-bay\'-ee','a form of כָּלֵב; Kelubai, an Israelite; Chelubai.'),
	('H3622','כְּלוּהַי','Kᵉlûwhay','kel-oo-hah\'-ee','from כָּלָה; completed; Keluhai, an Israelite; Chelluh.'),
	('H3623','כְּלוּלָה','kᵉlûwlâh','kel-oo-law\'','denominative passive participle from כַּלָּהlemma כַּלָה missing dagesh, corrected to כַּלָּה; bridehood (only in the plural); espousal.'),
	('H3624','כֶּלַח','kelach','keh\'-lakh','from an unused root meaning to be complete; maturity; full (old) age.'),
	('H3625','כֶּלַח','Kelach','keh\'-lakh','the same as כֶּלַח; Kelach, a place in Assyria; Calah.'),
	('H3626','כׇּל־חֹזֶה','Kol-Chôzeh','kol-kho-zeh\'','from כֹּל and חֹזֶה; every seer; Col-Chozeh, an Israelite; Col-hozeh.'),
	('H3627','כְּלִי','kᵉlîy','kel-ee\'','from כָּלָה; something prepared, i.e. any apparatus (as an implement, utensil, dress, vessel or weapon); armour(-bearer), artillery, bag, carriage, [phrase] furnish, furniture, instrument, jewel, that is made of, [idiom] one from another, that which pertaineth, pot, [phrase] psaltery, sack, stuff, thing, tool, vessel, ware, weapon, [phrase] whatsoever.'),
	('H3628','כְּלִיא','kᵉlîyʼ','kel-ee\'','or כְּלוּא; from כְּלִי (compare כֶּלֶא); a prison; prison.'),
	('H3629','כִּלְיָה','kilyâh','kil-yaw\'','feminine of כְּלִי (only in the plural); a kidney (as an essential organ); figuratively, the mind (as the interior self); kidneys, reins.'),
	('H3630','כִּלְיוֹן','Kilyôwn','kil-yone\'','a form of כִּלָּיוֹן; Kiljon, an Israelite; Chilion.'),
	('H3631','כִּלָּיוֹן','killâyôwn','kil-law-yone\'','from כָּלָה; pining, destruction; consumption, failing.'),
	('H3632','כָּלִיל','kâlîyl','kaw-leel\'','from כָּלַל; complete; as noun, the whole (specifically, a sacrifice entirely consumed); as adverb, fully; all, every whit, flame, perfect(-ion), utterly, whole burnt offering (sacrifice), wholly.'),
	('H3633','כַּלְכֹּל','Kalkôl','kal-kole\'','from כּוּל; sustenance; Calcol, an Israelite; Calcol, Chalcol.'),
	('H3634','כָּלַל','kâlal','kaw-lal\'','a primitive root; to complete; (make) perfect.'),
	('H3635','כְּלַל','kᵉlal','kel-al\'','(Aramaic) corresponding to כָּלַל; to complete; finish, make (set) up.'),
	('H3636','כְּלָל','Kᵉlâl','kel-awl\'','from כָּלַל; complete; Kelal, an Israelite; Chelal.'),
	('H3637','כָּלַם','kâlam','kaw-lawm\'','a primitive root; properly, to wound; but only figuratively, to taunt or insult; be (make) ashamed, blush, be confounded, be put to confusion, hurt, reproach, (do, put to) shame.'),
	('H3638','כִּלְמָד','Kilmâd','kil-mawd\'','of foreign derivation; Kilmad, a place apparently in the Assyrian empire; Chilmad.'),
	('H3639','כְּלִמָּה','kᵉlimmâh','kel-im-maw\'','from כָּלַם; disgrace; confusion, dishonour, reproach, shame.'),
	('H3640','כְּלִמּוּת','kᵉlimmûwth','kel-im-mooth\'','from כְּלִמָּה; disgrace; shame.'),
	('H3641','כַּלְנֶה','Kalneh','kal-neh\'','or כַּלְנֵה; also כַּלְנוֹ; of foreign derivation; Calneh or Calno, a place in the Assyrian empire; Calneh, Calno. Compare כַּנֶּה.'),
	('H3642','כָּמַהּ','kâmahh','kaw-mah','a primitive root; to pine after; long.'),
	('H3643','כִּמְהָם','Kimhâm','kim-hawm\'','from כָּמַהּ; pining; Kimham, an Israelite; Chimham.'),
	('H3644','כְּמוֹ','kᵉmôw','kem-o\'','or כָּמוֹ; (compare כֵּן); a form of the prefix \'k-\', but used separately  as, thus, so; according to, (such) as (it were, well as), in comparison of, like (as, to, unto), thus, when, worth.'),
	('H3645','כְּמוֹשׁ','Kᵉmôwsh','kem-oshe\'','or (Jeremiah 48:7) כְּמִישׁ; from an unused root meaning to subdue; the powerful; Kemosh, the god of the Moabites; Chemosh.'),
	('H3646','כַּמֹּן','kammôn','kam-mone\'','from an unused root meaning to store up or preserve; \'cummin\' (from its use as a condiment); cummin.'),
	('H3647','כָּמַס','kâmaç','kaw-mas\'','a primitive root; to store away, i.e. (figuratively) in the memory; lay up in store.'),
	('H3648','כָּמַר','kâmar','kaw-mar\'','a primitive root; properly, to intertwine or contract, i.e. (by implication) to shrivel (as with heat); figuratively, to be deeply affected with passion (love or pity); be black, be kindled, yearn.'),
	('H3649','כָּמָר','kâmâr','kaw-mawr\'','from כָּמַר; properly, an ascetic (as if shrunk with self-maceration), i.e. an idolatrous priest (only in plural); Chemarims (idolatrous) priests.'),
	('H3650','כִּמְרִיר','kimrîyr','kim-reer\'','redupl. from כָּמַר; obscuration (as if from shrinkage of light, i.e. an eclipse (only in plural); blackness.'),
	('H3651','כֵּן','kên','kane','from כּוּן; properly, set upright; hence (figuratively as adjective) just; but usually (as adverb or conjunction) rightly or so (in various applications to manner, time and relation; often with other particles); [phrase] after that (this, -ward, -wards), as... as, [phrase] (for-) asmuch as yet, [phrase] be (for which) cause, [phrase] following, howbeit, in (the) like (manner, -wise), [idiom] the more, right, (even) so, state, straightway, such (thing), surely, [phrase] there (where) -fore, this, thus, true, well, [idiom] you.'),
	('H3652','כֵּן','kên','kane','(Aramaic) corresponding to כֵּן; so; thus.'),
	('H3653','כֵּן','kên','kane','the same as כֵּן, used as a noun; a stand, i.e. pedestal or station; base, estate, foot, office, place, well.'),
	('H3654','כֵּן','kên','kane','from כָּנַן in the sense of fastening; (from infixing its sting; used only in plural (and irregular in Exodus 8:17,18; Hebrews 13:14)); a gnat; lice, [idiom] manner.'),
	('H3655','כָּנָה','kânâh','kaw-naw\'','a primitive root; to address by an additional name; hence, to eulogize; give flattering titles, surname (himself).'),
	('H3656','כַּנֶּה','Kanneh','kan-neh\'','for כַּלְנֶה; Canneh, a place in Assyria; Canneh.'),
	('H3657','כַּנָּה','kannâh','kaw-naw\'','from כָּנַן; a plant (as set); [idiom] vineyard.'),
	('H3658','כִּנּוֹר','kinnôwr','kin-nore\'','from a unused root meaning to twang; a harp; harp.'),
	('H3659','כׇּנְיָהוּ','Konyâhûw','kon-yaw\'-hoo','for יְכׇנְיָה; Conjah, an Israelite king; Coniah.'),
	('H3660','כְּנֵמָא','kᵉnêmâʼ','ken-ay-maw\'','(Aramaic) corresponding to כְּמוֹ; so or thus; so, (in) this manner (sort), thus.'),
	('H3661','כָּנַן','kânan','kaw-nan\'','a primitive root; to set out, i.e. plant; [idiom] vineyard.'),
	('H3662','כְּנָנִי','Kᵉnânîy','ken-aw-nee\'','from כָּנַן; planted; Kenani, an Israelite; Chenani.'),
	('H3663','כְּנַנְיָה','Kᵉnanyâh','ken-an-yaw\'','or כְּנַנְיָהוּ; from כָּנַן and יָהּ; Jah has planted; Kenanjah, an Israelite; Chenaniah.'),
	('H3664','כָּנַס','kânaç','kaw-nas\'','a primitive root; to collect; hence, to enfold; gather (together), heap up, wrap self.'),
	('H3665','כָּנַע','kânaʻ','kaw-nah\'','a primitive root; properly, to bend the knee; hence, to humiliate, vanquish; bring down (low), into subjection, under, humble (self), subdue.'),
	('H3666','כִּנְעָה','kinʻâh','kin-aw\'','from כָּנַע in the sense of folding (compare כָּנַס); a package; wares.'),
	('H3667','כְּנַעַן','Kᵉnaʻan','ken-ah\'-an','from כָּנַע; humiliated; Kenaan, a son a Ham; also the country inhabited by him; Canaan, merchant, traffick.'),
	('H3668','כְּנַעֲנָה','Kᵉnaʻănâh','ken-ah-an-aw\'','feminine of כְּנַעַן; Kenaanah, the name of two Israelites; Chenaanah.'),
	('H3669','כְּנַעַנִי','Kᵉnaʻanîy','ken-ah-an-ee\'','patrial from כְּנַעַן; a Kenaanite or inhabitant of Kenaan; by implication, a pedlar (the Canaanites standing for their neighbors the Ishmaelites, who conducted mercantile caravans); Canaanite, merchant, trafficker.'),
	('H3670','כָּנַף','kânaph','kaw-naf\'','a primitive root; properly, to project laterally, i.e. probably (reflexive) to withdraw; be removed.'),
	('H3671','כָּנָף','kânâph','kaw-nawf\'','from כָּנַף; an edge or extremity; specifically (of a bird or army) a wing, (of a garment or bedclothing) a flap, (of the earth) a quarter, (of a building) a pinnacle; [phrase] bird, border, corner, end, feather(-ed), [idiom] flying, [phrase] (one an-) other, overspreading, [idiom] quarters, skirt, [idiom] sort, uttermost part, wing(-ed).'),
	('H3672','כִּנְּרוֹת','Kinnᵉrôwth','kin-ner-oth\'','or כִּנֶּרֶתlemma כִּנֶרֶת missing dagesh, corrected to כִּנֶּרֶת; respectively plural and singular feminine from the same as כִּנּוֹר; perhaps harp-shaped; Kinneroth or Kinnereth, a place in Palestine; Chinnereth, Chinneroth, Cinneroth.'),
	('H3673','כָּנַשׁ','kânash','kaw-nash\'','(Aramaic) corresponding to כָּנַס; to assemble; gather together.'),
	('H3674','כְּנָת','kᵉnâth','ken-awth\'','from כָּנָה; a colleague (as having the same title); companion.'),
	('H3675','כְּנָת','kᵉnâth','ken-awth\'','(Aramaic) corresponding to כְּנָת; {a colleague (as having the same title)}; companion.'),
	('H3676','כֵּס','kêç','kace','apparently a contraction for כִּסֵּא, but probably by erroneous transcription for נֵס; {a flag; also a sail; by implication, a flagstaff; generally a signal; figuratively, a token}; sworn.'),
	('H3677','כֶּסֶא','keçeʼ','keh\'-seh','or כֶּסֶה; apparently from כָּסָה; properly, fulness or the full moon, i.e. its festival; (time) appointed.'),
	('H3678','כִּסֵּא','kiççêʼ','kis-say\'','or כִּסֵּה; from כָּסָה; properly, covered, i.e. a throne (as canopied); seat, stool, throne.'),
	('H3679','כַּסְדַּי','Kaçday','kas-dah\'-ee','for כַּשְׂדִּי; {a Kasdite, or descendant of Kesed; by implication, a Chaldaean (as if so descended); also an astrologer (as if proverbial of that people}; Chaldean.'),
	('H3680','כָּסָה','kâçâh','kaw-saw\'','a primitive root; properly, to plump, i.e. fill up hollows; by implication, to cover (for clothing or secrecy); clad self, close, clothe, conceal, cover (self), (flee to) hide, overwhelm. Compare כָּשָׂה.'),
	('H3681','כָּסוּי','kâçûwy','kaw-soo\'-ee','passive participle of כָּסָה; properly, covered, i.e. (as noun) a covering; covering.'),
	('H3682','כְּסוּת','kᵉçûwth','kes-ooth\'','from כָּסָה; a cover (garment); figuratively, a veiling; covering, raiment, vesture.'),
	('H3683','כָּסַח','kâçach','kaw-sakh\'','a primitive root; to cut off; cut down (up).'),
	('H3684','כְּסִיל','kᵉçîyl','kes-eel\'','from כָּסַל; properly, fat, i.e. (figuratively) stupid or silly; fool(-ish).'),
	('H3685','כְּסִיל','Kᵉçîyl','kes-eel\'','the same as כְּסִיל; any notable constellation; specifically Orion (as if a burly one); constellation, Orion.'),
	('H3686','כְּסִיל','Kᵉçîyl','kes-eel\'','the same as כְּסִיל; Kesil, a place in Palestine; Chesil.'),
	('H3687','כְּסִילוּת','kᵉçîylûwth','kes-eel-ooth\'','from כְּסִיל; silliness; foolish.'),
	('H3688','כָּסַל','kâçal','kaw-sal\'','a primitive root; properly, to be fat, i.e. (figuratively) silly; be foolish.'),
	('H3689','כֶּסֶל','keçel','keh\'-sel','from כָּסַל; properly, fatness, i.e. by implication (literally) the loin (as the seat of the leaf fat) or (generally) the viscera; also (figuratively) silliness or (in a good sense) trust; confidence, flank, folly, hope, loin.'),
	('H3690','כִּסְלָה','kiçlâh','kis-law\'','lemma כְּסִלָה first two vowels, corrected to כִּסְלָה; feminine of כֶּסֶל; in a good sense, trust; in a bad one, silliness; confidence, folly.'),
	('H3691','כִּסְלֵו','Kiçlêv','kis-lave\'','probably of foreign origin; Kisleu, the 9th Hebrew month; Chisleu.'),
	('H3692','כִּסְלוֹן','Kiçlôwn','kis-lone\'','from כָּסַל; hopeful; Kislon, an Israelite; Chislon.'),
	('H3693','כְּסָלוֹן','Kᵉçâlôwn','kes-aw-lone\'','from כָּסַל; fertile; Kesalon, a place in Palestine; Chesalon.'),
	('H3694','כְּסֻלּוֹת','Kᵉçullôwth','kes-ool-loth\'','feminine plural of passive participle of כָּסַל; fattened; Kesulloth, a place in Palestine; Chesulloth.'),
	('H3695','כַּסְלֻחִים','Kaçluchîym','kas-loo\'-kheem','a plural probably of foreign derivation; Casluchim, a people cognate to the Egyptians; Casluhim.'),
	('H3696','כִּסְלֹת תָּבֹר','Kiçlôth Tâbôr','kis-loth\' taw-bore\'','from the feminine plural of כֶּסֶל and תָּבוֹר; flanks of Tabor; Kisloth-Tabor, a place in Palestine; Chisloth-tabor.'),
	('H3697','כָּסַם','kâçam','kaw-sam\'','a primitive root; to shear; [idiom] only, poll. Compare כִּרְסֵם.'),
	('H3698','כֻּסֶּמֶת','kuççemeth','koos-seh\'-meth','from כָּסַם; spelt (from its bristliness as if just shorn); fitches, rie.'),
	('H3699','כָּסַס','kâçaç','kaw-sas\'','a primitive root; to estimate; make count.'),
	('H3700','כָּסַף','kâçaph','kaw-saf\'','a primitive root; properly, to become pale, i.e. (by implication) to pine after; also to fear; (have) desire, be greedy, long, sore.'),
	('H3701','כֶּסֶף','keçeph','keh\'-sef','from כָּסַף; silver (from its pale color); by implication, money; money, price, silver(-ling).'),
	('H3702','כְּסַף','kᵉçaph','kes-af\'','(Aramaic) corresponding to כֶּסֶף; {silver (from its pale color); by implication, money}; money, silver.'),
	('H3703','כָּסִפְיָא','Kâçiphyâʼ','kaw-sif-yaw\'','perhaps from כֶּסֶף; silvery; Casiphja, a place in Babylon; Casiphia.'),
	('H3704','כֶּסֶת','keçeth','keh\'-seth','from כָּסָה; a cushion or pillow (as covering a seat or bed); pillow.'),
	('H3705','כְּעַן','kᵉʻan','keh-an\'','(Aramaic) probably from כֵּן; now; now.'),
	('H3706','כְּעֶנֶת','kᵉʻeneth','keh-eh\'-neth','(Aramaic) or כְּעֶת; (Aramaic), feminine of כְּעַן; thus (only in the formula \'and so forth\'); at such a time.'),
	('H3707','כַּעַס','kaʻaç','kaw-as\'','a primitive root; to trouble; by implication, to grieve, rage, be indignant; be angry, be grieved, take indignation, provoke (to anger, unto wrath), have sorrow, vex, be wroth.'),
	('H3708','כַּעַס','kaʻaç','kah\'-as','or (in Job) כַּעַשׂ; from כַּעַס; vexation; anger, angry, grief, indignation, provocation, provoking, [idiom] sore, sorrow, spite, wrath.'),
	('H3709','כַּף','kaph','kaf','from כָּפַף; the hollow hand or palm (so of the paw of an animal, of the sole, and even of the bowl of a dish or sling, the handle of a bolt, the leaves of a palm-tree); figuratively, power; branch, [phrase] foot, hand((-ful), -dle, (-led)), hollow, middle, palm, paw, power, sole, spoon.'),
	('H3710','כֵּף','kêph','kafe','from כָּפַף; a hollow rock; rock.'),
	('H3711','כָּפָה','kâphâh','kaw-faw\'','a primitive root; properly, to bend, i.e. (figuratively) to tame or subdue; pacify.'),
	('H3712','כִּפָּה','kippâh','kip-paw\'','feminine of כַּף; a leaf of a palmtree; branch.'),
	('H3713','כְּפוֹר','kᵉphôwr','kef-ore\'','from כָּפַר; properly, a cover, i.e. (by implication) a tankard (or covered goblet); also white frost (as covering the ground); bason, hoar(-y) frost.'),
	('H3714','כָּפִיס','kâphîyç','kaw-fece\'','from an unused root meaning to connect; a girder; beam.'),
	('H3715','כְּפִיר','kᵉphîyr','kef-eer\'','from כָּפַר; a village (as covered in by walls); also a young lion (perhaps as covered with a mane); (young) lion, village. Compare כָּפָר.'),
	('H3716','כְּפִירָה','Kᵉphîyrâh','kef-ee-raw\'','feminine of כְּפִיר; the village (always with the art.); Kephirah, a place in Palestine; Chephirah.'),
	('H3717','כָּפַל','kâphal','kaw-fal\'','a primitive root; to fold together; figuratively, to repeat; double.'),
	('H3718','כֶּפֶל','kephel','keh\'-fel','from כָּפַל; a duplicate; double.'),
	('H3719','כָּפַן','kâphan','kaw-fan\'','a primitive root; to bend; bend.'),
	('H3720','כָּפָן','kâphân','kaw-fawn\'','from כָּפַן; hunger (as making to stoop with emptiness and pain); famine.'),
	('H3721','כָּפַף','kâphaph','kaw-faf\'','a primitive root; to curve; bow down (self).'),
	('H3722','כָּפַר','kâphar','kaw-far\'','a primitive root; to cover (specifically with bitumen); figuratively, to expiate or condone, to placate or cancel; appease, make (an atonement, cleanse, disannul, forgive, be merciful, pacify, pardon, purge (away), put off, (make) reconcile(-liation).'),
	('H3723','כָּפָר','kâphâr','kaw-fawr\'','from כָּפַר; a village (as protected by walls); village. Compare כְּפִיר.'),
	('H3724','כֹּפֶר','kôpher','ko\'-fer','from כָּפַר; properly, a cover, i.e. (literally) a village (as covered in); (specifically) bitumen (as used for coating), and the henna plant (as used for dyeing); figuratively, a redemption-price; bribe, camphire, pitch, ransom, satisfaction, sum of money, village.'),
	('H3725','כִּפֻּר','kippur','kip-poor\'','from כָּפַר; expiation (only in plural); atonement.'),
	('H3726','כְּפַר הָעַמּוֹנִי','Kᵉphar hâ-ʻAmmôwnîy','kef-ar\' haw-am-monee\'','from כָּפָר and עַמּוֹנִי, with the article interposed; village of the Ammonite; Kefar-ha-Ammoni, a place in Palestine; Chefarhaamonai.'),
	('H3727','כַּפֹּרֶת','kappôreth','kap-po\'-reth','from כָּפַר; a lid (used only of the cover of the sacred Ark); mercy seat.'),
	('H3728','כָּפַשׁ','kâphash','kaw-fash\'','a primitive root; to tread down; figuratively, to humiliate; cover.'),
	('H3729','כְּפַת','kᵉphath','kef-ath\'','(Aramaic) a root of uncertain correspondence; to fetter; bind.'),
	('H3730','כַּפְתֹּר','kaphtôr','kaf-tore\'','or (Amos 9:1) כַּפְתּוֹר; probably from an unused root meaning to encircle; a chaplet; but used only in an architectonic sense, i.e. the capital of acolumn, or a wreath-like button or disk on the candelabrum; knop, (upper) lintel.'),
	('H3731','כַּפְתֹּר','Kaphtôr','kaf-tore\'','or (Amos 9:7) כַּפְתּוֹר; apparently the same as כַּפְתֹּר; Caphtor (i.e. a wreath-shaped island), the original seat of the Philistines; Caphtor.'),
	('H3732','כַּפְתֹּרִי','Kaphtôrîy','kaf-to-ree\'','patrial from כַּפְתֹּר; a Caphtorite (collectively) or native of Caphtor; Caphthorim, Caphtorim(-s).'),
	('H3733','כַּר','kar','kar','from כָּרַר in the sense of plumpness; a ram (as full-grown and fat), including a battering-ram (as butting); hence, a meadow (as for sheep); also a pad or camel\'s saddle (as puffed out); captain, furniture, lamb, (large) pasture, ram. See also בֵּית כַּר, כָּרִי.'),
	('H3734','כֹּר','kôr','kore','from the same as כּוּר; properly, a deep round vessel, i.e. (specifically) a cor or measure for things dry; cor, measure. Aramaic the same.'),
	('H3735','כָּרָא','Kârâʼ','kaw-raw\'','(Aramaic) probably corresponding to כָּרָה in the sense of piercing(figuratively); to grieve; be grieved.'),
	('H3736','כַּרְבֵּל','karbêl','kar-bale\'','from the same as כֶּבֶל; to gird or clothe; clothed.'),
	('H3737','כַּרְבְּלָא','karbᵉlâʼ','kar-bel-aw\'','(Aramaic) from a verb corresponding to that of כַּרְבֵּל; a mantle; hat.'),
	('H3738','כָּרָה','kârâh','kaw-raw\'','a primitive root; properly, to dig; figuratively, to plot; generally, to bore or open; dig, [idiom] make (a banquet), open.'),
	('H3739','כָּרָה','kârâh','kaw-raw\'','usually assigned as a primitive root, but probably only a special application of כָּרָה (through the common idea of planning implied in a bargain); to purchase; buy, prepare.'),
	('H3740','כֵּרָה','kêrâh','kay-raw\'','from כָּרָה; a purchase; provision.'),
	('H3741','כָּרָה','kârâh','kaw-raw\'','feminine of כַּר; a meadow; cottage.'),
	('H3742','כְּרוּב','kᵉrûwb','ker-oob\'','of uncertain derivation; a cherub or imaginary figure; cherub, (plural) cherubims.'),
	('H3743','כְּרוּב','Kᵉrûwb','ker-oob\'','the same as כְּרוּב; Kerub, a place in Babylon; Cherub.'),
	('H3744','כָּרוֹז','kârôwz','kaw-roze\'','(Aramaic) from כְּרַז; a herald; herald.'),
	('H3745','כְּרַז','kᵉraz','ker-az\'','(Aramaic) probably of Greek origin; to proclaim; make a proclamation.'),
	('H3746','כָּרִי','kârîy','kaw-ree\'','perhaps an abridged plural of כַּר in the sense of leader (of the flock); a life-guardsman; captains, Cherethites (from the margin).'),
	('H3747','כְּרִית','Kᵉrîyth','ker-eeth\'','from כָּרַת; a cut; Kerith, a brook of Palestine; Cherith.'),
	('H3748','כְּרִיתוּת','kᵉrîythûwth','ker-ee-thooth\'','from כָּרַת; a cutting (of the matrimonial bond), i.e. divorce; divorce(-ment).'),
	('H3749','כַּרְכֹּב','karkôb','kar-kobe\'','expanded from the same as כַּבּוֹן; a rim or top margin; compass.'),
	('H3750','כַּרְכֹּם','karkôm','kar-kome\'','probably of foreign origin; the crocus; saffron.'),
	('H3751','כַּרְכְּמִישׁ','Karkᵉmîysh','kar-kem-eesh\'','of foreign derivation; Karkemish, a place in Syria; Carchemish.'),
	('H3752','כַּרְכַּס','Karkaç','kar-kas\'','of Persian origin; Karkas, a eunuch of Xerxes; Carcas.'),
	('H3753','כַּרְכָּרָה','karkârâh','kar-kaw-raw\'','from כָּרַר; a dromedary (from its rapid motion as if dancing); swift beast.'),
	('H3754','כֶּרֶם','kerem','keh\'-rem','from an unused root of uncertain meaning; a garden or vineyard; vines, (increase of the) vineyard(-s), vintage. See also בֵּית הַכֶּרֶם.'),
	('H3755','כֹּרֵם','kôrêm','ko-rame\'','active participle of an imaginary denominative from כֶּרֶם; a vinedresser; vine dresser (as one or two words).'),
	('H3756','כַּרְמִי','Karmîy','kar-mee\'','from כֶּרֶם; gardener; Karmi, the name of three Israelites; Carmi.'),
	('H3757','כַּרְמִי','Karmîy','kar-mee\'','patronymically from כַּרְמִי; a Karmite or descendant of Karmi; Carmites.'),
	('H3758','כַּרְמִיל','karmîyl','kar-mele\'','probably of foreign origin; carmine, a deep red; crimson.'),
	('H3759','כַּרְמֶל','karmel','kar-mel\'','from כֶּרֶם; a planted field (garden, orchard, vineyard or park); by implication, garden produce; full (green) ears (of corn), fruitful field (place), plentiful (field).'),
	('H3760','כַּרְמֶל','Karmel','kar-mel\'','the same as כַּרְמֶל; Karmel, the name of a hill and of a town in Palestine; Carmel, fruitful (plentiful) field, (place).'),
	('H3761','כַּרְמְלִי','Karmᵉlîy','kar-mel-ee\'','patron from כַּרְמֶל; a Karmelite or inhabitant of Karmel (the town); Carmelite.'),
	('H3762','כַּרְמְלִית','Karmᵉlîyth','kar-mel-eeth\'','feminine of כַּרְמְלִי; a Karmelitess or female inhabitant of Karmel; Carmelitess.'),
	('H3763','כְּרָן','Kᵉrân','ker-awn\'','of uncertain derivation; Keran, an aboriginal Idumaean; Cheran.'),
	('H3764','כׇּרְסֵא','korçêʼ','kor-say\'','(Aramaic) corresponding to כִּסֵּא; a throne; throne.'),
	('H3765','כִּרְסֵם','kirçêm','kir-same\'','from כָּסַם; to lay waste; waste.'),
	('H3766','כָּרַע','kâraʻ','kaw-rah\'','a primitive root; to bend the knee; by implication, to sink, to prostrate; bow (down, self), bring down (low), cast down, couch, fall, feeble, kneeling, sink, smite (stoop) down, subdue, [idiom] very.'),
	('H3767','כָּרָע','kârâʻ','kaw-raw\'','from כָּרַע; the leg (from the knee to the ankle) of men or locusts (only in the dual); leg.'),
	('H3768','כַּרְפַּס','karpaç','kar-pas\'','of foreign origin; byssus or fine vegetable wool; green.'),
	('H3769','כָּרַר','kârar','kaw-rar\'','a primitive root; to dance (i.e. whirl); dance(-ing).'),
	('H3770','כְּרֵשׂ','kᵉrês','ker-ace\'','by variation from קָרַס; the paunch or belly (as swelling out); belly.'),
	('H3771','כַּרְשְׁנָא','Karshᵉnâʼ','kar-shen-aw\'','of foreign origin; Karshena, a courtier of Xerxes; Carshena.'),
	('H3772','כָּרַת','kârath','kaw-rath\'','a primitive root; to cut (off, down or asunder); by implication, to destroy or consume; specifically, to covenant (i.e. make an alliance or bargain, originally by cutting flesh and passing between the pieces); be chewed, be con-(feder-) ate, covenant, cut (down, off), destroy, fail, feller, be freed, hew (down), make a league (covenant), [idiom] lose, perish, [idiom] utterly, [idiom] want.'),
	('H3773','כָּרֻתָה','kâruthâh','kaw-rooth-aw\'','passive participle feminine of כָּרַת; something cut, i.e. a hewn timber; beam.'),
	('H3774','כְּרֵתִי','Kᵉrêthîy','ker-ay-thee\'','probably from כָּרַת in the sense of executioner; (compare טַבָּח) (only collectively in the singular as plural); a Kerethite or life-guardsman; Cherethims, Cherethites.'),
	('H3775','כֶּשֶׂב','keseb','keh\'-seb','apparently by transposition for כֶּבֶשׂ; a young sheep; lamb.'),
	('H3776','כִּשְׂבָּה','kisbâh','kis-baw\'','feminine of כֶּשֶׂב; a young ewe; lamb.'),
	('H3777','כֶּשֶׂד','Kesed','keh\'-sed','from an unused root of uncertain meaning; Kesed, a relative of Abraham; Chesed.'),
	('H3778','כַּשְׂדִּי','Kasdîy','kas-dee\'','(occasionally with enclitic) כַּשְׂדִּימָה; towards the Kasdites into Chaldea), patronymically from כֶּשֶׂד (only in the plural); a Kasdite, or descendant of Kesed; by implication, a Chaldaean (as if so descended); also an astrologer (as if proverbial of that people; Chaldeans, Chaldees, inhabitants of Chaldea.'),
	('H3779','כַּשְׂדַּי','Kasday','kas-dah\'-ee','(Aramaic) corresponding to כַּשְׂדִּי; a Chaldaean or inhabitant of Chaldaea; by implication, a Magian or professional astrologer; Chaldean.'),
	('H3780','כָּשָׂה','kâsâh','kaw-saw\'','a primitive root; to grow fat (i.e. be covered with flesh); be covered. Compare כָּסָה.'),
	('H3781','כַּשִּׁיל','kashshîyl','kash-sheel\'','from כָּשַׁל; properly, a feller, i.e. an axe; ax.'),
	('H3782','כָּשַׁל','kâshal','kaw-shal\'','a primitive root; to totter or waver (through weakness of the legs, especially the ankle); by implication, to falter, stumble, faint or fall; bereave (from the margin), cast down, be decayed, (cause to) fail, (cause, make to) fall (down, -ing), feeble, be (the) ruin(-ed, of), (be) overthrown, (cause to) stumble, [idiom] utterly, be weak.'),
	('H3783','כִּשָּׁלוֹן','kishshâlôwn','kish-shaw-lone\'','from כָּשַׁל; properly, a tottering, i.e. ruin; fall.'),
	('H3784','כָּשַׁף','kâshaph','kaw-shaf\'','a primitive root; properly, to whisper aspell, i.e. to inchant or practise magic; sorcerer, (use) witch(-craft).'),
	('H3785','כֶּשֶׁף','kesheph','keh\'-shef','from כָּשַׁף; magic; sorcery, witchcraft.'),
	('H3786','כַּשָּׁף','kashshâph','kash-shawf\'','from כָּשַׁף; a magician; sorcerer.'),
	('H3787','כָּשֵׁר','kâshêr','kaw-share\'','a primitive root properly, to be straight or right; by implication, to be acceptable; also to succeed or prosper; direct, be right, prosper.'),
	('H3788','כִּשְׁרוֹן','kishrôwn','kish-rone\'','from כָּשֵׁר; success, advantage; equity, good, right.'),
	('H3789','כָּתַב','kâthab','kaw-thab\'','a primitive root; to grave, by implication, to write (describe, inscribe, prescribe, subscribe); describe, record, prescribe, subscribe, write(-ing, -ten).'),
	('H3790','כְּתַב','kᵉthab','keth-ab\'','(Aramaic) corresponding to כָּתַב; {to grave, by implication, to write (describe, inscribe, prescribe, subscribe)}; write(-ten).'),
	('H3791','כָּתָב','kâthâb','kaw-thawb\'','from כָּתַב; something written, i.e. a writing, record or book; register, scripture, writing.'),
	('H3792','כְּתָב','kᵉthâb','keth-awb\'','(Aramaic) corresponding to כָּתָב; {something written, i.e. a writing, record or book}; prescribing, writing(-ten).'),
	('H3793','כְּתֹבֶת','kᵉthôbeth','keth-o\'-beth','from כָּתַב; a letter or other mark branded on the skin; [idiom] any (mark).'),
	('H3794','כִּתִּי','Kittîy','kit-tee\'','or כִּתִּיִּי; patrial from an unused name denoting Cyprus (only in the plural); a Kittite or Cypriote; hence, an islander in general, i.e. the Greeks or Romans on the shores opposite Palestine; Chittim, Kittim.'),
	('H3795','כָּתִית','kâthîyth','kaw-theeth\'','from כָּתַת; beaten, i.e. pure (oil); beaten.'),
	('H3796','כֹּתֶל','kôthel','ko\'-thel','from an unused root meaning to compact; a wall (as gathering inmates); wall.'),
	('H3797','כְּתַל','kᵉthal','keth-al\'','(Aramaic) corresponding to כֹּתֶל; {a wall (as gathering inmates)}; wall.'),
	('H3798','כִּתְלִישׁ','Kithlîysh','kith-leesh\'','lemma כְּתִלִישׁ first two vowels, corrected to כִּתְלִישׁ; from כֹּתֶל and אִישׁ; wall of a man; Kithlish, a place in Palestine; Kithlish.'),
	('H3799','כָּתַם','kâtham','kaw-tham\'','a primitive root; properly, to carve or engrave, i.e. (by implication) to inscribe indelibly; mark.'),
	('H3800','כֶּתֶם','kethem','keh\'-them','from כָּתַם; properly, something carved out, i.e. ore; hence, gold (pure as originally mined); ((most) fine, pure) gold(-en wedge).'),
	('H3801','כְּתֹנֶת','kᵉthôneth','keth-o\'-neth','or כֻּתֹּנֶת; from an unused root meaning to cover (compare כָּתֵף); a shirt; coat, garment, robe.'),
	('H3802','כָּתֵף','kâthêph','kaw-thafe\'','from an unused root meaning to clothe; the shoulder (proper, i.e. upper end of the arm; as being the spot where the garments hang); figuratively, side-piece or lateral projection of anything; arm, corner, shoulder(-piece), side, undersetter.'),
	('H3803','כָּתַר','kâthar','kaw-thar\'','a primitive root; to enclose; hence (in a friendly sense) to crown, (in a hostile one) to besiege; also to wait (as restraining oneself); beset round, compass about, be crowned inclose round, suffer.'),
	('H3804','כֶּתֶר','kether','keh\'-ther','from כָּתַר; properly, a circlet, i.e. a diadem; crown.'),
	('H3805','כֹתֶרֶת','kôthereth','ko-theh\'-reth','feminine active participle of כָּתַר; the capital of a column; chapiter.'),
	('H3806','כָּתַשׁ','kâthash','kaw-thash\'','a primitive root; to butt or pound; bray.'),
	('H3807','כָּתַת','kâthath','kaw-thath\'','a primitive root; to bruise or violently strike; beat (down, to pieces), break in pieces, crushed, destroy, discomfit, smite, stamp. l'),
	('H3808','לֹא','lôʼ','lo','or לוֹא; or לֹה; (Deuteronomy 3:11), a primitive particle; not (the simple or abs. negation); by implication, no; often used with other particles; [idiom] before, [phrase] or else, ere, [phrase] except, ig(-norant), much, less, nay, neither, never, no((-ne), -r, (-thing)), ([idiom] as though...,(can-), for) not (out of), of nought, otherwise, out of, [phrase] surely, [phrase] as truly as, [phrase] of a truth, [phrase] verily, for want, [phrase] whether, without.'),
	('H3809','לָא','lâʼ','law','(Aramaic) or לָה; (Aramaic) (Daniel 4:32), corresponding to לֹא; {not (the simple or abs. negation); by implication, no;}; or even, neither, no(-ne, -r), (can-) not, as nothing, without.'),
	('H3810','לֹא דְבַר','Lôʼ Dᵉbar','lo deb-ar\'','or לוֹ דבַר; (Samuel 9:4,5), or לִדְבִר; (Joshua 13:26), (probably rather לֹדְבַר ); from לֹא and דֹּבֶר; pastureless; Lo-Debar, a place in Palestine; Debir, Lodebar.'),
	('H3811','לָאָה','lâʼâh','law-aw\'','a primitive root; to tire; (figuratively) to be (or make) disgusted; faint, grieve, lothe, (be, make) weary (selves).'),
	('H3812','לֵאָה','Lêʼâh','lay-aw\'','from לָאָה; weary; Leah, a wife of Jacob; Leah.'),
	('H3813','לָאַט','lâʼaṭ','law-at\'','a primitive root; to muffle; cover.'),
	('H3814','לָאט','lâʼṭ','lawt','from לָאַט (or perhaps for active participle of לוּט); properly, muffled, i.e. silently; softly.'),
	('H3815','לָאֵל','Lâʼêl','law-ale\'','from the prepositional prefix and אֵל; (belonging) to God; Lael an Israelite; Lael.'),
	('H3816','לְאֹם','lᵉʼôm','leh-ome\'','xlit lᵉôm corrected to lᵉʼôm; or לְאוֹם; from an unused root meaning to gather; a community; nation, people.'),
	('H3817','לְאֻמִּים','Lᵉʼummîym','leh-oom-meem\'','plural of לְאֹם; communities; Leum mim, an Arabian; Leummim.'),
	('H3818','לֹא עַמִּי','Lôʼ ʻAmmîy','lo am-mee\'','from לֹא and עַם with pronominal suffix; not my people; Lo-Ammi, the symbolic name of a son of Hosea; Lo-ammi.'),
	('H3819','לֹא רֻחָמָה','Lôʼ Ruchâmâh','lo roo-khaw-maw\'','from לֹא and רָחַם; not pitied; Lo-Ruchamah, the symbolic name of a son of Hosea; Lo-ruhamah.'),
	('H3820','לֵב','lêb','labe','a form of לֵבָב; the heart; also used (figuratively) very widely for the feelings, the will and even the intellect; likewise for the centre of anything; [phrase] care for, comfortably, consent, [idiom] considered, courag(-eous), friend(-ly), ((broken-), (hard-), (merry-), (stiff-), (stout-), double) heart(-ed), [idiom] heed, [idiom] I, kindly, midst, mind(-ed), [idiom] regard(-ed), [idiom] themselves, [idiom] unawares, understanding, [idiom] well, willingly, wisdom.'),
	('H3821','לֵב','lêb','labe','(Aramaic) corresponding to לֵב; {the heart; also used (figuratively) very widely for the feelings, the will and even the intellect; likewise for the centre of anything}; heart.'),
	('H3822','לְבָאוֹת','Lᵉbâʼôwth','leb-aw-oth\'','plural of לָבִיא; lionesses; Lebaoth, a place in Palestine; Lebaoth. See also בֵּית לְבָאוֹת.'),
	('H3823','לָבַב','lâbab','law-bab\'','a primitive root; properly, to be enclosed (as if with fat); by implication (as denominative from לֵבָב);  to unheart;  also as denominative from לָבִיבָה i.e.; (in a good sense) transport (with love), or (in a bad sense) stultify; to make cakes; make cakes, ravish, be wise.'),
	('H3824','לֵבָב','lêbâb','lay-bawb\'','from לָבַב; used also like לֵב; the heart (as the most interior organ); [phrase] bethink themselves, breast, comfortably, courage, ((faint), (tender-) heart(-ed), midst, mind, [idiom] unawares, understanding.'),
	('H3825','לְבַב','lᵉbab','leb-ab\'','(Aramaic) corresponding to לֵבָב; {the heart (as the most interior organ);}; heart.'),
	('H3826','לִבָּה','libbâh','lib-baw\'','feminine of לֵב; the heart; heart.'),
	('H3827','לַבָּה','labbâh','lab-baw\'','for לֶהָבָה; flame; flame.'),
	('H3828','לְבוֹנָה','lᵉbôwnâh','leb-o-naw\'','or לְבֹנָה; from לָבָן; frankincense (from its whiteness or perhaps that of its smoke); (frank-) incense.'),
	('H3829','לְבוֹנָה','Lᵉbôwnâh','leb-o-naw\'','the same as לְבוֹנָה; Lebonah, a place in Palestine; Lebonah.'),
	('H3830','לְבוּשׁ','lᵉbûwsh','leb-oosh\'','or לְבֻשׁ; from לָבַשׁ; a garment (literally or figuratively); by implication (euphemistically) a wife; apparel, clothed with, clothing, garment, raiment, vestment, vesture.'),
	('H3831','לְבוּשׁ','lᵉbûwsh','leb-oosh\'','(Aramaic) corresponding to לְבוּשׁ; {a garment (literally or figuratively); by implication (euphemistically) a wife}; garment.'),
	('H3832','לָבַט','lâbaṭ','law-bat\'','a primitive root; to overthrow; intransposed, to fall; fall.'),
	('H3833','לָבִיא','lâbîyʼ','law-bee\'','or (Ezekiel 19:2) לְבִיָּא; irregular masculine plural לְבָאִים; irregular feminine plural לְבָאוֹת; from an unused root meaning;  compare אֲרִי; to roar; a lion (properly, a lioness as the fiercer (although not a roarer;)); (great, old, stout) lion, lioness, young (lion).'),
	('H3834','לָבִיבָה','lâbîybâh','law-bee-baw\'','or rather לְבִבָה; from לָבַב in its original sense of fatness (or perhaps of folding); a cake (either as fried or turned); cake.'),
	('H3835','לָבַן','lâban','law-ban\'','a primitive root; also as denominative from לְבֵנָה; to be (or become) white;  to make bricks; make brick, be (made, make) white(-r).'),
	('H3836','לָבָן','lâbân','law-bawn\'','or (Genesis 49:12) לָבֵן; from לָבַן; white; white.'),
	('H3837','לָבָן','Lâbân','law-bawn\'','the same as לָבָן; Laban, a Mesopotamian; also a place in the Desert; Laban.'),
	('H3838','לְבָנָא','Lᵉbânâʼ','leb-aw-naw\'','or לְבָנָה; the same as לְבָנָה; Lebana or Lebanah, one of the Nethinim; Lebana, Lebanah.'),
	('H3839','לִבְנֶה','libneh','lib-neh\'','from לָבַן; some sort of whitish tree, perhaps the storax; poplar.'),
	('H3840','לִבְנָה','libnâh','lib-naw\'','from לָבַן; properly, whiteness, i.e. (by implication) transparency; paved.'),
	('H3841','לִבְנָה','Libnâh','lib-naw\'','the same as לִבְנֶה; Libnah, a place in the Desert and one in Palestine; Libnah.'),
	('H3842','לְבָנָה','lᵉbânâh','leb-aw-naw\'','from לָבַן; properly, (the) white, i.e. the moon; moon. See also לְבָנָא.'),
	('H3843','לְבֵנָה','lᵉbênâh','leb-ay-naw\'','from לָבַן; a brick (from the whiteness of the clay); (altar of) brick, tile.'),
	('H3844','לְבָנוֹן','Lᵉbânôwn','leb-aw-nohn\'','from לְבַב; (the) white mountain (from its snow); Lebanon, a mountain range in Palestine; Lebanon.'),
	('H3845','לִבְנִי','Libnîy','lib-nee\'','from לָבַן; white; Libni, an Israelite; Libni.'),
	('H3846','לִבְנִי','Libnîy','lib-nee\'','patronymically from לִבְנִי; a Libnite or descendants of Libni (collectively); Libnites.'),
	('H3847','לָבַשׁ','lâbash','law-bash\'','or לָבֵשׁ; a primitive root; properly, wrap around, i.e. (by implication) to put on agarment or clothe (oneself, or another), literally or figuratively; (in) apparel, arm, array (self), clothe (self), come upon, put (on, upon), wear.'),
	('H3848','לְבַשׁ','lᵉbash','leb-ash\'','(Aramaic) corresponding to לָבַשׁ; {properly, wrap around, i.e. (by implication) to put on agarment or clothe (oneself, or another), literally or figuratively}; clothe.'),
	('H3849','לֹג','lôg','lohg','from an unused root apparently meaning to deepen or hollow (like כַּד); a log or measure forliquids; log (of oil).'),
	('H3850','לֹד','Lôd','lode','from an unused root of uncertain signification; Lod, a place in Palestine; Lod.'),
	('H3851','לַהַב','lahab','lah\'-hab','from an usused root meaning to gleam; a flash; figuratively, a sharply polished blade or point of aweapon; blade, bright, flame, glittering.'),
	('H3852','לֶהָבָה','lehâbâh','leh-aw-baw\'','or לַהֶבֶת; feminine of לַהַב, and meaning the same; {a flash; figuratively, a sharply polished blade or point of aweapon}; flame(-ming), head (of a spear).'),
	('H3853','לְהָבִים','Lᵉhâbîym','leh-haw-beem\'','plural of לַהַב; flames; Lehabim, a son of Mizraim, and his descendants; Lehabim.'),
	('H3854','לַהַג','lahag','lah\'-hag','from an unused root meaning to be eager; intense mental application; study.'),
	('H3855','לַהַד','Lahad','lah\'-had','from an unused root meaning to glow (compare לַהַב) or else to be earnest (compare לַהַג); Lahad, an Israelite; Lahad.'),
	('H3856','לָהַהּ','lâhahh','law-hah\'','a primitive root meaning properly, to burn, i.e. (by implication); to be rabid (figuratively, insane); also (from the exhaustion of frenzy) to languish; faint, mad.'),
	('H3857','לָהַט','lâhaṭ','law-hat\'','a primitive root; properly, to lick, i.e. (by implication) to blaze; burn (up), set on fire, flaming, kindle.'),
	('H3858','לַהַט','lahaṭ','lah\'-hat','from לָהַט; a blaze; also (from the idea of enwrapping) magic (as covert); flaming, enchantment.'),
	('H3859','לָהַם','lâham','law-ham\'','a primitive root; properly, to burn in, i.e. (figuratively) to rankle; wound.'),
	('H3860','לָהֵן','lâhên','law-hane\'','from the prepositional prefix meaning to or for and הֵן; popularly for if; hence, therefore; for them (by mistake for prepositional suffix).'),
	('H3861','לָהֵן','lâhên','law-hane\'','xlit lâwhên corrected to lâhên; (Aramaic) corresponding to לָהֵן; therefore; also except; but, except, save, therefore, wherefore.'),
	('H3862','לַהֲקָה','lahăqâh','lah-hak-aw\'','probably from an unused root meaning to gather; an assembly; company.'),
	('H3863','לוּא','lûwʼ','loo','or לֻא; or לוּ; a conditional particle; if; by implication (interj. as a wish) would that!; if (haply), peradventure, I pray thee, though, I would, would God (that).'),
	('H3864','לוּבִי','Lûwbîy','loo-bee\'','or לֻבִּי; (Daniel 11:43), partrial from a name probably derived from an unused root meaning to thirst, i.e. a dry region; apparently; a Libyan or inhabitant of interior Africa (only in plural); Lubim(-s), Libyans.'),
	('H3865','לוּד','Lûwd','lood','probably of foreign derivation; Lud, the name of two nations; Lud, Lydia.'),
	('H3866','לוּדִי','Lûwdîy','loo-dee\'','or לוּדִיִּי; patrial from לוּד; a Ludite or inhabitants of Lud (only in plural); Ludim. Lydians.'),
	('H3867','לָוָה','lâvâh','law-vaw\'','a primitive root; properly, to twine, i.e. (by implication) to unite, to remain; also to borrow (as a form of obligation) or (caus.) to lend; abide with, borrow(-er), cleave, join (self), lend(-er).'),
	('H3868','לוּז','lûwz','looz','a primitive root; (compare לָוָה, לוּט and לוּן); to turn aside , i.e. (literally) to depart, (figuratively) be perverse; depart, froward, perverse(-ness).'),
	('H3869','לוּז','lûwz','looz','probably of foreign origin; some kind of nuttree, perhaps the almond; hazel.'),
	('H3870','לוּז','Lûwz','looz','probably from לוּז (as growing there); Luz, the name of two places in Palestine; Luz.'),
	('H3871','לוּחַ','lûwach','loo\'-akh','or לֻחַ; from a primitive root; probably meaning to glisten; a tablet (as polished), of stone, wood or metal; board, plate, table.'),
	('H3872','לוּחִית','Lûwchîyth','loo-kheeth\'','or לֻחוֹת; (Jeremiah 48:5), from the same as לוּחַ; floored; Luchith, a place East of the Jordan; Luhith.'),
	('H3873','לוֹחֵשׁ','Lôwchêsh','lo-khashe\'','active participle of לָחַשׁ; (the) enchanter; Lochesh, an Israelite; Hallohesh, Haloshesh (includ. the article).'),
	('H3874','לוּט','lûwṭ','loot','a primitive root; to wrap up; cast, wrap.'),
	('H3875','לוֹט','lôwṭ','lote','from לוּט; a veil; covering.'),
	('H3876','לוֹט','Lôwṭ','lote','the same as לוֹט; Lot, Abraham\'s nephew; Lot.'),
	('H3877','לוֹטָן','Lôwṭân','lo-tawn\'','from לוֹט; covering; Lotan, an Idumaean; Lotan.'),
	('H3878','לֵוִי','Lêvîy','lay-vee\'','from לָוָה; attached; Levi, a son of Jacob; Levi. See also לֵוִי, לֵוִיִּי.'),
	('H3879','לֵוִי','Lêvîy','lay-vee\'','(Aramaic) corresponding to לִוְיָה; {something attached, i.e. a wreath}; Levite.'),
	('H3880','לִוְיָה','livyâh','liv-yaw\'','from לָוָה; something attached, i.e. a wreath; ornament.'),
	('H3881','לֵוִיִּי','Lêvîyîy','lay-vee-ee\'','or לֵוִי; patronymically from לֵוִי; a Levite or descendant of Levi; Leviite.'),
	('H3882','לִוְיָתָן','livyâthân','liv-yaw-thawn\'','from לָוָה; a wreathed animal, i.e. a serpent (especially the crocodile or some other large sea-monster); figuratively, the constellation of the dragon; also as a symbol of Babylon; leviathan, mourning.'),
	('H3883','לוּל','lûwl','lool','from an unused root meaning to fold back; a spiral step; winding stair. Compare לֻלָאָה.'),
	('H3884','לוּלֵא','lûwlêʼ','loo-lay\'','or לוּלֵי; from לוּא and לֹא; if not; except, had not, if (...not), unless, were it not that.'),
	('H3885','לוּן','lûwn','loon','or לִין; a primitive root; to stop (usually over night); by implication, to stay permanently; hence (in a bad sense) to be obstinate (especially in words, to complain); abide (all night), continue, dwell, endure, grudge, be left, lie all night, (cause to) lodge (all night, in, -ing, this night), (make to) murmur, remain, tarry (all night, that night).'),
	('H3886','לוּעַ','lûwaʻ','loo\'-ah','a primitive root; to gulp; figuratively, to be rash; swallow down (up).'),
	('H3887','לוּץ','lûwts','loots','a primitive root; properly, to make mouths at, i.e. to scoff; hence (from the effort to pronounce a foreign language) to interpret, or (generally) intercede; ambassador, have in derision, interpreter, make a mock, mocker, scorn(-er, -ful), teacher.'),
	('H3888','לוּשׁ','lûwsh','loosh','a primitive root; to knead; knead.'),
	('H3889','לוּשׁ','Lûwsh','loosh','from לוּשׁ; kneading; Lush, a place in Palestine; Laish (from the margin). Compare לַיִשׁ.'),
	('H3890','לְוָת','lᵉvâth','lev-awth\'','(Aramaic) from a root corresponding to לָוָה; properly, adhesion, i.e. (as preposition) with; [idiom] thee.'),
	('H3891','לְזוּת','lᵉzûwth','lez-ooth\'','from לוּז; perverseness; perverse.'),
	('H3892','לַח','lach','lakh','from an unused root meaning to be new; fresh, i.e. unused or undried; green, moist.'),
	('H3893','לֵחַ','lêach','lay\'-akh','from the same as לַח; freshness, i.e. vigor; natural force.'),
	('H3894','לָחוּם','lâchûwm','law-khoom\'','or לָחֻם; passive participle of לָחַם; properly, eaten, i.e. food; also flesh, i.e. body; while...is eating, flesh.'),
	('H3895','לְחִי','lᵉchîy','lekh-ee\'','from an unused root meaning to be soft; the cheek (from its fleshiness); hence, the jaw-bone; cheek (bone), jaw (bone).'),
	('H3896','לֶחִי','Lechîy','lekh\'-ee','a form of לְחִי; Lechi, a place in Palestine; Lehi. Compare also רָמַת לֶחִי.'),
	('H3897','לָחַךְ','lâchak','law-khak\'','a primitive root; to lick; lick (up).'),
	('H3898','לָחַם','lâcham','law-kham\'','a primitive root; to feed on; figuratively, to consume; by implication, to battle (as destruction); devour, eat, [idiom] ever, fight(-ing), overcome, prevail, (make) war(-ring).'),
	('H3899','לֶחֶם','lechem','lekh\'-em','from לָחַם; See also בֵּית לְעַפְרָה; food (for man or beast), especially bread, or grain (for making it); (shew-) bread, [idiom] eat, food, fruit, loaf, meat, victuals.'),
	('H3900','לְחֶם','lᵉchem','lekh-em\'','(Aramaic) corresponding to לֶחֶם; {(for man or beast), especially bread, or grain (for making it)}; feast.'),
	('H3901','לָחֶם','lâchem','law-khem\'','from לָחַם,; battle; war.'),
