	('H4022','מֶגֶד','meged','meh\'-ghed','from an unused root probably meaning to be eminent; properly, a distinguished thing; hence something valuable, as aproduct or fruit; pleasant, precious fruit (thing).'),
	('H4023','מְגִדּוֹן','Mᵉgiddôwn','meg-id-done\'','(Zechariah אַבְדָן) or מְגִדּוֹ; from גָּדַד; rendezvous; Megiddon or Megiddo, a place in Palestine; Megiddo, Megiddon.'),
	('H4024','מִגְדּוֹל','Migdôwl','mig-dole\'','or מִגְדֹּל; probably of Egyptian origin; Migdol, a place in Egypt; Migdol, tower.'),
	('H4025','מַגְדִּיאֵל','Magdîyʼêl','mag-dee-ale\'','from מֶגֶד and אֵל; preciousness of God; Magdiel, an Idumaean; Magdiel.'),
	('H4026','מִגְדָּל','migdâl','mig-dawl\'','also (in plural) feminine מִגְדָּלָה; from גָּדַל; a tower (from its size or height); by analogy, a rostrum; figuratively, a (pyramidal) bed of flowers; castle, flower, tower. Compare the names following.'),
	('H4027','מִגְדַּל־אֵל','Migdal-ʼÊl','mig-dal-ale\'','from מִגְדָּל and אֵל; tower of God; Migdal-El, a place in Palestine; Migdal-el.'),
	('H4028','מִגְדַּל־גָּד','Migdal-Gâd','migdal-gawd\'','from מִגְדָּל and גַּד; tower of Fortune; Migdal-Gad, a place in Palestine; Migdal-gad.'),
	('H4029','מִגְדַּל־עֵדֶר','Migdal-ʻÊder','mig-dal\'-ay\'-der','from מִגְדָּל and עֵדֶר; tower of a flock; Migdal-Eder, a place in Palestine; Migdal-eder, tower of the flock.'),
	('H4030','מִגְדָּנָה','migdânâh','mig-daw-naw\'','from the same as מֶגֶד; preciousness, i.e. a gem; precious thing, present.'),
	('H4031','מָגוֹג','Mâgôwg','maw-gogue\'','from גּוֹג; Magog, a son of Japheth; also a barbarous northern region; Magog.'),
	('H4032','מָגוֹר','mâgôwr','maw-gore\'','or (Lamentations 2:22) מָגוּר; from גּוּר in the sense of fearing; a fright (objective or subjective); fear, terror. Compare מָגוֹר מִסָּבִיב.'),
	('H4033','מָגוּר','mâgûwr','maw-goor\'','or מָגֻר; from גּוּר in the sense of lodging; a temporary abode; by extension, a permanent residence; dwelling, pilgrimage, where sojourn, be a stranger. Compare מָגוֹר.'),
	('H4034','מְגוֹרַה','mᵉgôwrah','meg-o-raw\'','feminine of מָגוֹר; affright; fear.'),
	('H4035','מְגוּרָה','mᵉgûwrâh','meg-oo-raw\'','feminine of מָגוֹר or of מָגוּר; a fright; also a granary; barn, fear.'),
	('H4036','מָגוֹר מִסָּבִיב','Mâgôwr miç-Çâbîyb','maw-gore\' mis-saw-beeb\'','from מָגוֹר and סָבִיב with the preposition inserted; affright from around; Magor-mis-Sabib, a symbolic name of Pashur; Magormissabib.'),
	('H4037','מַגְזֵרָה','magzêrâh','mag-zay-raw\'','from גָּזַר; a cutting implement, i.e. a blade; axe.'),
	('H4038','מַגָּל','maggâl','mag-gawl\'','from an unused root meaning to reap; a sickle; sickle.'),
	('H4039','מְגִלָּה','mᵉgillâh','meg-il-law\'','from גָּלַל; a roll; roll, volume.'),
	('H4040','מְגִלָּה','mᵉgillâh','meg-il-law\'','(Aramaic) corresponding to מְגִלָּה; {a roll}; roll.'),
	('H4041','מְגַמָּה','mᵉgammâh','meg-am-maw\'','from the same as גַּם; properly, accumulation, i.e. impulse or direction; sup up.'),
	('H4042','מָגַן','mâgan','maw-gan\'','a denominative from מָגֵן; properly, to shield; encompass with; figuratively, to rescue, to hand safely over (i.e. surrender); deliver.'),
	('H4043','מָגֵן','mâgên','maw-gane\'','also (in plural) feminine מְגִנָּה; from גָּנַן; a shield (i.e. the small one or buckler); figuratively, a protector; also the scaly hide of the crocodile; [idiom] armed, buckler, defence, ruler, [phrase] scale, shield.'),
	('H4044','מְגִנָּה','mᵉginnâh','meg-in-naw\'','from מָגַן; a covering (in a bad sense), i.e. blindness or obduracy; sorrow. See also מָגֵן.'),
	('H4045','מִגְעֶרֶת','migʻereth','mig-eh\'-reth','from גָּעַר; reproof (i.e. curse); rebuke.'),
	('H4046','מַגֵּפָה','maggêphâh','mag-gay-faw\'','from נָגַף; a pestilence; by analogy, defeat; ([idiom] be) plague(-d), slaughter, stroke.'),
	('H4047','מַגְפִּיעָשׁ','Magpîyʻâsh','mag-pee-awsh\'','apparently from גּוּף or נָגַף and עָשׁ; exterminator of (the) moth; Magpiash, an Israelite; Magpiash.'),
	('H4048','מָגַר','mâgar','maw-gar\'','a primitive root; to yield up; intensively, to precipitate; cast down, terror.'),
	('H4049','מְגַר','mᵉgar','meg-ar\'','(Aramaic) corresponding to מָגַר; to overthrow; destroy.'),
	('H4050','מְגֵרָה','mᵉgêrâh','meg-ay-raw\'','from גָּרַר; a saw; axe, saw.'),
	('H4051','מִגְרוֹן','Migrôwn','mig-rone\'','from מָגַר; precipice; Migron, a place in Palestine; Migron.'),
	('H4052','מִגְרָעָה','migrâʻâh','mig-raw-aw\'','from גָּרַע; a ledge or offset; narrowed rest.'),
	('H4053','מִגְרָפָה','migrâphâh','mig-raw-faw\'','from גָּרַף; something thrown off (by the spade), i.e. a clod; clod.'),
	('H4054','מִגְרָשׁ','migrâsh','mig-rawsh\'','also (in plural) feminine (Ezekiel 27:28) מִגְרָשָׁה; from גָּרַשׁ; a suburb (i.e. open country whither flocks are driven from pasture); hence, the area around abuilding, or the margin of the sea; cast out, suburb.'),
	('H4055','מַד','mad','mad','or מֵד; from מָדַד; properly, extent, i.e. height; also a measure; by implication, a vesture (as measured); also a carpet; armour, clothes, garment, judgment, measure, raiment, stature.'),
	('H4056','מַדְבַּח','madbach','mad-bakh\'','(Aramaic) from דְּבַח; a sacrificial altar; altar.'),
	('H4057','מִדְבָּר','midbâr','mid-bawr\'','from דָבַר in the sense of driving; a pasture (i.e. open field, whither cattle are driven); by implication, a desert; also speech (including its organs); desert, south, speech, wilderness.'),
	('H4058','מָדַד','mâdad','maw-dad\'','a primitive root; properly, to stretch; by implication, to measure (as if by stretching a line); figuratively, to be extended; measure, mete, stretch self.'),
	('H4059','מִדַּד','middad','mid-dad\'','from נָדַד; flight; be gone.'),
	('H4060','מִדָּה','middâh','mid-daw\'','feminine of מַד; properly, extension, i.e. height or breadth; also a measure (including its standard); hence a portion (as measured) or a vestment; specifically, tribute (as measured); garment, measure(-ing, meteyard, piece, size, (great) stature, tribute, wide.'),
	('H4061','מִדָּה','middâh','mid-daw\'','(Aramaic) or מִנְדָּה; (Aramaic), corresponding to מִדָּה; tribute in money; toll, tribute.'),
	('H4062','מַדְהֵבָה','madhêbâh','mad-hay-baw\'','perhaps from the equivalent of דְּהַב; goldmaking, i.e. exactness; golden city.'),
	('H4063','מֶדֶו','medev','meh\'-dev','from an unused root meaning to stretch; properly, extent, i.e. measure; by implication, a dress (as measured); garment.'),
	('H4064','מַדְוֶה','madveh','mad-veh\'','from דָּוָה; sickness; disease.'),
	('H4065','מַדּוּחַ','maddûwach','mad-doo\'akh','from נָדַח; seduction; cause of banishment.'),
	('H4066','מָדוֹן','mâdôwn','maw-dohn\'','from דִּין; a contest or quarrel; brawling, contention(-ous), discord, strife. Compare מִדְיָן, מְדָן.'),
	('H4067','מָדוֹן','mâdôwn','maw-dohn\'','from the same as מֶדֶו; extensiveness, i.e. height; stature.'),
	('H4068','מָדוֹן','Mâdôwn','maw-dohn\'','the same as מָדוֹן; Madon, a place in Palestine; Madon.'),
	('H4069','מַדּוּעַ','maddûwaʻ','mad-doo\'-ah','or מַדֻּעַ; from מָה and the passive participle of יָדַע; what (is) known?; i.e. (by implication) (adverbially) why?; how, wherefore, why.'),
	('H4070','מְדוֹר','mᵉdôwr','med-ore\'','(Aramaic) or מְדֹר; (Aramaic), or מְדָר; (Aramaic), from דּוּר; a dwelling; dwelling.'),
	('H4071','מְדוּרָה','mᵉdûwrâh','med-oo-raw\'','or מְדֻרָה; from דּוּר in the sense of accumulation; a pile of fuel; pile (for fire).'),
	('H4072','מִדְחֶה','midcheh','mid-kheh\'','from דָּחָה; overthrow; ruin.'),
	('H4073','מְדַחְפָה','mᵉdachphâh','med-akh-faw\'','from דָּחַף; a push, i.e. ruin; overthrow.'),
	('H4074','מָדַי','Mâday','maw-dah\'-ee','of foreign derivation; Madai, a country of central Asia; Madai, Medes, Media.'),
	('H4075','מָדַי','Mâday','maw-dah\'-ee','patrial from מָדַי; a Madian or native of Madai; Mede.'),
	('H4076','מָדַי','Mâday','maw-dah\'-ee','(Aramaic) corresponding to מָדַי; {Madai, a country of central Asia}; Mede(-s).'),
	('H4077','מָדַי','Mâday','maw-dah\'-ee','(Aramaic) corresponding to מָדַי; {a Madian or native of Madai}; Median.'),
	('H4078','מַדַּי','madday','mad-dah\'-ee','from מָה and דַּי; what (is) enough, i.e. sufficiently; sufficiently.'),
	('H4079','מִדְיָן','midyân','mid-yawn\'','a variation for מָדוֹן; {a contest or quarrel}; brawling, contention(-ous).'),
	('H4080','מִדְיָן','Midyân','mid-yawn\'','the same as מִדְיָן; Midjan, a son of Abraham; also his country and (collectively) his descendants; Midian, Midianite.'),
	('H4081','מִדִּין','Middîyn','mid-deen\'','a variation for מִדְיָן; {Midjan, a son of Abraham; also his country and (collectively) his descendants}; Middin.'),
	('H4082','מְדִינָה','mᵉdîynâh','med-ee-naw\'','from דִּין; properly, a judgeship, i.e. jurisdiction; by implication, a district (as ruled by a judge); generally, a region; ([idiom] every) province.'),
	('H4083','מְדִינָה','mᵉdîynâh','med-ee-naw\'','(Aramaic) corresponding to מְדִינָה; {properly, a judgeship, i.e. jurisdiction; by implication, a district (as ruled by a judge); generally, a region}; province.'),
	('H4084','מִדְיָנִי','Midyânîy','mid-yaw-nee\'','patronymical or patrial from מִדְיָן; a Midjanite or descendant (native) of Midjan; Midianite. Compare מְדָנִי.'),
	('H4085','מְדֹכָה','mᵉdôkâh','med-o-kaw\'','from דּוּךְ; a mortar; mortar.'),
	('H4086','מַדְמֵן','Madmên','mad-mane\'','from the same as דֹּמֶן; dunghill; Madmen, a place in Palestine; Madmen.'),
	('H4087','מַדְמֵנָה','madmênâh','mad-may-naw\'','feminine from the same as דֹּמֶן; a dunghill; dunghill.'),
	('H4088','מַדְמֵנָה','Madmênâh','mad-may-naw\'','the same as מַדְמֵנָה; Madmenah, a place in Palestine; Madmenah.'),
	('H4089','מַדְמַנָּה','Madmannâh','mad-man-naw\'','a variation for מַדְמֵנָה; Madmannah, a place in Palestine; Madmannah.'),
	('H4090','מְדָן','mᵉdân','med-awn\'','a form of מָדוֹן; {a contest or quarrel}; discord, strife.'),
	('H4091','מְדָן','Mᵉdân','med-awn\'','the same as מְדָן; Medan, a son of Abraham; Medan.'),
	('H4092','מְדָנִי','Mᵉdânîy','med-aw-nee\'','a variation of מִדְיָנִי; {a Midjanite or descendant (native) of Midjan}; Midianite.'),
	('H4093','מַדָּע','maddâʻ','mad-daw\'','or מַדַּע; from יָדַע; intelligence or consciousness; knowledge, science, thought.'),
	('H4094','מַדְקָרָה','madqârâh','mad-kaw-raw\'','from דָּקַר; a wound; piercing.'),
	('H4095','מַדְרֵגָה','madrêgâh','mad-ray-gaw\'','from an unused root meaning to step; properly, a step; by implication, a steep or inaccessible place; stair, steep place.'),
	('H4096','מִדְרָךְ','midrâk','mid-rawk\'','from דָּרַךְ; a treading, i.e. a place for stepping on; (foot-) breadth.'),
	('H4097','מִדְרָשׁ','midrâsh','mid-rawsh\'','from דָּרַשׁ; properly, an investigation, i.e. (by implication) a treatise or elaborate compilation; story.'),
	('H4098','מְדֻשָּׁה','mᵉdushshâh','med-oosh-shaw\'','from דּוּשׁ; a threshing, i.e. (concretely and figuratively) down-trodden people; threshing.'),
	('H4099','מְדָתָא','Mᵉdâthâʼ','med-aw-thaw\'','xlit Mᵉdâthâ corrected to Mᵉdâthâʼ; of Persian origin; Medatha, the father of Haman; Hammedatha (including the article).'),
	('H4100','מָה','mâh','maw','or מַה; or מָ; or מַ; also מֶה; a primitive particle; properly, interrogative what? (including how? why? when?); but also exclamation, what! (including how!), or indefinitely what (including whatever, and even relatively, that which); often used with prefixes in various adverbial or conjunctive senses; how (long, oft, (-soever)), (no-) thing, what (end, good, purpose, thing), whereby(-fore, -in, -to, -with), (for) why.'),
	('H4101','מָה','mâh','maw','(Aramaic) corresponding to מָה; {properly, interrogative what? (including how? why? when?); but also exclamation, what! (including how!), or indefinitely what}; how great (mighty), that which, what(-soever), why.'),
	('H4102','מָהַהּ','mâhahh','maw-hah\'','apparently a denominative from מָה; properly, to question or hesitate, i.e. (by implication) to be reluctant; delay, linger, stay selves, tarry.'),
	('H4103','מְהוּמָה','mᵉhûwmâh','meh-hoo-maw\'','from הוּם; confusion or uproar; destruction, discomfiture, trouble, tumult, vexation, vexed.'),
	('H4104','מְהוּמָן','Mᵉhûwmân','meh-hoo-mawn\'','of Persian origin; Mehuman, a eunuch of Xerxes; Mehuman.'),
	('H4105','מְהֵיטַבְאֵל','Mᵉhêyṭabʼêl','meh-hay-tab-ale\'','from יָטַב (augmented) and אֵל; bettered of God; Mehetabel, the name of an Edomitish man and woman; Mehetabeel, Mehetabel.'),
	('H4106','מָהִיר','mâhîyr','maw-here\'','or מָהִר; from מָהַר; quick; hence, skilful; diligent, hasty, ready.'),
	('H4107','מָהַל','mâhal','maw-hal\'','a primitive root; properly, to cut down or reduce, i.e. by implication, to adulterate; mixed.'),
	('H4108','מַהְלֵךְ','mahlêk','mah-lake\'','from הָלַךְ; a walking (plural collectively), i.e. access; place to walk.'),
	('H4109','מַהֲלָךְ','mahălâk','mah-hal-awk\'','from הָלַךְ; a walk, i.e. a passage or a distance; journey, walk.'),
	('H4110','מַהֲלָל','mahălâl','mah-hal-awl\'','from הָלַל; fame; praise.'),
	('H4111','מַהֲלַלְאֵל','Mahălalʼêl','mah-hal-al-ale\'','from מַהֲלָל and אֵל; praise of God; Mahalalel, the name of an antediluvian patriarch and of an Israelite; Mahalaleel.'),
	('H4112','מַהֲלֻמָּה','mahălummâh','mah-hal-oom-maw\'','from הָלַם; a blow; stripe, stroke.'),
	('H4113','מַהֲמֹרָה','mahămôrâh','mah-ham-o-raw\'','from an unused root of uncertain meaning; perhaps an abyss; deep pit.'),
	('H4114','מַהְפֵּכָה','mahpêkâh','mah-pay-kaw\'','from הָפַךְ; a destruction; when...overthrew, overthrow(-n).'),
	('H4115','מַהְפֶּכֶת','mahpeketh','mah-peh\'-keth','from הָפַךְ; a wrench, i.e. the stocks; prison, stocks.'),
	('H4116','מָהַר','mâhar','maw-har\'','a primitive root; properly, to be liquid or flow easily, i.e. (by implication); to hurry (in a good or a bad sense); often used (with another verb) adverbially, promptly; be carried headlong, fearful, (cause to make, in, make) haste(-n, -ily), (be) hasty, (fetch, make ready) [idiom] quickly, rash, [idiom] shortly, (be so) [idiom] soon, make speed, [idiom] speedily, [idiom] straightway, [idiom] suddenly, swift.'),
	('H4117','מָהַר','mâhar','maw-har\'','a primitive root (perhaps rather the same as מָהַר through the idea of readiness in assent); to bargain (for a wife), i.e. to wed; endow, [idiom] surely.'),
	('H4118','מַהֵר','mahêr','mah-hare\'','from מָהַר; properly, hurrying; hence (adverbially) in ahurry; hasteth, hastily, at once, quickly, soon, speedily, suddenly.'),
	('H4119','מֹהַר','môhar','mo\'-har','from מָהַר; a price (for a wife); dowry.'),
	('H4120','מְהֵרָה','mᵉhêrâh','meh-hay-raw\'','feminine of מַהֵר; properly, a hurry; hence (adverbially) promptly; hastily, quickly, shortly, soon, make (with) speed(-ily), swiftly.'),
	('H4121','מַהֲרַי','Mahăray','mah-har-ah\'-ee','from מָהַר; hasty; Maharai, an Israelite; Maharai.'),
	('H4122','מַהֵר שָׁלָל חָשׁ בַּז','Mahêr Shâlâl Châsh Baz','mah-hare\' shaw-lawl\' khawsh baz','from מַהֵר and שָׁלָל and חוּשׁ and בַּז; hasting (is he (the enemy) to the) booty, swift (to the) prey; Maher-Shalal-Chash-Baz; the symbolical name of the son of Isaiah; Maher-sha-lal-bash-baz.'),
	('H4123','מַהֲתַלָּה','mahăthallâh','mah-hath-al-law\'','from הָתַל; a delusion; deceit.'),
	('H4124','מוֹאָב','Môwʼâb','mo-awb','from a prolonged form of the prepositional prefix m-and אָב; from (her (the mother\'s)) father; Moab, an incestuous son of Lot; also his territory and descendants; Moab.'),
	('H4125','מוֹאָבִי','Môwʼâbîy','mo-aw-bee\'','feminine מוֹאָבִיָּה; or מוֹאָבִיתxlit Môwâbîyth corrected to Môwʼâbîyth; patronymical from מוֹאָב; a Moabite or Moabitess, i.e. a descendant from Moab; (woman) of Moab, Moabite(-ish, -ss).'),
	('H4126','מוֹבָא','môwbâʼ','mo-baw\'','by transp. for מָבוֹא; an entrance; coming.'),
	('H4127','מוּג','mûwg','moog','a primitive root; to melt, i.e. literally (to soften, flow down, disappear), or figuratively (to fear, faint); consume, dissolve, (be) faint(-hearted), melt (away), make soft.'),
	('H4128','מוּד','mûwd','mood','a primitive root; to shake; measure.'),
	('H4129','מוֹדַע','môwdaʻ','mo-dah\'','or rather מֹדָע; from יָדַע; an acquaintance; kinswoman.'),
	('H4130','מוֹדַעַת','môwdaʻath','mo-dah\'-ath','from יָדַע; acquaintance; kindred.'),
	('H4131','מוֹט','môwṭ','mote','a primitive root; to waver; by implication, to slip, shake, fall; be carried, cast, be out of course, be fallen in decay, [idiom] exceedingly, fall(-ing down), be (re-) moved, be ready, shake, slide, slip.'),
	('H4132','מוֹט','môwṭ','mote','from מוֹט; a wavering, i.e. fall; by implication, a pole (as shaking); hence, a yoke (as essentially a bent pole); bar, be moved, staff, yoke.'),
	('H4133','מוֹטָה','môwṭâh','mo-taw\'','feminine of מוֹט; a pole; by implication, an ox-bow; hence, a yoke (either literal or figurative); bands, heavy, staves, yoke.'),
	('H4134','מוּךְ','mûwk','mook','a primitive root; to become thin, i.e. (figuratively) be impoverished; be (waxen) poor(-er).'),
	('H4135','מוּל','mûwl','mool','a primitive root; to cut short, i.e. curtail (specifically the prepuce, i.e. to circumcise); by implication, to blunt; figuratively, to destroy; circumcise(-ing), selves), cut down (in pieces), destroy, [idiom] must needs.'),
	('H4136','מוּל','mûwl','mool','or מוֹל; (Deuteronomy 1:1), or מוֹאל; (Nehemiah 12:38), or מֻל; (Numbers 22:5), from מוּל; properly, abrupt, i.e. a precipice; by implication, the front; used only adverbially (with prepositional prefix) opposite; (over) against, before, (fore-) front, from, (God-) ward, toward, with.'),
	('H4137','מוֹלָדָה','Môwlâdâh','mo-law-daw\'','from יָלַד; birth; Moladah, a place in Palestine; Moladah.'),
	('H4138','מוֹלֶדֶת','môwledeth','mo-leh\'-deth','from יָלַד; nativity (plural birth-place); by implication, lineage, native country; also offspring, family; begotten, born, issue, kindred, native(-ity).'),
	('H4139','מוּלָה','mûwlâh','moo-law\'','from מוּל; circumcision; circumcision.'),
	('H4140','מוֹלִיד','Môwlîyd','mo-leed\'','from יָלַד; genitor; Molid, an Israelite; Molid.'),
	('H4141','מוּסָב','mûwçâb','moo-sawb\'','from סָבַב; a turn, i.e. circuit (of a building); winding about.'),
	('H4142','מוּסַבָּה','mûwçabbâh','moo-sab-baw\'','or מֻסַבָּה; feminine of מוּסָב; a reversal, i.e. the backside (of a gem), fold (of a double-leaved door), transmutation (of a name); being changed, inclosed, be set, turning.'),
	('H4143','מוּסָד','mûwçâd','moo-sawd\'','from יָסַד; a foundation; foundation.'),
