	('H4145','מוּסָדָה','mûwçâdâh','moo-saw-daw\'','feminine of מוּסָד; a foundation; figuratively, an appointment; foundation, grounded. Compare מְיֻסָּדָה.'),
	('H4146','מוֹסָדָה','môwçâdâh','mo-saw-daw\'','or מֹסָדָה; feminine of מוֹסָד; a foundation; foundation.'),
	('H4147','מוֹסֵר','môwçêr','mo-sare\'','also (in plural) feminine מוֹסֵרָה; or מֹסְרָה; from יָסַר; properly, chastisement, i.e. (by implication) a halter; figuratively, restraint; band, bond.'),
	('H4148','מוּסָר','mûwçâr','moo-sawr\'','from יָסַר; properly, chastisement; figuratively, reproof, warning or instruction; also restraint; bond, chastening(-eth), chastisement, check, correction, discipline, doctrine, instruction, rebuke.'),
	('H4149','מוֹסֵרָה','Môwçêrâh','mo-say-raw\'','or (plural) מֹסְרוֹת feminine of מוֹסֵר; correction or corrections; Moserah or Moseroth, a place in the Desert; Mosera, Moseroth.'),
	('H4150','מוֹעֵד','môwʻêd','mo-ade\'','or מֹעֵד; or (feminine) מוֹעָדָה; (2 Chronicles 8:13), from יָעַד; properly, an appointment, i.e. a fixed time or season; specifically, a festival; conventionally ayear; by implication, an assembly (as convened for a definite purpose); technically the congregation; by extension, the place of meeting; also a signal (as appointed beforehand); appointed (sign, time), (place of, solemn) assembly, congregation, (set, solemn) feast, (appointed, due) season, solemn(-ity), synogogue, (set) time (appointed).'),
	('H4151','מוֹעָד','môwʻâd','mo-awd\'','from יָעַד; (as in מוֹעֵד); properly, an assembly  figuratively, a troop; appointed time.'),
	('H4152','מוּעָדָה','mûwʻâdâh','moo-aw-daw\'','from יָעַד; an appointed place, i.e. asylum; appointed.'),
