	('H4154','מוּעֶדֶת','mûwʻedeth','moo-ay\'-deth','feminine passive participle of מָעַד; properly, made to slip, i.e. dislocated; out of joint.'),
	('H4155','מוּעָף','mûwʻâph','moo-awf\'','from עוּף; properly, covered, i.e. dark; abstractly, obscurity, i.e. distress; dimness.'),
	('H4156','מוֹעֵצָה','môwʻêtsâh','mo-ay-tsaw\'','from יָעַץ; a purpose; counsel, device.'),
	('H4157','מוּעָקָה','mûwʻâqâh','moo-aw-kaw\'','from עוּק; pressure, i.e. (figuratively) distress; affliction.'),
	('H4158','מוֹפַעַת','Môwphaʻath','mo-fah\'-ath','(Jeremiah 48:21) or מֵיפַעַת; or מֵפַעַת; from יָפַע; illuminative; Mophaath or Mephaath, a place in Palestine; Mephaath.'),
	('H4159','מוֹפֵת','môwphêth','mo-faith\'','or מֹפֵת; from יָפָה in the sense of conspicuousness; a miracle; by implication, a token or omen; miracle, sign, wonder(-ed at).'),
	('H4160','מוּץ','mûwts','moots','a primitive root; to press, i.e. (figuratively) to oppress; extortioner.'),
