	('H4162','מוֹצָא','môwtsâʼ','mo-tsaw\'','the same as מוֹצָא; Motsa, the name of two Israelites; Moza.'),
	('H4163','מוֹצָאָה','môwtsâʼâh','mo-tsaw-aw\'','feminine of מוֹצָא; (marg.; compare צוֹאָה); a family descent; also a sewer; draught house; going forth.'),
	('H4164','מוּצַק','mûwtsaq','moo-tsak\'','or מוּצָק; from יָצַק; narrowness; figuratively, distress; anguish, is straitened, straitness.'),
	('H4165','מוּצָק','mûwtsâq','moo-tsawk\'','from עָגִיל; properly, fusion, i.e. literally, a casting (of metal); figuratively, a mass (of clay); casting, hardness.'),
