	('H4167','מוּק','mûwq','mook','a primitive root; to jeer, i.e. (intens.) blaspheme; be corrupt.'),
	('H4168','מוֹקֵד','môwqêd','mo-kade\'','from יָקַד; a fire or fuel; abstractly, a conflagration; burning, hearth.'),
	('H4169','מוֹקְדָה','môwqᵉdâh','mo-ked-aw\'','feminine of מוֹקֵד; fuel; burning.'),
	('H4170','מוֹקֵשׁ','môwqêsh','mo-kashe\'','or מֹקֵשׁ; from יָקֹשׁ; a noose (for catching animals) (literally or figuratively); by implication, a hook (for the nose); be ensnared, gin, (is) snare(-d), trap.'),
	('H4171','מוּר','mûwr','moor','a primitive root; to alter; by implication, to barter, to dispose of; [idiom] at all, (ex-) change, remove.'),
	('H4172','מוֹרָא','môwrâʼ','mo-raw\'','or מֹרָא; or מוֹרָהxlit môrâh corrected to môwrâh; (Psalm 9:20), from יָרֵא; fear; by implication, a fearful thing or deed; dread, (that ought to be) fear(-ed), terribleness, terror.'),
	('H4173','מוֹרַג','môwrag','mo-rag\'','or מֹרַג; from an unused root meaning to triturate; a threshing sledge; threshing instrument.'),
	('H4174','מוֹרָד','môwrâd','mo-rawd\'','from יָרַד; a descent; as architecture, an ornamental appendage, perhaps a festoon; going down, steep place, thin work.'),
	('H4175','מוֹרֶה','môwreh','mo-reh\'','from יָרָה; (see יוֹרֶה); an archer; also teacher or teaching; also the early rain; (early) rain.'),
	('H4176','מוֹרֶה','Môwreh','mo-reh\'','or מֹרֶה; the same as מוֹרֶה; Moreh, a Canaanite; also a hill (perhaps named from him); Moreh.'),
	('H4177','מוֹרָה','môwrâh','mo-raw\'','from מוּר in the sense of shearing; a razor; razor.'),
