	('H4186','מוֹשָׁב','môwshâb','mo-shawb\'','or מֹשָׁב; from יָשַׁב; a seat; figuratively, a site; abstractly, a session; by extension an abode (the place or the time); by implication, population; assembly, dwell in, dwelling(-place), wherein (that) dwelt (in), inhabited place, seat, sitting, situation, sojourning.'),
	('H4187','מוּשִׁי','Mûwshîy','moo-shee\'','or מֻשִּׁי; from מוּשׁ; sensitive; Mushi, a Levite; Mushi.'),
