	('H4218','מִזְרָע','mizrâʻ','miz-raw\'','from זָרַע; a planted field; thing sown.'),
	('H4219','מִזְרָק','mizrâq','miz-rawk\'','from זָרַק; a bowl (as if for sprinkling); bason, bowl.'),
