	('H4243','מְחִיר','Mᵉchîyr','mekh-eer\'','the same as מְחִיר; price; Mechir, an Israelite; Mehir.'),
	('H4244','מַחְלָה','Machlâh','makh-law\'','from חָלָה; sickness; Machlah, the name apparently of two Israelitesses; Mahlah.'),
	('H4245','מַחֲלֶה','machăleh','makh-al-eh\'','or (feminine) מַחֲלָה; from חָלָה; sickness; disease, infirmity, sickness.'),
	('H4246','מְחֹלָה','mᵉchôlâh','mek-o-law\'','xlit mᵉchôwlâh corrected to mᵉchôlâh; feminine of מָחוֹל; a dance; company, dances(-cing).'),
	('H4247','מְחִלָּה','mᵉchillâh','mekh-il-law\'','from חָלַל; a cavern (as if excavated); cave.'),
	('H4248','מַחְלוֹן','Machlôwn','makh-lone\'','from חָלָה; sick; Machlon, an Israelite; Mahlon.'),
	('H4249','מַחְלִי','Machlîy','makh-lee\'','from חָלָה; sick; Machli, the name of two Israelites; Mahli.'),
	('H4250','מַחְלִי','Machlîy','makh-lee\'','patronymical from מַחְלִי; a Machlite or (collectively) descendants of Machli; Mahlites.'),
	('H4251','מַחְלֻי','machluy','makh-loo\'-ee','from חָלָה; a disease; disease.'),
	('H4252','מַחֲלָף','machălâph','makh-al-awf\'','from חָלַף; a (sacrificial) knife (as gliding through the flesh); knife.'),
	('H4253','מַחְלָפָה','machlâphâh','makh-law-faw\'','from חָלַף; a ringlet of hair (as gliding over each other); lock.'),
	('H4254','מַחֲלָצָה','machălâtsâh','makh-al-aw-tsaw\'','from חָלַץ; a mantle (as easily drawn off); changeable suit of apparel, change of raiment.'),
	('H4255','מַחְלְקָה','machlᵉqâh','makh-lek-aw\'','(Aramaic) corresponding to מַחֲלֹקֶת; a section (of the Levites); course.'),
	('H4256','מַחֲלֹקֶת','machălôqeth','makh-al-o\'-keth','from חָלַק; a section (of Levites, people or soldiers); company, course, division, portion. See also סֶלַע הַמַּחְלְקוֹת.'),
	('H4257','מַחֲלַת','machălath','makh-al-ath\'','from חָלָה; sickness; \'Machalath\', probably the title (initial word) of a popular song; Mahalath.'),
	('H4258','מַחֲלַת','Machălath','makh-al-ath\'','the same as מַחֲלַת; sickness; Machalath, the name of an Ishmaelitess and of an Israelitess; Mahalath.'),
	('H4259','מְחֹלָתִי','Mᵉchôlâthîy','mekh-o-law-thee\'','patrial from אָבֵל מְחוֹלָה; a Mecholathite or inhabitant of Abel-Mecholah; Mecholathite.'),
	('H4260','מַחֲמָאָה','machămâʼâh','makh-am-aw-aw\'','a denominative from חֶמְאָה; something buttery (i.e. unctuous and pleasant), as (figuratively) flattery; [idiom] than butter.'),
	('H4261','מַחְמָד','machmâd','makh-mawd\'','from חָמַד; delightful; hence, a delight, i.e. object of affection or desire; beloved, desire, goodly, lovely, pleasant (thing).'),
	('H4262','מַחְמֻד','machmud','makh-mood\'','or מַחְמוּד; from חָמַד; desired; hence, a valuable; pleasant thing.'),
	('H4263','מַחְמָל','machmâl','makh-mawl\'','from חָמַל; (by paronomasia with מַחְמָד) delight; properly, sympathy; pitieth.'),
	('H4264','מַחֲנֶה','machăneh','makh-an-eh\'','from חָנָה; an encampment (of travellers or troops); hence, an army, whether literal (of soldiers) or figurative (of dancers, angels, cattle, locusts, stars; or even the sacred courts); army, band, battle, camp, company, drove, host, tents.'),
	('H4265','מַחֲנֵה־דָן','Machănêh-Dân','makh-an-ay\'-dawn','from מַחֲנֶה and דָּן; camp of Dan; Machaneh-Dan, a place in Palestine; Mahaneh-dan.'),
	('H4266','מַחֲנַיִם','Machănayim','makh-an-ah\'-yim','dual of מַחֲנֶה; double camp; Machanajim, a place in Palestine; Mahanaim.'),
	('H4267','מַחֲנַק','machănaq','makh-an-ak\'','from חָנַק; choking; strangling.'),
	('H4268','מַחֲסֶה','machăçeh','makh-as-eh\'','or מַחְסֶה; from חָסָה; a shelter (literally or figuratively); hope, (place of) refuge, shelter, trust.'),
	('H4269','מַחְסוֹם','machçôwm','makh-sohm\'','from חָסַם; a muzzle; bridle.'),
	('H4270','מַחְסוֹר','machçôwr','makh-sore\'','or מַחְסֹר; from חָסֵר; deficiency; hence, impoverishment; lack, need, penury, poor, poverty, want.'),
	('H4271','מַחְסֵיָה','Machçêyâh','makh-say-yaw\'','from מַחֲסֶה and יָהּ; refuge of (i.e. in) Jah; Machsejah, an Israelite; Maaseiah.'),
	('H4272','מָחַץ','mâchats','maw-khats\'','a primitive root; to dash asunder; by implication, to crush, smash or violently plunge; figuratively, to subdue or destroy; dip, pierce (through), smite (through), strike through, wound.'),
	('H4273','מַחַץ','machats','makh\'-ats','from מָחַץ; a contusion; stroke.'),
	('H4274','מַחְצֵב','machtsêb','makh-tsabe\'','from חָצַב; properly, a hewing; concretely, a quarry; hewed(-n).'),
	('H4275','מֶחֱצָה','mechĕtsâh','mekh-ets-aw\'','from חָצָהlemma חָעָה ayin, corrected to חָצָה; a halving; half.'),
	('H4276','מַחֲצִית','machătsîyth','makh-ats-eeth\'','from חָצָהlemma חָעָה ayin, corrected to חָצָה; a halving or the middle; half (so much), mid(-day).'),
	('H4277','מָחַק','mâchaq','maw-khak\'','a primitive root; to crush; smite off.'),
	('H4278','מֶחְקָר','mechqâr','mekh-kawr\'','from חָקַר; properly, scrutinized, i.e. (by implication) a recess; deep place.'),
	('H4279','מָחָר','mâchâr','maw-khar\'','probably from אָחַר; properly, deferred, i.e. the morrow; usually (adverbially) tomorrow; indefinitely, hereafter; time to come, tomorrow.'),
	('H4280','מַחֲרָאָה','machărâʼâh','makh-ar-aw-aw\'','from the same as חֶרֶא; a sink; draught house.'),
	('H4281','מַחֲרֵשָׁה','machărêshâh','makh-ar-ay-shaw\'','from חָרַשׁ; probably a pick-axe; mattock.'),
	('H4282','מַחֲרֶשֶׁת','machăresheth','makh-ar-eh\'-sheth','from חָרַשׁ; probably a hoe; share.'),
	('H4283','מׇחֳרָת','mochŏrâth','mokh-or-awth\'','or מׇחֳרָתָם; (1 Samuel 30:17), feminine from the same as מָחָר; the morrow or (adverbially) tomorrow; morrow, next day.'),
	('H4284','מַחֲשָׁבָה','machăshâbâh','makh-ash-aw-baw\'','or מַחֲשֶׁבֶת; from חָשַׁב; a contrivance, i.e. (concretely) a texture, machine, or (abstractly) intention, plan (whether bad, a plot; or good, advice); cunning (work), curious work, device(-sed), imagination, invented, means, purpose, thought.'),
	('H4285','מַחְשָׁךְ','machshâk','makh-shawk\'','from חָשַׁךְ; darkness; concretely, a dark place; dark(-ness, place).'),
	('H4286','מַחְשֹׂף','machsôph','makh-sofe\'','from חָשַׂף; a peeling; made appear.'),
	('H4287','מַחַת','Machath','makh\'-ath','probably from מָחָה; erasure; Machath, the name of two Israelites; Mahath.'),
	('H4288','מְחִתָּה','mᵉchittâh','mekh-it-taw\'','from חָתָה; properly, a dissolution; concretely, a ruin, or (abstractly) consternation; destruction, dismaying, ruin, terror.'),
	('H4289','מַחְתָּה','machtâh','makh-taw\'','the same as מְחִתָּה in the sense of removal; a pan for live coals; censer, firepan, snuffdish.'),
	('H4290','מַחְתֶּרֶת','machtereth','makh-teh\'-reth','from חָתַר; a burglary; figuratively, unexpected examination; breaking up, secret search.'),
	('H4291','מְטָא','mᵉṭâʼ','met-aw\'','(Aramaic) or מְטָה; (Aramaic), apparently corresponding to מָצָא in the intransitive sense of being found present; to arrive, extend or happen; come, reach.'),
	('H4292','מַטְאֲטֵא','maṭʼăṭêʼ','mat-at-ay\'','apparently a denominative from טִיט; a broom (as removing dirt (compare English \'to dust\', i.e. remove dust)); besom.'),
	('H4293','מַטְבֵּחַ','maṭbêach','mat-bay\'-akh','from טָבַח; slaughter; slaughter.'),
	('H4294','מַטֶּה','maṭṭeh','mat-teh\'','or (feminine) מַטָּה; from נָטָה; a branch (as extending); figuratively, a tribe; also a rod, whether for chastising (figuratively, correction), ruling (a sceptre), throwing (a lance), or walking (a staff; figuratively, a support of life, e.g. bread); rod, staff, tribe.'),
	('H4295','מַטָּה','maṭṭâh','mat\'-taw','from עָוַר with directive enclitic appended; downward, below or beneath; often adverbially with or without prefixes; beneath, down(-ward), less, very low, under(-neath).'),
	('H4296','מִטָּה','miṭṭâh','mit-taw\'','from נָטָה; a bed (as extended) forsleeping or eating; by analogy, a sofa, litter or bier; bed(-chamber), bier.'),
	('H4297','מֻטֶּה','muṭṭeh','moot-teh\'','from נָטָה; a stretching, i.e. distortion (figuratively, iniquity); perverseness.'),
	('H4298','מֻטָּה','muṭṭâh','moot-taw\'','from נָטָה; expansion; stretching out.'),
	('H4299','מַטְוֶה','maṭveh','mat-veh\'','from טָוָה; something spun; spun.'),
	('H4300','מְטִיל','mᵉṭîyl','met-eel\'','from טוּל in the sense of hammering out; an iron bar (as forged); bar.'),
	('H4301','מַטְמוֹן','maṭmôwn','mat-mone\'','or מַטְמֹן; or מַטְמֻן; from טָמַן; a secret storehouse; hence, a secreted valuable (buried); generally money; hidden riches, (hid) treasure(-s).'),
	('H4302','מַטָּע','maṭṭâʻ','mat-taw\'','from נָטַע; something planted, i.e. the place (a garden or vineyard), or the thing (a plant, figuratively or men); by implication, the act, planting; plant(-ation, -ing).'),
	('H4303','מַטְעַם','maṭʻam','mat-am\'','or (feminine) מַטְעַמָּה; from טָעַם; a delicacy; dainty (meat), savoury meat.'),
	('H4304','מִטְפַּחַת','miṭpachath','mit-pakh\'-ath','from טָפַח; a wide cloak (for a woman); vail, wimple.'),
	('H4305','מָטַר','mâṭar','maw-tar\'','a primitive root; to rain; (cause to) rain (upon).'),
	('H4306','מָטַר','mâṭar','maw-tawr\'','from מָטַר; rain; rain.'),
	('H4307','מַטָּרָא','maṭṭârâʼ','mat-taw-raw\'','or מַטָּרָה; from נָטַר; a jail (as a guard-house); also an aim (as being closely watched); mark, prison.'),
	('H4308','מַטְרֵד','Maṭrêd','mat-rade\'','from טָרַד; propulsive; Matred, an Edomitess; Matred.'),
	('H4309','מַטְרִי','Maṭrîy','mat-ree\'','from מָטַר; rainy; Matri, an Israelite; Matri.'),
