	('H4311','מֵידְבָא','Mêydᵉbâʼ','may-deb-aw\'','from מַיִם and דֹּבֶא; water of quiet; Medeba, a place in Palestine; Medeba.'),
	('H4312','מֵידָד','Mêydâd','may-dawd\'','from יָדַד in the sense of loving; affectionate; Medad, an Israelite; Medad.'),
	('H4313','מֵי הַיַּרְקוֹן','Mêy hay-Yarqôwn','may hah\'-ee-yar-kone\'','from מַיִם and יֵרָקוֹן with the art. interposed; water of the yellowness; Me-haj-Jarkon, a place in Palestine; Me-jarkon.'),
	('H4314','מֵי זָהָב','Mêy Zâhâb','may zaw-hawb\'','from מַיִם and זָהָב, water of gold; Me-Zahab, an Edomite; Mezahab.'),
	('H4315','מֵיטָב','mêyṭâb','may-tawb\'','from יָטַב; the best part; best.'),
	('H4316','מִיכָא','Mîykâʼ','mee-kaw\'','a variation for מִיכָה; Mica, the name of two Israelites; Micha.'),
	('H4317','מִיכָאֵל','Mîykâʼêl','me-kaw-ale\'','from מִי and (the prefix derivative from) כִּי and אֵל; who (is) like God?; Mikael, the name of an archangel and of nine Israelites; Michael.'),
	('H4318','מִיכָה','Mîykâh','mee-kaw\'','an abbreviated form of מִיכָיָה; Micah, the name of seven Israelites; Micah, Micaiah, Michah.'),
	('H4319','מִיכָהוּ','Mîykâhûw','me-kaw\'-hoo','a contr. for מִיכָיְהוּ; Mikehu, an Israelite prophet; Micaiah (2 Chronicles 18:8).'),
	('H4320','מִיכָיָה','Mîykâyâh','me-kaw-yaw\'','from מִי and (the prefix derivative from) כִּי and יָהּ; who (is) like Jah?; Micajah, the name of two Israelites; Micah, Michaiah. Compare מִיכָה.'),
	('H4321','מִיכָיְהוּ','Mîykâyᵉhûw','me-kaw-yeh-hoo\'','or מִכָיְהוּ; (Jeremiah 36:11), abbreviated form for מִיכָיָהוּ; Mikajah, the name of three Israelites; Micah, Micaiah, Michaiah.'),
	('H4322','מִיכָיָהוּ','Mîykâyâhûw','me-kaw-yaw\'-hoo','for מִיכָיָה; Mikajah, the name of an Israelite and an Israelitess; Michaiah.'),
	('H4323','מִיכָל','mîykâl','me-kawl\'','from יָכֹל; properly, a container, i.e. a streamlet; brook.'),
	('H4324','מִיכָל','Mîykâl','me-kawl\'','apparently the same as מִיכָל; revulet; Mikal, Saul\'s daughter; Michal.'),
	('H4325','מַיִם','mayim','mah\'-yim','dual of a primitive noun (but used in a singular sense); water; figuratively, juice; by euphemism, urine, semen; [phrase] piss, wasting, water(-ing, (-course, -flood, -spring)).'),
	('H4326','מִיָּמִן','Mîyâmin','me-yaw-meem\'','a form for מִנְיָמִין; Mijamin, the name of three Israelites; Miamin, Mijamin.'),
	('H4327','מִין','mîyn','meen','from an unused root meaning to portion out; a sort, i.e. species; kind. Compare מִן.'),
	('H4328','מְיֻסָּדָה','mᵉyuççâdâh','meh-yoos-saw-daw\'','properly, feminine passive participle of יָסַד; something founded, i.e. a foundation; foundation.'),
	('H4329','מֵיסָךְ','mêyçâk','may-sawk\'','from סָכַךְ; a portico (as covered); covert.'),
	('H4330','מִיץ','mîyts','meets','from מוּץ; pressure; churning, forcing, wringing.'),
	('H4331','מֵישָׁא','Mêyshâʼ','may-shaw\'','from מוּשׁ; departure; Mesha, a place in Arabia; also an Israelite; Mesha.'),
	('H4332','מִישָׁאֵל','Mîyshâʼêl','mee-shaw-ale\'','from מִי and אֵל with the abbreviated form insep. relatively (see אֲשֶׁר) interposed; who (is) what God (is) ?; Mishael, the name of three Israelites; Mishael.'),
	('H4333','מִישָׁאֵל','Mîyshâʼêl','mee-shaw-ale\'','(Aramaic) corresponding to מִישָׁאֵל; Mishael, an Israelite; Mishael.'),
	('H4334','מִישׁוֹר','mîyshôwr','mee-shore\'','or מִישֹׁר; from יָשַׁר; a level, i.e. a plain (often used (with the article prefix) as a proper name of certain districts); figuratively, concord; also straightness, i.e. (figuratively) justice (sometimes adverbially, justly); equity, even place, plain, right(-eously), (made) straight, uprightness.'),
	('H4335','מֵישַׁךְ','Mêyshak','may-shak\'','borrowed from מֵישַׁךְ; Meshak, an Israelite; Meshak.'),
	('H4336','מֵישַׁךְ','Mêyshak','may-shak\'','(Aramaic) of foreign origin and doubtful significance; name of מִישָׁאֵל; Meshak, the Babylonian; Meshak.'),
	('H4337','מֵישָׁע','Mêyshâʻ','may-shah\'','from יָשַׁע; safety; Mesha, an Israelite; Mesha.'),
	('H4338','מֵישַׁע','Mêyshaʻ','may-shaw\'','a variation for מֵישָׁע; safety; Mesha, a Moabite; Mesha.'),
	('H4339','מֵישָׁר','mêyshâr','may-shawr\'','from יָשַׁר; evenness, i.e. (figuratively) prosperity or concord; also straightness, i.e. (figuratively) rectitude (only in plural with singular sense; often adverbially); agreement, aright, that are equal, equity, (things that are) right(-eously, things), sweetly, upright(-ly, -ness).'),
	('H4340','מֵיתָר','mêythâr','may-thar\'','from יָתַר; (compare יֶתֶר); a cord (of a tent); or the string (of a bow); cord, string.'),
	('H4341','מַכְאֹב','makʼôb','mak-obe\'','sometimes מַכְאוֹב; also (feminine Isaiah 53:3) מַכְאֹבָה; from כָּאַב; anguish or (figuratively) affliction; grief, pain, sorrow.'),
	('H4342','מַכְבִּיר','makbîyr','mak-beer\'','transitive participle of כָּבַר; plenty; abundance.'),
	('H4343','מַכְבֵּנָא','Makbênâʼ','mak-bay-naw\'','from the same as כַּבּוֹן; knoll; Macbena, a place in Palestine settled by him; Machbenah.'),
	('H4344','מַכְבַּנַּי','Makbannay','mak-ban-nah\'-ee','patrial from מַכְבֵּנָא; a Macbannite or native of Macbena; Machbanai.'),
	('H4345','מַכְבֵּר','makbêr','mak-bare\'','from כָּבַר in the sense of covering (compare כְּבָרָה); a grate; grate.'),
	('H4346','מַכְבָּר','makbâr','mak-bawr\'','from כָּבַר in the sense of covering; (compare מַכְבֵּר); a cloth (as netted); thick cloth.'),
	('H4347','מַכָּה','makkâh','mak-kaw\'','or (masculine) מַכֶּה; (plural only) from נָכָה; a blow (in 2 Chronicles 2:10, of the flail); by implication,; a wound; figuratively, carnage, also pestilence; beaten, blow, plague, slaughter, smote, [idiom] sore, stripe, stroke, wound(-ed).'),
	('H4348','מִכְוָה','mikvâh','mik-vaw\'','from כָּוָה; a burn; that burneth, burning.'),
	('H4349','מָכוֹן','mâkôwn','maw-kone\'','from כּוּן; properly, a fixture, i.e. a basis; generally a place, especially as an abode; foundation, habitation, (dwelling-, settled) place.'),
	('H4350','מְכוֹנָה','mᵉkôwnâh','mek-o-naw\'','or מְכֹנָה; feminine of מָכוֹן; a pedestal, also a spot; base.'),
	('H4351','מְכוּרָה','mᵉkûwrâh','mek-oo-raw\'','or מְכֹרָה; from the same as כּוּר in the sense of dipping; origin (as if a mine); birth, habitation, nativity.'),
	('H4352','מָכִי','Mâkîy','maw-kee\'','probably from מוּךְ; pining; Maki, an Israelite; Machi.'),
	('H4353','מָכִיר','Mâkîyr','maw-keer\'','from מָכַר; salesman; Makir, an Israelite; Machir.'),
	('H4354','מָכִירִי','Mâkîyrîy','maw-kee-ree\'','patronymical from מָכִיר; a Makirite or descendant of Makir; of Machir.'),
	('H4355','מָכַךְ','mâkak','maw-kak\'','a primitive root; to tumble (in ruins); figuratively, to perish; be brought low, decay.'),
	('H4356','מִכְלָאָה','miklâʼâh','mik-law-aw\'','or מִכְלָה; from כָּלָא; a pen (for flocks); (sheep-)fold. Compare מִכְלָה.'),
	('H4357','מִכְלָה','miklâh','mik-law\'','from כָּלָה; completion (in plural concrete adverbial, wholly); perfect. Compare מִכְלָאָה.'),
	('H4358','מִכְלוֹל','miklôwl','mik-lole\'','from כָּלַל; perfection (i.e. concrete adverbial, splendidly); most gorgeously, all sorts.'),
	('H4359','מִכְלָל','miklâl','mik-lawl\'','from כָּלַל; perfection (of beauty); perfection.'),
	('H4360','מִכְלֻל','miklul','mik-lool\'','from כָּלַל; something perfect, i.e. a splendid garment; all sorts.'),
	('H4361','מַכֹּלֶת','makkôleth','mak-ko\'-leth','from אָכַל; nourishment; food.'),
	('H4362','מִכְמַן','mikman','mik-man\'','from the same as כַּמֹּן in the sense of hiding; treasure (as hidden); treasure.'),
	('H4363','מִכְמָס','Mikmâç','mik-maws\'','(Ezra 2:2 or מִכְמָשׁ; or מִכְמַשׁ; (Nehemiah 11:31), from כָּמַס; hidden; Mikmas or Mikmash, a place in Palestine; Mikmas, Mikmash.'),
	('H4364','מַכְמָר','makmâr','mak-mawr\'','or מִכְמֹר; from כָּמַר in the sense of blackening by heat; a (hunter\'s) net (as dark from concealment); net.'),
	('H4365','מִכְמֶרֶת','mikmereth','mik-meh\'-reth','or מִכְמֹרֶת; feminine of מַכְמָר; a (fisher\'s) net; drag, net.'),
	('H4366','מִכְמְתָת','Mikmᵉthâth','mik-meth-awth\'','apparently from an unused root meaning to hide; concealment; Mikmethath, a place in Palestine; Michmethath.'),
	('H4367','מַכְנַדְבַי','Maknadbay','mak-nad-bah\'-ee','from מָה and נָדַב with a particle interposed; what (is) like (a) liberal (man) ?; Maknadbai, an Israelite; Machnadebai.'),
	('H4368','מְכֹנָה','Mᵉkônâh','mek-o-naw\'','the same as מְכוֹנָה; a base; Mekonah, a place in Palestine; Mekonah.'),
	('H4369','מְכֻנָה','mᵉkunâh','mek-oo-naw\'','the same as מְכוֹנָה; a spot; base.'),
	('H4370','מִכְנָס','miknâç','mik-nawce\'','from כָּמַס in the sense of hiding; (only in dual) drawers (from concealing the private parts); breeches.'),
	('H4371','מֶכֶס','mekeç','meh\'-kes','probably from an unused root meaning to enumerate; an assessment (as based upon a census); tribute.'),
	('H4372','מִכְסֶה','mikçeh','mik-seh\'','from כָּסָה; a covering, i.e. weatherboarding; covering.'),
	('H4373','מִכְסָה','mikçâh','mik-saw\'','feminine of מֶכֶס; an enumeration; by implication, a valuation; number, worth.'),
	('H4374','מְכַסֶּה','mᵉkaççeh','mek-as-seh\'','from כָּסָה; a covering, i.e. garment; specifically, a coverlet (for a bed), an awning (from the sun); also the omentum (as covering the intestines); clothing, to cover, that which covereth.'),
	('H4375','מַכְפֵּלָה','Makpêlâh','mak-pay-law\'','from כָּפַל; a fold; Makpelah, a place in Palestine; Machpelah.'),
	('H4376','מָכַר','mâkar','maw-kar\'','a primitive root; to sell, literally (as merchandise, a daughter in marriage, into slavery), or figuratively (to surrender); [idiom] at all, sell (away, -er, self).'),
	('H4377','מֶכֶר','meker','meh\'-ker','from מָכַר; merchandise; also value; pay, price, ware.'),
	('H4378','מַכָּר','makkâr','mak-kawr\'','from נָכַר; an acquaintance; acquaintance.'),
	('H4379','מִכְרֶה','mikreh','mik-reh\'','from כָּרָה; a pit (for salt); (salt-) pit.'),
	('H4380','מְכֵרָה','mᵉkêrâh','mek-ay-raw\'','probably from the same as כּוּר in the sense of stabbing; a sword; habitation.'),
	('H4381','מִכְרִי','Mikrîy','mik-ree\'','from מָכַר; salesman; Mikri, an Israelite; Michri.'),
	('H4382','מְכֵרָתִי','Mᵉkêrâthîy','mek-ay-raw-thee\'','patrial from an unused name (the same as מְכֵרָה) of a place in Palestine; a Mekerathite, or inhabitant of Mekerah; Mecherathite.'),
	('H4383','מִכְשׁוֹל','mikshôwl','mik-shole\'','or מִכְשֹׁל; masculine from כָּשַׁל; a stumbling-block, literally or figuratively (obstacle, enticement (specifically an idol), scruple); caused to fall, offence, [idiom] (no-) thing offered, ruin, stumbling-block.'),
	('H4384','מַכְשֵׁלָה','makshêlâh','mak-shay-law\'','feminine from כָּשַׁל; a stumbling-block, but only figuratively (fall, enticement (idol)); ruin, stumbling-block.'),
	('H4385','מִכְתָּב','miktâb','mik-tawb\'','from כָּתַב; a thing written, the characters, or a document (letter, copy, edict, poem); writing.'),
	('H4386','מְכִתָּה','mᵉkittâh','mek-it-taw\'','from כָּתַת; a fracture; bursting.'),
	('H4387','מִכְתָּם','miktâm','mik-tawm\'','from כָּתַם; an engraving, i.e. (techn.) a poem; Michtam.'),
	('H4388','מַכְתֵּשׁ','maktêsh','mak-taysh\'','from כָּתַשׁ; a mortar; by analogy, a socket (of a tooth); hollow place, mortar.'),
	('H4389','מַכְתֵּשׁ','Maktêsh','mak-taysh\'','the same as מַכְתֵּשׁ; dell; the Maktesh, a place in Jerusalem; Maktesh.'),
	('H4390','מָלֵא','mâlêʼ','maw-lay\'','or מָלָא; (Esther 7:5), a primitive root; to fill or (intransitively) be full of, in a wide application (literally and figuratively); accomplish, confirm, [phrase] consecrate, be at an end, be expired, be fenced, fill, fulfil, (be, become, [idiom] draw, give in, go) full(-ly, -ly set, tale), (over-) flow, fulness, furnish, gather (selves, together), presume, replenish, satisfy, set, space, take a (hand-) full, [phrase] have wholly.'),
	('H4391','מְלָא','mᵉlâʼ','mel-aw\'','(Aramaic) corresponding to מָלֵא; to fill; fill, be full.'),
	('H4392','מָלֵא','mâlêʼ','maw-lay\'','from מָלֵא; full (literally or figuratively) or filling (literally); also (concretely) fulness; adverbially, fully; [idiom] she that was with child, fill(-ed, -ed with), full(-ly), multitude, as is worth.'),
	('H4393','מְלֹא','mᵉlôʼ','mel-o\'','rarely מְלוֹא; or מְלוֹ; (Ezekiel [41:8), from מָלֵא; fulness (literally or figuratively); [idiom] all along, [idiom] all that is (there-) in, fill, ([idiom] that whereof...was) full, fulness, (hand-) full, multitude.'),
	('H4394','מִלֻּא','milluʼ','mil-loo\'','from מָלֵא; a fulfilling (only in plural), i.e. (literally) a setting (of gems), or (technically) consecration (also concretely, a dedicatory sacrifice); consecration, be set.'),
	('H4395','מְלֵאָה','mᵉlêʼâh','mel-ay-aw\'','feminine of מָלֵא; something fulfilled, i.e. abundance (of produce); (first of ripe) fruit, fulness.'),
	('H4396','מִלֻּאָה','milluʼâh','mil-loo-aw\'','feminine of מִלֻּא; a filling, i.e. setting (of gems); enclosing, setting.'),
	('H4397','מֲלְאָךְ','mălʼâk','mal-awk\'','from an unused root meaning to despatch as a deputy; a messenger; specifically, of God, i.e. an angel (also a prophet, priest or teacher); ambassador, angel, king, messenger.'),
	('H4398','מַלְאַךְ','malʼak','mal-ak\'','(Aramaic) corresponding to מֲלְאָךְ; an angel; angel.'),
	('H4399','מְלָאכָה','mᵉlâʼkâh','mel-aw-kaw\'','from the same as מֲלְאָךְ; properly, deputyship, i.e. ministry; generally, employment (never servile) or work (abstractly or concretely); also property (as the result of labor); business, [phrase] cattle, [phrase] industrious, occupation, ([phrase] -pied), [phrase] officer, thing (made), use, (manner of) work((-man), -manship).'),
	('H4400','מַלְאֲכוּת','malʼăkûwth','mal-ak-ooth\'','from the same as מֲלְאָךְ; a message; message.'),
	('H4401','מַלְאָכִי','Malʼâkîy','mal-aw-kee\'','xlit Malʻâkîy corrected to Malʼâkîy; from the same as מֲלְאָךְ; ministrative; Malaki, a prophet; Malachi.'),
	('H4402','מִלֵּאת','millêʼth','mil-layth\'','from מָלֵא; fulness, i.e. (concretely) a plump socket (of the eye); [idiom] fitly.'),
	('H4403','מַלְבּוּשׁ','malbûwsh','mal-boosh\'','or מַלְבֻּשׁ; from לָבַשׁ; a garment, or (collectively) clothing; apparel, raiment, vestment.'),
	('H4404','מַלְבֵּן','malbên','mal-bane\'','from לָבַן (denominative); a brickkiln; brickkiln.'),
	('H4405','מִלָּה','millâh','mil-law\'','from מָלַל (plural masculine as if from מִלֶּה; a word; collectively, a discourse; figuratively, a topic; [phrase] answer, by-word, matter, any thing (what) to say, to speak(-ing), speak, talking, word.'),
	('H4406','מִלָּה','millâh','mil-law\'','(Aramaic) corresponding to מִלָּה; a word, command, discourse, or subject; commandment, matter, thing. word.'),
	('H4407','מִלּוֹא','millôwʼ','mil-lo\'','or מִלֹּא; (2 Kings 12:20), from מָלֵא; a rampart (as filled in), i.e. the citadel; Millo. See also בֵּית מִלּוֹא.'),
	('H4408','מַלּוּחַ','mallûwach','mal-loo\'-akh','lemma מַלוּחַ missing dagesh, corrected to מַלּוּחַ; from מָלַח; sea-purslain (from its saltness); mallows.'),
	('H4409','מַלּוּךְ','Mallûwk','mal-luke\'','or מַלּוּכִי; (Nehemiah 12:14), from מָלַךְ; remnant; Malluk, the name of five Israelites; Malluch, Melichu (from the margin).'),
	('H4410','מְלוּכָה','mᵉlûwkâh','mel-oo-kaw\'','feminine passive participle of מָלַךְ; something ruled, i.e. a realm; kingsom, king\'s, [idiom] royal.'),
	('H4411','מָלוֹן','mâlôwn','maw-lone\'','from לוּן; a lodgment, i.e. caravanserai or encampment; inn, place where...lodge, lodging (place).'),
	('H4412','מְלוּנָה','mᵉlûwnâh','mel-oo-naw\'','feminine from לוּן; a hut, a hammock; cottage, lodge.'),
	('H4413','מַלּוֹתִי','Mallôwthîy','mal-lo\'-thee','apparently from מָלַל; I have talked (i.e. loquacious); Mallothi, an Israelite; Mallothi.'),
	('H4414','מָלַח','mâlach','maw-lakh\'','a primitive root; also as denominative from מֶלַח; properly, to rub to pieces or pulverize; intransitively, to disappear as dust; to salt whether internally (to season with salt) or externally (to rub with salt); [idiom] at all, salt, season, temper together, vanish away.'),
	('H4415','מְלַח','mᵉlach','mel-akh\'','(Aramaic) corresponding to מָלַח; to eat salt, i.e. (generally) subsist; [phrase] have maintenance.'),
	('H4416','מְלַח','mᵉlach','mel-akh\'','(Aramaic) from מְלַח; salt; [phrase] maintenance, salt.'),
	('H4417','מֶלַח','melach','meh\'-lakh','from מָלַח; properly, powder, i.e. (specifically) salt (as easily pulverized and dissolved); salt(-pit).'),
	('H4418','מָלָח','mâlâch','maw-lawkh\'','from מָלַח in its original sense; a rag or old garment; rotten rag.'),
	('H4419','מַלָּח','mallâch','mal-lawkh\'','from מָלַח in its second. sense; a sailor (as following \'the salt\'); mariner.'),
	('H4420','מְלֵחָה','mᵉlêchâh','mel-ay-khaw\'','from מָלַח (in its denominative sense); understood as land (אֶרֶץ); properly, salted (i.e. land), i.e. a desert; barren land(-ness), salt (land).'),
	('H4421','מִלְחָמָה','milchâmâh','mil-khaw-maw\'','from לָחַם (in the sense of fighting); a battle (i.e. the engagement); generally, war (i.e. warfare); battle, fight(-ing), war(-rior).'),
	('H4422','מָלַט','mâlaṭ','maw-lat\'','a primitive root; properly, to be smooth, i.e. (by implication) to escape (as if by slipperiness); causatively, to release or rescue; specifically, to bring forth young, emit sparks; deliver (self), escape, lay, leap out, let alone, let go, preserve, save, [idiom] speedily, [idiom] surely.'),
	('H4423','מֶלֶט','meleṭ','meh\'-let','from מָלַט,; cement (from its plastic smoothness); clay.'),
	('H4424','מְלַטְיָה','Mᵉlaṭyâh','mel-at-yaw\'','from מֶלֶט and יָהּ; (whom) Jah has delivered; Melatjah, a Gibeonite; Melatiah.'),
	('H4425','מְלִילָה','mᵉlîylâh','mel-ee-law\'','from מְלַל (in the sense of cropping (compare מוּל)); a head of grain (as cut off); ear.'),
	('H4426','מְלִיצָה','mᵉlîytsâh','mel-ee-tsaw\'','from לוּץ; an aphorism; also a satire; interpretation, taunting.'),
	('H4427','מָלַךְ','mâlak','maw-lak\'','a primitive root; to reign; inceptively, to ascend the throne; causatively, to induct into royalty; hence (by implication) to take counsel; consult, [idiom] indeed, be (make, set a, set up) king, be (make) queen, (begin to, make to) reign(-ing), rule, [idiom] surely.'),
	('H4428','מֶלֶךְ','melek','meh\'-lek','from מָלַךְ; a king; king, royal.'),
	('H4429','מֶלֶךְ','Melek','meh\'-lek','the same as מֶלֶךְ; king; Melek, the name of two Israelites; Melech, Hammelech (by including the article).'),
	('H4430','מֶלֶךְ','melek','meh\'-lek','(Aramaic) corresponding to מֶלֶךְ; a king; king, royal.'),
	('H4431','מְלַךְ','mᵉlak','mel-ak\'','(Aramaic) from a root corresponding to מָלַךְ in the sense of consultation; advice; counsel.'),
	('H4432','מֹלֶךְ','Môlek','mo\'-lek','from מָלַךְ; Molek (i.e. king), the chief deity of the Ammonites; Molech. Compare מַלְכָּם.'),
	('H4433','מַלְכָּא','malkâʼ','mal-kaw\'','(Aramaic) corresponding to מַלְכָּה; a queen; queen.'),
	('H4434','מַלְכֹּדֶת','malkôdeth','mal-ko\'-deth','from לָכַד; a snare; trap.'),
	('H4435','מִלְכָּה','Milkâh','mil-kaw\'','a form of מַלְכָּה; queen; Milcah, the name of a Hebrewess and of an Israelite; Milcah.'),
	('H4436','מַלְכָּה','malkâh','mal-kaw\'','feminine of מֶלֶךְ; a queen; queen.'),
	('H4437','מַלְכוּ','malkûw','mal-koo\'','(Aramaic) corresponding to מַלְכוּת; dominion (abstractly or concretely); kingdom, kingly, realm, reign.'),
	('H4438','מַלְכוּת','malkûwth','mal-kooth\'','or מַלְכֻת; or (in plural) מַלְכֻיָּה; from מָלַךְ; a rule; concretely, a dominion; empire, kingdom, realm, reign, royal.'),
	('H4439','מַלְכִּיאֵל','Malkîyʼêl','mal-kee-ale\'','from מֶלֶךְ and אֵל; king of (i.e. appointed by) God; Malkiel, an Israelite; Malchiel.'),
	('H4440','מַלְכִּיאֵלִי','Malkîyʼêlîy','mal-kee-ay-lee\'','patronymical from מַלְכִּיאֵל; a Malkielite or descendant of Malkiel; Malchielite.'),
	('H4441','מַלְכִּיָּה','Malkîyâh','mal-kee-yaw\'','or מַלְכִּיָּהוּlemma מַלְכִּיָהוּ missing dagesh, corrected to מַלְכִּיָּהוּ; (Jeremiah [38:6), from מֶלֶךְ and יָהּ; king of (i.e. appointed by) Jah; Malkijah, the name of ten Israelites; Malchiah, Malchijah.'),
	('H4442','מַלְכִּי־צֶדֶק','Malkîy-Tsedeq','mal-kee-tseh\'-dek','from מֶלֶךְ and צֶדֶק; king of right; Malki-Tsedek, an early king in Palestine; Melchizedek.'),
	('H4443','מַלְכִּירָם','Malkîyrâm','mal-kee-rawm\'','from מֶלֶךְ and רוּם; king of a high one (i.e. of exaltation); Malkiram, an Israelite; Malchiram.'),
	('H4444','מַלְכִּישׁוּעַ','Malkîyshûwaʻ','mal-kee-shoo\'-ah','from מֶלֶךְ and שׁוּעַ; king of wealth; Malkishua, an Israelite; Malchishua.'),
	('H4445','מַלְכָּם','Malkâm','mal-kawm\'','or מִלְכּוֹם; from מֶלֶךְ for מֹלֶךְ; Malcam or Milcom, the national idol of the Ammonites; Malcham, Milcom.'),
	('H4446','מְלֶכֶת','mᵉleketh','mel-eh\'-keth','from מָלַךְ; a queen; queen.'),
	('H4447','מֹלֶכֶת','Môleketh','mo-leh\'-keth','feminine active participle of מָלַךְ; queen; Moleketh, an Israelitess; Hammoleketh (including the article).'),
	('H4448','מָלַל','mâlal','maw-lal\'','a primitive root; to speak (mostly poetical) or say; say, speak, utter.'),
	('H4449','מְלַל','mᵉlal','mel-al\'','(Aramaic) corresponding to מָלַל; to speak; say, speak(-ing).'),
	('H4450','מִלֲלַי','Milălay','mee-lal-ah\'-ee','from מָלַל; talkative; Milalai, an Israelite; Milalai.'),
	('H4451','מַלְמָד','malmâd','mal-mawd\'','from לָמַד; a goad for oxen; goad.'),
	('H4452','מָלַץ','mâlats','maw-lats\'','a primitive root; to be smooth, i.e. (figuratively) pleasant; be sweet.'),
	('H4453','מֶלְצָר','meltsâr','mel-tsawr\'','of Persian derivation; the butler or other officer in the Babylonian court; Melzar.'),
	('H4454','מָלַק','mâlaq','maw-lak\'','a primitive root; to crack a joint; by implication, to wring the neck of afowl (without separating it); wring off.'),
	('H4455','מַלְקוֹחַ','malqôwach','mal-ko\'-akh','from לָקַח; transitively (in dual) the jaws (as taking food); intransitively, spoil (and captives) (as taken); booty, jaws, prey.'),
	('H4456','מַלְקוֹשׁ','malqôwsh','mal-koshe\'','from לָקַשׁ; (compare לֶקֶשׁ); the spring rain; figuratively, eloquence; latter rain.'),
	('H4457','מֶלְקָח','melqâch','mel-kawkh\'','or מַלְקָח; from לָקַח; (only in dual) tweezers; snuffers, tongs.'),
	('H4458','מֶלְתָּחָה','meltâchâh','mel-taw-khaw\'','from an unused root meaning to spread out; a wardrobe (i.e. room where clothing is spread); vestry.'),
	('H4459','מַלְתָּעָה','maltâʻâh','mal-taw-aw\'','transp. for מְתַלְּעָה; a grinder, i.e. back tooth; great tooth.'),
	('H4460','מַמְּגֻרָה','mammᵉgurâh','mam-meg-oo-raw\'','from מָגַר (in the sense of depositing); a granary; barn.'),
	('H4461','מֵמַד','mêmad','may-mad\'','from מָדַד; a measure; measure.'),
	('H4462','מְמוּכָן','Mᵉmûwkân','mem-oo-kawn\'','or (transp.) מוֹמֻכָן; (Esther 1:16), of Persian derivation; Memucan or Momucan, a Persian satrap; Memucan.'),
	('H4463','מָמוֹת','mâmôwth','maw-mothe\'','from מוּת; a mortal disease; concretely, a corpse; death.'),
	('H4464','מַמְזֵר','mamzêr','mam-zare\'','from an unused root meaning to alienate; a mongrel, i.e. born of aJewish father and aheathen mother; bastard.'),
