	('H4482','מֵן','mên','mane','from an unused root meaning to apportion; a part; hence,; a musical chord (as parted into strings); in (the same) (Psalm 68:23), stringed instrument (Psalm 150:4), whereby (Psalm 45:8 (defective plural)).'),
	('H4483','מְנָא','mᵉnâʼ','men-aw\'','(Aramaic) or מְנָה; (Aramaic), corresponding to מָנָה; to count, appoint; number, ordain, set.'),
