	('H4579','מֵעָה','mêʻâh','may-aw\'','feminine of מֵעֶהxlit mêʻâh corrected to mêʻeh; the belly, i.e. (figuratively) interior; gravel.'),
	('H4580','מָעוֹג','mâʻôwg','maw-ogue\'','from עוּג; also with לָעֵג a table-buffoon, i.e.; a cake of bread; parasite; cake, feast.'),
	('H4581','מָעוֹז','mâʻôwz','maw-oze\'','(also מָעוּז ); or מָעֹז (also מָעֻז; from עָזַז; a fortified place; figuratively, a defence; force, fort(-ress), rock, strength(-en), ([idiom] most) strong (hold).'),
	('H4582','מָעוֹךְ','Mâʻôwk','maw-oke\'','from מָעַךְ; oppressed; Maok, a Philistine; Maoch.'),
	('H4583','מָעוֹן','mâʻôwn','maw-ohn\'','or מָעִין; (1 Chronicles 4:41), from the same as עוֹנָה; an abode, of God (the Tabernacle or the Temple), men (their home) or animals (their lair); hence, a retreat (asylum); den, dwelling((-) place), habitation.'),
	('H4584','מָעוֹן','Mâʻôwn','maw-ohn\'','the same as מָעוֹן; a residence; Maon, the name of an Israelite and of a place in Palestine; Maon, Maonites. Compare בֵּית בַּעַל מְעוֹן, מְעוּנִיlemma מְעוּנָי third vowel, corrected to מְעוּנִי.'),
	('H4585','מְעוֹנָה','mᵉʻôwnâh','meh-o-naw\'','or מְעֹנָה; feminine of מָעוֹן, and meaning the same; {an abode, of God (the Tabernacle or the Temple), men (their home) or animals (their lair); hence, a retreat (asylum)}; den, habitation, (dwelling) place, refuge.'),
	('H4586','מְעוּנִי','Mᵉʻûwnîy','meh-oo-nee\'','lemma מְעוּנָי third vowel, corrected to מְעוּנִי; or מְעִינִי; probably patrial from מָעוֹן; a Meunite, or inhabitant of Maon (only in plural); Mehunim(-s), Meunim.'),
	('H4587','מְעוֹנֹתַי','Mᵉʻôwnôthay','meh-o-no-thah\'-ee','plural of מְעוֹנָה; habitative; Meonothai, an Israelite; Meonothai.'),
	('H4588','מָעוּף','mâʻûwph','maw-off\'','from עוּף in the sense of covering with shade (compare מוּעָף); darkness; dimness.'),
	('H4589','מָעוֹר','mâʻôwr','maw-ore\'','from עוּר; nakedness, i.e. (in plural) the pudenda; nakedness.'),
	('H4590','מַעַזְיָה','Maʻazyâh','mah-az-yaw\'','or מַעַזְיָהוּ; probably from עוּז (in the sense of protection) and יָהּ; rescue of Jah; Maazjah, the name of two Israelites; Maaziah.'),
	('H4591','מָעַט','mâʻaṭ','maw-at\'','a primitive root; properly, to pare off, i.e. lessen; intransitively, to be (or causatively, to make) small or few (or figuratively, ineffective); suffer to decrease, diminish, (be, [idiom] borrow a, give, make) few (in number, -ness), gather least (little), be (seem) little, ([idiom] give the) less, be minished, bring to nothing.'),
	('H4592','מְעַט','mᵉʻaṭ','meh-at\'','or מְעָט; from מָעַט; a little or few (often adverbial or compar.); almost (some, very) few(-er, -est), lightly, little (while), (very) small (matter, thing), some, soon, [idiom] very.'),
	('H4593','מָעֹט','mâʻôṭ','maw-ote\'','passive adjective of מָעַט; thinned (as to the edge), i.e. sharp; wrapped up.'),
	('H4594','מַעֲטֶה','maʻăṭeh','mah-at-eh\'','from עָטָה; a vestment; garment.'),
	('H4595','מַעֲטָפָה','maʻăṭâphâh','mah-at-aw-faw\'','from עָטַף; a cloak; mantle.'),
	('H4596','מְעִי','mᵉʻîy','meh-ee\'','from עָוָה; (compare עִי); a pile of rubbish (as contorted), i.e. a ruin; heap.'),
	('H4597','מָעַי','Mâʻay','maw-ah\'-ee','xlit Mâʻai corrected to Mâʻay; probably from מֵעֶהxlit mêʻâh corrected to mêʻeh; sympathetic; Maai, an Israelite; Maai.'),
	('H4598','מְעִיל','mᵉʻîyl','meh-eel\'','from מָעַל in the sense of covering; a robe (i.e. upper and outer garment); cloke, coat, mantle, robe.'),
	('H4599','מַעְיָן','maʻyân','mah-yawn\'','or מַעְיְנוֹ; (Psalm 114:8), or (feminine) מַעְיָנָה; from עַיִן (as a denominative in the sense of a spring); a fountain (also collectively), figuratively, a source (of satisfaction); fountain, spring, well.'),
	('H4600','מָעַךְ','mâʻak','maw-ak\'','a primitive root; to press, i.e. to pierce, emasculate, handle; bruised, stuck, be pressed.'),
	('H4601','מַעֲכָה','Maʻăkâh','mah-ak-aw\'','or מַעֲכָת; (Joshua 13:13), from מָעַךְ; depression; Maakah (or Maakath), the name of a place in Syria, also of a Mesopotamian, of three Israelites, and of four Israelitesses and one Syrian woman; Maachah, Maachathites. See also בֵּית מַעֲכָה.'),
	('H4602','מַעֲכָתִי','Maʻăkâthîy','mah-ak-aw-thee\'','patrial from מַעֲכָה; a Maakathite, or inhabitant of Maakah; Maachathite.'),
	('H4603','מָעַל','mâʻal','maw-al\'','a primitive root; properly, to cover up; used only figuratively, to act covertly, i.e. treacherously; transgress, (commit, do a) trespass(-ing).'),
	('H4604','מַעַל','maʻal','mah\'-al','from מָעַל; treachery, i.e. sin; falsehood, grievously, sore, transgression, trespass, [idiom] very.'),
	('H4605','מַעַל','maʻal','mah\'al','from עָלָה; properly, the upper part, used only adverbially with prefix upward, above, overhead, from the top, etc.; above, exceeding(-ly), forward, on ([idiom] very) high, over, up(-on, -ward), very.'),
	('H4606','מֵעָל','mêʻâl','may-awl\'','(Aramaic) from עֲלַל; (only in plural as singular) the setting (of the sun); going down.'),
	('H4607','מֹעַל','môʻal','mo\'-al','from עָלָה; a raising (of the hands); lifting up.'),
	('H4608','מַעֲלֶה','maʻăleh','mah-al-eh\'','from עָלָה; an elevation, i.e. (concretely) acclivity or platform; abstractly (the relation or state) a rise or (figuratively) priority; ascent, before, chiefest, cliff, that goeth up, going up, hill, mounting up, stairs.'),
	('H4609','מַעֲלָה','maʻălâh','mah-al-aw\'','feminine of מַעֲלֶה; elevation, i.e. the act (literally, a journey to a higher place, figuratively, a thought arising), or (concretely) the condition (literally, a step or grademark, figuratively, a superiority of station); specifically a climactic progression (in certain Psalms); things that come up, (high) degree, deal, go up, stair, step, story.'),
	('H4610','מַעֲלֵה עַקְרַבִּים','Maʻălêh ʻAqrabbîym','mah-al-ay\' ak-rabbeem\'','from מַעֲלֶה and (the plural of) עַקְרָב; Steep of Scorpions, a place in the Desert; Maaleh-accrabim, the ascent (going up) of Akrabbim.'),
	('H4611','מַעֲלָל','maʻălâl','mah-al-awl\'','from עָלַל; an act (good or bad); doing, endeavour, invention, work.'),
	('H4612','מַעֲמָד','maʻămâd','mah-am-awd\'','from עָמַד; (figuratively) a position; attendance, office, place, state.'),
	('H4613','מׇעֳמָד','moʻŏmâd','moh-om-awd\'','from עָמַד; literally a foothold; standing.'),
	('H4614','מַעֲמָסָה','maʻămâçâh','mah-am-aw-saw\'','from עָמַס; burdensomeness; burdensome.'),
	('H4615','מַעֲמָק','maʻămâq','mah-am-awk\'','from עָמַק; a deep; deep, depth.'),
	('H4616','מַעַן','maʻan','mah\'-an','from עָנָה; properly, heed, i.e. purpose; used only adverbially, on account of (as a motive or an aim), teleologically, in order that; because of, to the end (intent) that, for (to,... \'s sake), [phrase] lest, that, to.'),
	('H4617','מַעֲנֶה','maʻăneh','mah-an-eh\'','from עָנָה; a reply (favorable or contradictory); answer, [idiom] himself.'),
	('H4618','מַעֲנָה','maʻănâh','mah-an-aw\'','from עָנָה, in the sense of depression or tilling; a furrow; [phrase] acre, furrow.'),
	('H4619','מַעַץ','Maʻats','mah\'-ats','from עָצָה; closure; Maats, an Israelite; Maaz.'),
	('H4620','מַעֲצֵבָה','maʻătsêbâh','mah-ats-ay-baw\'','from עָצַב; anguish; sorrow.'),
	('H4621','מַעֲצָד','maʻătsâd','mah-ats-awd\'','from an unused root meaning to hew; an axe; ax, tongs.'),
	('H4622','מַעְצוֹר','maʻtsôwr','mah-tsore\'','from עָצָר; objectively, a hindrance; restraint.'),
	('H4623','מַעְצָר','maʻtsâr','mah-tsawr\'','from עָצָר; subjectively, control; rule.'),
	('H4624','מַעֲקֶה','maʻăqeh','mah-ak-eh\'','from an unused root meaning to repress; a parapet; battlement.'),
	('H4625','מַעֲקָשׁ','maʻăqâsh','mah-ak-awsh\'','from עָקַשׁ; a crook (in a road); crooked thing.'),
	('H4626','מַעַר','maʻar','mah\'-ar','from עָרָה; a nude place, i.e. (literally) the pudenda, or (figuratively) a vacant space; nakedness, proportion.'),
	('H4627','מַעֲרָב','maʻărâb','mah-ar-awb\'','from עָרַב, in the sense of trading; traffic; by implication, mercantile goods; market, merchandise.'),
	('H4628','מַעֲרָב','maʻărâb','mah-ar-awb\'','or (feminine) מַעֲרָבָה; from עָרַב, in the sense of shading; the west (as a region of the evening sun); west.'),
	('H4629','מַעֲרֶה','maʻăreh','mah-ar-eh\'','from עָרָה; a nude place, i.e. a common; meadows.'),
	('H4630','מַעֲרָה','maʻărâh','mah-ar-aw\'','feminine of מַעֲרֶה; an open spot; army (from the margin).'),
	('H4631','מְעָרָה','mᵉʻârâh','meh-aw-raw\'','from עוּר; a cavern (as dark); cave, den, hole.'),
	('H4632','מְעָרָה','Mᵉʻârâh','meh-aw-raw\'','the same as מְעָרָה; cave; Mearah, a place in Palestine; Mearah.'),
	('H4633','מַעֲרָךְ','maʻărâk','mah-ar-awk\'','from עָרַךְ; an arrangement, i.e. (figuratively) mental disposition; preparation.'),
	('H4634','מַעֲרָכָה','maʻărâkâh','mah-ar-aw-kaw\'','feminine of מַעֲרָךְ; an arrangement; concretely, a pile; specifically a military array; army, fight, be set in order, ordered place, rank, row.'),
	('H4635','מַעֲרֶכֶת','maʻăreketh','mah-ar-eh\'-keth','from עָרַךְ; an arrangement, i.e. (concretely) a pile (of loaves); row, shewbread.'),
	('H4636','מַעֲרֹם','maʻărôm','mah-ar-ome\'','from עָרַם, in the sense of stripping; bare; naked.'),
	('H4637','מַעֲרָצָה','maʻărâtsâh','mah-ar-aw-tsaw\'','from עָרַץ; violence; terror.'),
	('H4638','מַעֲרָת','Maʻărâth','mah-ar-awth\'','a form of מַעֲרָה; waste; Maarath, a place in Palestine; Maarath.'),
	('H4639','מַעֲשֶׂה','maʻăseh','mah-as-eh\'','from עָשָׂה; an action (good or bad); generally, a transaction; abstractly, activity; by implication, a product (specifically, a poem) or (generally) property; act, art, [phrase] bakemeat, business, deed, do(-ing), labor, thing made, ware of making, occupation, thing offered, operation, possession, [idiom] well, (handy-, needle-, net-) work(ing, -manship), wrought.'),
	('H4640','מַעֲשַׂי','Maʻăsay','mah-as-ah\'ee','xlit Maʻsay corrected to Maʻăsay; from עָשָׂה; operative; Maasai, an Israelite; Maasiai.'),
	('H4641','מַעֲשֵׂיָה','Maʻăsêyâh','mah-as-ay-yaw\'','or מַעֲשֵׂיָהוּ; from מַעֲשֶׂה and יָהּ; work of Jah; Maasejah, the name of sixteen Israelites; Maaseiah.'),
	('H4642','מַעֲשַׁקָּה','maʻăshaqqâh','mah-ash-ak-kaw\'','from עָשַׁק; oppression; oppression, [idiom] oppressor.'),
	('H4643','מַעֲשֵׂר','maʻăsêr','mah-as-ayr\'','or מַעֲשַׂר; and (in plural) feminine מַעַשְׂרָה; from עָשָׂר; a tenth; especially a tithe; tenth (part), tithe(-ing).'),
	('H4644','מֹף','Môph','mofe','of Egyptian origin; Moph, the capital of Lower Egypt; Memphis. Compare נֹף.'),
	('H4645','מִפְגָּע','miphgâʻ','mif-gaw\'','from פָּגַע; an object of attack; mark.'),
	('H4646','מַפָּח','mappâch','map-pawkh\'','from נָפַח; a breathing out (of life), i.e. expiring; giving up.'),
	('H4647','מַפֻּחַ','mappuach','map-poo\'-akh','from נָפַח; the bellows (i.e. blower) of aforge; bellows.'),
	('H4648','מְפִיבֹשֶׁת','Mᵉphîybôsheth','mef-ee-bo\'-sheth','or מְפִבֹשֶׁת; probably from פָּאָה and בֹּשֶׁת; dispeller of shame (i.e. of Baal); Mephibosheth, the name of two Israelites; Mephibosheth.'),
	('H4649','מֻפִּים','Muppîym','moop-peem\'','a plural apparently from נוּף; wavings; Muppim, an Israelite; Muppim. Compare שֻׁפִּים.'),
	('H4650','מֵפִיץ','mêphîyts','may-feets\'','from פּוּץ; a breaker, i.e. mallet; maul.'),
	('H4651','מַפָּל','mappâl','map-pawl\'','from נָפַל; a falling off, i.e. chaff; also something pendulous, i.e. a flap; flake, refuse.'),
	('H4652','מִפְלָאָה','miphlâʼâh','mif-law-aw\'','from פָּלָא; a miracle; wondrous work.'),
	('H4653','מִפְלַגָּה','miphlaggâh','mif-lag-gaw\'','from פָּלַג; a classification; division.'),
	('H4654','מַפָּלָה','mappâlâh','map-paw-law\'','or מַפֵּלָה; from נָפַל; something fallen, i.e. a ruin; ruin(-ous).'),
	('H4655','מִפְלָט','miphlâṭ','mif-lawt\'','from פָּלַט; an escape; escape.'),
	('H4656','מִפְלֶצֶת','miphletseth','mif-leh\'-tseth','from פָּלַץ; a terror, i.e. an idol; idol.'),
	('H4657','מִפְלָשׂ','miphlâs','mif-lawce\'','from an unused root meaning to balance; a poising; balancing.'),
	('H4658','מַפֶּלֶת','mappeleth','map-peh\'-leth','from נָפַל; fall, i.e. decadence; concretely, a ruin; specifically a carcase; carcase, fall, ruin.'),
	('H4659','מִפְעָל','miphʻâl','mif-awl\'','or (feminine) מִפְעָלָה; from פָּעַל; a performance; work.'),
	('H4660','מַפָּץ','mappâts','map-pawts\'','from נָפַץ; a smiting to pieces; slaughter.'),
	('H4661','מַפֵּץ','mappêts','map-pates\'','from נָפַץ; a smiter, i.e. a war club; battle ax.'),
	('H4662','מִפְקָד','miphqâd','mif-kawd\'','from פָּקַד; an appointment, i.e. mandate; concretely, a designated spot; specifically, a census; appointed place, commandment, number.'),
	('H4663','מִפְקָד','Miphqâd','mif-kawd\'','the same as מִפְקָד; assignment; Miphkad, the name of a gate in Jerusalem; Miphkad.'),
	('H4664','מִפְרָץ','miphrâts','mif-rawts\'','from פָּרַץlemma פּרַץ missing vowel, corrected to פָּרַץ; a break (in the shore), i.e. a haven; breach.'),
	('H4665','מִפְרֶקֶת','miphreqeth','mif-reh\'-keth','xlit miphreketh corrected to miphreqeth; from פָּרַק; properly, a fracture, i.e. joint (vertebrae) of the neck; neck.'),
	('H4666','מִפְרָשׂ','miphrâs','mif-rawce\'','from פָּרַשׂ; an expansion; that which...spreadest forth, spreading.'),
	('H4667','מִפְשָׂעָה','miphsâʻâh','mif-saw-aw\'','from פָּשַׂע; a stride, i.e. (by euphemism) the crotch; buttocks.'),
	('H4668','מַפְתֵּחַ','maphtêach','maf-tay\'-akh','from פָּתַח; an opener, i.e. a key; key.'),
	('H4669','מִפְתָּח','miphtâch','mif-tawkh\'','from פָּתַח; an aperture, i.e. (figuratively) utterance; opening.'),
	('H4670','מִפְתָּן','miphtân','mif-tawn\'','from the same as פֶּתֶן; a stretcher, i.e. a sill; threshold.'),
	('H4671','מֹץ','môts','motes','or מוֹץ; (Zephaniah 2:2), from מוּץ; chaff (as pressed out, i.e. winnowed or (rather) threshed loose); chaff.'),
	('H4672','מָצָא','mâtsâʼ','maw-tsaw\'','a primitive root; properly, to come forth to, i.e. appear or exist; transitively, to attain, i.e. find or acquire; figuratively, to occur, meet or be present; [phrase] be able, befall, being, catch, [idiom] certainly, (cause to) come (on, to, to hand), deliver, be enough (cause to) find(-ing, occasion, out), get (hold upon), [idiom] have (here), be here, hit, be left, light (up-) on, meet (with), [idiom] occasion serve, (be) present, ready, speed, suffice, take hold on.'),
	('H4673','מַצָּב','matstsâb','mats-tsawb\'','from נָצַב; a fixed spot; figuratively, an office, a military post; garrison, station, place where...stood.'),
	('H4674','מֻצָּב','mutstsâb','moots-tsawb\'','from נָצַב; a station, i.e. military post; mount.'),
	('H4675','מַצָּבָה','matstsâbâh','mats-tsaw-baw\'','or מִצָּבָה; feminine of מַצָּב; a military guard; army, garrison.'),
	('H4676','מַצֵּבָה','matstsêbâh','mats-tsay-baw\'','feminine (causatively) participle of נָצַב; something stationed, i.e. a column or (memorial stone); by analogy, an idol; garrison, (standing) image, pillar.'),
	('H4677','מְצֹבָיָה','Mᵉtsôbâyâh','mets-o-baw-yaw\'','apparently from מָצָא and יָהּ; found of Jah; Metsobajah, a place in Palestine; Mesobaite.'),
	('H4678','מַצֶּבֶת','matstsebeth','mats-tseh\'-beth','from נָצַב; something stationary, i.e. a monumental stone; also the stock of atree; pillar, substance.'),
	('H4679','מְצַד','mᵉtsad','mets-ad\'','or מְצָד; or (feminine) מְצָדָה; from צוּד; a fastness (as a covert of ambush); castle, fort, (strong) hold, munition.'),
	('H4680','מָצָה','mâtsâh','maw-tsaw\'','a primitive root; to suck out; by implication, to drain, to squeeze out; suck, wring (out).'),
	('H4681','מֹצָה','Môtsâh','mo-tsaw\'','active participle feminine of מָצָה; drained; Motsah, a place in Palestine; Mozah.'),
	('H4682','מַצָּה','matstsâh','mats-tsaw\'','from מָצַץ in the sense of greedily devouring for sweetness; properly, sweetness; concretely, sweet (i.e. not soured or bittered with yeast); specifically, an unfermented cake or loaf, or (elliptically) the festival of Passover (because no leaven was then used); unleaved (bread, cake), without leaven.'),
	('H4683','מַצָּה','matstsâh','mats-tsaw\'','from נָצָה; a quarrel; contention, debate, strife.'),
	('H4684','מַצְהָלָה','matshâlâh','mats-haw-law\'','from צָהַל; a whinnying (through impatience for battle or lust); neighing.'),
	('H4685','מָצוֹד','mâtsôwd','maw-tsode\'','or (feminine) מְצוֹדָה; or מצֹדָה; from צוּד; also (by interchange for מְצַד); a net (for capturing animals or fishes);  afastness or (beseiging) tower; bulwark, hold, munition, net, snare.'),
	('H4686','מָצוּד','mâtsûwd','maw-tsood\'','or (feminine) מְצוּדָה; or מְצֻדָה; for מָצוֹד; a net, or (abstractly) capture; also a fastness; castle, defense, fort(-ress), (strong) hold, be hunted, net, snare, strong place.'),
	('H4687','מִצְוָה','mitsvâh','mits-vaw\'','from צָוָה; a command, whether human or divine (collectively, the Law); (which was) commanded(-ment), law, ordinance, precept.'),
	('H4688','מְצוֹלָה','mᵉtsôwlâh','mets-o-law\'','or מְצֹלָה; also מְצוּלָה; or מְצֻלָה; from the same as צוּלָה; a deep place (of water or mud); bottom, deep, depth.'),
	('H4689','מָצוֹק','mâtsôwq','maw-tsoke\'','from צוּק; a narrow place, i.e. (abstractly and figuratively) confinement or disability; anguish, distress, straitness.'),
	('H4690','מָצוּק','mâtsûwq','maw-tsook\'','or מָצֻק; from צוּק; something narrow, i.e. a column or hilltop; pillar, situate.'),
	('H4691','מְצוּקָה','mᵉtsûwqâh','mets-oo-kaw\'','or מְצֻקָה; feminine of מָצוּק; narrowness, i.e. (figuratively) trouble; anguish, distress.'),
	('H4692','מָצוֹר','mâtsôwr','maw-tsore\'','or מָצוּר; from צוּר; something hemming in, i.e. (objectively) a mound (of besiegers), (abstractly) a siege, (figuratively) distress; or (subjectively) a fastness; besieged, bulwark, defence, fenced, fortress, siege, strong (hold), tower.'),
	('H4693','מָצוֹר','mâtsôwr','maw-tsore\'','the same as מָצוֹר in the sense of a limit; Egypt (as the border of Palestine); besieged places, defense, fortified.'),
	('H4694','מְצוּרָה','mᵉtsûwrâh','mets-oo-raw\'','or מְצֻרָה; feminine of מָצוֹר; a hemming in, i.e. (objectively) a mound (of siege), or (subjectively) a rampart (of protection), (abstractly) fortification; fenced (city, fort, munition, strong hold.'),
	('H4695','מַצּוּת','matstsûwth','mats-tsooth\'','from נָצָה; a quarrel; that contended.'),
	('H4696','מֵצַח','mêtsach','may\'-tsakh','from an unused root meaning to be clear, i.e. conspicuous; the forehead (as open and prominent); brow, forehead, [phrase] impudent.'),
	('H4697','מִצְחָה','mitschâh','mits-khaw\'','from the same as מֵצַח; a shinpiece of armor (as prominent), only plural; greaves.'),
	('H4698','מְצִלָּה','mᵉtsillâh','mets-il-law\'','from צָלַל; a tinkler, i.e. a bell; bell.'),
	('H4699','מְצֻלָּה','mᵉtsullâh','mets-ool-law\'','from צָלַל; shade; bottom.'),
	('H4700','מְצֵלֶת','mᵉtsêleth','mets-ay\'-leth','from צָלַל; (only dual) double tinklers, i.e. cymbals; cymbals.'),
	('H4701','מִצְנֶפֶת','mitsnepheth','mits-neh\'-feth','from צָנַף; a tiara, i.e. official turban (of a king or high priest); diadem, mitre.'),
	('H4702','מַצָּע','matstsâʻ','mats-tsaw\'','from יַצַע; a couch; bed.'),
	('H4703','מִצְעָד','mitsʻâd','mits-awd\'','from צָעַד; a step; figuratively, companionship; going, step.'),
	('H4704','מִצְּעִירָה','mitstsᵉʻîyrâh','mits-tseh-ee-raw\'','feminine of מִצְעָר; properly, littleness; concretely, diminutive; little.'),
	('H4705','מִצְעָר','mitsʻâr','mits-awr\'','from צָעַר; petty (in size or number); adverbially, a short (time); little one (while), small.'),
	('H4706','מִצְעָר','Mitsʻâr','mits-awr\'','the same as מִצְעָר; Mitsar, a peak of Lebanon; Mizar.'),
	('H4707','מִצְפֶּה','mitspeh','mits-peh\'','from צָפָה; an observatory, especially formilitary purposes; watch tower.'),
	('H4708','מִצְפֶּה','Mitspeh','mits-peh\'','the same as מִצְפֶּה; Mitspeh, the name of five places in Palestine; Mizpeh, watch tower. Compare מִצְפָּה.'),
	('H4709','מִצְפָּה','Mitspâh','mits-paw\'','feminine of מִצְפֶּה; Mitspah, the name of two places in Palestine; Mitspah. (This seems rather to be only an orthographic variation of מִצְפֶּה when \'in pause\'.)'),
	('H4710','מִצְפֻּן','mitspun','mits-poon\'','from צָפַן; a secret (place or thing, perhaps, treasure); hidden thing.'),
	('H4711','מָצַץ','mâtsats','maw-tsats\'','a primitive root; to suck; milk.'),
	('H4712','מֵצַר','mêtsar','may-tsar\'','from קֵבָה; something tight, i.e. (figuratively) trouble; distress, pain, strait.'),
	('H4713','מִצְרִי','Mitsrîy','mits-ree\'','from מִצְרַיִם; a Mitsrite, or inhabitant of Mitsrajim; Egyptian, of Egypt.'),
	('H4714','מִצְרַיִם','Mitsrayim','mits-rah\'-yim','dual of מָצוֹר; Mitsrajim, i.e. Upper and Lower Egypt; Egypt, Egyptians, Mizraim.'),
	('H4715','מִצְרֵף','mitsrêph','mits-rafe\'','from צָרַף; a crucible; fining pot.'),
	('H4716','מַק','maq','mak','from מָקַק; properly, a melting, i.e. putridity; rottenness, stink.'),
	('H4717','מַקָּבָה','maqqâbâh','mak-kaw-baw\'','from נָקַב; properly, a perforatrix, i.e. a hammer (as piercing); hammer.'),
	('H4718','מַקֶּבֶת','maqqebeth','mak-keh\'-beth','from נָקַב; properly, a perforator, i.e. a hammer (as piercing); also (intransitively) a perforation, i.e. a quarry; hammer, hole.'),
	('H4719','מַקֵּדָה','Maqqêdâh','mak-kay-daw\'','from the same as נָקֹד in the denominative sense of herding (compare נֹקֵד); fold; Makkedah, a place in Palestine; Makkedah.'),
	('H4720','מִקְדָּשׁ','miqdâsh','mik-dawsh\'','or מִקְּדָשׁ; (Exodus 15:17), from קָדַשׁ; a consecrated thing or place, especially, a palace, sanctuary (whether of Jehovah or of idols) or asylum; chapel, hallowed part, holy place, sanctuary.'),
	('H4721','מַקְהֵל','maqhêl','mak-hale\'','or (feminine) מַקְהֵלָה; from קָהַל; an assembly; congregation.'),
	('H4722','מַקְהֵלֹת','Maqhêlôth','mak-hay-loth\'','plural of מַקְהֵל (feminine); assemblies; Makheloth, a place in the Desert; Makheloth.'),
	('H4723','מִקְוֶה','miqveh','mik-veh\'','or מִקְוֵה; (1 Kings 10:28), or מִקְוֵאlemma מִּקְוֵא extra dagesh, corrected to מִקְוֵא; (2 Chronicles 1:16), from קָוָה; something waited for, i.e. confidence (objective or subjective); also a collection, i.e. (of water) a pond, or (of men and horses) a caravan or drove; abiding, gathering together, hope, linen yarn, plenty (of water), pool.'),
	('H4724','מִקְוָה','miqvâh','mik-vaw\'','feminine of מִקְוֶה; a collection, i.e. (of water) a reservoir; ditch.'),
	('H4725','מָקוֹם','mâqôwm','maw-kome\'','or מָקֹם; also (feminine) מְקוֹמָה; or מְקֹמָה; from קוּם; properly, a standing, i.e. a spot; but used widely of a locality (general or specific); also (figuratively) of a condition (of body or mind); country, [idiom] home, [idiom] open, place, room, space, [idiom] whither(-soever).'),
	('H4726','מָקוֹר','mâqôwr','maw-kore\'','or מָקֹר; from קוּר; properly, something dug, i.e. a (general) source (of water, even when naturally flowing; also of tears, blood (by euphemism, of the female pudenda); figuratively, of happiness, wisdom, progeny); fountain, issue, spring, well(-spring).'),
	('H4727','מִקָּח','miqqâch','mik-kawkh\'','from לָקַח; reception; taking.'),
	('H4728','מַקָּחָה','maqqâchâh','mak-kaw-khaw\'','from לָקַח; something received, i.e. merchandise (purchased); ware.'),
	('H4729','מִקְטָר','miqṭâr','mik-tawr\'','from קָטַר; something to fume (incense) on i.e. a hearth place; to burn...upon.'),
	('H4730','מִקְטֶרֶת','miqṭereth','mik-teh\'-reth','feminine of מִקְטָר; something to fume (incense) in, i.e. a coal-pan; censer.'),
	('H4731','מַקֵּל','maqqêl','mak-kale','or (feminine) מַקְּלָה; from an unused root meaning apparently to germinate; a shoot, i.e. stick (with leaves on, or for walking, striking, guiding, divining); rod, (hand-)staff.'),
	('H4732','מִקְלוֹת','Miqlôwth','mik-lohth\'','(or perhaps mik-kel-ohth\') plural of (feminine) מַקֵּל; rods; Mikloth, a place in the Desert; Mikloth.'),
	('H4733','מִקְלָט','miqlâṭ','mik-lawt\'','from קָלַט in the sense of taking in; an asylum (as a receptacle); refuge.'),
	('H4734','מִקְלַעַת','miqlaʻath','mik-lah\'-ath','from קָלַע; a sculpture (probably in bas-relief); carved (figure), carving, graving.'),
	('H4735','מִקְנֶה','miqneh','mik-neh\'','from קָנָה; something bought, i.e. property, but only livestock; abstractly, acquisition; cattle, flock, herd, possession, purchase, substance.'),
	('H4736','מִקְנָה','miqnâh','mik-naw\'','feminine of מִקְנֶה; properly, a buying, i.e. acquisition; concretely, a piece of property (land or living); also the sum paid; (he that is) bought, possession, piece, purchase.'),
	('H4737','מִקְנֵיָהוּ','Miqnêyâhûw','mik-nay-yaw\'-hoo','from מִקְנֶה and יָהּ; possession of Jah; Miknejah, an Israelite; Mikneiah.'),
	('H4738','מִקְסָם','miqçâm','mik-sawn\'','from קָסַם; an augury; divination.'),
	('H4739','מָקַץ','Mâqats','maw-kats\'','from קָצַץ; end; Makats, a place in Palestine; Makaz.'),
	('H4740','מַקְצוֹעַ','maqtsôwaʻ','mak-tso\'-ah','or מַקְצֹעַ; or (feminine) מַקְצֹעָה; from קָצַע in the denominative sense of bending; an angle or recess; corner, turning.'),
	('H4741','מַקְצֻעָה','maqtsuʻâh','mak-tsoo-aw\'','from קָצַע; a scraper, i.e. a carving chisel; plane.'),
	('H4742','מְקֻצְעָה','mᵉqutsʻâh','mek-oots-aw\'','from קָצַע in the denominative sense of bending; an angle; corner.'),
	('H4743','מָקַק','mâqaq','maw-kak\'','\' a primitive root; to melt; figuratively, to flow, dwindle, vanish; consume away, be corrupt, dissolve, pine away.'),
	('H4744','מִקְרָא','miqrâʼ','mik-raw\'','from קָרָא; something called out, i.e. a public meeting (the act, the persons, or the place); also a rehearsal; assembly, calling, convocation, reading.'),
	('H4745','מִקְרֶה','miqreh','mik-reh\'','from קָרָה; something met with, i.e. an accident or fortune; something befallen, befalleth, chance, event, hap(-peneth).'),
	('H4746','מְקָרֶה','mᵉqâreh','mek-aw-reh\'','from קָרָה; properly, something meeting, i.e. a frame (of timbers); building.'),
	('H4747','מְקֵרָה','mᵉqêrâh','mek-ay-raw\'','from the same as קַר; a cooling off; [idiom] summer.'),
	('H4748','מִקְשֶׁה','miqsheh','mik-sheh\'','from קָשָׁה in the sense of knotting up round and hard; something turned (rounded), i.e. a curl (of tresses); [idiom] well (set) hair.'),
	('H4749','מִקְשָׁה','miqshâh','mik-shaw\'','feminine of מִקְשֶׁה; rounded work, i.e. moulded by hammering (repousse); beaten (out of one piece, work), upright, whole piece.'),
	('H4750','מִקְשָׁה','miqshâh','mik-shaw\'','denominative from קִשֻּׁא; literally a cucumbered field, i.e. a cucumber patch; garden of cucumbers.'),
	('H4751','מַר','mar','mar','or (feminine) מָרָה; from מָרַר; bitter (literally or figuratively); also (as noun) bitterness, or (adverbially) bitterly; [phrase] angry, bitter(-ly, -ness), chafed, discontented, [idiom] great, heavy.'),
	('H4752','מַר','mar','mar','from מָרַר in its original sense of distillation; a drop; drop.'),
	('H4753','מֹר','môr','more','or מוֹר; from מָרַר; myrrh (as distilling in drops, and also as bitter); myrrh.'),
	('H4754','מָרָא','mârâʼ','maw-raw\'','a primitive root; to rebel; hence (through the idea of maltreating) to whip, i.e. lash (self with wings, as the ostrich in running); be filthy, lift up self.'),
	('H4755','מָרָא','Mârâʼ','maw-raw\'','for מַר feminine; bitter; Mara, a symbolic name of Naomi; Mara.'),
	('H4756','מָרֵא','mârêʼ','maw-ray\'','(Aramaic) from a root corresponding to מָרָא in the sense of domineering; a master; lord, Lord.'),
