	('H4758','מַרְאֶה','marʼeh','mar-eh\'','from רָאָה; a view (the act of seeing); also an appearance (the thing seen), whether (real) a shape (especially if handsome, comeliness; often plural the looks), or (mental) a vision; [idiom] apparently, appearance(-reth), [idiom] as soon as beautiful(-ly), countenance, fair, favoured, form, goodly, to look (up) on (to), look(-eth), pattern, to see, seem, sight, visage, vision.'),
	('H4759','מַרְאָה','marʼâh','mar-aw\'','feminine of מַרְאֶה; a vision; also (causatively) a mirror; looking glass, vision.'),
	('H4760','מֻרְאָה','murʼâh','moor-aw\'','apparently feminine passive causative participle of רָאָה; something conspicuous, i.e. the craw of abird (from its prominence); crop.'),
	('H4761','מַרְאָשָׁה','marʼâshâh','mar-aw-shaw\'','denominative from רֹאשׁ; properly, headship, i.e. (plural for collective) dominion; principality.'),
	('H4762','מַרְאֵשָׁה','Marʼêshâh','mar-ay-shaw\'','or מַרֵשָׁה; formed like מַרְאָשָׁה; summit; Mareshah, the name of two Israelites and of a place in Palestine; Mareshah.'),
	('H4763','מְרַאֲשָׁה','mᵉraʼăshâh','mer-ah-ash-aw\'','formed like מַרְאָשָׁה; properly, a headpiece, i.e. (plural for adverbial) at (or as) the head-rest (or pillow); bolster, head, pillow. Compare מַרְגְלָה.'),
	('H4764','מֵרָב','Mêrâb','may-rawb\'','from רָבַב; increase; Merab, a daughter of Saul; Merab.'),
	('H4765','מַרְבַד','marbad','mar-bad\'','from רָבַד; a coverlet; covering of tapestry.'),
	('H4766','מַרְבֶה','marbeh','mar-beh\'','from רָבָה; properly, increasing; as noun, greatness, or (adverbially) greatly; great, increase.'),
	('H4767','מִרְבָּה','mirbâh','meer-baw\'','from רָבָה; abundance, i.e. a great quantity; much.'),
	('H4768','מַרְבִּית','marbîyth','mar-beeth\'','from רָבָה; a multitude; also offspring; specifically interest (on capital); greatest part, greatness, increase, multitude.'),
	('H4769','מַרְבֵּץ','marbêts','mar-bates\'','from רָבַץ; a reclining place, i.e. fold (for flocks); couching place, place to lie down.'),
	('H4770','מַרְבֵּק','marbêq','mar-bake\'','from an unused root meaning to tie up; a stall (for cattle); [idiom] fat(-ted), stall.'),
	('H4771','מַרְגּוֹעַ','margôwaʻ','mar-go\'-ah','from רָגַע; a resting place; rest.'),
	('H4772','מַרְגְלָה','margᵉlâh','mar-ghel-aw\'','denominative from רֶגֶל; (plural for collective) a footpiece, i.e. (adverbially) at the foot, or (direct.) the foot itself; feet. Compare מְרַאֲשָׁה.'),
	('H4773','מַרְגֵּמָה','margêmâh','mar-gay-maw\'','from רָגַם; a stone-heap; sling.'),
	('H4774','מַרְגֵּעָה','margêʻâh','mar-gay-aw\'','from רָגַע; rest; refreshing.'),
	('H4775','מָרַד','mârad','maw-rad\'','a primitive root; to rebel; rebel(-lious).'),
	('H4776','מְרַד','mᵉrad','mer-ad\'','(Aramaic) from a root corresponding to מָרַד; rebellion; rebellion.'),
	('H4777','מֶרֶד','mered','meh\'-red','from מָרַד; rebellion; rebellion.'),
	('H4778','מֶרֶד','Mered','meh\'-red','the same as מֶרֶד; Mered, an Israelite; Mered.'),
	('H4779','מָרָד','mârâd','maw-rawd\'','(Aramaic) from the same as מְרַד; rebellious; rebellious.'),
	('H4780','מַרְדּוּת','mardûwth','mar-dooth\'','from מָרַד; rebelliousness; [idiom] rebellious.'),
	('H4781','מְרֹדָךְ','Mᵉrôdâk','mer-o-dawk\'','of foreign derivation; Merodak, a Babylonian idol; Merodach. Compare מְרֹאדַךְ בַּלְאָדָן.'),
	('H4782','מׇרְדְּכַי','Mordᵉkay','mor-dek-ah\'-ee','of foreign derivation; Mordecai, an Israelite; Mordecai.'),
	('H4783','מֻרְדָּף','murdâph','moor-dawf\'','from רָדַף; persecuted; persecuted.'),
	('H4784','מָרָה','mârâh','maw-raw\'','a primitive root; to be (causatively, make) bitter (or unpleasant); (figuratively) to rebel (or resist; causatively, to provoke); bitter, change, be disobedient, disobey, grievously, provocation, provoke(-ing), (be) rebel (against, -lious).'),
	('H4785','מָרָה','Mârâh','maw-raw\'','the same as מַר feminine; bitter; Marah, a place in the Desert; Marah.'),
	('H4786','מֹרָה','môrâh','mo-raw\'','from מָרַר; bitterness, i.e. (figuratively) trouble; grief.'),
