	('H4788','מָרוּד','mârûwd','maw-rood\'','from רוּד in the sense of maltreatment; an outcast; (abstractly) destitution; cast out, misery.'),
	('H4789','מֵרוֹז','Mêrôwz','may-roze\'','of uncertain derivation; Meroz, a place in Palestine; Meroz.'),
	('H4790','מְרוֹחַ','mᵉrôwach','mer-o-akh\'','from מָרַח; bruised, i.e. emasculated; broken.'),
	('H4791','מָרוֹם','mârôwm','maw-rome\'','from רוּם; altitude, i.e. concretely (an elevated place), abstractly (elevation, figuratively (elation), or adverbially (aloft); (far) above, dignity, haughty, height, (most, on) high (one, place), loftily, upward.'),
	('H4792','מֵרוֹם','Mêrôwm','may-rome\'','formed like מָרוֹם; height; Merom, a lake in Palestine; Merom.'),
	('H4793','מֵרוֹץ','mêrôwts','may-rotes\'','from רוּץ; a run (the trial of speed); race.'),
