	('H5016','נְבוּאָה','nᵉbûwʼâh','neb-oo-aw\'','from נָבָא; a prediction (spoken or written); prophecy.'),
	('H5017','נְבוּאָה','nᵉbûwʼâh','neb-oo-aw','(Aramaic) corresponding to נְבוּאָה; inspired teaching; prophesying.'),
	('H5018','נְבוּזַרְאֲדָן','Nᵉbûwzarʼădân','neb-oo-zar-ad-awn\'',' xlit Nᵉbûwzarădân corrected to Nᵉbûwzarʼădân; of foreign origin; Nebuzaradan, a Babylonian general; Nebuzaradan.'),
	('H5019','נְבוּכַדְנֶאצַּר','Nᵉbûwkadneʼtstsar','neb-oo-kad-nets-tsar\'','or נְבֻּכַדְנֶאצַּר; (2 Kings 24:1,10), or נְבוּכַדְנֶצַּר; (Esther 2:6; Daniel 1:18), or נְבוּכַדְרֶאצַּר; or נְבוּכַדְרֶאצּוֹר; (Ezra 2:1; Jeremiah 49:28), or foreign derivation; Nebukadnetstsar (or -retstsar, or -retstsor), king of Babylon; Nebuchadnezzar, Nebuchadrezzar.'),
	('H5020','נְבוּכַדְנֶצַּר','Nᵉbûwkadnetstsar','neb-oo-kad-nets-tsar\'','(Aramaic) corresponding to נְבוּכַדְנֶאצַּר; {Nebukadnetstsar (or -retstsar, or -retstsor), king of Babylon}; Nebuchadnezzar.'),
	('H5021','נְבוּשַׁזְבָּן','Nᵉbûwshazbân','neb-oo-shaz-bawn\'','of foreign derivation; Nebushazban, Nebuchadnezzar\'s chief eunuch; Nebushazban.'),
	('H5022','נָבוֹת','Nâbôwth','naw-both\'','feminine plural from the same as נֹב; fruits; Naboth, an Israelite; Naboth.'),
	('H5023','נְבִזְבָּה','nᵉbizbâh','neb-iz-baw\'','(Aramaic) of uncertain derivation; a largess; reward.'),
	('H5024','נָבַח','nâbach','naw-bakh\'','a primitive root; to bark (as a dog); bark.'),
	('H5025','נֹבַח','Nôbach','no\'-bach','from נָבַח; a bark; Nobach, the name of an Israelite, and of a place East of the Jordan; Nobah.'),
	('H5026','נִבְחַז','Nibchaz','nib-khaz\'','of foreign origin; Nibchaz, a deity of the Avites; Nibhaz.'),
	('H5027','נָבַט','nâbaṭ','naw-bat\'','a primitive root; to scan, i.e. look intently at; by implication, to regard with pleasure, favor or care; (cause to) behold, consider, look (down), regard, have respect, see.'),
	('H5028','נְבָט','Nᵉbâṭ','neb-awt\'','from נָבַט; regard; Nebat, the father of Jeroboam I; Nebat.'),
	('H5029','נְבִיא','nᵉbîyʼ','neb-ee\'','(Aramaic) corresponding to נָבִיא; a prophet; prophet.'),
	('H5030','נָבִיא','nâbîyʼ','naw-bee\'','from נָבָא; a prophet or (generally) inspired man; prophecy, that prophesy, prophet.'),
	('H5031','נְבִיאָה','nᵉbîyʼâh','neb-ee-yaw\'','feminine of נָבִיא; a prophetess or (generally) inspired woman; by implication, a poetess; by association a prophet\'s wife; prophetess.'),
	('H5032','נְבָיוֹת','Nᵉbâyôwth','neb-aw-yoth\'','or נְבָיֹת; feminine plural from נוּב; fruitfulnesses; Nebajoth, a son of Ismael, and the country settled by him; Nebaioth, Nebajoth.'),
	('H5033','נֵבֶךְ','nêbek','nay\'-bek','from an unused root meaning to burst forth; a fountain; spring.'),
	('H5034','נָבֵל','nâbêl','naw-bale\'','a primitive root; to wilt; generally, to fall away, fail, faint; figuratively, to be foolish or (morally) wicked; causatively, to despise, disgrace; disgrace, dishounour, lightly esteem, fade (away, -ing), fall (down, -ling, off), do foolishly, come to nought, [idiom] surely, make vile, wither.'),
	('H5035','נֶבֶל','nebel','neh\'-bel','or נֵבֶל; from נָבֵל; a skin-bag for liquids (from collapsing when empty); hence, a vase (as similar in shape when full); also a lyre (as having a body of like form); bottle, pitcher, psaltery, vessel, viol.'),
	('H5036','נָבָל','nâbâl','naw-bawl\'','from נָבֵל; stupid; wicked (especially impious); fool(-ish, -ish man, -ish woman), vile person.'),
	('H5037','נָבָל','Nâbâl','naw-bawl\'','the same as נָבָל; dolt; Nabal, an Israelite; Nabal.'),
	('H5038','נְבֵלָה','nᵉbêlâh','neb-ay-law\'','from נָבֵל; a flabby thing, i.e. a carcase or carrion (human or bestial, often collectively); figuratively, an idol; (dead) body, (dead) carcase, dead of itself, which died, (beast) that (which) dieth of itself.'),
	('H5039','נְבָלָה','nᵉbâlâh','neb-aw-law\'','feminine of נָבָל; foolishness, i.e. (morally) wickedness; concretely, a crime; by extension, punishment; folly, vile, villany.'),
	('H5040','נַבְלוּת','nablûwth','nab-looth\'','from נָבָל; properly, disgrace, i.e. the (female) pudenda; lewdness.'),
	('H5041','נְבַלָּט','Nᵉballâṭ','neb-al-lawt\'','apparently from נָבָל and לָט; foolish secrecy; Neballat, a place in Palestine; Neballat.'),
	('H5042','נָבַע','nâbaʻ','naw-bah\'','a primitive root; to gush forth; figuratively, to utter (good or bad words); specifically, to emit (a foul odor); belch out, flowing, pour out, send forth, utter (abundantly).'),
	('H5043','נֶבְרְשָׁא','nebrᵉshâʼ','neb-reh-shaw\'','(Aramaic) from an unused root meaning to shine; a light; plural (collectively) a chandelier; candlestick.'),
	('H5044','נִבְשָׁן','Nibshân','nib-shawn\'','of uncertain derivation; Nibshan, a place in Palestine; Nibshan.'),
	('H5045','נֶגֶב','negeb','neh\'-gheb','from an unused root meaning to be parched; the south (from its drought); specifically, the Negeb or southern district of Judah, occasionally, Egypt (as south to Palestine); south (country, side, -ward).'),
	('H5046','נָגַד','nâgad','naw-gad\'','a primitive root; properly, to front, i.e. stand boldly out opposite; by implication (causatively), to manifest; figuratively, to announce (always by word of mouth to one present); specifically, to expose, predict, explain, praise; bewray, [idiom] certainly, certify, declare(-ing), denounce, expound, [idiom] fully, messenger, plainly, profess, rehearse, report, shew (forth), speak, [idiom] surely, tell, utter.'),
	('H5047','נְגַד','nᵉgad','neg-ad\'','(Aramaic) corresponding to נָגַד; to flow (through the idea of clearing the way); issue.'),
	('H5048','נֶגֶד','neged','neh\'-ghed','from נָגַד; a front, i.e. part opposite; specifically a counterpart, or mate; usually (adverbial, especially with preposition) over against or before; about, (over) against, [idiom] aloof, [idiom] far (off), [idiom] from, over, presence, [idiom] other side, sight, [idiom] to view.'),
	('H5049','נֶגֶד','neged','neh\'-ghed','(Aramaic) corresponding to נֶגֶד; opposite; toward.'),
	('H5050','נָגַהּ','nâgahh','naw-gah\'','a primitive root; to glitter; causatively, to illuminate; (en-) lighten, (cause to) shine.'),
	('H5051','נֹגַהּ','nôgahh','no\'-gah','from נָגַהּ; brilliancy (literally or figuratively); bright(-ness), light, (clear) shining.'),
	('H5052','נֹגַהּ','Nôgahh','no\'-gah','the same as נֹגַהּ; Nogah, a son of David; Nogah.'),
	('H5053','נֹגַהּ','nôgahh','no\'-gah','(Aramaic) corresponding to נֹגַהּ; dawn; morning.'),
	('H5054','נְגֹהָה','nᵉgôhâh','neg-o-haw\'','feminine of נֹגַהּ; splendor; brightness.'),
	('H5055','נָגַח','nâgach','naw-gakh\'','a primitive root; to butt with the horns; figuratively, to war against; gore, push (down, -ing).'),
	('H5056','נַגָּח','naggâch','nag-gawkh\'','from נָגַח; butting, i.e. vicious; used (wont) to push.'),
	('H5057','נָגִיד','nâgîyd','naw-gheed\'','or נָגִד; from נָגַד; a commander (as occupying the front), civil, military or religious; generally (abstractly, plural), honorable themes; captain, chief, excellent thing, (chief) governor, leader, noble, prince, (chief) ruler.'),
	('H5058','נְגִינָה','nᵉgîynâh','neg-ee-naw\'','or נְגִינַת; (Psalm 61:title), from נָגַן; properly, instrumental music; by implication, a stringed instrument; by extension, a poem set to music; specifically, an epigram; stringed instrument, musick, Neginoth (plural), song.'),
	('H5059','נָגַן','nâgan','naw-gan\'','a primitive root; properly, to thrum, i.e. beat atune with the fingers; expectation. to play on astringed instrument; hence (generally), to make music; player on instruments, sing to the stringed instruments, melody, ministrel, play(-er, -ing).'),
	('H5060','נָגַע','nâgaʻ','naw-gah\'','a primitive root; properly, to touch, i.e. lay the hand upon (for any purpose; euphemistically, to lie with a woman); by implication, to reach (figuratively, to arrive, acquire); violently, to strike (punish, defeat, destroy, etc.); beat, ([idiom] be able to) bring (down), cast, come (nigh), draw near (nigh), get up, happen, join, near, plague, reach (up), smite, strike, touch.'),
	('H5061','נֶגַע','negaʻ','neh\'-gah','from נָגַע; a blow (figuratively, infliction); also (by implication) a spot (concretely, a leprous person or dress); plague, sore, stricken, stripe, stroke, wound.'),
	('H5062','נָגַף','nâgaph','naw-gaf\'','a primitive root; to push, gore, defeat, stub (the toe), inflict (a disease); beat, dash, hurt, plague, slay, smite (down), strike, stumble, [idiom] surely, put to the worse.'),
	('H5063','נֶגֶף','negeph','neh\'-ghef','from נָגַף; a trip (of the foot); figuratively, an infliction (of disease); plague, stumbling.'),
	('H5064','נָגַר','nâgar','naw-gar\'','a primitive root; to flow; figuratively, to stretch out; causatively, to pour out or down; figuratively, to deliver over; fall, flow away, pour down (out), run, shed, spilt, trickle down.'),
	('H5065','נָגַשׂ','nâgas','naw-gas\'','a primitive root; to drive (an animal, a workman, a debtor, an army); by implication, to tax, harass, tyrannize; distress, driver, exact(-or), oppress(-or), [idiom] raiser of taxes, taskmaster.'),
	('H5066','נָגַשׁ','nâgash','naw-gash\'','a primitive root; to be or come (causatively, bring) near (for any purpose); euphemistically, to lie with a woman; as an enemy, to attack; religious to worship; causatively, to present; figuratively, to adduce an argument; by reversal, to stand back; (make to) approach (nigh), bring (forth, hither, near), (cause to) come (hither, near, nigh), give place, go hard (up), (be, draw, go) near (nigh), offer, overtake, present, put, stand.'),
	('H5067','נֵד','nêd','nade','from נוּד in the sense of piling up; a mound, i.e. wave; heap.'),
	('H5068','נָדַב','nâdab','naw-dab\'','a primitive root; to impel; hence, to volunteer (as a soldier), to present spontaneously; offer freely, be (give, make, offer self) willing(-ly).'),
	('H5069','נְדַב','nᵉdab','ned-ab\'','(Aramaic) corresponding to נָדַב; be (or give) liberal(-ly); (be minded of...own) freewill (offering), offer freely (willingly).'),
	('H5070','נָדָב','Nâdâb','naw-dawb\'','from נָדַב; liberal; Nadab, the name of four Israelites; Nadab.'),
	('H5071','נְדָבָה','nᵉdâbâh','ned-aw-baw\'','from נָדַב; properly (abstractly) spontaneity, or (adjectively) spontaneous; also (concretely) a spontaneous or (by inference, in plural) abundant gift; free(-will) offering, freely, plentiful, voluntary(-ily, offering), willing(-ly), offering).'),
	('H5072','נְדַבְיָה','Nᵉdabyâh','ned-ab-yaw\'','from נָדַב and יָהּ; largess of Jah; Nedabjah, an Israelite; Nedabiah.'),
	('H5073','נִדְבָּךְ','nidbâk','nid-bawk\'','(Aramaic) from a root meaning to stick; a layer (of building materials); row.'),
	('H5074','נָדַד','nâdad','naw-dad\'','a primitive root; properly, to wave to and fro (rarely to flap up and down); figuratively, to rove, flee, or (causatively) to drive away; chase (away), [idiom] could not, depart, flee ([idiom] apace, away), (re-) move, thrust away, wander (abroad, -er, -ing).'),
	('H5075','נְדַד','nᵉdad','ned-ad\'','(Aramaic) corresponding to נָדַד; to depart; go from.'),
	('H5076','נָדֻד','nâdud','naw-dood\'','passive participle of נָדַד; properly, tossed; abstractly, a rolling (on the bed); tossing to and fro.'),
	('H5077','נָדָה','nâdâh','naw-daw\'','or נָדָא; (2 Kings 17:21), a primitive root; properly, to toss; figuratively, to exclude, i.e. banish, postpone, prohibit; cast out, drive, put far away.'),
	('H5078','נֵדֶה','nêdeh','nay\'-deh','from נָדָה in the sense of freely flinging money; a bounty (for prostitution); gifts.'),
	('H5079','נִדָּה','niddâh','nid-daw\'','from נָדַד; properly, rejection; by implication, impurity, especially personal (menstruation) or moral (idolatry, incest); [idiom] far, filthiness, [idiom] flowers, menstruous (woman), put apart, [idiom] removed (woman), separation, set apart, unclean(-ness, thing, with filthiness).'),
	('H5080','נָדַח','nâdach','naw-dakh\'','a primitive root; to push off; used in a great variety of applications, literally and figuratively (to expel, mislead, strike, inflict, etc.); banish, bring, cast down (out), chase, compel, draw away, drive (away, out, quite), fetch a stroke, force, go away, outcast, thrust away (out), withdraw.'),
	('H5081','נָדִיב','nâdîyb','naw-deeb\'','from נָדַב; properly, voluntary, i.e. generous; hence, magnanimous; as noun, a grandee (sometimes a tyrant); free, liberal (things), noble, prince, willing (hearted).'),
	('H5082','נְדִיבָה','nᵉdîybâh','ned-ee-baw\'','feminine of נָדִיב; properly, nobility, i.e. reputation; soul.'),
	('H5083','נָדָן','nâdân','naw-dawn\'','probably from an unused root meaning to give; a present (for prostitution); gift.'),
	('H5084','נָדָן','nâdân','naw-dawn\'','of uncertain derivation; a sheath (of a sword); sheath.'),
	('H5085','נִדְנֶה','nidneh','nid-neh\'','(Aramaic) from the same as נָדָן; a sheath; figuratively, the body (as the receptacle of the soul); body.'),
	('H5086','נָדַף','nâdaph','naw-daf\'','a primitive root; to shove asunder, i.e. disperse; drive (away, to and fro), thrust down, shaken, tossed to and fro.'),
	('H5087','נָדַר','nâdar','naw-dar\'','a primitive root; to promise (pos., to do or give something to God); (make a) vow.'),
	('H5088','נֶדֶר','neder','neh\'-der','or נֵדֶר; from נָדַר; a promise (to God); also (concretely) a thing promised; vow(-ed).'),
	('H5089','נֹהַּ','nôahh','no\'-ah','from an unused root meaning to lament; lamentation; wailing.'),
	('H5090','נָהַג','nâhag','naw-hag\'','a primitive root; to drive forth (a person, an animal or chariot), i.e. lead, carry away; reflexively, to proceed (i.e. impel or guide oneself); also (from the panting induced by effort), to sigh; acquaint, bring (away), carry away, drive (away), lead (away, forth), (be) guide, lead (away, forth).'),
	('H5091','נָהָה','nâhâh','naw-haw\'','a primitive root; to groan, i.e. bewail; hence (through the idea of crying aloud), to assemble (as if on proclamation); lament, wail.'),
	('H5092','נְהִי','nᵉhîy','neh-hee\'','from נָהָה; an elegy; lamentation, wailing.'),
	('H5093','נִהְיָה','nihyâh','nih-yaw\'','feminine of נְהִי; lamentation; doleful.'),
	('H5094','נְהִיר','nᵉhîyr','neh-heere\'','(Aramaic) or נְהִירוּ; (Aramaic), from the same as נְהָרָה; illumination, i.e. (figuratively) wisdom; light.'),
	('H5095','נָהַל','nâhal','naw-hal\'','a primitive root; properly, to run with asparkle, i.e. flow; hence (transitively), to conduct, and (by inference) to protect, sustain; carry, feed, guide, lead (gently, on).'),
	('H5096','נַהֲלָל','Nahălâl','nah-hal-awl\'','or נַהֲלֹל; the same as נַהֲלֹל; Nahalal or Nahalol, a place in Palestine; Nahalal, Nahallal, Nahalol.'),
	('H5097','נַהֲלֹל','nahălôl','nah-hal-ole\'','from נָהַל; pasture; bush.'),
	('H5098','נָהַם','nâham','naw-ham\'','a primitive root; to growl; mourn, roar(-ing).'),
	('H5099','נַהַם','naham','nah\'-ham','from נָהַם; a snarl; roaring.'),
	('H5100','נְהָמָה','nᵉhâmâh','neh-haw-maw\'','feminine of נַהַם; snarling; disquietness, roaring.'),
	('H5101','נָהַק','nâhaq','naw-hak\'','a primitive root; to bray (as an ass), scream (from hunger); bray.'),
	('H5102','נָהַר','nâhar','naw-har\'','a primitive root; to sparkle, i.e. (figuratively) be cheerful; hence (from the sheen of a running stream) to flow, i.e. (figuratively) assemble; flow (together), be lightened.'),
	('H5103','נְהַר','nᵉhar','neh-har\'','(Aramaic) from a root corresponding to נָהַר; a river, especially the Euphrates; river, stream.'),
	('H5104','נָהָר','nâhâr','naw-hawr\'','from נָהַר; a stream (including the sea; expectation the Nile, Euphrates, etc.); figuratively, prosperity; flood, river.'),
	('H5105','נְהָרָה','nᵉhârâh','neh-haw-raw\'','from נָהַר in its original sense; daylight; light.'),
	('H5106','נוּא','nûwʼ','noo','a primitive root; to refuse, forbid, dissuade, or neutralize; break, disallow, discourage, make of none effect.'),
	('H5107','נוּב','nûwb','noob','a primitive root; to germinate, i.e. (figuratively) to (causatively, make) flourish; also (of words), to utter; bring forth (fruit), make cheerful, increase.'),
	('H5108','נוֹב','nôwb','nobe','or נֵיב; from נוּב; produce, literally or figuratively; fruit.'),
	('H5109','נוֹבַי','Nôwbay','no-bah\'ee','from נוֹב; fruitful; Nobai, an Israelite; Nebai (from the margin).'),
	('H5110','נוּד','nûwd','nood','a primitive root; to nod, i.e. waver; figuratively, to wander, flee, disappear; also (from shaking the head in sympathy), to console, deplore, or (from tossing the head in scorn) taunt; bemoan, flee, get, mourn, make to move, take pity, remove, shake, skip for joy, be sorry, vagabond, way, wandering.'),
	('H5111','נוּד','nûwd','nood','(Aramaic) corresponding to נָוֶה; to flee; get away.'),
	('H5112','נוֹד','nôwd','node','lemma נוֹדּ extra dagesh, corrected to נוֹד; (only defective נֹד ); from נוּד; exile; wandering.'),
	('H5113','נוֹד','Nôwd','node','the same as נוֹדlemma נוֹדּ extra dagesh, corrected to נוֹד; vagrancy; Nod, the land of Cain; Nod.'),
	('H5114','נוֹדָב','Nôwdâb','no-dawb\'','from נָדַב; noble; Nodab, an Arab tribe; Nodab.'),
	('H5115','נָוָה','nâvâh','naw-vaw\'','a primitive root; (compare נָוֶה); to rest (as at home); causatively (through the implied idea of beauty ), to celebrate (with praises); keept at home, prepare an habitation.'),
	('H5116','נָוֶה','nâveh','naw-veh\'','or (feminine) נָוָה; from נָוָה; (adjectively) at home; hence (by implication of satisfaction) lovely; also (noun) a home, of God (temple), men (residence), flocks (pasture), or wild animals (den); comely, dwelling (place), fold, habitation, pleasant place, sheepcote, stable, tarried.'),
	('H5117','נוּחַ','nûwach','noo\'-akh','a primitive root; to rest, i.e. settle down; used in a great variety of applications, literal and figurative, intransitive, transitive and causative (to dwell, stay, let fall, place, let alone, withdraw, give comfort, etc.); cease, be confederate, lay, let down, (be) quiet, remain, (cause to, be at, give, have, make to) rest, set down. Compare יָנִים.'),
	('H5118','נוּחַ','nûwach','noo\'-akh','or נוֹחַ; from נוּחַ; quiet; rest(-ed, -ing place).'),
	('H5119','נוֹחָה','Nôwchâh','no-chaw\'','feminine of נוּחַ; quietude; Nochah, an Israelite; Nohah.'),
	('H5120','נוּט','nûwṭ','noot','to quake; be moved.'),
	('H5121','נָוִית','Nâvîyth','naw-veeth\'','from נָוָה; residence; Navith, a place in Palestine; Naioth (from the margin).'),
	('H5122','נְוָלוּ','nᵉvâlûw','nev-aw-loo\'','(Aramaic) or נְוָלִי; (Aramaic), from an unused root probably meaning to be foul; a sink; dunghill.'),
	('H5123','נוּם','nûwm','noom','a primitive root; to slumber (from drowsiness); sleep, slumber.'),
	('H5124','נוּמָה','nûwmâh','noo-maw\'','from נוּם; sleepiness; drowsiness.'),
	('H5125','נוּן','nûwn','noon','a primitive root; to resprout, i.e. propagate by shoots; figuratively, to be perpetual; be continued.'),
	('H5126','נוּן','Nûwn','noon','or נוֹן; (1 Chronicles 7:27), from נוּן; perpetuity,; Nun or Non, the father of Joshua; Non, Nun.'),
	('H5127','נוּס','nûwç','noos','a primitive root; to flit, i.e. vanish away (subside, escape; causatively, chase, impel, deliver); [idiom] abate, away, be displayed, (make to) flee (away, -ing), put to flight, [idiom] hide, lift up a standard.'),
	('H5128','נוּעַ','nûwaʻ','noo\'-ah','a primitive root; to waver, in a great variety of applications, literally and figuratively (as subjoined); continually, fugitive, [idiom] make, to (go) up and down, be gone away, (be) move(-able, -d), be promoted, reel, remove, scatter, set, shake, sift, stagger, to and fro, be vagabond, wag, (make) wander (up and down).'),
	('H5129','נוֹעַדְיָה','Nôwʻadyâh','no-ad-yaw\'','from יָעַד and יָהּ; convened of Jah; Noadjah, the name of an Israelite, and a false prophetess; Noadiah.'),
	('H5130','נוּף','nûwph','noof','a primitive root; to quiver (i.e. vibrate up and down, or rock to and fro); used in a great variety of applications (including sprinkling, beckoning, rubbing, bastinadoing, sawing, waving, etc.); lift up, move, offer, perfume, send, shake, sift, strike, wave.'),
	('H5131','נוֹף','nôwph','nofe','from נוּף; elevation; situation. Compare נֹף.'),
	('H5132','נוּץ','nûwts','noots','a primitive root; properly, to flash; hence, to blossom (from the brilliancy of color); also, to fly away (from the quickness of motion); flee away, bud (forth).'),
	('H5133','נוֹצָה','nôwtsâh','no-tsaw\'','or נֹצָה; feminine active participle of נָצָה in the sense of flying; a pinion (or wing feather); often (collectively) plumage; feather(-s), ostrich.'),
	('H5134','נוּק','nûwq','nook','a primitive root; to suckle; nurse.'),
	('H5135','נוּר','nûwr','noor','(Aramaic) from an unused root (corresponding to that of נִיר) meaning to shine; fire; fiery, fire.'),
	('H5136','נוּשׁ','nûwsh','noosh','a primitive root; to be sick, i.e. (figuratively) distressed; be full of heaviness.'),
	('H5137','נָזָה','nâzâh','naw-zaw\'','a primitive root; to spirt, i.e. besprinkle (especially in expiation); sprinkle.'),
	('H5138','נָזִיד','nâzîyd','naw-zeed\'','from זוּד; something boiled, i.e. soup; pottage.'),
	('H5139','נָזִיר','nâzîyr','naw-zeer\'','or נָזִר; from נָזַר; separate, i.e. consecrated (as prince, a Nazirite); hence (figuratively from the latter) an unpruned vine (like an unshorn Nazirite); Nazarite (by a false alliteration with Nazareth), separate(-d), vine undressed.'),
	('H5140','נָזַל','nâzal','naw-zal\'','a primitive root; to drip, or shed by trickling; distil, drop, flood, (cause to) flow(-ing), gush out, melt, pour (down), running water, stream.'),
	('H5141','נֶזֶם','nezem','neh\'-zem','from an unused root of uncertain meaning; a nose-ring; earring, jewel.'),
	('H5142','נְזַק','nᵉzaq','nez-ak\'','(Aramaic) corresponding to the root of נֵזֶק; to suffer (causatively, inflict) loss; have (en-) damage, hurt(-ful).'),
	('H5143','נֵזֶק','nêzeq','nay\'zek','from an unused root meaning to injure; loss; damage.'),
	('H5144','נָזַר','nâzar','naw-zar\'','a primitive root; to hold aloof, i.e. (intransitivey) abstain (from food and drink, from impurity, and even from divine worship (i.e. apostatize)); specifically, to set apart (to sacred purposes), i.e. devote; consecrate, separate(-ing, self).'),
	('H5145','נֶזֶר','nezer','neh\'-zer','or נֵזֶר; from נָזַר; properly, something set apart, i.e. (abstractly) dedication (of a priet or Nazirite); hence (concretely) unshorn locks; also (by implication) a chaplet (especially of royalty); consecration, crown, hair, separation.'),
	('H5146','נֹחַ','Nôach','no\'-akh','the same as נוּחַ; rest; Noach, the patriarch of the flood; Noah.');
INSERT INTO `strongs` (`number`, `lemma`, `xlit`, `pronounce`, `description`)
VALUES
	('H5147','נַחְבִּי','Nachbîy','nakh-bee\'','from חָבָה; occult; Nachbi, an Israelite; Nakbi.'),
	('H5148','נָחָה','nâchâh','naw-khaw\'','a primitive root; to guide; by implication, to transport (into exile, or as colonists); bestow, bring, govern, guide, lead (forth), put, straiten.'),
	('H5149','נְחוּם','Nᵉchûwm','neh-khoom\'','from נָחַם; comforted; Nechum, an Israelite; Nehum.'),
	('H5150','נִחוּם','nichûwm','nee-khoom\'','or נִחֻם; from נָחַם; properly, consoled; abstractly, solace; comfort(-able), repenting.'),
	('H5151','נַחוּם','Nachûwm','nakh-oom\'','from נָחַם; comfortable; Nachum, an Israelite prophet; Nahum.'),
	('H5152','נָחוֹר','Nâchôwr','naw-khore\'','from the same as נַחַר; snorer; Nochor, the name of the grandfather and a brother of Abraham; Nahor.'),
	('H5153','נָחוּשׁ','nâchûwsh','naw-khoosh\'','apparently passive participle of נָחַשׁ (perhaps in the sense of ringing), i.e. bell-metal; or from the red color of the throat of a serpent (נָחָשׁ, as denominative) when hissing); coppery, i.e. (figuratively) hard; of brass.'),
	('H5154','נְחוּשָׁה','nᵉchûwshâh','nekh-oo-shaw\'','or נְחֻשָׁה; feminine of נָחוּשׁ; copper; brass, steel. Compare נָחָשׁ.'),
	('H5155','נְחִילָה','nᵉchîylâh','nekh-ee-law\'','probably denominative from חָלִיל; a flute; (plural) Nehiloth.'),
	('H5156','נְחִיר','nᵉchîyr','nekh-eer\'','from the same as נַחַר; a nostril; (dual) nostrils.'),
	('H5157','נָחַל','nâchal','naw-khal\'','a primitive root; to inherit (as a (figurative) mode of descent), or (generally) to occupy; causatively, to bequeath, or (generally) distribute, instate; divide, have (inheritance), take as a heritage, (cause to, give to, make to) inherit, (distribute for, divide (for, for an, by), give for, have, leave for, take (for)) inheritance, (have in, cause to, be made to) possess(-ion).'),
	('H5158','נַחַל','nachal','nakh\'-al','or (feminine) נַחְלָה; (Psalm 124:4), or נַחֲלָה; (Ezekiel 47:19; Ezekiel 48:28), from נָחַל in its original sense; a stream, especially a winter torrent; (by implication) a (narrow) valley (in which a brook runs); also a shaft (of a mine); brook, flood, river, stream, valley.'),
	('H5159','נַחֲלָה','nachălâh','nakh-al-aw\'','from נָחַל (in its usual sense); properly, something inherited, i.e. (abstractly) occupancy, or (concretely) an heirloom; generally an estate, patrimony or portion; heritage, to inherit, inheritance, possession. Compare נַחַל.'),
	('H5160','נַחֲלִיאֵל','Nachălîyʼêl','nakh-al-ee-ale\'','from נַחַל and אֵל; valley of God; Nachaliel, a place in the Desert; Nahaliel.'),
	('H5161','נֶחֱלָמִי','Nechĕlâmîy','nekh-el-aw-mee\'','apparently a patronymic from an unused name (apparently passive participle of חָלַם); dreamed; a Nechelamite, or descendant of Nechlam; Nehelamite.'),
	('H5162','נָחַם','nâcham','naw-kham\'','a primitive root; properly, to sigh, i.e. breathe strongly; by implication, to be sorry, i.e. (in a favorable sense) to pity, console or (reflexively) rue; or (unfavorably) to avenge (oneself); comfort (self), ease (one\'s self), repent(-er,-ing, self).'),
	('H5163','נַחַם','Nacham','nakh\'-am','from נָחַם; consolation; Nacham, an Israelite; Naham.'),
	('H5164','נֹחַם','nôcham','no\'-kham','from נָחַם; ruefulness, i.e. desistance; repentance.'),
	('H5165','נֶחָמָה','nechâmâh','nekh-aw-maw\'','from נָחַם; consolation; comfort.'),
	('H5166','נְחֶמְיָה','Nᵉchemyâh','nekh-em-yaw\'','from נָחַם and יָהּ; consolation of Jah; Nechemjah, the name of three Israelites; Nehemiah.'),
	('H5167','נַחֲמָנִי','Nachămânîy','nakh-am-aw-nee\'','from נָחַם; consolatory; Nachamani, an Israelite; Nahamani.'),
	('H5168','נַחְנוּ','nachnûw','nakh-noo\'','for אֲנַחְנוּ; we; we.'),
	('H5169','נָחַץ','nâchats','naw-khats\'','a primitive root; to be urgent; require haste.'),
	('H5170','נַחַר','nachar','nakh\'-ar','and (feminine) נַחֲרָה; from an unused root meaning to snort or snore; a snorting; nostrils, snorting.'),
	('H5171','נַחֲרַי','Nachăray','nakh-ar-ah\'-ee','or נַחְרַי; from the same as נַחַר; snorer; Nacharai or Nachrai, an Israelite; Naharai, Nahari.'),
	('H5172','נָחַשׁ','nâchash','naw-khash\'','a primitive root; properly, to hiss, i.e. whisper a (magic) spell; generally, to prognosticate; [idiom] certainly, divine, enchanter, (use) [idiom] enchantment, learn by experience, [idiom] indeed, diligently observe.'),
	('H5173','נַחַשׁ','nachash','nakh\'-ash','from נָחַשׁ; an incantation or augury; enchantment.'),
	('H5174','נְחָשׁ','nᵉchâsh','nekh-awsh\'','(Aramaic) corresponding to נְחוּשָׁה; copper; brass.'),
	('H5175','נָחָשׁ','nâchâsh','naw-khawsh\'','from נָחַשׁ; a snake (from its hiss); serpent.'),
	('H5176','נָחָשׁ','Nâchâsh','naw-khawsh\'','the same as נָחָשׁ; Nachash, the name of two persons apparently non-Israelite; Nahash.'),
	('H5177','נַחְשׁוֹן','Nachshôwn','nakh-shone\'','from נָחַשׁ; enchanter; Nachshon, an Israelite; Naashon, Nahshon.'),
	('H5178','נְחֹשֶׁת','nᵉchôsheth','nekh-o\'-sheth','for נְחוּשָׁה; copper, hence, something made of that metal, i.e. coin, a fetter; figuratively, base (as compared with gold or silver); brasen, brass, chain, copper, fetter (of brass), filthiness, steel.'),
	('H5179','נְחֻשְׁתָּא','Nᵉchushtâʼ','nekh-oosh-taw\'','from נְחֹשֶׁת; copper; Nechushta, an Israelitess; Nehushta.'),
	('H5180','נְחֻשְׁתָּן','Nᵉchushtân','nekh-oosh-tawn\'','from נְחֹשֶׁת; something made of copper, i.e. the copper serpent of the Desert; Nehushtan.'),
	('H5181','נָחַת','nâchath','naw-khath\'','a primitive root; to sink, i.e. descend; causatively, to press or lead down; be broken, (cause to) come down, enter, go down, press sore, settle, stick fast.'),
	('H5182','נְחַת','nᵉchath','nekh-ath\'','(Aramaic) corresponding to נָחַת; to descend; causatively, to bring away, deposit, depose; carry, come down, depose, lay up, place.'),
	('H5183','נַחַת','Nachath','nakh\'-ath','from נְחַת; also (intransitively; perhaps from נוּחַ); a descent, i.e. imposition, unfavorable (punishment) or favorable (food); restfulness; lighting down, quiet(-ness), to rest, be set on.'),
	('H5184','נַחַת','Nachath','nakh\'-ath','the same as נַחַת; quiet; Nachath, the name of an Edomite and of two Israelites; Nahath.'),
	('H5185','נָחֵת','nâchêth','naw-khayth\'','from נָחַת; descending; come down.'),
	('H5186','נָטָה','nâṭâh','naw-taw\'','a primitive root; to stretch or spread out; by implication, to bend away (including moral deflection); used in a great variety of application; [phrase] afternoon, apply, bow (down, -ing), carry aside, decline, deliver, extend, go down, be gone, incline, intend, lay, let down, offer, outstretched, overthrown, pervert, pitch, prolong, put away, shew, spread (out), stretch (forth, out), take (aside), turn (aside, away), wrest, cause to yield.'),
	('H5187','נְטִיל','nᵉṭîyl','net-eel\'','from נָטַל; laden; that bear.'),
	('H5188','נְטִיפָה','nᵉṭîyphâh','net-ee-faw\'','from נָטַף; a pendant for the ears (especially of pearls); chain, collar.'),
	('H5189','נְטִישָׁה','nᵉṭîyshâh','net-ee-shaw\'','from נָטַשׁ; a tendril (as an offshoot); battlement, branch, plant.'),
	('H5190','נָטַל','nâṭal','naw-tal\'','a primitive root; to lift; by implication, to impose; bear, offer, take up.'),
	('H5191','נְטַל','nᵉṭal','net-al\'','(Aramaic) corresponding to נָטַל; to raise; take up.'),
	('H5192','נֵטֶל','nêṭel','nay\'-tel','; from נָטַל; a burden; weighty.'),
	('H5193','נָטַע','nâṭaʻ','naw-tah\'','a primitive root; properly, to strike in, i.e. fix; specifically, to plant (literally or figuratively); fastened, plant(-er).'),
	('H5194','נֶטַע','neṭaʻ','neh\'-tah','from נָטַע; a plant; collectively, a plantation; abstractly, a planting; plant.'),
	('H5195','נָטִיעַ','nâṭîyaʻ','naw-tee\'-ah','xlit nâṭîaʻ corrected to nâṭîyaʻ; from נָטַע; a plant; plant.'),
	('H5196','נְטָעִים','Nᵉṭâʻîym','net-aw-eem\'','plural of נֶטַע; Netaim, a place in Palestine; plants.'),
	('H5197','נָטַף','nâṭaph','naw-taf\'','a primitive root; to ooze, i.e. distil gradually; by implication, to fall in drops; figuratively, to speak by inspiration; drop(-ping), prophesy(-et).'),
	('H5198','נָטָף','nâṭâph','naw-tawf\'','from נָטַף; a drop; specifically, an aromatic gum (probably stacte); drop, stacte.'),
	('H5199','נְטֹפָה','Nᵉṭôphâh','net-o-faw\'','from נָטַף; distillation; Netophah, a place in Palestine; Netophah.'),
	('H5200','נְטֹפָתִי','Nᵉṭôphâthîy','net-o-faw-thee\'','patronymic from נְטֹפָה; a Netophathite, or inhabitant of Netophah; Netophathite.'),
	('H5201','נָטַר','nâṭar','naw-tar\'','a primitive root; to guard; figuratively, to cherish (anger); bear grudge, keep(-er), reserve.'),
	('H5202','נְטַר','nᵉṭar','net-ar\'','(Aramaic) corresponding to נָטַר; to retain; keep.'),
	('H5203','נָטַשׁ','nâṭash','naw-tash\'','a primitive root; properly, to pound, i.e. smite; by implication (as if beating out, and thus expanding) to disperse; also, to thrust off, down, out or upon (inclusively, reject, let alone, permit, remit, etc.); cast off, drawn, let fall, forsake, join (battle), leave (off), lie still, loose, spread (self) abroad, stretch out, suffer.'),
	('H5204','נִי','nîy','nee','a doubtful word; apparently from נָהָה; lamentation; wailing.'),
	('H5205','נִיד','nîyd','need','from נוּד; motion (of the lips in speech); moving.'),
	('H5206','נִידָה','nîydâh','nee-daw\'','feminine of נִיד; removal, i.e. exile; removed.'),
	('H5207','נִיחוֹחַ','nîychôwach','nee-kho\'-akh','or נִיחֹחַ; from נוּחַ; properly, restful, i.e. pleasant; abstractly, delight; sweet (odour).'),
	('H5208','נִיחוֹחַ','nîychôwach','nee-kho\'-akh','(Aramaic) or נִיחֹחַ; (shorter) (Aramaic), corresponding to נִיחוֹחַ; pleasure; sweet odour (savour).'),
	('H5209','נִין','nîyn','neen','from נוּן; progeny; son.'),
	('H5210','נִינְוֵה','Nîynᵉvêh','nee-nev-ay\'','of foreign origin; Nineveh, the capital of Assyria; Nineveh.'),
	('H5211','נִיס','nîyç','neece','from נוּס; fugitive; that fleeth.'),
	('H5212','נִיסָן','Nîyçân','nee-sawn\'','probably of foreign origin; Nisan, the first month of the Jewish sacred year; Nisan.'),
	('H5213','נִיצוֹץ','nîytsôwts','nee-tsotes\'','from נָצַץ; a spark; spark.'),
	('H5214','נִיר','nîyr','neer','a root probably identical with that of נִיר, through the idea of the gleam of a fresh furrow; to till the soil; break up.'),
	('H5215','נִיר','nîyr','neer','or נִר; from נִיר; properly, plowing, i.e. (concretely) freshly plowed land; fallow ground, plowing, tillage.'),
	('H5216','נִיר','nîyr','neer','or נִר; also נֵיר; or נֵר; or (feminine) נֵרָה; from a primitive root (see נִיר; נוּר) properly, meaning to glisten; a lamp (i.e. the burner) or light (literally or figuratively); candle, lamp, light.'),
	('H5217','נָכָא','nâkâʼ','naw-kaw\'','a primitive root; to smite, i.e. drive away; be viler.'),
	('H5218','נָכֵא','nâkêʼ','naw-kay\'','or נָכָא; from נָכָא; smitten, i.e. (figuratively) afflicted; broken, stricken, wounded.'),
	('H5219','נְכֹאת','nᵉkôʼth','nek-ohth\'','from נָכֵא; properly, a smiting, i.e. (concretely) an aromatic gum (perhaps styrax) (as powdered); spicery(-ces).'),
	('H5220','נֶכֶד','neked','neh\'-ked','from an unused root meaning to propagate; offspring; nephew, son\'s son.'),
	('H5221','נָכָה','nâkâh','naw-kaw\'','a primitive root; to strike (lightly or severely, literally or figuratively); beat, cast forth, clap, give (wounds), [idiom] go forward, [idiom] indeed, kill, make (slaughter), murderer, punish, slaughter, slay(-er, -ing), smite(-r, -ing), strike, be stricken, (give) stripes, [idiom] surely, wound.'),
	('H5222','נֵכֶה','nêkeh','nay-keh\'','from נָכָה; a smiter, i.e. (figuratively) traducer; abject.'),
	('H5223','נָכֶה','nâkeh','naw-keh\'','; smitten, i.e. (literally) maimed, or (figuratively) dejected; contrite, lame.'),
	('H5224','נְכוֹ','Nᵉkôw','nek-o\'','probably of Egyptian origin; Neko, an Egyptian king; Necho. Compare פַּרְעֹה נְכֹה.'),
	('H5225','נָכוֹן','Nâkôwn','naw-kone\'','from כּוּן; prepared; Nakon, probably an Israelite; Nachon.'),
	('H5226','נֵכַח','nêkach','nay\'-kakh','from an unused root meaning to be straightforward; properly, the fore part; used adverbially, opposite; before, over against.'),
	('H5227','נֹכַח','nôkach','no\'-kakh','from the same as נֵכַח; properly, the front part; used adverbially (especially with preposition), opposite, in front of, forward, in behalf of; (over) against, before, direct(-ly), for, right (on).'),
	('H5228','נָכֹחַ','nâkôach','naw-ko\'-akh','from the same as נֵכַח; straightforward, i.e. (figuratively), equitable, correct, or (abstractly), integrity; plain, right, uprightness.'),
	('H5229','נְכֹחָה','nᵉkôchâh','nek-o-khaw\'','feminine of נָכֹחַ; properly, straightforwardness, i.e. (figuratively) integrity, or (concretely) a truth; equity, right (thing), uprightness.'),
	('H5230','נָכַל','nâkal','naw-kal\'','a primitive root; to defraud, i.e. act treacherously; beguile, conspire, deceiver, deal subtilly.'),
	('H5231','נֵכֶל','nêkel','nay\'-kel','from נָכַל; deceit; wile.'),
	('H5232','נְכַס','nᵉkaç','nek-as\'','(Aramaic) corresponding to נֶכֶס; {treasure}; goods.'),
	('H5233','נֶכֶס','nekeç','neh\'-kes','from an unused root meaning to accumulate; treasure; riches, wealth.'),
	('H5234','נָכַר','nâkar','naw-kar\'','a primitive root; properly, to scrutinize, i.e. look intently at; hence (with recognition implied), to acknowledge, be acquainted with, care for, respect, revere, or (with suspicion implied), to disregard, ignore, be strange toward, reject, resign, dissimulate (as if ignorant or disowning); acknowledge, [idiom] could, deliver, discern, dissemble, estrange, feign self to be another, know, take knowledge (notice), perceive, regard, (have) respect, behave (make) self strange(-ly).'),
	('H5235','נֶכֶר','neker','neh\'-ker','or נֹכֶר; from נָכַר; something strange, i.e. unexpected calamity; strange.'),
	('H5236','נֵכָר','nêkâr','nay-kawr\'','\' from נָכַר; foreign, or (concretely) a foreigner, or (abstractly) heathendom; alien, strange ([phrase] -er).'),
	('H5237','נׇכְרִי','nokrîy','nok-ree\'','from נֶכֶר (second form); strange, in a variety of degrees and applications (foreign, non-relative, adulterous, different, wonderful); alien, foreigner, outlandish, strange(-r, woman).'),
	('H5238','נְכֹת','nᵉkôth','nek-oth\'','probably for נְכֹאת; spicery, i.e. (generally) valuables; precious things.'),
	('H5239','נָלָה','nâlâh','naw-law\'','apparently a primitive root; to complete; make an end.'),
	('H5240','נְמִבְזֶה','nᵉmibzeh','nem-ib-zeh\'','from בָּזָה,; despised; vile.'),
	('H5241','נְמוּאֵל','Nᵉmûwʼêl','nem-oo-ale\'','apparently for יְמוּאֵל; Nemuel, the name of two Israelites; Nemuel.'),
	('H5242','נְמוּאֵלִי','Nᵉmûwʼêlîy','nem-oo-ay-lee\'','from נְמוּאֵל; a Nemuelite, or descendant of Nemuel; Nemuelite.'),
	('H5243','נָמַל','nâmal','naw-mal\'','a primitive root; to become clipped or (specifically) circumcised; (branch to) be cut down (off), circumcise.'),
	('H5244','נְמָלָה','nᵉmâlâh','nem-aw-law\'','feminine from נָמַל; an ant (probably from its almost bisected form); ant.'),
	('H5245','נְמַר','nᵉmar','nem-ar\'','(Aramaic) corresponding to נָמֵר; {a leopard (from its stripes)}; leopard.'),
	('H5246','נָמֵר','nâmêr','naw-mare\'','from an unused root meaning properly, to filtrate, i.e. be limpid (comp נִמְרָה and נִמְרִים); and thus to spot or stain as if by dripping; a leopard (from its stripes); leopard.'),
	('H5247','נִמְרָה','Nimrâh','nim-raw\'','from the same as נָמֵר; clear water; Nimrah, a place East of the Jordan; Nimrah. See also בֵּית נִמְרָה, נִמְרִים.'),
	('H5248','נִמְרוֹד','Nimrôwd','nim-rode\'','or נִמְרֹד; probably of foreign origin; Nimrod, a son of Cush; Nimrod.'),
	('H5249','נִמְרִים','Nimrîym','nim-reem\'','plural of a masculine corresponding to נִמְרָה; clear waters; Nimrim, a place East of the Jordan; Nimrim. Compare בֵּית נִמְרָה.'),
	('H5250','נִמְשִׁי','Nimshîy','nim-shee\'','probably from מָשָׁה; extricated; Nimshi, the (grand-) father of Jehu; Nimshi.'),
	('H5251','נֵס','nêç','nace','from נָסַס; a flag; also a sail; by implication, a flagstaff; generally a signal; figuratively, a token; banner, pole, sail, (en-) sign, standard.'),
	('H5252','נְסִבָּה','nᵉçibbâh','nes-ib-baw\'','feminine participle passive of סָבַב; properly, an environment, i.e. circumstance or turn of affairs; cause.'),
	('H5253','נָסַג','nâçag','naw-sag\'','a primitive root; to retreat; departing away, remove, take (hold), turn away.'),
	('H5254','נָסָה','nâçâh','naw-saw\'','a primitive root; to test; by implication, to attempt; adventure, assay, prove, tempt, try.'),
	('H5255','נָסַח','nâçach','naw-sakh\'','a primitive root; to tear away; destroy, pluck, root.'),
	('H5256','נְסַח','nᵉçach','nes-akh\'','(Aramaic) corresponding to נָסַח; {to tear away}; pull down.'),
	('H5257','נְסִיךְ','nᵉçîyk','nes-eek\'','from נָסַךְ; properly, something poured out, i.e. a libation; also a molten image; by implication, a prince (as anointed); drink offering, duke, prince(-ipal).'),
	('H5258','נָסַךְ','nâçak','naw-sak\'','a primitive root; to pour out, especially a libation, or to cast (metal); by analogy, to anoint aking; cover, melt, offer, (cause to) pour (out), set (up).'),
	('H5259','נָסַךְ','nâçak','naw-sak\'','a primitive root (probably identical with נָסַךְ through the idea of fusion); to interweave, i.e. (figuratively) to overspread; that is spread.'),
	('H5260','נְסַךְ','nᵉçak','nes-ak\'','(Aramaic) corresponding to נָסַךְ; to pour out a libation; offer.'),
	('H5261','נְסַךְ','nᵉçak','nes-ak\'','(Aramaic) corresponding to נֶסֶךְ; a libation; drink offering.'),
	('H5262','נֶסֶךְ','neçek','neh\'-sek','or נֵסֶךְ; from נָסַךְ; a libation; also a cast idol; cover, drink offering, molten image.'),
	('H5263','נָסַס','nâçaç','naw-sas\'','a primitive root; to wane, i.e. be sick; faint.'),
	('H5264','נָסַס','nâçaç','naw-sas\'','a primitive root; to gleam from afar, i.e. to be conspicuous as a signal; or rather perhaps a denominative from נֵס (and identical with נָסַס, through the idea of a flag as fluttering in the wind); to raise a beacon; lift up as an ensign.'),
	('H5265','נָסַע','nâçaʻ','naw-sah\'','a primitive root; properly, to pull up, especially the tent-pins, i.e. start on ajourney; cause to blow, bring, get, (make to) go (away, forth, forward, onward, out), (take) journey, march, remove, set aside (forward), [idiom] still, be on his (go their) way.'),
	('H5266','נָסַק','nâçaq','naw-sak\'','a primitive root; to go up; ascend.'),
	('H5267','נְסַק','nᵉçaq','nes-ak\'','(Aramaic) corresponding to נָסַק; {to go up}; take up.'),
	('H5268','נִסְרֹךְ','Niçrôk','nis-roke\'','lemma נְסִרֹךְ first vowel, corrected to נִסְרֹךְ; of foreign origin; Nisrok, a Babylonian idol; Nisroch.'),
	('H5269','נֵעָה','Nêʻâh','nay-aw\'','from נוּעַ; motion; Neah, a place in Palestine; Neah.'),
	('H5270','נֹעָה','Nôʻâh','no-aw\'','from נוּעַ; movement; Noah, an Israelitess; Noah.'),
	('H5271','נָעוּר','nâʻûwr','naw-oor\'','or נָעֻר; and (feminine) נְעֻרָה; properly, passive participle from נַעַר as denominative; (only in plural collectively or emphatic form) youth, the state (juvenility) or the persons (young people); childhood, youth.'),
	('H5272','נְעִיאֵל','Nᵉʻîyʼêl','neh-ee-ale\'','from נוּעַ and אֵל; moved of God; Neiel, a place in Palestine; Neiel.'),
	('H5273','נָעִים','nâʻîym','naw-eem\'','from נָעֵם; delightful (objective or subjective, literal or figurative); pleasant(-ure), sweet.'),
	('H5274','נָעַל','nâʻal','naw-al\'','a primitive root; also denominative from נַעַל; properly, to fasten up, i.e. with abar or cord; hence, to sandal, i.e. furnish with slippers; bolt, inclose, lock, shoe, shut up.'),
	('H5275','נַעַל','naʻal','nah\'-al','or (feminine) נַעֲלָה; from נָעַל; properly, a sandal tongue; by extension a sandal or slipper (sometimes as a symbol of occupancy, a refusal to marry, or of something valueless); dryshod, (pair of) shoe((-latchet), -s).'),
	('H5276','נָעֵם','nâʻêm','naw-ame\'','a primitive root; to be agreeable (literally or figuratively); pass in beauty, be delight, be pleasant, be sweet.'),
	('H5277','נַעַם','Naʻam','nah\'-am','from נָעֵם; pleasure; Naam, an Israelite; Naam.'),
	('H5278','נֹעַם','nôʻam','no\'-am','from נָעֵם; agreeableness, i.e. delight, suitableness, splendor or grace; beauty, pleasant(-ness).'),
	('H5279','נַעֲמָה','Naʻămâh','nah-am-aw\'','feminine of נַעַם; pleasantness; Naamah, the name of an antediluvian woman, of an Ammonitess, and of a place in Palestine; Naamah.'),
	('H5280','נַעֲמִי','Naʻămîy','nah-am-ee\'','patronymic from נַעֲמָן; a Naamanite, or descendant of Naaman (collectively); Naamites.'),
	('H5281','נׇעֳמִי','Noʻŏmîy','no-om-ee\'','from נֹעַם; pleasant; Noomi, an Israelitess; Naomi.'),
	('H5282','נַעֲמָן','naʻămân','nah-am-awn\'','from נָעֵם; pleasantness (plural as concrete); pleasant.'),
	('H5283','נַעֲמָן','Naʻămân','nah-am-awn\'','the same as נַעֲמָן; Naaman, the name of an Israelite and of a Damascene; Naaman.'),
	('H5284','נַעֲמָתִי','Naʻămâthîy','nah-am-aw-thee\'','patrial from a place corresponding in name (but not identical) with נַעֲמָה; a Naamathite, or inhabitant of Naamah; Naamathite.'),
	('H5285','נַעֲצוּץ','naʻătsûwts','nah-ats-oots\'','from an unused root meaning to prick; probably a brier; by implication, a thicket of thorny bushes; thorn.'),
	('H5286','נָעַר','nâʻar','naw-ar\'','a primitive root; to growl; yell.'),
	('H5287','נָעַר','nâʻar','naw-ar\'','a primitive root (probably identical with נָעַר, through the idea of the rustling of mane, which usually accompanies the lion\'s roar); to tumble about; shake (off, out, self), overthrow, toss up and down.'),
	('H5288','נַעַר','naʻar','nah\'-ar','from נָעַר; (concretely) a boy (as active), from the age of infancy to adolescence; by implication, a servant; also (by interch. of sex), a girl (of similar latitude in age); babe, boy, child, damsel (from the margin), lad, servant, young (man).'),
	('H5289','נַעַר','naʻar','nah\'-ar','from נָעַר in its derivative sense of tossing about; a wanderer; young one.'),
	('H5290','נֹעַר','nôʻar','no\'-ar','from נָעַר; (compare נַעַר); (abstractly) boyhood; child, youth.'),
	('H5291','נַעֲרָה','naʻărâh','nah-ar-aw\'','feminine of נַעַר; a girl (from infancy to adolescence); damsel, maid(-en), young (woman).'),
	('H5292','נַעֲרָה','Naʻărâh','nah-ar-aw\'','the same as נַעֲרָה; Naarah, the name of an Israelitess, and of a place in Palestine; Naarah, Naarath.'),
	('H5293','נַעֲרַי','Naʻăray','nah-ar-ah\'-ee','from נַעַר; youthful; Naarai, an Israelite; Naarai.'),
	('H5294','נְעַרְיָה','Nᵉʻaryâh','neh-ar-yaw\'','from נַעַר and יָהּ; servant of Jah; Nearjah, the name of two Israelites; Neariah.'),
	('H5295','נַעֲרָן','Naʻărân','nah-ar-awn\'','from נַעַר; juvenile; Naaran, a place in Palestine; Naaran.'),
	('H5296','נְעֹרֶת','nᵉʻôreth','neh-o\'-reth','from נָעַר; something shaken out, i.e. tow (as the refuse of flax); tow.'),
	('H5297','נֹף','Nôph','nofe','a variation of מֹף; Noph, the capital of Upper Egypt; Noph.'),
	('H5298','נֶפֶג','Nepheg','neh\'-feg','from an unused root probably meaning to spring forth; a sprout; Nepheg, the name of two Israelites; Nepheg.'),
	('H5299','נָפָה','nâphâh','naw-faw\'','from נוּף in the sense of lifting; a height; also a sieve; border, coast, region, sieve.'),
	('H5300','נְפוּשְׁסִים','Nᵉphûwshᵉçîym','nef-oo-shes-eem\'','for נְפִיסִים; Nephushesim, a Temple-servant; Nephisesim (from the margin).'),
	('H5301','נָפַח','nâphach','naw-fakh\'','a primitive root; to puff, in various applications (literally, to inflate, blow hard, scatter, kindle, expire; figuratively, to disesteem); blow, breath, give up, cause to lose (life), seething, snuff.'),
	('H5302','נֹפַח','Nôphach','no\'-fakh','from נָפַח; a gust; Nophach, a place in Moab; Nophah.'),
	('H5303','נְפִיל','nᵉphîyl','nef-eel\'','or נְפִל; from נָפַל; properly, a feller, i.e. a bully or tyrant; giant.'),
	('H5304','נְפִיסִים','Nᵉphîyçîym','nef-ee-seem\'','plural from an unused root meaning to scatter; expansions; Nephisim, a Temple-servant; Nephusim (from the margin).'),
	('H5305','נָפִישׁ','Nâphîysh','naw-feesh\'','from נָפַשׁ; refreshed; Naphish, a son of Ishmael, and his posterity; Naphish.'),
	('H5306','נֹפֶךְ','nôphek','no\'-fek','from an unused root meaning to glisten; shining; a gem, probably the garnet; emerald.'),
	('H5307','נָפַל','nâphal','naw-fal\'','a primitive root; to fall, in a great variety of applications (intransitive or causative, literal or figurative); be accepted, cast (down, self, (lots), out), cease, die, divide (by lot), (let) fail, (cause to, let, make, ready to) fall (away, down, -en, -ing), fell(-ing), fugitive, have (inheritance), inferior, be judged (by mistake for פָּלַל), lay (along), (cause to) lie down, light (down), be ([idiom] hast) lost, lying, overthrow, overwhelm, perish, present(-ed, -ing), (make to) rot, slay, smite out, [idiom] surely, throw down.'),
	('H5308','נְפַל','nᵉphal','nef-al\'','(Aramaic) corresponding to נָפַל; {to fall, in a great variety of applications (intransitive or causative, literal or figurative)}; fall (down), have occasion.'),
	('H5309','נֶפֶל','nephel','neh\'-fel','or נֵפֶל; from נָפַל; something fallen, i.e. an abortion; untimely birth.'),
	('H5310','נָפַץ','nâphats','naw-fats\'','a primitive root; to dash to pieces, or scatter; be beaten in sunder, break (in pieces), broken, dash (in pieces), cause to be discharged, dispersed, be overspread, scatter.'),
	('H5311','נֶפֶץ','nephets','neh\'-fets','from נָפַץ; a storm (as dispersing); scattering.'),
	('H5312','נְפַק','nᵉphaq','nef-ak\'','(Aramaic) a primitive root; to issue; causatively, to bring out; come (go, take) forth (out).'),
	('H5313','נִפְקָא','niphqâʼ','nif-kaw\'','(Aramaic) from נְפַק; an outgo, i.e. expense; expense.'),
	('H5314','נָפַשׁ','nâphash','naw-fash\'','a primitive root; to breathe; passively, to be breathed upon , i.e. (figuratively) refreshed (as if by a current of air); (be) refresh selves (-ed).'),
	('H5315','נֶפֶשׁ','nephesh','neh\'-fesh','from נָפַשׁ; properly, a breathing creature, i.e. animal of (abstractly) vitality; used very widely in a literal, accommodated or figurative sense (bodily or mental); any, appetite, beast, body, breath, creature, [idiom] dead(-ly), desire, [idiom] (dis-) contented, [idiom] fish, ghost, [phrase] greedy, he, heart(-y), (hath, [idiom] jeopardy of) life ([idiom] in jeopardy), lust, man, me, mind, mortally, one, own, person, pleasure, (her-, him-, my-, thy-) self, them (your) -selves, [phrase] slay, soul, [phrase] tablet, they, thing, ([idiom] she) will, [idiom] would have it.'),
	('H5316','נֶפֶת','nepheth','neh\'-feth','for נָפָה; a height; country.'),
	('H5317','נֹפֶת','nôpheth','no\'-feth','from נוּף in the sense of shaking to pieces; a dripping i.e. of honey (from the comb); honeycomb.'),
	('H5318','נֶפְתּוֹחַ','Nephtôwach','nef-to\'-akh','from פָּתַח; opened, i.e. a spring; Nephtoach, a place in Palestine; Neptoah.'),
	('H5319','נַפְתּוּל','naphtûwl','naf-tool\'','from פָּתַל; properly, wrestled; but used (in the plural) transitively, a struggle; wrestling.'),
	('H5320','נַפְתֻּחִים','Naphtuchîym','naf-too-kheem','plural of foreign origin,; Naphtuchim, an Egyptian tribe; Naptuhim.'),
	('H5321','נַפְתָּלִי','Naphtâlîy','naf-taw-lee\'','from פָּתַל; my wrestling; Naphtali, a son of Jacob, with the tribe descended from him, and its territory; Naphtali.'),
	('H5322','נֵץ','nêts','nayts','from נָצַץ; a flower (from its brilliancy); also a hawk (from it flashing speed); blossom, hawk.'),
	('H5323','נָצָא','nâtsâʼ','naw-tsaw\'','a primitive root; to go away; flee.'),
	('H5324','נָצַב','nâtsab','naw-tsab\'','a primitive root; to station, in various applications (literally or figuratively); appointed, deputy, erect, establish, [idiom] Huzzah (by mistake for a proper name), lay, officer, pillar, present, rear up, set (over, up), settle, sharpen, establish, (make to) stand(-ing, still, up, upright), best state.'),
	('H5325','נִצָּב','nitstsâb','nits-twawb\'','passive participle of נָצַב; fixed, i.e. a handle; haft.'),
	('H5326','נִצְבָּה','nitsbâh','nits-baw\'','(Aramaic) from a root corresponding to נָצַב; fixedness, i.e. firmness; strength.'),
	('H5327','נָצָה','nâtsâh','naw-tsaw\'','a primitive root; properly, to go forth, i.e. (by implication) to be expelled, and (consequently) desolate; causatively, to lay waste; also (specifically), to quarrel; be laid waste, runinous, strive (together).'),
	('H5328','נִצָּה','nitstsâh','nits-tsaw\'','feminine of נֵץ; a blossom; flower.'),
	('H5329','נָצַח','nâtsach','naw-tsakh\'','a primitive root;  also as denominative from נֶצַח; properly, to glitter from afar, i.e. to be eminent (as a superintendent, especially of the Temple services and its music); to be permanent; excel, chief musician (singer), oversee(-r), set forward.'),
	('H5330','נְצַח','nᵉtsach','nets-akh\'','(Aramaic) corresponding to נָצַח; to become chief; be preferred.'),
	('H5331','נֶצַח','netsach','neh\'-tsakh','or נֵצַח; from נָצַח; properly, a goal, i.e. the bright object at adistance travelled towards; hence (figuratively), splendor, or (subjectively) truthfulness, or (objectively) confidence; but usually (adverbially), continually (i.e. to the most distant point of view); alway(-s), constantly, end, ([phrase] n-) ever(more), perpetual, strength, victory.'),
	('H5332','נֵצַח','Nêtsach','nay\'-tsakh','probably identical with נֶצַח, through the idea of brilliancy of color; juice of the grape (as blood red); blood, strength.'),
	('H5333','נְצִיב','nᵉtsîyb','nets-eeb\'','or נְצִב; from נָצַב; something stationary, i.e. a prefect, a military post, a statue; garrison, officer, pillar.'),
	('H5334','נְצִיב','Nᵉtsîyb','nets-eeb\'','the same as נְצִיב; station; Netsib, a place in Palestine; Nezib.'),
	('H5335','נְצִיחַ','nᵉtsîyach','nets-ee\'-akh','from נָצַח; conspicuous; Netsiach, a Temple-servant; Neziah.'),
	('H5336','נָצִיר','nâtsîyr','naw-tsere\'','from נָצַר; properly, conservative; but used passively, delivered; preserved.'),
	('H5337','נָצַל','nâtsal','naw-tsal\'','a primitive root; to snatch away, whether in a good or a bad sense; [idiom] at all, defend, deliver (self), escape, [idiom] without fail, part, pluck, preserve, recover, rescue, rid, save, spoil, strip, [idiom] surely, take (out).'),
	('H5338','נְצַל','nᵉtsal','nets-al\'','(Aramaic) corresponding to נָצַל; to extricate; deliver, rescue.'),
	('H5339','נִצָּן','nitstsân','nits-tsawn\'','from נֵץ; a blossom; flower.'),
	('H5340','נָצַץ','nâtsats','naw-tsats\'','a primitive root; to glare, i.e. be bright-colored; sparkle.'),
	('H5341','נָצַר','nâtsar','naw-tsar\'','a primitive root; to guard, in a good sense (to protect, maintain, obey, etc.) or a bad one (to conceal, etc.); besieged, hidden thing, keep(-er, -ing), monument, observe, preserve(-r), subtil, watcher(-man).'),
	('H5342','נֵצֶר','nêtser','nay\'-tser','from נָצַר in the sense of greenness as a striking color; a shoot; figuratively, a descendant; branch.'),
	('H5343','נְקֵא','nᵉqêʼ','nek-ay\'','(Aramaic) from a root corresponding to נָקָה; clean; pure.'),
	('H5344','נָקַב','nâqab','naw-kab\'','a primitive root; to puncture, literally (to perforate, with more or less violence) or figuratively (to specify, designate, libel); appoint, blaspheme, bore, curse, express, with holes, name, pierce, strike through.'),
	('H5345','נֶקֶב','neqeb','neh\'keb','a bezel (for a gem); pipe.'),
	('H5346','נֶקֶב','Neqeb','neh\'-keb','the same as נֶקֶב; dell; Nekeb, a place in Palestine; Nekeb.'),
	('H5347','נְקֵבָה','nᵉqêbâh','nek-ay-baw\'','from נָקַב; female (from the sexual form); female.'),
	('H5348','נָקֹד','nâqôd','naw-kode\'','from an unused root meaning to mark (by puncturing or branding); spotted; speckled.'),
	('H5349','נֹקֵד','nôqêd','no-kade\'','active participle from the same as נָקֹד; a spotter (of sheep or cattle), i.e. the owner or tender (who thus marks them); herdman, sheepmaster.'),
	('H5350','נִקֻּד','niqqud','nik-kood\'','from the same as נָקֹד; a crumb (as broken to spots); also a biscuit (as pricked); cracknel, mouldy.'),
	('H5351','נְקֻדָּה','nᵉquddâh','ned-ood-daw\'','feminine of נָקֹד; a boss; stud.'),
	('H5352','נָקָה','nâqâh','naw-kaw\'','a primitive root; to be (or make) clean (literally or figuratively); by implication (in an adverse sense) to be bare, i.e. extirpated; acquit [idiom] at all, [idiom] altogether, be blameless, cleanse, (be) clear(-ing), cut off, be desolate, be free, be (hold) guiltless, be (hold) innocent, [idiom] by no means, be quit, be (leave) unpunished, [idiom] utterly, [idiom] wholly.'),
	('H5353','נְקוֹדָא','Nᵉqôwdâʼ','nek-o-daw\'','feminine of נָקֹד (in the figurative sense of marked); distinction; Nekoda, a Temple-servant; Nekoda.'),
	('H5354','נָקַט','nâqaṭ','naw-kat\'','a primitive root; to loathe; weary.'),
	('H5355','נָקִי','nâqîy','naw-kee\'','or נָקִיא; (Joel 4:19; Jonah [1:14), from נָקָה; innocent; blameless, clean, clear, exempted, free, guiltless, innocent, quit.'),
	('H5356','נִקָּיוֹן','niqqâyôwn','nik-kaw-yone\'','or נִקָּיֹן; from נָקָה; clearness (literally or figuratively); cleanness, innocency.'),
	('H5357','נָקִיק','nâqîyq','naw-keek\'','from an unused root meaning to bore; a cleft; hole.'),
	('H5358','נָקַם','nâqam','naw-kam\'','a primitive root; to grudge, i.e. avenge or punish; avenge(-r, self), punish, revenge (self), [idiom] surely, take vengeance.'),
	('H5359','נָקָם','nâqâm','naw-kawm\'','from נָקַם; revenge; [phrase] avenged, quarrel, vengeance.'),
	('H5360','נְקָמָה','nᵉqâmâh','nek-aw-maw\'','feminine of נָקָם; avengement, whether the act of the passion; [phrase] avenge, revenge(-ing), vengeance.'),
	('H5361','נָקַע','nâqaʻ','naw-kah\'','a primitive root; to feel aversion; be alienated.'),
	('H5362','נָקַף','nâqaph','naw-kaf\'','a primitive root; to strike with more or less violence (beat, fell, corrode); by implication (of attack) to knock together, i.e. surround or circulate; compass (about, -ing), cut down, destroy, go round (about), inclose, round.'),
	('H5363','נֹקֶף','nôqeph','no\'-kef','from נָקַף; a threshing (of olives); shaking.'),
	('H5364','נִקְפָּה','niqpâh','nik-paw\'','from נָקַף; probably a rope (as encircling); rent.'),
	('H5365','נָקַר','nâqar','naw-kar\'','a primitive root; to bore (penetrate, quarry); dig, pick out, pierce, put (thrust) out.'),
	('H5366','נְקָרָה','nᵉqârâh','nek-aw-raw\'','from נָקַר, a fissure; {to bore (penetrate, quarry)}; cleft, clift.'),
	('H5367','נָקַשׁ','nâqash','naw-kash\'','a primitive root; to entrap (with a noose), literally or figuratively; catch (lay a) snare.'),
	('H5368','נְקַשׁ','nᵉqash','nek-ash\'','(Aramaic) corresponding to נָקַשׁ; used in the sense of נָקַף; to knock; smote.'),
	('H5369','נֵר','Nêr','nare','the same as נִיר; lamp; Ner, an Israelite; Ner.'),
	('H5370','נֵרְגַּל','Nêrᵉgal','nare-gal\'','of foreign origin; Nergal, a Cuthite deity; Nergal.'),
	('H5371','נֵרְגַּל שַׁרְאֶצֶר','Nêrᵉgal Sharʼetser','nare-gal\' shar-eh\'-tser','from נֵרְגַּל and שַׁרְאֶצֶר; Nergal-Sharetser, the name of two Babylonians; Nergal-sharezer.'),
	('H5372','נִרְגָּן','nirgân','neer-gawn\'','from an unused root meaning to roll to pieces; a slanderer; talebearer, whisperer.'),
	('H5373','נֵרְדְּ','nêrd','nayrd','of foreign origin; nard, an aromatic; spikenard.'),
	('H5374','נֵרִיָּה','Nêrîyâh','nay-ree-yaw\'','or נֵרִיָּהוּ; from נִיר and יָהּ; light of Jah; Nerijah, an Israelite; Neriah.'),
	('H5375','נָשָׂא','nâsâʼ','naw-saw\'','or נָסָה; (Psalm 4:6 (אֲבַד)), a primitive root; to lift, in a great variety of applications, literal and figurative, absolute and relative; accept, advance, arise, (able to, (armor), suffer to) bear(-er, up), bring (forth), burn, carry (away), cast, contain, desire, ease, exact, exalt (self), extol, fetch, forgive, furnish, further, give, go on, help, high, hold up, honorable ([phrase] man), lade, lay, lift (self) up, lofty, marry, magnify, [idiom] needs, obtain, pardon, raise (up), receive, regard, respect, set (up), spare, stir up, [phrase] swear, take (away, up), [idiom] utterly, wear, yield.'),
	('H5376','נְשָׂא','nᵉsâʼ','nes-aw\'','(Aramaic) corresponding to נָשָׂא; {to lift}; carry away, make insurrection, take.'),
	('H5377','נָשָׁא','nâshâʼ','naw-shaw\'','a primitive root; to lead astray, i.e. (mentally) to delude, or (morally) to seduce; beguile, deceive, [idiom] greatly, [idiom] utterly.'),
	('H5378','נָשָׁא','nâshâʼ','naw-shaw\'','a primitive root (perhaps identical with נָשָׁא, through the idea of imposition); to lend on interest; by implication, to dun fordebt; [idiom] debt, exact, giver of usury.'),
	('H5379','נִשֵּׂאת','nissêʼth','nis-sayth\'','passive participle feminine of נָשָׂא; something taken, i.e. a present; gift.'),
	('H5380','נָשַׁב','nâshab','naw-shab\'','a primitive root; to blow; by implication, to disperse; (cause to) blow, drive away.'),
	('H5381','נָשַׂג','nâsag','naw-sag\'','a primitive root; to reach (literally or figuratively); ability, be able, attain (unto), (be able to, can) get, lay at, put, reach, remove, wax rich, [idiom] surely, (over-) take (hold of, on, upon).'),
	('H5382','נָשָׁה','nâshâh','naw-shaw\'','a primitive root; to forget; figuratively, to neglect; causatively, to remit, remove; forget, deprive, exact.'),
	('H5383','נָשָׁה','nâshâh','naw-shaw\'','a primitive root (rather identical with נָשָׁה, in the sense of נָשָׁא); to lend or (by reciprocity) borrow on security or interest; creditor, exact, extortioner, lend, usurer, lend on (taker on) usury.'),
	('H5384','נָשֶׁה','nâsheh','naw-sheh\'','from נָשָׁה, in the sense of failure; rheumatic or crippled (from the incident to Jacob); which shrank.'),
	('H5385','נְשׂוּאָה','nᵉsûwʼâh','nes-oo-aw\'','or rather, נְשֻׂאָה; feminine. passive participle of נָשָׂא; something borne, i.e. a load; carriage.'),
	('H5386','נְשִׁי','nᵉshîy','nesh-ee\'','from נָשָׁה; a debt; debt.'),
	('H5387','נָשִׂיא','nâsîyʼ','naw-see\'','or נָשִׂא; from נָשָׂא; properly, an exalted one, i.e. a king or sheik; also a rising mist; captain, chief, cloud, governor, prince, ruler, vapour.'),
	('H5388','נְשִׁיָּה','nᵉshîyâh','nesh-ee-yaw\'','from נָשָׁה; oblivion; forgetfulness.'),
	('H5389','נָשִׁין','nâshîyn','naw-sheen\'','(Aramaic) irregular plural feminine of אֱנָשׁ; {a man}; women.'),
	('H5390','נְשִׁיקָה','nᵉshîyqâh','nesh-ee-kaw\'','from נָשַׁק; a kiss; kiss.'),
	('H5391','נָשַׁךְ','nâshak','naw-shak\'','a primitive root; to strike with a sting (as a serpent); figuratively, to oppress with interest on a loan; bite, lend upon usury.'),
	('H5392','נֶשֶׁךְ','neshek','neh\'-shek','from נָשַׁךְ; interest on a debt; usury.'),
	('H5393','נִשְׁכָּה','nishkâh','nish-kaw\'','for לִשְׁכָּה; a cell; chamber.'),
	('H5394','נָשַׁל','nâshal','naw-shal\'','a primitive root; to pluck off, i.e. divest, eject or drop; cast (out), drive, loose, put off (out), slip.'),
	('H5395','נָשַׁם','nâsham','naw-sham\'','a primitive root; properly, to blow away, i.e. destroy; destroy.'),
	('H5396','נִשְׁמָא','nishmâʼ','nish-maw\'','(Aramaic) corresponding to נְשָׁמָה; vital breath; breath.'),
	('H5397','נְשָׁמָה','nᵉshâmâh','nesh-aw-maw\'','from נָשַׁם; a puff, i.e. wind, angry or vital breath, divine inspiration, intellect. or (concretely) an animal; blast, (that) breath(-eth), inspiration, soul, spirit.'),
	('H5398','נָשַׁף','nâshaph','naw-shaf\'','a primitive root; to breeze, i.e. blow up fresh (as the wind); blow.'),
	('H5399','נֶשֶׁף','nesheph','neh\'-shef','from נָשַׁף; properly, a breeze, i.e. (by implication) dusk (when the evening breeze prevails); dark, dawning of the day (morning), night, twilight.'),
	('H5400','נָשַׂק','nâsaq','naw-sak\'','a primitive root; to catch fire; burn, kindle.'),
	('H5401','נָשַׁק','nâshaq','naw-shak\'','a primitive root (identical with נָשַׂק, through the idea of fastening up; compare חָזַק, חָשַׁק); to kiss, literally or figuratively (touch); also (as a mode of attachment), to equip with weapons; armed (men), rule, kiss, that touched.'),
	('H5402','נֶשֶׁק','nesheq','neh\'-shek','or נֵשֶׁק; from נָשַׁק; military equipment, i.e. (collectively) arms (offensive or defensive), or (concretely) an arsenal; armed men, armour(-y), battle, harness, weapon.'),
	('H5403','נְשַׁר','nᵉshar','nesh-ar\'','(Aramaic) corresponding to נֶשֶׁר; an eagle; eagle.'),
	('H5404','נֶשֶׁר','nesher','neh\'-sher','from an unused root meaning to lacerate; the eagle (or other large bird of prey); eagle.'),
	('H5405','נָשַׁת','nâshath','naw-shath\'','a primitive root; properly, to eliminate, i.e. (intransitively) to dry up; fail.'),
	('H5406','נִשְׁתְּוָן','nishtᵉvân','nish-tev-awn\'','probably of Persian origin; an epistle; letter.'),
	('H5407','נִשְׁתְּוָן','nishtᵉvân','nish-tev-awn\'','(Aramaic) corresponding to נִשְׁתְּוָן; {an epistle}; letter.'),
	('H5408','נָתַח','nâthach','naw-thakh\'','a primitive root; to dismember; cut (in pieces), divide, hew in pieces.'),
	('H5409','נֵתַח','nêthach','nay\'-thakh','from נָתַח; a fragment; part, piece.'),
	('H5410','נָתִיב','nâthîyb','naw-theeb\'','or (feminine) נְתִיבָה; or נְתִבָה; (Jeremiah 6:16), from an unused root meaning to tramp; a (beaten) track; path(-way), [idiom] travel(-ler), way.'),
	('H5411','נָתִין','Nâthîyn','naw-theen\'','or נָתוּן (Ezra 8:17), (the proper form as passive participle), from נָתַן; one given, i.e. (in the plural only); the Nethinim, or Temple-servants (as given to that duty); Nethinims.'),
	('H5412','נְתִין','Nᵉthîyn','netheen\'','(Aramaic) corresponding to נָתִין; {the Nethinim, or Temple-servants (as given to that duty)}; Nethinims.'),
