	('H5415','נְתַן','nᵉthan','neth-an\'','(Aramaic) corresponding to נָתַן; give; bestow, give pay.'),
	('H5416','נָתָן','Nâthân','naw-thawn\'','from נָתַן; given; Nathan, the name of five Israelites; Nathan.'),
	('H5417','נְתַנְאֵל','Nᵉthanʼêl','neth-an-ale\'','xlit Nᵉthanêʼl corrected to Nᵉthanʼêl; from נָתַן and אֵל; given of God; Nethanel, the name of ten Israelites; Nethaneel.'),
	('H5418','נְתַנְיָה','Nᵉthanyâh','neth-an-yaw\'','or נְתַנְיָהוּ; from נָתַן and יָהּ; given of Jah; Nethanjah, the name of four Israelites; Nethaniah.'),
	('H5419','נְתַן־מֶלֶךְ','Nᵉthan-Melek','neth-an\' meh\'-lek','from נָתַן and מֶלֶךְ; given of (the) king; Nethan-Melek, an Israelite; Nathanmelech.'),
	('H5420','נָתָס','nâthâç','naw-thas\'','a primitive root; to tear up; mar.'),
	('H5421','נָתַע','nâthaʻ','naw-thah\'','for נָתַץ; to tear out; break.'),
	('H5422','נָתַץ','nâthats','naw-thats\'','a primitive root; to tear down; beat down, break down (out), cast down, destroy, overthrow, pull down, throw down.'),
	('H5423','נָתַק','nâthaq','naw-thak\'','a primitive root; to tear off; break (off), burst, draw (away), lift up, pluck (away, off), pull (out), root out.'),
	('H5424','נֶתֶק','netheq','neh\'-thek','from נָתַק; scurf; (dry) scall.'),
	('H5425','נָתַר','nâthar','naw-thar\'','a primitive root; to jump, i.e. be violently agitated; causatively, to terrify, shake off, untie; drive asunder, leap, (let) loose, [idiom] make, move, undo.'),
	('H5426','נְתַר','nᵉthar','neth-ar\'','(Aramaic) corresponding to נָתַר; {to jump, i.e. be violently agitated; causatively, to terrify, shake off, untie}; shake off.'),
	('H5427','נֶתֶר','nether','neh\'-ther','from נָתַר; mineral potash (so called from effervescing with acid); nitre.'),
	('H5428','נָתַשׁ','nâthash','naw-thash\'','a primitive root; to tear away; destroy, forsake, pluck (out, up, by the roots), pull up, root out (up), [idiom] utterly. s'),
	('H5429','סְאָה','çᵉʼâh','seh-aw\'','from an unused root meaning to define; a seah, or certain measure (as determinative) forgrain; measure.'),
	('H5430','סְאוֹן','çᵉʼôwn','seh-own\'','from סָאַן; perhaps a military boot (as aprotection from mud; battle.'),
