	('H5432','סַאסְּאָה','çaʼçᵉʼâh','sah-seh-aw\'','lemma סַאסְאָה missing dagesh, corrected to סַאסְּאָה; for סְאָה; measurement, i.e. moderation; measure.'),
	('H5433','סָבָא','çâbâʼ','saw-baw\'','a primitive root; to quaff to satiety, i.e. become tipsy; drunkard, fill self, Sabean, (wine-) bibber.'),
