	('H5438','סִבָּה','çibbâh','sib-baw\'','from סָבַב; a (providential) turn (of affairs); cause.'),
	('H5439','סָבִיב','çâbîyb','saw-beeb\'','or (feminine) סְבִיבָה; from סָבַב; (as noun) a circle, neighbour, or environs; but chiefly (as adverb, with or without preposition) around; (place, round) about, circuit, compass, on every side.'),
	('H5440','סָבַךְ','çâbak','saw-bak\'','a primitive root; to entwine; fold together, wrap.'),
	('H5441','סֹבֶךְ','çôbek','so\'-bek','from סָבַךְ; a copse; thicket.'),
	('H5442','סְבָךְ','çᵉbâk','seb-awk\'','from סָבַךְ,; a copse; thick(-et).'),
	('H5443','סַבְּכָא','çabbᵉkâʼ','sab-bek-aw\'','(Aramaic) or שַׂבְּכָא; (Aramaic), from a root corresponding to סָבַךְ; a lyre; sackbut.'),
	('H5444','סִבְּכַי','Çibbᵉkay','sib-bek-ah\'-ee','from סָבַךְ; copse-like; Sibbecai, an Israelite; Sibbecai, Sibbechai.'),
	('H5445','סָבַל','çâbal','saw-bal\'','a primitive root; to carry (literally or figuratively), or (reflexively) be burdensome; specifically, to be gravid; bear, be a burden, carry, strong to labour.'),
	('H5446','סְבַל','çᵉbal','seb-al\'','(Aramaic) corresponding to סָבַל; to erect; strongly laid.'),
	('H5447','סֵבֶל','çêbel','say\'-bel','from סָבַל; a load (literally or figuratively); burden, charge.'),
	('H5448','סֹבֶל','çôbel','so\'-bel','(only in the form סֻבָּל; from סָבַל; a load (figuratively); burden.'),
	('H5449','סַבָּל','çabbâl','sab-bawl\'','from סָבַל; a porter; (to bear, bearer of) burden(-s).'),
	('H5450','סְבָלָה','çᵉbâlâh','seb-aw-law\'','from סֵבֶל; porterage; burden.'),
	('H5451','סִבֹּלֶת','çibbôleth','sib-bo\'-leth','for שִׁבֹּל; an ear of grain; Sibboleth.'),
	('H5452','סְבַר','çᵉbar','seb-ar\'','(Aramaic) a primitive root; to bear in mind, i.e. hope; think.'),
	('H5453','סִבְרַיִם','Çibrayim','sib-rah\'-yim','dual from a root corresponding to סְבַר; double hope; Sibrajim, a place in Syria; Sibraim.'),
	('H5454','סַבְתָּא','Çabtâʼ','sab-taw\'','or סַבְתָּה; probably of foreign derivation; Sabta or Sabtah, the name of a son of Cush, and the country occupied by his posterity; Sabta, Sabtah.'),
	('H5455','סַבְתְּכָא','Çabtᵉkâʼ','sab-tek-aw\'','probably of foreign derivation; Sabteca, the name of a son of Cush, and the region settled by him; Sabtecha, Sabtechah.'),
	('H5456','סָגַד','çâgad','saw-gad\'','a primitive root; to prostrate oneself (in homage); fall down.'),
	('H5457','סְגִד','çᵉgid','seg-eed\'','(Aramaic) corresponding to סָגַד; {to prostrate oneself (in homage)}; worship.'),
	('H5458','סְגוֹר','çᵉgôwr','seg-ore\'','from סָגַר; properly, shut up, i.e. the breast (as enclosing the heart); also gold (as generally shut up safely); caul, gold.'),
	('H5459','סְגֻלָּה','çᵉgullâh','seg-ool-law\'','feminine passive participle of an unused root meaning to shut up; wealth (as closely shut up); jewel, peculiar (treasure), proper good, special.'),
	('H5460','סְגַן','çᵉgan','seg-an\'','(Aramaic) corresponding to סָגָן; {a prefect of aprovince}; governor.'),
	('H5461','סָגָן','çâgân','saw-gawn\'','from an unused root meaning to superintend; a prefect of a province; prince, ruler.'),
	('H5462','סָגַר','çâgar','saw-gar\'','a primitive root; to shut up; figuratively, to surrender; close up, deliver (up), give over (up), inclose, [idiom] pure, repair, shut (in, self, out, up, up together), stop, [idiom] straitly.'),
	('H5463','סְגַר','çᵉgar','seg-ar\'','(Aramaic) corresponding to סָגַר; {to shut up; figuratively, to surrender}; shut up.'),
	('H5464','סַגְרִיד','çagrîyd','sag-reed\'','probably from סָגַר in the sense of sweeping away; a pouring rain; very rainy.'),
	('H5465','סַד','çad','sad','from an unused root meaning to estop; the stocks; stocks.'),
	('H5466','סָדִין','çâdîyn','saw-deen\'','from an unused root meaning to envelop; a wrapper, i.e. shirt; fine linen, sheet.'),
	('H5467','סְדֹם','Çᵉdôm','sed-ome\'','from an unused root meaning to scorch; burnt (i.e. volcanic or bituminous) district; Sedom, a place near the Dead Sea; Sodom.'),
	('H5468','סֶדֶר','çeder','seh\'-der','from an unused root meaning to arrange; order; order.'),
	('H5469','סַהַר','çahar','cah\'-har','from an unused root meaning to be round; roundness; round.'),
	('H5470','סֹהַר','çôhar','so\'-har','from the same as סַהַר; a dungeon (as surrounded by walls); prison.'),
	('H5471','סוֹא','Çôwʼ','so','of foreign derivation; So, an Egyptian king; So.'),
	('H5472','סוּג','çûwg','soog','a primitive root; properly, to flinch, i.e. (by implication) to go back, literally (to retreat) or figuratively (to apostatize); backslider, drive, go back, turn (away, back).'),
	('H5473','סוּג','çûwg','soog','a primitive root (probably rather identical with סוּג through the idea of shrinking from a hedge; compare שׂוּג); to hem in, i.e. bind; set about.'),
	('H5474','סוּגַר','çûwgar','soo-gar\'','from סָגַר; an inclosure, i.e. cage (for an animal); ward.'),
	('H5475','סוֹד','çôwd','sode','from יָסַד; a session, i.e. company of persons (in close deliberation); by implication, intimacy, consultation, a secret; assembly, consel, inward, secret (counsel).'),
	('H5476','סוֹדִי','Çôwdîy','so-dee\'','from סוֹד; a confidant; Sodi, an Israelite; Sodi.'),
	('H5477','סוּחַ','Çûwach','soo\'-akh','from an unused root meaning to wipe away; sweeping; Suach, an Israelite; Suah.'),
	('H5478','סוּחָה','çûwchâh','soo-khaw\'','from the same as סוּחַ; something swept away, i.e. filth; torn.'),
	('H5479','סוֹטַי','Çôwṭay','so-tah\'-ee','from שׂוּט; roving; Sotai, one of the Nethinim; Sotai.'),
	('H5480','סוּךְ','çûwk','sook','a primitive root; properly, to smear over (with oil), i.e. anoint; anoint (self), [idiom] at all.'),
	('H5481','סוּמְפּוֹנְיָה','çûwmᵉpôwnᵉyâh','soom-po-neh-yaw\'','(Aramaic) or סוּמְפֹּנְיָה; (Aramaic), or סִיפֹנְיָא; (Daniel 3:10) (Aramaic), of Greek origin; a bagpipe (with a double pipe); dulcimer.'),
	('H5482','סְוֵנֵה','Çᵉvênêh','sev-ay-nay\'','(rather to be written סְוֵנָה; for סְוֵן; i.e to Seven); of Egyptian derivation; Seven, a place in Upper Egypt; Syene.'),
	('H5483','סוּס','çûwç','soos','or סֻס; from an unused root meaning to skip (properly, for joy); a horse (as leaping); also a swallow (from its rapid flight); crane, horse (-back, -hoof). Compare פָּרָשׁ.'),
	('H5484','סוּסָה','çûwçâh','soo-saw\'','feminine of סוּס; a mare; company of horses.'),
	('H5485','סוּסִי','Çûwçîy','soo-see\'','from סוּס; horse-like; Susi, an Israelite; Susi.'),
	('H5486','סוּף','çûwph','soof','a primitive root; to snatch away, i.e. terminate; consume, have an end, perish, [idiom] be utterly.'),
	('H5487','סוּף','çûwph','soof','(Aramaic) corresponding to סוּף; to come to an end; consume, fulfill.'),
	('H5488','סוּף','çûwph','soof','probably of Egyptian origin; a reed, especially the papyrus; flag, Red (sea), weed. Compare סוּף.'),
	('H5489','סוּף','Çûwph','soof','for סוּף (by ellipsis of יָם); the Reed (Sea); Red Sea.'),
	('H5490','סוֹף','çôwph','sofe','from סוּף; a termination; conclusion, end, hinder participle'),
	('H5491','סוֹף','çôwph','sofe','(Aramaic) corresponding to סוֹף; {a termination}; end.'),
	('H5492','סוּפָה','çûwphâh','soo-faw\'','from סוּף; a hurricane; Red Sea, storm, tempest, whirlwind, Red sea.'),
	('H5493','סוּר','çûwr','soor','or שׂוּר; (Hosea 9:12), a primitive root; to turn off (literal or figurative); be(-head), bring, call back, decline, depart, eschew, get (you), go (aside), [idiom] grievous, lay away (by), leave undone, be past, pluck away, put (away, down), rebel, remove (to and fro), revolt, [idiom] be sour, take (away, off), turn (aside, away, in), withdraw, be without.'),
	('H5494','סוּר','çûwr','soor','probably passive participle of סוּר; turned off, i.e. deteriorated; degenerate.'),
	('H5495','סוּר','Çûwr','soor','the same as סוּר; Sur, a gate of the temple; Sur.'),
	('H5496','סוּת','çûwth','sooth','perhaps denominative from שַׁיִת; properly, to prick, i.e. (figuratively) stimulate; by implication, to seduce; entice, move, persuade, provoke, remove, set on, stir up, take away.'),
	('H5497','סוּת','çûwth','sooth','probably from the same root as מַסְוֶה; covering, i.e. clothing; clothes.'),
	('H5498','סָחַב','çâchab','saw-khab\'','a primitive root; to trail along; draw (out), tear.'),
	('H5499','סְחָבָה','çᵉchâbâh','seh-khaw-baw\'','from סָחַב; a rag; cast clout.'),
	('H5500','סָחָה','çâchâh','saw-khaw\'','a primitive root; to sweep away; scrape.'),
	('H5501','סְחִי','çᵉchîy','seh-khee\'','from סָחָה; refuse (as swept off); offscouring.'),
	('H5502','סָחַף','çâchaph','saw-khaf\'','a primitive root; to scrape off; sweep (away).'),
	('H5503','סָחַר','çâchar','saw-khar\'','a primitive root; to travel round (specifically as a pedlar); intensively, to palpitate; go about, merchant(-man), occupy with, pant, trade, traffick.'),
	('H5504','סַחַר','çachar','sakh\'-ar','from סָחַר; profit (from trade); merchandise.'),
	('H5505','סָחַר','çâchar','saw-khar\'','from סָחַר; an emporium; abstractly, profit (from trade); mart, merchandise.'),
	('H5506','סְחֹרָה','çᵉchôrâh','sekh-o-raw\'','from סָחַר; traffic; merchandise.'),
	('H5507','סֹחֵרָה','çôchêrâh','so-khay-raw\'','properly, active participle feminine of סָחַר; something surrounding the person, i.e. a shield; buckler.'),
	('H5508','סֹחֵרֶת','çôchêreth','so-kheh\'-reth','similar to סֹחֵרָה; probably a (black) tile (or tessara) forlaying borders with; black marble.'),
	('H5509','סִיג','çîyg','seeg','or סוּג; (Ezekiel 22:18), from סוּג in the sense of refuse; scoria; dross.'),
	('H5510','סִיוָן','Çîyvân','see-vawn\'','probably of Persian origin; Sivan, the third Hebrew month; Sivan.'),
	('H5511','סִיחוֹן','Çîychôwn','see-khone\'','or סִיחֹן; from the same as סוּחַ; tempestuous; Sichon, an Amoritish king; Sihon.'),
	('H5512','סִין','Çîyn','seen','of uncertain derivation; Sin the name of an Egyptian town and (probably) desert adjoining; Sin.'),
	('H5513','סִינִי','Çîynîy','see-nee\'','from an otherwise unknown name of a man; a Sinite, or descendant of one of the sons of Canaan; Sinite.'),
	('H5514','סִינַי','Çîynay','see-nah\'-ee','of uncertain derivation; Sinai, mountain of Arabia; Sinai.'),
	('H5515','סִינִים','Çîynîym','see-neem\'','plural of an otherwise unknown name; Sinim, a distant Oriental region; Sinim.'),
	('H5516','סִיסְרָא','Çîyçᵉrâʼ','see-ser-aw\'','of uncertain derivation; Sisera, the name of a Canaanitish king and of one of the Nethinim; Sisera.'),
	('H5517','סִיעָא','Çîyʻâʼ','see-ah\'','or סִיעֲהָא; from an unused root meaning to converse; congregation; Sia or Siaha, one of the Nethinim; Sia, Siaha.'),
	('H5518','סִיר','çîyr','seer','or (feminine) סִירָה; or סִרָה; (Jeremiah 52:18), from a primitive root meaning to boil up; a pot; also a thorn (as springing up rapidly); by implication, a hook; caldron, fishhook, pan, (wash-)pot, thorn.'),
	('H5519','סָךְ','çâk','sawk','from סָכַךְ; properly, a thicket of men, i.e. a crowd; multitude.'),
	('H5520','סֹךְ','çôk','soke','from סָכַךְ; a hut (as of entwined boughs); also a lair; covert, den, pavilion, tabernacle.'),
	('H5521','סֻכָּה','çukkâh','sook-kaw\'','feminine of סֹךְ; a hut or lair; booth, cottage, covert, pavilion, tabernacle, tent.'),
	('H5522','סִכּוּת','çikkûwth','sik-kooth\'','feminine of סָךְ; an (idolatrous) booth; tabernacle.'),
	('H5523','סֻכּוֹת','Çukkôwth','sook-kohth\'','or סֻכֹּת; plural of סֻכָּה; booths; Succoth, the name of a place in Egypt and of three in Palestine; Succoth.'),
	('H5524','סֻכּוֹת בְּנוֹת','Çukkôwth bᵉnôwth','sook-kohth\' ben-ohth\'','from סֻכּוֹת and the (irregular) plural of בַּת; booths of (the) daughters; brothels, i.e. idoalatrous tents forimpure purpose; Succothbenoth.'),
	('H5525','סֻכִּי','Çukkîy','sook-kee\'','patrial from an unknown name (perhaps סֹךְ); a Sukkite, or inhabitant of some place near Egypt (i.e. hut-dwellers); Sukkiims.'),
	('H5526','סָכַךְ','çâkak','saw-kak\'','or שָׂכַךְ; (Exodus 33:22), a primitive root; properly, to entwine as ascreen; by implication, to fence in, cover over, (figuratively) protect; cover, defence, defend, hedge in, join together, set, shut up.'),
	('H5527','סְכָכָה','Çᵉkâkâh','sek-aw-kaw\'','from סָכַךְ; inclosure; Secacah, a place in Palestine; Secacah.'),
	('H5528','סָכַל','çâkal','saw-kal\'','for כָּסַל; to be silly; do (make, play the, turn into) fool(-ish, -ishly, -ishness).'),
	('H5529','סֶכֶל','çekel','seh\'-kal','from סָכַל; silliness; concretely and collectively, dolts; folly.'),
	('H5530','סָכָל','çâkâl','saw-kawl\'','from סָכַל; silly; fool(-ish), sottish.'),
	('H5531','סִכְלוּת','çiklûwth','sik-looth\'','or שִׂכְלוּת; (Ecclesiastes 1:17), from סָכַל; silliness; folly, foolishness.'),
	('H5532','סָכַן','çâkan','saw-kan\'','a primitive root; to be familiar with; by implication, to minister to, be serviceable to, be customary; acquaint (self), be advantage, [idiom] ever, (be, (un-)) profit(-able), treasurer, be wont.'),
	('H5533','סָכַן','çâkan','saw-kan\'','probably a denominative from שַׂכִּין; properly, to cut, i.e. damage; also to grow (causatively, make) poor; endanger, impoverish.'),
	('H5534','סָכַר','çâkar','saw-kar\'','a primitive root; to shut up; by implication, to surrender; stop, give over. See also סָגַר, שָׂכַר.'),
	('H5535','סָכַת','çâkath','saw-kath\'','a primitive root to be silent; by implication, to observe quietly; take heed.'),
	('H5536','סַל','çal','sal','from סָלַל; properly, a willow twig (as pendulous), i.e. an osier; but only as woven into abasket; basket.'),
	('H5537','סָלָא','çâlâʼ','saw-law\'','a primitive root; to suspend in a balance, i.e. weigh; compare.'),
	('H5538','סִלָּא','Çillâʼ','sil-law\'','from סָלַל; an embankment; Silla, a place in Jerusalem; Silla.'),
	('H5539','סָלַד','çâlad','saw-lad\'','a primitive root; probably to leap (with joy), i.e. exult; harden self.'),
	('H5540','סֶלֶד','Çeled','seh\'-led','from סָלַד; exultation; Seled, an Israelite; Seled.'),
	('H5541','סָלָה','çâlâh','saw-law\'','a primitive root; to hang up, i.e. weigh, or (figuratively) contemn; tread down (under foot), value.'),
	('H5542','סֶלָה','çelâh','seh\'-law','from סָלָה; suspension (of music), i.e. pause; Selah.'),
	('H5543','סַלּוּ','Çallûw','sal-loo\'','or סַלּוּא; or סָלוּא; or סַלַּי; from סָלָה; weighed; Sallu or Sallai, the name of two Israelites; Sallai, Sallu, Salu.'),
	('H5544','סִלּוֹן','çillôwn','sil-lone\'','or סַלּוֹן; from סָלָה; a prickle (as if pendulous); brier, thorn.'),
	('H5545','סָלַח','çâlach','saw-lakh\'','a primitive root; to forgive; forgive, pardon, spare.'),
	('H5546','סַלָּח','çallâch','saw-lawkh\'','from סָלַח; placable; ready to forgive.'),
	('H5547','סְלִיחָה','çᵉlîychâh','sel-ee-khaw\'','from סָלַח; pardon; forgiveness, pardon.'),
	('H5548','סַלְכָה','Çalkâh','sal-kaw\'','from an unused root. meaning to walk; walking; Salcah, a place East of the Jordan; Salcah, Salchah.'),
	('H5549','סָלַל','çâlal','saw-lal\'','a primitive root; to mound up (especially a turnpike); figurative, to exalt; reflexively, to oppose (as by a dam); cast up, exalt (self), extol, make plain, raise up.'),
	('H5550','סֹלְלָה','çôlᵉlâh','so-lel-aw\'','or סוֹלְלָה; active participle feminine of סָלַל, but used passively; a military mound, i.e. rampart of besiegers; bank, mount.'),
	('H5551','סֻלָּם','çullâm','sool-lawm\'','from סָלַל; a stair-case; ladder.'),
	('H5552','סַלְסִלָּה','çalçillâh','sal-sil-law\'','from סָלָה; a twig (as pendulous); basket.'),
	('H5553','סֶלַע','çelaʻ','seh\'-lah','from an unused root meaning to be lofty; a craggy rock, literally or figuratively (a fortress); (ragged) rock, stone(-ny), strong hold.'),
	('H5554','סֶלַע','Çelaʻ','seh\'-lah','the same as סֶלַע; Sela, the rock-city of Idumaea; rock, Sela(-h).'),
	('H5555','סֶלַע הַמַּחְלְקוֹת','Çelaʻ ham-machlᵉqôwth','seh\'-lah hammakh-lek-oth\'','from סֶלַע and the plural of מַחֲלֹקֶת with the article interposed; rock of the divisions; Sela-ham-Machlekoth, a place in Palestine; Sela-hammalekoth.'),
	('H5556','סׇלְעָם','çolʻâm','sol-awm\'','apparently from the same as סֶלַע in the sense of crushing as with a rock, i.e. consuming; a kind of locust (from its destructiveness); bald locust.'),
	('H5557','סָלַף','çâlaph','saw-laf\'','a primitive root; properly, to wrench, i.e. (figuratively) to subvert; overthrow, pervert.'),
	('H5558','סֶלֶף','çeleph','seh\'-lef','from סָלַף; distortion, i.e. (figuratively) viciousness; perverseness.'),
	('H5559','סְלִק','çᵉliq','sel-eek\'','(Aramaic) a primitive root; to ascend; come (up).'),
	('H5560','סֹלֶת','çôleth','so\'-leth','from an unused root meaning to strip; flour (as chipped off); (fine) flour, meal.'),
	('H5561','סַם','çam','sam','from an unused root meaning to smell sweet; an aroma; sweet (spice).'),
	('H5562','סַמְגַּר נְבוֹ','Çamgar Nᵉbôw','sam-gar\' neb-o\'','of foreign origin; Samgar-Nebo, a Babylonian general; Samgar-nebo.'),
	('H5563','סְמָדַר','çᵉmâdar','sem-aw-dar\'','of uncertain derivation; a vine blossom; used also adverbially, abloom; tender grape.'),
	('H5564','סָמַךְ','çâmak','saw-mak\'','a primitive root; to prop (literally or figuratively); reflexively, to lean upon or take hold of (in a favorable or unfavorable sense); bear up, establish, (up-) hold, lay, lean, lie hard, put, rest self, set self, stand fast, stay (self), sustain.'),
	('H5565','סְמַכְיָהוּ','Çᵉmakyâhûw','sem-ak-yaw\'-hoo','from סָמַךְ and יָהּ; supported of Jah; Semakjah, an Israelite; Semachiah.'),
	('H5566','סֶמֶל','çemel','seh\'-mel','or סֵמֶל; from an unused root meaning to resemble; a likeness; figure, idol, image.'),
	('H5567','סָמַן','çâman','saw-man\'','a primitive root; to designate; appointed.'),
	('H5568','סָמַר','çâmar','saw-mar\'','a primitive root; to be erect, i.e. bristle as hair; stand up, tremble.'),
	('H5569','סָמָר','çâmâr','saw-mar\'','from סָמַר; bristling, i.e. shaggy; rough.'),
	('H5570','סְנָאָה','Çᵉnâʼâh','sen-aw-aw\'','from an unused root meaning to prick; thorny; Senaah, a place in Palestine; Senaah, Hassenaah (with the article).'),
	('H5571','סַנְבַלַּט','Çanballaṭ','san-bal-lat\'','of foreign origin; Sanballat, a Persian satrap of Samaria; Sanballat.'),
	('H5572','סְנֶה','çᵉneh','sen-eh\'','from an unused root meaning to prick; a bramble; bush.'),
	('H5573','סֶנֶה','Çeneh','seh-neh\'','the same as סְנֶה; thorn; Seneh, a crag in Palestine; Seneh.'),
	('H5574','סְנוּאָה','Çᵉnûwʼâh','sen-oo-aw\'','or סְנֻאָה from the same as סְנָאָה; pointed; (used with the article as a proper name) Senuah, the name of two Israelites; Hasenuah (including the art), Senuah.'),
	('H5575','סַנְוֵר','çanvêr','san-vare\'','of uncertain derivation; (in plural) blindness; blindness.'),
	('H5576','סַנְחֵרִיב','Çanchêrîyb','san-khay-reeb\'','of foreign origin; Sancherib, an Assyrian king; Sennacherib.'),
	('H5577','סַנְסִן','çançin','san-seen\'','from an unused root meaning to be pointed; a twig (as tapering); bough.'),
	('H5578','סַנְסַנָּה','Çançannâh','san-san-naw\'','feminine of a form of סַנְסִן; a bough; Sansannah, a place in Palestine; Sansannah.'),
	('H5579','סְנַפִּיר','çᵉnappîyr','sen-ap-peer\'','of uncertain derivation; a fin (collectively); fins.'),
	('H5580','סָס','çâç','sawce','from the same as סוּס; a moth (from the agility of the fly); moth.'),
	('H5581','סִסְמַי','Çiçmay','sis-mah\'-ee','of uncertain derivation; Sismai, an Israelite; Sisamai.'),
	('H5582','סָעַד','çâʻad','saw-ad\'','a primitive root; to suport (mostly figurative); comfort, establish, hold up, refresh self, strengthen, be upholden.'),
	('H5583','סְעַד','çᵉʻad','seh-ad\'','(Aramaic) corresponding to סָעַד; to aid; helping.'),
	('H5584','סָעָה','çâʻâh','saw-aw\'','a primitive root; to rush; storm.'),
	('H5585','סָעִיף','çâʻîyph','saw-eef\'','from סָעַף; a fissure (of rocks); also a bough (as subdivided); (outmost) branch, clift, top.'),
	('H5586','סָעַף','çâʻaph','saw-af\'','a primitive root; properly, to divide up; but used only as denominative from סָעִיף,; to disbranch (a tree); top.'),
	('H5587','סָעִף','çâʻiph','saw-eef\'','or שָׂעִף; from סָעַף; divided (in mind), i.e. (abstractly) a sentiment; opinion.'),
	('H5588','סֵעֵף','çêʻêph','say-afe\'','from סָעַף; divided (in mind), i.e. (concretely) a skeptic; thought.'),
	('H5589','סְעַפָּה','çᵉʻappâh','seh-ap-paw\'','feminine of סָעִיף; a twig; bough, branch. Compare סַרְעַפָּה.'),
	('H5590','סָעַר','çâʻar','saw-ar\'','a primitive root; to rush upon; by implication, to toss (transitive or intransitive, literal or figurative); be (toss with) tempest(-uous), be sore, troubled, come out as a (drive with the, scatter with a) whirlwind.'),
	('H5591','סַעַר','çaʻar','sah\'-ar','or (feminine) סְעָרָה; from סָעַר; a hurricane; storm(-y), tempest, whirlwind.'),
	('H5592','סַף','çaph','saf','from סָפַף, in its original sense of containing; a vestibule (as a limit); also a dish (for holding blood or wine); bason, bowl, cup, door (post), gate, post, threshold.'),
	('H5593','סַף','Çaph','saf','the same as סַף; Saph, a Philistine; Saph. Compare סִפַּי.'),
	('H5594','סָפַד','çâphad','saw-fad\'','a primitive root; properly, to tear the hair and beat the breasts (as Orientals do in grief); generally to lament; by implication, to wail; lament, mourn(-er), wail.'),
	('H5595','סָפָה','çâphâh','saw-faw\'','a primitive root; properly, to scrape (literally, to shave; but usually figuratively) together (i.e. to accumulate or increase) or away (i.e. to scatter, remove, or ruin; intransitively, to perish); add, augment, consume, destroy, heap, join, perish, put.'),
	('H5596','סָפַח','çâphach','saw-fakh\'','or שָׂפַח; (Isaiah 3:17), a primitive root; properly, to scrape out, but in certain peculiar senses (of removal or association); abiding, gather together, cleave, smite with the scab.'),
	('H5597','סַפַּחַת','çappachath','sap-pakh\'-ath','from סָפַח; the mange (as making the hair fall off); scab.'),
	('H5598','סִפַּי','Çippay','sip-pah\'-ee','from סַף; bason-like; Sippai, a Philistine; Sippai. Compare סַף.'),
	('H5599','סָפִיחַ','çâphîyach','saw-fee\'-akh','from סָפַח; something (spontaneously) falling off, i.e. a self-sown crop; figuratively, a freshet; (such) things as (which) grow (of themselves), which groweth of its own accord (itself).'),
	('H5600','סְפִינָה','çᵉphîynâh','sef-ee-naw\'','from סָפַן; a (sea-going) vessel (as ceiled with a deck); ship.'),
	('H5601','סַפִּיר','çappîyr','sap-peer\'','from סָפַר; a gem (perhaps used for scratching other substances), probably the sapphire; sapphire.'),
	('H5602','סֵפֶל','çêphel','say\'-fel','from an unused root meaning to depress; a basin (as deepened out); bowl, dish.'),
	('H5603','סָפַן','çâphan','saw-fan\'','a primitive root; to hide by covering; specifically, to roof (passive participle as noun, a roof) or wainscot; figuratively, to reserve; cieled, cover, seated.'),
	('H5604','סִפֻּן','çippun','sip-poon\'','from סָפַן; a wainscot; cieling.'),
	('H5605','סָפַף','çâphaph','saw-faf\'','a primitive root; properly, to snatch away, i.e. terminate; but used only as denominative from סַף (in the sense of a vestibule),; to wait at the threshold; be a doorkeeper.'),
	('H5606','סָפַק','çâphaq','saw-fak\'','or שָׂפַק; (1 Kings 20:10; Job 27:23; Isaiah 2:6), a primitive root; to clap the hands (in token of compact, derision, grief, indignation, or punishment); by implication of satisfaction, to be enough; by implication of excess, to vomit; clap, smite, strike, suffice, wallow.'),
	('H5607','סֵפֶק','çêpheq','say\'-fek','or שֶׂפֶק; (Job 20:22; Job 36:18), from סָפַק; chastisement; also satiety; stroke, sufficiency.'),
	('H5608','סָפַר','çâphar','saw-far\'','a primitive root; properly, to score with a mark as a tally or record, i.e. (by implication) to inscribe, and also to enumerate; intensively, to recount, i.e. celebrate; commune, (ac-) count; declare, number, [phrase] penknife, reckon, scribe, shew forth, speak, talk, tell (out), writer.'),
	('H5609','סְפַר','çᵉphar','sef-ar\'','(Aramaic) from a root corresponding to סָפַר; a book; book, roll.'),
	('H5610','סְפָר','çᵉphâr','sef-awr\'','from סָפַר; a census; numbering.'),
	('H5611','סְפָר','Çᵉphâr','sef-awr\'','the same as סְפָר; Sephar, a place in Arabia; Sephar.'),
	('H5612','סֵפֶר','çêpher','say\'-fer','or (feminine) סִפְרָה; (Psalm 56:8 (אֲבֵדָה)), from סָפַר; properly, writing (the art or a document); by implication, a book; bill, book, evidence, [idiom] learn(-ed) (-ing), letter, register, scroll.'),
	('H5613','סָפֵר','çâphêr','saw-fare\'','(Aramaic) from the same as סְפַר; a scribe (secular or sacred); scribe.'),
	('H5614','סְפָרָד','Çᵉphârâd','sef-aw-rawd\'','of foreign derivation; Sepharad, a region of Assyria; Sepharad.'),
	('H5615','סְפֹרָה','çᵉphôrâh','sef-o-raw\'','from סָפַר; a numeration; number.'),
	('H5616','סְפַרְוִי','Çᵉpharvîy','sef-ar-vee\'','patrial from סְפַרְוַיִם; a Sepharvite or inhabitant of Sepharvain; Sepharvite.'),
	('H5617','סְפַרְוַיִם','Çᵉpharvayim','sef-ar-vah\'-yim','(dual); Sepharvites; '),
	('H5618','סֹפֶרֶת','Çôphereth','so-feh\'-reth','feminine active participle of סָפַר; a scribe (properly, female); Sophereth, a temple servant; Sophereth.'),
	('H5619','סָקַל','çâqal','saw-kal\'','a primitive root; properly, to be weighty; but used only in the sense of lapidation or its contrary (as if a delapidation); (cast, gather out, throw) stone(-s), [idiom] surely.'),
	('H5620','סַר','çar','sar','contracted from סָרַר; peevish; heavy, sad.'),
	('H5621','סָרָב','çârâb','saw-rawb\'','from an unused root meaning to sting; a thistle; brier.'),
	('H5622','סַרְבַּל','çarbal','sar-bal\'','(Aramaic) of uncertain derivation; a cloak; coat.'),
	('H5623','סַרְגּוֹן','Çargôwn','sar-gone\'','of foreign derivation; Sargon, an Assyrian king; Sargon.'),
	('H5624','סֶרֶד','Çered','seh\'-red','from a primitive root meaning to tremble; trembling; Sered, an Israelite; Sered.'),
	('H5625','סַרְדִּי','Çardîy','sar-dee\'','patron from סֶרֶד; a Seredite (collectively) or descendants of Sered; Sardites.'),
	('H5626','סִרָה','Çirâh','see-raw\'','from סוּר; departure; Sirah, a cistern so-called; Sirah. See also סִיר.'),
	('H5627','סָרָה','çârâh','saw-raw\'','from סוּר; apostasy, crime; figuratively, remission; [idiom] continual, rebellion, revolt(-ed), turn away, wrong.'),
	('H5628','סָרַח','çârach','saw-rakh\'','a primitive root; to extend (even to excess); exceeding, hand, spread, stretch self, banish.'),
	('H5629','סֶרַח','çerach','seh\'-rakh','from סָרַח; a redundancy; remnant.'),
	('H5630','סִרְיֹן','çiryôn','sir-yone\'','for שִׁרְיוֹן; a coat of mail; brigandine.'),
	('H5631','סָרִיס','çârîyç','saw-reece\'','or סָרִס; from an unused root meaning to castrate; a eunuch; by implication, valet (especially of the female apartments), and thus, a minister of state; chamberlain, eunuch, officer. Compare רַב־סָרִיס.'),
	('H5632','סָרֵךְ','çârêk','saw-rake\'','(Aramaic) of foreign origin; an emir; president.'),
	('H5633','סֶרֶן','çeren','seh\'-ren','from an unused root of uncertain meaning; an axle; figuratively, a peer; lord, plate.'),
	('H5634','סַרְעַפָּה','çarʻappâh','sar-ap-paw\'','for סְעַפָּה; a twig; bough.'),
	('H5635','סָרַף','çâraph','saw-raf\'','a primitive root; to cremate, i.e. to be (near) of kin (such being privileged to kindle the pyre); burn.'),
	('H5636','סַרְפָּד','çarpâd','sar-pawd\'','from סָרַף; a nettle (as stinging like a burn); brier.'),
	('H5637','סָרַר','çârar','saw-rar\'','a primitive root; to turn away, i.e. (morally) be refractory; [idiom] away, backsliding, rebellious, revolter(-ing), slide back, stubborn, withdrew.'),
	('H5638','סְתָו','çᵉthâv','seth-awv\'','from an unused root meaning to hide; winter (as the dark season); winter.'),
	('H5639','סְתוּר','Çᵉthûwr','seth-oor\'','from סָתַר; hidden; Sethur, an Israelite; Sethur.'),
	('H5640','סָתַם','çâtham','saw-tham\'','or שָׂתַם; (Numbers 24:15), a primitive root; to stop up; by implication, to repair; figuratively, to keep secret; closed up, hidden, secret, shut out (up), stop.'),
	('H5641','סָתַר','çâthar','saw-thar\'','a primitive root; to hide (by covering), literally or figuratively; be absent, keep close, conceal, hide (self), (keep) secret, [idiom] surely.'),
	('H5642','סְתַר','çᵉthar','seth-ar\'','(Aramaic) corresponding to סָתַר; to conceal; figuratively, to demolish; destroy, secret thing.'),
	('H5643','סֵתֶר','çêther','say\'-ther','or (feminine) סִתְרָה; (Deuteronomy [32:38), from סָתַר; a cover (in a good or a bad, a literal or a figurative sense); backbiting, covering, covert, [idiom] disguise(-th), hiding place, privily, protection, secret(-ly, place).'),
	('H5644','סִתְרִי','Çithrîy','sith-ree\'','from סֵתֶר; protective; Sithri, an Israelite,; Zithri. ['),
	('H5645','עָב','ʻâb','awb','(masculine and feminine); from עוּב; properly, an envelope, i.e. darkness (or density, 2 Chronicles 4:17); specifically, a (scud) cloud; also a copse; clay, (thick) cloud, [idiom] thick, thicket. Compare עֲבִי.'),
	('H5646','עָב','ʻâb','awb','or עֹב; from an unused root meaning to cover; properly, equivalent to עָב; but used only as an architectural term,; an architrave (as shading the pillars); thick (beam, plant).'),
	('H5647','עָבַד','ʻâbad','aw-bad\'','a primitive root; to work (in any sense); by implication, to serve, till, (causatively) enslave, etc.; [idiom] be, keep in bondage, be bondmen, bond-service, compel, do, dress, ear, execute, [phrase] husbandman, keep, labour(-ing man, bring to pass, (cause to, make to) serve(-ing, self), (be, become) servant(-s), do (use) service, till(-er), transgress (from margin), (set a) work, be wrought, worshipper,'),
	('H5648','עֲבַד','ʻăbad','ab-bad\'','(Aramaic) corresponding to עָבַד; to do, make, prepare, keep, etc.; [idiom] cut, do, execute, go on, make, move, work.'),
	('H5649','עֲבַד','ʻăbad','ab-bad\'','(Aramaic) from עֲבַד; a servant; servant.'),
	('H5650','עֶבֶד','ʻebed','eh\'-bed','from עָבַד; a servant; [idiom] bondage, bondman, (bond-) servant, (man-) servant.'),
	('H5651','עֶבֶד','ʻEbed','eh\'-bed','the same as עֶבֶד; Ebed, the name of two Israelites; Ebed.'),
	('H5652','עֲבָד','ʻăbâd','ab-awd\'','from עָבַד; a deed; work.'),
	('H5653','עַבְדָּא','ʻAbdâʼ','ab-daw\'','from עָבַד; work; Abda, the name of two Israelites; Abda'),
	('H5654','עֹבֵד אֱדוֹם','ʻÔbêd ʼĔdôwm','o-bade\' ed-ome\'','from the active participle of עָבַד and אֱדֹם; worker of Edom; Obed-Edom, the name of five Israelites; Obed-edom.'),
	('H5655','עַבְדְּאֵל','ʻAbdᵉʼêl','ab-deh-ale\'','from עָבַד and אֵל; serving God; Abdeel, an Israelite; Abdeel. Compare עַבְדִיאֵל.'),
	('H5656','עֲבֹדָה','ʻăbôdâh','ab-o-daw\'','or עֲבוֹדָה; from עָבַד; work of any kind; act, bondage, [phrase] bondservant, effect, labour, ministering(-try), office, service(-ile, -itude), tillage, use, work, [idiom] wrought.'),
	('H5657','עֲבֻדָּה','ʻăbuddâh','ab-ood-daw\'','passive participle of עָבַד; something wrought, i.e. (concretely) service; household, store of servants.'),
	('H5658','עַבְדוֹן','ʻAbdôwn','ab-dohn\'','from עָבַד; servitude; Abdon, the name of a place in Palestine and of four Israelites; Abdon. Compare עֶבְרֹן.'),
	('H5659','עַבְדוּת','ʻabdûwth','ab-dooth\'','from עָבַד; servitude; bondage.'),
	('H5660','עַבְדִּי','ʻAbdîy','ab-dee\'','from עָבַד; serviceable; Abdi, the name of two Israelites; Abdi.'),
	('H5661','עַבְדִיאֵל','ʻAbdîyʼêl','ab-dee-ale\'','from עֶבֶד and אֵל; servant of God; Abdiel, an Israelite; Abdiel. Compare עַבְדְּאֵל.'),
	('H5662','עֹבַדְיָה','ʻÔbadyâh','o-bad-yaw\'','or עֹבַדְיָהוּ; active participle of עָבַד and יָהּ; serving Jah; Obadjah, the name of thirteen Israelites; Obadiah.'),
	('H5663','עֶבֶד מֶלֶךְ','ʻEbed Melek','eh\'-bed meh\'-lek','from עֶבֶד and מֶלֶךְ; servant of a king; Ebed-Melek, a eunuch of Zedekeah; Ebed-melech.'),
	('H5664','עֲבֵד נְגוֹ','ʻĂbêd Nᵉgôw','ab-ade\' neg-o\'','the same as עֲבֵד נְגוֹא; Abed-Nego, the Babylonian name of one of Daniel\'s companions; Abed-nego.'),
	('H5665','עֲבֵד נְגוֹא','ʻĂbêd Nᵉgôwʼ','ab-ade\' neg-o\'','(Aramaic) of foreign origin; Abed-Nego, the name of Azariah; Abed-nego.'),
	('H5666','עָבָה','ʻâbâh','aw-baw\'','a primitive root; to be dense; be (grow) thick(-er).'),
	('H5667','עֲבוֹט','ʻăbôwṭ','ab-ote\'','or עֲבֹט; from עָבַט; a pawn; pledge.'),
	('H5668','עָבוּר','ʻâbûwr','aw-boor\'','or עָבֻר; passive participle of עָבַר; properly, crossed, i.e. (abstractly) transit; used only adverbially, on account of, in order that; because of, for (...\'s sake), (intent) that, to.'),
	('H5669','עָבוּר','ʻâbûwr','aw-boor\'','the same as עָבוּר; passed, i.e. kept over; used only of stored grain; old corn.'),
	('H5670','עָבַט','ʻâbaṭ','aw-bat\'','a primitive root; to pawn; causatively, to lend (on security); figuratively, to entangle; borrow, break (ranks), fetch (a pledge), lend, [idiom] surely.'),
	('H5671','עַבְטִיט','ʻabṭîyṭ','ab-teet\'','from עָבַט; something pledged, i.e. (collectively) pawned goods; thick clay (by a false etym.).'),
	('H5672','עֲבִי','ʻăbîy','ab-ee\'','or עֳבִי]; from עָבָה; density, i.e. depth or width; thick(-ness). Compare עָב.'),
	('H5673','עֲבִידָה','ʻăbîydâh','ab-ee-daw\'','(Aramaic) from עֲבַד; labor or business; affairs, service, work.'),
	('H5674','עָבַר','ʻâbar','aw-bar\'','a primitive root; to cross over; used very widely of any transition (literal or figurative; transitive, intransitive, intensive, causative); specifically, to cover (in copulation); alienate, alter, [idiom] at all, beyond, bring (over, through), carry over, (over-) come (on, over), conduct (over), convey over, current, deliver, do away, enter, escape, fail, gender, get over, (make) go (away, beyond, by, forth, his way, in, on, over, through), have away (more), lay, meddle, overrun, make partition, (cause to, give, make to, over) pass(-age, along, away, beyond, by, -enger, on, out, over, through), (cause to, make) [phrase] proclaim(-amation), perish, provoke to anger, put away, rage, [phrase] raiser of taxes, remove, send over, set apart, [phrase] shave, cause to (make) sound, [idiom] speedily, [idiom] sweet smelling, take (away), (make to) transgress(-or), translate, turn away, (way-) faring man, be wrath.'),
	('H5675','עֲבַר','ʻăbar','ab-ar\'','(Aramaic) corresponding to עֵבֶר; {properly, a region across; but used only adverbially (with or without a preposition) on the opposite side (especially of the Jordan; ususally meaning the east)}; beyond, this side.'),
	('H5676','עֵבֶר','ʻêber','ay\'-ber','from עָבַר; properly, a region across; but used only adverbially (with or without a preposition) on the opposite side (especially of the Jordan; ususally meaning the east); [idiom] against, beyond, by, [idiom] from, over, passage, quarter, (other, this) side, straight.'),
	('H5677','עֵבֵר','ʻÊbêr','ay\'-ber','the same as עֵבֶר; Eber, the name of two patriarchs and four Israelites; Eber, Heber.'),
	('H5678','עֶבְרָה','ʻebrâh','eb-raw\'','feminine of עֵבֶר; an outburst of passion; anger, rage, wrath.'),
	('H5679','עֲבָרָה','ʻăbârâh','ab-aw-raw\'','from עָבַר; a crossing-place; ferry, plain (from the margin).'),
	('H5680','עִבְרִי','ʻIbrîy','ib-ree\'','patronymic from עֵבֵר; an Eberite (i.e. Hebrew) or descendant of Eber; Hebrew(-ess, woman).'),
	('H5681','עִבְרִי','ʻIbrîy','ib-ree\'','the same as עִבְרִי; Ibri, an Israelite; Ibri.'),
	('H5682','עֲבָרִים','ʻĂbârîym','ab-aw-reem\'','xlit ʻĂbârîm corrected to ʻĂbârîym; plural of עֵבֶר; regions beyond; Abarim, a place in Palestine; Abarim, passages.'),
	('H5683','עֶבְרֹן','ʻEbrôn','eb-rone\'','from עֵבֶר; transitional; Ebron, a place in Palestine; Hebron. Perhaps a clerical error for עַבְדוֹן.'),
	('H5684','עֶבְרֹנָה','ʻEbrônâh','eb-raw-naw\'','feminine of עֶבְרֹן; Ebronah, place in the Desert; Ebronah.'),
	('H5685','עָבַשׁ','ʻâbash','aw-bash\'','a primitive root; to dry up; be rotten.'),
	('H5686','עָבַת','ʻâbath','aw-bath\'','a primitive root; to interlace, i.e. (figuratively) to pervert; wrap up.'),
	('H5687','עָבֹת','ʻâbôth','aw-both\'','or עָבוֹת; from עָבַת; intwined, i.e. dense; thick.'),
	('H5688','עֲבֹת','ʻăbôth','ab-oth\'','or עֲבוֹת; or (feminine) עֲבֹתָה; the same as עָבֹת; something intwined, i.e. a string, wreath or foliage; band, cord, rope, thick bough (branch), wreathen (chain).'),
	('H5689','עֲגַב','ʻăgab','aw-gab\'','a primitive root; to breathe after, i.e. to love (sensually); dote, lover.'),
	('H5690','עֶגֶב','ʻegeb','eh\'-gheb','from עֲגַב; love (concretely), i.e. amative words; much love, very lovely.'),
	('H5691','עֲגָבָה','ʻăgâbâh','ag-aw-baw\'','from עֲגַב; love (abstractly), i.e. amorousness; inordinate love.'),
	('H5692','עֻגָּה','ʻuggâh','oog-gaw\'','from עוּג; an ash-cake (as round); cake (upon the hearth).'),
	('H5693','עָגוּר','ʻâgûwr','aw-goor\'','passive part (but with active sense) of an unused root meaning to twitter; probably the swallow; swallow.'),
	('H5694','עָגִיל','ʻâgîyl','aw-gheel\'','from the same as עָגֹל; something round, i.e. a ring (for the ears); earring.'),
	('H5695','עֵגֶל','ʻêgel','ay-ghel','from the same as עָגֹל; a (male) calf (as frisking round), especially one nearly grown (i.e. a steer); bullock, calf.'),
	('H5696','עָגֹל','ʻâgôl','aw-gole\'','or עָגוֹל; from an unused root meaning to revolve,; circular; round.'),
	('H5697','עֶגְלָה','ʻeglâh','eg-law\'','feminine of עֵגֶל; a (female) calf, especially one nearly grown (i.e. a heifer); calf, cow, heifer.'),
	('H5698','עֶגְלָה','ʻEglâh','eg-law\'','the same as עֶגְלָה; Eglah, a wife of David; Eglah.'),
	('H5699','עֲגָלָה','ʻăgâlâh','ag-aw-law\'','from the same as עָגֹל; something revolving, i.e. a wheeled vehicle; cart, chariot, wagon'),
	('H5700','עֶגְלוֹן','ʻEglôwn','eg-lawn\'','from עֵגֶל; vituline; Eglon, the name of a place in Palestine and of a Moabitish king; Eglon.'),
	('H5701','עָגַם','ʻâgam','aw-gam\'','a primitive root; to be sad; grieve.'),
	('H5702','עָגַן','ʻâgan','aw-gan\'','a primitive root; to debar, i.e. from marriage; stay.'),
	('H5703','עַד','ʻad','ad','from עָדָה; properly, a (peremptory) terminus, i.e. (by implication) duration, in the sense of advance or perpetuity (substantially as a noun, either with or without a preposition); eternity, ever(-lasting, -more), old, perpetually, [phrase] world without end.'),
	('H5704','עַד','ʻad','ad','properly, the same as עַד (used as a preposition, adverb or conjunction; especially with a preposition); as far (or long, or much) as, whether of space (even unto) or time (during, while, until) or degree (equally with); against, and, as, at, before, by (that), even (to), for(-asmuch as), (hither-) to, [phrase] how long, into, as long (much) as, (so) that, till, toward, until, when, while, ([phrase] as) yet.'),
