	('H5706','עַד','ʻad','ad','the same as עַד in the sense of the aim of an attack; booty; prey.'),
	('H5707','עֵד','ʻêd','ayd','contracted from עוּד; concretely, a witness; abstractly, testimony; specifically, a recorder, i.e. prince; witness.'),
	('H5708','עֵד','ʻêd','ayd','from an unused root meaning to set a period (compare עָדָה, עוּד); the menstrual flux (as periodical); by implication (in plural) soiling; filthy.'),
	('H5709','עֲדָא','ʻădâʼ','ad-aw\'','(Aramaic) or עֲדָה; (Aramaic), corresponding to עָדָה; {to advance, i.e. pass on or continue; causatively, to remove; specifically, to bedeck (i.e. bring an ornament upon)}; alter, depart, pass (away), remove, take (away).'),
	('H5710','עָדָה','ʻâdâh','aw-daw\'','a primitive root; to advance, i.e. pass on or continue; causatively, to remove; specifically, to bedeck (i.e. bring an ornament upon); adorn, deck (self), pass by, take away.'),
