	('H5715','עֵדוּת','ʻêdûwth','ay-dooth\'','feminine of עֵד; testimony; testimony, witness.'),
	('H5716','עֲדִי','ʻădîy','ad-ee\'','from עָדָה in the sense of trappings; finery; generally an outfit; specifically, a headstall; [idiom] excellent, mouth, ornament.'),
	('H5717','עֲדִיאֵל','ʻĂdîyʼêl','ad-ee-ale\'','from עֲדִי and אֵל; ornament of God; Adiel, the name of three Israelites; Adiel.'),
	('H5718','עֲדָיָה','ʻĂdâyâh','ad-aw-yaw\'','or עֲדָיָהוּ; from עָדָה and יָהּ; Jah has adorned; Adajah, the name of eight Israelites; Adaiah.'),
