	('H5925','עֻלָּא','ʻUllâʼ','ool-law\'','feminine of עֹל; burden; Ulla, an Israelite; Ulla.'),
	('H5926','עִלֵּג','ʻillêg','il-layg\'','from an unused root meaning to stutter; stuttering; stammerer.'),
	('H5927','עָלָה','ʻâlâh','aw-law\'','a primitive root; to ascend, intransitively (be high) or actively (mount); used in a great variety of senses, primary and secondary, literal and figurative; arise (up), (cause to) ascend up, at once, break (the day) (up), bring (up), (cause to) burn, carry up, cast up, [phrase] shew, climb (up), (cause to, make to) come (up), cut off, dawn, depart, exalt, excel, fall, fetch up, get up, (make to) go (away, up); grow (over) increase, lay, leap, levy, lift (self) up, light, (make) up, [idiom] mention, mount up, offer, make to pay, [phrase] perfect, prefer, put (on), raise, recover, restore, (make to) rise (up), scale, set (up), shoot forth (up), (begin to) spring (up), stir up, take away (up), work.'),
	('H5928','עֲלָה','ʻălâh','al-law\'','(Aramaic) corresponding to עֹלָה; a holocaust; burnt offering.'),
	('H5929','עָלֶה','ʻâleh','aw-leh\'','from עָלָה; a leaf (as coming up on a tree); collectively, foliage; branch, leaf.'),
	('H5930','עֹלָה','ʻôlâh','o-law\'','or עוֹלָה; feminine active participle of עָלָה; a step or (collectively, stairs, as ascending); usually a holocaust (as going up in smoke); ascent, burnt offering (sacrifice), go up to. See also עֶוֶל.'),
	('H5931','עִלָּה','ʻillâh','il-law\'','(Aramaic) feminine from a root corresponding to עָלָה; a pretext (as arising artificially); occasion.'),
	('H5932','עַלְוָה','ʻalvâh','al-vaw\'','for עֶוֶל; moral perverseness; iniquity.'),
	('H5933','עַלְוָה','ʻAlvâh','al-vaw\'','or עַליָה; the same as עַלְוָה; Alvah or Aljah, an Idumaean; Aliah, Alvah.'),
	('H5934','עָלוּם','ʻâlûwm','aw-loom\'','passive participle of עָלַם in the denominative sense of עֶלֶם; (only in plural as abstract) adolescence; figuratively, vigor; youth.'),
	('H5935','עַלְוָן','ʻAlvân','al-vawn\'','or עַלְיָן; from עָלָה; lofty; Alvan or Aljan, an Idumaean; Alian, Alvan.'),
	('H5936','עֲלוּקָה','ʻălûwqâh','al-oo-kaw\'','feminine passive participle of an unused root meaning to suck; the leech; horse-leech.'),
	('H5937','עָלַז','ʻâlaz','aw-laz\'','a primitive root; to jump for joy, i.e. exult; be joyful, rejoice, triumph.'),
	('H5938','עָלֵז','ʻâlêz','aw-laze\'','from עָלַז; exultant; that rejoiceth.'),
	('H5939','עֲלָטָה','ʻălâṭâh','al-aw-taw\'','feminine from an unused root meaning to cover; dusk; dark, twilight.'),
	('H5940','עֱלִי','ʻĕlîy','el-ee\'','from עָלָה; a pestle (as lifted); pestle.'),
	('H5941','עֵלִי','ʻÊlîy','ay-lee\'','from עָלָה; lofty; Eli, an Israelite highpriest; Eli.'),
	('H5942','עִלִּי','ʻillîy','il-lee\'','from עָלָה; high; i.e. comparative; upper.'),
	('H5943','עִלַּי','ʻillay','il-lah\'-ee','(Aramaic) corresponding to עִלִּי; supreme (i.e. God); (most) high.'),
	('H5944','עֲלִיָּה','ʻălîyâh','al-ee-yaw\'','feminine from עָלָה; something lofty, i.e. a stair-way; also a second-story room (or even one on the roof); figuratively, the sky; ascent, (upper) chamber, going up, loft, parlour.'),
	('H5945','עֶלְיוֹן','ʻelyôwn','el-yone\'','from עָלָה; an elevation, i.e. (adj.) lofty (compar.); as title, the Supreme; (Most, on) high(-er, -est), upper(-most).'),
	('H5946','עֶלְיוֹן','ʻelyôwn','el-yone\'','(Aramaic) corresponding to עֶלְיוֹן; the Supreme; Most high.'),
	('H5947','עַלִּיז','ʻallîyz','al-leez\'','from עָלַז; exultant; joyous, (that) rejoice(-ing)'),
	('H5948','עֲלִיל','ʻălîyl','al-eel\'','from עָלַל in the sense of completing; probably a crucible (as working over the metal); furnace.'),
	('H5949','עֲלִילָה','ʻălîylâh','al-ee-law\'','or עֲלִלָה; from עָלַל in the sense of effecting; an exploit (of God), or a performance (of man, often in a bad sense); by implication, an opportunity; act(-ion), deed, doing, invention, occasion, work.'),
	('H5950','עֲלִילִיָּה','ʻălîylîyâh','al-ee-lee-yaw\'','for עֲלִילָה; (miraculous) execution; work.'),
	('H5951','עֲלִיצוּת','ʻălîytsûwth','al-ee-tsooth\'','from עָלַץ; exultation; rejoicing.'),
	('H5952','עַלִּית','ʻallîyth','al-leeth\'','from עָלָה; a second-story room; chamber. Compare עֲלִיָּה.'),
	('H5953','עָלַל','ʻâlal','aw-lal\'','a primitive root; to effect thoroughly; specifically, to glean (also figuratively); by implication (in a bad sense) to overdo, i.e. maltreat, be saucy to, pain, impose (also literal); abuse, affect, [idiom] child, defile, do, glean, mock, practise, thoroughly, work (wonderfully).'),
	('H5954','עֲלַל','ʻălal','al-al\'','(Aramaic) corresponding to עָלַל (in the sense of thrusting oneself in),; to enter; causatively, to introduce; bring in, come in, go in.'),
	('H5955','עֹלֵלָה','ʻôlêlâh','o-lay-law\'','feminine active participle of עָלַל; only in plural gleanings; by extension gleaning-time; (gleaning) (of the) grapes, grapegleanings.'),
	('H5956','עָלַם','ʻâlam','aw-lam\'','a primitive root; to veil from sight, i.e. conceal (literally or figuratively); [idiom] any ways, blind, dissembler, hide (self), secret (thing).'),
	('H5957','עָלַם','ʻâlam','aw-lam\'','(Aramaic) corresponding to עוֹלָם; remote time, i.e. the future or past indefinitely; often adverb, forever; for (n-)ever (lasting), old.'),
	('H5958','עֶלֶם','ʻelem','eh\'-lem','from עָלַם; (compare עַלְמָה); properly, something kept out of sight, i.e. a lad; young man, stripling.'),
	('H5959','עַלְמָה','ʻalmâh','al-maw\'','feminine of עֶלֶם; a lass (as veiled or private); damsel, maid, virgin.'),
	('H5960','עַלְמוֹן','ʻAlmôwn','al-mone\'','from עָלַם; hidden; See also עַלְמֹן דִּבְלָתָיְמָה.; Almon, a place in Palestine; '),
	('H5961','עֲלָמוֹת','ʻĂlâmôwth','al-aw-moth\'','plural of עַלְמָה; properly, girls, i.e. the soprano or female voice, perhaps falsetto; Alamoth.'),
	('H5962','עַלְמִי','ʻAlmîy','al-mee\'','(Aramaic) patrial from a name corresponding to עֵילָם contracted; an Elamite or inhabitant of Elam; Elamite.'),
	('H5963','עַלְמֹן דִּבְלָתָיְמָה','ʻAlmôn Diblâthâyᵉmâh','al-mone\' dib-lawthaw\'-yem-aw','from the same as עַלְמוֹן and the dual of הֻיְּדָה (compare בֵּית דִּבְלָתַיִם) with enclitic of direction; Almon towards Diblathajim; Almon-Diblathajemah, a place in Moab; Almondilathaim.'),
	('H5964','עָלֶמֶת','ʻÂlemeth','aw-leh\'-meth','from עָלַם; a covering; Alemeth, the name of a place in Palestine and of two Israelites; Alameth, Alemeth.'),
	('H5965','עָלַס','ʻâlaç','aw-las\'','a primitive root; to leap for joy, i.e. exult, wave joyously; [idiom] peacock, rejoice, solace self.'),
	('H5966','עָלַע','ʻâlaʻ','aw-lah\'','a primitive root; to sip up; suck up.'),
	('H5967','עֲלַע','ʻălaʻ','al-ah\'','(Aramaic) corresponding to צֵלָע; a rib; rib.'),
	('H5968','עָלַף','ʻâlaph','aw-laf\'','a primitive root; to veil or cover; figuratively, to be languid; faint, overlaid, wrap self.'),
	('H5969','עֻלְפֶּה','ʻulpeh','ool-peh\'','from עָלַף; an envelope, i.e. (figuratively) mourning; fainted.'),
	('H5970','עָלַץ','ʻâlats','aw-lats\'','a primitive root; to jump for joy, i.e. exult; be joyful, rejoice, triumph.'),
	('H5971','עַם','ʻam','am','from עָמַם; a people (as a congregated unit); specifically, a tribe (as those of Israel); hence (collectively) troops or attendants; figuratively, a flock; folk, men, nation, people.'),
	('H5972','עַם','ʻam','am','(Aramaic) corresponding to עַם; {a people (as a congregated unit); specifically, a tribe (as those of Israel); hence (collectively) troops or attendants; figuratively, a flock}; people.'),
	('H5973','עִם','ʻim','eem','from עָמַם; adverb or preposition, with (i.e. in conjunction with), in varied applications; specifically, equally with; often with prepositional prefix (and then usually unrepresented in English); accompanying, against, and, as ([idiom] long as), before, beside, by (reason of), for all, from (among, between), in, like, more than, of, (un-) to, with(-al).'),
	('H5974','עִם','ʻim','eem','(Aramaic) corresponding to עִם; {adverb or preposition, with (i.e. in conjunction with), in varied applications; specifically, equally with; often with prepositional prefix (and then usually unrepresented in English)}; by, from, like, to(-ward), with.'),
	('H5975','עָמַד','ʻâmad','aw-mad\'','a primitive root; to stand, in various relations (literal and figurative, intransitive and transitive); abide (behind), appoint, arise, cease, confirm, continue, dwell, be employed, endure, establish, leave, make, ordain, be (over), place, (be) present (self), raise up, remain, repair, [phrase] serve, set (forth, over, -tle, up), (make to, make to be at a, with-) stand (by, fast, firm, still, up), (be at a) stay (up), tarry.'),
	('H5976','עָמַד','ʻâmad','aw-mad\'','for מָעַד; to shake; be at a stand.'),
	('H5977','עֹמֶד','ʻômed','o\'-med','from עָמַד; a spot (as being fixed); place, ([phrase] where) stood, upright.'),
	('H5978','עִמָּד','ʻimmâd','im-mawd\'','prolonged for עִם; along with; against, by, from, [phrase] me, [phrase] mine, of, [phrase] that I take, unto, upon, with(-in.)'),
	('H5979','עֶמְדָּה','ʻemdâh','em-daw\'','from עָמַד; a station, i.e. domicile; standing.'),
	('H5980','עֻמָּה','ʻummâh','oom-maw\'','from עָמַם; conjunction, i.e. society; mostly adverb or preposition (with prepositional prefix), near, beside, along with; (over) against, at, beside, hard by, in points.'),
	('H5981','עֻמָּה','ʻUmmâh','oom-maw\'','the same as עֻמָּה; association; Ummah, a place in Palestine; Ummah.'),
	('H5982','עַמּוּד','ʻammûwd','am-mood\'','or עַמֻּד; from עָמַד; a column (as standing); also a stand, i.e. platform; [idiom] apiece, pillar.'),
	('H5983','עַמּוֹן','ʻAmmôwn','am-mone\'','from עַם; tribal, i.e. inbred; Ammon, a son of Lot; also his posterity and their country; Ammon, Ammonites.'),
	('H5984','עַמּוֹנִי','ʻAmmôwnîy','am-mo-nee\'','patronymically from עַמּוֹן; an Ammonite or (the adjective) Ammonitish; Ammonite(-s).'),
	('H5985','עַמּוֹנִית','ʻAmmôwnîyth','am-mo-neeth\'','feminine of עַמּוֹנִי; an Ammonitess; Ammonite(-ss).'),
	('H5986','עָמוֹס','ʻÂmôwç','aw-moce\'','from עָמַס; burdensome; Amos, an Israelite prophet; Amos.'),
	('H5987','עָמוֹק','ʻÂmôwq','aw-moke\'','from עָמַק; deep; Amok, an Israelite; Amok.'),
	('H5988','עַמִּיאֵל','ʻAmmîyʼêl','am-mee-ale\'','from עַם and אֵל; people of God; Ammiel, the name of three or four Israelites; Ammiel.'),
	('H5989','עַמִּיהוּד','ʻAmmîyhûwd','am-mee-hood\'','from עַם and הוֹד; people of splendor; Ammihud, the name of three Israelites; Ammihud.'),
	('H5990','עַמִּיזָבָד','ʻAmmîyzâbâd','am-mee-zaw-bawd\'','from עַם and זָבַד; people of endowment; Ammizabad, an Israelite; Ammizabad.'),
	('H5991','עַמִּיחוּר','ʻAmmîychûwr','am-mee-khoor\'','from עַם and חוּר; people of nobility; Ammichur, a Syrian prince; Ammihud (from the margin).'),
	('H5992','עַמִּינָדָב','ʻAmmîynâdâb','am-mee-naw-dawb\'','from עַם and נָדַב; people of liberality; Amminadab, the name of four Israelites; Amminadab.'),
	('H5993','עַמִּי נָדִיב','ʻAmmîy Nâdîyb','am-mee\' naw-deeb\'','from עַם and נָדִיב; my people (is) liberal; Ammi-Nadib, probably an Israelite; Amminadib.'),
	('H5994','עֲמִיק','ʻămîyq','am-eek\'','(Aramaic) corresponding to עָמֵק; profound, i.e. unsearchable; deep.'),
	('H5995','עָמִיר','ʻâmîyr','aw-meer\'','from עָמַר; a bunch of grain; handful, sheaf.'),
	('H5996','עַמִּישַׁדַּי','ʻAmmîyshadday','am-mee-shad-dah\'ee','from עַם and שַׁדַּי; people of (the) Almighty; Ammishaddai, an Israelite; Ammishaddai.'),
	('H5997','עָמִית','ʻâmîyth','aw-meeth\'','from a primitive root meaning to associate; companionship; hence (concretely) a comrade or kindred man; another, fellow, neighbour.'),
	('H5998','עָמַל','ʻâmal','aw-mal\'','a primitive root; to toil, i.e. work severely and with irksomeness; (take) labour (in).'),
	('H5999','עָמָל','ʻâmâl','aw-mawl\'','from עָמַל; toil, i.e. wearing effort; hence, worry, wheth. of body or mind; grievance(-vousness), iniquity, labour, mischief, miserable(-sery), pain(-ful), perverseness, sorrow, toil, travail, trouble, wearisome, wickedness.'),
	('H6000','עָמָל','ʻÂmâl','aw-mawl\'','the same as עָמָל; Amal, an Israelite; Amal.'),
	('H6001','עָמֵל','ʻâmêl','aw-male\'','from עָמַל; toiling; concretely, a laborer; figuratively, sorrowful; that laboureth, that is a misery, had taken (labour), wicked, workman.'),
	('H6002','עֲמָלֵק','ʻĂmâlêq','am-aw-lake\'','probably of foreign origin; Amalek, a descendant of Esau; also his posterity and their country; Amalek.'),
	('H6003','עֲמָלֵקִי','ʻĂmâlêqîy','am-aw-lay-kee\'','patronymically from עֲמָלֵק; an Amalekite (or collectively the Amalekites) or descendants of Amalek; Amalekite(-s).'),
	('H6004','עָמַם','ʻâmam','aw-mam\'','a primitive root; to associate; by implication, to overshadow (by huddling together); become dim, hide.'),
	('H6005','עִמָּנוּאֵל','ʻImmânûwʼêl','im-maw-noo-ale\'','from עִם and with a pronominal suffix inserted; with us (is) God; Immanuel, a type name of Isaiah\'s son; Immanuel.'),
	('H6006','עָמַס','ʻâmaç','aw-mas\'','or עָמַשׂ; a primitive root; to load, i.e. impose aburden (or figuratively, infliction); be borne, (heavy) burden (self), lade, load, put.'),
	('H6007','עֲמַסְיָה','ʻĂmaçyâh','am-as-yaw\'','from עָמַס and יָהּ; Jah has loaded; Amasjah, an Israelite; Amasiah.'),
	('H6008','עַמְעָד','ʻAmʻâd','am-awd\'','from עַם and עַד; people of time; Amad, a place in Palestine; Amad.'),
	('H6009','עָמַק','ʻâmaq','aw-mak\'','a primitive root; to be (causatively, make) deep (literally or figuratively); (be, have, make, seek) deep(-ly), depth, be profound.'),
	('H6010','עֵמֶק','ʻêmeq','ay\'-mek','from עָמַק; a vale (i.e. broad depression); dale, vale, valley (often used as a part of proper names). See also בֵּית הָעֵמֶק.'),
	('H6011','עֹמֶק','ʻômeq','o\'-mek','from עָמַק; depth; depth.'),
	('H6012','עָמֵק','ʻâmêq','aw-make\'','from עָמַק; deep (literally or figuratively); deeper, depth, strange.'),
	('H6013','עָמֹק','ʻâmôq','aw-moke\'','from עָמַק; deep (literally or figuratively); ([idiom] exceeding) deep (thing).'),
	('H6014','עָמַר','ʻâmar','aw-mar\'','a primitive root; properly, apparently to heap; figuratively, to chastise (as if piling blows); specifically (as denominative from עֹמֶר); to gather grain; bind sheaves, make merchandise of.'),
	('H6015','עֲמַר','ʻămar','am-ar\'','(Aramaic) corresponding to צֶמֶר; wool; wool.'),
	('H6016','עֹמֶר','ʻômer','o\'-mer','from עָמַר; properly, a heap, i.e. a sheaf; also an omer, as a dry measure; omer, sheaf.'),
	('H6017','עֲמֹרָה','ʻĂmôrâh','am-o-raw\'','from עָמַר; a (ruined) heap; Amorah, a place in Palestine; Gomorrah.'),
	('H6018','עׇמְרִי','ʻOmrîy','om-ree\'','from עָמַר; heaping; Omri, an Israelite; Omri.'),
	('H6019','עַמְרָם','ʻAmrâm','am-rawm\'','probably from עַם and רוּם; high people; Amram, the name of two Israelites; Amram.'),
	('H6020','עַמְרָמִי','ʻAmrâmîy','am-raw-mee\'','from עַמְרָם; an Amramite or descendant of Amram; Amramite.'),
	('H6021','עֲמָשָׂא','ʻĂmâsâʼ','am-aw-saw\'','from עָמַס; burden; Amasa, the name of two Israelites; Amasa.'),
	('H6022','עֲמָשַׂי','ʻĂmâsay','am-aw-sah\'-ee','from עָמַס; burdensome; Amasai, the name of three Israelites; Amasai.'),
	('H6023','עֲמַשְׁסַי','ʻĂmashçay','am-ash-sah\'-ee','probably from עָמַס; burdensome; Amashsay, an Israelite; Amashai.'),
	('H6024','עֲנָב','ʻĂnâb','an-awb\'','from the same as עֵנָב; fruit; Anab, a place in Palestine; Anab.'),
	('H6025','עֵנָב','ʻênâb','ay-nawb\'','from an unused root probably meaning to bear fruit; a grape; (ripe) grape, wine.'),
	('H6026','עָנַג','ʻânag','aw-nag\'','a primitive root; to be soft or pliable, i.e. (figuratively) effeminate or luxurious; delicate(-ness), (have) delight (self), sport self.'),
	('H6027','עֹנֶג','ʻôneg','o\'-neg','from עָנַג; luxury; delight, pleasant.'),
	('H6028','עָנֹג','ʻânôg','aw-nogue\'','from עָנַג; luxurious; delicate.'),
	('H6029','עָנַד','ʻânad','aw-nad\'','a primitive root; to lace fast; bind, tie.'),
	('H6030','עָנָה','ʻânâh','aw-naw\'','a primitive root; properly, to eye or (generally) to heed, i.e. pay attention; by implication, to respond; by extension to begin to speak; specifically to sing, shout, testify, announce; give account, afflict (by mistake for עָנָה), (cause to, give) answer, bring low (by mistake for עָנָה), cry, hear, Leannoth, lift up, say, [idiom] scholar, (give a) shout, sing (together by course), speak, testify, utter, (bear) witness. See also בֵּית עֲנוֹת, בֵּית עֲנָת.'),
	('H6031','עָנָה','ʻânâh','aw-naw\'','a primitive root (possibly rather identical with עָנָה through the idea of looking down or browbeating); to depress literally or figuratively, transitive or intransitive (in various applications, as follows); abase self, afflict(-ion, self), answer (by mistake for עָנָה), chasten self, deal hardly with, defile, exercise, force, gentleness, humble (self), hurt, ravish, sing (by mistake for עָנָה), speak (by mistake for עָנָה), submit self, weaken, [idiom] in any wise.'),
	('H6032','עֲנָה','ʻănâh','an-aw\'','(Aramaic) corresponding to עָנָה; {properly, to eye or (generally) to heed, i.e. pay attention; by implication, to respond; by extension to begin to speak; specifically to sing, shout, testify, announce}; answer, speak.'),
	('H6033','עֲנָה','ʻănâh','an-aw\'','(Aramaic) corresponding to עָנָה; {to depress literally or figuratively, transitive or intransitive (in various applications, as follows)}; poor.'),
	('H6034','עֲנָה','ʻĂnâh','an-aw\'','probably from עָנָה; an answer; Anah, the name of two Edomites and one Edomitess; Anah.'),
	('H6035','עָנָו','ʻânâv','aw-nawv\'','or (by intermixture with עָנִי) עָנָיו; from עָנָה; depressed (figuratively), in mind (gentle) or circumstances (needy, especially saintly); humble, lowly, meek, poor. Compare עָנִי.'),
