	('H6155','עָרָב','ʻârâb','aw-rawb\'','from עָרַב; a willow (from the use of osiers as wattles); willow.'),
	('H6156','עָרֵב','ʻârêb','aw-rabe\'','from עָרֵב; pleasant; sweet.'),
	('H6157','עָרֹב','ʻârôb','aw-robe\'','from עָרַב; a mosquito (from its swarming); divers sorts of flies, swarm.'),
	('H6158','עֹרֵב','ʻôrêb','o-rabe\'','or עוֹרֵב; from עָרַב; a raven (from its dusky hue); raven.'),
	('H6159','עֹרֵב','ʻÔrêb','o-rabe\'','or עוֹרֵב; the same as עֹרֵב; Oreb, the name of a Midianite and of the cliff near the Jordan; Oreb.'),
	('H6160','עֲרָבָה','ʻărâbâh','ar-aw-baw\'','from עָרַב (in the sense of sterility); a desert; especially (with the article prefix) the (generally) sterile valley of the Jordan and its continuation to the Red Sea; Arabah, champaign, desert, evening, heaven, plain, wilderness. See also בֵּית הָעֲרָבָה.'),
	('H6161','עֲרֻבָּה','ʻărubbâh','ar-oob-baw\'','feminine passive participle of עֲנַמֶּלֶךְ in the sense of a bargain or exchange; something given as security, i.e. (literally) a token (of safety) or (metaphorically) a bondsman; pledge, surety.'),
	('H6162','עֲרָבוֹן','ʻărâbôwn','ar-aw-bone\'','from עָרַב (in the sense of exchange); a pawn (given as security); pledge.'),
	('H6163','עֲרָבִי','ʻĂrâbîy','ar-aw-bee\'','or עַרְבִי; patrial from עֲרָב; an Arabian or inhabitant of Arab (i.e. Arabia); Arabian.'),
	('H6164','עַרְבָתִי','ʻArbâthîy','ar-baw-thee\'','patrial from בֵּית הָעֲרָבָה; an Arbathite or inhabitant of (Beth-) Arabah; Arbahite.'),
	('H6165','עָרַג','ʻârag','aw-rag\'','a primitive root; to long for; cry, pant.'),
	('H6166','עֲרָד','ʻĂrâd','ar-awd\'','from an unused root meaning to sequester itself; fugitive; Arad, the name of a place near Palestine, also of a Canaanite and an Israelite; Arad.'),
	('H6167','עֲרָד','ʻărâd','ar-awd\'','(Aramaic) corresponding to עָרוֹד; an onager; wild ass.'),
	('H6168','עָרָה','ʻârâh','aw-raw\'','a primitive root; to be (causatively, make) bare; hence, to empty, pour out, demolish; leave destitute, discover, empty, make naked, pour (out), rase, spread self, uncover.'),
	('H6169','עָרָה','ʻârâh','aw-raw\'','feminine from עָרָה; a naked (i.e. level) plot; paper reed.'),
	('H6170','עֲרוּגָה','ʻărûwgâh','ar-oo-gaw\'','or עֲרֻגָה; feminine passive participle of עָרַג; something piled up (as if (figuratively) raised by mental aspiration), i.e. a paterre; bed, furrow.'),
	('H6171','עָרוֹד','ʻârôwd','aw-rode\'','from the same as עֲרָד; an onager (from his lonesome habits); wild ass.'),
	('H6172','עֶרְוָה','ʻervâh','er-vaw\'','from עָרָה; nudity, literally (especially the pudenda) or figuratively (disgrace, blemish); nakedness, shame, unclean(-ness).'),
	('H6173','עַרְוָה','ʻarvâh','ar-vaw\'','(Aramaic) corresponding to עֶרְוָה; nakedness, i.e. (figuratively) impoverishment; dishonor.'),
	('H6174','עָרוֹם','ʻârôwm','aw-rome\'','or עָרֹם; from עָרַם (in its original sense); nude, either partially or totally; naked.'),
	('H6175','עָרוּם','ʻârûwm','aw-room\'','passive participle of עָרַם; cunning (usually in a bad sense); crafty, prudent, subtil.'),
	('H6176','עֲרוֹעֵר','ʻărôwʻêr','ar-o-ayr\'','or עַרְעָר; from עָרַר reduplicated; a juniper (from its nudity of situation); health.'),
	('H6177','עֲרוֹעֵר','ʻĂrôwʻêr','ar-o-ayr\'','or עֲרֹעֵר; or עַרְעוֹר; the same as עֲרוֹעֵר; nudity of situation; Aroer, the name of three places in or near Palestine; Aroer.'),
	('H6178','עָרוּץ','ʻârûwts','aw-roots\'','passive participle of עָרַץ; feared, i.e. (concretely) a horrible place or chasm; cliffs.'),
	('H6179','עֵרִי','ʻÊrîy','ay-ree\'','from עוּר; watchful; Eri, an Israelite; Eri.'),
	('H6180','עֵרִי','ʻÊrîy','ay-ree\'','patronymically of עֵרִי; a Erite (collectively) or descendants of Eri; Erites.'),
	('H6181','עֶרְיָה','ʻeryâh','er-yaw\'','for עֶרְוָה; nudity; bare, naked, [idiom] quite.'),
	('H6182','עֲרִיסָה','ʻărîyçâh','ar-ee-saw\'','from an unused root meaning to comminute; meal; dough.'),
	('H6183','עָרִיף','ʻârîyph','aw-reef\'','from עָרַף; the sky (as dropping at the horizon); heaven.'),
	('H6184','עָרִיץ','ʻârîyts','aw-reets\'','from עָרַץ; fearful, i.e. powerful or tyrannical; mighty, oppressor, in great power, strong, terrible, violent.'),
	('H6185','עֲרִירִי','ʻărîyrîy','ar-e-ree\'','from עָרַר; bare, i.e. destitute (of children); childless.'),
	('H6186','עָרַךְ','ʻârak','aw-rak\'','a primitive root; to set in a row, i.e. arrange, put in order (in a very wide variety of applications); put (set) (the battle, self) in array, compare, direct, equal, esteem, estimate, expert (in war), furnish, handle, join (battle), ordain, (lay, put, reckon up, set) (in) order, prepare, tax, value.'),
	('H6187','עֵרֶךְ','ʻêrek','eh\'rek','from עָרַךְ; a pile, equipment, estimate; equal, estimation, (things that are set in) order, price, proportion, [idiom] set at, suit, taxation, [idiom] valuest.'),
	('H6188','עָרֵל','ʻârêl','aw-rale\'','a primitive root; properly, to strip; but used as denominative from עָרֵל; to expose or remove the prepuce, whether literal (to go naked) or figurative (to refrain from using); count uncircumcised, foreskin to be uncovered.'),
	('H6189','עָרֵל','ʻârêl','aw-rale\'','from עָרֵל; properly, exposed, i.e. projecting loose (as to the prepuce); used only technically,; uncircumcised (i.e. still having the prepuce uncurtailed); uncircumcised (person).'),
	('H6190','עׇרְלָה','ʻorlâh','or-law\'','feminine of עָרֵל; the prepuce; foreskin, [phrase] uncircumcised.'),
	('H6191','עָרַם','ʻâram','aw-ram\'','a primitive root; properly, to be (or make) bare; but used only in the derivative sense (through the idea perhaps of smoothness) to be cunning (usually in a bad sense); [idiom] very, beware, take crafty (counsel), be prudent, deal subtilly.'),
	('H6192','עָרַם','ʻâram','aw-ram\'','a primitive root; to pile up; gather together.'),
	('H6193','עֹרֶם','ʻôrem','o\'-rem','from עָרַם; a stratagem; craftiness.'),
	('H6194','עָרֵם','ʻârêm','aw-rame\'','(Jeremiah 50:26) or (feminine) עֲרֵמָה; from עָרַם; a heap; specifically, a sheaf; heap (of corn), sheaf.'),
	('H6195','עׇרְמָה','ʻormâh','or-maw\'','feminine of עֹרֶם; trickery; or (in a good sense) discretion; guile, prudence, subtilty, wilily, wisdom.'),
	('H6196','עַרְמוֹן','ʻarmôwn','ar-mone\'','probably from עָרַם; the plane tree (from its smooth and shed bark); chestnut tree.'),
	('H6197','עֵרָן','ʻÊrân','ay-rawn\'','probably from עוּר; watchful; Eran, an Israelite; Eran.'),
	('H6198','עֵרָנִי','ʻÊrânîy','ay-raw-nee\'','patronymically from עֵרָן; an Eranite or descendant (collectively) of Eran; Eranites.'),
	('H6199','עַרעָר','ʻarʻâr','ar-awr\'','from עָרַר; naked, i.e. (figuratively) poor; destitute. See also עֲרוֹעֵר.'),
	('H6200','עֲרֹעֵרִי','ʻĂrôʻêrîy','ar-o-ay-ree\'','patronymically from עֲרוֹעֵר; an Aroerite or inhabitant of Aroer; Aroerite.'),
	('H6201','עָרַף','ʻâraph','aw-raf\'','a primitive root; to droop; hence, to drip; drop (down).'),
	('H6202','עָרַף','ʻâraph','aw-raf\'','a primitive root (identical with through the idea of sloping); properly, to bend downward; but used only as a denominative from עֹרֶף,; to break the neck; hence (figuratively) to destroy; that is beheaded, break down, break (cut off, strike off) neck.'),
	('H6203','עֹרֶף','ʻôreph','o-ref\'','from עָרַף; the nape or back of the neck (as declining); hence, the back generally (whether literal or figurative); back ((stiff-) neck((-ed).'),
	('H6204','עׇרְפָּה','ʻOrpâh','or-paw\'','feminine of עֹרֶף; mane; Orpah, a Moabites; Orpah.'),
	('H6205','עֲרָפֶל','ʻărâphel','ar-aw-fel\'','probably from עָרַף; gloom (as of a lowering sky); (gross, thick) dark (cloud, -ness).'),
	('H6206','עָרַץ','ʻârats','aw-rats\'','a primitive root; to awe or (intransitive) to dread; hence, to harass; be affrighted (afraid, dread, feared, terrified), break, dread, fear, oppress, prevail, shake terribly.'),
	('H6207','עָרַק','ʻâraq','aw-rak\'','a primitive root; to gnaw, i.e. (figuratively) eat (by hyberbole); also (participle) a pain; fleeing, sinew.'),
	('H6208','עַרְקִי','ʻArqîy','ar-kee\'','patrial from an unused name meaning a tush; an Arkite or inhabitant of Erek; Arkite.'),
	('H6209','עָרַר','ʻârar','aw-rar\'','a primitive root; to bare; figuratively, to demolish; make bare, break, raise up (perhaps by clerical error for raze), [idiom] utterly.'),
	('H6210','עֶרֶשׂ','ʻeres','eh\'res','from an unused root meaning perhaps to arch; a couch (properly, with a canopy); bed(-stead), couch.'),
	('H6211','עָשׁ','ʻâsh','awsh','from עָשֵׁשׁ; a moth; moth. See also עַיִשׁ.'),
	('H6212','עֶשֶׂב','ʻeseb','eh\'seb','from an unused root meaning to glisten (or be green); grass (or any tender shoot); grass, herb.'),
	('H6213','עָשָׂה','ʻâsâh','aw-saw\'','a primitive root; to do or make, in the broadest sense and widest application; accomplish, advance, appoint, apt, be at, become, bear, bestow, bring forth, bruise, be busy, [idiom] certainly, have the charge of, commit, deal (with), deck, [phrase] displease, do, (ready) dress(-ed), (put in) execute(-ion), exercise, fashion, [phrase] feast, (fight-) ing man, [phrase] finish, fit, fly, follow, fulfill, furnish, gather, get, go about, govern, grant, great, [phrase] hinder, hold (a feast), [idiom] indeed, [phrase] be industrious, [phrase] journey, keep, labour, maintain, make, be meet, observe, be occupied, offer, [phrase] officer, pare, bring (come) to pass, perform, pracise, prepare, procure, provide, put, requite, [idiom] sacrifice, serve, set, shew, [idiom] sin, spend, [idiom] surely, take, [idiom] thoroughly, trim, [idiom] very, [phrase] vex, be (warr-) ior, work(-man), yield, use.'),
	('H6214','עֲשָׂהאֵל','ʻĂsâhʼêl','as-aw-ale\'','from עָשָׂה and אֵל; God has made; Asahel, the name of four Israelites; Asahel.'),
	('H6215','עֵשָׂו','ʻÊsâv','ay-sawv\'','apparently a form of the passive participle of עָשָׂה in the original sense of handling; rough (i.e. sensibly felt); Esav, a son of Isaac, including his posterity; Esau.'),
	('H6216','עָשׁוֹק','ʻâshôwq','aw-shoke\'','from עָשַׁק; oppressive (as noun, a tyrant); oppressor.'),
	('H6217','עָשׁוּק','ʻâshûwq','aw-shook\'','or עָשֻׁק; passive participle of עָשַׁק; used in plural masculine as abstractly, tyranny; oppressed(-ion). (Doubtful.)'),
	('H6218','עָשׂוֹר','ʻâsôwr','aw-sore\'','or עָשֹׂר; from עֶשֶׂר; ten; by abbreviated form ten strings, and so a decachord; (instrument of) ten (strings, -th).'),
	('H6219','עָשׁוֹת','ʻâshôwth','aw-shoth\'','from עָשַׁת; shining, i.e. polished; bright.'),
	('H6220','עַשְׁוָת','ʻAshvâth','ash-vawth\'','for עָשׁוֹת; bright; Ashvath, an Israelite; Ashvath.'),
	('H6221','עֲשִׂיאֵל','ʻĂsîyʼêl','as-ee-ale\'','from עָשָׂה and אֵל; made of God; Asiel, an Israelite; Asiel.'),
	('H6222','עֲשָׂיָה','ʻĂsâyâh','aw-saw-yaw\'','from עָשָׂה and יָהּ; Jah has made; Asajah, the name of three or four Israelites; Asaiah.'),
	('H6223','עָשִׁיר','ʻâshîyr','aw-sheer\'','from עָשַׁר; rich, whether literal or figurative (noble); rich (man).'),
	('H6224','עֲשִׂירִי','ʻăsîyrîy','as-ee-ree\'','from עֶשֶׂר; tenth; by abbreviation, tenth month or (feminine) part; tenth (part).'),
	('H6225','עָשַׁן','ʻâshan','aw-shan\'','a primitive root; to smoke, whether literal or figurative; be angry (be on a) smoke.'),
	('H6226','עָשֵׁן','ʻâshên','aw-shane\'','from עָשַׁן; smoky; smoking.'),
	('H6227','עָשָׁן','ʻâshân','aw-shawn\'','from עָשַׁן; smoke, literally or figuratively (vapor, dust, anger); smoke(-ing).'),
	('H6228','עָשָׁן','ʻÂshân','aw-shawn\'','the same as עָשָׁן; Ashan, a place in Palestine; Ashan.'),
	('H6229','עָשַׂק','ʻâsaq','aw-sak','a primitive root (identical with עָשַׁק); to press upon, i.e. quarrel; strive with.'),
	('H6230','עֵשֶׂק','ʻêseq','ay\'sek','from עָשַׂק; strife; Esek.'),
	('H6231','עָשַׁק','ʻâshaq','aw-shak\'','a primitive root (compare עָשַׂק); to press upon, i.e. oppress, defraud, violate, overflow; get deceitfully, deceive, defraud, drink up, (use) oppress(-ion), -or), do violence (wrong).'),
	('H6232','עֵשֶׁק','ʻÊsheq','ay-shek\'','from עָשַׁק; oppression; Eshek, an Israelite; Eshek.'),
	('H6233','עֹשֶׁק','ʻôsheq','o\'-shek','from עָשַׁק; injury, fraud, (subjectively) distress, (concretely) unjust gain; cruelly, extortion, oppression, thing (deceitfully gotten).'),
	('H6234','עׇשְׁקָה','ʻoshqâh','osh-kaw\'','feminine of עֹשֶׁק; anguish; oppressed.'),
	('H6235','עֶשֶׂר','ʻeser','eh\'ser','masculine of term עֲשָׂרָה; from עָשַׂר; ten (as an accumulation to the extent of the digits); ten, (fif-, seven-) teen.'),
	('H6236','עֲשַׂר','ʻăsar','as-ar\'','(Aramaic) masculine עֲשְׂרָה (Aramaic); corresponding to עֶשֶׂר; ten; ten, [phrase] twelve.'),
	('H6237','עָשַׂר','ʻâsar','aw-sar\'','a primitive root (identical with עָשַׁר); to accumulate; but used only as denominative from עֶשֶׂר; to tithe, i.e. to take or give atenth; [idiom] surely, give (take) the tenth, (have, take) tithe(-ing, -s), [idiom] truly.'),
	('H6238','עָשַׁר','ʻâshar','aw-shar\'','a primitive root; properly, to accumulate; chiefly (specifically) to grow (causatively, make) rich; be(-come, en-, make, make self, wax) rich, make (1 Kings 22:48 marg). See עָשָׂר.'),
	('H6239','עֹשֶׁר','ʻôsher','o\'-sher','from עָשַׁר; wealth; [idiom] far (richer), riches.'),
	('H6240','עָשָׂר','ʻâsâr','aw-sawr\'','for עֶשֶׂר; ten (only in combination), i.e. -teen; also (ordinal) -teenth; (eigh-, fif-, four-, nine-, seven-, six-, thir-) teen(-th), [phrase] eleven(-th), [phrase] sixscore thousand, [phrase] twelve(-th).'),
	('H6241','עִשָּׂרוֹן','ʻissârôwn','is-saw-rone\'','or עִשָּׂרֹן; from עֶשֶׂר; (fractional) a tenth part; tenth deal.'),
	('H6242','עֶשְׂרִים','ʻesrîym','es-reem\'','from עֶשֶׂר; twenty; also (ordinal) twentieth; (six-) score, twenty(-ieth).'),
	('H6243','עֶשְׂרִין','ʻesrîyn','es-reen\'','(Aramaic) corresponding to עֶשְׂרִים; {twenty; also (ordinal) twentieth}; twenty.'),
	('H6244','עָשֵׁשׁ','ʻâshêsh','aw-shaysh\'','a primitive root; probably to shrink, i.e. fail; be consumed.'),
	('H6245','עָשַׁת','ʻâshath','aw-shath\'','a primitive root; probably to be sleek, i.e. glossy; hence (through the idea of polishing) to excogitate (as if forming in the mind); shine, think.'),
	('H6246','עֲשִׁת','ʻăshith','ash-eeth\'','(Aramaic) corresponding to עָשַׁת; to purpose; think.'),
	('H6247','עֶשֶׁת','ʻesheth','eh\'-sheth','from עָשַׁת; a fabric; bright.'),
	('H6248','עַשְׁתּוּת','ʻashtûwth','ash-tooth\'','from עָשַׁת; cogitation; thought.'),
	('H6249','עַשְׁתֵּי','ʻashtêy','ash-tay\'','apparently masculine plural construction of עֶשֶׁת in the sense of an afterthought (used only in connection with עָשָׂר in lieu of אֶחָד); eleven or (ordinal) eleventh; [phrase] eleven(-th).'),
	('H6250','עֶשְׁתֹּנָה','ʻeshtônâh','esh-to-naw\'','from עָשַׁת; thinking; thought.'),
	('H6251','עַשְׁתְּרָה','ʻashtᵉrâh','ash-ter-aw\'','probably from עָשַׁר; increase; flock.'),
	('H6252','עַשְׁתָּרוֹת','ʻAshtârôwth','ash-taw-roth\'','or עַשְׁתָּרֹת; plural of עַשְׁתְּרָה; Ashtaroth, the name of a Sidonian deity, and of a place East of the Jordan; Asharoth, Astaroth. See also בֵּית עַשְׁתָּרוֹת, עַשְׁתֹּרֶת, עַשְׁתְּרֹת קַרְנַיִם.'),
	('H6253','עַשְׁתֹּרֶת','ʻAshtôreth','ash-to\'reth','probably for עַשְׁתְּרָה; Ashtoreth, the Phoenician goddess of love (and increase); Ashtoreth.'),
	('H6254','עַשְׁתְּרָתִי','ʻAshtᵉrâthîy','ash-ter-aw-thee\'','patrial from עַשְׁתָּרוֹת; an Ashterathite or inhabitant of Ashtaroth; Ashterathite.'),
	('H6255','עַשְׁתְּרֹת קַרְנַיִם','ʻAshtᵉrôth Qarnayim','ash-ter-oth\' kar-nah\'-yim','from עַשְׁתָּרוֹת and the dual of קֶרֶן; Ashtaroth of (the) double horns (a symbol of the deity); Ashteroth-Karnaim, a place East of the Jordan; Ashtoreth Karnaim.'),
	('H6256','עֵת','ʻêth','ayth','from עַד; time, especially (adverb with preposition) now, when, etc.; [phrase] after, (al-) ways, [idiom] certain, [phrase] continually, [phrase] evening, long, (due) season, so (long) as, (even-, evening-, noon-) tide, (meal-), what) time, when.'),
	('H6257','עָתַד','ʻâthad','aw-thad\'','a primitive root; to prepare; make fit, be ready to become.'),
	('H6258','עַתָּה','ʻattâh','at-taw\'','from עֵת; at this time, whether adverb, conjunction or expletive; henceforth, now, straightway, this time, whereas.'),
	('H6259','עָתוּד','ʻâthûwd','aw-thood\'','passive participle of עָתַד; prepared; ready.'),
	('H6260','עַתּוּד','ʻattûwd','at-tood\'','or עַתֻּד; from עָתַד; prepared, i.e. full grown; spoken only (in plural) of he-goats, or (figuratively) leaders of the people; chief one, (he) goat, ram.'),
	('H6261','עִתִּי','ʻittîy','it-tee\'','from עֵת; timely; fit.'),
	('H6262','עַתַּי','ʻAttay','at-tah\'ee','for עִתִּי; Attai, the name of three Israelites; Attai.'),
	('H6263','עֲתִיד','ʻăthîyd','ath-eed\'','(Aramaic) corresponding to עָתִיד; prepared; ready.'),
	('H6264','עָתִיד','ʻâthîyd','aw-theed\'','from עָתַד; prepared; by implication, skilful; feminine plural the future; also treasure; things that shall come, ready, treasures.'),
	('H6265','עֲתָיָה','ʻĂthâyâh','ath-aw-yaw\'','from עוּת and יָהּ; Jah has helped; Athajah, an Israelite; Athaiah.'),
	('H6266','עָתִיק','ʻâthîyq','aw-theek\'','from עָתַק; properly, antique, i.e. venerable or splendid; durable.'),
	('H6267','עַתִּיק','ʻattîyq','at-teek\'','from עָתַק; removed, i.e. weaned; also antique; ancient, drawn.'),
	('H6268','עַתִּיק','ʻattîyq','at-teek\'','(Aramaic) corresponding to עַתִּיק; venerable; ancient.'),
	('H6269','עֲתָךְ','ʻĂthâk','ath-awk\'','from an unused root meaning to sojourn; lodging; Athak, a place in Palestine; Athach.'),
	('H6270','עַתְלַי','ʻAthlay','ath-lah\'ee','from an unused root meaning to compress; constringent; Athlai, an Israelite; Athlai.'),
	('H6271','עֲתַלְיָה','ʻĂthalyâh','ath-al-yaw\'','or עֲתַלְיָהוּ; from the same as עַתְלַי and יָהּ; Jah has constrained; Athaljah, the name of an Israelitess and two Israelites; Athaliah.'),
	('H6272','עָתַם','ʻâtham','aw-tham','a primitive root; probably to glow, i.e. (figuratively) be desolated; be darkened.'),
	('H6273','עׇתְנִי','ʻOthnîy','oth-nee\'','from an unused root meaning to force; forcible; Othni, an Israelite; Othni.'),
	('H6274','עׇתְנִיאֵל','ʻOthnîyʼêl','oth-nee-ale\'','from the same as עׇתְנִי and אֵל; force of God; Othniel, an Israelite; Othniel.'),
	('H6275','עָתַק','ʻâthaq','aw-thak\'','a primitive root; to remove (intransitive or transitive) figuratively, to grow old; specifically, to transcribe; copy out, leave off, become (wax) old, remove.'),
	('H6276','עָתֵק','ʻâthêq','aw-thake\'','from עָתַק; antique, i.e. valued; durable.'),
	('H6277','עָתָק','ʻâthâq','aw-thawk\'','from עָתַק in the sense of license; impudent; arrogancy, grievous (hard) things, stiff.'),
	('H6278','עֵת קָצִין','ʻÊth Qâtsîyn','ayth kaw-tseen\'','from עֵת and קַיָּם; time of a judge; Eth-Katsin, a place in Palestine; Ittahkazin (by including directive enclitic).'),
	('H6279','עָתַר','ʻâthar','aw-thar\'','a primitive root (rather denominative from עֶתֶר); to burn incense in worship, i.e. intercede (reciprocally, listen to prayer); intreat, (make) pray(-er).'),
	('H6280','עָתַר','ʻâthar','aw-thar\'','a primitive root; to be (causatively, make) abundant; deceitful, multiply.'),
	('H6281','עֶתֶר','ʻEther','eh\'ther','from עָתַר; abundance; Ether, a place in Palestine; Ether.'),
	('H6282','עָתָר','ʻâthâr','aw-thawr\'','from עָתַר; also compare עָתַר; incense (as increasing to a volume of smoke); hence  a worshipper; suppliant, thick.'),
	('H6283','עֲתֶרֶת','ʻăthereth','ath-eh\'-reth','from עָתַר; copiousness; abundance. p'),
	('H6284','פָּאָה','pâʼâh','paw-aw\'','a primitive root; to puff, i.e. blow away; scatter into corners.'),
	('H6285','פֵּאָה','pêʼâh','pay-aw\'','feminine of פֹּה; properly, mouth in a figurative sense, i.e. direction, region, extremity; corner, end, quarter, side.'),
	('H6286','פָּאַר','pâʼar','paw-ar\'','a primitive root; also denominative from פְּאֹרָה,; to gleam, i.e. (causatively) embellish; figuratively, to boast; also to explain (i.e. make clear) oneself; to shake a tree; beautify, boast self, go over the boughs, glorify (self), glory, vaunt self.'),
	('H6287','פְּאֵר','pᵉʼêr','peh-ayr\'','from פָּאַר; an embellishment, i.e. fancy head-dress; beauty, bonnet, goodly, ornament, tire.'),
	('H6288','פְּאֹרָה','pᵉʼôrâh','peh-o-raw\'','or פֹּרָאה; or פֻּארָה; from פָּאַר; properly, ornamentation, i.e. (plural) foliage (including the limbs) as bright green; bough, branch, sprig.'),
	('H6289','פָּארוּר','pâʼrûwr','paw-roor\'','from פָּאַר; properly, illuminated, i.e. a glow; as noun, a flush (of anxiety); blackness.'),
	('H6290','פָּארָן','Pâʼrân','paw-rawn\'','from פָּאַר; ornamental; Paran, a desert of Arabia; Paran.'),
	('H6291','פַּג','pag','pag','from an unused root meaning to be torpid, i.e.; crude; an unripe fig; green figuratively'),
	('H6292','פִּגּוּל','piggûwl','pig-gool\'','or פִּגֻּל; from an unused root meaning to stink; properly, fetid, i.e. (figuratively) unclean (ceremonially); abominable(-tion, thing).'),
	('H6293','פָּגַע','pâgaʻ','paw-gah\'','a primitive root; to impinge, by accident or violence, or (figuratively) by importunity; come (betwixt), cause to entreat, fall (upon), make intercession, intercessor, intreat, lay, light (upon), meet (together), pray, reach, run.'),
	('H6294','פֶּגַע','pegaʻ','peh\'-gah','from פָּגַע; impact (casual); chance, occurent.'),
	('H6295','פַּגְעִיאֵל','Pagʻîyʼêl','pag-ee-ale\'','from פֶּגַע and אֵל; accident of God; Pagiel, an Israelite; Pagiel.'),
	('H6296','פָּגַר','pâgar','paw-gar\'','a primitive root; to relax, i.e. become exhausted; be faint.'),
	('H6297','פֶּגֶר','peger','peh\'gher','from פָּגַר; a carcase (as limp), whether of man or beast; figuratively, an idolatrous image; carcase, corpse, dead body.'),
	('H6298','פָּגַשׁ','pâgash','paw-gash\'','a primitive root; to come in contact with, whether by accident or violence; figuratively, to concur; meet (with, together).'),
	('H6299','פָּדָה','pâdâh','paw-daw\'','a primitive root; to sever, i.e. ransom; gener. to release, preserve; [idiom] at all, deliver, [idiom] by any means, ransom, (that are to be, let be) redeem(-ed), rescue, [idiom] surely.'),
	('H6300','פְּדַהְאֵל','Pᵉdahʼêl','ped-ah-ale\'','from פָּדָה and אֵל; God has ransomed; Pedahel, an Israelite; Pedahel.'),
	('H6301','פְּדָהצוּר','Pᵉdâhtsûwr','ped-aw-tsoor\'','from פָּדָה and צוּר; a rock (i.e. God) has ransomed; Pedahtsur, an Israelite; Pedahzur.'),
	('H6302','פָּדוּי','pâdûwy','paw-doo\'ee','passive participle of פָּדָה. ransomed (and so occurring under פָּדָה); as abstractly (in plural masculine) a ransom; (that are) to be (that were) redeemed.'),
	('H6303','פָּדוֹן','Pâdôwn','paw-done\'','from פָּדָה; ransom; Padon, one of the Nethinim.; Padon.'),
	('H6304','פְּדוּת','pᵉdûwth','ped-ooth\'','or פְּדֻת; from קֵדְמָהlemma קדְמָה missing vowel, corrected to קֵדְמָה; distinction; also deliverance; division, redeem, redemption.'),
	('H6305','פְּדָיָה','Pᵉdâyâh','ped-aw-yaw\'','or פְּדָיָהוּ; from פָּדָה and יָהּ; Jah has ransomed; Pedajah, the name of six Israelites; Pedaiah.'),
	('H6306','פִּדְיוֹם','pidyôwm','pid-yome\'','or פִּדְיֹם; also פִּדְיוֹן; or פִּדְיֹן; from פָּדָה; a ransom; ransom, that were redeemed, redemption.'),
	('H6307','פַּדָּן','Paddân','pad-dawn\'','from an unused root meaning to extend; a plateau; or פַּדַּן אֲרָם; from the same and אֲרָם; the table-land of Aram; Paddan or Paddan-Aram, a region of Syria; Padan, Padan-aram.'),
	('H6308','פָּדַע','pâdaʻ','paw-dah\'','a primitive root; to retrieve; deliver.'),
	('H6309','פֶּדֶר','peder','peh\'der','from an unused root meaning to be greasy; suet; fat.'),
	('H6310','פֶּה','peh','peh','from פָּאָה; the mouth (as the means of blowing), whether literal or figurative (particularly speech); specifically edge, portion or side; adverbially (with preposition) according to; accord(-ing as, -ing to), after, appointment, assent, collar, command(-ment), [idiom] eat, edge, end, entry, [phrase] file, hole, [idiom] in, mind, mouth, part, portion, [idiom] (should) say(-ing), sentence, skirt, sound, speech, [idiom] spoken, talk, tenor, [idiom] to, [phrase] two-edged, wish, word.'),
	('H6311','פֹּה','pôh','po','or פֹּא; (Job 38:11), or פּוֹ; probably from a primitive inseparable particle \'p\' (of demonstrative force) and הוּא; this place (French ici), i.e. here or hence; here, hither, the one (other, this, that) side.'),
	('H6312','פּוּאָה','Pûwʼâh','poo-aw\'','or פֻּוָּה; from פָּאָה; a blast; Puah or Puvvah, the name of two Israelites; Phuvah, Pua, Puah.'),
	('H6313','פּוּג','pûwg','poog','a primitive root; to be sluggish; cease, be feeble, faint, be slacked.'),
	('H6314','פּוּגָה','pûwgâh','poo-gaw\'','from פּוּג; intermission; rest.'),
	('H6315','פּוּחַ','pûwach','poo\'akh','a primitive root; to puff, i.e. blow with the breath or air; hence, to fan (as a breeze), to utter, to kindle (a fire), to scoff; blow (upon), break, puff, bring into a snare, speak, utter.'),
	('H6316','פּוּט','Pûwṭ','poot','of foreign origin; Put, a son of Ham, also the name of his descendants or their region, and of a Persian tribe; Phut, Put.'),
	('H6317','פּוּטִיאֵל','Pûwṭîyʼêl','poo-tee-ale\'','from an unused root (probably meaning to disparage) and אֵל; contempt of God; Putiel, an Israelite; Putiel.'),
	('H6318','פּוֹטִיפַר','Pôwṭîyphar','po-tee-far\'','of Egyptian derivation; Potiphar, an Egyptian; Potiphar.'),
	('H6319','פּוֹטִי פֶרַע','Pôwṭîy Pheraʻ','po-tee feh\'-rah','of Egyptian derivation; Poti-Phera, an Egyptian; Poti-pherah.'),
	('H6320','פּוּךְ','pûwk','pook','from an unused root meaning to paint; dye (specifically, stibium for the eyes); fair colours, glistering, paint(-ed) (-ing).'),
	('H6321','פּוֹל','pôwl','pole','lemma פוֹל missing dagesh, corrected to פּוֹל; from an unused root meaning to be thick; a bean (as plump); beans.'),
	('H6322','פּוּל','Pûwl','pool','of foreign origin; Pul, the name of an Assyrian king and of an Ethiopian tribe; Pul.'),
	('H6323','פּוּן','pûwn','poon','a primitive root meaning to turn, i.e.; be perplexed; be distracted.'),
	('H6324','פּוּנִי','Pûwnîy','poo-nee\'','patronymically from an unused name meaning a turn; a Punite (collectively) or descendants of an unknown Pun; Punites.'),
	('H6325','פּוּנֹן','Pûwnôn','poo-none\'','from פּוּן; perplexity; Punon, a place in the Desert; Punon.'),
	('H6326','פּוּעָה','Pûwʻâh','poo-aw\'','from an unused root meaning to glitter; brilliancy; Puah, an Israelitess; Puah.'),
	('H6327','פּוּץ','pûwts','poots','a primitive root; to dash in pieces, literally or figuratively (especially to disperse); break (dash, shake) in (to) pieces, cast (abroad), disperse (selves), drive, retire, scatter (abroad), spread abroad.'),
	('H6328','פּוּק','pûwq','pook','a primitive root; to waver; stumble, move.'),
	('H6329','פּוּק','pûwq','pook','a primitive root (identical with פּוּק through the idea of dropping out; compare נְפַק); to issue, i.e. furnish; causatively, to secure; figuratively, to succeed; afford, draw out, further, get, obtain.'),
	('H6330','פּוּקָה','pûwqâh','poo-kaw\'','from פּוּק; a stumbling-block; grief.'),
	('H6331','פּוּר','pûwr','poor','a primitive root; to crush; break, bring to nought, [idiom] utterly take.'),
	('H6332','פּוּר','Pûwr','poor','also (plural) פּוּרִים; or פֻּרִים; from פּוּר; a lot (as by means of a broken piece); Pur, Purim.'),
	('H6333','פּוּרָה','pûwrâh','poo-raw\'','from פּוּר; a wine-press (as crushing the grapes); winepress.'),
	('H6334','פּוֹרָתָא','Pôwrâthâʼ','po-raw-thaw\'','of Persian origin; Poratha, a son of Haman; Poratha.'),
	('H6335','פּוּשׁ','pûwsh','poosh','a primitive root; to spread; figuratively, act proudly; grow up, be grown fat, spread selves, be scattered.'),
	('H6336','פּוּתִי','Pûwthîy','poo-thee\'','patronymically from an unused name meaning a hinge; a Puthite (collectively) or descendants of an unknown Puth; Puhites (as if from פּוּאָה).'),
	('H6337','פָּז','pâz','pawz','from פָּזַז; pure (gold); hence, gold itself (as refined); fine (pure) gold.'),
	('H6338','פָּזַז','pâzaz','paw-zaz\'','a primitive root; to refine (gold); best (gold).'),
	('H6339','פָּזַז','pâzaz','paw-zaz\'','a primitive root (identical with פָּזַז); to solidify (as if by refining); also to spring (as if separating the limbs); leap, be made strong.'),
	('H6340','פָּזַר','pâzar','paw-zar\'','a primitive root; to scatter, whether in enmity or bounty; disperse, scatter (abroad).'),
	('H6341','פַּח','pach','pakh','from פָּחַח; a (metallic) sheet (as pounded thin); also a spring net (as spread out like a lamina); gin, (thin) plate, snare.'),
	('H6342','פָּחַד','pâchad','paw-kkad\'','a primitive root; to be startled (by a sudden alarm); hence, to fear in general; be afraid, stand in awe, (be in) fear, make to shake.'),
	('H6343','פַּחַד','pachad','pakh\'-ad','from פָּחַד; a (sudden) alarm (properly, the object feared, by implication, the feeling); dread(-ful), fear, (thing) great (fear, -ly feared), terror.'),
	('H6344','פַּחַד','pachad','pakh\'-ad','the same as פַּחַד; a testicle (as a cause of shame akin to fear); stone.'),
	('H6345','פַּחְדָּה','pachdâh','pakh-daw\'','feminine of פַּחַד; alarm (i.e. awe); fear.'),
	('H6346','פֶּחָה','pechâh','peh-khaw\'','of foreign origin; a prefect (of a city or small district); captain, deputy, governor.'),
	('H6347','פֶּחָה','pechâh','peh-khaw\'','(Aramaic) corresponding to פֶּחָה; {a prefect (of a city or small district)}; captain, governor.'),
	('H6348','פָּחַז','pâchaz','paw-khaz\'','a primitive root; to bubble up or froth (as boiling water), i.e. (figuratively) to be unimportant; light.'),
	('H6349','פַּחַז','pachaz','pakh\'-az','from פָּחַז; ebullition, i.e. froth (figuratively, lust); unstable.'),
	('H6350','פַּחֲזוּת','pachăzûwth','pakh-az-ooth\'','from פָּחַז; frivolity; lightness.'),
	('H6351','פָּחַח','pâchach','paw-khakh\'','a primitive root; to batter out; but used only as denominative from פַּח,; to spread a net; be snared.'),
	('H6352','פֶּחָם','pechâm','peh-khawm\'','perhaps from an unused root probably meaning to be black; a coal, whether charred or live; coals.'),
	('H6353','פֶּחָר','pechâr','peh-khawr\'','(Aramaic) from an unused root probably meaning to fashion; a potter; potter.'),
	('H6354','פַּחַת','pachath','pakh\'-ath','probably from an unused root apparently meaning to dig; a pit, especially forcatching animals; hole, pit, snare.'),
	('H6355','פַּחַת מוֹאָב','Pachath Môwʼâb','pakh\'-ath mo-awb\'','from פַּחַת and מוֹאָב; pit of Moab; Pachath-Moab, an Israelite; Pahathmoab.'),
	('H6356','פְּחֶתֶת','pᵉchetheth','pekh-eh\'-theth','from the same as פַּחַת; a hole (by mildew in a garment); fret inward.'),
	('H6357','פִּטְדָה','piṭdâh','pit-daw\'','of foreign derivation; a gem, probably the topaz; topaz.'),
	('H6358','פָּטוּר','pâṭûwr','paw-toor\'','passive participle of פָּטַר; opened, i.e. (as noun) a bud; open.'),
	('H6359','פָּטִיר','pâṭîyr','paw-teer\'','from פָּטַר; open, i.e. unoccupied; free.'),
	('H6360','פַּטִּישׁ','paṭṭîysh','pat-teesh\'','intensively from an unused root meaning to pound; a hammer; hammer.'),
	('H6361','פַּטִּישׁ','paṭṭîysh','pat-teesh\'','(Aramaic) from a root corresponding to that of פַּטִּישׁ; a gown (as if hammered out wide); hose.'),
	('H6362','פָּטַר','pâṭar','paw-tar\'','a primitive root; to cleave or burst through, i.e. (causatively) to emit, whether literal or figurative (gape); dismiss, free, let (shoot) out, slip away.'),
	('H6363','פֶּטֶר','peṭer','peh\'-ter','or פִּטְרָה; from פָּטַר; a fissure, i.e. (concretely) firstling (as opening the matrix); firstling, openeth, such as open.'),
	('H6364','פִּי־בֶסֶת','Pîy-Beçeth','pee beh\'-seth','of Egyptian origin; Pi-Beseth, a place in Egypt; Pi-beseth.'),
	('H6365','פִּיד','pîyd','peed','from an unused root probably meaning to pierce; (figuratively) misfortune; destruction, ruin.'),
	('H6366','פֵּיָה','pêyâh','pay-aw\'','or פִּיָּה; feminine of פֶּה; an edge; (two-) edge(-d).'),
