	('H6368','פִּיחַ','pîyach','pee\'-akh','from פּוּחַ; a powder (as easily puffed away), i.e. ashes or dust; ashes.'),
	('H6369','פִּיכֹל','Pîykôl','pee-kole\'','apparently from פֶּה and כֹּל; mouth of all; Picol, a Philistine; Phichol.'),
	('H6370','פִּילֶגֶשׁ','pîylegesh','pee-leh\'-ghesh','or פִּלֶגֶשׁ; of uncertain derivation; a concubine; also (masculine) a paramour; concubine, paramour.'),
	('H6371','פִּימָה','pîymâh','pee-maw\'','probably from an unused root meaning to be plump; obesity; collops.'),
	('H6372','פִּינְחָס','Pîynᵉchâç','pee-nekh-aws\'','apparently from פֶּה and a variation of נָחָשׁ; mouth of a serpent; Pinechas, the name of three Israelites; Phinehas.'),
	('H6373','פִּינֹן','pîynôn','pee-none\'','probably the same as פּוּנֹן; Pinon, an Idumaean; Pinon.'),
	('H6374','פִּיפִיָּה','pîyphîyâh','pee-fee-yaw\'','for פֵּיָה; an edge or tooth; tooth, [idiom] two-edged.'),
	('H6375','פִּיק','pîyq','peek','from פּוּק; a tottering; smite together.'),
	('H6376','פִּישׁוֹן','Pîyshôwn','pee-shone\'','from פּוּשׁ; dispersive; Pishon, a river of Eden; Pison.'),
	('H6377','פִּיתוֹן','Pîythôwn','pee-thone\'','probably from the same as פֹּת; expansive; Pithon, an Israelite; Pithon.'),
	('H6378','פַּךְ','pak','pak','from פָּכָה; a flask (from which a liquid may flow); box, vial.'),
	('H6379','פָּכָה','pâkâh','paw-kaw\'','a primitive root; to pour; run out.'),
