	('H6411','פְּלָיָה','Pᵉlâyâh','pel-aw-yaw\'','or פְּלָאיָה; from פָּלָא and יָהּ; Jah has distinguished; Pelajah, the name of three Israelites; Pelaiah.'),
	('H6412','פָּלִיט','pâlîyṭ','paw-leet\'','or פָּלֵיט; or פָּלֵט; from פָּלַט; a refugee; (that have) escape(-d, -th), fugitive.'),
