	('H6604','פְּתוֹר','Pᵉthôwr','peth-ore\'','of foreign origin; Pethor, a place in Mesopotamia; Pethor.'),
	('H6605','פָּתַח','pâthach','paw-thakh\'','a primitive root; to open wide (literally or figuratively); specifically, to loosen, begin, plough, carve; appear, break forth, draw (out), let go free, (en-) grave(-n), loose (self), (be, be set) open(-ing), put off, ungird, unstop, have vent.'),
	('H6606','פְּתַח','pᵉthach','peth-akh\'','(Aramaic) corresponding to פָּתַח; to open; open.'),
	('H6607','פֶּתַח','pethach','peh\'-thakh','from פָּתַח; an opening (literally), i.e. door (gate) or entrance way; door, entering (in), entrance (-ry), gate, opening, place.'),
	('H6608','פֵּתַח','pêthach','pay\'-thakh','from פָּתַח; opening (figuratively) i.e. disclosure; entrance.'),
	('H6609','פְּתִחָה','pᵉthichâh','peth-ee-khaw\'','from פָּתַח; something opened, i.e. a drawn sword; drawn sword.'),
	('H6610','פִּתְחוֹן','pithchôwn','pith-khone\'','from פָּתַח; opening (the act); open(-ing).'),
	('H6611','פְּתַחְיָה','Pᵉthachyâh','peth-akh-yaw\'','from פָּתַח and יָהּ; Jah has opened; Pethachjah, the name of four Israelites; Pethakiah.'),
	('H6612','פְּתִי','pᵉthîy','peth-ee\'','or פֶּתִי; or פְּתָאִי; from פָּתָה; silly (i.e. seducible); foolish, simple(-icity, one).'),
	('H6613','פְּתַי','pᵉthay','peth-ah\'-ee','(Aramaic) from a root corresponding to פָּתָה; open, i.e. (as noun) width; breadth.'),
	('H6614','פְּתִיגִיל','pᵉthîygîyl','peth-eeg-eel\'','of uncertain derivation; probably a figured mantle forholidays; stomacher.'),
	('H6615','פְּתַיּוּת','pᵉthayûwth','peth-ah-yooth\'','from פְּתִי; silliness (i.e. seducibility); simple.'),
	('H6616','פָּתִיל','pâthîyl','paw-theel\'','from פָּתַל; twine; bound, bracelet, lace, line, ribband, thread, wire.'),
	('H6617','פָּתַל','pâthal','paw-thal\'','a primitive root; to twine, i.e. (literally) to struggle or (figuratively) be (morally) tortuous; (shew self) froward, shew self unsavoury, wrestle.'),
	('H6618','פְּתַלְתֹּל','pᵉthaltôl','peth-al-tole\'','from פָּתַל; tortuous (i.e. crafty); crooked.'),
	('H6619','פִּתֹם','Pithôm','pee-thome\'','of Egyptian derivation; Pithom, a place in Egypt; Pithom.'),
	('H6620','פֶּתֶן','pethen','peh\'-then','from an unused root meaning to twist; an asp (from its contortions); adder.'),
	('H6621','פֶּתַע','pethaʻ','peh\'-thah','from an unused root meaning to open (the eyes); (compare פִּתְאוֹם); a wink, i.e. moment(used only (with or without preposition) adverbially, quickly or unexpectedly; at an instant, suddenly, [idiom] very.'),
	('H6622','פָּתַר','pâthar','paw-thar\'','a primitive root; to open up, i.e. (figuratively) interpret (a dream); interpret(-ation, -er).'),
	('H6623','פִּתְרוֹן','pithrôwn','pith-rone\'','or פִּתְרֹן; from פָּתַר; interpretation (of a dream); interpretation.'),
	('H6624','פַּתְרוֹס','Pathrôwç','path-roce\'','of Egyptian derivation; Pathros, a part of Egypt; Pathros.'),
	('H6625','פַּתְרֻסִי','Pathruçîy','path-roo-see\'','patrial from פַּתְרוֹס; a Pathrusite, or inhabitant of Pathros; Pathrusim.'),
	('H6626','פָּתַת','pâthath','paw-thath\'','a primitive root; to open, i.e. break; participle x'),
	('H6627','צָאָה','tsâʼâh','tsaw-aw\'','from יָצָא; issue, i.e. (human) excrement; that (which) cometh from (out).'),
	('H6628','צֶאֶל','tseʼel','tseh\'-el','from an unused root meaning to be slender; the lotus tree; shady tree.'),
	('H6629','צֹאן','tsôʼn','tsone','or צאוֹן; (Psalm 144:13), from an unused root meaning to migrate; a collective name for a flock (of sheep or goats); also figuratively (of men); (small) cattle, flock ([phrase] -s), lamb ([phrase] -s), sheep(-cote, -fold, -shearer, -herds).'),
	('H6630','צַאֲנָן','Tsaʼănân','tsah-an-awn\'','from the same as צֹאן used denominatively; sheep pasture; Zaanan, a place in Palestine; Zaanan.'),
	('H6631','צֶאֱצָא','tseʼĕtsâʼ','tseh-ets-aw\'','from יָצָא; issue, i.e. produce, children; that which cometh forth (out), offspring.'),
	('H6632','צָב','tsâb','tsawb','from an unused root meaning to establish; a palanquin or canopy (as a fixture); also a species of lizard (probably as clinging fast); covered, litter, tortoise.'),
	('H6633','צָבָא','tsâbâʼ','tsaw-baw\'','a primitive root; to mass (an army or servants); assemble, fight, perform, muster, wait upon, war.'),
	('H6634','צְבָא','tsᵉbâʼ','tseb-aw\'','(Aramaic) corresponding to פִּתְרוֹן in the figurative sense of summoning one\'s wishes; to please; will, would.'),
	('H6635','צָבָא','tsâbâʼ','tsaw-baw\'','or (feminine) צְבָאָה; from צָבָא; a mass of persons (or figuratively, things), especially reg. organized forwar (an army); by implication, a campaign, literally or figuratively (specifically, hardship, worship); appointed time, ([phrase]) army, ([phrase]) battle, company, host, service, soldiers, waiting upon, war(-fare).'),
	('H6636','צְבֹאִים','Tsᵉbôʼîym','tseb-o-eem\'','or (more correctly) צְבִיִּים; or צְבִיִּם; plural of צְבִי; gazelles; Tseboim or Tsebijim, a place in Palestine; Zeboiim, Zeboim.'),
	('H6637','צֹבֵבָה','Tsôbêbâh','tso-bay-baw\'','feminine active participle of the same as צָב; the canopier (with the article); Tsobebah, an Israelitess; Zobebah.'),
	('H6638','צָבָה','tsâbâh','tsaw-baw\'','a primitive root; to amass, i.e. grow turgid; specifically, to array an army against; fight swell.'),
	('H6639','צָבֶה','tsâbeh','tsaw-beh\'','from צָבָה; turgid; swell.'),
	('H6640','צְבוּ','tsᵉbûw','tseb-oo\'','(Aramaic) from צְבָא; properly, will; concretely, an affair (as a matter of determination); purpose.'),
	('H6641','צָבוּעַ','tsâbûwaʻ','tsaw-boo\'-ah','passive participle of the same as צֶבַע; dyed (in stripes), i.e. the hyena; speckled.'),
	('H6642','צָבַט','tsâbaṭ','tsaw-bat\'','a primitive root; to grasp, i.e. hand out; reach.'),
	('H6643','צְבִי','tsᵉbîy','tseb-ee\'','from צָבָה in the sense of prominence; splendor (as conspicuous); also a gazelle (as beautiful); beautiful(-ty), glorious (-ry), goodly, pleasant, roe(-buck).'),
	('H6644','צִבְיָא','Tsibyâʼ','tsib-yaw\'','for צִבְיָּה; Tsibja, an Israelite; Zibia.'),
	('H6645','צִבְיָּה','Tsibyâh','tsib-yaw\'','for צְבִיָּה; Tsibjah, an Israelite; Zibiah.'),
	('H6646','צְבִיָּה','tsᵉbîyâh','tseb-ee-yaw\'','feminine of צְבִי; a female gazelle; roe.'),
	('H6647','צְבַע','tsᵉbaʻ','tseb-ah\'','(Aramaic) a root corresponding to that of צֶבַע; to dip; wet.'),
	('H6648','צֶבַע','tsebaʻ','tseh\'-bah','from an unused root meaning to dip (into coloring fluid); a dye; divers, colours.'),
	('H6649','צִבְעוֹן','Tsibʻôwn','tsib-one\'','from the same as צֶבַע; variegated; Tsibon, an Idumaean; Zibeon.'),
	('H6650','צְבֹעִים','Tsᵉbôʻîym','tseb-o-eem\'','plural of צָבוּעַ; hyenas; Tseboim, a place in Palestine; Zeboim.'),
	('H6651','צָבַר','tsâbar','tsaw-bar\'','a primitive root; to aggregate; gather (together), heap (up), lay up.'),
	('H6652','צִבֻּר','tsibbur','tsib-boor\'','from פַּרְעֹשׁ; a pile; heap.'),
	('H6653','צֶבֶת','tsebeth','tseh\'-beth','from an unused root apparently meaning to grip; a lock of stalks; handful.'),
	('H6654','צַד','tsad','tsad','contr. from an unused root meaning to sidle off; a side; figuratively, an adversary; (be-) side.'),
	('H6655','צַד','tsad','tsad','(Aramaic) corresponding to צַד; used adverbially (with preposition) at or upon the side of; against, concerning.'),
	('H6656','צְדָא','tsᵉdâʼ','tsed-aw\'','(Aramaic) from an unused root corresponding to צָדָה in the sense of intentness; a (sinister) design; true.'),
	('H6657','צְדָד','Tsᵉdâd','tsed-awd\'','from the same as צַד; a siding; Tsedad, a place near Palestine; Zedad.'),
	('H6658','צָדָה','tsâdâh','tsaw-daw\'','a primitive root; to chase; by implication, to desolate; destroy, hunt, lie in wait.'),
	('H6659','צָדוֹק','Tsâdôwq','tsaw-doke\'','from צָדַק; just; Tsadok, the name of eight or nine Israelites; Zadok.'),
	('H6660','צְדִיָּה','tsᵉdîyâh','tsed-ee-yaw\'','from צָדָה; (compare צְדָא); design; lying in wait.'),
	('H6661','צִדִּים','Tsiddîym','tsid-deem\'','plural of צַד; sides; Tsiddim (with the article), a place in Palestine; Ziddim.'),
	('H6662','צַדִּיק','tsaddîyq','tsad-deek\'','from צָדַק; just; just, lawful, righteous (man).'),
	('H6663','צָדַק','tsâdaq','tsaw-dak\'','a primitive root; to be (causatively, make) right (in a moral or forensic sense); cleanse, clear self, (be, do) just(-ice, -ify, -ify self), (be turn to) righteous(-ness).'),
	('H6664','צֶדֶק','tsedeq','tseh\'-dek','from צָדַק; the right (natural, moral or legal); also (abstractly) equity or (figuratively) prosperity; [idiom] even, ([idiom] that which is altogether) just(-ice), (un-)right(-eous) (cause, -ly, -ness).'),
	('H6665','צִדְקָה','tsidqâh','tsid-kaw\'','(Aramaic) corresponding to צְדָקָה; beneficence; righteousness.'),
	('H6666','צְדָקָה','tsᵉdâqâh','tsed-aw-kaw\'','from צָדַק; rightness (abstractly), subjectively (rectitude), objectively (justice), morally (virtue) or figuratively (prosperity); justice, moderately, right(-eous) (act, -ly, -ness).'),
	('H6667','צִדְקִיָּה','Tsidqîyâh','tsid-kee-yaw\'','or צִדְקִיָּהוּ; from צֶדֶק and יָהּ; right of Jah; Tsidkijah, the name of six Israelites; Zedekiah, Zidkijah.'),
	('H6668','צָהַב','tsâhab','tsaw-hab\'','a primitive root; to glitter, i.e. be golden in color; [idiom] fine.'),
	('H6669','צָהֹב','tsâhôb','tsaw-obe\'','from צָהַב; golden in color; yellow.'),
	('H6670','צָהַל','tsâhal','tsaw-hal\'','a primitive root; to gleam, i.e. (figuratively) be cheerful; by transference to sound clear (of various animal or human expressions); bellow, cry aloud (out), lift up, neigh, rejoice, make to shine, shout.'),
	('H6671','צָהַר','tsâhar','tsaw-har\'','a primitive root; to glisten; used only as denominative from יִצְהָר,; to press out oil; make oil.'),
	('H6672','צֹהַר','tsôhar','tso\'-har','from צָהַר; a light (i.e. window); dual double light, i.e. noon; midday, noon(-day, -tide), window.'),
	('H6673','צַו','tsav','tsav','or צָו; from צָוָה; an injunction; commandment, precept.'),
	('H6674','צוֹא','tsôwʼ','tso','or צֹא; from an unused root meaning to issue; soiled (as if excrementitious); filthy.'),
	('H6675','צוֹאָה','tsôwʼâh','tso-aw\'','or צֹאָה ; feminine of צוֹא; excrement; generally, dirt; figuratively, pollution; dung, filth(-iness). Marg. for חֶרֶא.'),
	('H6676','צַוַּאר','tsavvaʼr','tsav-var\'','(Aramaic) corresponding to צַוָּאר; {the back of the neck (as that on which burdens are bound)}; neck.'),
	('H6677','צַוָּאר','tsavvâʼr','tsav-vawr\'','or צַוָּר; (Nehemiah 3:5), or צַוָּרֹןlemma צַוָּרן missing vowel, corrected to צַוָּרֹן; (Song of Solomon 4:9), or (feminine) צַוָּארָה; (Micah 2:3), intensively from צוּר in the sense of binding; the back of the neck (as that on which burdens are bound); neck.'),
	('H6678','צוֹבָא','Tsôwbâʼ','tso-baw\'','or צוֹבָה; or צֹבָה; from an unused root meaning to station; a station; Zoba or Zobah, a region of Syria; Zoba, Zobah.'),
	('H6679','צוּד','tsûwd','tsood','a primitive root; also denominative from צַיִד; to lie alongside (i.e. in wait); by implication, to catch an animal (figuratively, men); to victual (for a journey); chase, hunt, sore, take (provision).'),
	('H6680','צָוָה','tsâvâh','tsaw-vaw\'','a primitive root; (intensively) to constitute, enjoin; appoint, (for-) bid, (give a) charge, (give a, give in, send with) command(-er, -ment), send a messenger, put, (set) in order.'),
	('H6681','צָוַח','tsâvach','tsaw-vakh\'','a primitive root; to screech (exultingly); shout.'),
	('H6682','צְוָחָה','tsᵉvâchâh','tsev-aw-khaw\'','from צָוַח; a screech (of anguish); cry(-ing).'),
	('H6683','צוּלָה','tsûwlâh','tsoo-law\'','from an unused root meaning to sink; an abyss (of the sea); deep.'),
	('H6684','צוּם','tsûwm','tsoom','a primitive root; to cover over (the mouth), i.e. to fast; [idiom] at all, fast.'),
	('H6685','צוֹם','tsôwm','tsome','or צֹם; from צוּם; a fast; fast(-ing).'),
	('H6686','צוּעָר','Tsûwʻâr','tsoo-awr\'','from צָעַר; small; Tsuar, an Israelite; Zuar.'),
	('H6687','צוּף','tsûwph','tsoof','a primitive root; to overflow; (make to over-) flow, swim.'),
	('H6688','צוּף','tsûwph','tsoof','from צוּף; comb of honey (from dripping); honeycomb.'),
	('H6689','צוּף','Tsûwph','tsoof','or צוֹפַי; or צִיף; from צוּף; honey-comb; Tsuph or Tsophai or Tsiph, the name of an Israelite and of a place in Palestine; Zophai, Zuph.'),
	('H6690','צוֹפַח','Tsôwphach','tso-fakh\'','from an unused root meaning to expand, breadth; Tsophach, an Israelite; Zophah.'),
	('H6691','צוֹפַר','Tsôwphar','tso-far\'','from צָפַר; departing; Tsophar, a friend of Job; Zophar.'),
	('H6692','צוּץ','tsûwts','tsoots','a primitive root; to twinkle, i.e. glance; by analogy, to blossom (figuratively, flourish); bloom, blossom, flourish, shew self.'),
	('H6693','צוּק','tsûwq','tsook','a primitive root; to compress, i.e. (figuratively) oppress, distress; constrain, distress, lie sore, (op-) press(-or), straiten.'),
	('H6694','צוּק','tsûwq','tsook','a primitive root (identical with through the idea of narrowness (of orifice)); to pour out, i.e. (figuratively) smelt, utter; be molten, pour.'),
	('H6695','צוֹק','tsôwq','tsoke','or (feminine) צוּקָה; from צוּק; a strait, i.e. (figuratively) distress; anguish, [idiom] troublous.'),
	('H6696','צוּר','tsûwr','tsoor','a primitive root; to cramp, i.e. confine (in many applications, literally and figuratively, formative or hostile); adversary, assault, beset, besiege, bind (up), cast, distress, fashion, fortify, inclose, lay siege, put up in bags.'),
	('H6697','צוּר','tsûwr','tsoor','or צֻר; from צוּר; properly, a cliff (or sharp rock, as compressed); generally, a rock or boulder; figuratively, a refuge; also an edge (as precipitous); edge, [idiom] (mighty) God (one), rock, [idiom] sharp, stone, [idiom] strength, [idiom] strong. See also בֵּית צוּר.'),
	('H6698','צוּר','Tsûwr','tsoor','the same as צוּר; rock; Tsur, the name of a Midianite and of an Israelite; Zur.'),
	('H6699','צוּרָה','tsûwrâh','tsoo-raw\'','feminine of צוּר; a rock (Job 28:10); also a form (as if pressed out); form, rock.'),
	('H6700','צוּרִיאֵל','Tsûwrîyʼêl','tsoo-ree-ale\'','from צוּר and אֵל; rock of God; Tsuriel, an Israelite; Zuriel.'),
	('H6701','צוּרִישַׁדַּי','Tsûwrîyshadday','tsoo-ree-shad-dah\'-ee','from צוּר and שַׁדַּי; rock of (the) Almighty; Tsurishaddai, an Israelite; Zurishaddai.'),
	('H6702','צוּת','tsûwth','tsooth','a primitive root; to blaze; burn.'),
	('H6703','צַח','tsach','tsakh','from צָחַח; dazzling, i.e. sunny, bright, (figuratively) evident; clear, dry, plainly, white.'),
	('H6704','צִחֶה','tsicheh','tsee-kheh\'','from an unused root meaning to glow; parched; dried up.'),
	('H6705','צָחַח','tsâchach','tsaw-khakh\'','a primitive root; to glare, i.e. be dazzling white; be whiter.'),
	('H6706','צְחִיחַ','tsᵉchîyach','tsekh-ee\'-akh','from צָחַח; glaring, i.e. exposed to the bright sun; higher place, top.'),
	('H6707','צְחִיחָה','tsᵉchîychâh','tsekh-ee-khaw\'','feminine of צְחִיחַ; a parched region, i.e. the desert; dry land.'),
	('H6708','צְחִיחִי','tsᵉchîychîy','tsekh-ee-khee\'','from צְחִיחַ; bare spot, i.e. in the glaring sun; higher place.'),
	('H6709','צַחֲנָה','tsachănâh','tsakh-an-aw\'','from an unused root meaning to putrefy; stench; ill savour.'),
	('H6710','צַחְצָחָה','tsachtsâchâh','tsakh-tsaw-khaw\'','from צָחַח; a dry place, i.e. desert; drought.'),
	('H6711','צָחַק','tsâchaq','tsaw-khak\'','a primitive root; to laugh outright (in merriment or scorn); by implication, to sport; laugh, mock, play, make sport.'),
	('H6712','צְחֹק','tsᵉchôq','tsekh-oke\'','from צָחַק; laughter (in pleasure or derision); laugh(-ed to scorn).'),
	('H6713','צַחַר','tsachar','tsakh\'-ar','from an unused root meaning to dazzle; sheen, i.e. whiteness; white.'),
	('H6714','צֹחַר','Tsôchar','tso\'-khar','from the same as צַחַר; whiteness; Tsochar, the name of a Hittite and of an Israelite; Zohar. Compare יִצְחַר.'),
	('H6715','צָחֹר','tsâchôr','tsaw-khore\'','from the same as צַחַר; white; white.'),
	('H6716','צִי','tsîy','tsee','from צָוָה; a ship (as a fixture); ship.'),
	('H6717','צִיבָא','Tsîybâʼ','tsee-baw\'','from the same as צוֹבָא; station; Tsiba, an Israelite; Ziba.'),
	('H6718','צַיִד','tsayid','tsah\'-yid','from a form of צוּד and meaning the same; the chase; also game (thus taken); (generally) lunch (especially for a journey); [idiom] catcheth, food, [idiom] hunter, (that which he took in) hunting, venison, victuals.'),
	('H6719','צַיָּד','tsayâd','tsah\'-yawd','from the same as צַיִד; a huntsman; hunter.'),
	('H6720','צֵידָה','tsêydâh','tsay-daw\'','or צֵדָה; feminine of צַיִד; food; meat, provision, venison, victuals.'),
	('H6721','צִידוֹן','Tsîydôwn','tsee-done\'','or צִידֹן; from צוּד in the sense of catching fish; fishery; Tsidon, the name of a son of Canaan, and of a place in Palestine; Sidon, Zidon.'),
	('H6722','צִידֹנִי','Tsîydônîy','tsee-do-nee\'','patrial from צִידוֹן; a Tsidonian or inhabitant of Tsidon; Sidonian, of Sidon, Zidonian.'),
	('H6723','צִיָּה','tsîyâh','tsee-yaw\'','from an unused root meaning to parch; aridity; concretely, a desert; barren, drought, dry (land, place), solitary place, wilderness.'),
	('H6724','צִיוֹן','tsîyôwn','tsee-yone\'','from the same as צִיָּה; a desert; dry place.'),
	('H6725','צִיּוּן','tsîyûwn','tsee-yoon\'','lemma צִיוּן missing dagesh, corrected to צִיּוּן; from the same as צִיָּה in the sense of conspicuousness (compare נָצַח); a monumental or guiding pillar; sign, title, waymark.'),
	('H6726','צִיּוֹן','Tsîyôwn','tsee-yone\'','the same (regularly) as צִיּוּןlemma צִיוּן missing dagesh, corrected to צִיּוּן; Tsijon (as a permanent capital), a mountain of Jerusalem; Zion.'),
	('H6727','צִיחָא','Tsîychâʼ','tsee-khaw\'','or צִחָא; as if feminine of צִחֶה; drought; Tsicha, the name of two Nethinim; Ziha.'),
	('H6728','צִיִּי','tsîyîy','tsee-ee\'','from the same as צִיָּה; a desert-dweller, i.e. nomad or wild beast; wild beast of the desert, that dwell in (inhabiting) the wilderness.'),
	('H6729','צִינֹק','tsîynôq','tsee-noke\'','from an unused root meaning to confine; the pillory; stocks.'),
	('H6730','צִיעֹר','Tsîyʻôr','tsee-ore\'','from צָעַר; small; Tsior, a place in Palestine; Zior.'),
	('H6731','צִיץ','tsîyts','tseets','or צִץ; from צוּץ; properly, glistening, i.e. a burnished plate; also a flower (as bright-colored); a wing (as gleaming in the air); blossom, flower, plate, wing.'),
	('H6732','צִיץ','Tsîyts','tseets','the same as צִיץ; bloom; Tsits, a place in Palestine; Ziz.'),
	('H6733','צִיצָה','tsîytsâh','tsee-tsaw\'','feminine of צִיץ; a flower; flower.'),
	('H6734','צִיצִת','tsîytsith','tsee-tseeth\'','feminine of צִיץ; a floral or wing-like projection, i.e. a forelock of hair, a tassel; fringe, lock.'),
	('H6735','צִיר','tsîyr','tseer','from צוּר; a hinge (as pressed in turning); also a throe (as a phys. or mental pressure); also a herald or erranddoer (as constrained by the principal); ambassador, hinge, messenger, pain, pang, sorrow. Compare צִיר.'),
	('H6736','צִיר','tsîyr','tseer','the same as צִיר; a form (of beauty; as if pressed out, i.e. carved); hence, an (idolatrous) image; beauty, idol.'),
	('H6737','צָיַר','tsâyar','tsaw-yar\'','a denominative from צִיר in the sense of ambassador; to make an errand, i.e. betake oneself; make as if...had been ambassador.'),
	('H6738','צֵל','tsêl','tsale','from צָלַל; shade, whether literal or figurative; defence, shade(-ow).'),
	('H6739','צְלָא','tsᵉlâʼ','tsel-aw\'','(Aramaic) probably corresponding to צָלַע in the sense of bowing; pray; pray.'),
	('H6740','צָלָה','tsâlâh','tsaw-law\'','a primitive root; to roast; roast.'),
	('H6741','צִלָּה','Tsillâh','tsil-law\'','feminine of צֵל; Tsillah, an antediluvian woman; Zillah.'),
	('H6742','צְלוּל','tsᵉlûwl','tsel-ool\'','from צָלַל in the sense of rolling; a (round or flattened) cake; cake.'),
	('H6743','צָלַח','tsâlach','tsaw-lakh\'','or צָלֵחַ; a primitive root; to push forward, in various senses (literal or figurative, transitive or intransitive); break out, come (mightily), go over, be good, be meet, be profitable, (cause to, effect, make to, send) prosper(-ity, -ous, -ously).'),
	('H6744','צְלַח','tsᵉlach','tsel-akh\'','(Aramaic) corresponding to צָלַח; to advance (transitive or intransitive); promote, prosper.'),
	('H6745','צֵלָחָה','tsêlâchâh','tsay-law-khaw\'','from צָלַח; something protracted or flattened out, i.e. a platter; pan.'),
	('H6746','צְלֹחִית','tsᵉlôchîyth','tsel-o-kheeth\'','from צָלַח; something prolonged or tall, i.e. a vial or salt-cellar; cruse.'),
	('H6747','צַלַּחַת','tsallachath','tsal-lakh\'-ath','from צָלַח; something advanced or deep, i.e. a bowl; figuratively, the bosom; bosom, dish.'),
	('H6748','צָלִי','tsâlîy','tsaw-lee\'','passive participle of צָלָה; roasted; roast.'),
	('H6749','צָלַל','tsâlal','tsaw-lal\'','a primitive root; properly, to tumble down, i.e. settle by awaving motion; sink. Compare צָלַל, צָלַל.'),
	('H6750','צָלַל','tsâlal','tsaw-lal\'','a primitive root (identical with through the idea of vibration); to tinkle, i.e. rattle together (as the ears in reddening with shame, or the teeth in chattering with fear); quiver, tingle.'),
	('H6751','צָלַל','tsâlal','tsaw-lal\'','a primitive root (identical with through the idea of hovering over (compare צֶלֶם)); to shade, as twilight or an opaque object; begin to be dark, shadowing.'),
	('H6752','צֵלֶל','tsêlel','tsay\'-lel','from צָלַל; shade; shadow.'),
	('H6753','צְלֶלְפּוֹנִי','Tsᵉlelpôwnîy','tsel-el-po-nee\'','from צֵלֶל and the active participle of פָּנָה; shade-facing; Tselelponi, an Israelitess; Hazelelponi (including the article).'),
	('H6754','צֶלֶם','tselem','tseh\'-lem','from an unused root meaning to shade; a phantom, i.e. (figuratively) illusion, resemblance; hence, a representative figure, especially an idol; image, vain shew.'),
	('H6755','צֶלֶם','tselem','tseh\'-lem','(Aramaic) or צְלֶם; (Aramaic), corresponding to צֶלֶם; an idolatrous figure; form, image.'),
	('H6756','צַלְמוֹן','Tsalmôwn','tsal-mone\'','from צֶלֶם; shady; Tsalmon, the name of a place in Palestine and of an Israelite; Zalmon.'),
	('H6757','צַלְמָוֶת','tsalmâveth','tsal-maw\'-veth','from צֵל and מָוֶת; shade of death, i.e. the grave (figuratively, calamity); shadow of death.'),
	('H6758','צַלְמֹנָה','Tsalmônâh','tsal-mo-naw\'','feminine of צַלְמָוֶת; shadiness; Tsalmonah, a place in the Desert; Zalmonah.'),
	('H6759','צַלְמֻנָּע','Tsalmunnâʻ','tsal-moon-naw\'','from צֵל and מָנַע; shade has been denied; Tsalmunna, a Midianite; Zalmunna.'),
	('H6760','צָלַע','tsâlaʻ','tsaw-lah\'','a primitive root; probably to curve; used only as denominative from צֵלָע,; to limp (as if one-sided); halt.'),
	('H6761','צֶלַע','tselaʻ','tseh\'-lah','from צָלַע; a limping or full (figuratively); adversity, halt(-ing).'),
	('H6762','צֶלַע','Tselaʻ','tseh\'-lah','the same as צֶלַע; Tsela, a place in Palestine; Zelah.'),
	('H6763','צֵלָע','tsêlâʻ','tsay-law\'','or (feminine) צַלְעָה; from צָלַע; a rib (as curved), literally (of the body) or figuratively (of a door, i.e. leaf); hence, a side, literally (of a person) or figuratively (of an object or the sky, i.e. quarter); architecturally, a (especially floor or ceiling) timber or plank (single or collective, i.e. a flooring); beam, board, chamber, corner, leaf, plank, rib, side (chamber).'),
	('H6764','צָלָף','Tsâlâph','tsaw-lawf\'','from an unused root of unknown meaning; Tsalaph, an Israelite; Zalaph.'),
	('H6765','צְלׇפְחָד','Tsᵉlophchâd','tsel-of-chawd\'','from the same as צָלָף and אֶחָד; Tselophchad, an Israelite; Zelophehad.'),
	('H6766','צֶלְצַח','Tseltsach','tsel-tsakh\'','from צֵל and צַח; clear shade; Tseltsach, a place in Palestine; Zelzah.'),
	('H6767','צְלָצַל','tsᵉlâtsal','tsel-aw-tsal\'','from צָלַל reduplicated; a clatter, i.e. (abstractly) whirring (of wings); (concretely) a cricket; also a harpoon (as rattling), a cymbal (as clanging); cymbal, locust, shadowing, spear.'),
	('H6768','צֶלֶק','Tseleq','tseh\'-lek','from an unused root meaning to split; fissure; Tselek, an Israelite; Zelek.'),
	('H6769','צִלְּתַי','Tsillᵉthay','tsil-leth-ah\'-ee','from the feminine of צֵל; shady; Tsillethai, the name of two Israelites; Zilthai.'),
	('H6770','צָמֵא','tsâmêʼ','tsaw-may\'','a primitive root; to thirst (literally or figuratively); (be a-, suffer) thirst(-y).'),
	('H6771','צָמֵא','tsâmêʼ','tsaw-may\'','from צָמֵא; thirsty (literally or figuratively); (that) thirst(-eth, -y).'),
	('H6772','צָמָא','tsâmâʼ','tsaw-maw\'','from צָמֵא; thirst (literally or figuratively); thirst(-y).'),
	('H6773','צִמְאָה','tsimʼâh','tsim-aw\'','feminine of צָמָא; thirst (figuratively, of libidinousnes); thirst.'),
	('H6774','צִמָּאוֹן','tsimmâʼôwn','tsim-maw-one\'','from צָמֵא; a thirsty place, i.e. desert; drought, dry ground, thirsty land.'),
	('H6775','צָמַד','tsâmad','tsaw-mad\'','a primitive root; to link, i.e. gird; figuratively, to serve, (mentally) contrive; fasten, frame, join (self).'),
	('H6776','צֶמֶד','tsemed','tseh\'-med','a yoke or team (i.e. pair); hence, an acre (i.e. day\'s task for a yoke of cattle to plough); acre, couple, [idiom] together, two (donkeys), yoke (of oxen).'),
	('H6777','צַמָּה','tsammâh','tsam-maw\'','from an unused root meaning to fasten on; a veil; locks.'),
	('H6778','צַמּוּק','tsammûwq','tsam-mook\'','from צָמַק; a cake of dried grapes; bunch (cluster) of raisins.'),
	('H6779','צָמַח','tsâmach','tsaw-makh\'','a primitive root; to sprout (transitive or intransitive, literal or figurative); bear, bring forth, (cause to, make to) bud (forth), (cause to, make to) grow (again, up), (cause to) spring (forth, up).'),
	('H6780','צֶמַח','tsemach','tseh\'-makh','from צָמַח; a sprout (usually concrete), literal or figurative; branch, bud, that which (where) grew (upon), spring(-ing).'),
