	('H6782','צַמִּים','tsammîym','tsam-meem\'','from the same as צַמָּה; a noose (as fastening); figuratively, destruction; robber.'),
	('H6783','צְמִיתֻת','tsᵉmîythuth','tsem-ee-thooth\'','or צְמִתֻת; from צָמַת; excision, i.e. destruction; used only (adverbially) with prepositional prefix to extinction, i.e. perpetually; ever.'),
	('H6784','צָמַק','tsâmaq','tsaw-mak\'','a primitive root; to dry up; dry.'),
	('H6785','צֶמֶר','tsemer','tseh\'-mer','from an unused root probably meaning to be shaggy; wool; wool(-len).'),
	('H6786','צְמָרִי','Tsᵉmârîy','tsem-aw-ree\'','patrial from an unused name of a place in Palestine; a Tsemarite or branch of the Canaanites; Zemarite.'),
	('H6787','צְמָרַיִם','Tsᵉmârayim','tsem-aw-rah\'-yim','dual of צֶמֶר; double fleece; Tsemarajim, a place in Palestine; Zemaraim.'),
	('H6788','צַמֶּרֶת','tsammereth','tsam-meh\'-reth','from the same as צֶמֶר; fleeciness, i.e. foliage; highest branch, top.'),
