	('H6790','צִן','Tsin','tseen','from an unused root meaning to prick; a crag; Tsin, a part of the Desert; Zin.'),
	('H6791','צֵן','tsên','tsane','from an unused root meaning to be prickly; a thorn; hence, a cactus-hedge; thorn.'),
	('H6792','צֹנֵא','tsônêʼ','tso-nay\'','or צֹנֶה; for צֹאן; a flock; sheep.'),
	('H6793','צִנָּה','tsinnâh','tsin-naw\'','feminine of צֵן; a hook (as pointed); also a (large) shield (as if guarding by prickliness); also cold (as piercing); buckler, cold, hook, shield, target.'),
	('H6794','צִנּוּר','tsinnûwr','tsin-noor\'','from an unused root perhaps meaning to be hollow; a culvert; gutter, water-spout.'),
	('H6795','צָנַח','tsânach','tsaw-nakh\'','a primitive root; to alight; (transitive) to cause to descend, i.e. drive down; fasten, light (from off).'),
	('H6796','צָנִין','tsânîyn','tsaw-neen\'','or צָנִן; from the same as צֵן; a thorn; thorn.'),
	('H6797','צָנִיף','tsânîyph','tsaw-neef\'','or צָנוֹף; or (feminine) צָנִיפָה; from צָנַף; a head-dress (i.e. piece of cloth wrapped around); diadem, hood, mitre.'),
	('H6798','צָנַם','tsânam','tsaw-nam\'','a primitive root; to blast or shrink; withered.'),
	('H6799','צְנָן','Tsᵉnân','tsen-awn\'','probably for צַאֲנָן; Tsenan, a place near Palestine; Zenan.'),
	('H6800','צָנַע','tsânaʻ','tsaw-nah\'','a primitive root; to humiliate; humbly, lowly.'),
	('H6801','צָנַף','tsânaph','tsaw-naf\'','a primitive root; to wrap, i.e. roll or dress; be attired, [idiom] surely, violently turn.'),
	('H6802','צְנֵפָה','tsᵉnêphâh','tsen-ay-faw\'','from צָנַף; a ball; [idiom] toss.'),
	('H6803','צִנְצֶנֶת','tsintseneth','tsin-tseh\'-neth','from the same as צֵן; a vase (probably a vial tapering at the top); pot.'),
	('H6804','צַנְתָּרָה','tsantârâh','tsan-taw-raw\'','probably from the same as צִנּוּר; a tube; pipe.'),
