	('H6808','צָעָה','tsâʻâh','tsaw-aw\'','a primitive root; to tip over (for the purpose of spilling or pouring out), i.e. (figuratively) depopulate; by implication, to imprison or conquer; (reflexive) to lie down (for coitus); captive exile, travelling, (cause to) wander(-er).'),
	('H6809','צָעִיף','tsâʻîyph','tsaw-eef\'','from an unused root meaning to wrap over; a veil; vail.'),
