	('H6811','צָעִיר','Tsâʻîyr','tsaw-eer\'','the same as צָעִיר; Tsair, a place in Idumaea; Zair.'),
	('H6812','צְעִירָה','tsᵉʻîyrâh','tseh-ee-raw\'','feminine of צָעִיר; smallness (of age), i.e. juvenility; youth.'),
	('H6813','צָעַן','tsâʻan','tsaw-an\'','a primitive root; to load up (beasts), i.e. to migrate; be taken down.'),
	('H6814','צֹעַן','Tsôʻan','tso\'-an','of Egyptian derivation; Tsoan, a place in Egypt; Zoan.'),
	('H6815','צַעֲנַנִּים','Tsaʻănannîym','tsah-an-an-neem\'','or (dual) צַעֲנַיִם; plural from צָעַן; removals; Tsaanannim or Tsaanajim, a place in Palestine; Zaannannim, Zaanaim.'),
	('H6816','צַעְצֻעַ','tsaʻtsuaʻ','tsah-tsoo\'-ah','from an unused root meaning to bestrew with carvings; sculpture; image (work).'),
	('H6817','צָעַק','tsâʻaq','tsaw-ak\'','a primitive root; to shriek; (by implication) to proclaim (an assembly); [idiom] at all, call together, cry (out), gather (selves) (together).'),
	('H6818','צַעֲקָה','tsaʻăqâh','tsah-ak-aw\'','from צָעַק; a shriek; cry(-ing).'),
	('H6819','צָעַר','tsâʻar','tsaw-ar\'','a primitive root; to be small, i.e. (figuratively) ignoble; be brought low, little one, be small.'),
	('H6820','צֹעַר','Tsôʻar','tso\'ar','from צָעַר; little; Tsoar, a place East of the Jordan; Zoar.'),
	('H6821','צָפַד','tsâphad','tsaw-fad\'','a primitive root; to adhere; cleave.'),
	('H6822','צָפָה','tsâphâh','tsaw-faw\'','a primitive root; properly, to lean forward, i.e. to peer into the distance; by implication, to observe, await; behold, espy, look up (well), wait for, (keep the) watch(-man).'),
	('H6823','צָפָה','tsâphâh','tsaw-faw\'','a primitive root (probably identical with צָפָה through the idea of expansion in outlook, transferring to action); to sheet over (especially with metal); cover, overlay.'),
	('H6824','צָפָה','tsâphâh','tsaw-faw\'','from צָפָה; an inundation (as covering); [idiom] swimmest.'),
	('H6825','צְפוֹ','Tsᵉphôw','tsef-o\'','or צְפִי; from צָפָה; observant; Tsepho or Tsephi, an Idumaean; Zephi, Zepho.'),
	('H6826','צִפּוּי','tsippûwy','tsip-poo\'-ee','from צָפָה; encasement (with metal); covering, overlaying.'),
	('H6827','צְפוֹן','Tsᵉphôwn','tsef-one\'','probably for צִפְיוֹן; Tsephon, an Israelite; Zephon.'),
	('H6828','צָפוֹן','tsâphôwn','tsaw-fone\'','or צָפֹן; from צָפַן; properly, hidden, i.e. dark; used only of the north as aquarter (gloomy and unknown); north(-ern, side, -ward, wind).'),
	('H6829','צָפוֹן','Tsâphôwn','tsaw-fone\'','the same as צָפוֹן; boreal; Tsaphon, a place in Palestine; Zaphon.'),
	('H6830','צְפוֹנִי','tsᵉphôwnîy','tsef-o-nee\'','from צָפוֹן; northern; northern.'),
	('H6831','צְפוֹנִי','Tsᵉphôwnîy','tsef-o-nee\'','patronymically from צְפוֹן; a Tsephonite, or (collectively) descendants of Tsephon; Zephonites.'),
	('H6832','צְפוּעַ','tsᵉphûwaʻ','tsef-oo\'-ah','from the same as צֶפַע; excrement (as protruded); dung.'),
	('H6833','צִפּוֹר','tsippôwr','tsip-pore\'','or צִפֹּר; from צָפַר; a little bird (as hopping); bird, fowl, sparrow.'),
	('H6834','צִפּוֹר','Tsippôwr','tsip-pore\'','the same as צִפּוֹר; Tsippor, a Moabite; Zippor.'),
	('H6835','צַפַּחַת','tsappachath','tsap-pakh\'-ath','from an unused root meaning to expand; a saucer (as flat); cruse.'),
