	('H6838','צַפִּיחִת','tsappîychith','tsap-pee-kheeth\'','from the same as צַפַּחַת; a flat thin cake; wafer.'),
	('H6839','צֹפִים','Tsôphîym','tso-feem\'','plural of active participle of צָפָה; watchers; Tsophim, a place East of the Jordan; Zophim.'),
	('H6840','צָפִין','tsâphîyn','tsaw-feen\'','from צָפַן; a treasure (as hidden); hid.'),
	('H6841','צְפִיר','tsᵉphîyr','tsef-eer\'','(Aramaic) corresponding to צָפִיר; a he-goat; he (goat).'),
	('H6842','צָפִיר','tsâphîyr','tsaw-feer\'','from צָפַר; a male goat (as prancing); (he) goat.'),
	('H6843','צְפִירָה','tsᵉphîyrâh','tsef-ee-raw\'','feminine formed like צָפִיר; a crown (as encircling the head); also a turn of affairs (i.e. mishap); diadem, morning.'),
	('H6844','צָפִית','tsâphîyth','tsaw-feeth\'','from צָפָה; a sentry; watchtower.'),
	('H6845','צָפַן','tsâphan','tsaw-fan\'','a primitive root; to hide (by covering over); by implication, to hoard or reserve; figuratively to deny; specifically (favorably) to protect, (unfavorably) to lurk; esteem, hide(-den one, self), lay up, lurk (be set) privily, (keep) secret(-ly, place).'),
	('H6846','צְפַנְיָה','Tsᵉphanyâh','tsef-an-yaw\'','or צְפַנְיָהוּ; from צָפַן and יָהּ; Jah has secreted; Tsephanjah, the name of four Israelites; Zephaniah.'),
	('H6847','צׇפְנַת פַּעְנֵחַ','Tsophnath Paʻnêach','tsof-nath\' pah-nay\'-akh','of Egyptian derivation; Tsophnath-Paneach, Joseph\'s Egyptian name; Zaphnath-paaneah.'),
	('H6848','צֶפַע','tsephaʻ','tseh\'-fah or tsiphoniy tsif-o-nee\'','from an unused root meaning to extrude; a viper (as thrusting out the tongue, i.e. hissing); adder, cockatrice.'),
	('H6849','צְפִעָה','tsᵉphiʻâh','tsef-ee-aw\'','feminine from the same as צֶפַע; an outcast thing; issue.'),
	('H6850','צָפַף','tsâphaph','tsaw-faf\'','a primitive root; to coo or chirp (as a bird); chatter, peep, whisper.'),
	('H6851','צַפְצָפָה','tsaphtsâphâh','tsaf-tsaw-faw\'','from צוּף; a willow (as growing in overflowed places); willow tree.'),
	('H6852','צָפַר','tsâphar','tsaw-far\'','a primitive root; to skip about, i.e. return; depart early.'),
	('H6853','צְפַר','tsᵉphar','tsef-ar\'','(Aramaic) corresponding to צִפּוֹר; a bird.; bird.'),
	('H6854','צְפַרְדֵּעַ','tsᵉphardêaʻ','tsef-ar-day\'-ah','from צָפַר and a word elsewhere unused meaning a swamp; a marsh-leaper, i.e. frog; frog.'),
	('H6855','צִפֹּרָה','Tsippôrâh','tsip-po-raw\'','feminine of צִפּוֹר; bird; Tsipporah, Moses\' wife; Zipporah.'),
	('H6856','צִפֹּרֶן','tsippôren','tsip-po\'-ren','from צָפַר (in the denominative sense (from צִפּוֹר) of scratching); properly, a claw, i.e. (human) nail; also the point of astyle (or pen, tipped with adamant); nail, point.'),
	('H6857','צְפַת','Tsᵉphath','tsef-ath\'','from צָפָה; watch-tower; Tsephath, a place in Palestine; Zephath.'),
	('H6858','צֶפֶת','tsepheth','tseh\'-feth','from an unused root meaning to encircle; a capital of a column; chapiter.'),
	('H6859','צְפָתָה','Tsᵉphâthâh','tsef-aw\'-thaw','the same as צְפַת; Tsephathah, a place in Palestine; Zephathah.'),
	('H6860','צִקְלַג','Tsiqlag','tsik-lag\'','or צִיקלַג; (1 Chronicles 12:1,20), of uncertain derivation; Tsiklag or Tsikelag, a place in Palestine; Ziklag.'),
	('H6861','צִקְלֹן','tsiqlôn','tsik-lone\'','from an unused root meaning to wind; a sack (as tied at the mouth); husk.'),
	('H6862','צַר','tsar','tsar','or צָר; from צָרַר; compare as in צֹר; narrow; (as a noun) a tight place (usually figuratively, i.e. trouble); also a pebble ; (transitive) an opponent (as crowding); adversary, afflicted(-tion), anguish, close, distress, enemy, flint, foe, narrow, small, sorrow, strait, tribulation, trouble.'),
	('H6863','צֵר','Tsêr','tsare','from צָרַר; rock; Tser, a place in Palestine; Zer.'),
	('H6864','צֹר','tsôr','tsore','from צוּר; a stone (as if pressed hard or to a point); (by implication, of use) a knife; flint, sharp stone.'),
	('H6865','צֹר','Tsôr','tsore','or צוֹר; the same as צֹר; a rock; Tsor, a place in Palestine; Tyre, Tyrus.'),
	('H6866','צָרַב','tsârab','tsaw-rab\'','a primitive root; to burn; burn.'),
	('H6867','צָרֶבֶת','tsârebeth','tsaw-reh\'-beth','from צוּעָר; conflagration (of fire or disease); burning, inflammation.'),
	('H6868','צְרֵדָה','Tsᵉrêdâh','tser-ay-daw\'','or צְרֵדָתָה; apparently from an unused root meaning to pierce; puncture; Tseredah, a place in Palestine; Zereda, Zeredathah.'),
	('H6869','צָרָה','tsârâh','tsaw-raw\'','feminine of צַר; tightness (i.e. figuratively, trouble); transitively, a female rival:; adversary, adversity, affliction, anguish, distress, tribulation, trouble.'),
	('H6870','צְרוּיָה','Tsᵉrûwyâh','tser-oo-yaw\'','feminine passive participle from the same as צְרִי; wounded; Tserujah, an Israelitess; Zeruiah.'),
	('H6871','צְרוּעָה','Tsᵉrûwʻâh','tser-oo-aw\'','feminine passive participle of צָרַע; leprous; Tseruah, an Israelitess; Zeruah.'),
	('H6872','צְרוֹר','tsᵉrôwr','tser-ore\'','or (shorter) צְרֹר; from צָרַר; a parcel (as packed up); also a kernel or particle (as if a package); bag, [idiom] bendeth, bundle, least grain, small stone.'),
	('H6873','צָרַח','tsârach','tsaw-rakh\'','a primitive root; to be clear (in tone, i.e. shrill), i.e. to whoop; cry, roar.'),
	('H6874','צְרִי','Tsᵉrîy','tser-ee\'','the same as צְרִי; Tseri, an Israelite; Zeri. Compare יִצְרִי.'),
	('H6875','צְרִי','tsᵉrîy','tser-ee\'','or צֳרִי; from an unused root meaning to crack (as by pressure), hence, to leak; distillation, i.e. balsam; balm.'),
	('H6876','צֹרִי','Tsôrîy','tso-ree\'','patrial from צֹר; a Tsorite or inhabitant of Tsor (i.e. Syrian); (man) of Tyre.'),
	('H6877','צְרִיחַ','tsᵉrîyach','tser-ee\'-akh','from צָרַח in the sense of clearness of vision; a citadel; high place, hold.'),
	('H6878','צֹרֶךְ','tsôrek','tso\'-rek','from an unused root meaning to need; need; need.'),
	('H6879','צָרַע','tsâraʻ','tsaw-rah\'','a primitive root; to scourge, i.e. (intransitive and figurative) to be stricken with leprosy; leper, leprous.'),
	('H6880','צִרְעָה','tsirʻâh','tsir-aw\'','from צָרַע; a wasp (as stinging); hornet.');
INSERT INTO `strongs` (`number`, `lemma`, `xlit`, `pronounce`, `description`)
VALUES
	('H6881','צׇרְעָה','Tsorʻâh','tsor-aw\'','apparently another form for צִרְעָה; Tsorah, a place in Palestine; Zareah, Zorah, Zoreah.'),
	('H6882','צׇרְעִי','Tsorʻîy','tsor-ee\'','or צׇרְעָתִי; patrial from צׇרְעָה; a Tsorite or Tsorathite, i.e. inhabitants of Tsorah; Zorites, Zareathites, Zorathites.'),
	('H6883','צָרַעַת','tsâraʻath','tsaw-rah\'-ath','from צָרַע; leprosy; leprosy.'),
	('H6884','צָרַף','tsâraph','tsaw-raf\'','a primitive root; to fuse (metal), i.e. refine (literally or figuratively); cast, (re-) fine(-er), founder, goldsmith, melt, pure, purge away, try.'),
	('H6885','צֹרְפִי','Tsôrᵉphîy','tso-ref-ee\'','from צָרַף; refiner; Tsorephi (with the article), an Israelite; goldsmith\'s.'),
	('H6886','צָרְפַת','Tsârᵉphath','tsaq-ref-ath\'','from צָרַף; refinement; Tsarephath, a place in Palestine; Zarephath.'),
	('H6887','צָרַר','tsârar','tsaw-rar\'','a primitive root; to cramp, literally or figuratively, transitive or intransitive; adversary, (be in) afflict(-ion), beseige, bind (up), (be in, bring) distress, enemy, narrower, oppress, pangs, shut up, be in a strait (trouble), vex.'),
	('H6888','צְרֵרָה','Tsᵉrêrâh','tser-ay-raw\'','apparently by erroneous transcription for צְרֵדָה; Tsererah for Tseredah; Zererath.'),
	('H6889','צֶרֶת','Tsereth','tseh\'-reth','perhaps from צָהַר; splendor; Tsereth, an Israelite; Zereth.'),
	('H6890','צֶרֶת הַשַּׁחַר','Tsereth hash-Shachar','tseh\'-reth hash-shakh\'-ar','from the same as צֶרֶת and שַׁחַר with the article interposed; splendor of the dawn; Tsereth-hash-Shachar, a place in Palestine; Zareth-shahar.'),
	('H6891','צָרְתָן','Tsârᵉthân','tsaw-reth-awn\'','perhaps for צְרֵדָה; Tsarethan, a place in Palestine; Zarthan. q'),
	('H6892','קֵא','qêʼ','kay','or קִיא; from קוֹא; vomit; vomit.'),
	('H6893','קָאַת','qâʼath','kaw-ath\'','from קוֹא; probably the pelican (from vomiting); cormorant.'),
	('H6894','קַב','qab','kab','from קָבַב; a hollow, i.e. vessel used as a (dry) measure; cab.'),
	('H6895','קָבַב','qâbab','kaw-bab\'','a primitive root; to scoop out, i.e. (figuratively) to malign or execrate (i.e. stab with words); [idiom] at all, curse.'),
	('H6896','קֵבָה','qêbâh','kay-baw\'','from קָבַב; the paunch (as a cavity) or first stomach of ruminants; maw.'),
	('H6897','קֹבָה','qôbâh','ko\'-baw','from קָבַב; the abdomen (as a cavity); belly.'),
	('H6898','קֻבָּה','qubbâh','koob-baw\'','from קָבַב; a pavilion (as a domed cavity); tent.'),
	('H6899','קִבּוּץ','qibbûwts','kib-boots\'','from קָבַץ; a throng; company.'),
	('H6900','קְבוּרָה','qᵉbûwrâh','keb-oo-raw\'','or קְבֻרָה; feminine passive participle of קָבַר; sepulture; (concretely) a sepulchre; burial, burying place, grave, sepulchre.'),
	('H6901','קָבַל','qâbal','kaw-bal\'','a primitive root; to admit, i.e. take (literally or figuratively); choose, (take) hold, receive, (under-) take.'),
	('H6902','קְבַל','qᵉbal','keb-al\'','(Aramaic) corresponding to קָבַל; to acquire; receive, take.'),
	('H6903','קְבֵל','qᵉbêl','keb-ale\'','(Aramaic) or קֳבֵל; (Aramaic), (corresponding to קָבָל; (adverbially) in front of; usually (with other particles) on account of, so as, since, hence; [phrase] according to, [phrase] as, [phrase] because, before, [phrase] for this cause, [phrase] forasmuch as, [phrase] by this means, over against, by reason of, [phrase] that, [phrase] therefore, [phrase] though, [phrase] wherefore.'),
	('H6904','קֹבֶל','qôbel','ko\'-bel','from קָבַל in the sense of confronting (as standing opposite in order to receive); a battering-ram; war.'),
	('H6905','קָבָל','qâbâl','kaw-bawl\'','from קָבַל in the sense of opposite (see קֹבֶל); the presence, i.e. (adverbially) in front of; before.'),
	('H6906','קָבַע','qâbaʻ','kaw-bah\'','a primitive root; to cover, i.e. (figuratively) defraud; rob, spoil.'),
	('H6907','קֻבַּעַת','qubbaʻath','koob-bah\'-ath','from קָבַע; a goblet (as deep like a cover); dregs.'),
	('H6908','קָבַץ','qâbats','kaw-bats\'','a primitive root; to grasp, i.e. collect; assemble (selves), gather (bring) (together, selves together, up), heap, resort, [idiom] surely, take up.'),
	('H6909','קַבְצְאֵל','Qabtsᵉʼêl','kab-tseh-ale\'','from קָבַץ and אֵל; God has gathered; Kabtseel, a place in Palestine; Kabzeel. Compare יְקַבְצְאֵל.'),
	('H6910','קְבֻצָה','qᵉbutsâh','keb-oo-tsaw\'','feminine passive participle of קָבַץ; a hoard; [idiom] gather.'),
	('H6911','קִבְצַיִם','Qibtsayim','kib-tsah\'-yim','dual from קָבַץ; a double heap; Kibtsajim, a place in Palestine; Kibzaim.'),
	('H6912','קָבַר','qâbar','kaw-bar\'','a primitive root; to inter; [idiom] in any wise, bury(-ier).'),
	('H6913','קֶבֶר','qeber','keh\'-ber','or (feminine) קִבְרָה; from קָבַר; a sepulchre; burying place, grave, sepulchre.'),
	('H6914','קִבְרוֹת הַתַּאֲוָה','Qibrôwth hat-Taʼă-vâh','kib-roth\' hat-tahav-aw\'','from the feminine plural of קֶבֶר and תַּאֲוָה with the article interposed; graves of the longing; Kibroth-hat-Taavh, a place in the Desert; Kibroth-hattaavah.'),
	('H6915','קָדַד','qâdad','kaw-dad\'','a primitive root; to shrivel up, i.e. contract or bend the body (or neck) in deference; bow (down) (the) head, stoop.'),
	('H6916','קִדָּה','qiddâh','kid-daw\'','from קָדַד; cassia bark (as in shrivelled rolls); cassia.'),
	('H6917','קָדוּם','qâdûwm','kaw-doom\'','passive participle of קָדַם; a pristine hero; ancient.'),
	('H6918','קָדוֹשׁ','qâdôwsh','kaw-doshe\'','or קָדֹשׁ; from קָדַשׁ; sacred (ceremonially or morally); (as noun) God (by eminence), an angel, a saint, a sanctuary; holy (One), saint.'),
	('H6919','קָדַח','qâdach','kaw-dakh\'','a primitive root to inflame; to inflame; burn, kindle.'),
	('H6920','קַדַּחַת','qaddachath','kad-dakh\'-ath','from קָדַח; inflammation, i.e. febrile disease; burning ague, fever.'),
	('H6921','קָדִים','qâdîym','kaw-deem\'','or קָדִם; from קָדַם; the fore or front part; hence (by orientation) the East (often adverbially, eastward, for brevity the east wind); east(-ward, wind).'),
	('H6922','קַדִּישׁ','qaddîysh','kad-deesh\'','(Aramaic) corresponding to קָדוֹשׁ.; {sacred (ceremonially or morally); (as noun) God (by eminence), an angel, a saint, a sanctuary}; holy (One), saint.'),
	('H6923','קָדַם','qâdam','kaw-dam\'','a primitive root; to project (one self), i.e. precede; hence, to anticipate, hasten, meet (usually for help); come (go, (flee)) before, [phrase] disappoint, meet, prevent.'),
	('H6924','קֶדֶם','qedem','keh\'-dem','or קֵדְמָה; from קָדַם; the front, of place (absolutely, the fore part, relatively the East) or time (antiquity); often used adverbially (before, anciently, eastward); aforetime, ancient (time), before, east (end, part, side, -ward), eternal, [idiom] ever(-lasting), forward, old, past. Compare קִדְמָה.'),
	('H6925','קֳדָם','qŏdâm','kod-awm\'','(Aramaic) or קְדָם; (Aramaic) (Daniel 7:13), corresponding to קֶדֶם; before; before, [idiom] from, [idiom] I (thought), [idiom] me, [phrase] of, [idiom] it pleased, presence.'),
	('H6926','קִדְמָה','qidmâh','kid-maw\'','feminine of קֶדֶם; the forward part (or relatively) East (often adverbially, on the east or in front); east(-ward).'),
	('H6927','קַדְמָה','qadmâh','kad-maw\'','from קָדַם; priority (in time); also used adverbially (before); afore, antiquity, former (old) estate.'),
	('H6928','קַדְמָה','qadmâh','kad-maw\'','(Aramaic) corresponding to קַדְמָה; former time; afore(-time), ago.'),
	('H6929','קֵדְמָה','Qêdᵉmâh','kayd\'-maw','lemma קדְמָה missing vowel, corrected to קֵדְמָה; from קָדַם; precedence; Kedemah, a son of Ishmael; Kedemah.'),
	('H6930','קַדְמוֹן','qadmôwn','kad-mone\'','from קָדַם; eastern; east.'),
	('H6931','קַדְמוֹנִי','qadmôwnîy','kad-mo-nee\'','or קַדְמֹנִי; from קַדְמוֹן; (of time) anterior or (of place) oriental; ancient, they that went before, east, (thing of) old.'),
	('H6932','קְדֵמוֹת','Qᵉdêmôwth','ked-ay-mothe\'','from קָדַם; beginnings; Kedemoth, a place in eastern Palestine; Kedemoth.'),
	('H6933','קַדְמַי','qadmay','kad-mah\'-ee','(Aramaic) from a root corresponding to קָדַם; first; first.'),
	('H6934','קַדְמִיאֵל','Qadmîyʼêl','kad-mee-ale\'','from קֶדֶם and אֵל; presence of God; Kadmiel, the name of three Israelites; Kadmiel.'),
	('H6935','קַדְמֹנִי','Qadmônîy','kad-mo-nee\'','the same as קַדְמוֹנִי; ancient, i.e. aboriginal; Kadmonite (collectively), the name of a tribe in Palestine; Kadmonites.'),
	('H6936','קׇדְקֹד','qodqôd','kod-kode\'','from קָדַד; the crown of the head (as the part most bowed); crown (of the head), pate, scalp, top of the head.'),
	('H6937','קָדַר','qâdar','kaw-dar\'','a primitive root; to be ashy, i.e. darkcolored; by implication, to mourn (in sackcloth or sordid garments); be black(-ish), be (make) dark(-en), [idiom] heavily, (cause to) mourn.'),
	('H6938','קֵדָר','Qêdâr','kay-dawr\'','from קָדַר; dusky (of the skin or the tent); Kedar, a son of Ishmael; also (collectively) Bedouin (as his descendants or representatives); Kedar.'),
	('H6939','קִדְרוֹן','Qidrôwn','kid-rone\'','from קָדַר; dusky place; Kidron, a brook near Jerusalem; Kidron.'),
	('H6940','קַדְרוּת','qadrûwth','kad-rooth\'','from קָדַר; duskiness; blackness.'),
	('H6941','קְדֹרַנִּית','qᵉdôrannîyth','ked-o-ran-neeth\'','adverb from קָדַר; blackish ones (i.e. in sackcloth); used adverbially, in mourning weeds; mournfully.'),
	('H6942','קָדַשׁ','qâdash','kaw-dash\'','a primitive root; to be (causatively, make, pronounce or observe as) clean (ceremonially or morally); appoint, bid, consecrate, dedicate, defile, hallow, (be, keep) holy(-er, place), keep, prepare, proclaim, purify, sanctify(-ied one, self), [idiom] wholly.'),
	('H6943','קֶדֶשׁ','Qedesh','keh\'-desh','from קָדַשׁ; a sanctum; Kedesh, the name of four places in Palestine; Kedesh.'),
	('H6944','קֹדֶשׁ','qôdesh','ko\'-desh','from קָדַשׁ; a sacred place or thing; rarely abstract, sanctity; consecrated (thing), dedicated (thing), hallowed (thing), holiness, ([idiom] most) holy ([idiom] day, portion, thing), saint, sanctuary.'),
	('H6945','קָדֵשׁ','qâdêsh','kaw-dashe\'','from קָדַשׁ; a (quasi) sacred person, i.e. (technically) a (male) devotee (by prostitution) to licentious idolatry; sodomite, unclean.'),
	('H6946','קָדֵשׁ','Qâdêsh','kaw-dashe\'','the same as קָדֵשׁ; sanctuary; Kadesh, a place in the Desert; Kadesh. Compare קָדֵשׁ בַּרְנֵעַ.'),
	('H6947','קָדֵשׁ בַּרְנֵעַ','Qâdêsh Barnêaʻ','kaw-dashe\' bar-nay\'-ah','from the same as קָדֵשׁ and an otherwise unused word (apparently compounded of a correspondent to בַּר and a derivative of נוּעַ) meaning desert of a fugitive; Kadesh of (the) Wilderness of Wandering; Kadesh-Barnea, a place in the Desert; Kadeshbarnea.'),
	('H6948','קְדֵשָׁה','qᵉdêshâh','ked-ay-shaw\'','feminine of קָדֵשׁ; a female devotee (i.e. prostitute); harlot, whore.'),
	('H6949','קָהָה','qâhâh','kaw-haw\'','a primitive root; to be dull; be set on edge, be blunt.'),
	('H6950','קָהַל','qâhal','\'kaw-hal\'','a primitive root; to convoke; assemble (selves) (together), gather (selves) (together).'),
	('H6951','קָהָל','qâhâl','kaw-hawl\'','from קָהַל; assemblage (usually concretely); assembly, company, congregation, multitude.'),
	('H6952','קְהִלָּה','qᵉhillâh','keh-hil-law\'','from קָהַל; an assemblage; assembly, congregation.'),
