	('H7075','קִנְיָן','qinyân','kin-yawn\'','from קָנָה; creation, i.e. (concretely) creatures; also acquisition, purchase, wealth; getting, goods, [idiom] with money, riches, substance.'),
	('H7076','קִנָּמוֹן','qinnâmôwn','kin-naw-mone\'','from an unused root (meaning to erect); cinnamon bark (as in upright rolls); cinnamon.'),
	('H7077','קָנַן','qânan','kaw-nan\'','a primitive root; to erect; but used only as denominative from קֵן; to nestle, i.e. build or occupy as anest; make...nest.'),
	('H7078','קֶנֶץ','qenets','keh\'-nets','from an unused root probably meaning to wrench; perversion; end.'),
	('H7079','קְנָת','Qᵉnâth','ken-awth\'','from קָנָה; possession; Kenath, a place East of the Jordan; Kenath.'),
	('H7080','קָסַם','qâçam','kaw-sam\'','a primitive root; properly, to distribute, i.e. determine by lot or magical scroll; by implication, to divine; divine(-r, -ation), prudent, soothsayer, use (divination).'),
	('H7081','קֶסֶם','qeçem','keh\'-sem','from קָסַם; a lot; also divination (including its fee), oracle; (reward of) divination, divine sentence, witchcraft.'),
