	('H7083','קֶסֶת','qeçeth','keh\'-seth','from the same as כּוֹס (or as קָשָׁה); properly, a cup, i.e. an ink-stand; inkhorn.'),
	('H7084','קְעִילָה','Qᵉʻîylâh','keh-ee-law\'','perhaps from קָלַע in the sense of enclosing; citadel; Keilah, a place in Palestine; Keilah.'),
	('H7085','קַעֲקַע','qaʻăqaʻ','kah-ak-ah\'','from the same as קוֹעַ; an incision or gash; [phrase] mark.'),
	('H7086','קְעָרָה','qᵉʻârâh','keh-aw-raw\'','probably from קָרַע; a bowl (as cut out hollow); charger, dish.'),
	('H7087','קָפָא','qâphâʼ','kaw-faw\'','a primitive root; to shrink, i.e. thicken (as unracked wine, curdled milk, clouded sky, frozen water); congeal, curdle, dark, settle.'),
	('H7088','קָפַד','qâphad','kaw-fad\'','a primitive root; to contract, i.e. roll together; cut off.'),
	('H7089','קְפָדָה','qᵉphâdâh','kef-aw-daw\'','from קָפַד; shrinking, i.e., terror; destruction.'),
	('H7090','קִפּוֹד','qippôwd','kip-pode\'','or קִפֹּדlemma קִכֹּד kaf, corrected to קִפֹּד; from קָפַד; a species of bird, perhaps the bittern (from its contracted form); bittern.'),
	('H7091','קִפּוֹז','qippôwz','kip-poze\'','from an unused root meaning to contract, i.e.; spring forward; an arrow-snake (as darting on its prey); great owl.'),
	('H7092','קָפַץ','qâphats','kaw-fats\'','a primitive root; to draw together, i.e. close; by implication, to leap (by contracting the limbs); specifically, to die (from gathering up the feet); shut (up), skip, stop, take out of the way.'),
	('H7093','קֵץ','qêts','kates','contracted from קָצַץ; an extremity; adverbially (with prepositional prefix) after; [phrase] after, (utmost) border, end, (in-) finite, [idiom] process.'),
	('H7094','קָצַב','qâtsab','kaw-tsab\'','a primitive root; to clip, or (generally) chop; cut down, shorn.'),
	('H7095','קֶצֶב','qetseb','keh\'-tseb','from קָצַב; shape (as if cut out); base (as if there cut off); bottom, size.'),
	('H7096','קָצָה','qâtsâh','kaw-tsaw\'','a primitive root; to cut off; (figuratively) to destroy; (partially) to scrape off; cut off, cut short, scrape (off).'),
	('H7097','קָצֶה','qâtseh','kaw-tseh\'','or (negative only) קֵצֶה; from קָצָה; (used in a great variety of applications and idioms; compare קֵץ); an extremity; [idiom] after, border, brim, brink, edge, end, (in-) finite, frontier, outmost coast, quarter, shore, (out-) side, [idiom] some, ut(-ter-) most (part).'),
	('H7098','קָצָה','qâtsâh','kaw-tsaw\'','feminine of קָצֶה; (used like קָצֶה); a termination; coast, corner, (selv-) edge, lowest, (uttermost) participle'),
	('H7099','קֶצֶו','qetsev','keh\'-tsev','and (feminine) קִצְוָה; from קָצָה; (used like קָצֶה, but with less variety); a limit; end, edge, uttermost participle'),
	('H7100','קֶצַח','qetsach','keh\'-tsakh','from an unused root apparently meaning to incise; fennelflower (from its pungency); fitches.'),
	('H7101','קָצִין','qâtsîyn','kaw-tseen\'','from קָצָה in the sense of determining; a magistrate (as deciding) or other leader; captain, guide, prince, ruler. Compare עֵת קָצִין.'),
	('H7102','קְצִיעָה','qᵉtsîyʻâh','kets-ee-aw\'','from קָצַע; cassia (as peeled; plural the bark); cassia.'),
	('H7103','קְצִיעָה','Qᵉtsîyʻâh','kets-ee-aw\'','the same as קְצִיעָה; Ketsiah, a daughter of Job; Kezia.'),
	('H7104','קְצִיץ','Qᵉtsîyts','kets-eets\'','from קָצַץ; abrupt; Keziz, a valley in Palestine; Keziz.'),
	('H7105','קָצִיר','qâtsîyr','kaw-tseer\'','from קָצַר; severed, i.e. harvest (as reaped), the crop, the time, the reaper, or figuratively; also a limb (of a tree, or simply foliage); bough, branch, harvest (man).'),
	('H7106','קָצַע','qâtsaʻ','kaw-tsah\'','a primitive root; to strip off, i.e. (partially) scrape; by implication, to segregate (as an angle); cause to scrape, corner.'),
	('H7107','קָצַף','qâtsaph','kaw-tsaf\'','a primitive root; to crack off, i.e. (figuratively) burst out in rage; (be) anger(-ry), displease, fret self, (provoke to) wrath (come), be wroth.'),
	('H7108','קְצַף','qᵉtsaph','kets-af\'','(Aramaic) corresponding to קָצַף; to become enraged; be furious.'),
	('H7109','קְצַף','qᵉtsaph','kets-af\'','(Aramaic) from קְצַף; rage; wrath.'),
	('H7110','קֶצֶף','qetseph','keh\'-tsef','from קָצַף; a splinter (as chipped off); figuratively, rage or strife; foam, indignation, [idiom] sore, wrath.'),
	('H7111','קְצָפָה','qᵉtsâphâh','kets-aw-faw\'','from קָצַף; a fragment; bark(-ed).'),
	('H7112','קָצַץ','qâtsats','kaw-tsats\'','a primitive root; to chop off (literally or figuratively); cut (asunder, in pieces, in sunder, off), [idiom] utmost.'),
	('H7113','קְצַץ','qᵉtsats','kets-ats\'','(Aramaic) corresponding to קָצַץ; {to chop off (literally or figuratively)}; cut off.'),
	('H7114','קָצַר','qâtsar','kaw-tsar\'','a primitive root; to dock off, i.e. curtail (transitive or intransitive, literal or figurative); especially to harvest (grass or grain); [idiom] at all, cut down, much discouraged, grieve, harvestman, lothe, mourn, reap(-er), (be, wax) short(-en, -er), straiten, trouble, vex.'),
	('H7115','קֹצֶר','qôtser','ko\'-tser','from קָצַר; shortness (of spirit), i.e. impatience; anguish.'),
	('H7116','קָצֵר','qâtsêr','kaw-tsare\'','from קָצַר; short (whether in size, number, life, strength or temper); few, hasty, small, soon.'),
	('H7117','קְצָת','qᵉtsâth','kets-awth\'','from קָצָה; a termination (literally or figuratively); also (by implication) a portion; adverbially (with prepositional prefix) after; end, part, [idiom] some.'),
	('H7118','קְצָת','qᵉtsâth','kets-awth\'','(Aramaic) corresponding to קְצָת; {a termination (literally or figuratively); also (by implication) a portion; adverbially (with prepositional prefix) after}; end, partly.'),
	('H7119','קַר','qar','kar','contracted from an unused root meaning to chill; cool; figuratively, quiet; cold, excellent (from the margin).'),
	('H7120','קֹר','qôr','kore','from the same as קַר; cold; cold.'),
	('H7121','קָרָא','qârâʼ','kaw-raw\'','a primitive root (rather identical with קָרָא through the idea of accosting a person met); to call out to (i.e. properly, address by name, but used in a wide variety of applications); bewray (self), that are bidden, call (for, forth, self, upon), cry (unto), (be) famous, guest, invite, mention, (give) name, preach, (make) proclaim(-ation), pronounce, publish, read, renowned, say.'),
	('H7122','קָרָא','qârâʼ','kaw-raw\'','a primitive root; to encounter, whether accidentally or in a hostile manner; befall, (by) chance, (cause to) come (upon), fall out, happen, meet.'),
	('H7123','קְרָא','qᵉrâʼ','ker-aw\'','(Aramaic) corresponding to קָרָא; {to call out to (i.e. properly, address by name, but used in a wide variety of applications)}; call, cry, read.'),
	('H7124','קֹרֵא','qôrêʼ','ko-ray\'','properly, active participle of קָרָא; a caller, i.e. partridge (from its cry); partridge. See also קוֹרֵא.'),
	('H7125','קִרְאָה','qirʼâh','keer-aw\'','from קָרָא; an encountering, accidental, friendly or hostile (also adverbially, opposite); [idiom] against (he come), help, meet, seek, [idiom] to, [idiom] in the way.'),
	('H7126','קָרַב','qârab','kaw-rab\'','a primitive root; to approach (causatively, bring near) for whatever purpose; (cause to) approach, (cause to) bring (forth, near), (cause to) come (near, nigh), (cause to) draw near (nigh), go (near), be at hand, join, be near, offer, present, produce, make ready, stand, take.'),
	('H7127','קְרֵב','qᵉrêb','ker-abe\'','(Aramaic) corresponding to קָרַב; {to approach (causatively, bring near) for whatever purpose}; approach, come (near, nigh), draw near.'),
	('H7128','קְרָב','qᵉrâb','ker-awb\'','from קָרַב; hostile encounter; battle, war.'),
	('H7129','קְרָב','qᵉrâb','ker-awb\'','(Aramaic) corresponding to קְרָב; {hostile encounter}; war.'),
	('H7130','קֶרֶב','qereb','keh\'-reb','from קָרַב; properly, the nearest part, i.e. the center, whether literal, figurative or adverbial (especially with preposition); [idiom] among, [idiom] before, bowels, [idiom] unto charge, [phrase] eat (up), [idiom] heart, [idiom] him, [idiom] in, inward ([idiom] -ly, part, -s, thought), midst, [phrase] out of, purtenance, [idiom] therein, [idiom] through, [idiom] within self.'),
	('H7131','קָרֵב','qârêb','kaw-rabe\'','from קָרַב; near; approach, come (near, nigh), draw near.'),
	('H7132','קְרָבָה','qᵉrâbâh','ker-aw-baw\'','from קָרַב; approach; approaching, draw near.'),
	('H7133','קׇרְבָּן','qorbân','kor-bawn\'','or קֻרְבָּן; from קָרַב; something brought near the altar, i.e. a sacrificial present; oblation, that is offered, offering.'),
	('H7134','קַרְדֹּם','qardôm','kar-dome\'','perhaps from קָדַם in the sense of striking upon; an axe; ax.'),
	('H7135','קָרָה','qârâh','kaw-raw\'','feminine of קַר; coolness; cold.'),
	('H7136','קָרָה','qârâh','kaw-raw\'','a primitive root; to light upon (chiefly by accident); causatively, to bring about; specifically, to impose timbers (for roof or floor); appoint, lay (make) beams, befall, bring, come (to pass unto), floor, (hap) was, happen (unto), meet, send good speed.'),
	('H7137','קָרֶה','qâreh','kaw-reh\'','from קָרָה; an (unfortunate) occurrence, i.e. some accidental (ceremonial) disqualification; uncleanness that chanceth.'),
	('H7138','קָרוֹב','qârôwb','kaw-robe\'','or קָרֹב; from קָרַב; near (in place, kindred or time); allied, approach, at hand, [phrase] any of kin, kinsfold(-sman), (that is) near (of kin), neighbour, (that is) next, (them that come) nigh (at hand), more ready, short(-ly).'),
	('H7139','קָרַח','qârach','kaw-rakh\'','a primitive root; to depilate; make (self) bald.'),
	('H7140','קֶרַח','qerach','keh\'-rakh','or קֹרַח; from קָרַח; ice (as if bald, i.e. smooth); hence, hail; by resemblance, rock crystal; crystal, frost, ice.'),
	('H7141','קֹרַח','Qôrach','ko\'rakh','from קָרַח; ice; Korach, the name of two Edomites and three Israelites; Korah.'),
	('H7142','קֵרֵחַ','qêrêach','kay-ray\'-akh','from קָרַח; bald (on the back of the head); bald (head).'),
	('H7143','קָרֵחַ','Qârêach','kaw-ray\'-akh','from קָרַח; bald; Kareach, an Israelite; Careah, Kareah.'),
	('H7144','קׇרְחָה','qorchâh','kor-khaw\'','or קׇרְחָא; (Ezekiel 27:31), from קָרַח; baldness; bald(-ness), [idiom] utterly.'),
	('H7145','קׇרְחִי','Qorchîy','kor-khee\'','patronymic from קֹרַח; a Korchite (collectively) or descendants of Korach; Korahite, Korathite, sons of Kore, Korhite.'),
	('H7146','קָרַחַת','qârachath','kaw-rakh\'-ath','from קָרַח; a bald spot (on the back of the head); figuratively, a threadbare spot (on the back side of the cloth); bald head, bare within.'),
	('H7147','קְרִי','qᵉrîy','ker-ee\'','from קָרָה; hostile encounter; contrary.'),
	('H7148','קָרִיא','qârîyʼ','kaw-ree\'','from קָרָא; called, i.e. select; famous, renowned.'),
	('H7149','קִרְיָא','qiryâʼ','keer-yaw\'','(Aramaic) or קִרְיָה; (Aramaic), corresponding to קִרְיָה; {building; a city}; city.'),
	('H7150','קְרִיאָה','qᵉrîyʼâh','ker-ee-aw\'','from קָרָא; a proclamation; preaching.'),
	('H7151','קִרְיָה','qiryâh','kir-yaw\'','from קָרָה in the sense of flooring, i.e.; building; a city; city.'),
