	('H7153','קִרְיַת אַרְבַּע','Qiryath ʼArbaʻ','keer-yath\' ar-bah\'','or (with the article interposed) קִרְיַת הָאַרְבַּע; (Nehemiah 11:25), from קִרְיָה and אַרְבַּע or אַרְבַּע; city of Arba, or city of the four (giants); Kirjath-Arba or Kirjath-ha-Arba, a place in Palestine; Kirjath-arba.'),
