	('H7155','קִרְיַת חֻצוֹת','Qiryath Chutsôwth','keer-yath\' khoo-tsoth\'','from קִרְיָה and the feminine plural of חוּץ; city of streets; Kirjath-Chutsoth, a place in Moab; Kirjath-huzoth.'),
	('H7156','קִרְיָתַיִם','Qiryâthayim','keer-yaw-thah\'-yim','dual of קִרְיָה; double city; Kirjathaim, the name of two placed in Palestine; Kiriathaim, Kirjathaim.'),
