	('H7158','קִרְיַת סַנָּה','Qiryath Çannâh','keer-yath\' san-naw\'','or קִרְיַת סֵפֶר; from קִרְיָה and a simpler feminine from the same as סַנְסִן, or (for the latter name) סֵפֶר; city of branches, or of a book; Kirjath-Sannah or Kirjath-Sepher, a place in Palestine; Kirjath-sannah, Kirjath-sepher.'),
	('H7159','קָרַם','qâram','kaw-ram\'','a primitive root; to cover; cover.'),
	('H7160','קָרַן','qâran','kaw-ran\'','a primitive root; to push or gore; used only as denominative from קֶרֶן,; to shoot out horns; figuratively, rays; have horns, shine.'),
	('H7161','קֶרֶן','qeren','keh\'-ren','from קָרַן; a horn (as projecting); by implication, a flask, cornet; by resemblance. an elephant\'s tooth (i.e. ivory), a corner (of the altar), a peak (of a mountain), a ray (of light); figuratively, power; [idiom] hill, horn.'),
	('H7162','קֶרֶן','qeren','keh\'-ren','(Aramaic) corresponding to קֶרֶן; a horn (literally or for sound); horn, cornet.'),
