	('H7164','קָרַס','qâraç','kaw-ras\'','a primitive root; properly, to protrude; used only as denominative from קֶרֶס (for alliteration with קָרַע),; to hunch, i.e. be hump-backed; stoop.'),
	('H7165','קֶרֶס','qereç','keh\'-res','from קָרַס; a knob or belaying-pin (from its swelling form); tache.'),
	('H7166','קַרְסֹל','qarçôl','kar-sole\'','from קָרַס; an ankle (as a protuberance or joint); foot.'),
	('H7167','קָרַע','qâraʻ','kaw-rah\'','a primitive root; to rend, literally or figuratively (revile, paint the eyes, as if enlarging them); cut out, rend, [idiom] surely, tear.'),
	('H7168','קֶרַע','qeraʻ','keh\'-rah','from קָרַע; a rag; piece, rag.'),
	('H7169','קָרַץ','qârats','kaw-rats\'','a primitive root; to pinch, i.e. (partially) to bite the lips, blink the eyes (as a gesture of malice), or (fully) to squeeze off (a piece of clay in order to mould a vessel from it); form, move, wink.'),
	('H7170','קְרַץ','qᵉrats','ker-ats\'','(Aramaic) corresponding to קֶרֶץ in the sense of a bit (to \'eat the morsels of\' any one, i.e.; chew him up (figuratively) by slander; [phrase] accuse.'),
