	('H7172','קַרְקַע','qarqaʻ','kar-kah\'','from קָרַע; floor (as if a pavement of pieces or tesseroe), of abuilding or the sea; bottom, ([idiom] one side of the) floor.'),
	('H7173','קַרְקַע','Qarqaʻ','kar-kah\'','the same as קַרְקַע; ground-floor; Karka (with the article prefix), a place in Palestine; Karkaa.'),
	('H7174','קַרְקֹר','Qarqôr','kar-kore\'','from קוּר; foundation; Karkor, a place East of the Jordan; Karkor.'),
	('H7175','קֶרֶשׁ','qeresh','keh\'-resh','from an unused root meaning to split off; a slab or plank; by implication, a deck of aship; bench, board.'),
	('H7176','קֶרֶת','qereth','keh\'-reth','from קָרָה in the sense of building; a city; city.'),
	('H7177','קַרְתָּה','Qartâh','kar-taw\'','from קֶרֶת; city; Kartah, a place in Palestine; Kartah.'),
	('H7178','קַרְתָּן','Qartân','kar-tawn\'','lemma קַרְתּן missing vowel, corrected to קַרְתָּן; from קֶרֶת; city-plot; Kartan, a place in Palestine; Kartan.'),
	('H7179','קַשׁ','qash','kash','from קָשַׁשׁ; straw (as dry); stubble.'),
	('H7180','קִשֻּׁא','qishshuʼ','kish-shoo\'','from an unused root (meaning to be hard); a cucumber (from the difficulty of digestion); cucumber.'),
	('H7181','קָשַׁב','qâshab','kaw-shab\'','a primitive root; to prick up the ears, i.e. hearken; attend, (cause to) hear(-ken), give heed, incline, mark (well), regard.'),
	('H7182','קֶשֶׁב','qesheb','keh\'-sheb','from קָשַׁב; a hearkening; [idiom] diligently, hearing, much heed, that regarded.'),
	('H7183','קַשָּׁב','qashshâb','kash-shawb\'','or קַשֻּׁב; from קָשַׁב; hearkening; attent(-ive).'),
	('H7184','קָשָׂה','qâsâh','kaw-saw\'','or קַשְׂוָה; from an unused root meaning to be round; a jug (from its shape); cover, cup.'),
	('H7185','קָשָׁה','qâshâh','kaw-shaw\'','a primitive root; properly, to be dense, i.e. tough or severe (in various applications); be cruel, be fiercer, make grievous, be ((ask a), be in, have, seem, would) hard(-en, (labour), -ly, thing), be sore, (be, make) stiff(-en, (-necked)).'),
	('H7186','קָשֶׁה','qâsheh','kaw-sheh\'','from קָשָׁה; severe (in various applications); churlish, cruel, grievous, hard((-hearted), thing), heavy, [phrase] impudent, obstinate, prevailed, rough(-ly), sore, sorrowful, stiff(necked), stubborn, [phrase] in trouble.'),
	('H7187','קְשׁוֹט','qᵉshôwṭ','kesh-ote\'','(Aramaic) or קשֹׁט; (Aramaic), corresponding to קֹשֶׁט; fidelity; truth.'),
	('H7188','קָשַׁח','qâshach','kaw-shakh\'','a primitive root; to be (causatively, make) unfeeling; harden.'),
	('H7189','קֹשֶׁט','qôsheṭ','ko\'-shet','or קֹשְׁטְ; from an unused root meaning to balance; equity (as evenly weighed), i.e. reality; truth.'),
	('H7190','קְשִׁי','qᵉshîy','kesh-ee\'','from קָשָׁה; obstinacy; stubbornness.'),
	('H7191','קִשְׁיוֹן','Qishyôwn','kish-yone\'','from קְשִׁי; hard ground; Kishjon, a place in Palestine; Kishion, Keshon.'),
	('H7192','קְשִׂיטָה','qᵉsîyṭâh','kes-ee-taw\'','from an unused root (probably meaning to weigh out); an ingot (as definitely estimated and stamped for a coin); piece of money (silver).'),
	('H7193','קַשְׂקֶשֶׂת','qasqeseth','kas-keh\'-seth','by reduplication from an unused root meaning to shale off as bark; a scale (of a fish); hence a coat of mail (as composed of or covered with jointed plates of metal); mail, scale.'),
	('H7194','קָשַׁר','qâshar','kaw-shar\'','a primitive root; to tie, physically (gird, confine, compact) or mentally (in love, league); bind (up), (make a) conspire(-acy, -ator), join together, knit, stronger, work (treason).'),
	('H7195','קֶשֶׁר','qesher','keh\'-sher','from קָשַׁר; an (unlawful) alliance; confederacy, conspiracy, treason.'),
	('H7196','קִשֻּׁר','qishshur','kish-shoor\'','from קָשַׁר; an (ornamental) girdle (for women); attire, headband.'),
	('H7197','קָשַׁשׁ','qâshash','kaw-shash\'','a primitive root; to become sapless through drought; used only as denominative from קַשׁ; to forage for straw, stubble or wood; figuratively, to assemble; gather (selves) (together).'),
	('H7198','קֶשֶׁת','qesheth','keh\'-sheth','from קָשָׁה in the original sense (of קוֹשׁ) of bending; a bow, forshooting (hence, figuratively, strength) or the iris; [idiom] arch(-er), [phrase] arrow, bow(-man, -shot).'),
	('H7199','קַשָּׁת','qashshâth','kash-shawth\'','intensive (as denominative) from קֶשֶׁת; a bowman; [idiom] archer. r'),
	('H7200','רָאָה','râʼâh','raw-aw\'','a primitive root; to see, literally or figuratively (in numerous applications, direct and implied, transitive, intransitive and causative); advise self, appear, approve, behold, [idiom] certainly, consider, discern, (make to) enjoy, have experience, gaze, take heed, [idiom] indeed, [idiom] joyfully, lo, look (on, one another, one on another, one upon another, out, up, upon), mark, meet, [idiom] be near, perceive, present, provide, regard, (have) respect, (fore-, cause to, let) see(-r, -m, one another), shew (self), [idiom] sight of others, (e-) spy, stare, [idiom] surely, [idiom] think, view, visions.'),
	('H7201','רָאָה','râʼâh','raw-aw\'','from רָאָה; a bird of prey (probably the vulture, from its sharp sight); glede. Compare דָּאָה.'),
	('H7202','רָאֶה','râʼeh','raw-eh\'','from רָאָה; seeing, i.e. experiencing; see.'),
	('H7203','רֹאֶה','rôʼeh','ro-eh\'','active participle of רָאָה; a seer (as often rendered); but also (abstractly) a vision; vision.'),
	('H7204','רֹאֵה','Rôʼêh','ro-ay\'','for רֹאֶה; prophet; Roeh, an Israelite; Haroeh (including the article).'),
	('H7205','רְאוּבֵן','Rᵉʼûwbên','reh-oo-bane\'','from the imperative of רָאָה and בֵּן; see ye a son; Reuben, a son of Jacob; Reuben.'),
	('H7206','רְאוּבֵנִי','Rᵉʼûwbênîy','reh-oob-ay-nee\'','patronymic from רְאוּבֵן; a Reubenite or descendant of Reuben; children of Reuben, Reubenites.'),
	('H7207','רַאֲוָה','raʼăvâh','rah-av-aw\'','from רָאָה; sight, i.e. satisfaction; behold.'),
	('H7208','רְאוּמָה','Rᵉʼûwmâh','reh-oo-maw\'','feminine passive participle of רָאַם; raised; Reumah, a Syrian woman; Reumah.'),
	('H7209','רְאִי','rᵉʼîy','reh-ee\'','from רָאָה; a mirror (as seen); looking glass.'),
	('H7210','רֳאִי','rŏʼîy','ro-ee\'','from רָאָה; sight, whether abstractly (vision) or concretely (a spectacle); gazingstock, look to, (that) see(-th).'),
	('H7211','רְאָיָה','Rᵉʼâyâh','reh-aw-yaw\'','from רָאָה and יָהּ; Jah has seen; Reajah, the name of three Israelites; Reaia, Reaiah.'),
	('H7212','רְאִית','rᵉʼîyth','reh-eeth\'','from רָאָה; sight; beholding.'),
	('H7213','רָאַם','râʼam','raw-am\'','a primitive root; to rise; be lifted up.'),
	('H7214','רְאֵם','rᵉʼêm','reh-ame\'','or רְאֵיםlemma רְאיֵם second vowel, corrected to רְאֵים; or רֵים; or רֵם; from רָאַם; a wild bull (from its conspicuousness); unicorn.'),
	('H7215','רָאמָה','râʼmâh','raw-maw\'','from רָאַם; something high in value, i.e. perhaps coral; coral.'),
	('H7216','רָאמוֹת','Râʼmôwth','raw-moth\'','or רָאמֹתxlit Râmôth corrected to Râʼmôth; plural of רָאמָה; heights; Ramoth, the name of two places in Palestine; Ramoth.'),
	('H7217','רֵאשׁ','rêʼsh','raysh','(Aramaic) corresponding to רֹאשׁ; the head; figuratively, the sum; chief, head, sum.'),
	('H7218','רֹאשׁ','rôʼsh','roshe','from an unused root apparently meaning to shake; the head (as most easily shaken), whether literal or figurative (in many applications, of place, time, rank, itc.); band, beginning, captain, chapiter, chief(-est place, man, things), company, end, [idiom] every (man), excellent, first, forefront, (be-)head, height, (on) high(-est part, (priest)), [idiom] lead, [idiom] poor, principal, ruler, sum, top.'),
	('H7219','רֹאשׁ','rôʼsh','roshe','or רוֹשׁ; (Deuteronomy 32:32), apparently the same as רֹאשׁ; a poisonous plant, probably the poppy (from its conspicuous head); generally poison (even of serpents); gall, hemlock, poison, venom.'),
	('H7220','רֹאשׁ','Rôʼsh','roshe','probably the same as רֹאשׁ; Rosh, the name of an Israelite and of a foreign nation; Rosh.'),
	('H7221','רִאשָׁה','riʼshâh','ree-shaw\'','from the same as רֹאשׁ; a beginning; beginning.'),
	('H7222','רֹאשָׁה','rôʼshâh','ro-shaw\'','feminine of רֹאשׁ; the head; head(-stone).'),
	('H7223','רִאשׁוֹן','riʼshôwn','ree-shone\'','or רִאשֹׁן; from רִאשָׁה; first, in place, time or rank (as adjective or noun); ancestor, (that were) before(-time), beginning, eldest, first, fore(-father) (-most), former (thing), of old time, past.'),
	('H7224','רִאשֹׁנִי','riʼshônîy','ree-sho-nee\'','from רִאשׁוֹן; first; first.'),
	('H7225','רֵאשִׁית','rêʼshîyth','ray-sheeth\'','from the same as רֹאשׁ; the first, in place, time, order or rank (specifically, a firstfruit); beginning, chief(-est), first(-fruits, part, time), principal thing.'),
	('H7226','רַאֲשֹׁת','raʼăshôth','rah-ash-oth\'','from רֹאשׁ; a pillow (being for the head); bolster.'),
	('H7227','רַב','rab','rab','by contracted from רָבַב; abundant (in quantity, size, age, number, rank, quality); (in) abound(-undance, -ant, -antly), captain, elder, enough, exceedingly, full, great(-ly, man, one), increase, long (enough, (time)), (do, have) many(-ifold, things, a time), (ship-)master, mighty, more, (too, very) much, multiply(-tude), officer, often(-times), plenteous, populous, prince, process (of time), suffice(-lent).'),
	('H7228','רַב','rab','rab','by contraction from רָבַב; (or perhaps the same as רַב); an archer; archer.'),
	('H7229','רַב','rab','rab','(Aramaic) corresponding to רַב; {abundant}; captain, chief, great, lord, master, stout.'),
	('H7230','רֹב','rôb','robe','from רָבַב; abundance (in any respect); abundance(-antly), all, [idiom] common (sort), excellent, great(-ly, -ness, number), huge, be increased, long, many, more in number, most, much, multitude, plenty(-ifully), [idiom] very (age).'),
	('H7231','רָבַב','râbab','raw-bab\'','a primitive root; (compare רָבִיב); also as denominative from רְבָבָה; properly, to cast together , i.e. increase, especially in number; to multiply by the myriad; increase, be many(-ifold), be more, multiply, ten thousands.'),
	('H7232','רָבַב','râbab','raw-bab\'','a primitive root (rather identical with רָבַב through the idea of projection); to shoot an arrow; shoot.'),
	('H7233','רְבָבָה','rᵉbâbâh','reb-aw-baw\'','from רָבַב; abundance (in number), i.e. (specifically) a myriad (whether definite or indefinite); many, million, [idiom] multiply, ten thousand.'),
	('H7234','רָבַד','râbad','raw-bad\'','a primitive root; to spread; deck.'),
	('H7235','רָבָה','râbâh','raw-baw\'','a primitive root; to increase (in whatever respect); (bring in) abundance ([idiom] -antly), [phrase] archer (by mistake for רָבַב), be in authority, bring up, [idiom] continue, enlarge, excel, exceeding(-ly), be full of, (be, make) great(-er, -ly, [idiom] -ness), grow up, heap, increase, be long, (be, give, have, make, use) many (a time), (any, be, give, give the, have) more (in number), (ask, be, be so, gather, over, take, yield) much (greater, more), (make to) multiply, nourish, plenty(-eous), [idiom] process (of time), sore, store, thoroughly, very.'),
	('H7236','רְבָה','rᵉbâh','reb-aw\'','(Aramaic) corresponding to רָבָה; {to increase (in whatever respect)}; make a great man, grow.'),
	('H7237','רַבָּה','Rabbâh','rab-baw\'','feminine of רַב; great; Rabbah, the name of two places in Palestine, East and West; Rabbah, Rabbath.'),
	('H7238','רְבוּ','rᵉbûw','reb-oo\'','(Aramaic) from a root corresponding to רָבָה; increase (of dignity); greatness, majesty.'),
	('H7239','רִבּוֹ','ribbôw','rib-bo\'','from רָבַב; or רִבּוֹא from רָבַב; a myriad, i.e. indefinitely, large number; great things, ten ((eight) -een, (for) -ty, [phrase] sixscore, [phrase] threescore, [idiom] twenty, (twen) -ty) thousand.'),
	('H7240','רִבּוֹ','ribbôw','rib-bo\'','(Aramaic) corresponding to רִבּוֹ; {a myriad, i.e. indefinitely, large number}; [idiom] ten thousand times ten thousand.'),
	('H7241','רָבִיב','râbîyb','raw-beeb\'','from רָבַב; a rain (as an accumulation of drops); shower.'),
	('H7242','רָבִיד','râbîyd','raw-beed\'','from רָבַד; a collar (as spread around the neck); chain.'),
	('H7243','רְבִיעִי','rᵉbîyʻîy','reb-ee-ee\'','or רְבִעִי; from רָבַע; fourth; also (fractionally) a fourth; foursquare, fourth (part).'),
	('H7244','רְבִיעַי','rᵉbîyʻay','reb-ee-ah\'-ee','(Aramaic) corresponding to רְבִיעִי; {fourth; also (fractionally) a fourth}; fourth.'),
	('H7245','רַבִּית','Rabbîyth','rab-beeth\'','from רָבַב; multitude; Rabbith, a place in Palestine; Rabbith.'),
	('H7246','רָבַךְ','râbak','raw-bak\'','a primitive root; to soak (bread in oil); baken, (that which is) fried.'),
	('H7247','רִבְלָה','Riblâh','rib-law\'','from an unused root meaning to be fruitful; fertile; Riblah, a place in Syria; Riblah.'),
	('H7248','רַב־מָג','Rab-Mâg','rab-mawg\'','from רַב and a foreign word for a Magian; chief Magian; Rab-Mag, a Babylonian official; Rab-mag.'),
	('H7249','רַב־סָרִיס','Rab-Çârîyç','rab-saw-reece\'','from רַב and a foreign word for a eunuch; chief chamberlain; Rab-Saris, a Babylonian official; Rab-saris.'),
	('H7250','רָבַע','râbaʻ','raw-bah\'','a primitive root; to squat or lie out flat, i.e. (specifically) in copulation; let gender, lie down.'),
	('H7251','רָבַע','râbaʻ','raw-bah\'','a primitive root (rather identical with רָבַע through the idea of sprawling \'at all fours\' (or possibly the reverse is the order of deriv.); compare אַרְבַּע); properly, to be four (sided); used only as denominative of רֶבַע; to be quadrate; (four-) square(-d).'),
	('H7252','רֶבַע','rebaʻ','reh\'-bah','from רָבַע; prostration (for sleep); lying down.'),
	('H7253','רֶבַע','rebaʻ','reh\'-bah','from רָבַע; a fourth (part or side); fourth part, side, square.'),
	('H7254','רֶבַע','Rebaʻ','reh\'-bah','the same as רֶבַע; Reba, a Midianite; Reba.'),
	('H7255','רֹבַע','rôbaʻ','ro\'-bah','from רָבַע; a quarter; fourth participle'),
	('H7256','רִבֵּעַ','ribbêaʻ','rib-bay\'-ah','from רָבַע; a descendant of the fourth generation, i.e. great great grandchild; fourth.'),
	('H7257','רָבַץ','râbats','raw-bats\'','a primitive root; to crouch (on all four legs folded, like a recumbent animal); be implication, to recline, repose, brood, lurk, imbed; crouch (down), fall down, make a fold, lay, (cause to, make to) lie (down), make to rest, sit.'),
	('H7258','רֵבֶץ','rêbets','reh\'-bets','from רָבַץ; a couch or place of repose; where each lay, lie down in, resting place.'),
	('H7259','רִבְקָה','Ribqâh','rib-kaw\'','from an unused root probably meaning to clog by tying up the fetlock; fettering (by beauty); Ribkah, the wife of Isaac; Rebekah.'),
	('H7260','רַבְרַב','rabrab','rab-rab\'','(Aramaic) from רַב; huge (in size); domineering (in character); (very) great (things).'),
	('H7261','רַבְרְבָן','rabrᵉbân','rab-reb-awn\'','(Aramaic) from רַבְרַב; a magnate; lord, prince.'),
	('H7262','רַבְשָׁקֵה','Rabshâqêh','rab-shaw-kay\'','from רַב and שָׁקָה; chief butler; Rabshakeh, a Babylonian official; Rabshakeh.'),
	('H7263','רֶגֶב','regeb','reh\'-gheb','from an unused root meaning to pile together; a lump of clay; clod.'),
	('H7264','רָגַז','râgaz','raw-gaz\'','a primitive root; to quiver (with any violent emotion, especially anger or fear); be afraid, stand in awe, disquiet, fall out, fret, move, provoke, quake, rage, shake, tremble, trouble, be wroth.'),
	('H7265','רְגַז','rᵉgaz','reg-az\'','(Aramaic) corresponding to רָגַז; {to quiver (with any violent emotion, especially anger or fear)}; provoke unto wrath.'),
	('H7266','רְגַז','rᵉgaz','reg-az\'','(Aramaic) from רְגַז; violent anger; rage.'),
	('H7267','רֹגֶז','rôgez','ro\'-ghez','from רָגַז; commotion, restlessness (of a horse), crash (of thunder), disquiet, anger; fear, noise, rage, trouble(-ing), wrath.'),
	('H7268','רַגָּז','raggâz','rag-gawz\'','intensive from רָגַז; timid; trembling.'),
	('H7269','רׇגְזָה','rogzâh','rog-zaw\'','feminine of רֹגֶז; trepidation; trembling.'),
	('H7270','רָגַל','râgal','raw-gal\'','a primitive root;  also as denominative from רֶגֶל; to walk along; but only in specifically, applications, to reconnoiter, to be atale-bearer (i.e. slander); to lead about; backbite, search, slander, (e-) spy (out), teach to go, view.'),
	('H7271','רְגַל','rᵉgal','reg-al\'','(Aramaic) corresponding to רֶגֶל; {a foot, a step; by euphemistically the pudenda}; foot.'),
	('H7272','רֶגֶל','regel','reh\'-gel','from רָגַל; a foot (as used in walking); by implication, a step; by euphemistically the pudenda; [idiom] be able to endure, [idiom] according as, [idiom] after, [idiom] coming, [idiom] follow, (broken-)foot(-ed, -stool), [idiom] great toe, [idiom] haunt, [idiom] journey, leg, [phrase] piss, [phrase] possession, time.'),
	('H7273','רַגְלִי','raglîy','rag-lee\'','from רֶגֶל; a footman (soldier); (on) foot(-man).'),
	('H7274','רֹגְלִים','Rôgᵉlîym','ro-gel-eem\'','plural of active participle of רָגַל; fullers (as tramping the cloth in washing); Rogelim, a place East of the Jordan; Rogelim.'),
	('H7275','רָגַם','râgam','raw-gam\'','a primitive root (compare רֶגֶב, רוּעַ, רָקַם); to cast together (stones), i.e. to lapidate; [idiom] certainly, stone.'),
	('H7276','רֶגֶם','Regem','reh\'-gem','from רָגַם; stoneheap; Regem, an Israelite; Regem.'),
	('H7277','רִגְמָה','rigmâh','rig-maw\'','feminine of the same as רֶגֶם; a pile (of stones), i.e. (figuratively) a throng; council.'),
	('H7278','רֶגֶם מֶלֶךְ','Regem Melek','reh\'-gem meh\'-lek','from רֶגֶם and מֶלֶךְ; king\'s heap; Regem-Melek, an Israelite; Regem-melech.'),
	('H7279','רָגַן','râgan','raw-gan\'','a primitive root; to grumble, i.e. rebel; murmur.'),
	('H7280','רָגַע','râgaʻ','raw-gah\'','a primitive root; properly, to toss violently and suddenly (the sea with waves, the skin with boils); figuratively (in a favorable manner) to settle, i.e. quiet; specifically, to wink (from the motion of the eye-lids); break, divide, find ease, be a moment, (cause, give, make to) rest, make suddenly.'),
	('H7281','רֶגַע','regaʻ','reh\'-gah','from רָגַע.; a wink (of the eyes), i.e. a very short space of time; instant, moment, space, suddenly.'),
	('H7282','רָגֵעַ','râgêaʻ','raw-gay\'-ah','from רָגַע; restful, i.e. peaceable; that are quiet.'),
	('H7283','רָגַשׁ','râgash','raw-gash\'','a primitive root; to be tumultuous; rage.'),
	('H7284','רְגַשׁ','rᵉgash','reg-ash\'','(Aramaic) corresponding to רָגַשׁ; to gather tumultuously; assemble (together).'),
	('H7285','רֶגֶשׁ','regesh','reh\'-ghesh','or (feminine) רִגְשָׁה; from רָגַשׁ; a tumultuous crowd; company, insurrection.'),
	('H7286','רָדַד','râdad','raw-dad\'','a primitive root; to tread in pieces, i.e. (figuratively) to conquer, or (specifically) to overlay; spend, spread, subdue.'),
	('H7287','רָדָה','râdâh','raw-daw\'','a primitive root; to tread down, i.e. subjugate; specifically, to crumble off; (come to, make to) have dominion, prevail against, reign, (bear, make to) rule,(-r, over), take.'),
	('H7288','רַדַּי','Radday','rad-dah\'-ee','intensive from רָדָה; domineering; Raddai, an Israelite; Raddai.'),
	('H7289','רָדִיד','râdîyd','raw-deed\'','from רָדַד in the sense of spreading; a veil (as expanded); vail, veil.'),
	('H7290','רָדַם','râdam','raw-dam\'','a primitive root; to stun, i.e. stupefy (with sleep or death); (be fast a-, be in a deep, cast into a dead, that) sleep(-er, -eth).'),
	('H7291','רָדַף','râdaph','raw-daf\'','a primitive root; to run after (usually with hostile intent; figuratively (of time) gone by); chase, put to flight, follow (after, on), hunt, (be under) persecute(-ion, -or), pursue(-r).'),
	('H7292','רָהַב','râhab','raw-hab\'','a primitive root; to urge severely, i.e. (figuratively) importune, embolden, capture, act insolently; overcome, behave self proudly, make sure, strengthen.'),
	('H7293','רַהַב','rahab','rah\'-hab','from רָהַב,; bluster(-er); proud, strength.'),
	('H7294','רַהַב','Rahab','rah\'-hab','the same as רַהַב; Rahab (i.e. boaster), an epithet of Egypt; Rahab.'),
	('H7295','רָהָב','râhâb','raw-hawb\'','from רָהַב; insolent; proud.'),
