	('H7423','רְמִיָּה','rᵉmîyâh','rem-ee-yaw\'','from רָמָה; remissness, treachery; deceit(-ful, -fully), false, guile, idle, slack, slothful.'),
	('H7424','רַמָּךְ','rammâk','ram-mawk\'','of foreign origin; a brood mare; dromedary.'),
