	('H7430','רָמַשׂ','râmas','raw-mas\'','a primitive root; properly, to glide swiftly, i.e. to crawl or move with short steps; by analogy to swarm; creep, move.'),
	('H7431','רֶמֶשׂ','remes','reh\'-mes','from רָמַשׂ; a reptile or any other rapidly moving animal; that creepeth, creeping (moving) thing.'),
	('H7432','רֶמֶת','Remeth','reh\'-meth','from רָמָה; height; Remeth, a place in Palestine; Remeth.'),
	('H7433','רָמֹת גִּלעָד','Râmôth Gilʻâd','raw-moth\' gil-awd\'','or רָמוֹת גִּלעָד; (2 Chronicles 22:5), from the plural of רָמָה and גִּלְעָד; heights of Gilad; Ramoth-Gilad, a place East of the Jordan; Ramoth-gilead, Ramoth in Gilead. See also רָאמוֹת.'),
	('H7434','רָמַת הַמִּצְפֶּה','Râmath ham-Mit-speh','raw-math\' ham-mitspeh\'','from רָמָה and מִצְפֶּה with the article interpolated; height of the watch-tower; Ramath-ham-Mitspeh, a place in Palestine; Ramath-mizpeh.'),
	('H7435','רָמָתִי','Râmâthîy','raw-maw-thee\'','patronymic of רָמָה; a Ramathite or inhabitant of Ramah; Ramathite.'),
