	('H7437','רָמַת לֶחִי','Râmath Lechîy','raw\'-math lekh\'-ee','from רָמָה and לְחִי; height of a jaw-bone; Ramath-Lechi, a place in Palestine; Ramath-lehi.'),
	('H7438','רֹן','rôn','rone','from רָנַן; a shout (of deliverance); song.'),
	('H7439','רָנָה','rânâh','raw-naw\'','a primitive root; to whiz; rattle.'),
	('H7440','רִנָּה','rinnâh','rin-naw\'','from רָנַן; properly, a creaking (or shrill sound), i.e. shout (of joy or grief); cry, gladness, joy, proclamation, rejoicing, shouting, sing(-ing), triumph.'),
	('H7441','רִנָּה','Rinnâh','rin-naw\'','the same as רִנָּה; Rinnah, an Israelite; Rinnah.'),
	('H7442','רָנַן','rânan','raw-nan\'','a primitive root; properly, to creak (or emit a stridulous sound), i.e. to shout (usually for joy); aloud for joy, cry out, be joyful (greatly, make to) rejoice, (cause to) shout (for joy), (cause to) sing (aloud, for joy, out), triumph.'),
	('H7443','רֶנֶן','renen','reh\'-nen','from רָנַן; an ostrich (from its wail); [idiom] goodly.'),
