	('H7472','רֵעִי','Rêʻîy','ray-ee\'','from רֵעַ; social; Rei, an Israelite; Rei.'),
	('H7473','רֹעִי','rôʻîy','ro-ee\'','from active participle of רָעָה; pastoral; as noun, a shepherd; shipherd.'),
