	('H7490','רְעַע','rᵉʻaʻ','reh-ah\'','(Aramaic) corresponding to רָעַע; {properly, to spoil (literally, by breaking to pieces); figuratively, to make (or be) good fornothing, i.e. bad (physically, socially or morally)}; break, bruise.'),
