	('H7504','רָפֶה','râpheh','raw-feh\'','from רָפָה; slack (in body or mind); weak. raphah, Raphah. See רָפָא, רָפָא. riphah. See רִיפָה.'),
	('H7505','רָפוּא','Râphûwʼ','raw-foo\'','passive participle of רָפָא; cured; Raphu, an Israelite; Raphu.'),
