	('H7537','רָקַב','râqab','raw-kab\'','a primitive root; to decay (as by worm-eating); rot.'),
	('H7538','רָקָב','râqâb','raw-kawb\'','from רָקַב; decay (by caries); rottenness (thing).'),
	('H7539','רִקָּבוֹן','riqqâbôwn','rik-kaw-bone\'','from רָקָב; decay (by caries); rotten.'),
	('H7540','רָקַד','râqad','raw-kad\'','a primitive root; properly, to stamp, i.e. to spring about (wildly or for joy); dance, jump, leap, skip.'),
	('H7541','רַקָּה','raqqâh','rak-kaw\'','feminine of רַק; properly, thinness, i.e. the side of the head; temple.'),
	('H7542','רַקּוֹן','Raqqôwn','rak-kone\'','from רַק; thinness; Rakkon, a place in Palestine; Rakkon.'),
	('H7543','רָקַח','râqach','raw-kakh\'','a primitive root; to perfume; apothecary, compound, make (ointment), prepare, spice.'),
	('H7544','רֶקַח','reqach','reh\'-kakh','from רָקַח; properly, perfumery, i.e. (by implication) spicery (for flavor); spiced.'),
	('H7545','רֹקַח','rôqach','ro\'-kakh','from רַקּוֹן; an aromatic; confection, ointment.'),
	('H7546','רַקָּח','raqqâch','rak-kawkh\'','from רָקַח; a male perfumer; apothecary.'),
	('H7547','רַקֻּחַ','raqquach','rak-koo\'-akh','from רָקַח; a scented substance; perfume.'),
	('H7548','רַקָּחָה','raqqâchâh','rak-kaw-khaw\'','feminine of רַקֻּחַ; a female perfumer; confectioner.'),
	('H7549','רָקִיעַ','râqîyaʻ','raw-kee\'-ah','from רָקַע; properly, an expanse, i.e. the firmament or (apparently) visible arch of the sky; firmament.'),
	('H7550','רָקִיק','râqîyq','raw-keek\'','from, רָקַק in its original sense; a thin cake; cake, wafer.'),
	('H7551','רָקַם','râqam','raw-kam\'','a primitive root; to variegate color, i.e. embroider; by implication, to fabricate; embroiderer, needlework, curiously work.'),
	('H7552','רֶקֶם','Reqem','reh\'-kem','from רָקַם; versi-color; Rekem, the name of a place in Palestine, also of a Midianite and an Israelite; Rekem.'),
	('H7553','רִקְמָה','riqmâh','rik-maw\'','from רָקַם; variegation of color; specifically, embroidery; broidered (work), divers colours, (raiment of) needlework (on both sides).'),
	('H7554','רָקַע','râqaʻ','raw-kah\'','a primitive root; to pound the earth (as a sign of passion); by analogy to expand (by hammering); by implication, to overlay (with thin sheets of metal); beat, make broad, spread abroad (forth, over, out, into plates), stamp, stretch.'),
	('H7555','רִקֻּעַ','riqquaʻ','rik-koo\'-ah','from רָקַע; beaten out, i.e. a (metallic) plate; broad.'),
	('H7556','רָקַק','râqaq','raw-kak\'','a primitive root; to spit; spit.'),
	('H7557','רַקַּת','Raqqath','rak-kath\'','from רָקַק in its original sense of diffusing; a beach (as expanded shingle); Rakkath, a place in Palestine; Rakkath.'),
	('H7558','רִשְׁיוֹן','rishyôwn','rish-yone\'','from an unused root meaning to have leave; a permit; grant.'),
	('H7559','רָשַׁם','râsham','raw-sham\'','a primitive root; to record; note.'),
	('H7560','רְשַׁם','rᵉsham','resh-am\'','(Aramaic) corresponding to רָשַׁם; {to record}; sign, write.'),
	('H7561','רָשַׁע','râshaʻ','raw-shah\'','a primitive root; to be (causatively, do or declare) wrong; by implication, to disturb, violate; condemn, make trouble, vex, be (commit, deal, depart, do) wicked(-ly, -ness).'),
	('H7562','רֶשַׁע','reshaʻ','reh\'-shah','from רָשַׁע; a wrong (especially moral); iniquity, wicked(-ness).'),
	('H7563','רָשָׁע','râshâʻ','raw-shaw\'','from רָשַׁע; morally wrong; concretely, an (actively) bad person; [phrase] condemned, guilty, ungodly, wicked (man), that did wrong.'),
	('H7564','רִשְׁעָה','rishʻâh','rish-aw\'','feminine of רֶשַׁע; wrong (especially moral); fault, wickedly(-ness).'),
	('H7565','רֶשֶׁף','resheph','reh\'-shef','from שָׂרַף; a live coal; by analogy lightning; figuratively, an arrow, (as flashing through the air); specifically, fever; arrow, (burning) coal, burning heat, [phrase] spark, hot thunderbolt.'),
	('H7566','רֶשֶׁף','Resheph','reh\'-shef','the same as רֶשֶׁף; Resheph, an Israelite; Resheph.'),
	('H7567','רָשַׁשׁ','râshash','raw-shash\'','a primitive root; to demolish; impoverish.'),
	('H7568','רֶשֶׁת','resheth','reh\'-sheth','from יָרַשׁ; a net (as catching animals); net(-work).'),
	('H7569','רַתּוֹק','rattôwq','rat-toke\'','from רָתַק; a chain; chain.'),
	('H7570','רָתַח','râthach','raw-thakh\'','a primitive root; to boil; boil.'),
	('H7571','רֶתַח','rethach','reh\'-thakh','from רָתַח; a boiling; [idiom] (boil) well.'),
	('H7572','רַתִּיקָה','rattîyqâh','rat-tee-kaw\'','from רָתַק; a chain; chain.'),
	('H7573','רָתַם','râtham','raw-tham\'','a primitive root; to yoke up (to the pole of a vehicle); bind.'),
	('H7574','רֶתֶם','rethem','reh\'-them','or רֹתֶם; from רָתַם; the Spanish broom (from its pole-like stems); juniper (tree).'),
	('H7575','רִתְמָה','Rithmâh','rith-maw\'','feminine of רֶתֶם; Rithmah, a place in the Desert; Rithmah.'),
	('H7576','רָתַק','râthaq','raw-thak\'','a primitive root; to fasten; bind.'),
	('H7577','רְתֻקָה','rᵉthuqâh','reth-oo-kaw\'','feminine passive participle of רָתַק; something fastened, i.e. a chain; chain.'),
	('H7578','רְתֵת','rᵉthêth','reth-ayth\'','for רֶטֶט; terror; trembling. �'),
	('H7579','שָׁאַב','shâʼab','sahw-ab\'','a primitive root; to bale up water; (woman to) draw(-er, water).'),
	('H7580','שָׁאַג','shâʼag','shaw-ag\'','a primitive root; to rumble or moan; [idiom] mightily, roar.'),
	('H7581','שְׁאָגָה','shᵉʼâgâh','sheh-aw-gaw\'','from שָׁאַג; a rumbling or moan; roaring.'),
	('H7582','שָׁאָה','shâʼâh','shaw-aw\'','a primitive root; to rush; by implication, to desolate; be desolate, (make a) rush(-ing), (lay) waste.'),
	('H7583','שָׁאָה','shâʼâh','shaw-aw\'','a primitive root (identical with through the idea of whirling to giddiness); to stun, i.e. (intransitively) be astonished; wonder.'),
	('H7584','שַׁאֲוָה','shaʼăvâh','shah-av-aw\'','from שָׁאָה; a tempest (as rushing); desolation.'),
	('H7585','שְׁאוֹל','shᵉʼôwl','sheh-ole\'','or שְׁאֹל; from שָׁאַל; Hades or the world of the dead (as if a subterranean retreat), including its accessories and inmates; grave, hell, pit.'),
	('H7586','שָׁאוּל','Shâʼûwl','shaw-ool\'','passive participle of שָׁאַל; asked; Shaul, the name of an Edomite and two Israelites; Saul, Shaul.'),
	('H7587','שָׁאוּלִי','Shâʼûwlîy','shaw-oo-lee\'','patronymic from שִׂטְנָה; a Shaulite or descendant of Shaul; Shaulites.'),
	('H7588','שָׁאוֹן','shâʼôwn','shaw-one\'','from שָׁאָה; uproar (as of rushing); by implication, destruction; [idiom] horrible, noise, pomp, rushing, tumult ([idiom] -uous).'),
	('H7589','שְׁאָט','shᵉʼâṭ','sheh-awt\'','from an unused root meaning to push aside; contempt; despite(-ful).'),
	('H7590','שָׁאט','shâʼṭ','shawt','for active part of שׂוּט (compare שְׁאָט); one contemning; that (which) despise(-d).'),
	('H7591','שְׁאִיָּה','shᵉʼîyâh','sheh-ee-yaw\'','from שָׁאָה; desolation; destruction.'),
	('H7592','שָׁאַל','shâʼal','shaw-al\'','or שָׁאֵל; a primitive root; to inquire; by implication, to request; by extension, to demand; ask (counsel, on), beg, borrow, lay to charge, consult, demand, desire, [idiom] earnestly, enquire, [phrase] greet, obtain leave, lend, pray, request, require, [phrase] salute, [idiom] straitly, [idiom] surely, wish.'),
	('H7593','שְׁאֵל','shᵉʼêl','sheh-ale\'','(Aramaic) corresponding to שָׁאַל; {to inquire; by implication, to request; by extension, to demand}; ask, demand, require.'),
	('H7594','שְׁאָל','Shᵉʼâl','sheh-awl\'','from שָׁאַל; request; Sheal, an Israelite; Sheal.'),
	('H7595','שְׁאֵלָא','shᵉʼêlâʼ','sheh-ay-law\'','(Aramaic) from שְׁאֵל; properly, a question (at law), i.e. judicial decision or mandate; demand.'),
	('H7596','שְׁאֵלָה','shᵉʼêlâh','sheh-ay-law\'','or שֵׁלָה; (1 Samuel 1:17), from שָׁאַל; a petition; by implication, a loan; loan, petition, request.'),
	('H7597','שְׁאַלְתִּיאֵל','Shᵉʼaltîyʼêl','sheh-al-tee-ale\'','or שַׁלְתִּיאֵל; from שָׁאַל and אֵל; I have asked God; Shealtiel, an Israelite; Shalthiel, Shealtiel.'),
	('H7598','שְׁאַלְתִּיאֵל','Shᵉʼaltîyʼêl','sheh-al-tee-ale\'','(Aramaic) corresponding to שְׁאַלְתִּיאֵל; {Shealtiel, an Israelite}; Shealtiel.'),
	('H7599','שָׁאַן','shâʼan','shaw-an\'','a primitive root; to loll, i.e. be peaceful; be at ease, be quiet, rest. See also בֵּית שְׁאָן.'),
	('H7600','שַׁאֲנָן','shaʼănân','shah-an-awn\'','from שָׁאַן; secure; in a bad sense, haughty; that is at ease, quiet, tumult. Compare שַׁלְאֲנָן.'),
	('H7601','שָׁאַס','shâʼaç','shaw-as\'','a primitive root; to plunder; spoil.'),
	('H7602','שָׁאַף','shâʼaph','shaw-af\'','a primitive root; to inhale eagerly; figuratively, to cover; by implication, to be angry; also to hasten; desire (earnestly), devour, haste, pant, snuff up, swallow up.'),
	('H7603','שְׂאֹר','sᵉʼôr','seh-ore\'','from שָׁאַר; barm or yeast-cake (as swelling by fermentation); leaven.'),
	('H7604','שָׁאַר','shâʼar','shaw-ar\'','a primitive root; properly, to swell up, i.e. be (causatively, make) redundant; leave, (be) left, let, remain, remnant, reserve, the rest.'),
	('H7605','שְׁאָר','shᵉʼâr','sheh-awr\'','from שָׁאַר; a remainder; [idiom] other, remnant, residue, rest.'),
	('H7606','שְׁאָר','shᵉʼâr','sheh-awr\'','(Aramaic) corresponding to שְׁאָר; {a remainder}; [idiom] whatsoever more, residue, rest.'),
	('H7607','שְׁאֵר','shᵉʼêr','sheh-ayr\'','from שָׁאַר; flesh (as swelling out), as living or forfood; generally food of any kind; figuratively, kindred by blood; body, flesh, food, (near) kin(-sman, -swoman), near (nigh) (of kin).'),
	('H7608','שַׁאֲרָה','shaʼărâh','shah-ar-aw\'','feminine of שְׁאֵר; female kindred by blood; near kinswomen.'),
	('H7609','שֶׁאֱרָה','Sheʼĕrâh','sheh-er-aw\'','the same as שַׁאֲרָה; Sheerah, an Israelitess; Sherah.'),
	('H7610','שְׁאָר יָשׁוּב','Shᵉʼâr Yâshûwb','sheh-awr\'yaw-shoob\'','from שְׁאָר and שׁוּב; a remnant will return; Shear-Jashub, the symbolic name of one of Isaiah\'s sons; Shear-jashub.'),
	('H7611','שְׁאֵרִית','shᵉʼêrîyth','sheh-ay-reeth\'','from שָׁאַר; a remainder or residual (surviving, final) portion; that had escaped, be left, posterity, remain(-der), remnant, residue, rest.'),
	('H7612','שֵׁאת','shêʼth','shayth','from שָׁאָה; devastation; desolation.'),
	('H7613','שְׂאֵת','sᵉʼêth','seh-ayth\'','from נָשָׂא; an elevation or leprous scab; figuratively, elation or cheerfulness; exaltation in rank or character; be accepted, dignity, excellency, highness, raise up self, rising.'),
	('H7614','שְׁבָא','Shᵉbâʼ','sheb-aw\'','of foreign origin; Sheba, the name of three early progenitors of tribes and of an Ethiopian district; Sheba, Sabeans.'),
	('H7615','שְׁבָאִי','Shᵉbâʼîy','sheb-aw-ee\'','patronymic from שְׁבָא; a Shebaite or descendant of Sheba; Sabean.'),
	('H7616','שָׁבָב','shâbâb','shaw-bawb\'','from an unused root meaning to break up; a fragment, i.e. ruin; broken in pieces.'),
	('H7617','שָׁבָה','shâbâh','shaw-baw\'','a primitive root; to transport into captivity; (bring away, carry, carry away, lead, lead away, take) captive(-s), drive (take) away.'),
	('H7618','שְׁבוּ','shᵉbûw','sheb-oo\'','from an unused root (probably identical with that of שָׁבָה through the idea of subdivision into flashes or streamers (compare שָׁבִיב) meaning to flame; a gem (from its sparkle), probably the agate; agate.'),
	('H7619','שְׁבוּאֵל','Shᵉbûwʼêl','sheb-oo-ale\'','or שׁוּבָאֵל; from שָׁבָה (abbreviated form) or שׁוּב and אֵל; captive (or returned) of God; Shebuel or Shubael, the name of two Israelites; Shebuel, Shubael.'),
	('H7620','שָׁבוּעַ','shâbûwaʻ','shaw-boo\'-ah','or שָׁבֻעַ; also (feminine) שְׁבֻעָה; properly, passive participle of שָׁבַע as a denominative of שֶׁבַע; literally, sevened, i.e. a week (specifically, of years); seven, week.'),
	('H7621','שְׁבוּעָה','shᵉbûwʻâh','sheb-oo-aw\'','feminine passive participle of שָׁבַע; properly, something sworn, i.e. an oath; curse, oath, [idiom] sworn.'),
	('H7622','שְׁבוּת','shᵉbûwth','sheb-ooth\'','or שְׁבִית; from שָׁבָה; exile, concretely, prisoners; figuratively, a former state of prosperity; captive(-ity).'),
	('H7623','שָׁבַח','shâbach','shaw-bakh\'','a primitive root; properly, to address in aloud tone, i.e. (specifically) loud; figuratively, to pacify (as if by words); commend, glory, keep in, praise, still, triumph.'),
	('H7624','שְׁבַח','shᵉbach','sheb-akh\'','(Aramaic) corresponding to שָׁבַח; to adulate, i.e. adore; praise.'),
	('H7625','שְׁבַט','shᵉbaṭ','sheb-at\'','(Aramaic) corresponding to שֵׁבֶט; a clan; tribe.'),
	('H7626','שֵׁבֶט','shêbeṭ','shay\'-bet','from an unused root probably meaning to branch off; a scion, i.e. (literally) a stick (for punishing, writing, fighting, ruling, walking, etc.) or (figuratively) a clan; [idiom] correction, dart, rod, sceptre, staff, tribe.'),
	('H7627','שְׁבָט','Shᵉbâṭ','sheb-awt\'','of foreign origin; Shebat, a Jewish month; Sebat.'),
	('H7628','שְׁבִי','shᵉbîy','sheb-ee\'','from שְׁבוּ; exiled; captured; as noun, exile (abstractly or concretely and collectively); by extension, booty; captive(-ity), prisoners, [idiom] take away, that was taken.'),
	('H7629','שֹׁבִי','Shôbîy','sho-bee\'','from שָׁבָה; captor; Shobi, an Ammonite; Shobi.'),
	('H7630','שֹׁבַי','Shôbay','sho-bah\'-ee','for שֹׁבִי; Shobai, an Israelite; Shobai.'),
	('H7631','שְׂבִיב','sᵉbîyb','seb-eeb\'','(Aramaic) corresponding to שָׁבִיב; {flame (as split into tongues)}; flame.'),
	('H7632','שָׁבִיב','shâbîyb','shaw-beeb\'','from the same as שָׁבָב; flame (as split into tongues); spark.'),
	('H7633','שִׁבְיָה','shibyâh','shib-yaw\'','feminine of שְׁבִי; exile (abstractly or concretely and collectively); captives(-ity).'),
	('H7634','שׇׁבְיָה','Shobyâh','shob-yaw\'','feminine of the same as שֹׁבִי; captivation; Shobjah, an Israelite; Shachia (from the margin).'),
	('H7635','שָׁבִיל','shâbîyl','shaw-beel\'','from the same as שֹׁבֶל; a track or passage-way (as if flowing along); path.'),
	('H7636','שָׁבִיס','shâbîyç','shaw-beece\'','from an unused root meaning to interweave; a netting for the hair; caul.'),
	('H7637','שְׁבִיעִי','shᵉbîyʻîy','sheb-ee-ee\'','or שְׁבִעִי; ordinal from שִׁבְעִים; seventh; seventh (time).'),
	('H7638','שָׂבָךְ','sâbâk','saw-bawk\'','from an unused root meaning to intwine; a netting (ornament to the capital of a column); net.'),
	('H7639','שְׂבָכָה','sᵉbâkâh','seb-aw-kaw\'','feminine of שָׂבָךְ; a net-work, i.e. (in hunting) a snare, (in architecture) a ballustrade; also a reticulated ornament to apillar; checker, lattice, network, snare, wreath(-enwork).'),
	('H7640','שֹׁבֶל','shôbel','show\'-bel','from an unused root meaning to flow; a lady\'s train (as trailing after her); leg.'),
	('H7641','שִׁבֹּל','shibbôl','shib-bole','or (feminine) שִׁבֹּלֶת; from the same as שֹׁבֶל; a stream (as flowing); also an ear of grain (as growing out); by analogy, a branch; branch, channel, ear (of corn), (water-)flood, Shibboleth. Compare סִבֹּלֶת.'),
	('H7642','שַׁבְלוּל','shablûwl','shab-lool\'','from the same as שֹׁבֶל; a snail (as if floating in its own slime); snail.'),
	('H7643','שְׂבָם','Sᵉbâm','seb-awm\'','or (feminine) שִׂבְמָה; probably from בָּשָׂם; spice; Sebam or Sibmah, a place in Moab; Shebam, Shibmah, Sibmah.'),
	('H7644','שֶׁבְנָא','Shebnâʼ','sheb-naw\'','or שֶׁבְנָה; from an unused root meaning to grow; growth; Shebna or Shebnah, an Israelite; Shebna, Shebnah.'),
	('H7645','שְׁבַנְיָה','Shᵉbanyâh','sheb-an-yaw\'','or שְׁבַנְיָהוּ; from the same as שֶׁבְנָא and יָהּ; Jah has grown (i.e. prospered); Shebanjah, the name of three or four Israelites; Shebaniah.'),
	('H7646','שָׂבַע','sâbaʻ','saw-bah\'','or שָׂבֵעַ; a primitive root; to sate, i.e. fill to satisfaction (literally or figuratively); have enough, fill (full, self, with), be (to the) full (of), have plenty of, be satiate, satisfy (with), suffice, be weary of.'),
	('H7647','שָׂבָע','sâbâʻ','saw-baw\'','from שָׂבַע; copiousness; abundance, plenteous(-ness, -ly).'),
	('H7648','שֹׂבַע','sôbaʻ','so\'-bah','from שָׂבַע; satisfaction (of food or (figuratively) joy); fill, full(-ness), satisfying, be satisfied.'),
	('H7649','שָׂבֵעַ','sâbêaʻ','saw-bay\'-ah','from שָׂבַע; satiated (in a pleasant or disagreeable sense); full (of), satisfied (with).'),
	('H7650','שָׁבַע','shâbaʻ','shaw-bah\'','a primitive root; properly to be complete, but used only as a denominative from שֶׁבַע; to seven oneself, i.e. swear (as if by repeating a declaration seven times); adjure, charge (by an oath, with an oath), feed to the full (by mistake for שָׂבַע), take an oath, [idiom] straitly, (cause to, make to) swear.'),
	('H7651','שֶׁבַע','shebaʻ','sheh\'-bah','or (masculine) (שִׁבְעָה); from שָׁבַע; a primitive cardinal number; seven (as the sacred full one); also (adverbially) seven times; by implication, a week; by extension, an indefinite number; ([phrase] by) seven(-fold),-s, (-teen, -teenth), -th, times). Compare שִׁבְעָנָה.'),
	('H7652','שֶׁבַע','shebaʻ','sheh\'-bah','the same as שֶׁבַע; seven; Sheba, the name of a place in Palestine, and of two Israelites; Sheba.'),
