	('H7884','שִׁיחוֹר לִבְנָת','Shîychôwr Libnâth','shee-khore\' lib-nawth\'','from the same as שִׁיחוֹר and לָבַן; darkish whiteness; Shichor-Libnath, a stream of Palestine; Shihor-libnath.'),
	('H7885','שַׁיִט','shayiṭ','shay\'-yit','from שׁוּט; also compare שׁוֹט; an oar; a scourge (figuratively); oar, scourge.'),
	('H7886','שִׁילֹה','Shîylôh','shee-lo\'','from שָׁלָה; tranquil; Shiloh, an epithet of the Messiah; Shiloh.'),
	('H7887','שִׁילֹה','Shîylôh','shee-lo\'','or שִׁלֹה; or שִׁילוֹ; or שִׁלוֹ; from the same as שִׁילֹה; Shiloh, a place in Palestine; Shiloh.'),
	('H7888','שִׁילוֹנִי','Shîylôwnîy','shee-lo-nee\'','or שִׁילֹנִי; or שִׁלֹנִי; from שִׁילֹה; a Shilonite or inhabitant of Shiloh; Shilonite.'),
	('H7889','שִׁימוֹן','Shîymôwn','shee-mone\'','apparently for יְשִׁימוֹן; desert; Shimon, an Israelite; Shimon.'),
	('H7890','שַׁיִן','shayin','shah\'-yin','from an unused root meaning to urinate; urine; piss.'),
	('H7891','שִׁיר','shîyr','sheer','or (the original form) שׁוּר; (1 Samuel 18:6), a primitive root (rather identical with שׁוּר through the idea of strolling minstrelsy); to sing; behold (by mistake for שׁוּר), sing(-er, -ing man, -ing woman).'),
	('H7892','שִׁיר','shîyr','sheer','or feminine שִׁירָה; from שִׁיר; a song; abstractly, singing; musical(-ick), [idiom] sing(-er, -ing), song.'),
	('H7893','שַׁיִשׁ','shayish','shah\'-yish','from an unused root meaning to bleach, i.e. whiten;  See שֵׁשׁ.; white, i.e. marble.; '),
	('H7894','שִׁישָׁא','Shîyshâʼ','shee-shaw\'','from the same as שַׁיִשׁ; whiteness; Shisha, an Israelite; Shisha.'),
	('H7895','שִׁישַׁק','Shîyshaq','shee-shak\'','or שׁוּשַׁק; of Egyptian derivation; Shishak, an Egyptian king; Shishak.'),
	('H7896','שִׁית','shîyth','sheeth','a primitive root; to place (in a very wide application); apply, appoint, array, bring, consider, lay (up), let alone, [idiom] look, make, mark, put (on), [phrase] regard, set, shew, be stayed, [idiom] take.'),
	('H7897','שִׁית','shîyth','sheeth','from שִׁית; a dress (as put on); attire.'),
	('H7898','שַׁיִת','shayith','shah\'-yith','from שִׁית; scrub or trash, i.e. wild growth of weeds or briers (as if put on the field); thorns.'),
	('H7899','שֵׂךְ','sêk','sake','from סָכַךְ in the sense of שׂוּךְ; a brier (as of a hedge); prick.'),
	('H7900','שֹׂךְ','sôk','soke','from סָכַךְ in the sense of שׂוּךְ; a booth (as interlaced); tabernacle.'),
	('H7901','שָׁכַב','shâkab','shaw-kab\'','a primitive root; to lie down (for rest, sexual connection, decease or any other purpose); [idiom] at all, cast down, (lover-)lay (self) (down), (make to) lie (down, down to sleep, still with), lodge, ravish, take rest, sleep, stay.'),
	('H7902','שְׁכָבָה','shᵉkâbâh','shek-aw-baw\'','from שָׁכַב; a lying down (of dew, or for the sexual act); [idiom] carnally, copulation, [idiom] lay, seed.'),
	('H7903','שְׁכֹבֶת','shᵉkôbeth','shek-o\'-beth','lemma שֶׁכֹבֶת first vowel, corrected to שְׁכֹבֶת; from שָׁכַב; a (sexual) lying with; [idiom] lie.'),
	('H7904','שָׁכָה','shâkâh','shaw-kaw\'','a primitive root; to roam (through lust); in the morning (by mistake for שָׁכַם).'),
	('H7905','שֻׂכָּה','sukkâh','sook-kaw\'','feminine of שֹׂךְ in the sense of שֵׂךְ; a dart (as pointed like a thorn); barbed iron.'),
	('H7906','שֵׂכוּ','Sêkûw','say\'-koo','from an unused root apparently meaning to surmount; an observatory (with the article); Seku, a place in Palestine; Sechu.'),
	('H7907','שֶׂכְוִי','sekvîy','sek-vee\'','from the same as שֵׂכוּ; observant, i.e. (concretely) the mind; heart.'),
	('H7908','שְׁכוֹל','shᵉkôwl','shek-ole\'','infinitive of שָׁכֹל; bereavement; loss of children, spoiling.'),
	('H7909','שַׁכּוּל','shakkûwl','shak-kool\'','or שַׁכֻּל; from שָׁכֹל; bereaved; barren, bereaved (robbed) of children (whelps).'),
	('H7910','שִׁכּוֹר','shikkôwr','shik-kore\'','or שִׁכֹּר; from שָׁכַר; intoxicated, as astate or a habit; drunk(-ard, -en, -en man).'),
	('H7911','שָׁכַח','shâkach','shaw-kakh\'','or שָׁכֵחַ; a primitive root; to mislay, i.e. to be oblivious of, from want of memory or attention; [idiom] at all, (cause to) forget.'),
	('H7912','שְׁכַח','shᵉkach','shek-akh\'','(Aramaic) corresponding to שָׁכַח through the idea of disclosure of a covered or forgotten thing; to discover (literally or figuratively); find.'),
	('H7913','שָׁכֵחַ','shâkêach','shaw-kay\'-akh','from שָׁכַח; oblivious; forget.'),
	('H7914','שְׂכִיָּה','sᵉkîyâh','sek-ee-yaw\'','feminine from the same as שֵׂכוּ; a conspicuous object; picture.'),
	('H7915','שַׂכִּין','sakkîyn','sak-keen\'','intensive perhaps from the same as שֵׂכוּ in the sense of שׂוּךְ; a knife (as pointed or edged); knife.'),
	('H7916','שָׂכִיר','sâkîyr','saw-keer\'','from שָׂכַר; a man at wages  by the day or year; hired (man, servant), hireling.'),
	('H7917','שְׂכִירָה','sᵉkîyrâh','sek-ee-raw\'','feminine of שָׂכִיר; a hiring; that is hired.'),
	('H7918','שָׁכַךְ','shâkak','shaw-kak\'','a primitive root; to weave (i.e. lay) a trap; figuratively, (through the idea of secreting) to allay (passions; physically, abate a flood); appease, assuage, make to cease, pacify, set.'),
	('H7919','שָׂכַל','sâkal','saw-kal\'','a primitive root; to be (causatively, make or act) circumspect and hence, intelligent; consider, expert, instruct, prosper, (deal) prudent(-ly), (give) skill(-ful), have good success, teach, (have, make to) understand(-ing), wisdom, (be, behave self, consider, make) wise(-ly), guide wittingly.'),
	('H7920','שְׂכַל','sᵉkal','sek-al\'','(Aramaic) corresponding to שָׂכַל; {to be (causatively, make or act) circumspect and hence, intelligent}; consider.'),
	('H7921','שָׁכֹל','shâkôl','shaw-kole\'','a primitive root; properly, to miscarry, i.e. suffer abortion; by analogy, to bereave (literally or figuratively); bereave (of children), barren, cast calf (fruit, young), be (make) childless, deprive, destroy, [idiom] expect, lose children, miscarry, rob of children, spoil.'),
	('H7922','שֶׂכֶל','sekel','seh\'-kel','or שֵׂכֶל; from שָׂכַל; intelligence; by implication, success; discretion, knowledge, policy, prudence, sense, understanding, wisdom, wise.'),
	('H7923','שִׁכֻּלִים','shikkulîym','shik-koo-leem\'','plural from שָׁכֹל; childlessness (by continued bereavements); to have after loss of others.'),
	('H7924','שׇׂכְלְתָנוּ','soklᵉthânûw','sok-leth-aw-noo\'','(Aramaic) from שְׂכַל; intelligence; understanding.'),
	('H7925','שָׁכַם','shâkam','shaw-kam\'','a primitive root; properly, to incline (the shoulder to a burden); but used only as denominative from שְׁכֶם; literally, to load up (on the back of man or beast), i.e. to start early in the morning; (arise, be up, get (oneself) up, rise up) early (betimes), morning.'),
	('H7926','שְׁכֶם','shᵉkem','shek-em\'','from שָׁכַם; the neck (between the shoulders) as the place of burdens; figuratively, the spur of ahill; back, [idiom] consent, portion, shoulder.'),
	('H7927','שְׁכֶם','Shᵉkem','shek-em\'','the same as שְׁכֶם; ridge; Shekem, a place in Palestine; Shechem.'),
	('H7928','שֶׁכֶם','Shekem','sheh\'-kem','for שְׁכֶם; Shekem, the name of a Hivite and two Israelites; Shechem.'),
	('H7929','שִׁכְמָה','shikmâh','shik-maw\'','feminine of שְׁכֶם; the shoulderbone; shoulder blade.'),
	('H7930','שִׁכְמִי','Shikmîy','shik-mee\'','patronymic from שֶׁכֶם; a Shikmite (collectively), or descendants of Shekem; Shichemites.'),
	('H7931','שָׁכַן','shâkan','shaw-kan\'','a primitive root (apparently akin (by transmission) to שָׁכַב through the idea of lodging; compare סִכְלוּת, שָׁכַם); to reside or permanently stay (literally or figuratively); abide, continue, (cause to, make to) dwell(-er), have habitation, inhabit, lay, place, (cause to) remain, rest, set (up).'),
	('H7932','שְׁכַן','shᵉkan','shek-an\'','(Aramaic) corresponding to שָׁכַן; {to reside or permanently stay (literally or figuratively)}; cause to dwell, have habitation.'),
	('H7933','שֶׁכֶן','sheken','sheh\'-ken','from שָׁכַן; a residence; habitation.'),
	('H7934','שָׁכֵן','shâkên','shaw-kane\'','from שָׁכַן; a resident; by extension, a fellow-citizen; inhabitant, neighbour, nigh.'),
	('H7935','שְׁכַנְיָה','Shᵉkanyâh','shek-an-yaw\'','or (prolonged) שְׁכַנְיָהוּ; from שָׁכַן and יָהּ; Jah has dwelt; Shekanjah, the name of nine Israelites; Shecaniah, Shechaniah.'),
	('H7936','שָׂכַר','sâkar','saw-kar\'','or (by permutation) סָכַר; (Ezra 4:5), a primitive root (apparently akin (by prosthesis) to כָּרָה through the idea of temporary purchase; compare שָׁכַר); to hire; earn wages, hire (out self), reward, [idiom] surely.'),
	('H7937','שָׁכַר','shâkar','shaw-kar\'','a primitive root; to become tipsy; in a qualified sense, to satiate with astimulating drink or (figuratively) influence; (be filled with) drink (abundantly), (be, make) drunk(-en), be merry. (Superlative of שָׁקָה.)'),
	('H7938','שֶׂכֶר','seker','seh\'-ker','from שָׂכַר; wages; reward, sluices.'),
	('H7939','שָׂכָר','sâkâr','saw-kawr\'','from שָׂכַר; payment of contract; concretely, salary, fare, maintenance; by implication, compensation, benefit; hire, price, reward(-ed), wages, worth.'),
	('H7940','שָׂכָר','Sâkâr','saw-kar\'','the same as שָׂכָר; recompense; Sakar, the name of two Israelites; Sacar.'),
	('H7941','שֵׁכָר','shêkâr','shay-kawr\'','from שָׁכַר; an intoxicant, i.e. intensely alcoholic liquor; strong drink, [phrase] drunkard, strong wine.'),
	('H7942','שִׁכְּרוֹן','Shikkᵉrôwn','shik-ker-one\'','for שִׁכָּרוֹן; drunkenness, Shikkeron, a place in Palestine; Shicron.'),
	('H7943','שִׁכָּרוֹן','shikkârôwn','shik-kaw-rone\'','from שָׁכַר; intoxication; (be) drunken(-ness).'),
	('H7944','שַׁל','shal','shal','from שָׁלָה abbreviated form; a fault; error.'),
	('H7945','שֶׁל','shel','shel','for the rel. אֲשֶׁר; used with prepositional prefix, and often followed by some pronominal affix; on account of, whatsoever, whichsoever; cause, sake.'),
	('H7946','שַׁלְאֲנָן','shalʼănân','shal-an-awn\'','for שַׁאֲנָן; tranquil; being at ease.'),
	('H7947','שָׁלַב','shâlab','shaw-lab\'','a primitive root; to space off; intensive (evenly) to make equidistant; equally distant, set in order.'),
	('H7948','שָׁלָב','shâlâb','shaw-lawb\'','from שָׁלַב; a spacer or raised interval, i.e. the stile in aframe or panel; ledge.'),
	('H7949','שָׁלַג','shâlag','shaw-lag\'','a primitive root; properly, meaning to be white; used only as denominative from שֶׁלֶג; to be snow-white (with the linen clothing of the slain); be as snow.'),
	('H7950','שֶׁלֶג','sheleg','sheh\'-leg','from שָׁלַג; snow (probably from its whiteness); snow(-y).'),
	('H7951','שָׁלָה','shâlâh','shaw-law\'','or שָׁלַו; (Job 3:26), a primitive root; to be tranquil, i.e. secure or successful; be happy, prosper, be in safety.'),
	('H7952','שָׁלָה','shâlâh','shaw-law\'','a primitive root (probably identical with שָׁלָה through the idea of educing); to mislead; deceive, be negligent.'),
	('H7953','שָׁלָה','shâlâh','shaw-law\'','a primitive root (rather cognate (by contraction) to the base of נָשַׁל, שָׁלַל and their congeners through the idea of extracting); to draw out or off, i.e. remove (the soul by death); take away.'),
	('H7954','שְׁלָה','shᵉlâh','shel-aw\'','(Aramaic) corresponding to שָׁלָה; to be secure; at rest.'),
	('H7955','שָׁלָה','shâlâh','shaw-law\'','(Aramaic) from a root corresponding to שָׁלָה; a wrong; thing amiss.'),
	('H7956','שֵׁלָה','Shêlâh','shay-law\'','the same as שְׁאֵלָה (shortened); request; Shelah, the name of a postdiluvian patriarch and of an Israelite; Shelah.'),
	('H7957','שַׁלְהֶבֶת','shalhebeth','shal-heh\'-beth','from the same as לַהַב with sibilant prefix; a flare of fire; (flaming) flame.'),
	('H7958','שְׂלָו','sᵉlâv','sel-awv\'','or שְׂלָיו; by orthographical variation from שָׁלָה through the idea of sluggishness; the quail collectively (as slow in flight from its weight); quails.'),
	('H7959','שֶׁלֶו','shelev','sheh\'-lev','from שָׁלָה; security; prosperity.'),
	('H7960','שָׁלוּ','shâlûw','shaw-loo\'','(Aramaic) or שָׁלוּת; (Aramaic), from the same as שָׁלָה; a fault; error, [idiom] fail, thing amiss.'),
	('H7961','שָׁלֵו','shâlêv','shaw-lave\'','or שָׁלֵיו; feminine שְׁלֵוָה; from שָׁלָה; tranquil; (in a bad sense) careless; abstractly, security; (being) at ease, peaceable, (in) prosper(-ity), quiet(-ness), wealthy.'),
	('H7962','שַׁלְוָה','shalvâh','shal-vaw\'','from שָׁלָה; security (genuine or false); abundance, peace(-ably), prosperity, quietness.'),
	('H7963','שְׁלֵוָה','shᵉlêvâh','shel-ay-vaw\'','(Aramaic) corresponding to שַׁלְוָה; safety; tranquillity. See also שָׁלֵו.'),
	('H7964','שִׁלּוּחַ','shillûwach','shil-loo\'-akh','or שִׁלֻּחַ; from שָׁלַח; (only in plural) a dismissal, i.e. (of a wife) divorce (especially the document); also (of a daughter) dower; presents, have sent back.'),
	('H7965','שָׁלוֹם','shâlôwm','shaw-lome\'','or שָׁלֹם; from שָׁלַם; safe, i.e. (figuratively) well, happy, friendly; also (abstractly) welfare, i.e. health, prosperity, peace; [idiom] do, familiar, [idiom] fare, favour, [phrase] friend, [idiom] great, (good) health, ([idiom] perfect, such as be at) peace(-able, -ably), prosper(-ity, -ous), rest, safe(-ty), salute, welfare, ([idiom] all is, be) well, [idiom] wholly.'),
	('H7966','שִׁלּוּם','shillûwm','shil-loom\'','or שִׁלֻּם; from שָׁלַם; a requital, i.e. (secure) retribution, (venal) a fee; recompense, reward.'),
	('H7967','שַׁלּוּם','Shallûwm','shal-loom\'','or (shorter) שַׁלֻּם; the same as שִׁלּוּם; Shallum, the name of fourteen Israelites; Shallum.'),
	('H7968','שַׁלּוּן','Shallûwn','shal-loon\'','probably for שַׁלּוּם; Shallun, an Israelite; Shallum.'),
	('H7969','שָׁלוֹשׁ','shâlôwsh','shaw-loshe\'','or שָׁלֹשׁ; masculine שְׁלוֹשָׁה; or שְׁלֹשָׁה; a primitive number; three; occasionally (ordinal) third, or (multiple) thrice; [phrase] fork, [phrase] often(-times), third, thir(-teen, -teenth), three, [phrase] thrice. Compare שָׁלִישׁ.'),
	('H7970','שְׁלוֹשִׁים','shᵉlôwshîym','shel-o-sheem\'','or שְׁלֹשִׁים; multiple of שָׁלוֹשׁ; thirty; or (ordinal) thirtieth; thirty, thirtieth. Compare שָׁלִישׁ.'),
	('H7971','שָׁלַח','shâlach','shaw-lakh\'','a primitive root; to send away, for, or out (in a great variety of applications); [idiom] any wise, appoint, bring (on the way), cast (away, out), conduct, [idiom] earnestly, forsake, give (up), grow long, lay, leave, let depart (down, go, loose), push away, put (away, forth, in, out), reach forth, send (away, forth, out), set, shoot (forth, out), sow, spread, stretch forth (out).'),
	('H7972','שְׁלַח','shᵉlach','shel-akh\'','(Aramaic) corresponding to שָׁלַח; {to send away, for, or out (in a great variety of applications)}; put, send.'),
	('H7973','שֶׁלַח','shelach','sheh\'-lakh','from שָׁלַח; a missile of attack, i.e. spear; also (figuratively) a shoot of growth; i.e. branch; dart, plant, [idiom] put off, sword, weapon.'),
	('H7974','שֶׁלַח','Shelach','sheh\'-lakh','the same as שֶׁלַח; Shelach, a postdiluvian patriarch; Salah, Shelah. Compare שִׁלֹחַlemma שִׁלֹּחַ extra dagesh, corrected to שִׁלֹחַ.'),
	('H7975','שִׁלֹחַ','Shilôach','shee-lo\'-akh','lemma שִׁלֹּחַ extra dagesh, corrected to שִׁלֹחַ; or (in imitation of שֶׁלַח) שֶׁלַח; (Nehemiah 3:15), from שָׁלַח; rill; Shiloach, a fountain of Jerusalem; Shiloah, Siloah.'),
	('H7976','שִׁלֻּחָה','shilluchâh','shil-loo-khaw\'','feminine of שִׁלּוּחַ; a shoot; branch.'),
	('H7977','שִׁלְחִי','Shilchîy','shil-khee\'','from שֶׁלַח; missive, i.e. armed; Shilchi, an Israelite; Shilhi.'),
	('H7978','שִׁלְחִים','Shilchîym','shil-kheem\'','plural of שֶׁלַח; javelins or sprouts; Shilchim, a place in Palestine; Shilhim.'),
	('H7979','שֻׁלְחָן','shulchân','shool-khawn\'','from שָׁלַח; a table (as spread out); by implication, a meal; table.'),
	('H7980','שָׁלַט','shâlaṭ','shaw-lat\'','a primitive root; to dominate, i.e. govern; by implication, to permit; (bear, have) rule, have dominion, give (have) power.'),
	('H7981','שְׁלֵט','shᵉlêṭ','shel-ate\'','(Aramaic) corresponding to שָׁלַט; {to dominate, i.e. govern; by implication, to permit}; have the mastery, have power, bear rule, be (make) ruler.'),
	('H7982','שֶׁלֶט','sheleṭ','sheh\'-let','from שָׁלַט; probably a shield (as controlling, i.e. protecting the person); shield.'),
	('H7983','שִׁלְטוֹן','shilṭôwn','shil-tone\'','(Aramaic) from שָׁלַט; {power.}; power.'),
	('H7984','שִׁלְטוֹן','shilṭôwn','shil-tone\'','(Aramaic) or שִׁלְטֹןlemma שִׁלְטן missing vowel, corrected to שִׁלְטֹן; corresponding to שִׁלְטוֹן; {a potentate}; ruler.'),
	('H7985','שׇׁלְטָן','sholṭân','shol-tawn\'','(Aramaic) from שְׁלֵט; empire (abstractly or concretely); dominion.'),
	('H7986','שַׁלֶּטֶת','shalleṭeth','shal-leh\'-teth','feminine from שָׁלַט; a vixen; imperious.'),
	('H7987','שְׁלִי','shᵉlîy','shel-ee\'','from שָׁלָה; privacy; [phrase] quietly.'),
	('H7988','שִׁלְיָה','shilyâh','shil-yaw\'','feminine from שָׁלָה; a fetus or babe (as extruded in birth); young one.'),
