	('H8121','שֶׁמֶשׁ','shemesh','sheh\'-mesh','from an unused root meaning to be brilliant; the sun; by implication, the east; figuratively, a ray, i.e. (architectural) a notched battlement; [phrase] east side(-ward), sun (rising), [phrase] west(-ward), window. See also בֵּית שֶׁמֶשׁ.'),
