	('H8199','שָׁפַט','shâphaṭ','shaw-fat\'','a primitive root; to judge, i.e. pronounce sentence (for or against); by implication, to vindicate or punish; by extenssion, to govern; passively, to litigate (literally or figuratively); [phrase] avenge, [idiom] that condemn, contend, defend, execute (judgment), (be a) judge(-ment), [idiom] needs, plead, reason, rule.'),
	('H8200','שְׁפַט','shᵉphaṭ','shef-at\'','(Aramaic) corresponding to שָׁפַט; to judge; magistrate.'),
	('H8201','שֶׁפֶט','shepheṭ','sheh\'-fet','from שָׁפַט; a sentence, i.e. infliction; judgment.'),
	('H8202','שָׁפָט','Shâphâṭ','shaw-fawt\'','from שָׁפַט; judge; Shaphat, the name of four Israelites; Shaphat.'),
