	('H8204','שִׁפְטָן','Shiphṭân','shif-tawn\'','from שָׁפַט; judge-like; Shiphtan, an Israelite; Shiphtan.'),
	('H8205','שְׁפִי','shᵉphîy','shef-ee\'','from שָׁפָה; bareness; concretely, a bare hill or plain; high place, stick out.'),
	('H8206','שֻׁפִּים','Shuppîym','shoop-peem\'','plural of an unused noun from the same as שְׁפִיפֹן and meaning the same; serpents; Shuppim, an Israelite; Shuppim.'),
	('H8207','שְׁפִיפֹן','shᵉphîyphôn','shef-ee-fone\'','from an unused root meaning the same as שׁוּף; a kind of serpent (as snapping), probably the cerastes or horned adder; adder.'),
	('H8208','שָׁפִיר','Shâphîyr','shaf-eer\'','from שָׁפַר; beautiful; Shaphir, a place in Palestine; Saphir.'),
	('H8209','שַׁפִּיר','shappîyr','shap-peer\'','(Aramaic) intensive of a form corresponding to שָׁפִיר; beautiful; fair.'),
	('H8210','שָׁפַךְ','shâphak','shaw-fak\'','a primitive root; to spill forth (blood, a libation, liquid metal; or even a solid, i.e. to mound up); also (figuratively) to expend (life, soul, complaint, money, etc.); intensively, to sprawl out; cast (up), gush out, pour (out), shed(-der, out), slip.'),
	('H8211','שֶׁפֶךְ','shephek','sheh\'-fek','from שָׁפַךְ; an emptying place, e.g. an ash-heap; are poured out.'),
	('H8212','שׇׁפְכָה','shophkâh','shof-kaw\'','feminine of a derivative from שָׁפַךְ; a pipe (for pouring forth, e.g. wine), i.e. the penis; privy member.'),
	('H8213','שָׁפֵל','shâphêl','shaw-fale\'','a primitive root; to depress or sink (expectation figuratively, to humiliate, intransitive or transitive); abase, bring (cast, put) down, debase, humble (self), be (bring, lay, make, put) low(-er).'),
	('H8214','שְׁפַל','shᵉphal','shef-al\'','(Aramaic) corresponding to שָׁפֵל; {to depress or sink (expectation figuratively, to humiliate, intransitive or transitive)}; abase, humble, put down, subdue.'),
	('H8215','שְׁפַל','shᵉphal','shef-al\'','(Aramaic) from שְׁפַל; low; basest.'),
	('H8216','שֶׁפֶל','shephel','shay\'-fel','from שָׁפֵל; an humble rank; low estate (place).'),
	('H8217','שָׁפָל','shâphâl','shaw-fawl\'','from שָׁפֵל; depressed, literally or figuratively; base(-st), humble, low(-er, -ly).'),
	('H8218','שִׁפְלָה','shiphlâh','shif-law\'','feminine of שֶׁפֶל; depression; low place.'),
	('H8219','שְׁפֵלָה','shᵉphêlâh','shef-ay-law\'','from שָׁפֵל; Lowland, i.e. (with the article) the maritime slope of Palestine; low country, (low) plain, vale(-ley).'),
	('H8220','שִׁפְלוּת','shiphlûwth','shif-looth\'','from שָׁפֵל; remissness; idleness.'),
	('H8221','שְׁפָם','Shᵉphâm','shef-awm\'','probably from שָׁפָה; bare spot; Shepham, a place in or near Palestine; Shepham.'),
	('H8222','שָׂפָם','sâphâm','saw-fawm\'','from שָׂפָה; the beard (as a lippiece); beard, (upper) lip.'),
	('H8223','שָׁפָם','Shâphâm','shaw-fawm\'','formed like שְׁפָם; baldly; Shapham, an Israelite; Shapham.'),
	('H8224','שִׂפְמוֹת','Siphmôwth','sif-moth\'','feminine plural of שְׁפָם; Siphmoth, a place in Palestine; Siphmoth.'),
	('H8225','שִׁפְמִי','Shiphmîy','shif-mee\'','patrial from שְׁפָם; a Shiphmite or inhabitant of Shepham; Shiphmite.'),
	('H8226','שָׂפַן','sâphan','saw-fan\'','a primitive root; to conceal (as a valuable); treasure.'),
	('H8227','שָׁפָן','shâphân','shaw-fawn\'','from שָׂפַן; a species of rockrabbit (from its hiding), i.e. probably the hyrax; coney.'),
	('H8228','שֶׁפַע','shephaʻ','sheh\'-fah','from an unused root meaning to abound; resources; abundance.'),
	('H8229','שִׁפְעָה','shiphʻâh','shif-aw\'','feminine of שֶׁפַע; copiousness; abundance, company, multitude.'),
	('H8230','שִׁפְעִי','Shiphʻîy','shif-ee\'','from שֶׁפַע; copious; Shiphi, an Israelite; Shiphi.'),
	('H8231','שָׁפַר','shâphar','shaw-far\'','a primitive root; to glisten, i.e. (figuratively) be (causatively, make) fair; [idiom] goodly.'),
	('H8232','שְׁפַר','shᵉphar','shef-ar\'','(Aramaic) corresponding to שָׁפַר; to be beautiful; be acceptable, please, [phrase] think good.'),
	('H8233','שֶׁפֶר','shepher','sheh\'-fer','from שָׁפַר; beauty; [idiom] goodly.'),
	('H8234','שֶׁפֶר','Shepher','sheh\'-fer','the same as שֶׁפֶר; Shepher, a place in the Desert; Shapper.'),
	('H8235','שִׁפְרָה','shiphrâh','shif-raw\'','from שָׁפַר; brightness; garnish.'),
	('H8236','שִׁפְרָה','Shiphrâh','shif-raw\'','the same as שִׁפְרָה; Shiphrah, an Israelitess; Shiphrah.'),
	('H8237','שַׁפְרוּר','shaphrûwr','shaf-roor\'','from שָׁפַר; splendid, i.e. a tapestry or canopy; royal pavilion.'),
	('H8238','שְׁפַרְפַר','shᵉpharphar','shef-ar-far\'','(Aramaic) from שָׁפַר; the dawn (as brilliant with aurora); [idiom] very early in the morning.'),
	('H8239','שָׁפַת','shâphath','shaw-fath\'','a primitive root; to locate, i.e. (generally) hang on or (figuratively) establish, reduce; bring, ordain, set on.'),
	('H8240','שָׁפָת','shâphâth','shaw-fawth\'','from שָׁפַת; a (double) stall (for cattle); also a (two-pronged) hook (for flaying animals on); hook, pot.'),
	('H8241','שֶׁצֶף','shetseph','sheh\'-tsef','from שָׁטַף (for alliteration with קֶצֶף); an outburst (of anger); little.'),
	('H8242','שַׂק','saq','sak','from שָׁקַק; properly, a mesh (as allowing a liquid to run through), i.e. coarse loose cloth or sacking (used in mourning and for bagging); hence, a bag (for grain, etc.); sack(-cloth, -clothes).'),
	('H8243','שָׁק','shâq','shawk','(Aramaic) corresponding to שׁוֹק; the leg; leg.'),
	('H8244','שָׂקַד','sâqad','saw-kad\'','a primitive root; to fasten; bind.'),
	('H8245','שָׁקַד','shâqad','shaw-kad\'','a primitive root; to be alert, i.e. sleepless; hence to be on the lookout (whether for good or ill); hasten, remain, wake, watch (for).'),
	('H8246','שָׁקַד','shâqad','shaw-kad\'','a denominative from שָׁקֵד; to be (intensively, make) almond-shaped; make like (unto, after the fashion of) almonds.'),
	('H8247','שָׁקֵד','shâqêd','shaw-kade\'','from שָׁקַד; the almond (tree or nut; as being the earliest in bloom); almond (tree).'),
	('H8248','שָׁקָה','shâqâh','shaw-kaw\'','a primitive root; to quaff, i.e. (causatively) to irrigate or furnish apotion to; cause to (give, give to, let, make to) drink, drown, moisten, water. See שָׁכַר, שָׁתָה.'),
	('H8249','שִׁקֻּו','shiqquv','shif-koov\'','from שָׁקָה; (plural collective) a draught; drink.'),
	('H8250','שִׁקּוּי','shiqqûwy','shik-koo\'-ee','from שָׁקָה; a beverage; moisture, i.e. (figuratively) refreshment; drink, marrow.'),
	('H8251','שִׁקּוּץ','shiqqûwts','shik-koots\'','or שִׁקֻּץ; from שָׁקַץ; disgusting, i.e. filthy; especially idolatrous or (concretely) an idol; abominable filth (idol, -ation), detestable (thing).'),
	('H8252','שָׁקַט','shâqaṭ','shaw-kat\'','a primitive root; to repose (usually figurative); appease, idleness, (at, be at, be in, give) quiet(-ness), (be at, be in, give, have, take) rest, settle, be still.'),
	('H8253','שֶׁקֶט','sheqeṭ','sheh\'-ket','from שָׁקַט; tranquillity; quietness.'),
	('H8254','שָׁקַל','shâqal','shaw-kal\'','a primitive root; to suspend or poise (especially in trade); pay, receive(-r), spend, [idiom] throughly, weigh.'),
	('H8255','שֶׁקֶל','sheqel','sheh\'-kel','from שָׁקַל; probably a weight; used as a commercial standard; shekel.'),
	('H8256','שִׁקְמָה','shiqmâh','shik-maw\'','or (feminine) שִׁקְמָה; of uncertain derivation; a sycamore (usually the tree); sycamore (fruit, tree).'),
	('H8257','שָׁקַע','shâqaʻ','shaw-kah\'','(abbreviated Amos 8:8); a primitive root; to subside; by implication, to be overflowed, cease; causatively, to abate, subdue; make deep, let down, drown, quench, sink.'),
	('H8258','שְׁקַעְרוּרָה','shᵉqaʻrûwrâh','shek-ah-roo-raw\'','from שָׁקַע; a depression; hollow strake.'),
	('H8259','שָׁקַף','shâqaph','shaw-kaf\'','a primitive root; properly, to lean out (of a window), i.e. (by implication) peep or gaze (passively, be a spectacle); appear, look (down, forth, out).'),
	('H8260','שֶׁקֶף','sheqeph','sheh\'-kef','from שָׁקַף; a loophole (for looking out), to admit light and air; window.'),
