	('H8268','שֹׁקֶת','shôqeth','sho\'-keth','from שָׁקָה; a trough (for watering); trough.'),
	('H8269','שַׂר','sar','sar','from שָׂרַר; a head person (of any rank or class); captain (that had rule), chief (captain), general, governor, keeper, lord,(-task-)master, prince(-ipal), ruler, steward.'),
	('H8270','שֹׁר','shôr','shore','from שָׁרַר; (compare שָׁרִיר); a string (as twisted ), i.e. (specifically) the umbilical cord (also figuratively, as the centre of strength); navel.'),
	('H8271','שְׁרֵא','shᵉrêʼ','sher-ay\'','(Aramaic) a root corresponding to that of שֵׁרוּת; to free, separate; figuratively, to unravel, commence; by implication (of unloading beasts) to reside; begin, dissolve, dwell, loose.'),
	('H8272','שַׁרְאֶצֶר','Sharʼetser','shar-eh\'-tser','of foreign derivation; Sharetser, the name of an Assyrian and an Israelite; Sharezer.'),
	('H8273','שָׁרָב','shârâb','shaw-rawb\'','from an unused root meaning to glare; quivering glow (of the air), expectation. the mirage; heat, parched ground.'),
	('H8274','שֵׁרֵבְיָה','Shêrêbᵉyâh','shay-rayb-yaw\'','from שָׁרָב and יָהּ; Jah has brought heat; Sherebjah, the name of two Israelites; Sherebiah.'),
	('H8275','שַׁרְבִיט','sharbîyṭ','shar-beet\'','for שֵׁבֶט; a rod of empire; sceptre.'),
	('H8276','שָׂרַג','sârag','saw-rag\'','a primitive root; to intwine; wrap together, wreath.'),
	('H8277','שָׂרַד','sârad','saw-rad\'','a primitive root; (compare שֶׂרֶד); properly, to puncture, i.e. (figuratively through the idea of slipping out) to escape or survive; remain.'),
	('H8278','שְׂרָד','sᵉrâd','ser-awd\'','from שָׂרַד; stitching (as pierced with a needle); service.'),
	('H8279','שֶׂרֶד','sered','seh\'-red','from שָׂרַד; a (carpenter\'s) scribing-awl (for pricking or scratching measurements); line.'),
	('H8280','שָׂרָה','sârâh','saw-raw\'','a primitive root; to prevail; have power (as a prince).'),
