	('H8282','שָׂרָה','sârâh','saw-raw\'','feminine of שַׂר; a mistress, i.e. female noble; lady, princess, queen.'),
	('H8283','שָׂרָה','Sârâh','saw-raw\'','the same as שָׂרָה; Sarah, Abraham\'s wife; Sarah.'),
	('H8284','שָׁרָה','shârâh','shaw-raw\'','probably feminine of שׁוּר; a fortification (literally or figuratively); sing (by mistake for שִׁיר), wall.'),
