	('H8286','שְׂרוּג','Sᵉrûwg','ser-oog\'','from שָׂרַג; tendril; Serug, a postdiluvian patriarch; Serug.'),
	('H8287','שָׁרוּחֶן','Shârûwchen','shaw-roo-khen\'','probably from שָׁרָה (in the sense of dwelling (compare שְׁרֵא) and חֵן; abode of pleasure; Sharuchen, a place in Palestine; Sharuhen.'),
	('H8288','שְׂרוֹךְ','sᵉrôwk','ser-oke\'','from שָׂרַךְ; a thong (as laced or tied); (shoe-)latchet.'),
	('H8289','שָׁרוֹן','Shârôwn','shaw-rone\'','probably abridged from יָשַׁר; plain, Sharon, the name of a place in Palestine; Lasharon, Sharon.'),
