	('H8292','שְׁרוּקָה','shᵉrûwqâh','sher-oo-kaw\'','or (by permutation) שְׁרִיקָה; feminine passive participle of שָׁרַק; a whistling (in scorn); by analogy, a piping; bleating, hissing.'),
	('H8293','שֵׁרוּת','shêrûwth','shay-rooth\'','from שָׁרָה abbreviated; freedom; remnant.'),
	('H8294','שֶׂרַח','Serach','seh\'-rakh','by permutation for סֶרַח; superfluity; Serach, an Israelitess; Sarah, Serah.'),
	('H8295','שָׂרַט','sâraṭ','saw-rat\'','a primitive root; to gash; cut in pieces, make (cuttings) pieces.'),
