	('H8297','שָׂרַי','Sâray','saw-rah\'-ee','from שַׂר; dominative; Sarai, the wife of Abraham; Sarai.'),
	('H8298','שָׁרַי','Shâray','shaw-rah\'-ee','probably from שָׁרַר; hostile; Sharay, an Israelite; Sharai.'),
	('H8299','שָׂרִיג','sârîyg','saw-reeg\'','from שָׂרַג; a tendril (as entwining); branch.'),
	('H8300','שָׂרִיד','sârîyd','saw-reed\'','from שָׂרַד; a survivor; [idiom] alive, left, remain(-ing), remnant, rest.'),
	('H8301','שָׂרִיד','Sârîyd','suw-reed\'','the same as שָׂרִיד; Sarid, a place in Palestine; Sarid.'),
	('H8302','שִׁרְיוֹן','shiryôwn','shir-yone\'','or שִׁרְיֹן; and שִׁרְיָן; also (feminine) שִׁרְיָה; and שִׁרְיֹנָה; from שָׁרָה in the original sense of turning; a corslet (as if twisted); breastplate, coat of mail, habergeon, harness. See סִרְיֹן.'),
	('H8303','שִׁרְיוֹן','Shiryôwn','shir-yone\'','and שִׂרְיֹן; the same as שְׂרָיָה (i.e. sheeted with snow); Shirjon or Sirjon, a peak of the Lebanon; Sirion.'),
	('H8304','שְׂרָיָה','Sᵉrâyâh','ser-aw-yaw\'','or שְׂרָיָהוּ; from שָׂרָה and יָהּ; Jah has prevailed; Serajah, the name of nine Israelites; Seraiah.'),
	('H8305','שְׂרִיקָה','sᵉrîyqâh','ser-ee-kaw\'','from the same as שֹׂרֵק in the original sense of piercing; hetchelling (or combing flax), i.e. (concretely) tow (by extension, linen cloth); fine.'),
	('H8306','שָׁרִיר','shârîyr','shaw-reer\'','from שָׁרַר in the original sense as in שֹׁר (compare שֹׁרֶר); a cord, i.e. (by analogy) sinew; navel.'),
	('H8307','שְׁרִירוּת','shᵉrîyrûwth','sher-ee-rooth\'','from שָׁרַר in the sense of twisted, i.e. firm; obstinacy; imagination, lust.'),
	('H8308','שָׂרַךְ','sârak','saw-rak\'','a primitive root; to interlace; traverse.'),
	('H8309','שְׁרֵמָה','shᵉrêmâh','sher-ay-maw\'','probably by an orthographical error for שְׁדֵמָה; a common; field.'),
	('H8310','שַׂרְסְכִים','Sarçᵉkîym','sar-seh-keem\'','of foreign derivation; Sarsekim, a Babylonian general; Sarsechim.'),
	('H8311','שָׂרַע','sâraʻ','saw-rah\'','a primitive root; to prolong, i.e. (reflex) be deformed by excess of members; stretch out self, (have any) superfluous thing.'),
	('H8312','שַׂרְעַף','sarʻaph','sar-af\'','for סָעִף; cogitation; thought.'),
	('H8313','שָׂרַף','sâraph','saw-raf\'','a primitive root; to be (causatively, set) on fire; (cause to, make a) burn((-ing), up) kindle, [idiom] utterly.'),
