	('H8317','שָׁרַץ','shârats','shaw-rats\'','a primitive root; to wriggle, i.e. (by implication) swarm or abound; breed (bring forth, increase) abundantly (in abundance), creep, move.'),
	('H8318','שֶׁרֶץ','sherets','sheh\'-rets','from שָׁרַץ; a swarm, i.e. active mass of minute animals; creep(-ing thing), move(-ing creature).'),
