	('H8321','שֹׂרֵק','sôrêq','so-rake\'','or שׂוֹרֵק; and (feminine) שֹׂרֵקָה; from שָׁרַק in the sense of redness (compare שָׂרֻק); a vine stock (properly, one yielding purple grapes, the richest variety); choice(-st, noble) wine. Compare שָׂרוּק.'),
	('H8322','שְׁרֵקָה','shᵉrêqâh','sher-ay-kaw\'','from שָׁרַק; a derision; hissing.'),
