	('H8325','שָׁרַר','Shârar','shaw-rawr\'','from שָׁרַר; hostile; Sharar, an Israelite; Sharar.'),
	('H8326','שֹׁרֶר','shôrer','sho\'-rer','from שָׁרַר in the sense of twisting (compare שֹׁר); the umbilical cord, i.e. (by extension) a bodice; navel.'),
	('H8327','שָׁרַשׁ','shârash','shaw-rash\'','a primitive root; to root, i.e. strike into the soil, or (by implication) to pluck from it; (take, cause to take) root (out).'),
	('H8328','שֶׁרֶשׁ','sheresh','sheh\'-resh','from שָׁרַשׁ; a root (literally or figuratively); bottom, deep, heel, root.'),
