	('H8331','שַׁרְשָׁה','sharshâh','shar-shaw\'','from שָׁרַשׁ; a chain (as rooted, i.e. linked); chain. Compare שַׁרְשְׁרָה.'),
	('H8332','שְׁרֹשׁוּ','shᵉrôshûw','sher-o-shoo\'','(Aramaic) from a root corresponding to שָׁרַשׁ; eradication, i.e. (figuratively) exile; banishment.'),
	('H8333','שַׁרְשְׁרָה','sharshᵉrâh','shar-sher-aw\'','from שָׁרַשׁ (compare שַׁרְשָׁה); a chain; (architectural) probably a garland; chain.'),
	('H8334','שָׁרַת','shârath','shaw-rath\'','a primitive root; to attend as a menial or worshipper; figuratively, to contribute to; minister (unto), (do) serve(-ant, -ice, -itor), wait on.'),
