	('H8337','שֵׁשׁ','shêsh','shaysh','masculine שִׁשָּׁה; a primitive number; compare שׂוּשׂ; six (as an overplus  beyond five or the fingers of the hand); as ord. sixth; six(-teen, -teenth), sixth.'),
	('H8338','שָׁשָׁא','shâshâʼ','shaw-shaw\'','xlit shâwshâw corrected to shâshâʼ; a primitive root; apparently,; to annihilate; leave by the sixth part (by confusion with שָׁשָׁה).'),
	('H8339','שֵׁשְׁבַּצַּר','Shêshᵉbatstsar','shaysh-bats-tsar\'','of foreign derivation; Sheshbatstsar, Zerubbabel\'s Persian name; Sheshbazzar.'),
	('H8340','שֵׁשְׁבַּצַּר','Shêshᵉbatstsar','shaysh-bats-tsar\'','(Aramaic) corresponding to שֵׁשְׁבַּצַּר; {Sheshbatstsar, Zerubbabel\'s Persian name}; Sheshbazzar.'),
	('H8341','שָׁשָׁה','shâshâh','shaw-shaw\'','a denominative from שֵׁשׁ; to sixth or divide into sixths; give the sixth participle'),
