	('H8343','שָׁשַׁי','Shâshay','shaw-shah\'-ee','perhaps from שֵׁשׁ; whitish; Shashai, an Israelite; Shashai.'),
	('H8344','שֵׁשַׁי','Shêshay','shay-shah\'-ee','probably for שָׁשַׁי; Sheshai, a Canaanite; Sheshai.'),
	('H8345','שִׁשִּׁי','shishshîy','shish-shee\'','from שֵׁשׁ; sixth, ord. or (feminine) fractional; sixth (part).'),
