	('H8355','שְׁתָה','shᵉthâh','sheth-aw\'','(Aramaic) corresponding to שָׁתָה; {to imbibe (literally or figuratively)}; drink.'),
	('H8356','שָׁתָה','shâthâh','shaw-thaw\'','from שִׁית; a basis, i.e. (figuratively) political or moral support; foundation, purpose.'),
	('H8357','שֵׁתָה','shêthâh','shay-thaw\'','from שִׁית; the seat (of the person); buttock.'),
	('H8358','שְׁתִי','shᵉthîy','sheth-ee\'','from שָׁתָה; intoxicaion; drunkenness.'),
	('H8359','שְׁתִי','shᵉthîy','sheth-ee\'','from שִׁית; a fixture, i.e. the warp in weaving; warp.'),
	('H8360','שְׁתִיָּה','shᵉthîyâh','sheth-ee-yaw\'','feminine of שְׁתִי; potation; drinking.'),
	('H8361','שִׁתִּין','shittîyn','shit-teen\'','(Aramaic) corresponding to שִׁשִּׁים (compare שֵׁת); sixty; threescore.'),
