	('H8365','שָׁתַם','shâtham','shaw-tham\'','a primitive root; to unveil (figuratively); be open.'),
	('H8366','שָׁתַן','shâthan','shaw-than\'','a primitive root; (causatively) to make water, i.e. urinate; piss.'),
	('H8367','שָׁתַק','shâthaq','shaw-thak\'','a primitive root; to subside; be calm, cease, be quiet.'),
