	('H8371','שָׁתַת','shâthath','shaw-thath\'','a primitive root; to place, i.e. array; reflex. to lie; be laid, set. t'),
	('H8372','תָּא','tâʼ','taw','and (feminine) תָּאָה; (Ezekiel 40:12), from (the base of) תָּאָה; a room (as circumscribed); (little) chamber.'),
