	('H8374','תָּאַב','tâʼab','taw-ab\'','a primitive root (probably identical with תָּאַב through the idea of puffing disdainfully at; compare אָיַב); to loathe (morally); abhor.'),
	('H8375','תַּאֲבָה','taʼăbâh','tah-ab-aw\'','from תָּאַב (compare אָבֶה); desire; longing.'),
