	('H8397','תֶּבֶל','tebel','teh\'-bel','apparently from בָּלַל; mixture, i.e. unnatural bestiality; confusion.'),
	('H8398','תֵּבֵל','têbêl','tay-bale\'','from יָבַל; the earth (as moist and therefore inhabited); by extension, the globe; by implication, its inhabitants; specifically, a particular land, as Babylonia, Palestine; habitable part, world.'),
	('H8399','תַּבְלִית','tablîyth','tab-leeth\'','from בָּלָה; consumption; destruction.'),
	('H8400','תְּבַּלֻּל','tᵉballul','teb-al-lool\'','from בָּלַל in the original sense of flowing; a cataract (in the eye); blemish.'),
	('H8401','תֶּבֶן','teben','teh\'-ben','probably from בָּנָה; properly, material, i.e. (specifically) refuse haum or stalks of grain (as chopped in threshing and used for fodder); chaff, straw, stubble.'),
	('H8402','תִּבְנִי','Tibnîy','tib-nee\'','xlit Tibni corrected to Tibnîy; from תֶּבֶן; strawy; Tibni, an Israelite; Tibni.'),
	('H8403','תַּבְנִית','tabnîyth','tab-neeth\'','from בָּנָה; structure; by implication, a model, resemblance; figure, form, likeness, pattern, similitude.'),
