	('H8410','תִּדְהָר','tidhâr','tid-hawr\'','apparently from דָּהַר; enduring; a species of hard-wood or lasting tree (perhaps oak); pine (tree).'),
	('H8411','תְּדִירָא','tᵉdîyrâʼ','ted-ee-raw\'','(Aramaic) from דּוּר in the original sense of enduring; permanence, i.e. (adverb) constantly; continually.'),
	('H8412','תַּדְמֹר','Tadmôr','tad-more\'','or תַּמֹּר; (1 Kings 9:18), apparently from תָּמָר; palm-city; Tadmor, a place near Palestine; Tadmor.'),
	('H8413','תִּדְעָל','Tidʻâl','tid-awl\'','perhaps from דְּחַל; fearfulness; Tidal, a Canaanite; Tidal.'),
	('H8414','תֹּהוּ','tôhûw','to\'-hoo','from an unused root meaning to lie waste; a desolation (of surface), i.e. desert; figuratively, a worthless thing; adverbially, in vain; confusion, empty place, without form, nothing, (thing of) nought, vain, vanity, waste, wilderness.'),
	('H8415','תְּהוֹם','tᵉhôwm','teh-home\'','or תְּהֹם; (usually feminine) from הוּם; an abyss (as a surging mass of water), especially the deep (the main sea or the subterranean watersupply); deep (place), depth.'),
	('H8416','תְּהִלָּה','tᵉhillâh','teh-hil-law\'','from הָלַל; laudation; specifically (concretely) a hymn; praise.'),
	('H8417','תׇּהֳלָה','tohŏlâh','to-hol-aw\'','feminine of an unused noun (apparently from הָלַל) meaning bluster; braggadocio, i.e. (by implication) fatuity; folly.'),
	('H8418','תַּהֲלֻכָה','tahălukâh','tah-hal-oo-kaw\'','from הָלַךְ; a procession; [idiom] went.'),
	('H8419','תַּהְפֻּכָה','tahpukâh','tah-poo-kaw\'','from הָפַךְ; a perversity or fraud; (very) froward(-ness, thing), perverse thing.'),
	('H8420','תָּו','tâv','tawv','from תָּוָה; a mark; by implication, a signature; desire, mark.'),
	('H8421','תּוּב','tûwb','toob','(Aramaic) corresponding to שׁוּב, to come back; specifically (transitive and ellip.) to reply; answer, restore, return (an answer).'),
	('H8422','תּוּבַל','Tûwbal','too-bal\'','or תֻּבַל; probably of foreign derivation; Tubal, a postdiluvian patriarch and his posterity; Tubal.'),
