	('H8430','תּוֹחַ','Tôwach','to\'-akh','from an unused root meaning to depress; humble; Toach, an Israelite; Toah.'),
	('H8431','תּוֹחֶלֶת','tôwcheleth','to-kheh\'-leth','from יָחַל; expectation; hope.'),
	('H8432','תָּוֶךְ','tâvek','taw\'-vek','from an unused root meaning to sever; a bisection, i.e. (by implication) the centre; among(-st), [idiom] between, half, [idiom] (there-, where-), in(-to), middle, mid(-night), midst (among), [idiom] out (of), [idiom] through, [idiom] with(-in).'),
	('H8433','תּוֹכֵחָה','tôwkêchâh','to-kay-khaw\'','and תּוֹכַחַת; from יָכַח; chastisement; figuratively (by words) correction, refutation, proof (even in defence); argument, [idiom] chastened, correction, reasoning, rebuke, reproof, [idiom] be (often) reproved.'),
	('H8434','תּוֹלָד','Tôwlâd','to-lawd\'','from יָלַד; posterity; Tolad, a place in Palestine; Tolad. Compare אֶלְתּוֹלַד.'),
	('H8435','תּוֹלְדָה','tôwlᵉdâh','to-led-aw\'','or תֹּלְדָה; from יָלַד; (plural only) descent, i.e. family; (figuratively) history; birth, generations.'),
	('H8436','תּוּלוֹן','Tûwlôwn','too-lone\'','xlit Tûwlôn corrected to Tûwlôwn; from תָּלַל; suspension; Tulon, an Israelite; Tilon (from the margin).'),
	('H8437','תּוֹלָל','tôwlâl','to-lawl\'','from יָלַל; causing to howl, i.e. an oppressor; that wasted.'),
	('H8438','תּוֹלָע','tôwlâʻ','to-law\'','and (feminine) תּוֹלֵעָה; or תּוֹלַעַת; or תֹּלַעַת; from יָלַע; a maggot (as voracious); specifically (often with ellipsis of שָׁנִי); the crimson-grub, but used only (in this connection) of the colorfrom it, and cloths dyed therewith; crimson, scarlet, worm.'),
	('H8439','תּוֹלָע','Tôwlâʻ','to-law\'','the same as תּוֹלָע; worm; Tola, the name of two Israelites; Tola.'),
	('H8440','תּוֹלָעִי','Tôwlâʻîy','to-law-ee\'','patronymically from תּוֹלָע; a Tolaite (collectively) or descendants of Tola; Tolaites.'),
	('H8441','תּוֹעֵבַה','tôwʻêbah','to-ay-baw\'','or תֹּעֵבַה; feminine active participle of תַּעָב; properly, something disgusting (morally), i.e. (as noun) an abhorrence; especially idolatry or (concretely) an idol; abominable (custom, thing), abomination.'),
	('H8442','תּוֹעָה','tôwʻâh','to-aw\'','feminine active participle of תָּעָה; mistake, i.e. (morally) impiety, or (political) injury; error, hinder.'),
	('H8443','תּוֹעָפָה','tôwʻâphâh','to-aw-faw\'','from יָעַף; (only in plural collective) weariness, i.e. (by implication) toil (treasure so obtained) or speed; plenty, strength.'),
	('H8444','תּוֹצָאָה','tôwtsâʼâh','to-tsaw-aw\'','or תֹּצָאָה; from יָצָא; (only in plural collective) exit, i.e. (geographical) boundary, or (figuratively) deliverance, (actively) source; border(-s), going(-s) forth (out), issues, outgoings.'),
	('H8445','תּוֹקַהַת','Tôwqahath','to-kah\'-ath','from the same as יִקָּהָה; obedience; Tokahath, an Israelite; Tikvath (by correction for תִּקְוָה).'),
	('H8446','תּוּר','tûwr','toor','a primitive root; to meander (causatively, guide) about, especially fortrade or reconnoitring; chap(-man), sent to descry, be excellent, merchant(-man), search (out), seek, (e-) spy (out).'),
	('H8447','תּוֹר','tôwr','tore','or תֹּר; from תּוּר; a succession, i.e. a string or (abstractly) order; border, row, turn.'),
	('H8448','תּוֹר','tôwr','tore','probably the same as תּוֹר; a manner (as a sort of turn); estate.'),
	('H8449','תּוֹר','tôwr','tore','or תֹּר; probably the same as תּוֹר; a ring-dove, often (figuratively) as a term of endearment; (turtle) dove.'),
	('H8450','תּוֹר','tôwr','tore','(Aramaic) corresponding (by permutation) to שׁוֹר; a bull; bullock, ox.'),
	('H8451','תּוֹרָה','tôwrâh','to-raw\'','or תֹּרָה; from יָרָה; a precept or statute, especially the Decalogue or Pentateuch; law.'),
	('H8452','תּוֹרָה','tôwrâh','to-raw\'','probably feminine of תּוֹר; a custom; manner.'),
	('H8453','תּוֹשָׁב','tôwshâb','to-shawb\'','or תֹּשָׁב; (1 Kings 17:1), from יָשַׁב; a dweller (but not outlandish (נׇכְרִי)); especially (as distinguished from a native citizen (active participle of יָשַׁב) and a temporary inmate (גֵּר) or mere lodger (לוּן)); resident alien; foreigner, inhabitant, sojourner, stranger.'),
	('H8454','תּוּשִׁיָּה','tûwshîyâh','too-shee-yaw\'','or תֻּשִׁיָּה; from an unused root probably meaning to substantiate; support or (by implication) ability, i.e. (direct) help, (in purpose) an undertaking, (intellectual) understanding; enterprise, that which (thing as it) is, substance, (sound) wisdom, working.'),
	('H8455','תּוֹתָח','tôwthâch','to-thawkh\'','from an unused root meaning to smite; a club; darts.'),
	('H8456','תָּזַז','tâzaz','taw-zaz\'','a primitive root; to lop off; cut down.'),
	('H8457','תַּזְנוּת','taznûwth','taz-nooth\'','or תַּזְנֻת; from זָנָה; harlotry, i.e. (figuratively) idolatry; fornication, whoredom.'),
	('H8458','תַּחְבֻּלָה','tachbulâh','takh-boo-law\'','or תַּחְבּוּלָה; from חָבַל as denominative from חֶבֶל; (only in plural) properly, steerage (as a management of ropes), i.e. (figuratively) guidance or (by implication) a plan; good advice, (wise) counsels.'),
	('H8459','תֹּחוּ','Tôchûw','to\'-khoo','from an unused root meaning to depress; abasement; Tochu, an Israelite; Tohu.'),
	('H8460','תְּחוֹת','tᵉchôwth','tekh-oth\'','(Aramaic) or תּחֹת; (Aramaic), corresponding to תַּחַת; beneath; under.'),
	('H8461','תַּחְכְּמֹנִי','Tachkᵉmônîy','takh-kem-o-nee\'','probably for חַכְמוֹנִי; sagacious; Tachkemoni, an Israelite; Tachmonite.'),
	('H8462','תְּחִלָּה','tᵉchillâh','tekh-il-law\'','from חָלַל in the sense of opening; a commencement; rel. original (adverb, -ly); begin(-ning), first (time).'),
	('H8463','תַּחֲלוּא','tachălûwʼ','takh-al-oo\'','or תַּחֲלֻא; from חָלָא; a malady; disease, [idiom] grievous, (that are) sick(-ness).'),
	('H8464','תַּחְמָס','tachmâç','takh-mawce\'','from חָמַס; a species of unclean bird (from its violence), perhaps an owl; night hawk.'),
	('H8465','תַּחַן','Tachan','takh\'-an','probably from חָנָה; station; Tachan, the name of two Israelites; Tahan.'),
	('H8466','תַּחֲנָה','tachănâh','takh-an-aw\'','from חָנָה; (only plural collectively) an encampment; camp.'),
	('H8467','תְּחִנָּה','tᵉchinnâh','tekh-in-naw\'','from חָנַן; graciousness; causatively, entreaty; favour, grace, supplication.'),
	('H8468','תְּחִנָּה','Tᵉchinnâh','tekh-in-naw\'','the same as תְּחִנָּה; Techinnah, an Israelite; Tehinnah.'),
	('H8469','תַּחֲנוּן','tachănûwn','takh-an-oon\'','or (feminine) תַּחֲנוּנָה; from חָנַן; earnest prayer; intreaty, supplication.'),
	('H8470','תַּחֲנִי','Tachănîy','takh-an-ee\'','patronymically from תַּחַן; a Tachanite (collectively) or descendants of Tachan; Tahanites.'),
	('H8471','תַּחְפַּנְחֵס','Tachpanchêç','takh-pan-khace\'','or תְּחַפְנְחֵס; (Ezekiel 30:18), or תַּחְפְּנֵס; (Jeremiah 2:16), of Egyptian derivation; Tachpanches, Techaphneches or Tachpenes, a place in Egypt; Tahapanes, Tahpanhes, Tehaphnehes.'),
	('H8472','תַּחְפְּנֵיס','Tachpᵉnêyç','takh-pen-ace\'','of Egyptian derivation; Tachpenes, an Egyptian woman; Tahpenes.'),
	('H8473','תַּחֲרָא','tachărâʼ','takh-ar-aw\'','from חָרָה in the original sense of חוּר or חוּר; a linen corslet (as white or hollow); habergeon.'),
	('H8474','תַּחָרָה','tachârâh','takh-aw-raw\'','a facitious root from חָרָה through the idea of the heat of jealousy; to vie with a rival; close, contend.'),
	('H8475','תַּחְרֵעַ','Tachrêaʻ','takh-ray\'-ah','for תַּאֲרֵעַ; Tachrea, an Israelite; Tahrea.'),
	('H8476','תַּחַשׁ','tachash','takh\'-ash','probably of foreign derivation; a (clean) animal with fur, probably a species of antelope; badger.'),
	('H8477','תַּחַשׁ','Tachash','takh\'-ash','the same as תַּחַשׁ; Tachash, a relative of Abraham; Thahash.'),
	('H8478','תַּחַת','tachath','takh\'-ath','from the same as תּוֹחַ; the bottom (as depressed); only adverbially, below (often with prepositional prefix underneath), in lieu of, etc.; as, beneath, [idiom] flat, in(-stead), (same) place (where...is), room, for...sake, stead of, under, [idiom] unto, [idiom] when...was mine, whereas, (where-) fore, with.'),
	('H8479','תַּחַת','tachath','takh\'-ath','(Aramaic) corresponding to תַּחַת; {the bottom (as depressed); only adverbially, below (often with prepositional prefix underneath), in lieu of, etc.}; under.'),
	('H8480','תַּחַת','Tachath','takh\'-ath','the same as תַּחַת; Tachath, the name of a place in the Desert, also of three Israelites; Tahath.'),
	('H8481','תַּחְתּוֹן','tachtôwn','takh-tone\'','or תַּחְתֹּן; from תַּחַת; bottommost; lower(-est), nether(-most).'),
	('H8482','תַּחְתִּי','tachtîy','takh-tee\'','from תַּחַת; lowermost; as noun (feminine plural) the depths (figuratively, a pit, the womb); low (parts, -er, -er parts, -est), nether (part).'),
	('H8483','תַּחְתִּים חׇדְשִׁי','Tachtîym Chodshîy','takh-teem\' khod-shee\'','apparently from the plural masculine of תַּחְתִּי or תַּחַת and חֹדֶשׁ; lower (ones) monthly; Tachtim-Chodshi, a place in Palestine; Tahtim-hodshi.'),
	('H8484','תִּיכוֹן','tîykôwn','tee-kone\'','or תִּיכֹן; from תָּוֶךְ; central; middle(-most), midst.'),
	('H8485','תֵּימָא','Têymâʼ','tay-maw\'','or תֵּמָא; probably of foreign derivation; Tema, a son of Ishmael, and the region settled by him; Tema.'),
	('H8486','תֵּימָן','têymân','tay-mawn\'','or תֵּמָן; denominative from יָמִין; the south (as being on the right hand of a person facing the east); south (side, -ward, wind).'),
	('H8487','תֵּימָן','Têymân','tay-mawn\'','or תֵּמָן; the same as תֵּימָן; Teman, the name of two Edomites, and of the region and descendant of one of them; south, Teman.'),
	('H8488','תֵּימְנִי','Têymᵉnîy','tay-men-ee\'','probably for תֵּימָנִי; Temeni, an Israelite; Temeni.'),
	('H8489','תֵּימָנִי','Têymânîy','tay-maw-nee\'','patronymically from תֵּימָן; a Temanite or descendant of Teman; Temani, Temanite.'),
	('H8490','תִּימָרָה','tîymârâh','tee-maw-raw\'','or תִּמָרָה; from the same as תָּמָר; a column, i.e. cloud; pillar.'),
	('H8491','תִּיצִי','Tîytsîy','tee-tsee\'','patrial or patronymically from an unused noun of uncertain meaning; a Titsite or descendant or inhabitant of an unknown Tits; Tizite.'),
	('H8492','תִּירוֹשׁ','tîyrôwsh','tee-roshe\'','or תִּירֹשׁ; from יָרַשׁ in the sense of expulsion; must or fresh grape-juice (as just squeezed out); by implication (rarely) fermented wine; (new, sweet) wine.'),
	('H8493','תִּירְיָא','Tîyrᵉyâʼ','tee-reh-yaw\'','probably from יָרֵא; fearful, Tirja, an Israelite; Tiria.'),
	('H8494','תִּירָס','Tîyrâç','tee-rawce\'','probably of foreign derivation; Tiras, a son of Japheth; Tiras.'),
	('H8495','תַּיִשׁ','tayish','tah\'-yeesh','from an unused root meaning to butt; a buck or he-goat (as given to butting); he goat.'),
	('H8496','תֹּךְ','tôk','toke','or תּוֹך; (Psalm 72:14), from the same base as תָּוֶךְ (in the sense of cutting to pieces); oppression; deceit, fraud.'),
	('H8497','תָּכָה','tâkâh','taw-kaw\'','a primitive root; to strew, i.e. encamp; sit down.'),
	('H8498','תְּכוּנָה','tᵉkûwnâh','tek-oo-naw\'','feminine passive participle of תָּכַן; adjustment, i.e. structure; by implication, equipage; fashion, store.'),
	('H8499','תְּכוּנָה','tᵉkûwnâh','tek-oo-naw\'','from כּוּן; or probably identical with תְּכוּנָה; something arranged or fixed, i.e. a place; seat.'),
	('H8500','תֻּכִּי','tukkîy','took-kee\'','or תּוּכִּי; probably of foreign derivation; some imported creature, probably a peacock; peacock.'),
	('H8501','תָּכָךְ','tâkâk','taw-kawk\'','from an unused root meaning; to dissever, i.e. crush; deceitful.'),
	('H8502','תִּכְלָה','tiklâh','tik-law\'','from כָּלָה; completeness; perfection.'),
	('H8503','תַּכְלִית','taklîyth','tak-leeth\'','from כָּלָה; completion; by implication, an extremity; end, perfect(-ion).'),
	('H8504','תְּכֵלֶת','tᵉkêleth','tek-ay\'-leth','probably for שְׁחֶלֶת; the cerulean mussel, i.e. the color (violet) obtained therefrom or stuff dyed therewith; blue.'),
	('H8505','תָּכַן','tâkan','taw-kan\'','a primitive root; to balance, i.e. measure out (by weight or dimension); figuratively, arrange, equalize, through the idea of levelling (ment. estimate, test); bear up, direct, be (un-)equal, mete, ponder, tell, weigh.'),
	('H8506','תֹּכֶן','tôken','to\'-ken','from תָּכַן; a fixed quantity; measure, tale.'),
	('H8507','תֹּכֶן','Tôken','to\'-ken','the same as תֹּכֶן; Token, a place in Palestine; Tochen.'),
	('H8508','תׇּכְנִית','toknîyth','tok-neeth\'','from תֹּכֶן; admeasurement, i.e. consummation; pattern, sum.'),
	('H8509','תַּכְרִיךְ','takrîyk','tak-reek\'','apparently from an unused root meaning to encompass; a wrapper or robe; garment.'),
	('H8510','תֵּל','têl','tale','by contraction from תָּלַל; a mound; heap, [idiom] strength.'),
	('H8511','תָּלָא','tâlâʼ','taw-law\'','a primitive root; to suspend; figuratively (through hesitation) to be uncertain; by implication (of mental dependence) to habituate; be bent, hang (in doubt).'),
	('H8512','תֵּל אָבִיב','Têl ʼÂbîyb','tale aw-beeb\'','from תֵּל and אָבִיב; mound of green growth; Tel-Abib, a place in Chaldaea; Tel-abib.'),
	('H8513','תְּלָאָה','tᵉlâʼâh','tel-aw-aw\'','from לָאָה; distress; travail, travel, trouble.'),
	('H8514','תַּלְאוּבָה','talʼûwbâh','tal-oo-baw\'','from לַהַב; desiccation; great drought.'),
	('H8515','תְּלַאשַּׂר','Tᵉlaʼssar','tel-as-sar\'','or תְּלַשַּׂר; of foreign derivation; Telassar, a region of Assyria; Telassar.'),
	('H8516','תַּלְבֹּשֶׁת','talbôsheth','tal-bo\'-sheth','from לָבַשׁ; a garment; clothing.'),
	('H8517','תְּלַג','tᵉlag','tel-ag\'','(Aramaic) corresponding to שֶׁלֶג; snow; snow.'),
	('H8518','תָּלָה','tâlâh','taw-law\'','a primitive root; to suspend (especially to gibbet); hang (up).'),
	('H8519','תְּלוּנָה','tᵉlûwnâh','tel-oo-naw\'','or תּלֻנָּה; from לוּן in the sense of obstinacy; a grumbling; murmuring.'),
	('H8520','תֶּלַח','Telach','teh\'-lakh','probably from an unused root meaning to dissever; breach; Telach, an Israelite; Telah.'),
	('H8521','תֵּל חַרְשָׁא','Têl Charshâʼ','tale khar-shaw\'','from תֵּל and the feminine of חֲרָשִׁים; mound of workmanship; Tel-Charsha, a place in Babylonia; Tel-haresha, Tel-harsa.'),
	('H8522','תְּלִי','tᵉlîy','tel-ee\'','probably from תָּלָה; a quiver (as slung); quiver.'),
	('H8523','תְּלִיתַי','tᵉlîythay','tel-ee-thah\'-ee','(Aramaic) or תַּלְתִּי; (Aramaic), ordinal from תְּלָת; third; third.'),
	('H8524','תָּלַל','tâlal','taw-lal\'','a primitive root; to pile up, i.e. elevate; eminent. Compare הָתַל.'),
	('H8525','תֶּלֶם','telem','teh\'-lem','from an unused root meaning to accumulate; a bank or terrace; furrow, ridge.'),
	('H8526','תַּלְמַי','Talmay','tal-mah\'-ee','from תֶּלֶם; ridged; Talmai, the name of a Canaanite and a Syrian; Talmai.'),
	('H8527','תַּלְמִיד','talmîyd','tal-meed\'','from לָמַד; a pupil; scholar.'),
	('H8528','תֵּל מֶלַח','Têl Melach','tale meh\'-lakh','from תֵּל and מֶלַח; mound of salt; Tel-Melach, a place in Babylonia; Tel-melah.'),
	('H8529','תָּלַע','tâlaʻ','taw-law\'','a denominative from תּוֹלָע; to crimson, i.e. dye that color; [idiom] scarlet.'),
	('H8530','תַּלְפִּיָּה','talpîyâh','tal-pee-yaw\'','feminine from an unused root meaning to tower; something tall, i.e. (plural collective) slenderness; armoury.'),
	('H8531','תְּלַת','tᵉlath','tel-ath\'','(Aramaic) from תְּלָת; a tertiary rank; third.'),
	('H8532','תְּלָת','tᵉlâth','tel-awth\'','(Aramaic) masculine תְּלָתָה; (Aramaic), or תְּלָתָא; (Aramaic), corresponding to שָׁלוֹשׁ; three or third; third, three.'),
	('H8533','תְּלָתִין','tᵉlâthîyn','tel-aw-theen\'','(Aramaic) multiple of תְּלָת; ten times three; thirty.'),
	('H8534','תַּלְתַּל','taltal','tal-tal\'','by reduplication, from תָּלַל through the idea of vibration; a trailing bough (as pendulous); bushy.'),
	('H8535','תָּם','tâm','tawm','from תָּמַם; complete; usually (morally) pious; specifically, gentle, dear; coupled together, perfect, plain, undefiled, upright.'),
	('H8536','תָּם','tâm','tawm','(Aramaic) corresponding to שָׁם; there; [idiom] thence, there, [idiom] where.'),
	('H8537','תֹּם','tôm','tome','from תָּמַם; completeness; figuratively, prosperity; usually (morally) innocence; full, integrity, perfect(-ion), simplicity, upright(-ly, -ness), at a venture. See תֻּמִּים.'),
	('H8538','תֻּמָּה','tummâh','toom-maw\'','feminine of תֹּם; innocence; integrity.'),
	('H8539','תָּמַהּ','tâmahh','taw-mah\'','a primitive root; to be in consternation; be amazed, be astonished, marvel(-lously), wonder.'),
	('H8540','תְּמַהּ','tᵉmahh','tem-ah\'','(Aramaic) from a root corresponding to תָּמַהּ; a miracle; wonder.'),
	('H8541','תִּמָּהוֹן','timmâhôwn','tim-maw-hone\'','from תָּמַהּ; consternation; astonishment.'),
	('H8542','תַּמּוּז','Tammûwz','tam-mooz\'','of uncertain derivation; Tammuz, a Phoenician deity; Tammuz.'),
	('H8543','תְּמוֹל','tᵉmôwl','tem-ole\'','or תְּמֹל; probably for אֶתְמוֹל; sometimes with  שִׁלְשׁוֹם; properly, ago, i.e. a (short or long) time since; especially yesterday, or  day before yesterday; [phrase] before (-time), [phrase] these (three) days, [phrase] heretofore, [phrase] time past, yesterday.'),
	('H8544','תְּמוּנָה','tᵉmûwnâh','tem-oo-naw\'','or תְּמֻנָה; from מִין; something portioned (i.e. fashioned) out, as ashape, i.e. (indefinitely) phantom, or (specifically) embodiment, or (figuratively) manifestation (of favor); image, likeness, similitude.'),
	('H8545','תְּמוּרָה','tᵉmûwrâh','tem-oo-raw\'','from מוּר; barter, compensation; (ex-) change(-ing), recompense, restitution.'),
	('H8546','תְּמוּתָה','tᵉmûwthâh','tem-oo-thaw\'','from מוּת; execution (as a doom); death, die.'),
	('H8547','תֶּמַח','Temach','teh\'-makh','of uncertain derivation; Temach, one of the Nethinim; Tamah, Thamah.'),
	('H8548','תָּמִיד','tâmîyd','taw-meed\'','from an unused root meaning to stretch; properly, continuance (as indefinite extension); but used only (attributively as adjective) constant (or adverbially, constantly); ellipt. the regular (daily) sacrifice; alway(-s), continual (employment, -ly), daily, (n-)ever(-more), perpetual.'),
	('H8549','תָּמִים','tâmîym','taw-meem\'','from תָּמַם; entire (literally, figuratively or morally); also (as noun) integrity, truth; without blemish, complete, full, perfect, sincerely (-ity), sound, without spot, undefiled, upright(-ly), whole.'),
	('H8550','תֻּמִּים','Tummîym','toom-meem\'','plural of תֹּם; perfections, i.e. (techn.) one of the epithets of the objects in the high-priest\'s breastplate as an emblem of complete Truth; Thummim.'),
	('H8551','תָּמַךְ','tâmak','taw-mak\'','a primitive root; to sustain; by implication, to obtain, keep fast; figuratively, to help, follow close; (take, up-) hold (up), maintain, retain, stay (up).'),
	('H8552','תָּמַם','tâmam','taw-mam\'','a primitive root; to complete, in a good or a bad sense, literal, or figurative, transitive or intransitive; accomplish, cease, be clean (pass-) ed, consume, have done, (come to an, have an, make an) end, fail, come to the full, be all gone, [idiom] be all here, be (make) perfect, be spent, sum, be (shew self) upright, be wasted, whole.'),
	('H8553','תִּמְנָה','Timnâh','tim-naw\'','from מָנָה; a portion assigned; Timnah, the name of two places in Palestine; Timnah, Timnath, Thimnathah.'),
	('H8554','תִּמְנִי','Timnîy','tim-nee\'','patrial from תִּמְנָה; a Timnite or inhabitant of Timnah; Timnite.'),
	('H8555','תִּמְנָע','Timnâʻ','tim-naw\'','from מָנַע; restraint; Timna, the name of two Edomites; Timna, Timnah.'),
	('H8556','תִּמְנַת חֶרֶס','Timnath Chereç','tim-nath kheh\'-res','or תִּמְנַת סֶרַח; from תִּמְנָה and חֶרֶס; portion of (the) sun; Timnath-Cheres, a place in Palestine; Timnath-heres, Timnath-serah.'),
	('H8557','תֶּמֶס','temeç','teh\'-mes','from מָסָה; liquefaction, i.e. disappearance; melt.'),
	('H8558','תָּמָר','tâmâr','taw-mawr\'','from an unused root meaning to be erect; a palm tree; palm (tree).'),
	('H8559','תָּמָר','Tâmâr','taw-mawr\'','the same as תָּמָר; Tamar, the name of three women and a place; Tamar.'),
	('H8560','תֹּמֶר','tômer','to\'-mer','from the same root as תָּמָר; a palm trunk; palm tree.'),
	('H8561','תִּמֹּר','timmôr','tim-more\'','(plural or (feminine) תִּמֹּרָה; (singular and plural), from the same root as תָּמָר; (architectural) a palm-like pilaster (i.e. umbellate); palm tree.'),
	('H8562','תַּמְרוּק','tamrûwq','tam-rook\'','or תַּמְרֻק; or תַּמְרִיק; from מָרַק; properly, a scouring, i.e. soap or perfumery forthe bath; figuratively, a detergent; [idiom] cleanse, (thing for) purification(-fying).'),
	('H8563','תַּמְרוּר','tamrûwr','tam-roor\'','from מָרַר; bitterness (plural as collective); [idiom] most bitter(-ly).'),
	('H8564','תַּמְרוּר','tamrûwr','tam-roor\'','from the same root as תָּמָר; an erection, i.e. pillar (probably for a guide-board); high heap.'),
	('H8565','תַּן','tan','tan','from an unused root probably meaning to elongate; a monster (as preternaturally formed), i.e. a sea-serpent (or other huge marine animal); also a jackal (or other hideous land animal); dragon, whale. Compare תַּנִּין.'),
	('H8566','תָּנָה','tânâh','taw-naw\'','a primitive root; to present (a mercenary inducement), i.e. bargain with (a harlot); hire.'),
	('H8567','תָּנָה','tânâh','taw-naw\'','a primitive root (identical with through the idea of attributing honor); to ascribe (praise), i.e. celebrate, commemorate; lament, rehearse.'),
	('H8568','תַּנָּה','tannâh','tan-naw\'','probably feminine of תַּן; a female jackal; dragon.'),
	('H8569','תְּנוּאָה','tᵉnûwʼâh','ten-oo-aw\'','from נוּא; alienation; by implication, enmity; breach of promise, occasion.'),
	('H8570','תְּנוּבָה','tᵉnûwbâh','ten-oo-baw\'','from נוּב; produce; fruit, increase.'),
	('H8571','תְּנוּךְ','tᵉnûwk','ten-ook\'','perhaps from the same as אֲנָךְ through the idea of protraction; a pinnacle, i.e. extremity; tip.'),
	('H8572','תְּנוּמָה','tᵉnûwmâh','ten-oo-maw\'','from נוּם; drowsiness, i.e. sleep; slumber(-ing).'),
	('H8573','תְּנוּפָה','tᵉnûwphâh','ten-oo-faw\'','from נוּף; a brandishing (in threat); by implication, tumult; specifically, the official undulation of sacrificial offerings; offering, shaking, wave (offering).'),
	('H8574','תַּנּוּר','tannûwr','tan-noor\'','from נִיר; a fire-pot; furnace, oven.'),
	('H8575','תַּנְחוּם','tanchûwm','tan-khoom\'','or תַּנְחֻם; and (feminine) תַּנְחוּמָה; from נָחַם; compassion, solace; comfort, consolation.'),
	('H8576','תַּנְחֻמֶת','Tanchumeth','tan-khoo\'-meth','for תַּנְחוּם (feminine); Tanchumeth, an Israelite; Tanhumeth.'),
	('H8577','תַּנִּין','tannîyn','tan-neen\'','or תַּנִּים; (Ezekiel 29:3), intensive from the same as תַּן; a marine or land monster, i.e. sea-serpent or jackal; dragon, sea-monster, serpent, whale.'),
	('H8578','תִּנְיָן','tinyân','tin-yawn\'','(Aramaic) corresponding to שְׁנַיִם; second; second.'),
	('H8579','תִּנְיָנוּת','tinyânûwth','tin-yaw-nooth\'','(Aramaic) from תִּנְיָן; a second time; again.'),
	('H8580','תַּנְשֶׁמֶת','tanshemeth','tan-sheh\'-meth','from נָשַׁם; properly, a hard breather, i.e. the name of two unclean creatures, a lizard and abird (both perhaps from changing color through their irascibility), probably the tree-toad and the water-hen; mole, swan.'),
	('H8581','תַּעָב','taʻâb','taw-ab\'','a primitive root; to loathe, i.e. (morally) detest; (make to be) abhor(-red), (be, commit more, do) abominable(-y), [idiom] utterly.'),
	('H8582','תָּעָה','tâʻâh','taw-aw\'','a primitive root; to vacillate, i.e. reel or stray (literally or figuratively); also causative of both; (cause to) go astray, deceive, dissemble, (cause to, make to) err, pant, seduce, (make to) stagger, (cause to) wander, be out of the way.'),
	('H8583','תֹּעוּ','Tôʻûw','to\'-oo','or תֹּעִי; from תָּעָה; error; Tou or Toi, a Syrian king; Toi, Tou.'),
	('H8584','תְּעוּדָה','tᵉʻûwdâh','teh-oo-daw\'','from עוּד; attestation, i.e. a precept, usage; testimony.');
INSERT INTO `strongs` (`number`, `lemma`, `xlit`, `pronounce`, `description`)
VALUES
	('H8585','תְּעָלָה','tᵉʻâlâh','teh-aw-law\'','from עָלָה; a channel (into which water is raised for irrigation); also a bandage or plaster (as placed upon a wound); conduit, cured, healing, little river, trench, watercourse.'),
	('H8586','תַּעֲלוּל','taʻălûwl','tah-al-ool\'','from עָלַל; caprice (as a fit coming on), i.e. vexation; concretely a tyrant; babe, delusion.'),
	('H8587','תַּעֲלֻמָּה','taʻălummâh','tah-al-oom-maw\'','from עָלַם; a secret; thing that is hid, secret.'),
	('H8588','תַּעֲנוּג','taʻănûwg','tah-an-oog\'','or תַּעֲנֻג; and (feminine) תַּעֲנֻגָה; from עָנַג; luxury; delicate, delight, pleasant.'),
	('H8589','תַּעֲנִית','taʻănîyth','tah-an-eeth\'','from עָנָה; affliction (of self), i.e. fasting; heaviness.'),
	('H8590','תַּעֲנָךְ','Taʻănâk','tah-an-awk\'','or תַּעְנָךְ; of uncertain derivation; Taanak or Tanak, a place in Palestine; Taanach, Tanach.'),
	('H8591','תָּעַע','tâʻaʻ','taw-ah\'','a primitive root; to cheat; by analogy, to maltreat; deceive, misuse.'),
	('H8592','תַּעֲצֻמָה','taʻătsumâh','tah-ats-oo-maw\'','from עָצַם; might (plural collective); power.'),
	('H8593','תַּעַר','taʻar','tah\'-ar','from עָרָה; a knife or razor (as making bare); also a scabbard (as being bare, i.e. empty); (pen-) knife, razor, scabbard, shave, sheath.'),
	('H8594','תַּעֲרֻבָה','taʻărubâh','tah-ar-oo-baw\'','from עָרַב; suretyship, i.e. (concretely) a pledge; [phrase] hostage.'),
	('H8595','תַּעְתֻּעַ','taʻtuaʻ','tah-too\'-ah','from תָּעַע; a fraud; error.'),
	('H8596','תֹּף','tôph','tofe','from תָּפַף contracted; a tambourine; tabret, timbrel.'),
	('H8597','תִּפְאָרָה','tiphʼârâh','tif-aw-raw\'','or תִּפְאֶרֶת; from פָּאַר; ornament (abstractly or concretely, literally or figuratively); beauty(-iful), bravery, comely, fair, glory(-ious), honour, majesty.'),
	('H8598','תַּפּוּחַ','tappûwach','tap-poo\'-akh','from נָפַח; an apple (from its fragrance), i.e. the fruit or the tree (probably includ. others of the pome order, as the quince, the orange, etc.); apple (tree). See also בֵּית תַּפּוּחַ.'),
	('H8599','תַּפּוּחַ','Tappûwach','tap-poo\'-akh','the same as תַּפּוּחַ; Tappuach, the name of two places in Palestine, also of an Israelite; Tappuah.'),
	('H8600','תְּפוֹצָה','tᵉphôwtsâh','tef-o-tsaw\'','from פּוּץ; a dispersal; dispersion.'),
	('H8601','תֻּפִין','tuphîyn','too-feen\'','from אָפָה; cookery, i.e. (concretely) a cake; baked piece.'),
	('H8602','תָּפֵל','tâphêl','taw-fale\'','from an unused root meaning to smear; plaster (as gummy) or slime; (figuratively) frivolity; foolish things, unsavoury, untempered.'),
	('H8603','תֹּפֶל','Tôphel','to\'-fel','from the same as תָּפֵל; quagmire; Tophel, a place near the Desert; Tophel.'),
	('H8604','תִּפְלָה','tiphlâh','tif-law\'','from the same as תָּפֵל; frivolity; folly, foolishly.'),
	('H8605','תְּפִלָּה','tᵉphillâh','tef-il-law\'','from פָּלַל; intercession, supplication; by implication, a hymn; prayer.'),
	('H8606','תִּפְלֶצֶת','tiphletseth','tif-leh\'-tseth','from פָּלַץ; fearfulness; terrible.'),
	('H8607','תִּפְסַח','Tiphçach','tif-sakh\'','from פָּסַח; ford; Tiphsach, a place in Mesopotamia; Tipsah.'),
	('H8608','תָּפַף','tâphaph','taw-faf\'','a primitive root; to drum, i.e. play (as) on the tambourine; taber, play with timbrels.'),
	('H8609','תָּפַר','tâphar','taw-far\'','a primitive root; to sew; (women that) sew (together).'),
	('H8610','תָּפַשׂ','tâphas','taw-fas\'','a primitive root; to manipulate, i.e. seize; chiefly to capture, wield, specifically, to overlay; figuratively, to use unwarrantably; catch, handle, (lay, take) hold (on, over), stop, [idiom] surely, surprise, take.'),
	('H8611','תֹּפֶת','tôpheth','to\'-feth','from the base of תָּפַף; a smiting, i.e. (figuratively) contempt; tabret.'),
	('H8612','תֹּפֶת','Tôpheth','to\'-feth','the same as תֹּפֶת; Topheth, a place near Jerusalem; Tophet, Topheth.'),
	('H8613','תׇּפְתֶּה','Tophteh','tof-teh\'','probably a form of תֹּפֶת; Tophteh, a place of cremation; Tophet.'),
	('H8614','תִּפְתַּי','tiphtay','tif-tah\'-ee','(Aramaic) perhaps from שָׁפַט; judicial, i.e. a lawyer; sheriff.'),
	('H8615','תִּקְוָה','tiqvâh','tik-vaw\'','from קָוָה; (compare קָוֶה); literally a cord (as an attachment); figuratively, expectancy; expectation(-ted), hope, live, thing that I long for.'),
	('H8616','תִּקְוָה','Tiqvâh','tik-vaw\'','the same as תִּקְוָה; Tikvah, the name of two Israelites; Tikvah.'),
	('H8617','תְּקוּמָה','tᵉqûwmâh','tek-oo-maw\'','from קוּם; resistfulness; power to stand.'),
	('H8618','תְּקוֹמֵם','tᵉqôwmêm','tek-o-mame\'','from קוּם; an opponent; rise up against.'),
	('H8619','תָּקוֹעַ','tâqôwaʻ','taw-ko\'-ah','from תָּקַע (in the musical sense); a trumpet; trumpet.'),
	('H8620','תְּקוֹעַ','Tᵉqôwaʻ','tek-o\'-ah','a form of תָּקוֹעַ; Tekoa, a place in Palestine; Tekoa, Tekoah.'),
	('H8621','תְּקוֹעִי','Tᵉqôwʻîy','tek-o-ee\'','or תְּקֹעִי; patronymically from תְּקוֹעַ; a Tekoite or inhabitant of Tekoah; Tekoite.'),
	('H8622','תְּקוּפָה','tᵉqûwphâh','tek-oo-faw\'','or תְּקֻפָה; from נָקַף; a revolution, i.e. (of the sun) course, (of time) lapse; circuit, come about, end.'),
	('H8623','תַּקִּיף','taqqîyph','tak-keef\'','from תָּקַף; powerful; mightier.'),
	('H8624','תַּקִּיף','taqqîyph','tak-keef\'','(Aramaic) corresponding to תַּקִּיף; {powerful}; mighty, strong.'),
	('H8625','תְּקַל','tᵉqal','tek-al\'','(Aramaic) corresponding to שָׁקַל; to balance; Tekel, be weighed.'),
	('H8626','תָּקַן','tâqan','taw-kan\'','a primitive root; to equalize, i.e. straighten (intransitive or transitive); figuratively, to compose; set in order, make straight.'),
	('H8627','תְּקַן','tᵉqan','tek-an\'','(Aramaic) corresponding to תָּקַן; to straighten up, i.e. confirm; establish.'),
	('H8628','תָּקַע','tâqaʻ','taw-kah\'','a primitive root; to clatter, i.e. slap (the hands together), clang (an instrument); by analogy, to drive (a nail or tent-pin, a dart, etc.); by implication, to become bondsman by handclasping); blow (a trumpet), cast, clap, fasten, pitch (tent), smite, sound, strike, [idiom] suretiship, thrust.'),
	('H8629','תֵּקַע','têqaʻ','tay-kah\'','from תָּקַע; a blast of a trumpet; sound.'),
	('H8630','תָּקַף','tâqaph','taw-kaf\'','a primitive root; to overpower; prevail (against).'),
	('H8631','תְּקֵף','tᵉqêph','tek-afe\'','(Aramaic) corresponding to תָּקַף; to become (causatively, make) mighty or (figuratively) obstinate; make firm, harden, be(-come) strong.'),
	('H8632','תְּקֹף','tᵉqôph','tek-ofe\'','(Aramaic) corresponding to תֹּקֶף; power; might, strength.'),
	('H8633','תֹּקֶף','tôqeph','to\'-kef','from תָּקַף; might or (figuratively) positiveness; authority, power, strength.'),
	('H8634','תַּרְאֲלָה','Tarʼălâh','tar-al-aw\'','probably for תַּרְעֵלָה; a reeling; Taralah, a place in Palestine; Taralah.'),
	('H8635','תַּרְבּוּת','tarbûwth','tar-booth\'','from רָבָה; multiplication, i.e. progeny; increase.'),
	('H8636','תַּרְבִּית','tarbîyth','tar-beeth\'','from רָבָה; multiplication, i.e. percentage or bonus in addition to principal; increase, unjust gain.'),
	('H8637','תִּרְגַּל','tirgal','teer-gal\'','a denominative from רָגַל; to cause to walk; teach to go.'),
	('H8638','תִּרְגַּם','tirgam','teer-gam\'','a denominative from רָגַם in the sense of throwing over; to transfer, i.e. translate; interpret.'),
	('H8639','תַּרְדֵּמָה','tardêmâh','tar-day-maw\'','from רָדַם; a lethargy or (by implication) trance; deep sleep.'),
	('H8640','תִּרְהָקָה','Tirhâqâh','teer-haw\'-kaw','of foreign derivation; Tirhakah, a king of Kush; Tirhakah.'),
	('H8641','תְּרוּמָה','tᵉrûwmâh','ter-oo-maw\'','or תְּרֻמָה; (Deuteronomy 12:11), from רוּם; a present (as offered up), especially in sacrifice or as tribute; gift, heave offering (shoulder), oblation, offered(-ing).'),
	('H8642','תְּרוּמִיָּה','tᵉrûwmîyâh','ter-oo-mee-yaw\'','formed as תְּרוּמָה; a sacrificial offering; oblation.'),
	('H8643','תְּרוּעָה','tᵉrûwʻâh','ter-oo-aw\'','from רוּעַ; clamor, i.e. acclamation of joy or a battle-cry; especially clangorof trumpets, as an alarum; alarm, blow(-ing) (of, the) (trumpets), joy, jubile, loud noise, rejoicing, shout(-ing), (high, joyful) sound(-ing).'),
	('H8644','תְּרוּפָה','tᵉrûwphâh','ter-oo-faw\'','from רוּף in the sense of its congener רָפָא; a remedy; medicine.'),
	('H8645','תִּרְזָה','tirzâh','teer-zaw\'','probably from רָזָה; a species of tree (apparently from its slenderness), perhaps the cypress; cypress.'),
	('H8646','תֶּרַח','Terach','teh\'-rakh','of uncertain derivation; Terach, the father of Abraham; also a place in the Desert; Tarah, Terah.'),
	('H8647','תִּרְחֲנָה','Tirchănâh','teer-khan-aw\'','of uncertain derivation; Tirchanah, an Israelite; Tirhanah.'),
	('H8648','תְּרֵין','tᵉrêyn','ter-ane\'','(Aramaic) feminine תַּרְתֵּין; corresponding to שְׁנַיִם; two; second, [phrase] twelve, two.'),
	('H8649','תׇּרְמָה','tormâh','tor-maw\'','and תַּרְמוּת; or תַּרְמִית; from רָמָה; fraud; deceit(-ful), privily.'),
	('H8650','תֹּרֶן','tôren','to\'-ren','probably for אֹרֶן; a pole (as a mast or flagstaff); beacon, mast.'),
	('H8651','תְּרַע','tᵉraʻ','ter-ah\'','(Aramaic) corresponding to שַׁעַר; a door; by implication, a palace; gate mouth.'),
	('H8652','תָּרָע','târâʻ','taw-raw\'','(Aramaic) from תְּרַע; a doorkeeper; porter.'),
	('H8653','תַּרְעֵלָה','tarʻêlâh','tar-ay-law\'','from רָעַל; reeling; astonishment, trembling.'),
	('H8654','תִּרְעָתִי','Tirʻâthîy','teer-aw-thee\'','patrial from an unused name meaning gate; a Tirathite or inhabitant of an unknown Tirah; Tirathite.'),
	('H8655','תְּרָפִים','tᵉrâphîym','ter-aw-feme\'','plural from רָפָא; a healer; Teraphim (singular or plural) a family idol; idols(-atry), images, teraphim.'),
	('H8656','תִּרְצָה','Tirtsâh','teer-tsaw\'','from רָצָה; delightsomeness; Tirtsah, a place in Palestine; also an Israelitess; Tirzah.'),
	('H8657','תֶּרֶשׁ','Teresh','teh\'-resh','of foreign derivation; Teresh, a eunuch of Xerxes; Teresh.'),
	('H8658','תַּרְשִׁישׁ','tarshîysh','tar-sheesh\'','probably of foreign derivation (compare תַּרְשִׁישׁ); a gem, perhaps the topaz; beryl.'),
	('H8659','תַּרְשִׁישׁ','Tarshîysh','tar-sheesh\'','probably the same as תַּרְשִׁישׁ (as the region of the stone, or the reverse); Tarshish, a place on the Mediterranean, hence, the ephithet of a merchant vessel (as if for or from that port); also the name of a Persian and of an Israelite; Tarshish, Tharshish.'),
	('H8660','תִּרְשָׁתָא','Tirshâthâʼ','teer-shaw-thaw\'','of foreign derivation; Tirshatha, the title of a Persian deputy or governor; Tirshatha.'),
	('H8661','תַּרְתָּן','Tartân','tar-tawn\'','of foreign derivation; Tartan, an Assyrian; Tartan.'),
	('H8662','תַּרְתָּק','Tartâq','tar-tawk\'','of foreign derivation; Tartak, a deity of the Avvites; Tartak.'),
	('H8663','תְּשֻׁאָה','tᵉshuʼâh','tesh-oo-aw\'','from שׁוֹא; a crashing or loud clamor; crying, noise, shouting, stir.'),
	('H8664','תִּשְׁבִּי','Tishbîy','tish-bee\'','patrial from an unused name meaning recourse; a Tishbite or inhabitant of Tishbeh (in Gilead); Tishbite.'),
	('H8665','תַּשְׁבֵּץ','tashbêts','tash-bates\'','from שָׁבַץ; checkered stuff (as reticulated); broidered.'),
	('H8666','תְּשׁוּבָה','tᵉshûwbâh','tesh-oo-baw\'','or תְּשֻׁבָה; from שׁוּב; a recurrence (of time or place); a reply (as returned); answer, be expired, return.'),
	('H8667','תְּשׂוּמֶת','tᵉsûwmeth','tes-oo-meth\'','from שׂוּם; a deposit, i.e. pledging; [phrase] fellowship.'),
	('H8668','תְּשׁוּעָה','tᵉshûwʻâh','tesh-oo-aw\'','or תְּשֻׁעָה; from שָׁוַע in the sense of יָשַׁע; rescue (literal or figurative, persons, national or spiritual); deliverance, help, safety, salvation, victory.'),
	('H8669','תְּשׁוּקָה','tᵉshûwqâh','tesh-oo-kaw\'','from שׁוּק in the original sense of stretching out after; a longing; desire.'),
	('H8670','תְּשׁוּרָה','tᵉshûwrâh','tesh-oo-raw\'','from שׁוּר in the sense of arrival; a gift; present.'),
	('H8671','תְּשִׁיעִי','tᵉshîyʻîy','tesh-ee-ee\'','ordinal from תֵּשַׁע; ninth; ninth.'),
	('H8672','תֵּשַׁע','têshaʻ','tay\'-shah','or (masculine) תִּשְׁעָה; perhaps from שָׁעָה through the idea of a turn to the next or full number ten; nine or (ordinal) ninth; nine ([phrase] -teen, [phrase] -teenth, -th).'),
	('H8673','תִּשְׁעִים','tishʻîym','tish-eem\'','multiple from תֵּשַׁע; ninety; ninety.'),
	('H8674','תַּתְּנַי','Tattᵉnay','tat-ten-ah\'-ee','of foreign derivation; Tattenai, a Persian; Tatnai.'),
	('G1','Α','A','al\'-fah','of Hebrew origin; the first letter of the alphabet; figuratively, only (from its use as a numeral) the first: --Alpha. Often used (usually , before a vowel) also in composition (as a contraction from ἄνευ) in the sense of privation; so, in many words, beginning with this letter; occasionally in the sense of union (as a contraction of ἅμα).'),
	('G2','Ἀαρών','Aarṓn','ah-ar-ohn\'','of Hebrew origin (אַהֲרוֹן); Aaron, the brother of Moses:--Aaron.'),
	('G3','Ἀβαδδών','Abaddṓn','ab-ad-dohn\'','of Hebrew origin (אֲבַדּוֹן); a destroying angel:--Abaddon.'),
	('G4','ἀβαρής','abarḗs','ab-ar-ace\'','from Α (as a negative particle) and βάρος; weightless, i.e. (figuratively) not burdensome:--from being burdensome.'),
	('G5','Ἀββᾶ','Abbâ','ab-bah\'','of Chaldee origin (אַב); father as a vocative:--Abba.'),
	('G6','Ἄβελ','Ábel','ab\'-el','of Hebrew origin (הֶבֶל); Abel, the son of Adam:--Abel.'),
	('G7','Ἀβιά','Abiá','ab-ee-ah\'','of Hebrew origin (אֲבִיָּה); Abijah, the name of two Israelites:--Abia.'),
	('G8','Ἀβιαθάρ','Abiathár','ab-ee-ath\'-ar','of Hebrew origin (אֶבְיָתָר); Abiathar, an Israelite:--Abiathar.'),
	('G9','Ἀβιληνή','Abilēnḗ','ab-ee-lay-nay\'','of foreign origin (compare אָבֵל); Abilene, a region of Syria:--Abilene.'),
	('G10','Ἀβιούδ','Abioúd','ab-ee-ood\'','of Hebrew origin (אֲבִיהוּד); Abihud, an Israelite:--Abiud.'),
	('G11','Ἀβραάμ','Abraám','ab-rah-am\'','of Hebrew origin (אַבְרָהָם); Abraham, the Hebrew patriarch:--Abraham. (In Acts 7:16 the text should probably read Jacob.)'),
	('G12','ἄβυσσος','ábyssos','ab\'-us-sos','from Α (as a negative particle) and a variation of βυθός; depthless, i.e. (specially) (infernal) \"abyss\":--deep, (bottomless) pit.'),
	('G13','Ἄγαβος','Ágabos','ag\'-ab-os','of Hebrew origin (compare חָגָב); Agabus, an Israelite:--Agabus.'),
	('G14','ἀγαθοεργέω','agathoergéō','ag-ath-er-gheh\'-o','from ἀγαθός and ἔργον; to work good:--do good.'),
	('G15','ἀγαθοποιέω','agathopoiéō','ag-ath-op-oy-eh\'-o','from ἀγαθοποιός; to be a well-doer (as a favor or a duty):--(when) do good (well).'),
	('G16','ἀγαθοποιΐα','agathopoiḯa','ag-ath-op-oy-ee\'-ah','from ἀγαθοποιός; well-doing, i.e. virtue:--well-doing.'),
	('G17','ἀγαθοποιός','agathopoiós','ag-ath-op-oy-os\'','from ἀγαθός and ποιέω; a well-doer, i.e. virtuous:--them that do well.'),
	('G18','ἀγαθός','agathós','ag-ath-os\'','a primary word; \"good\" (in any sense, often as noun):--benefit, good(-s, things), well. Compare καλός.'),
	('G19','ἀγαθωσύνη','agathōsýnē','ag-ath-o-soo\'-nay','from ἀγαθός; goodness, i.e. virtue or beneficence:--goodness.'),
	('G20','ἀγαλλίασις','agallíasis','ag-al-lee\'-as-is','from ἀγαλλιάω; exultation; specially, welcome:--gladness, (exceeding) joy.'),
	('G21','ἀγαλλιάω','agalliáō','ag-al-lee-ah\'-o','from agan (much) and ἅλλομαι; properly, to jump for joy, i.e. exult:--be (exceeding) glad, with exceeding joy, rejoice (greatly).'),
	('G22','ἄγαμος','ágamos','ag\'-am-os','from Α (as a negative particle) and γάμος; unmarried:--unmarried.'),
	('G23','ἀγανακτέω','aganaktéō','ag-an-ak-teh\'-o','from  (much) and  (grief; akin to the base of ἀγκάλη); to be greatly afflicted, i.e. (figuratively) indignant:--be much (sore) displeased, have (be moved with, with) indignation.'),
	('G24','ἀγανάκτησις','aganáktēsis','ag-an-ak\'-tay-sis','from ἀγανακτέω; indignation:--indignation.'),
	('G25','ἀγαπάω','agapáō','ag-ap-ah\'-o','perhaps from  (much) (or compare עֲגַב); to love (in a social or moral sense):--(be-)love(-ed). Compare φιλέω.'),
	('G26','ἀγάπη','agápē','ag-ah\'-pay','from ἀγαπάω; love, i.e. affection or benevolence; specially (plural) a love-feast:--(feast of) charity(-ably), dear, love.'),
	('G27','ἀγαπητός','agapētós','ag-ap-ay-tos\'','from ἀγαπάω; beloved:--(dearly, well) beloved, dear.'),
	('G28','Ἄγαρ','Ágar','ag\'-ar','of Hebrew origin (הָגָר); Hagar, the concubine of Abraham:--Hagar.'),
	('G29','ἀγγαρεύω','angareúō','ang-ar-yew\'-o','of foreign origin (compare אִגְּרָא); properly, to be a courier, i.e. (by implication) to press into public service:--compel (to go).'),
	('G30','ἀγγεῖον','angeîon','ang-eye\'-on','from  (a pail, perhaps as bent; compare the base of ἀγκάλη); a receptacle:--vessel.'),
	('G31','ἀγγελία','angelía','ang-el-ee\'-ah','from ἄγγελος; an announcement, i.e. (by implication) precept:--message.'),
	('G32','ἄγγελος','ángelos','ang\'-el-os','from  (probably derived from ἄγω; compare ἀγέλη) (to bring tidings); a messenger; especially an \"angel\"; by implication, a pastor:--angel, messenger.'),
	('G33','ἄγε','áge','ag\'-eh','imperative of ἄγω; properly, lead, i.e. come on:--go to.'),
	('G34','ἀγέλη','agélē','ag-el\'-ay','from ἄγω (compare ἄγγελος); a drove:--herd.'),
	('G35','ἀγενεαλόγητος','agenealógētos','ag-en-eh-al-og\'-ay-tos','from Α (as negative particle) and γενεαλογέω; unregistered as to birth:--without descent.'),
	('G36','ἀγενής','agenḗs','ag-en-ace\'','from Α (as negative particle) and γένος; properly, without kin, i.e. (of unknown descent, and by implication) ignoble:--base things.'),
	('G37','ἁγιάζω','hagiázō','hag-ee-ad\'-zo','from ἅγιος; to make holy, i.e. (ceremonially) purify or consecrate; (mentally) to venerate:--hallow, be holy, sanctify.'),
	('G38','ἁγιασμός','hagiasmós','hag-ee-as-mos\'','from ἁγιάζω; properly, purification, i.e. (the state) purity; concretely (by Hebraism) a purifier:--holiness, sanctification.'),
	('G39','ἅγιον','hágion','hag\'-ee-on','neuter of ἅγιος; a sacred thing (i.e. spot):--holiest (of all), holy place, sanctuary.'),
	('G40','ἅγιος','hágios','hag\'-ee-os','from  (an awful thing) (compare ἁγνός, θάλπω); sacred (physically, pure, morally blameless or religious, ceremonially, consecrated):--(most) holy (one, thing), saint.'),
	('G41','ἁγιότης','hagiótēs','hag-ee-ot\'-ace','from ἅγιος; sanctity (i.e. properly, the state):--holiness.'),
	('G42','ἁγιωσύνη','hagiōsýnē','hag-ee-o-soo\'-nay','from ἅγιος; sacredness (i.e. properly, the quality):--holiness.'),
	('G43','ἀγκάλη','ankálē','ang-kal\'-ay','from  (a bend, \"ache\"); an arm (as curved):--arm.'),
	('G44','ἄγκιστρον','ánkistron','ang\'-kis-tron','from the same as ἀγκάλη; a hook (as bent):--hook.'),
	('G45','ἄγκυρα','ánkyra','ang\'-koo-rah','from the same as ἀγκάλη; an \"anchor\" (as crooked):--anchor.'),
	('G46','ἄγναφος','ágnaphos','ag\'-naf-os','from Α (as a negative particle) and the same as γναφεύς; properly, unfulled, i.e. (by implication) new (cloth):--new.'),
	('G47','ἁγνεία','hagneía','hag-ni\'-ah','from ἁγνός; cleanliness (the quality), i.e. (specially) chastity:--purity.'),
	('G48','ἁγνίζω','hagnízō','hag-nid\'-zo','from ἁγνός; to make clean, i.e. (figuratively) sanctify (ceremonially or morally):--purify (self).'),
	('G49','ἁγνισμός','hagnismós','hag-nis-mos\'','from ἁγνίζω; a cleansing (the act), i.e. (ceremonially) lustration:--purification.'),
	('G50','ἀγνοέω','agnoéō','ag-no-eh\'-o','from Α (as a negative particle) and νοιέω; not to know (through lack of information or intelligence); by implication, to ignore (through disinclination):--(be) ignorant(-ly), not know, not understand, unknown.'),
	('G51','ἀγνόημα','agnóēma','ag-no\'-ay-mah','from ἀγνοέω; a thing ignored, i.e. shortcoming:--error.'),
	('G52','ἄγνοια','ágnoia','ag\'-noy-ah','from ἀγνοέω; ignorance (properly, the quality):--ignorance.'),
	('G53','ἁγνός','hagnós','hag-nos\'','from the same as ἅγιος; properly, clean, i.e. (figuratively) innocent, modest, perfect:--chaste, clean, pure.'),
	('G54','ἁγνότης','hagnótēs','hag-not\'-ace','from ἁγνός; cleanness (the state), i.e. (figuratively) blamelessness:--pureness.'),
	('G55','ἁγνῶς','hagnōs','hag-noce\'','adverb from ἁγνός; purely, i.e. honestly:--sincerely.'),
	('G56','ἀγνωσία','agnōsía','ag-no-see\'-ah','from Α (as negative particle) and γνῶσις; ignorance (properly, the state):--ignorance, not the knowledge.'),
	('G57','ἄγνωστος','ágnōstos','ag\'-noce-tos\'','from Α (as negative particle) and γνωστός; unknown:--unknown.'),
	('G58','ἀγορά','agorá','ag-or-ah\'','from  (to gather; probably akin to ἐγείρω); properly, the town-square (as a place of public resort); by implication, a market or thoroughfare:--market(-place), street.'),
	('G59','ἀγοράζω','agorázō','ag-or-ad\'-zo','from ἀγορά; properly, to go to market, i.e. (by implication) to purchase; specially, to redeem:--buy, redeem.'),
	('G60','ἀγοραῖος','agoraîos','ag-or-ah\'-yos','from ἀγορά; relating to the market-place, i.e. forensic (times); by implication, vulgar:--baser sort, low.'),
	('G61','ἄγρα','ágra','ag\'-rah','from ἄγω; (abstractly) a catching (of fish); also (concretely) a haul (of fish):--draught.'),
	('G62','ἀγράμματος','agrámmatos','ag-ram-mat-os','from Α (as negative particle) and γράμμα; unlettered, i.e. illiterate:--unlearned.'),
	('G63','ἀγραυλέω','agrauléō','ag-row-leh\'-o','from ἀγρός and αὐλέω (in the sense of αὐλή); to camp out:--abide in the field.'),
	('G64','ἀγρεύω','agreúō','ag-rew\'-o','from ἄγρα; to hunt, i.e. (figuratively) to entrap:--catch.'),
	('G65','ἀγριέλαιος','agriélaios','ag-ree-el\'-ah-yos','from ἄγριος and ἐλαία; an oleaster:--olive tree (which is) wild.'),
	('G66','ἄγριος','ágrios','ag\'-ree-os','from ἀγρός; wild (as pertaining to the country), literally (natural) or figuratively (fierce):--wild, raging.'),
	('G67','Ἀγρίππας','Agríppas','ag-rip\'-pas','apparently from ἄγριος and ἵππος; wild-horse tamer; Agrippas, one of the Herods:--Agrippa.'),
	('G68','ἀγρός','agrós','ag-ros\'','from ἄγω; a field (as a drive for cattle); genitive case, the country; specially, a farm, i.e. hamlet:--country, farm, piece of ground, land.'),
	('G69','ἀγρυπνέω','agrypnéō','ag-roop-neh\'-o','ultimately from Α (as negative particle) and ὕπνος; to be sleepless, i.e. keep awake:--watch.'),
	('G70','ἀγρυπνία','agrypnía','ag-roop-nee\'-ah','from ἀγρυπνέω; sleeplessness, i.e. a keeping awake:--watch.'),
	('G71','ἄγω','ágō','ag\'-o','a primary verb; properly, to lead; by implication, to bring, drive, (reflexively) go, (specially) pass (time), or (figuratively) induce:--be, bring (forth), carry, (let) go, keep, lead away, be open.'),
	('G72','ἀγωγή','agōgḗ','ag-o-gay\'','reduplicated from ἄγω; a bringing up, i.e. mode of living:--manner of life.'),
	('G73','ἀγών','agṓn','ag-one\'','from ἄγω; properly, a place of assembly (as if led), i.e. (by implication) a contest (held there); figuratively, an effort or anxiety:--conflict, contention, fight, race.'),
	('G74','ἀγωνία','agōnía','ag-o-nee\'-ah','from ἀγών; a struggle (properly, the state), i.e. (figuratively) anguish:--agony.'),
	('G75','ἀγωνίζομαι','agōnízomai','ag-o-nid\'-zom-ahee','from ἀγών; to struggle, literally (to compete for a prize), figuratively (to contend with an adversary), or genitive case (to endeavor to accomplish something):--fight, labor fervently, strive.'),
	('G76','Ἀδάμ','Adám','ad-am\'','of Hebrew origin (אָדָם); Adam, the first man; typically (of Jesus) man (as his representative):--Adam.'),
	('G77','ἀδάπανος','adápanos','ad-ap\'-an-os','from Α (as negative particle); and δαπάνη; costless, i.e. gratuitous:--without expense.'),
	('G78','Ἀδδί','Addí','ad-dee\'','probably of Hebrew origin (compare עֲדִי); Addi, an Israelite:--Addi.'),
	('G79','ἀδελφή','adelphḗ','ad-el-fay\'','feminine of ἀδελφός; a sister (naturally or ecclesiastically):--sister.'),
	('G80','ἀδελφός','adelphós','ad-el-fos\'','from Α (as a connective particle) and  (the womb); a brother (literally or figuratively) near or remote (much like Α):--brother.'),
	('G81','ἀδελφότης','adelphótēs','ad-el-fot\'-ace','from ἀδελφός; brotherhood (properly, the feeling of brotherliness), i.e. the (Christian) fraternity:--brethren, brotherhood.'),
	('G82','ἄδηλος','ádēlos','ad\'-ay-los','from Α (as a negative particle) and δῆλος; hidden, figuratively, indistinct:--appear not, uncertain.'),
	('G83','ἀδηλότης','adēlótēs','ad-ay-lot\'-ace','from ἄδηλος; uncertainty:--X uncertain.'),
	('G84','ἀδήλως','adḗlōs','ad-ay\'-loce','adverb from ἄδηλος; uncertainly:--uncertainly.'),
	('G85','ἀδημονέω','adēmonéō','ad-ay-mon-eh\'-o','from a derivative of  (to be sated to loathing); to be in distress (of mind):--be full of heaviness, be very heavy.'),
	('G86','ᾅδης','háidēs','hah\'-dace','from Α (as negative particle) and εἴδω; properly, unseen, i.e. \"Hades\" or the place (state) of departed souls:--grave, hell.'),
	('G87','ἀδιάκριτος','adiákritos','ad-ee-ak\'-ree-tos','from Α (as a negative particle) and a derivative of διακρίνω; properly, undistinguished, i.e. (actively) impartial:--without partiality.'),
	('G88','ἀδιάλειπτος','adiáleiptos','ad-ee-al\'-ipe-tos','from Α (as a negative particle) and a derivative of a compound of διά and λείπω; unintermitted, i.e. permanent:--without ceasing, continual.'),
	('G89','ἀδιαλείπτως','adialeíptōs','ad-ee-al-ipe\'-toce','adverb from ἀδιάλειπτος; uninterruptedly, i.e. without omission (on an appropriate occasion):--without ceasing.'),
	('G90','ἀδιαφθορία','adiaphthoría','ad-ee-af-thor-ee\'-ah','from a derivative of a compound of Α (as a negative particle) and a derivative of διαφθείρω; incorruptibleness, i.e. (figuratively) purity (of doctrine):--uncorruptness.'),
	('G91','ἀδικέω','adikéō','ad-ee-keh\'-o','from ἄδικος; to be unjust, i.e. (actively) do wrong (morally, socially or physically):--hurt, injure, be an offender, be unjust, (do, suffer, take) wrong.'),
	('G92','ἀδίκημα','adíkēma','ad-eek\'-ay-mah','from ἀδικέω; a wrong done:--evil doing, iniquity, matter of wrong.'),
	('G93','ἀδικία','adikía','ad-ee-kee\'-ah','from ἄδικος; (legal) injustice (properly, the quality, by implication, the act); morally, wrongfulness (of character, life or act):--iniquity, unjust, unrighteousness, wrong.'),
	('G94','ἄδικος','ádikos','ad\'-ee-kos','from Α (as a negative particle) and δίκη; unjust; by extension wicked; by implication, treacherous; specially, heathen:--unjust, unrighteous.'),
	('G95','ἀδίκως','adíkōs','ad-ee\'-koce','adverb from ἄδικος; unjustly:--wrongfully.'),
	('G96','ἀδόκιμος','adókimos','ad-ok\'-ee-mos','from Α (as a negative particle) and δόκιμος; unapproved, i.e. rejected; by implication, worthless (literally or morally):--castaway, rejected, reprobate.'),
	('G97','ἄδολος','ádolos','ad\'-ol-os','from Α (as a negative particle); and δόλος; undeceitful, i.e. (figuratively) unadulterated:--sincere.'),
	('G98','Ἀδραμυττηνός','Adramyttēnós','ad-ram-oot-tay-nos\'','from  (a place in Asia Minor); Adramyttene or belonging to Adramyttium:--of Adramyttium.'),
	('G99','Ἀδρίας','Adrías','ad-ree\'-as','from  (a place near its shore); the Adriatic sea (including the Ionian):--Adria.'),
	('G100','ἁδρότης','hadrótēs','had-rot\'-ace','from  (stout); plumpness, i.e. (figuratively) liberality:--abundance.'),
	('G101','ἀδυνατέω','adynatéō','ad-oo-nat-eh\'-o','from ἀδύνατος; to be unable, i.e. (passively) impossible:--be impossible.'),
