	('G108','Ἄζωτος','Ázōtos','ad\'-zo-tos','of Hebrew origin (אַשְׁדּוֹד); Azotus (i.e. Ashdod), a place in Palestine:--Azotus.'),
	('G109','ἀήρ','aḗr','ah-ayr\'','from  (to breathe unconsciously, i.e. respire; by analogy, to blow); \"air\" (as naturally circumambient):--air. Compare ψύχω.'),
