	('G142','αἴρω','aírō','ah\'-ee-ro','a primary root; to lift up; by implication, to take up or away; figuratively, to raise (the voice), keep in suspense (the mind), specially, to sail away (i.e. weigh anchor); by Hebraism (compare נָשָׂא) to expiate sin:--away with, bear (up), carry, lift up, loose, make to doubt, put away, remove, take (away, up).'),
