	('G238','ἀλληγορέω','allēgoréō','al-lay-gor-eh\'-o','from ἄλλος and  (to harangue (compare ἀγορά)); to allegorize:--be an allegory (the Greek word itself).'),
	('G239','ἀλληλουϊα','allēlouïa','al-lay-loo\'-ee-ah','of Hebrew origin (imperative of הָלַל and יָהּ); praise ye Jah!, an adoring exclamation:--alleluiah.'),
