	('G263','ἀμάραντος','amárantos','am-ar\'-an-tos','from Α (as a negative particle) and a presumed derivative of μαραίνω; unfading, i.e. (by implication) perpetual:--that fadeth not away.'),
	('G264','ἁμαρτάνω','hamartánō','ham-ar-tan\'-o','perhaps from Α (as a negative particle) and the base of μέρος; properly, to miss the mark (and so not share in the prize), i.e. (figuratively) to err, especially (morally) to sin:--for your faults, offend, sin, trespass.'),
	('G265','ἁμάρτημα','hamártēma','ham-ar\'-tay-mah','from ἁμαρτάνω; a sin (properly concrete):--sin.'),
	('G266','ἁμαρτία','hamartía','ham-ar-tee\'-ah','from ἁμαρτάνω; a sin (properly abstract):--offence, sin(-ful).'),
	('G267','ἀμάρτυρος','amártyros','am-ar\'-too-ros','from Α (as a negative particle) and a form of μάρτυς; unattested:--without witness.'),
	('G268','ἁμαρτωλός','hamartōlós','ham-ar-to-los\'','from ἁμαρτάνω; sinful, i.e. a sinner:--sinful, sinner.'),
