	('G270','ἀμάω','amáō','am-ah\'-o','from ἅμα; properly, to collect, i.e. (by implication) reap:--reap down.'),
	('G271','ἀμέθυστος','améthystos','am-eth\'-oos-tos','from Α (as a negative particle) and a derivative of μεθύω; the \"amethyst\" (supposed to prevent intoxication):--amethyst.'),
