	('G286','ἀμνός','amnós','am-nos\'','apparently a primary word; a lamb:--lamb.'),
	('G287','ἀμοιβή','amoibḗ','am-oy-bay\'','from  (to exchange); requital:--requite.'),
	('G288','ἄμπελος','ámpelos','am\'-pel-os','probably from the base of ἀμφότερος and that of ἅλων; a vine (as coiling about a support):--vine.'),
	('G289','ἀμπελουργός','ampelourgós','am-pel-oor-gos\'','from ἄμπελος and ἔργον; a vine-worker, i.e. pruner:--vine-dresser.'),
