	('G303','ἀνά','aná','an-ah\'','a primary preposition and adverb; properly, up; but (by extension) used (distributively) severally, or (locally) at (etc.):--and, apiece, by, each, every (man), in, through. In compounds (as a prefix) it often means (by implication) repetition, intensity, reversal, etc.'),
