	('G310','ἀναβοάω','anaboáō','an-ab-o-ah\'-o','from ἀνά and βοάω; to halloo:--cry (aloud, out).'),
	('G311','ἀναβολή','anabolḗ','an-ab-ol-ay\'','from ἀναβάλλομαι; a putting off:--delay.'),
	('G312','ἀναγγέλλω','anangéllō','an-ang-el\'-lo','from ἀνά and the base of ἄγγελος; to announce (in detail):--declare, rehearse, report, show, speak, tell.'),
