	('G491','Ἀντιοχεύς','Antiocheús','an-tee-okh-yoos\'','from Ἀντιόχεια; an Antiochian or inhabitant of Antiochia:--of Antioch.'),
	('G492','ἀντιπαρέρχομαι','antiparérchomai','an-tee-par-er\'-khom-ahee','from ἀντί and παρέρχομαι; to go along opposite:--pass by on the other side.'),
	('G493','Ἀντίπας','Antípas','an-tee\'-pas','contracted for a compound of ἀντί and a derivative of πατήρ; Antipas, a Christian:--Antipas.'),
	('G494','Ἀντιπατρίς','Antipatrís','an-tip-at-rece\'','from the same as Ἀντίπας; Antipatris, a place in Palestine:--Antipatris.'),
	('G495','ἀντιπέραν','antipéran','an-tee-per\'-an','from ἀντί and πέραν; on the opposite side:--over against.'),
	('G496','ἀντιπίπτω','antipíptō','an-tee-pip\'-to','from ἀντί and πίπτω (including its alternate); to oppose:--resist.'),
	('G497','ἀντιστρατεύομαι','antistrateúomai','an-tee-strat-yoo\'-om-ahee','from ἀντί and στρατεύομαι; (figuratively) to attack, i.e. (by implication) destroy:--war against.'),
	('G498','ἀντιτάσσομαι','antitássomai','an-tee-tas\'-som-ahee','from ἀντί and the middle voice of τάσσω; to range oneself against, i.e. oppose:--oppose themselves, resist.'),
	('G499','ἀντίτυπον','antítypon','an-teet\'-oo-pon','neuter of a compound of ἀντί and τύπος; corresponding (\"antitype\"), i.e. a representative, counterpart:--(like) figure (whereunto).'),
	('G500','ἀντίχριστος','antíchristos','an-tee\'-khris-tos','from ἀντί and Χριστός; an opponent of the Messiah:--antichrist.'),
	('G501','ἀντλέω','antléō','ant-leh-o','from  (the hold of a ship); to bale up (properly, bilge water), i.e. dip water (with a bucket, pitcher, etc.):--draw (out).'),
	('G502','ἄντλημα','ántlēma','ant\'-lay-mah','from ἀντλέω; a baling-vessel:--thing to draw with.'),
	('G503','ἀντοφθαλμέω','antophthalméō','ant-of-thal-meh\'-o','from a compound of ἀντί and ὀφθαλμός; to face:--bear up into.'),
	('G504','ἄνυδρος','ánydros','an\'-oo-dros','from Α (as a negative particle) and ὕδωρ; waterless, i.e. dry:--dry, without water.'),
	('G505','ἀνυπόκριτος','anypókritos','an-oo-pok\'-ree-tos','from Α (as a negative particle) and a presumed derivative of ὑποκρίνομαι; undissembled, i.e. sincere:--without dissimulation (hypocrisy), unfeigned.'),
	('G506','ἀνυπότακτος','anypótaktos','an-oo-pot\'-ak-tos','from Α (as a negative particle) and a presumed derivative of ὑποτάσσω; unsubdued, i.e. insubordinate (in fact or temper):--disobedient, that is not put under, unruly.'),
	('G507','ἄνω','ánō','an\'-o','adverb from ἀντί; upward or on the top:--above, brim, high, up.'),
	('G508','ἀνώγεον','anṓgeon','an-ogue\'-eh-on','from ἄνω and γῆ; above the ground, i.e. (properly) the second floor of a building; used for a dome or a balcony on the upper story:--upper room.'),
	('G509','ἄνωθεν','ánōthen','an\'-o-then','from ἄνω; from above; by analogy, from the first; by implication, anew:--from above, again, from the beginning (very first), the top.'),
	('G510','ἀνωτερικός','anōterikós','an-o-ter-ee-kos\'','from ἀνώτερος; superior, i.e. (locally) more remote:--upper.'),
	('G511','ἀνώτερος','anṓteros','an-o\'-ter-os','comparative degree of ἄνω; upper, i.e. (neuter as adverb) to a more conspicuous place, in a former part of the book:--above, higher.'),
	('G512','ἀνωφελής','anōphelḗs','an-o-fel\'-ace','from Α (as a negative particle) and the base of ὠφέλιμος; useless or (neuter) inutility:--unprofitable(-ness).'),
	('G513','ἀξίνη','axínē','ax-ee\'-nay','probably from  (to break; compare ῥήγνυμι); an axe:--axe.'),
	('G514','ἄξιος','áxios','ax\'-ee-os','probably from ἄγω; deserving, comparable or suitable (as if drawing praise):--due reward, meet, (un-)worthy.'),
	('G515','ἀξιόω','axióō','ax-ee-o\'-o','from ἄξιος; to deem entitled or fit:--desire, think good, count (think) worthy.'),
	('G516','ἀξίως','axíōs','ax-ee\'-oce','adverb from ἄξιος; appropriately:--as becometh, after a godly sort, worthily(-thy).'),
	('G517','ἀόρατος','aóratos','ah-or\'-at-os','from Α (as a negative particle) and ὁρατός; invisible:--invisible (thing).'),
	('G518','ἀπαγγέλλω','apangéllō','ap-ang-el\'-lo','from ἀπό and the base of ἄγγελος; to announce:--bring word (again), declare, report, shew (again), tell.'),
	('G519','ἀπάγχομαι','apánchomai','ap-ang\'-khom-ahee','from ἀπό and  (to choke; akin to the base of ἀγκάλη); to strangle oneself off (i.e. to death):--hang himself.'),
	('G520','ἀπάγω','apágō','ap-ag\'-o','from ἀπό and ἄγω; to take off (in various senses):--bring, carry away, lead (away), put to death, take away.'),
	('G521','ἀπαίδευτος','apaídeutos','ap-ah\'-ee-dyoo-tos','from Α (as a negative particle) and a derivative of παιδεύω; uninstructed, i.e. (figuratively) stupid:--unlearned.'),
