	('G523','ἀπαιτέω','apaitéō','ap-ah\'-ee-teh-o','from ἀπό and αἰτέω; to demand back:--ask again, require.'),
	('G524','ἀπαλγέω','apalgéō','ap-alg-eh\'-o','from ἀπό and  (to smart); to grieve out, i.e. become apathetic:--be past feeling.'),
	('G525','ἀπαλλάσσω','apallássō','ap-al-las\'-so','from ἀπό and ἀλλάσσω; to change away, i.e. release, (reflexively) remove:--deliver, depart.'),
	('G526','ἀπαλλοτριόω','apallotrióō','ap-al-lot-ree-o\'-o','from ἀπό and a derivative of ἀλλότριος; to estrange away, i.e. (passively and figuratively) to be non-participant:-- alienate, be alien.'),
	('G527','ἀπαλός','apalós','ap-al-os\'','of uncertain derivation; soft:--tender.'),
	('G528','ἀπαντάω','apantáō','ap-an-tah\'-o','from ἀπό and a derivative of ἀντί; to meet away, i.e. encounter:--meet.'),
	('G529','ἀπάντησις','apántēsis','ap-an\'-tay-sis','from ἀπαντάω; a (friendly) encounter:--meet.'),
	('G530','ἅπαξ','hápax','hap\'-ax','probably from ἅπας; one (or a single) time (numerically or conclusively):--once.'),
	('G531','ἀπαράβατος','aparábatos','ap-ar-ab\'-at-os','from Α (as a negative particle) and a derivative of παραβαίνω; not passing away, i.e. untransferable (perpetual):-- unchangeable.'),
