	('G533','ἀπαρνέομαι','aparnéomai','ap-ar-neh\'-om-ahee','from ἀπό and ἀρνέομαι; to deny utterly, i.e. disown, abstain:--deny.'),
	('G534','ἀπάρτι','apárti','ap-ar\'-tee','from ἀπό and ἄρτι; from now, i.e. henceforth (already):--from henceforth.'),
	('G535','ἀπαρτισμός','apartismós','ap-ar-tis-mos\'','from a derivative of ἀπάρτι; completion:--finishing.'),
	('G536','ἀπαρχή','aparchḗ','ap-ar-khay\'','from a compound of ἀπό and ἄρχομαι; a beginning of sacrifice, i.e. the (Jewish) first-fruit (figuratively):--first-fruits.'),
	('G537','ἅπας','hápas','hap\'-as','from Α (as a particle of union) and πᾶς; absolutely all or (singular) every one:--all (things), every (one), whole.'),
	('G538','ἀπατάω','apatáō','ap-at-ah\'-o','of uncertain derivation; to cheat, i.e. delude:--deceive.'),
	('G539','ἀπάτη','apátē','ap-at\'-ay','from ἀπατάω; delusion:--deceit(-ful, -fulness), deceivableness(-ving).'),
	('G540','ἀπάτωρ','apátōr','ap-at\'-ore','from Α (as a negative particle) and πατήρ; fatherless, i.e. of unrecorded paternity:--without father.'),
	('G541','ἀπαύγασμα','apaúgasma','ap-ow\'-gas-mah','from a compound of ἀπό and αὐγάζω; an off-flash, i.e. effulgence:--brightness.'),
	('G542','ἀπείδω','apeídō','ap-i\'-do','from ἀπό and the same as εἴδω; to see fully:--see.'),
	('G543','ἀπείθεια','apeítheia','ap-i\'-thi-ah','from ἀπειθής; disbelief (obstinate and rebellious):--disobedience, unbelief.'),
	('G544','ἀπειθέω','apeithéō','ap-i-theh\'-o','from ἀπειθής; to disbelieve (wilfully and perversely):--not believe, disobedient, obey not, unbelieving.'),
	('G545','ἀπειθής','apeithḗs','ap-i-thace\'','from Α (as a negative particle) and πείθω; unpersuadable, i.e. contumacious:--disobedient.'),
	('G546','ἀπειλέω','apeiléō','ap-i-leh\'-o','of uncertain derivation; to menace; by implication, to forbid:--threaten.'),
	('G547','ἀπειλή','apeilḗ','ap-i-lay\'','from ἀπειλέω; a menace:--X straitly, threatening.'),
	('G548','ἄπειμι','ápeimi','ap\'-i-mee','from ἀπό and εἰμί; to be away:--be absent. Compare ἄπειμι.'),
	('G549','ἄπειμι','ápeimi','ap\'-i-mee','from ἀπό and  (to go); to go away:--go. Compare ἄπειμι.'),
	('G550','ἀπειπόμην','apeipómēn','ap-i-pom\'-ane','reflexive past of a compound of ἀπό and ἔπω; to say off for oneself, i.e. disown:--renounce.'),
