	('G553','ἀπεκδέχομαι','apekdéchomai','ap-ek-dekh\'-om-ahee','from ἀπό and ἐκδέχομαι; to expect fully:--look (wait) for.'),
	('G554','ἀπεκδύομαι','apekdýomai','ap-ek-doo\'-om-ahee','middle voice from ἀπό and ἐκδύω; to divest wholly oneself, or (for oneself) despoil:--put off, spoil.'),
	('G555','ἀπέκδυσις','apékdysis','ap-ek\'-doo-sis','from ἀπεκδύομαι; divestment:--putting off.'),
	('G556','ἀπελαύνω','apelaúnō','ap-el-ow\'-no','from ἀπό and ἐλαύνω; to dismiss:--drive.'),
	('G557','ἀπελεγμός','apelegmós','ap-el-eg-mos\'','from a compound of ἀπό and ἐλέγχω; refutation, i.e. (by implication) contempt:--nought.'),
	('G558','ἀπελεύθερος','apeleútheros','ap-el-yoo\'-ther-os','from ἀπό and ἐλεύθερος; one freed away, i.e. a freedman:--freeman.'),
