	('G560','ἀπελπίζω','apelpízō','ap-el-pid\'-zo','from ἀπό and ἐλπίζω; to hope out, i.e. fully expect:--hope for again.'),
	('G561','ἀπέναντι','apénanti','ap-en\'-an-tee','from ἀπό and ἔναντι; from in front, i.e. opposite, before or against:--before, contrary, over against, in the presence of.'),
	('G562','ἀπέραντος','apérantos','ap-er\'-an-tos','from Α (as a negative particle) and a secondary derivative of πέραν; unfinished, i.e. (by implication) interminable:--endless.'),
	('G563','ἀπερισπάστως','aperispástōs','ap-er-is-pas-toce\'','adverb from a compound of Α (as a negative participle) and a presumed derivative of περισπάω; undistractedly, i.e. free from (domestic) solicitude:--without distraction.'),
	('G564','ἀπερίτμητος','aperítmētos','ap-er-eet\'-may-tos','from Α (as a negative particle) and a presumed derivative of περιτέμνω; uncircumcised (figuratively):--uncircumcised.'),
	('G565','ἀπέρχομαι','apérchomai','ap-erkh\'-om-ahee','from ἀπό and ἔρχομαι; to go off (i.e. depart), aside (i.e. apart) or behind (i.e. follow), literally or figuratively:--come, depart, go (aside, away, back, out, … ways), pass away, be past.'),
