	('G567','ἀπέχομαι','apéchomai','ap-ekh\'-om-ahee','middle voice (reflexively) of ἀπέχω; to hold oneself off, i.e. refrain:--abstain.'),
	('G568','ἀπέχω','apéchō','ap-ekh\'-o','from ἀπό and ἔχω; (actively) to have out, i.e. receive in full; (intransitively) to keep (oneself) away, i.e. be distant (literally or figuratively):--be, have, receive.'),
	('G569','ἀπιστέω','apistéō','ap-is-teh\'-o','from ἄπιστος; to be unbelieving, i.e. (transitively) disbelieve, or (by implication) disobey:--believe not.'),
	('G570','ἀπιστία','apistía','ap-is-tee\'-ah','from ἄπιστος; faithlessness, i.e. (negatively) disbelief (lack of Christian faith), or (positively) unfaithfulness (disobedience):--unbelief.'),
	('G571','ἄπιστος','ápistos','ap\'-is-tos','from Α (as a negative particle) and πιστός; (actively) disbelieving, i.e. without Christian faith (specially, a heathen); (passively) untrustworthy (person), or incredible (thing):--that believeth not, faithless, incredible thing, infidel, unbeliever(-ing).'),
	('G572','ἁπλότης','haplótēs','hap-lot\'-ace','from ἁπλοῦς; singleness, i.e. (subjectively) sincerity (without dissimulation or self-seeking), or (objectively) generosity (copious bestowal):--bountifulness, liberal(-ity), simplicity, singleness.'),
	('G573','ἁπλοῦς','haploûs','hap-looce\'','probably from Α (as a particle of union) and the base of πλέκω; properly, folded together, i.e. single (figuratively, clear):--single.'),
	('G574','ἁπλῶς','haplōs','hap-loce\'','adverb from ἁπλοῦς (in the objective sense of ἁπλότης); bountifully; --liberally.'),
	('G575','ἀπό','apó','apo\'','a primary particle; \"off,\" i.e. away (from something near), in various senses (of place, time, or relation; literal or figurative):--(X here-)after, ago, at, because of, before, by (the space of), for(-th), from, in, (out) of, off, (up-)on(-ce), since, with. In composition (as a prefix) it usually denotes separation, departure, cessation, completion, reversal, etc.'),
	('G576','ἀποβαίνω','apobaínō','ap-ob-ah\'-ee-no','from ἀπό and the base of βάσις; literally, to disembark; figuratively, to eventuate:--become, go out, turn.'),
	('G577','ἀποβάλλω','apobállō','ap-ob-al\'-lo','from ἀπό and βάλλω; to throw off; figuratively, to lose:--cast away.'),
	('G578','ἀποβλέπω','apoblépō','ap-ob-lep\'-o','from ἀπό and βλέπω; to look away from everything else, i.e. (figuratively) intently regard:--have respect.'),
	('G579','ἀπόβλητος','apóblētos','ap-ob\'-lay-tos','from ἀποβάλλω; cast off, i.e. (figuratively) such as to be rejected:--be refused.'),
	('G580','ἀποβολή','apobolḗ','ap-ob-ol-ay\'','from ἀποβάλλω; rejection; figuratively, loss:--casting away, loss.'),
	('G581','ἀπογενόμενος','apogenómenos','ap-og-en-om\'-en-os','past participle of a compound of ἀπό and γίνομαι; absent, i.e. deceased (figuratively, renounced):--being dead.'),
	('G582','ἀπογραφή','apographḗ','ap-og-raf-ay\'','from ἀπογράφω; an enrollment; by implication, an assessment:--taxing.'),
	('G583','ἀπογράφω','apográphō','ap-og-raf\'-o','from ἀπό and γράφω; to write off (a copy or list), i.e. enrol:--tax, write.'),
	('G584','ἀποδείκνυμι','apodeíknymi','ap-od-ike\'-noo-mee','from ἀπό and δεικνύω; to show off, i.e. exhibit; figuratively, to demonstrate, i.e. accredit:--(ap-)prove, set forth, shew.'),
