	('G588','ἀποδέχομαι','apodéchomai','ap-od-ekh\'-om-ahee','from ἀπό and δέχομαι; to take fully, i.e. welcome (persons), approve (things):--accept, receive (gladly).'),
	('G589','ἀποδημέω','apodēméō','ap-od-ay-meh\'-o','from ἀπόδημος; to go abroad, i.e. visit a foreign land:--go (travel) into a far country, journey.'),
