	('G592','ἀποδιορίζω','apodiorízō','ap-od-ee-or-id\'-zo','from ἀπό and a compound of διά and ὁρίζω; to disjoin (by a boundary, figuratively, a party):--separate.'),
	('G593','ἀποδοκιμάζω','apodokimázō','ap-od-ok-ee-mad\'-zo','from ἀπό and δοκιμάζω; to disapprove, i.e. (by implication) to repudiate:--disallow, reject.'),
	('G594','ἀποδοχή','apodochḗ','ap-od-okh-ay\'','from ἀποδέχομαι; acceptance:--acceptation.'),
	('G595','ἀπόθεσις','apóthesis','ap-oth\'-es-is','from ἀποτίθημι; a laying aside (literally or figuratively):--putting away (off).'),
