	('G599','ἀποθνήσκω','apothnḗskō','ap-oth-nace\'-ko','from ἀπό and θνήσκω; to die off (literally or figuratively):--be dead, death, die, lie a-dying, be slain (X with).'),
	('G600','ἀποκαθίστημι','apokathístēmi','ap-ok-ath-is\'-tay-mee','from ἀπό and καθίστημι; to reconstitute (in health, home or organization):--restore (again).'),
