	('G603','ἀποκαραδοκία','apokaradokía','ap-ok-ar-ad-ok-ee\'-ah','from a comparative of ἀπό and a compound of  (the head) and δοκέω (in the sense of watching); intense anticipation:--earnest expectation.'),
	('G604','ἀποκαταλλάσσω','apokatallássō','ap-ok-at-al-las\'-so','from ἀπό and καταλλάσσω; to reconcile fully:--reconcile.'),
	('G605','ἀποκατάστασις','apokatástasis','ap-ok-at-as\'-tas-is','from ἀποκαθίστημι; reconstitution:--restitution.'),
	('G606','ἀπόκειμαι','apókeimai','ap-ok\'-i-mahee','from ἀπό and κεῖμαι; to be reserved; figuratively, to await:--be appointed, (be) laid up.'),
	('G607','ἀποκεφαλίζω','apokephalízō','ap-ok-ef-al-id\'-zo','from ἀπό and κεφαλή; to decapitate:--behead.'),
	('G608','ἀποκλείω','apokleíō','ap-ok-li\'-o','from ἀπό and κλείω; to close fully:--shut up.'),
	('G609','ἀποκόπτω','apokóptō','ap-ok-op\'-to','from ἀπό and κόπτω; to amputate; reflexively (by irony) to mutilate (the privy parts):--cut off. Compare κατατομή.'),
	('G610','ἀπόκριμα','apókrima','ap-ok\'-ree-mah','from ἀποκρίνομαι (in its original sense of judging); a judicial decision:--sentence.'),
	('G611','ἀποκρίνομαι','apokrínomai','ap-ok-ree\'-nom-ahee','from ἀπό and ; to conclude for oneself, i.e. (by implication) to respond; by Hebraism (compare עָנָה) to begin to speak (where an address is expected):--answer.'),
	('G612','ἀπόκρισις','apókrisis','ap-ok\'-ree-sis','from ἀποκρίνομαι; a response:--answer.'),
	('G613','ἀποκρύπτω','apokrýptō','ap-ok-roop\'-to','from ἀπό and κρύπτω; to conceal away (i.e. fully); figuratively, to keep secret:--hide.'),
