	('G615','ἀποκτείνω','apokteínō','ap-ok-ti\'-no','from ἀπό and  (to slay); to kill outright; figuratively, to destroy:--put to death, kill, slay.'),
	('G616','ἀποκυέω','apokyéō','ap-ok-oo-eh\'-o','from ἀπό and the base of κῦμα; to breed forth, i.e. (by transference) to generate (figuratively):--beget, produce.'),
