	('G652','ἀπόστολος','apóstolos','ap-os\'-tol-os','from ἀποστέλλω; a delegate; specially, an ambassador of the Gospel; officially a commissioner of Christ (\"apostle\") (with miraculous powers):--apostle, messenger, he that is sent.'),
