	('G745','Ἀρχέλαος','Archélaos','ar-khel\'-ah-os','from ἄρχω and Λαοδικεύς; people-ruling; Archelaus, a Jewish king:--Archelaus.'),
	('G746','ἀρχή','archḗ','ar-khay\'','from ἄρχομαι; (properly abstract) a commencement, or (concretely) chief (in various applications of order, time, place, or rank):--beginning, corner, (at the, the) first (estate), magistrate, power, principality, principle, rule.'),
	('G747','ἀρχηγός','archēgós','ar-khay-gos\'','from ἀρχή and ἄγω; a chief leader:--author, captain, prince.'),
	('G748','ἀρχιερατικός','archieratikós','ar-khee-er-at-ee-kos\'','from ἀρχή and a derivative of ἱερός; high-priestly:--of the high-priest.'),
	('G749','ἀρχιερεύς','archiereús','ar-khee-er-yuce\'','from ἀρχή and ἱερεύς; the high-priest (literally, of the Jews, typically, Christ); by extension a chief priest:--chief (high) priest, chief of the priests.'),
	('G750','ἀρχιποίμην','archipoímēn','ar-khee-poy\'-mane','from ἀρχή and ποιμήν; a head shepherd:--chief shepherd.'),
	('G751','Ἄρχιππος','Árchippos','ar\'-khip-pos','from ἀρχή and ἵππος; horse-ruler; Archippus, a Christian:--Archippus.'),
	('G752','ἀρχισυνάγωγος','archisynágōgos','ar-khee-soon-ag\'-o-gos','from ἀρχή and συναγωγή; director of the synagogue services:--(chief) ruler of the synagogue.'),
	('G753','ἀρχιτέκτων','architéktōn','ar-khee-tek\'-tone','from ἀρχή and τέκτων; a chief constructor, i.e. \"architect\":--masterbuilder.'),
	('G754','ἀρχιτελώνης','architelṓnēs','ar-khee-tel-o\'-nace','from ἀρχή and τελώνης; a principle tax-gatherer:--chief among the publicans.'),
	('G755','ἀρχιτρίκλινος','architríklinos','ar-khee-tree\'-klee-nos','from ἀρχή and a compound of τρεῖς and κλίνω (a dinner-bed, because composed of three couches); director of the entertainment:--governor (ruler) of the feast.'),
	('G756','ἄρχομαι','árchomai','ar\'-khom-ahee','middle voice of ἄρχω (through the implication, of precedence); to commence (in order of time):--(rehearse from the) begin(-ning).'),
	('G757','ἄρχω','árchō','ar\'-kho','a primary verb; to be first (in political rank or power):--reign (rule) over.'),
	('G758','ἄρχων','árchōn','ar\'-khone','present participle of ἄρχω; a first (in rank or power):--chief (ruler), magistrate, prince, ruler.'),
	('G759','ἄρωμα','árōma','ar\'-o-mah','from αἴρω (in the sense of sending off scent); an aromatic:--(sweet) spice.'),
	('G760','Ἀσά','Asá','as-ah\'','of Hebrew origin (אָסָא); Asa, an Israelite:--Asa.'),
	('G761','ἀσάλευτος','asáleutos','as-al\'-yoo-tos','from Α (as a negative particle) and a derivative of σαλεύω; unshaken, i.e. (by implication) immovable (figuratively):--which cannot be moved, unmovable.'),
	('G762','ἄσβεστος','ásbestos','as\'-bes-tos','from Α (as a negative particle) and a derivative of σβέννυμι; not extinguished, i.e. (by implication) perpetual:--not to be quenched, unquenchable.'),
	('G763','ἀσέβεια','asébeia','as-eb\'-i-ah','from ἀσεβής; impiety, i.e. (by implication) wickedness:--ungodly(-liness).'),
	('G764','ἀσεβέω','asebéō','as-eb-eh\'-o','from ἀσεβής; to be (by implied act) impious or wicked:--commit (live, that after should live) ungodly.'),
	('G765','ἀσεβής','asebḗs','as-eb-ace\'','from Α (as a negative particle) and a presumed derivative of σέβομαι; irreverent, i.e. (by extension) impious or wicked:-- ungodly (man).'),
	('G766','ἀσέλγεια','asélgeia','as-elg\'-i-a','from a compound of Α (as a negative particle) and a presumed  (of uncertain derivation, but apparently meaning continent); licentiousness (sometimes including other vices):--filthy, lasciviousness, wantonness.'),
	('G767','ἄσημος','ásēmos','as\'-ay-mos','from Α (as a negative particle) and the base of σημαίνω; unmarked, i.e. (figuratively) ignoble:--mean.'),
	('G768','Ἀσήρ','Asḗr','as-ayr\'','of Hebrew origin (אָשֵׁר); Aser (i.e. Asher), an Israelite tribe:--Aser.'),
	('G769','ἀσθένεια','asthéneia','as-then\'-i-ah','from ἀσθενής; feebleness (of mind or body); by implication, malady; morally, frailty:--disease, infirmity, sickness, weakness.'),
	('G770','ἀσθενέω','asthenéō','as-then-eh\'-o','from ἀσθενής; to be feeble (in any sense):--be diseased, impotent folk (man), (be) sick, (be, be made) weak.'),
	('G771','ἀσθένημα','asthénēma','as-then\'-ay-mah','from ἀσθενέω; a scruple of conscience:--infirmity.'),
	('G772','ἀσθενής','asthenḗs','as-then-ace\'','from Α (as a negative particle) and the base of σθενόω; strengthless (in various applications, literal, figurative and moral):--more feeble, impotent, sick, without strength, weak(-er, -ness, thing).'),
	('G773','Ἀσία','Asía','as-ee\'-ah','of uncertain derivation; Asia, i.e. Asia Minor, or (usually) only its western shore:--Asia.'),
	('G774','Ἀσιανός','Asianós','as-ee-an-os\'','from Ἀσία; an Asian (i.e. Asiatic) or an inhabitant of Asia:--of Asia.'),
	('G775','Ἀσιάρχης','Asiárchēs','as-ee-ar\'-khace','from Ἀσία and ἀρχή; an Asiarch or president of the public festivities in a city of Asia Minor:--chief of Asia.'),
	('G776','ἀσιτία','asitía','as-ee-tee\'-ah','from ἄσιτος; fasting (the state):--abstinence.'),
	('G777','ἄσιτος','ásitos','as\'-ee-tos','from Α (as a negative particle) and σῖτος; without (taking) food:--fasting.'),
	('G778','ἀσκέω','askéō','as-keh\'-o','probably from the same as σκεῦος; to elaborate, i.e. (figuratively) train (by implication, strive):--exercise.'),
	('G779','ἀσκός','askós','as-kos\'','from the same as ἀσκέω; a leathern (or skin) bag used as a bottle:--bottle.'),
	('G780','ἀσμένως','asménōs','as-men\'-oce','adverb from a derivative of the base of ἡδονή; with pleasure:--gladly.'),
	('G781','ἄσοφος','ásophos','as\'-of-os','from Α (as a negative particle) and σοφός; unwise:--fool.'),
	('G782','ἀσπάζομαι','aspázomai','as-pad\'-zom-ahee','from Α (as a particle of union) and a presumed form of σπάω; to enfold in the arms, i.e. (by implication) to salute, (figuratively) to welcome:--embrace, greet, salute, take leave.'),
	('G783','ἀσπασμός','aspasmós','as-pas-mos\'','from ἀσπάζομαι; a greeting (in person or by letter):--greeting, salutation.'),
	('G784','ἄσπιλος','áspilos','as\'-pee-los','from Α (as a negative particle) and σπιλόω; unblemished (physically or morally):--without spot, unspotted.'),
	('G785','ἀσπίς','aspís','as-pece\'','of uncertain derivation; a buckler (or round shield); used of a serpent (as coiling itself), probably the \"asp\":--asp.'),
	('G786','ἄσπονδος','áspondos','as\'-pon-dos','from Α (as a negative particle) and a derivative of σπένδω; literally, without libation (which usually accompanied a treaty), i.e. (by implication) truceless:--implacable, truce-breaker.'),
	('G787','ἀσσάριον','assárion','as-sar\'-ee-on','of Latin origin; an assarius or as, a Roman coin:--farthing.'),
	('G788','ἆσσον','âsson','as\'-son','neuter comparative of the base of ἐγγύς; more nearly, i.e. very near:--close.'),
	('G789','Ἄσσος','Ássos','as\'-sos','probably of foreign origin; Assus, a city of Asia MInor:--Assos.'),
	('G790','ἀστατέω','astatéō','as-tat-eh\'-o','from Α (as a negative particle) and a derivative of ἵστημι; to be non-stationary, i.e. (figuratively) homeless:--have no certain dwelling-place.'),
	('G791','ἀστεῖος','asteîos','as-ti\'-os','from  (a city); urbane, i.e. (by implication) handsome:--fair.'),
	('G792','ἀστήρ','astḗr','as-tare\'','probably from the base of στρώννυμι; a star (as strown over the sky), literally or figuratively:--star.'),
	('G793','ἀστήρικτος','astḗriktos','as-tay\'-rik-tos','from Α (as a negative particle) and a presumed derivative of στηρίζω; unfixed, i.e. (figuratively) vacillating:--unstable.'),
	('G794','ἄστοργος','ástorgos','as\'-tor-gos','from Α (as a negative particle) and a presumed derivative of  (to cherish affectionately); hard-hearted towards kindred:--without natural affection.'),
	('G795','ἀστοχέω','astochéō','as-tokh-eh\'-o','from a compound of Α (as a negative particle) and  (an aim); to miss the mark, i.e. (figuratively) deviate from truth:--err, swerve.'),
	('G796','ἀστραπή','astrapḗ','as-trap-ay\'','from ἀστράπτω; lightning; by analogy, glare:--lightning, bright shining.'),
	('G797','ἀστράπτω','astráptō','as-trap\'-to','probably from  ἀστήρ; to flash as lightning:--lighten, shine.'),
	('G798','ἄστρον','ástron','as\'-tron','neuter from ἀστήρ; properly, a constellation; put for a single star (natural or artificial):--star.'),
	('G799','Ἀσύγκριτος','Asýnkritos','as-oong\'-kree-tos','from Α (as a negative particle) and a derivative of συγκρίνω; incomparable; Asyncritus, a Christian:--Asyncritos.'),
	('G800','ἀσύμφωνος','asýmphōnos','as-oom\'-fo-nos','from Α (as a negative particle) and σύμφωνος; inharmonious (figuratively):--agree not.'),
	('G801','ἀσύνετος','asýnetos','as-oon\'-ay-tos','from Α (as a negative particle) and συνετός; unintelligent; by implication, wicked:--foolish, without understanding.'),
	('G802','ἀσύνθετος','asýnthetos','as-oon\'-thet-os','from Α (as a negative particle) and a derivative of συντίθεμαι; properly, not agreed, i.e. treacherous to compacts:-- covenant-breaker.'),
	('G803','ἀσφάλεια','aspháleia','as-fal\'-i-ah','from ἀσφαλής; security (literally or figuratively):--certainty, safety.'),
	('G804','ἀσφαλής','asphalḗs','as-fal-ace\'','from Α (as a negative particle) and sphallo (to \"fail\"); secure (literally or figuratively):--certain(-ty), safe, sure.'),
	('G805','ἀσφαλίζω','asphalízō','as-fal-id\'-zo','from ἀσφαλής; to render secure:--make fast (sure).'),
	('G806','ἀσφαλῶς','asphalōs','as-fal-oce\'','adverb from ἀσφαλής; securely (literally or figuratively):--assuredly, safely.'),
	('G807','ἀσχημονέω','aschēmonéō','as-kay-mon-eh\'-o','from ἀσχήμων; to be (i.e. act) unbecoming:--behave self uncomely (unseemly).'),
	('G808','ἀσχημοσύνη','aschēmosýnē','as-kay-mos-oo\'-nay','from ἀσχήμων; an indecency; by implication, the pudenda:--shame, that which is unseemly.'),
	('G809','ἀσχήμων','aschḗmōn','as-kay\'-mone','from Α (as a negative particle) and a presumed derivative of ἔχω (in the sense of its congener σχῆμα); properly, shapeless, i.e. (figuratively) inelegant:--uncomely.'),
	('G810','ἀσωτία','asōtía','as-o-tee\'-ah','from a compound of Α (as a negative particle) and a presumed derivative of σώζω; properly, unsavedness, i.e. (by implication) profligacy:--excess, riot.'),
	('G811','ἀσώτως','asṓtōs','as-o\'-toce','adverb from the same as ἀσωτία; dissolutely:--riotous.'),
	('G812','ἀτακτέω','ataktéō','at-ak-teh\'-o','from ἄτακτος; to be (i.e. act) irregular:--behave self disorderly.'),
	('G813','ἄτακτος','átaktos','at\'-ak-tos','from Α (as a negative particle) and a derivative of τάσσω; unarranged, i.e. (by implication) insubordinate (religiously):--unruly.'),
	('G814','ἀτάκτως','atáktōs','at-ak\'-toce','adverb from ἄτακτος, irregularly (morally):--disorderly.'),
	('G815','ἄτεκνος','áteknos','at\'-ek-nos','from Α (as a negative particle) and τέκνον; childless:--childless, without children.'),
	('G816','ἀτενίζω','atenízō','at-en-id\'-zo','from a compound of Α (as a particle of union) and  (to stretch); to gaze intently:--behold earnestly (stedfastly), fasten (eyes), look (earnestly, stedfastly, up stedfastly), set eyes.'),
	('G817','ἄτερ','áter','at\'-er','a particle probably akin to ἄνευ; aloof, i.e. apart from (literally or figuratively):--in the absence of, without.'),
	('G818','ἀτιμάζω','atimázō','at-im-ad\'-zo','from ἄτιμος; to render infamous, i.e. (by implication) contemn or maltreat:--despise, dishonour, suffer shame, entreat shamefully.'),
	('G819','ἀτιμία','atimía','at-ee-mee\'-ah','from ἄτιμος; infamy, i.e. (subjectively) comparative indignity, (objectively) disgrace:--dishonour, reproach, shame, vile.'),
	('G820','ἄτιμος','átimos','at\'-ee-mos','from Α (as a negative particle) and τιμή; (negatively) unhonoured or (positively) dishonoured:--despised, without honour, less honourable (comparative degree).'),
	('G821','ἀτιμόω','atimóō','at-ee-mo\'-o','from ἄτιμος; used like ἀτιμάζω, to maltreat:--handle shamefully.'),
	('G822','ἀτμίς','atmís','at-mece\'','from the same as ἀήρ; mist:--vapour.'),
	('G823','ἄτομος','átomos','at\'-om-os','from Α (as a negative particle) and the base of τομώτερος; uncut, i.e. (by implication) indivisible (an \"atom\" of time):-- moment.'),
	('G824','ἄτοπος','átopos','at\'-op-os','from Α (as a negative particle) and τόπος; out of place, i.e. (figuratively) improper, injurious, wicked:--amiss, harm, unreasonable.'),
	('G825','Ἀττάλεια','Attáleia','at-tal\'-i-ah','from  (a king of Pergamus); Attaleia, a place in Pamphylia:--Attalia.'),
	('G826','αὐγάζω','augázō','ow-gad\'-zo','from αὐγή; to beam forth (figuratively):--shine.'),
	('G827','αὐγή','augḗ','owg\'-ay','of uncertain derivation; a ray of light, i.e. (by implication) radiance, dawn:--break of day.'),
	('G828','Αὐγοῦστος','Augoûstos','ow\'-goos-tos','from Latin (\"august\"); Augustus, a title of the Roman emperor:--Augustus.'),
	('G829','αὐθάδης','authádēs','ow-thad\'-ace','from αὐτός and the base of ἡδονή; self-pleasing, i.e. arrogant:--self-willed.'),
	('G830','αὐθαίρετος','authaíretos','ow-thah\'-ee-ret-os','from αὐτός and the same as αἱρετίζω; self-chosen, i.e. (by implication) voluntary:--of own accord, willing of self.'),
	('G831','αὐθεντέω','authentéō','ow-then-teh\'-o','from a compound of αὐτός and an obsolete  (a worker); to act of oneself, i.e. (figuratively) dominate:--usurp authority over.'),
	('G832','αὐλέω','auléō','ow-leh\'-o','from αὐλός; to play the flute:--pipe.'),
	('G833','αὐλή','aulḗ','ow-lay\'','from the same as ἀήρ; a yard (as open to the wind); by implication, a mansion:--court, (sheep-)fold, hall, palace.'),
	('G834','αὐλητής','aulētḗs','ow-lay-tace\'','from αὐλέω; a flute-player:--minstrel, piper.'),
	('G835','αὐλίζομαι','aulízomai','ow-lid\'-zom-ahee','middle voice from αὐλή; to pass the night (properly, in the open air):--abide, lodge.'),
	('G836','αὐλός','aulós','ow-los\'','from the same as ἀήρ; a flute (as blown):--pipe.'),
	('G837','αὐξάνω','auxánō','owx-an\'-o','a prolonged form of a primary verb; to grow (\"wax\"), i.e. enlarge (literal or figurative, active or passive):--grow (up), (give the) increase.'),
	('G838','αὔξησις','aúxēsis','owx\'-ay-sis','from αὐξάνω; growth:--increase.'),
	('G839','αὔριον','aúrion','ow\'-ree-on','from a derivative of the same as ἀήρ (meaning a breeze, i.e. the morning air); properly, fresh, i.e. (adverb with ellipsis of ἡμέρα) to-morrow:--(to-)morrow, next day.'),
	('G840','αὐστηρός','austērós','ow-stay-ros\'','from a (presumed) derivative of the same as ἀήρ (meaning blown); rough (properly as a gale), i.e. (figuratively) severe:--austere.'),
	('G841','αὐτάρκεια','autárkeia','ow-tar\'-ki-ah','from αὐτάρκης; self-satisfaction, i.e. (abstractly) contentedness, or (concretely) a competence:--contentment, sufficiency.'),
	('G842','αὐτάρκης','autárkēs','ow-tar\'-kace','from αὐτός and ἀρκέω; self-complacent, i.e. contented:--content.'),
	('G843','αὐτοκατάκριτος','autokatákritos','ow-tok-at-ak\'-ree-tos','from αὐτός and a derivative or κατακρίνω; self-condemned:--condemned of self.'),
	('G844','αὐτόματος','autómatos','ow-tom\'-at-os','from αὐτός and the same as μάτην; self-moved (\"automatic\"), i.e. spontaneous:--of own accord, of self.'),
	('G845','αὐτόπτης','autóptēs','ow-top\'-tace','from αὐτός and ὀπτάνομαι; self-seeing, i.e. an eye-witness:--eye-witness.'),
	('G846','αὐτός','autós','ow-tos\'','from the particle  (perhaps akin to the base of ἀήρ through the idea of a baffling wind) (backward); the reflexive pronoun self, used (alone or in the comparative ἑαυτοῦ) of the third person , and (with the proper personal pronoun) of the other persons:--her, it(-self), one, the other, (mine) own, said, (self-), the) same, ((him-, my-, thy- )self, (your-)selves, she, that, their(-s), them(-selves), there(-at, - by, -in, -into, -of, -on, -with), they, (these) things, this (man), those, together, very, which. Compare αὑτοῦ.'),
	('G847','αὐτοῦ','autoû','ow-too\'','genitive (i.e. possessive) of αὐτός, used as an adverb of location; properly, belonging to the same spot, i.e. in this (or that) place:--(t-)here.'),
	('G848','αὑτοῦ','hautoû','how-too\'','contracted for ἑαυτοῦ; self (in some oblique case or reflexive relation):--her (own), (of) him(-self), his (own), of it, thee, their (own), them(-selves), they.'),
	('G849','αὐτόχειρ','autócheir','ow-tokh\'-ire','from αὐτός and χείρ; self-handed, i.e. doing personally:--with … own hands.'),
	('G850','αὐχμηρός','auchmērós','owkh-may-ros\'','from  (probably from a base akin to that of ἀήρ) (dust, as dried by wind); properly, dirty, i.e. (by implication) obscure:--dark.'),
	('G851','ἀφαιρέω','aphairéō','af-ahee-reh\'-o','from ἀπό and αἱρέομαι; to remove (literally or figuratively):--cut (smite) off, take away.'),
	('G852','ἀφανής','aphanḗs','af-an-ace\'','from Α (as a negative particle) and φαίνω; non-apparent:--that is not manifest.'),
	('G853','ἀφανίζω','aphanízō','af-an-id\'-zo','from ἀφανής; to render unapparent, i.e. (actively) consume (becloud), or (passively) disappear (be destroyed):-- corrupt, disfigure, perish, vanish away.'),
	('G854','ἀφανισμός','aphanismós','af-an-is-mos\'','from ἀφανίζω; disappearance, i.e. (figuratively) abrogation:--vanish away.'),
	('G855','ἄφαντος','áphantos','af\'-an-tos','from Α (as a negative particle) and a derivative of φαίνω; non-manifested, i.e. invisible:--vanished out of sight.'),
	('G856','ἀφεδρών','aphedrṓn','af-ed-rone\'','from a compound of ἀπό and the base of ἑδραῖος; a place of sitting apart, i.e. a privy:--draught.'),
	('G857','ἀφειδία','apheidía','af-i-dee\'-ah','from a compound of Α (as a negative particle) and φείδομαι; unsparingness, i.e. austerity (asceticism):--neglecting.'),
	('G858','ἀφελότης','aphelótēs','af-el-ot\'-ace','from a compound of Α (as a negative particle) and  (in the sense of a stone as stubbing the foot); smoothness, i.e. (figuratively) simplicity:--singleness.'),
	('G859','ἄφεσις','áphesis','af\'-es-is','from ἀφίημι; freedom; (figuratively) pardon:--deliverance, forgiveness, liberty, remission.'),
	('G860','ἁφή','haphḗ','haf-ay\'','from ἅπτομαι; probably a ligament (as fastening):--joint.'),
	('G861','ἀφθαρσία','aphtharsía','af-thar-see\'-ah','from ἄφθαρτος; incorruptibility; genitive, unending existence; (figuratively) genuineness:--immortality, incorruption, sincerity.'),
	('G862','ἄφθαρτος','áphthartos','af\'-thar-tos','from Α (as a negative particle) and a derivative of φθείρω; undecaying (in essence or continuance):--not (in-, un-)corruptible, immortal.'),
	('G863','ἀφίημι','aphíēmi','af-ee\'-ay-mee','from ἀπό and  (to send; an intensive form of , to go); to send forth, in various applications (as follow):--cry, forgive, forsake, lay aside, leave, let (alone, be, go, have), omit, put (send) away, remit, suffer, yield up.'),
	('G864','ἀφικνέομαι','aphiknéomai','af-ik-neh\'-om-ahee','from ἀπό and the base of ἱκανός; to go (i.e. spread) forth (by rumor):--come abroad.'),
	('G865','ἀφιλάγαθος','aphilágathos','af-il-ag\'-ath-os','from Α (as a negative particle) and φιλάγαθος; hostile to virtue:--despiser of those that are good.'),
	('G866','ἀφιλάργυρος','aphilárgyros','af-il-ar\'-goo-ros','from Α (as a negative particle) and φιλάργυρος; unavaricious:--without covetousness, not greedy of filthy lucre.'),
	('G867','ἄφιξις','áphixis','af\'-ix-is','from ἀφικνέομαι; properly, arrival, i.e. (by implication) departure:--departing.'),
	('G868','ἀφίστημι','aphístēmi','af-is\'-tay-mee','from ἀπό and ἵστημι; to remove, i.e. (actively) instigate to revolt; usually (reflexively) to desist, desert, etc.:--depart, draw (fall) away, refrain, withdraw self.'),
	('G869','ἄφνω','áphnō','af\'-no','adverb from ἀφανής (contraction); unawares, i.e. unexpectedly:--suddenly.'),
	('G870','ἀφόβως','aphóbōs','af-ob\'-oce','adverb from a compound of Α (as a negative particle) and φόβος; fearlessly:--without fear.'),
	('G871','ἀφομοιόω','aphomoióō','af-om-oy-o\'-o','from ἀπό and ὁμοιόω; to assimilate closely:--make like.'),
	('G872','ἀφοράω','aphoráō','af-or-ah\'-o','from ἀπό and ὁράω; to consider attentively:--look.'),
	('G873','ἀφορίζω','aphorízō','af-or-id\'-zo','from ἀπό and ὁρίζω; to set off by boundary, i.e. (figuratively) limit, exclude, appoint, etc.:--divide, separate, sever.'),
