	('G1668','ἕλκος','hélkos','hel\'-kos','probably from ἑλκύω; an ulcer (as if drawn together):--sore.'),
	('G1669','ἑλκόω','helkóō','hel-ko\'-o','from ἕλκος; to cause to ulcerate, i.e. (passively) be ulcerous:--full of sores.'),
	('G1670','ἑλκύω','helkýō','hel\'-ko','probably akin to αἱρέομαι; to drag (literally or figuratively):--draw. Compare ἑλίσσω.'),
	('G1671','Ἑλλάς','Hellás','hel-las\'','of uncertain affinity; Hellas (or Greece), a country of Europe:--Greece.');
INSERT INTO `strongs` (`number`, `lemma`, `xlit`, `pronounce`, `description`)
VALUES
	('G1672','Ἕλλην','Héllēn','hel\'-lane','from Ἑλλάς; a Hellen (Grecian) or inhabitant of Hellas; by extension a Greek-speaking person, especially a non-Jew:-- Gentile, Greek.'),
	('G1673','Ἑλληνικός','Hellēnikós','hel-lay-nee-kos\'','from Ἕλλην; Hellenic, i.e. Grecian (in language):--Greek.'),
	('G1674','Ἑλληνίς','Hellēnís','hel-lay-nis\'','feminine of Ἕλλην; a Grecian (i.e. non-Jewish) woman:--Greek.'),
	('G1675','Ἑλληνιστής','Hellēnistḗs','hel-lay-nis-tace\'','from a derivative of Ἕλλην; a Hellenist or Greek-speaking Jew:--Grecian.'),
	('G1676','Ἑλληνιστί','Hellēnistí','hel-lay-nis-tee\'','adverb from the same as Ἑλληνιστής; Hellenistically, i.e. in the Grecian language:--Greek.'),
	('G1677','ἐλλογέω','ellogéō','el-log-eh\'-o','from ἐν and λόγος (in the sense of account); to reckon in, i.e. attribute:--impute, put on account.'),
	('G1678','Ἐλμωδάμ','Elmōdám','el-mo-dam\'','of Hebrew origin (perhaps for אַלְמוֹדָד); Elmodam, an Israelite:--Elmodam.'),
	('G1679','ἐλπίζω','elpízō','el-pid\'-zo','from ἐλπίς; to expect or confide:--(have, thing) hope(-d) (for), trust.'),
	('G1680','ἐλπίς','elpís','el-pece\'','from a primary  (to anticipate, usually with pleasure); expectation (abstractly or concretely) or confidence:--faith, hope.'),
	('G1681','Ἐλύμας','Elýmas','el-oo\'-mas','of foreign origin; Elymas, a wizard:--Elymas.'),
	('G1682','ἐλοΐ','eloḯ','el-o-ee\'','of Chaldean origin (אֱלָהּ with pronominal suffix) my God:--Eloi.'),
	('G1683','ἐμαυτοῦ','emautoû','em-ow-ton\'','genitive case compound of ἐμοῦ and αὐτός; of myself so likewise the dative case        , and accusative case        :--me, mine own (self), myself.'),
	('G1684','ἐμβαίνω','embaínō','em-ba\'-hee-no','from ἐν and the base of βάσις; to walk on, i.e. embark (aboard a vessel), reach (a pool):--come (get) into, enter (into), go (up) into, step in, take ship.'),
	('G1685','ἐμβάλλω','embállō','em-bal\'-lo','from ἐν and βάλλω; to throw on, i.e. (figuratively) subject to (eternal punishment):--cast into.'),
	('G1686','ἐμβάπτω','embáptō','em-bap\'-to','from ἐν and βάπτω; to whelm on, i.e. wet (a part of the person, etc.) by contact with a fluid:--dip.'),
	('G1687','ἐμβατεύω','embateúō','em-bat-yoo\'-o','from ἐν and a presumed derivative of the base of βάσις; equivalent to ἐμβαίνω; to intrude on (figuratively):--intrude into.'),
	('G1688','ἐμβιβάζω','embibázō','em-bib-ad\'-zo','from ἐν and  (to mount; causative of ἐμβαίνω); to place on, i.e. transfer (aboard a vessel):--put in.'),
	('G1689','ἐμβλέπω','emblépō','em-blep\'-o','from ἐν and βλέπω; to look on, i.e. (relatively) to observe fixedly, or (absolutely) to discern clearly:--behold, gaze up, look upon, (could) see.'),
	('G1690','ἐμβριμάομαι','embrimáomai','em-brim-ah\'-om-ahee','from ἐν and  (to snort with anger); to have indignation on, i.e. (transitively) to blame, (intransitively) to sigh with chagrin, (specially) to sternly enjoin:--straitly charge, groan, murmur against.'),
	('G1691','ἐμέ','emé','em-eh\'','a prolonged form of μέ; me:--I, me, my(-self).'),
	('G1692','ἐμέω','eméō','em-eh\'-o','of uncertain affinity; to vomit:--(will) spue.'),
	('G1693','ἐμμαίνομαι','emmaínomai','em-mah\'-ee-nom-ahee','from ἐν and μαίνομαι; to rave on, i.e. rage at:--be mad against.'),
	('G1694','Ἐμμανουήλ','Emmanouḗl','em-man-oo-ale\'','of Hebrew origin (עִמָּנוּאֵל); God with us; Emmanuel, a name of Christ:--Emmanuel.'),
	('G1695','Ἐμμαούς','Emmaoús','em-mah-ooce\'','probably of Hebrew origin (compare יֵם); Emmaus, a place in Palestine:--Emmaus.'),
	('G1696','ἐμμένω','emménō','em-men\'-o','from ἐν and μένω; to stay in the same place, i.e. (figuratively) persevere:--continue.'),
	('G1697','Ἐμμόρ','Emmór','em-mor\'','of Hebrew origin (חֲמוֹר); Emmor (i.e. Chamor), a Canaanite:--Emmor.'),
	('G1698','ἐμοί','emoí','em-oy\'','a prolonged form of μοί; to me:--I, me, mine, my.'),
	('G1699','ἐμός','emós','em-os\'','from the oblique cases of ἐγώ (ἐμοί, ἐμοῦ, ἐμέ); my:--of me, mine (own), my.'),
	('G1700','ἐμοῦ','emoû','em-oo\'','a prolonged form of μόχθος; of me:--me, mine, my.'),
	('G1701','ἐμπαιγμός','empaigmós','emp-aheeg-mos\'','from ἐμπαίζω; derision:--mocking.'),
	('G1702','ἐμπαίζω','empaízō','emp-aheed\'-zo','from ἐν and παίζω; to jeer at, i.e. deride:--mock.'),
	('G1703','ἐμπαίκτης','empaíktēs','emp-aheek-tace\'','from ἐμπαίζω; a derider, i.e. (by implication) a false teacher:--mocker, scoffer.'),
	('G1704','ἐμπεριπατέω','emperipatéō','em-per-ee-pat-eh\'-o','from ἐν and περιπατέω; to perambulate on a place, i.e. (figuratively) to be occupied among persons:--walk in.'),
	('G1705','ἐμπίπλημι','empíplēmi','em-play\'-tho','from ἐν and the base of πλεῖστος;to fill in (up), i.e. (by implication) to satisfy (literally or figuratively):--fill.'),
	('G1706','ἐμπίπτω','empíptō','em-pip\'-to','from ἐν and πίπτω; to fall on, i.e. (literally) to be entrapped by, or (figuratively) be overwhelmed with:--fall among (into).'),
	('G1707','ἐμπλέκω','emplékō','em-plek\'-o','from ἐν and πλέκω; to entwine, i.e. (figuratively) involve with:--entangle (in, self with).'),
	('G1708','ἐμπλοκή','emplokḗ','em-plok-ay\'','from ἐμπλέκω; elaborate braiding of the hair:--plaiting.'),
	('G1709','ἐμπνέω','empnéō','emp-neh\'-o','from ἐν and πνέω; to inhale, i.e. (figuratively) to be animated by (bent upon):--breathe.'),
	('G1710','ἐμπορεύομαι','emporeúomai','em-por-yoo\'-om-ahee','from ἐν and πορεύομαι; to travel in (a country as a pedlar), i.e. (by implication) to trade:--buy and sell, make merchandise.'),
	('G1711','ἐμπορία','emporía','em-por-ee\'-ah','feminine from ἔμπορος; traffic:--merchandise.'),
	('G1712','ἐμπόριον','empórion','em-por\'-ee-on','neuter from ἔμπορος; a mart (\"emporium\"):--merchandise.'),
	('G1713','ἔμπορος','émporos','em\'-por-os','from ἐν and the base of πορεύομαι; a (wholesale) tradesman:--merchant.'),
	('G1714','ἐμπρήθω','emprḗthō','em-pray\'-tho','from ἐν and  (to blow a flame); to enkindle, i.e. set on fire:--burn up.'),
	('G1715','ἔμπροσθεν','émprosthen','em\'-pros-then','from ἐν and πρός; in front of (in place (literally or figuratively) or time):--against, at, before, (in presence, sight) of.'),
	('G1716','ἐμπτύω','emptýō','emp-too\'-o','from ἐν and πτύω; to spit at or on:--spit (upon).'),
	('G1717','ἐμφανής','emphanḗs','em-fan-ace\'','from a compound of ἐν and φαίνω; apparent in self:--manifest, openly.'),
	('G1718','ἐμφανίζω','emphanízō','em-fan-id\'-zo','from ἐμφανής; to exhibit (in person) or disclose (by words):--appear, declare (plainly), inform, (will) manifest, shew, signify.'),
	('G1719','ἔμφοβος','émphobos','em\'-fob-os','from ἐν and φόβος; in fear, i.e. alarmed:--affrighted, afraid, tremble.'),
	('G1720','ἐμφυσάω','emphysáō','em-foo-sah\'-o','from ἐν and  (to puff) (compare φύω); to blow at or on:--breathe on.'),
	('G1721','ἔμφυτος','émphytos','em\'-foo-tos','from ἐν and a derivative of φύω; implanted (figuratively):--engrafted.'),
	('G1722','ἐν','en','en','a primary preposition denoting (fixed) position (in place, time or state), and (by implication) instrumentality (medially or constructively), i.e. a relation of rest (intermediate between εἰς and ἐκ); \"in,\" at, (up-)on, by, etc.:--about, after, against, + almost, X altogether, among, X as, at, before, between, (here-)by (+ all means), for (… sake of), + give self wholly to, (here-)in(-to, -wardly), X mightily, (because) of, (up-)on, (open-)ly, X outwardly, one, X quickly, X shortly, (speedi-)ly, X that, X there(-in, -on), through(-out), (un-)to(-ward), under, when, where(-with), while, with(-in). Often used in compounds, with substantially the same import; rarely with verbs of motion, and then not to indicate direction, except (elliptically) by a separate (and different) preposition.'),
	('G1723','ἐναγκαλίζομαι','enankalízomai','en-ang-kal-id\'-zom-ahee','from ἐν and a derivative of ἀγκάλη; to take in one\'s arms, i.e. embrace:--take up in arms.'),
	('G1724','ἐνάλιος','enálios','en-al\'-ee-os','from ἐν and ἅλς; in the sea, i.e. marine:--thing in the sea.'),
	('G1725','ἔναντι','énanti','en\'-an-tee','from ἐν and ἀντί; in front (i.e. figuratively, presence) of:--before.'),
	('G1726','ἐναντίον','enantíon','en-an-tee\'-on','neuter of ἐναντίος; (adverbially) in the presence (view) of:--before, in the presence of.'),
	('G1727','ἐναντίος','enantíos','en-an-tee\'-os','from ἔναντι; opposite; figuratively, antagonistic:--(over) against, contrary.'),
	('G1728','ἐνάρχομαι','enárchomai','en-ar\'-khom-ahee','from ἐν and ἄρχομαι; to commence on:--rule (by mistake for ἄρχω).'),
	('G1729','ἐνδεής','endeḗs','en-deh-ace\'','from a compound of ἐν and δέω (in the sense of lacking); deficient in:--lacking.'),
	('G1730','ἔνδειγμα','éndeigma','en\'-dighe-mah','from ἐνδείκνυμι; an indication (concretely):--manifest token.'),
	('G1731','ἐνδείκνυμι','endeíknymi','en-dike\'-noo-mee','from ἐν and δεικνύω; to indicate (by word or act):--do, show (forth).'),
	('G1732','ἔνδειξις','éndeixis','en\'-dike-sis','from ἐνδείκνυμι; indication (abstractly):--declare, evident token, proof.'),
	('G1733','ἕνδεκα','héndeka','hen\'-dek-ah','from (the neuter of) εἷς and δέκα; one and ten, i.e. eleven:--eleven.'),
	('G1734','ἑνδέκατος','hendékatos','hen-dek\'-at-os','ordinal from ἕνδεκα; eleventh:--eleventh.'),
	('G1735','ἐνδέχεται','endéchetai','en-dekh\'-et-ahee','third person singular present of a compound of ἐν and δέχομαι; (impersonally) it is accepted in, i.e. admitted (possible):--can (+ not) be.'),
	('G1736','ἐνδημέω','endēméō','en-day-meh\'-o','from a compound of ἐν and δῆμος; to be in one\'s own country, i.e. home (figuratively):--be at home (present).'),
	('G1737','ἐνδιδύσκω','endidýskō','en-did-oos\'-ko','a prolonged form of ἐνδύω; to invest (with a garment):--clothe in, wear.'),
	('G1738','ἔνδικος','éndikos','en\'-dee-kos','from ἐν and δίκη; in the right, i.e. equitable:--just.'),
	('G1739','ἐνδόμησις','endómēsis','en-dom\'-ay-sis','from a compound of ἐν and a derivative of the base of δῆμος; a housing in (residence), i.e. structure:--building.'),
	('G1740','ἐνδοξάζω','endoxázō','en-dox-ad\'-zo','from ἔνδοξος; to glorify:--glorify.'),
	('G1741','ἔνδοξος','éndoxos','en\'-dox-os','from ἐν and δόξα; in glory, i.e. splendid, (figuratively) noble:--glorious, gorgeous(-ly), honourable.'),
	('G1742','ἔνδυμα','éndyma','en\'-doo-mah','from ἐνδύω; apparel (especially the outer robe):--clothing, garment, raiment.'),
	('G1743','ἐνδυναμόω','endynamóō','en-doo-nam-o\'-o','from ἐν and δυναμόω; to empower:--enable, (increase in) strength(-en), be (make) strong.'),
	('G1744','ἐνδύνω','endýnō','en-doo\'-no','from ἔννομος and δύνω; to sink (by implication, wrap (compare ἐνδύω) on, i.e. (figuratively) sneak:--creep.'),
	('G1745','ἔνδυσις','éndysis','en\'-doo-sis','from ἐνδύω; investment with clothing:--putting on.'),
	('G1746','ἐνδύω','endýō','en-doo\'-o','from ἐν and δύνω (in the sense of sinking into a garment); to invest with clothing (literally or figuratively):--array, clothe (with), endue, have (put) on.'),
	('G1747','ἐνέδρα','enédra','en-ed\'-rah','feminine from ἐν and the base of ἑδραῖος; an ambuscade, i.e. (figuratively) murderous purpose:--lay wait. See also ἔνεδρον.'),
	('G1748','ἐνεδρεύω','enedreúō','en-ed-ryoo\'-o','from ἐνέδρα; to lurk, i.e. (figuratively) plot assassination:--lay wait for.'),
	('G1749','ἔνεδρον','énedron','en\'-ed-ron','neuter of the same as ἐνέδρα; an ambush, i.e. (figuratively) murderous design:--lying in wait.'),
	('G1750','ἐνειλέω','eneiléō','en-i-leh\'-o','from ἔννομος and the base of εἱλίσσω; to enwrap:--wrap in.'),
	('G1751','ἔνειμι','éneimi','en\'-i-mee','from ἔννομος and εἰμί; to be within (neuter participle plural):--such things as … have. See also ἔνι.'),
	('G1752','ἕνεκα','héneka','hi\'-nek-en','of uncertain affinity; on account of:--because, for (cause, sake), (where-)fore, by reason of, that.'),
	('G1753','ἐνέργεια','enérgeia','en-erg\'-i-ah','from ἐνεργής; efficiency (\"energy\"):--operation, strong, (effectual) working.'),
	('G1754','ἐνεργέω','energéō','en-erg-eh\'-o','from ἐνεργής; to be active, efficient:--do, (be) effectual (fervent), be mighty in, shew forth self, work (effectually in).'),
	('G1755','ἐνέργημα','enérgēma','en-erg\'-ay-mah','from ἐνεργέω; an effect:--operation, working.'),
	('G1756','ἐνεργής','energḗs','en-er-gace\'','from ἐν and ἔργον; active, operative:--effectual, powerful.'),
	('G1757','ἐνευλογέω','eneulogéō','en-yoo-log-eh\'-o','from ἐν and εὐλογέω; to confer a benefit on:--bless.'),
	('G1758','ἐνέχω','enéchō','en-ekh\'-o','from ἐν and ἔχω; to hold in or upon, i.e. ensnare; by implication, to keep a grudge:--entangle with, have a quarrel against, urge.'),
	('G1759','ἐνθάδε','entháde','en-thad\'-eh','from a prolonged form of ἐν; properly, within, i.e. (of place) here, hither:--(t-)here, hither.'),
	('G1760','ἐνθυμέομαι','enthyméomai','en-thoo-meh\'-om-ahee','from a compound of ἐν and θυμός; to be inspirited, i.e. ponder:--think.'),
	('G1761','ἐνθύμησις','enthýmēsis','en-thoo\'-may-sis','from ἐνθυμέομαι; deliberation:--device, thought.'),
	('G1762','ἔνι','éni','en\'-ee','contraction for the third person singular present indicative of ἔνειμι; impersonally, there is in or among:--be, (there) is.'),
	('G1763','ἐνιαυτός','eniautós','en-ee-ow-tos\'','prolongation from a primary  (a year); a year:--year.'),
	('G1764','ἐνίστημι','enístēmi','en-is\'-tay-mee','from ἐν and ἵστημι; to place on hand, i.e. (reflexively) impend, (participle) be instant:--come, be at hand, present.'),
	('G1765','ἐνισχύω','enischýō','en-is-khoo\'-o','from ἐν and ἰσχύω; to invigorate (transitively or reflexively):--strengthen.'),
	('G1766','ἔννατος','énnatos','en\'-nat-os','ordinal from ἐννέα; ninth:--ninth.'),
	('G1767','ἐννέα','ennéa','en-neh\'-ah','a primary number; nine:--nine.'),
	('G1768','ἐννενηκονταεννέα','ennenēkontaennéa','en-nen-ay-kon-tah-en-neh\'-ah','from a (tenth) multiple of ἐννέα and ἐννέα itself; ninety-nine:--ninety and nine.'),
	('G1769','ἐννεός','enneós','en-neh-os\'','from ἐννεύω; dumb (as making signs), i.e. silent from astonishment:--speechless.'),
	('G1770','ἐννεύω','enneúō','en-nyoo\'-o','from ἐν and νεύω; to nod at, i.e. beckon or communicate by gesture:--make signs.'),
	('G1771','ἔννοια','énnoia','en\'-noy-ah','from a compound of ἐν and νοῦς; thoughtfulness, i.e. moral understanding:--intent, mind.'),
	('G1772','ἔννομος','énnomos','en\'-nom-os','from ἐν and νόμος; (subjectively) legal, or (objectively) subject to:--lawful, under law.'),
	('G1773','ἔννυχον','énnychon','en\'-noo-khon','neuter of a compound of ἐν and νύξ; (adverbially) by night:--before day.'),
	('G1774','ἐνοικέω','enoikéō','en-oy-keh\'-o','from ἐν and οἰκέω; to inhabit (figuratively):--dwell in.'),
	('G1775','ἑνότης','henótēs','hen-ot-ace\'','from εἷς; oneness, i.e. (figuratively) unanimity:--unity.'),
	('G1776','ἐνοχλέω','enochléō','en-okh-leh\'-o','from ἐν and ὀχλέω; to crowd in, i.e. (figuratively) to annoy:--trouble.'),
