	('G1778','ἔνταλμα','éntalma','en\'-tal-mah','from ἐντέλλομαι; an injunction, i.e. religious precept:--commandment.'),
	('G1779','ἐνταφιάζω','entaphiázō','en-taf-ee-ad\'-zo','from a compound of ἐν and τάφος; to inswathe with cerements for interment:--bury.'),
	('G1780','ἐνταφιασμός','entaphiasmós','en-taf-ee-as-mos\'','from ἐνταφιάζω; preparation for interment:--burying.'),
	('G1781','ἐντέλλομαι','entéllomai','en-tel\'-lom-ahee','from ἐν and the base of τέλος; to enjoin:--(give) charge, (give) command(-ments), injoin.'),
	('G1782','ἐντεῦθεν','enteûthen','ent-yoo\'-then','from the same as ἐνθάδε; hence (literally or figuratively); (repeated) on both sides:--(from) hence, on either side.'),
	('G1783','ἔντευξις','énteuxis','ent\'-yook-sis','from ἐντυγχάνω; an interview, i.e. (specially) supplication:--intercession, prayer.'),
	('G1784','ἔντιμος','éntimos','en\'-tee-mos','from ἐν and τιμή; valued (figuratively):--dear, more honourable, precious, in reputation.'),
	('G1785','ἐντολή','entolḗ','en-tol-ay\'','from ἐντέλλομαι; injunction, i.e. an authoritative prescription:--commandment, precept.'),
	('G1786','ἐντόπιος','entópios','en-top\'-ee-os','from ἐν and τόπος; a resident:--of that place.'),
	('G1787','ἐντός','entós','en-tos\'','from ἐν; inside (adverb or noun):--within.'),
	('G1788','ἐντρέπω','entrépō','en-trep\'-o','from ἐν and the base of τροπή; to invert, i.e. (figuratively and reflexively) in a good sense, to respect; or in a bad one, to confound:--regard, (give) reference, shame.'),
	('G1789','ἐντρέφω','entréphō','en-tref\'-o','from ἐν and τρέφω; (figuratively) to educate:--nourish up in.'),
	('G1790','ἔντρομος','éntromos','en\'-trom-os','from ἐν and τρόμος; terrified:--X quake, X trembled.'),
	('G1791','ἐντροπή','entropḗ','en-trop-ay\'','from ἐντρέπω; confusion:--shame.'),
	('G1792','ἐντρυφάω','entrypháō','en-troo-fah\'-o','from ἐν and τρυφάω; to revel in:--sporting selves.'),
	('G1793','ἐντυγχάνω','entynchánō','en-toong-khan\'-o','from ἐν and τυγχάνω; to chance upon, i.e. (by implication) confer with; by extension to entreat (in favor or against):--deal with, make intercession.'),
	('G1794','ἐντυλίσσω','entylíssō','en-too-lis\'-so','from ἐν and  (to twist; probably akin to εἱλίσσω); to entwine, i.e. wind up in:--wrap in (together).'),
	('G1795','ἐντυπόω','entypóō','en-too-po\'-o','from ἐν and a derivative of τύπος; to enstamp, i.e. engrave:--engrave.'),
	('G1796','ἐνυβρίζω','enybrízō','en-oo-brid\'-zo','from ἐν and ὑβρίζω; to insult:--do despite unto.'),
