	('G2164','εὐφορέω','euphoréō','yoo-for-eh\'-o','from εὖ and φορέω; to bear well, i.e. be fertile:--bring forth abundantly.'),
	('G2165','εὐφραίνω','euphraínō','yoo-frah\'-ee-no','from εὖ and φρήν; to put (middle voice or passively, be) in a good frame of mind, i.e. rejoice:--fare, make glad, be (make) merry, rejoice.'),
	('G2166','Εὐφράτης','Euphrátēs','yoo-frat\'-ace','of foreign origin (compare פְּרָת); Euphrates, a river of Asia:--Euphrates.'),
	('G2167','εὐφροσύνη','euphrosýnē','yoo-fros-oo\'-nay','from the same as εὐφραίνω; joyfulness:--gladness, joy.'),
	('G2168','εὐχαριστέω','eucharistéō','yoo-khar-is-teh\'-o','from εὐχάριστος; to be grateful, i.e. (actively) to express gratitude (towards); specially, to say grace at a meal:--(give) thank(-ful, -s).'),
	('G2169','εὐχαριστία','eucharistía','yoo-khar-is-tee\'-ah','from εὐχάριστος; gratitude; actively, grateful language (to God, as an act of worship):--thankfulness, (giving of) thanks(-giving).'),
	('G2170','εὐχάριστος','eucháristos','yoo-khar\'-is-tos','from εὖ and a derivative of χαρίζομαι; well favored, i.e. (by implication) grateful:--thankful.'),
	('G2171','εὐχή','euchḗ','yoo-khay\'','from εὔχομαι; properly, a wish, expressed as a petition to God, or in votive obligation:--prayer, vow.'),
	('G2172','εὔχομαι','eúchomai','yoo\'-khom-ahee','middle voice of a primary verb; to wish; by implication, to pray to God:--pray, will, wish.'),
	('G2173','εὔχρηστος','eúchrēstos','yoo\'-khrays-tos','from εὖ and χρηστός; easily used, i.e. useful:--profitable, meet for use.'),
	('G2174','εὐψυχέω','eupsychéō','yoo-psoo-kheh\'-o','from a compound of εὖ and ψυχή; to be in good spirits, i.e. feel encouraged:--be of good comfort.'),
	('G2175','εὐωδία','euōdía','yoo-o-dee\'-ah','from a compound of εὖ and a derivative of ὄζω; good-scentedness, i.e. fragrance:--sweet savour (smell, -smelling).'),
	('G2176','εὐώνυμος','euṓnymos','yoo-o\'-noo-mos','from εὖ and ὄνομα; properly, well-named (good-omened), i.e. the left (which was the lucky side among the pagan Greeks); neuter as adverbial, at the left hand:--(on the) left.'),
	('G2177','ἐφάλλομαι','ephállomai','ef-al\'-lom-ahee','from ἐπί and ἅλλομαι; to spring upon:--leap on.'),
	('G2178','ἐφάπαξ','ephápax','ef-ap\'-ax','from ἐπί and ἅπαξ; upon one occasion (only):--(at) once (for all).'),
	('G2179','Ἐφεσῖνος','Ephesînos','ef-es-ee\'-nos','from Ἔφεσος; Ephesine, or situated at Ephesus:--of Ephesus.'),
	('G2180','Ἐφέσιος','Ephésios','ef-es\'-ee-os','from Ἔφεσος; an Ephesian or inhabitant of Ephesus:--Ephesian, of Ephesus.'),
	('G2181','Ἔφεσος','Éphesos','ef\'-es-os','probably of foreign origin; Ephesus, a city of Asia Minor:--Ephesus.'),
	('G2182','ἐφευρετής','epheuretḗs','ef-yoo-ret\'-ace','from a compound of ἐπί and εὑρίσκω; a discoverer, i.e. contriver:--inventor.'),
	('G2183','ἐφημερία','ephēmería','ef-ay-mer-ee\'-ah','from ἐφήμερος; diurnality, i.e. (specially) the quotidian rotation or class of the Jewish priests\' service at the Temple, as distributed by families:--course.'),
	('G2184','ἐφήμερος','ephḗmeros','ef-ay\'-mer-os','from ἐπί and ἡμέρα; for a day (\"ephemeral\"), i.e. diurnal:--daily.'),
	('G2185','ἐφικνέομαι','ephiknéomai','ef-ik-neh\'-om-ahee','from ἐπί and a cognate of ἥκω; to arrive upon, i.e. extend to:--reach.'),
	('G2186','ἐφίστημι','ephístēmi','ef-is\'-tay-mee','from ἐπί and ἵστημι; to stand upon, i.e. be present (in various applications, friendly or otherwise, usually literal); --assault, come (in, to, unto, upon), be at hand (instant), present, stand (before, by, over).'),
	('G2187','Ἐφραίμ','Ephraím','ef-rah-im\'','of Hebrew origin (אֶפְרַיִם or better עֶפְרוֹן); Ephraim, a place in Palestine:--Ephraim.'),
	('G2188','ἐφφαθά','ephphathá','ef-fath-ah\'','of Chaldee origin (פְּתַח); be opened!:--Ephphatha.'),
	('G2189','ἔχθρα','échthra','ekh\'-thrah','feminine of ἐχθρός; hostility; by implication, a reason for opposition:--enmity, hatred.'),
	('G2190','ἐχθρός','echthrós','ech-thros\'','from a primary  (to hate); hateful (passively, odious, or actively, hostile); usually as a noun, an adversary (especially Satan):--enemy, foe.'),
	('G2191','ἔχιδνα','échidna','ekh\'-id-nah','of uncertain origin; an adder or other poisonous snake (literally or figuratively):--viper.'),
	('G2192','ἔχω','échō','skheh\'-o','a primary verb; to hold (used in very various applications, literally or figuratively, direct or remote; such as possession; ability, contiuity, relation, or condition):--be (able, X hold, possessed with), accompany, + begin to amend, can(+ -not), X conceive, count, diseased, do + eat, + enjoy, + fear, following, have, hold, keep, + lack, + go to law, lie, + must needs, + of necessity, + need, next, + recover, + reign, + rest, + return, X sick, take for, + tremble, + uncircumcised, use.'),
	('G2193','ἕως','héōs','heh\'-oce','of uncertain affinity; a conjunction, preposition and adverb of continuance, until (of time and place):--even (until, unto), (as) far (as), how long, (un-)til(-l), (hither-, un-, up) to, while(-s).'),
	('G2194','Ζαβουλών','Zaboulṓn','dzab-oo-lone\'','of Hebrew origin (זְבוּלוּן); Zabulon (i.e. Zebulon), a region of Palestine:--Zabulon.'),
	('G2195','Ζακχαῖος','Zakchaîos','dzak-chah\'-ee-yos','of Hebrew origin (compare זַכַּי); Zacchæus, an Israelite:--Zacchæus.'),
	('G2196','Ζαρά','Zará','dzar-ah\'','of Hebrew origin (זֶרַח); Zara, (i.e. Zerach), an Israelite:--Zara.'),
	('G2197','Ζαχαρίας','Zacharías','dzakh-ar-ee\'-as','of Hebrew origin (זְכַרְיָה); Zacharias (i.e. Zechariah), the name of two Israelites:--Zacharias.'),
	('G2198','ζάω','záō','dzah\'-o','a primary verb; to live (literally or figuratively):--life(-time), (a-)live(-ly), quick.'),
	('G2199','Ζεβεδαῖος','Zebedaîos','dzeb-ed-ah\'-yos','of Hebrew origin (compare זַבְדִּי); Zebedæus, an Israelite:--Zebedee.'),
	('G2200','ζεστός','zestós','dzes-tos\'','from ζέω; boiled, i.e. (by implication) calid (figuratively, fervent):--hot.'),
	('G2201','ζεῦγος','zeûgos','dzyoo\'-gos','from the same as ζυγός; a couple, i.e. a team (of oxen yoked together) or brace (of birds tied together):--yoke, pair.'),
	('G2202','ζευκτηρία','zeuktēría','dzook-tay-ree\'-ah','feminine of a derivative (at the second stage) from the same as ζυγός; a fastening (tiller-rope):--band.'),
	('G2203','Ζεύς','Zeús','deece','of uncertain affinity; in the oblique cases there is used instead of it a (probably cognate) name        , which is otherwise obsolete;        Zeus or Dis (among the Latins, Jupiter or Jove), the supreme deity of the Greeks:--Jupiter.'),
	('G2204','ζέω','zéō','dzeh\'-o','a primary verb; to be hot (boil, of liquids; or glow, of solids), i.e. (figuratively) be fervid (earnest):--be fervent.'),
	('G2205','ζῆλος','zēlos','dzay\'-los','from ζέω; properly, heat, i.e. (figuratively) \"zeal\" (in a favorable sense, ardor; in an unfavorable one, jealousy, as of a husband (figuratively, of God), or an enemy, malice):--emulation, envy(-ing), fervent mind, indignation, jealousy, zeal.'),
	('G2206','ζηλόω','zēlóō','dzay-lo\'-o','from ζῆλος; to have warmth of feeling for or against:--affect, covet (earnestly), (have) desire, (move with) envy, be jealous over, (be) zealous(-ly affect).'),
	('G2207','ζηλωτής','zēlōtḗs','dzay-lo-tace\'','from ζηλόω; a \"zealot\":--zealous.'),
	('G2208','Ζηλωτής','Zēlōtḗs','dzay-lo-tace\'','the same as ζηλωτής; a Zealot, i.e. (specially) partisan for Jewish political independence:--Zelotes.'),
	('G2209','ζημία','zēmía','dzay-mee\'-ah','probably akin to the base of δαμάζω (through the idea of violence); detriment:--damage, loss.'),
	('G2210','ζημιόω','zēmióō','dzay-mee-o\'-o','from ζημία; to injure, i.e. (reflexively or passively) to experience detriment:--be cast away, receive damage, lose, suffer loss.'),
	('G2211','Ζηνᾶς','Zēnâs','dzay-nas\'','probably contracted from a poetic form of Ζεύς and δῶρον; Jove-given; Zenas, a Christian:--Zenas.'),
	('G2212','ζητέω','zētéō','dzay-teh\'-o','of uncertain affinity; to seek (literally or figuratively); specially, (by Hebraism) to worship (God), or (in a bad sense) to plot (against life):--be (go) about, desire, endeavour, enquire (for), require, (X will) seek (after, for, means). Compare πυνθάνομαι.'),
	('G2213','ζήτημα','zḗtēma','dzay\'-tay-mah','from ζητέω; a search (properly concretely), i.e. (in words) a debate:--question.'),
	('G2214','ζήτησις','zḗtēsis','dzay\'-tay-sis','from ζητέω; a searching (properly, the act), i.e. a dispute or its theme:--question.'),
	('G2215','ζιζάνιον','zizánion','dziz-an\'-ee-on','of uncertain origin; darnel or false grain:--tares.'),
	('G2216','Ζοροβάβελ','Zorobábel','dzor-ob-ab\'-el','of Hebrew origin (זְרֻבָּבֶל); Zorobabel (i.e. Zerubbabel), an Israelite:--Zorobabel.'),
	('G2217','ζόφος','zóphos','dzof\'-os','akin to the base of νέφος; gloom (as shrouding like a cloud):--blackness, darkness, mist.'),
	('G2218','ζυγός','zygós','dzoo-gos\'','from the root of  (to join, especially by a \"yoke\"); a coupling, i.e. (figuratively) servitude (a law or obligation); also (literally) the beam of the balance (as connecting the scales):--pair of balances, yoke.'),
	('G2219','ζύμη','zýmē','dzoo\'-may','probably from ζέω; ferment (as if boiling up):--leaven.'),
	('G2220','ζυμόω','zymóō','dzoo-mo\'-o','from ζύμη; to cause to ferment:--leaven.'),
	('G2221','ζωγρέω','zōgréō','dzogue-reh\'-o','from the same as ζῶον and ἀγρεύω; to take alive (make a prisoner of war), i.e. (figuratively) to capture or ensnare:--take captive, catch.'),
	('G2222','ζωή','zōḗ','dzo-ay\'','from ζάω; life (literally or figuratively):--life(-time). Compare ψυχή.'),
	('G2223','ζώνη','zṓnē','dzo\'-nay','probably akin to the base of ζυγός; a belt; by implication, a pocket:--girdle, purse.'),
	('G2224','ζώννυμι','zṓnnymi','dzone\'-noo-mi','from ζώνη; to bind about (especially with a belt):--gird.'),
	('G2225','ζωογονέω','zōogonéō','dzo-og-on-eh\'-o','from the same as ζῶον and a derivative of γίνομαι; to engender alive, i.e. (by analogy) to rescue (passively, be saved) from death:--live, preserve.'),
	('G2226','ζῶον','zōon','dzo\'-on','neuter of a derivative of ζάω; a live thing, i.e. an animal:--beast.'),
	('G2227','ζωοποιέω','zōopoiéō','dzo-op-oy-eh\'-o','from the same as ζῶον and ποιέω; to (re-)vitalize (literally or figuratively):--make alive, give life, quicken.'),
	('G2228','ἤ','ḗ','ay','a primary particle of distinction between two connected terms; disjunctive, or; comparative, than:--and, but (either), (n-)either, except it be, (n-)or (else), rather, save, than, that, what, yea. Often used in connection with other particles. Compare especially ἤδη, ἤπερ, ἤτοι.'),
	('G2229','ἦ','ē','ay','an adverb of confirmation; perhaps intensive of ἤ; used only (in the New Testament) before μέν; assuredly:--surely.'),
	('G2230','ἡγεμονεύω','hēgemoneúō','hayg-em-on-yoo\'-o','from ἡγεμών; to act as ruler:--be governor.'),
	('G2231','ἡγεμονία','hēgemonía','hayg-em-on-ee\'-ah','from ἡγεμών; government, i.e. (in time) official term:--reign.'),
	('G2232','ἡγεμών','hēgemṓn','hayg-em-ohn\'','from ἡγέομαι; a leader, i.e. chief person (or figuratively, place) of a province:--governor, prince, ruler.'),
	('G2233','ἡγέομαι','hēgéomai','hayg-eh\'-om-ahee','middle voice of a (presumed) strengthened form of ἄγω; to lead, i.e. command (with official authority); figuratively, to deem, i.e. consider:--account, (be) chief, count, esteem, governor, judge, have the rule over, suppose, think.'),
	('G2234','ἡδέως','hēdéōs','hay-deh\'-oce','adverb from a derivative of the base of ἡδονή; sweetly, i.e. (figuratively) with pleasure:--gladly.'),
	('G2235','ἤδη','ḗdē','ay\'-day','apparently from ἤ (or possibly ἦ) and δή; even now:--already, (even) now (already), by this time.'),
	('G2236','ἥδιστα','hḗdista','hay\'-dis-tah','neuter plural of the superlative of the same as ἡδέως; with great pleasure:--most (very) gladly.'),
	('G2237','ἡδονή','hēdonḗ','hay-don-ay\'','from  (to please); sensual delight; by implication, desire:--lust, pleasure.'),
	('G2238','ἡδύοσμον','hēdýosmon','hay-doo\'-os-mon','neuter of the compound of the same as ἡδέως and ὀσμή; a sweet-scented plant, i.e. mint:--mint.'),
	('G2239','ἦθος','ēthos','ay\'-thos','a strengthened form of ἔθος; usage, i.e. (plural) moral habits:--manners.'),
	('G2240','ἥκω','hḗkō','hay\'-ko','a primary verb; to arrive, i.e. be present (literally or figuratively):--come.'),
	('G2241','ἠλί','ēlí','ay-lee\'','of Hebrew origin (אֵל with pronominal suffix); my God:-- Eli.'),
	('G2242','Ἡλί','Hēlí','hay-lee\'','of Hebrew origin (עֵלִי); Heli (i.e. Eli), an Israelite:--Heli.'),
	('G2243','Ἡλίας','Hēlías','hay-lee\'-as','of Hebrew origin (אֵלִיָּה); Helias (i.e. Elijah), an Israelite:--Elias.'),
	('G2244','ἡλικία','hēlikía','hay-lik-ee\'-ah','from the same as ἡλίκος; maturity (in years or size):--age, stature.'),
	('G2245','ἡλίκος','hēlíkos','hay-lee\'-kos','from  (a comrade, i.e. one of the same age); as big as, i.e. (interjectively) how much:--how (what) great.'),
	('G2246','ἥλιος','hḗlios','hay\'-lee-os','from  (a ray; perhaps akin to the alternate of αἱρέομαι); the sun; by implication, light:--+ east, sun.'),
	('G2247','ἧλος','hēlos','hay\'-los','of uncertain affinity; a stud, i.e. spike:--nail.'),
	('G2248','ἡμᾶς','hēmâs','hay-mas\'','accusative case plural of ἐγώ; us:--our, us, we.'),
	('G2249','ἡμεῖς','hēmeîs','hay-mice\'','nominative plural of ἐγώ; we (only used when emphatic):--us, we (ourselves).'),
	('G2250','ἡμέρα','hēméra','hay-mer\'-ah','feminine (with ὥρα implied) of a derivative of  (to sit; akin to the base of ἑδραῖος) meaning tame, i.e. gentle; day, i.e. (literally) the time space between dawn and dark, or the whole 24 hours (but several days were usually reckoned by the Jews as inclusive of the parts of both extremes); figuratively, a period (always defined more or less clearly by the context):--age, + alway, (mid-)day (by day, (-ly)), + for ever, judgment, (day) time, while, years.'),
	('G2251','ἡμέτερος','hēméteros','hay-met\'-er-os','from θνητός; our:--our, your (by a different reading).'),
	('G2252','ἤμην','ḗmēn','ay\'-mane','a prolonged form of ἦν; I was:--be, was. (Sometimes unexpressed).'),
	('G2253','ἡμιθανής','hēmithanḗs','hay-mee-than-ace\'','from a presumed compound of the base of ἥμισυ and θνήσκω; half dead, i.e. entirely exhausted:--half dead.'),
	('G2254','ἡμῖν','hēmîn','hay-meen\'','dative case plural of ἐγώ; to (or for, with, by) us:--our, (for) us, we.'),
	('G2255','ἥμισυ','hḗmisy','hay\'-mee-soo','neuter of a derivative from an inseparable prefix akin to ἅμα (through the idea of partition involved in connection) and meaning semi-; (as noun) half:--half.'),
	('G2256','ἡμιώριον','hēmiṓrion','hay-mee-o\'-ree-on','from the base of ἥμισυ and ὥρα; a half-hour:--half an hour.'),
	('G2257','ἡμῶν','hēmōn','hay-mone\'','genitive case plural of ἐγώ; of (or from) us:--our (company), us, we.'),
	('G2258','ἦν','ēn','ane','imperfect of εἰμί; I (thou, etc.) was (wast or were):--+ agree, be, X have (+ charge of), hold, use, was(-t), were.'),
	('G2259','ἡνίκα','hēníka','hay-nee\'-kah','of uncertain affinity; at which time:--when.'),
	('G2260','ἤπερ','ḗper','ay\'-per','from ἤ and περ; than at all (or than perhaps, than indeed):--than.'),
	('G2261','ἤπιος','ḗpios','ay\'-pee-os','probably from ἔπος; properly, affable, i.e. mild or kind:--gentle.'),
	('G2262','Ἤρ','Ḗr','ayr','of Hebrew origin (עֵר); Er, an Israelite:--Er.'),
	('G2263','ἤρεμος','ḗremos','ay\'-rem-os','perhaps by transposition from ἔρημος (through the idea of stillness); tranquil:--quiet.'),
	('G2264','Ἡρώδης','Hērṓdēs','hay-ro\'-dace','compound of  (a \"hero\") and εἶδος; heroic; Herod, the name of four Jewish kings:--Herod.'),
	('G2265','Ἡρωδιανοί','Hērōdianoí','hay-ro-dee-an-oy\'','plural of a derivative of Ἡρώδης; Herodians, i.e. partisans of Herod:--Herodians.'),
	('G2266','Ἡρωδιάς','Hērōdiás','hay-ro-dee-as\'','from Ἡρώδης; Herodias, a woman of the Heodian family:--Herodias.'),
	('G2267','Ἡρωδίων','Hērōdíōn','hay-ro-dee\'-ohn','from Ἡρώδης; Herodion, a Christian:--Herodion.'),
	('G2268','Ἡσαΐας','Hēsaḯas','hay-sah-ee\'-as','of Hebrew origin (יְשַׁעְיָה); Hesaias (i.e. Jeshajah), an Israelite:--Esaias.'),
	('G2269','Ἠσαῦ','Ēsaû','ay-sow\'','of Hebrew origin (עֵשָׂו); Esau, an Edomite:--Esau.'),
	('G2270','ἡσυχάζω','hēsycházō','hay-soo-khad\'-zo','from the same as ἡσύχιος; to keep still (intransitively), i.e. refrain from labor, meddlesomeness or speech:--cease, hold peace, be quiet, rest.'),
	('G2271','ἡσυχία','hēsychía','hay-soo-khee\'-ah','feminine of ἡσύχιος; (as noun) stillness, i.e. desistance from bustle or language:--quietness, silence.'),
	('G2272','ἡσύχιος','hēsýchios','hay-soo\'-khee-os','a prolonged form of a compound probably of a derivative of the base of ἑδραῖος and perhaps ἔχω; properly, keeping one\'s seat (sedentary), i.e. (by implication) still (undisturbed, undisturbing):--peaceable, quiet.'),
	('G2273','ἤτοι','ḗtoi','ay\'-toy','from ἤ and τοί; either indeed:--whether.'),
	('G2274','ἡττάω','hēttáō','hayt-tah\'-o','from the same as ἥττον; to make worse, i.e. vanquish (literally or figuratively); by implication, to rate lower:--be inferior, overcome.'),
	('G2275','ἥττημα','hḗttēma','hayt\'-tay-mah','from ἡττάω; a deterioration, i.e. (objectively) failure or (subjectively) loss:--diminishing, fault.'),
	('G2276','ἥττον','hḗtton','hate\'-ton','neuter of comparative of  (slightly) used for that of κακός; worse (as noun); by implication, less (as adverb):--less, worse.'),
	('G2277','ἤτω','ḗtō','ay\'-to','third person singular imperative of εἰμί; let him (or it) be:--let … be.'),
	('G2278','ἠχέω','ēchéō','ay-kheh\'-o','from ἦχος; to make a loud noise, i.e. reverberate:--roar, sound.'),
	('G2279','ἦχος','ēchos','ay\'-khos','of uncertain affinity; a loud or confused noise (\"echo\"), i.e. roar; figuratively, a rumor:--fame, sound.'),
	('G2280','Θαδδαῖος','Thaddaîos','thad-dah\'-yos','of uncertain origin; Thaddæus, one of the Apostles:--Thaddæus.'),
	('G2281','θάλασσα','thálassa','thal\'-as-sah','probably prolonged from ἅλς; the sea (genitive case or specially):--sea.'),
	('G2282','θάλπω','thálpō','thal\'-po','probably akin to  (to warm); to brood, i.e. (figuratively) to foster:--cherish.'),
	('G2283','Θάμαρ','Thámar','tham\'-ar','of Hebrew origin (תָּמָר); Thamar (i.e. Tamar), an Israelitess:--Thamar.'),
	('G2284','θαμβέω','thambéō','tham-beh\'-o','from θάμβος; to stupefy (with surprise), i.e. astound:--amaze, astonish.'),
	('G2285','θάμβος','thámbos','tham\'-bos','akin to an obsolete  (to dumbfound); stupefaction (by surprise), i.e. astonishment:--X amazed, + astonished, wonder.'),
	('G2286','θανάσιμος','thanásimos','than-as\'-ee-mos','from θάνατος; fatal, i.e. poisonous:--deadly.'),
	('G2287','θανατήφορος','thanatḗphoros','than-at-ay\'-for-os','from (the feminine form of) θάνατος and φέρω; death-bearing, i.e. fatal:--deadly.'),
