	('G2552','κακοπάθεια','kakopátheia','kak-op-ath\'-i-ah','from a compound of ἡμιώριον and πάθος; hardship:--suffering affliction.'),
	('G2553','κακοπαθέω','kakopathéō','kak-op-ath-eh\'-o','from the same as κακοπάθεια; to undergo hardship:--be afflicted, endure afflictions (hardness), suffer trouble.'),
	('G2554','κακοποιέω','kakopoiéō','kak-op-oy-eh\'-o','from κακοποιός; to be a bad-doer, i.e. (objectively) to injure, or (genitive) to sin:--do(ing) evil.'),
	('G2555','κακοποιός','kakopoiós','kak-op-oy-os\'','from κακός and ποιέω; a bad-doer; (specially), a criminal:--evil-doer, malefactor.'),
	('G2556','κακός','kakós','kak-os\'','apparently a primary word; worthless (intrinsically, such; whereas πονηρός properly refers to effects), i.e. (subjectively) depraved, or (objectively) injurious:--bad, evil, harm, ill, noisome, wicked.'),
	('G2557','κακοῦργος','kakoûrgos','kak-oor\'-gos','from κακός and the base of ἔργον; a wrong-doer, i.e. criminal:--evil-doer, malefactor.'),
	('G2558','κακουχέω','kakouchéō','kak-oo-kheh\'-o','from a presumed compound of κακός and ἔχω; to maltreat:--which suffer adversity, torment.'),
