	('G2560','κακῶς','kakōs','kak-oce\'','from κακός; badly (physically or morally):--amiss, diseased, evil, grievously, miserably, sick, sore.'),
	('G2561','κάκωσις','kákōsis','kak\'-o-sis','from κακόω; maltreatment:--affliction.'),
	('G2562','καλάμη','kalámē','kal-am\'-ay','feminine of κάλαμος; a stalk of grain, i.e. (collectively) stubble:--stubble.'),
	('G2563','κάλαμος','kálamos','kal\'-am-os','of uncertain affinity; a reed (the plant or its stem, or that of a similar plant); by implication, a pen:--pen, reed.'),
	('G2564','καλέω','kaléō','kal-eh\'-o','akin to the base of κελεύω; to \"call\" (properly, aloud, but used in a variety of applications, directly or otherwise):--bid, call (forth), (whose, whose sur-)name (was (called)).'),
	('G2565','καλλιέλαιος','kalliélaios','kal-le-el\'-ah-yos','from the base of καλλίον and ἐλαία; a cultivated olive tree, i.e. a domesticated or improved one:--good olive tree.'),
	('G2566','καλλίον','kallíon','kal-lee\'-on','neuter of the (irregular) comparative of καλός; (adverbially) better than many:--very well.'),
	('G2567','καλοδιδάσκαλος','kalodidáskalos','kal-od-id-as\'-kal-os','from καλός and διδάσκαλος; a teacher of the right:--teacher of good things.'),
	('G2568','Καλοὶ Λιμένες','Kaloì Liménes','kal-oy\' lee-men\'-es','plural of καλός and λιμήν; Good Harbors, i.e. Fairhaven, a bay of Crete:--fair havens.'),
	('G2569','καλοποιέω','kalopoiéō','kal-op-oy-eh\'-o','from καλός and ποιέω; to do well, i.e. live virtuously:--well doing.'),
	('G2570','καλός','kalós','kal-os\'','of uncertain affinity; properly, beautiful, but chiefly (figuratively) good (literally or morally), i.e. valuable or virtuous (for appearance or use, and thus distinguished from ἀγαθός, which is properly intrinsic):--X better, fair, good(-ly), honest, meet, well, worthy.'),
	('G2571','κάλυμα','kályma','kal\'-oo-mah','from καλύπτω; a cover, i.e. veil:--vail.'),
	('G2572','καλύπτω','kalýptō','kal-oop\'-to','akin to κλέπτω and κρύπτω; to cover up (literally or figuratively):--cover, hide.'),
	('G2573','καλῶς','kalōs','kal-oce\'','adverb from καλός; well (usually morally):--(in a) good (place), honestly, + recover, (full) well.'),
	('G2574','κάμηλος','kámēlos','kam\'-ay-los','of Hebrew origin (גָּמָל); a \"camel\":--camel.'),
	('G2575','κάμινος','káminos','kam\'-ee-nos','probably from καίω; a furnace:--furnace.'),
	('G2576','καμμύω','kammýō','kam-moo\'-o','from a compound of κατά and the base of μυστήριον; to shut down, i.e. close the eyes:--close.'),
	('G2577','κάμνω','kámnō','kam\'-no','apparently a primary verb; properly, to toil, i.e. (by implication) to tire (figuratively, faint, sicken):--faint, sick, be wearied.'),
	('G2578','κάμπτω','kámptō','kamp\'-to','apparently a primary verb; to bend:--bow.'),
	('G2579','κἄν','kán','kan','from καί and ἐάν; and (or even) if:--and (also) if (so much as), if but, at the least, though, yet.'),
	('G2580','Κανᾶ','Kanâ','kan-ah\'','of Hebrew origin (compare קָנָה); Cana, a place in Palestine:--Cana.'),
	('G2581','Κανανίτης','Kananítēs','kan-an-ee\'-tace','of Chaldee origin (compare קַנָּא); zealous; Cananites, an epithet:--Canaanite (by mistake for a derivative from Χαναάν).'),
	('G2582','Κανδάκη','Kandákē','kan-dak\'-ay','of foreign origin; Candacè, an Egyptian queen:--Candace.'),
	('G2583','κανών','kanṓn','kan-ohn\'','from  (a straight reed, i.e. rod); a rule (\"canon\"), i.e. (figuratively) a standard (of faith and practice); by implication, a boundary, i.e. (figuratively) a sphere (of activity):--line, rule.'),
	('G2584','Καπερναούμ','Kapernaoúm','cap-er-nah-oom\'','of Hebrew origin (probably כָּפָר and נַחוּם); Capernaum (i.e. Caphanachum), a place in Palestine:--Capernaum.'),
	('G2585','καπηλεύω','kapēleúō','kap-ale-yoo\'-o','from  (a huckster); to retail, i.e. (by implication) to adulterate (figuratively):--corrupt.'),
	('G2586','καπνός','kapnós','kap-nos\'','of uncertain affinity; smoke:--smoke.'),
	('G2587','Καππαδοκία','Kappadokía','kap-pad-ok-ee\'-ah','of foreign origin; Cappadocia, a region of Asia Minor:--Cappadocia.'),
	('G2588','καρδία','kardía','kar-dee\'-ah','prolonged from a primary  (Latin cor, \"heart\"); the heart, i.e. (figuratively) the thoughts or feelings (mind); also (by analogy) the middle:--(+ broken-)heart(-ed).'),
	('G2589','καρδιογνώστης','kardiognṓstēs','kar-dee-og-noce\'-tace','from καρδία and γινώσκω; a heart-knower:--which knowest the hearts.'),
	('G2590','καρπός','karpós','kar-pos\'','probably from the base of ἁρπάζω; fruit (as plucked), literally or figuratively:--fruit.'),
	('G2591','Κάρπος','Kárpos','kar\'-pos','perhaps for καρπός; Carpus, probably a Christian:--Carpus.'),
	('G2592','καρποφορέω','karpophoréō','kar-pof-or-eh\'-o','from καρποφόρος; to be fertile (literally or figuratively):--be (bear, bring forth) fruit(-ful).'),
	('G2593','καρποφόρος','karpophóros','kar-pof-or\'-os','from καρπός and φέρω; fruitbearing (figuratively):--fruitful.'),
	('G2594','καρτερέω','karteréō','kar-ter-eh\'-o','from a derivative of κράτος (transposed); to be strong, i.e. (figuratively) steadfast (patient):--endure.'),
	('G2595','κάρφος','kárphos','kar\'-fos','from  (to wither); a dry twig or straw:--mote.'),
	('G2596','κατά','katá','kat-ah\'','a primary particle; (prepositionally) down (in place or time), in varied relations (according to the case (genitive, dative or accusative) with which it is joined):--about, according as (to), after, against, (when they were) X alone, among, and, X apart, (even, like) as (concerning, pertaining to touching), X aside, at, before, beyond, by, to the charge of, (charita-)bly, concerning, + covered, (dai-)ly, down, every, (+ far more) exceeding, X more excellent, for, from … to, godly, in(-asmuch, divers, every, -to, respect of), … by, after the manner of, + by any means, beyond (out of) measure, X mightily, more, X natural, of (up-)on (X part), out (of every), over against, (+ your) X own, + particularly, so, through(-oughout, -oughout every), thus, (un-)to(-gether, -ward), X uttermost, where(-by), with. In composition it retains many of these applications, and frequently denotes opposition, distribution, or intensity.'),
	('G2597','καταβαίνω','katabaínō','kat-ab-ah\'-ee-no','from κατά and the base of βάσις; to descend (literally or figuratively):--come (get, go, step) down, fall (down).'),
	('G2598','καταβάλλω','katabállō','kat-ab-al\'-lo','from κατά and βάλλω; to throw down:--cast down, lay.'),
	('G2599','καταβαρέω','katabaréō','kat-ab-ar-eh\'-o','from κατά and βαρέω; to impose upon:--burden.'),
	('G2600','κατάβασις','katábasis','kat-ab\'-as-is','from καταβαίνω; a declivity:--descent.'),
	('G2601','καταβιβάζω','katabibázō','kat-ab-ib-ad\'-zo','from κατά and a derivative of the base of βάσις; to cause to go down, i.e. precipitate:--bring (thrust) down.'),
	('G2602','καταβολή','katabolḗ','kat-ab-ol-ay\'','from καταβάλλω; a deposition, i.e. founding; figuratively, conception:--conceive, foundation.'),
	('G2603','καταβραβεύω','katabrabeúō','kat-ab-rab-yoo\'-o','from κατά and βραβεύω (in its original sense); to award the price against, i.e. (figuratively) to defraud (of salvation):--beguile of reward.'),
	('G2604','καταγγελεύς','katangeleús','kat-ang-gel-yooce\'','from καταγγέλλω; a proclaimer:--setter forth.'),
	('G2605','καταγγέλλω','katangéllō','kat-ang-gel\'-lo','from κατά and the base of ἄγγελος; to proclaim, promulgate:--declare, preach, shew, speak of, teach.'),
	('G2606','καταγελάω','katageláō','kat-ag-el-ah\'-o',''),
	('G2607','καταγινώσκω','kataginṓskō','kat-ag-in-o\'-sko','from κατά and γινώσκω; to note against, i.e. find fault with:--blame, condemn.'),
	('G2608','κατάγνυμι','katágnymi','kat-ag\'-noo-mee','from κατά and the base of ῥήγνυμι; to rend in pieces, i.e. crack apart:--break.'),
