	('G2614','καταδιώκω','katadiṓkō','kat-ad-ee-o\'-ko','from κατά and διώκω; to hunt down, i.e. search for:--follow after.'),
	('G2615','καταδουλόω','katadoulóō','kat-ad-oo-lo\'-o','from κατά and δουλόω; to enslave utterly:--bring into bondage.'),
	('G2616','καταδυναστεύω','katadynasteúō','kat-ad-oo-nas-tyoo\'-o','from κατά and a derivative of δυνάστης; to exercise dominion against, i.e. oppress:--oppress.'),
	('G2617','καταισχύνω','kataischýnō','kat-ahee-skhoo\'-no','from κατά and αἰσχύνομαι; to shame down, i.e. disgrace or (by implication) put to the blush:--confound, dishonour, (be a-, make a-)shame(-d).'),
