	('G2634','κατακυριεύω','katakyrieúō','kat-ak-oo-ree-yoo\'-o','from κατά and κυριεύω; to lord against, i.e. control, subjugate:--exercise dominion over (lordship), be lord over, overcome.'),
	('G2635','καταλαλέω','katalaléō','kat-al-al-eh\'-o','from κατάλαλος; to be a traducer, i.e. to slander:--speak against (evil of).'),
