	('G2637','κατάλαλος','katálalos','kat-al\'-al-os','from κατά and the base of λαλέω; talkative against, i.e. a slanderer:--backbiter.'),
	('G2638','καταλαμβάνω','katalambánō','kat-al-am-ban\'-o','from κατά and λαμβάνω; to take eagerly, i.e. seize, possess, etc. (literally or figuratively):--apprehend, attain, come upon, comprehend, find, obtain, perceive, (over-)take.'),
	('G2639','καταλέγω','katalégō','kat-al-eg\'-o','from κατά and λέγω (in its original meaning); to lay down, i.e. (figuratively) to enrol:--take into the number.'),
	('G2640','κατάλειμμα','katáleimma','kat-al\'-ime-mah','from καταλείπω; a remainder, i.e. (by implication) a few:--remnant.'),
