	('G2642','καταλιθάζω','katalitházō','kat-al-ith-ad\'-zo','from κατά and λιθάζω; to stone down, i.e. to death:--stone.'),
	('G2643','καταλλαγή','katallagḗ','kat-al-lag-ay\'','from καταλλάσσω; exchange (figuratively, adjustment), i.e. restoration to (the divine) favor:--atonement, reconciliation(-ing).'),
