	('G2665','καταπέτασμα','katapétasma','kat-ap-et\'-as-mah','from a compound of κατά and a congener of πέτομαι; something spread thoroughly, i.e. (specially) the door screen (to the Most Holy Place) in the Jewish Temple:--vail.'),
	('G2666','καταπίνω','katapínō','kat-ap-ee\'-no','from κατά and πίνω; to drink down, i.e. gulp entire (literally or figuratively):--devour, drown, swallow (up).'),
