	('G2673','καταργέω','katargéō','kat-arg-eh\'-o','from κατά and ἀργέω; to be (render) entirely idle (useless), literally or figuratively:--abolish, cease, cumber, deliver, destroy, do away, become (make) of no (none, without) effect, fail, loose, bring (come) to nought, put away (down), vanish away, make void.'),
	('G2674','καταριθμέω','katarithméō','kat-ar-ith-meh\'-o','from κατά and ἀριθμέω; to reckon among:--number with.'),
