	('G3108','μακαρισμός','makarismós','mak-ar-is-mos\'','from μακαρίζω; beatification, i.e. attribution of good fortune:--blessedness.'),
	('G3109','Μακεδονία','Makedonía','mak-ed-on-ee\'-ah','from Μακεδών; Macedonia, a region of Greece:--Macedonia.'),
	('G3110','Μακεδών','Makedṓn','mak-ed\'-ohn','of uncertain derivation; a Macedon (Macedonian), i.e. inhabitant of Macedonia:--of Macedonia, Macedonian.'),
	('G3111','μάκελλον','mákellon','mak\'-el-lon','of Latin origin (macellum); a butcher\'s stall, meat market or provision-shop:--shambles.'),
	('G3112','μακράν','makrán','mak-ran\'','feminine accusative case singular of μακρός (ὁδός being implied); at a distance (literally or figuratively):--(a-)far (off), good (great) way off.'),
	('G3113','μακρόθεν','makróthen','mak-roth\'-en','adverb from μακρός; from a distance or afar:--afar off, from far.'),
	('G3114','μακροθυμέω','makrothyméō','mak-roth-oo-meh\'-o','from the same as μακροθυμώς; to be long-spirited, i.e. (objectively) forbearing or (subjectively) patient:--bear (suffer) long, be longsuffering, have (long) patience, be patient, patiently endure.'),
	('G3115','μακροθυμία','makrothymía','mak-roth-oo-mee\'-ah','from the same as μακροθυμώς; longanimity, i.e. (objectively) forbearance or (subjectively) fortitude:--longsuffering, patience.'),
	('G3116','μακροθυμώς','makrothymṓs','mak-roth-oo-moce\'','adverb of a compound of μακρός and θυμός; with long (enduring) temper, i.e. leniently:--patiently.'),
