	('G3118','μακροχρόνιος','makrochrónios','mak-rokh-ron\'-ee-os','from μακρός and χρόνος; long-timed, i.e. long-lived:--live long.'),
	('G3119','μαλακία','malakía','mal-ak-ee\'-ah','from μαλακός; softness, i.e. enervation (debility):--disease.'),
	('G3120','μαλακός','malakós','mal-ak-os\'','of uncertain affinity; soft, i.e. fine (clothing); figuratively, a catamite:--effeminate, soft.'),
	('G3121','Μαλελεήλ','Maleleḗl','mal-el-eh-ale\'','of Hebrew origin (מַהֲלַלְאֵל); Maleleel (i.e. Mahalalel), an antediluvian:--Maleleel.'),
	('G3122','μάλιστα','málista','mal\'-is-tah','neuter plural of the superlative of an apparently primary adverb  (very); (adverbially) most (in the greatest degree) or particularly:--chiefly, most of all, (e-)specially.'),
