	('G3126','μαμμωνᾶς','mammōnâs','mam-mo-nas\'','of Chaldee origin (confidence, i.e. wealth, personified); mammonas, i.e. avarice (deified):--mammon.'),
	('G3127','Μαναήν','Manaḗn','man-ah-ane\'','of uncertain origin; Manaën, a Christian:--Manaen.'),
	('G3128','Μανασσῆς','Manassēs','man-as-sace\'','of Hebrew origin (מְנַשֶּׁה); Mannasses (i.e. Menashsheh), an Israelite:--Manasses.'),
