	('G3159','Ματθίας','Matthías','mat-thee\'-as','apparently a shortened form of Ματταθίας; Matthias (i.e. Mattithjah), an Israelite:--Matthias.'),
	('G3160','Ματταθά','Mattathá','mat-tath-ah\'','probably a shortened form of Ματταθίας (compare מַתַּתָּה); Mattatha (i.e. Mattithjah), an Israelite:--Mattatha.'),
	('G3161','Ματταθίας','Mattathías','mat-tath-ee\'-as','of Hebrew origin (מַתִּתְיָה); Mattathias (i.e. Mattithjah), an Israelite and a Christian:--Mattathias.'),
