	('G3193','μελίσσιος','melíssios','mel-is\'-see-os','from μέλι; relating to honey, i.e. bee (comb):--honeycomb.'),
	('G3194','Μελίτη','Melítē','mel-ee\'-tay','of uncertain origin; Melita, an island in the Mediterranean:--Melita.'),
