	('G3303','μέν','mén','men','a primary particle; properly, indicative of affirmation or concession (in fact); usually followed by a contrasted clause with δέ (this one, the former, etc.):--even, indeed, so, some, truly, verily. Often compounded with other particles in an intensive or asseverative sense.'),
