	('G3312','μεριστής','meristḗs','mer-is-tace\'','from μερίζω; an apportioner (administrator):--divider.'),
	('G3313','μέρος','méros','mer\'-os','from an obsolete but more primary form of  (to get as a section or allotment); a division or share (literally or figuratively, in a wide application):--behalf, course, coast, craft, particular (+ -ly), part (+ -ly), piece, portion, respect, side, some sort(-what).'),
	('G3314','μεσημβρία','mesēmbría','mes-ame-bree\'-ah','from μέσος and ἡμέρα; midday; by implication, the south:--noon, south.'),
