	('G3317','μεσονύκτιον','mesonýktion','mes-on-ook\'-tee-on','neuter of compound of μέσος and νύξ; midnight (especially as a watch):--midnight.'),
	('G3318','Μεσοποταμία','Mesopotamía','mes-op-ot-am-ee\'-ah','from μέσος and ποταμός; Mesopotamia (as lying between the Euphrates and the Tigris; compare אֲרַם נַהֲרַיִם), a region of Asia:--Mesopotamia.'),
	('G3319','μέσος','mésos','mes\'-os','from μετά; middle (as an adjective or (neuter) noun):--among, X before them, between, + forth, mid(-day, -night), midst, way.'),
