	('G3325','μεστόω','mestóō','mes-to\'-o','from μεστός; to replenish, i.e. (by implication) to intoxicate:--fill.'),
	('G3326','μετά','metá','met-ah\'','a primary preposition (often used adverbially); properly, denoting accompaniment; \"amid\" (local or causal); modified variously according to the case (genitive association, or accusative succession) with which it is joined; occupying an intermediate position between ἀπό or ἐκ and εἰς or πρός; less intimate than ἐν and less close than σύν):--after(-ward), X that he again, against, among, X and, + follow, hence, hereafter, in, of, (up-)on, + our, X and setting, since, (un-)to, + together, when, with (+ -out). Often used in composition, in substantially the same relations of participation or proximity, and transfer or sequence.'),
	('G3327','μεταβαίνω','metabaínō','met-ab-ah\'-ee-no','from μετά and the base of βάσις; to change place:--depart, go, pass, remove.'),
	('G3328','μεταβάλλω','metabállō','met-ab-al\'-lo','from μετά and βάλλω; to throw over, i.e. (middle voice figuratively) to turn about in opinion:--change mind.'),
	('G3329','μετάγω','metágō','met-ag\'-o','from μετά and ἁρμόζω; to lead over, i.e. transfer (direct):--turn about.'),
	('G3330','μεταδίδωμι','metadídōmi','met-ad-id\'-o-mee','from μετά and δίδωμι; to give over, i.e. share:--give, impart.'),
	('G3331','μετάθεσις','metáthesis','met-ath\'-es-is','from μετατίθημι; transposition, i.e. transferral (to heaven), disestablishment (of a law):--change, removing, translation.'),
