	('G3344','μεταστρέφω','metastréphō','met-as-tref\'-o','from μετά and στρέφω; to turn across, i.e. transmute or (figuratively) corrupt:--pervert, turn.'),
	('G3345','μετασχηματίζω','metaschēmatízō','met-askh-ay-mat-id\'-zo','from μετά and a derivative of σχῆμα; to transfigure or disguise; figuratively, to apply (by accommodation):--transfer, transform (self).'),
	('G3346','μετατίθημι','metatíthēmi','met-at-ith\'-ay-mee','from μετά and τίθημι; to transfer, i.e. (literally) transport, (by implication) exchange, (reflexively) change sides, or (figuratively) pervert:--carry over, change, remove, translate, turn.'),
	('G3347','μετέπειτα','metépeita','met-ep\'-i-tah','from μετά and ἔπειτα; thereafter:--afterward.'),
	('G3348','μετέχω','metéchō','met-ekh\'-o','from μετά and ἔχω; to share or participate; by implication, belong to, eat (or drink):--be partaker, pertain, take part, use.'),
	('G3349','μετεωρίζω','meteōrízō','met-eh-o-rid\'-zo','from a compound of μετά and a collateral form of αἴρω or perhaps rather ἀήρ (compare \"meteor\"); to raise in mid-air, i.e. (figuratively) suspend (passively, fluctuate or be anxious):--be of doubtful mind.'),
	('G3350','μετοικεσία','metoikesía','met-oy-kes-ee\'-ah','from a derivative of a compound of μετά and οἶκος; a change of abode, i.e. (specially), expatriation:--X brought, carried(-ying) away (in-)to.'),
