	('G3361','μή','mḗ','may','a primary particle of qualified negation (whereas οὐ expresses an absolute denial); (adverb) not, (conjunction) lest; also (as an interrogative implying a negative answer (whereas οὐ expects an affirmative one)) whether:--any but (that), X forbear, + God forbid, + lack, lest, neither, never, no (X wise in), none, nor, (can-)not, nothing, that not, un(-taken), without. Often used in compounds in substantially the same relations. See also ἐὰν μή, ἵνα μή, οὐ μή, μῆκος, μηκύνω, μήν, μὴ οὐκ.'),
	('G3362','ἐὰν μή','eàn mḗ','eh-an\' may','i.e. ἐάν and μή; if not, i.e. unless:--X before, but, except, if, no, (if, + whosoever) not.'),
