	('G3705','ὅραμα','hórama','hor\'-am-ah','from ὁράω; something gazed at, i.e. a spectacle (especially supernatural):--sight, vision.'),
	('G3706','ὅρασις','hórasis','hor\'-as-is','from ὁράω; the act of gazing, i.e. (externally) an aspect or (internally) an inspired appearance:--sight, vision.'),
	('G3707','ὁρατός','horatós','hor-at-os\'','from ὁράω; gazed at, i.e. (by implication) capable of being seen:--visible.'),
	('G3708','ὁράω','horáō','hor-ah\'-o','properly, to stare at (compare ὀπτάνομαι), i.e. (by implication) to discern clearly (physically or mentally); by extension, to attend to; by Hebraism, to experience; passively, to appear:--behold, perceive, see, take heed.'),
	('G3709','ὀργή','orgḗ','or-gay\'','from ὀρέγομαι; properly, desire (as a reaching forth or excitement of the mind), i.e. (by analogy), violent passion (ire, or (justifiable) abhorrence); by implication punishment:--anger, indignation, vengeance, wrath.'),
	('G3710','ὀργίζω','orgízō','or-gid\'-zo','from ὀργή; to provoke or enrage, i.e. (passively) become exasperated:--be angry (wroth).'),
	('G3711','ὀργίλος','orgílos','org-ee\'-los','from ὀργή; irascible:--soon angry.'),
	('G3712','ὀργυιά','orguiá','org-wee-ah\'','from ὀρέγομαι; a stretch of the arms, i.e. a fathom:--fathom.'),
	('G3713','ὀρέγομαι','orégomai','or-eg\'-om-ahee','middle voice of apparently a prolonged form of an obsolete primary (compare ὄρος); to stretch oneself, i.e. reach out after (long for):--covet after, desire.'),
	('G3714','ὀρεινός','oreinós','or-i-nos','from ὄρος; mountainous, i.e. (feminine by implication, of χώρα) the Highlands (of Judæa):--hill country.'),
	('G3715','ὄρεξις','órexis','or\'-ex-is','from ὀρέγομαι; excitement of the mind, i.e. longing after:--lust.'),
	('G3716','ὀρθοποδέω','orthopodéō','or-thop-od-eh\'-o','from a compound of ὀρθός and πούς; to be straight-footed, i.e. (figuratively) to go directly forward:--walk uprightly.'),
	('G3717','ὀρθός','orthós','or-thos\'','probably from the base of ὄρος; right (as rising), i.e. (perpendicularly) erect (figuratively, honest), or (horizontally) level or direct:--straight, upright.'),
	('G3718','ὀρθοτομέω','orthotoméō','or-thot-om-eh\'-o','from a compound of ὀρθός and the base of τομώτερος, to make a straight cut, i.e. (figuratively) to dissect (expound) correctly (the divine message):--rightly divide.'),
	('G3719','ὀρθρίζω','orthrízō','or-thrid\'-zo','from ὄρθρος; to use the dawn, i.e. (by implication) to repair betimes:--come early in the morning.'),
	('G3720','ὀρθρινός','orthrinós','or-thrin-os\'','from ὄρθρος; relating to the dawn, i.e. matutinal (as an epithet of Venus, especially brilliant in the early day):--morning.'),
	('G3721','ὄρθριος','órthrios','or\'-three-os','from ὄρθρος; in the dawn, i.e. up at day-break:--early.'),
	('G3722','ὄρθρος','órthros','or\'-thros','from the same as ὄρος; dawn (as sun-rise, rising of light); by extension, morn:--early in the morning.'),
	('G3723','ὀρθῶς','orthōs','or-thoce\'','adverb from ὀρθός; in a straight manner, i.e. (figuratively) correctly (also morally):--plain, right(-ly).'),
	('G3724','ὁρίζω','horízō','hor-id\'-zo','from ὅριον; to mark out or bound (\"horizon\"), i.e. (figuratively) to appoint, decree, specify:--declare, determine, limit, ordain.'),
	('G3725','ὅριον','hórion','hor\'-ee-on','neuter of a derivative of an apparently primary  (a bound or limit); a boundary-line, i.e. (by implication) a frontier (region):--border, coast.'),
	('G3726','ὁρκίζω','horkízō','hor-kid\'-zo','from ὅρκος; to put on oath, i.e. make swear; by analogy, to solemnly enjoin:--adjure, charge.'),
	('G3727','ὅρκος','hórkos','hor\'-kos','from  (a fence; perhaps akin to ὅριον); a limit, i.e. (sacred) restraint (specially, an oath):--oath.'),
	('G3728','ὁρκωμοσία','horkōmosía','hor-ko-mos-ee\'ah','from a compound of ὅρκος and a derivative of ὀμνύω; asseveration on oath:--oath.'),
	('G3729','ὁρμάω','hormáō','hor-mah\'-o','from ὁρμή; to start, spur or urge on, i.e. (reflexively) to dash or plunge:--run (violently), rush.'),
	('G3730','ὁρμή','hormḗ','hor-may\'','of uncertain affinity; a violent impulse, i.e. onset:--assault.'),
	('G3731','ὅρμημα','hórmēma','hor\'-may-mah','from ὁρμή; an attack, i.e. (abstractly) precipitancy:--violence.'),
	('G3732','ὄρνεον','órneon','or\'-neh-on','neuter of a presumed derivative of ὄρνις; a birdling:--bird, fowl.'),
	('G3733','ὄρνις','órnis','or\'-nis','probably from a prolonged form of the base of ὄρος; a bird (as rising in the air), i.e. (specially), a hen (or female domestic fowl):--hen.'),
	('G3734','ὁροθεσία','horothesía','hor-oth-es-ee\'-ah','from a compound of the base of ὅριον and a derivative of τίθημι; a limit-placing, i.e. (concretely) boundary-line:--bound.'),
	('G3735','ὄρος','óros','or\'-os','probably from an obsolete  (to rise or \"rear\"; perhaps akin to αἴρω; compare ὄρνις); a mountain (as lifting itself above the plain):--hill, mount(-ain).'),
	('G3736','ὀρύσσω','orýssō','or-oos\'-so','apparently a primary verb; to \"burrow\" in the ground, i.e. dig:--dig.'),
	('G3737','ὀρφανός','orphanós','or-fan-os\'','of uncertain affinity; bereaved (\"orphan\"), i.e. parentless:--comfortless, fatherless.'),
	('G3738','ὀρχέομαι','orchéomai','or-kheh\'-om-ahee','middle voice from  (a row or ring); to dance (from the ranklike or regular motion):--dance.'),
	('G3739','ὅς','hós','ho','probably a primary word (or perhaps a form of the article ὁ); the relatively (sometimes demonstrative) pronoun, who, which, what, that:--one, (an-, the) other, some, that, what, which, who(-m, -se), etc. See also οὗ.'),
	('G3740','ὁσάκις','hosákis','hos-ak\'-is','multiple adverb from ὅς; how (i.e. with ἄν, so) many times as:--as oft(-en) as.'),
	('G3741','ὅσιος','hósios','hos\'-ee-os','of uncertain affinity; properly, right (by intrinsic or divine character; thus distinguished from 1342, which refers rather to human statutes and relations; from ἱερός, which denotes formal consecration; and from ἅγιος, which relates to purity from defilement), i.e. hallowed (pious, sacred, sure):--holy, mercy, shalt be. 342'),
	('G3742','ὁσιότης','hosiótēs','hos-ee-ot\'-ace','from ὅσιος; piety:--holiness.'),
	('G3743','ὁσίως','hosíōs','hos-ee-oce\'','adverb from ὅσιος; piously:--holily.'),
	('G3744','ὀσμή','osmḗ','os-may\'','from ὄζω; fragrance (literally or figuratively):--odour, savour.'),
	('G3745','ὅσος','hósos','hos\'-os','by reduplication from ὅς; as (much, great, long, etc.) as:--all (that), as (long, many, much) (as), how great (many, much), (in-)asmuch as, so many as, that (ever), the more, those things, what (great, -soever), wheresoever, wherewithsoever, which, X while, who(-soever).'),
	('G3746','ὅσπερ','hósper','hos\'-per','from ὅς and περ; who especially:--whomsoever.'),
	('G3747','ὀστέον','ostéon','os-toon\'','of uncertain affinity; a bone:--bone.'),
	('G3748','ὅστις','hóstis','hot\'-ee','from ὅς and τὶς; which some, i.e. any that; also (definite) which same:--X and (they), (such) as, (they) that, in that they, what(-soever), whereas ye, (they) which, who(-soever). Compare ὅτι.'),
	('G3749','ὀστράκινος','ostrákinos','os-tra\'-kin-os','from  (\"oyster\") (a tile, i.e. terra cotta); earthen-ware, i.e. clayey; by implication, frail:--of earth, earthen.'),
	('G3750','ὄσφρησις','ósphrēsis','os\'-fray-sis','from a derivative of ὄζω; smell (the sense):--smelling.'),
	('G3751','ὀσφῦς','osphŷs','os-foos\'','of uncertain affinity; the loin (externally), i.e. the hip; internally (by extension) procreative power:--loin.'),
	('G3752','ὅταν','hótan','hot\'-an','from ὅτε and ἄν; whenever (implying hypothesis or more or less uncertainty); also causatively (conjunctionally) inasmuch as:--as long (soon) as, that, + till, when(-soever), while.'),
	('G3753','ὅτε','hóte','hot\'-eh','from ὅς and τέ; at which (thing) too, i.e. when:--after (that), as soon as, that, when, while.'),
	('G3754','ὅτι','hóti','hot\'-ee','neuter of ὅστις as conjunction; demonstrative, that (sometimes redundant); causative, because:--as concerning that, as though, because (that), for (that), how (that), (in) that, though, why.'),
	('G3755','ὅτου','hótou','hot\'-oo','for the genitive case of ὅστις (as adverb); during which same time, i.e. whilst:--whiles.'),
	('G3756','οὐ','ou','ookh','a primary word; the absolute negative (compare μή) adverb; no or not:--+ long, nay, neither, never, no (X man), none, (can-)not, + nothing, + special, un(-worthy), when, + without, + yet but. See also οὐ μή, μῆκος.'),
	('G3757','οὗ','hoû','hoo','genitive case of ὅς as adverb; at which place, i.e. where:--where(-in), whither(-soever).'),
	('G3758','οὐά','ouá','oo-ah\'','a primary exclamation of surprise; \"ah\":--ah.'),
	('G3759','οὐαί','ouaí','oo-ah\'-ee','a primary exclamation of grief; \"woe\":--alas, woe.'),
	('G3760','οὐδαμῶς','oudamōs','oo-dam-oce\'','adverb from (the feminine) of οὐδείς; by no means:--not.'),
	('G3761','οὐδέ','oudé','oo-deh\'','from οὐ and δέ; not however, i.e. neither, nor, not even:--neither (indeed), never, no (more, nor, not), nor (yet), (also, even, then) not (even, so much as), + nothing, so much as.'),
	('G3762','οὐδείς','oudeís','oo-den\'','from οὐδέ and εἷς; not even one (man, woman or thing), i.e. none, nobody, nothing:--any (man), aught, man, neither any (thing), never (man), no (man), none (+ of these things), not (any, at all, -thing), nought.'),
	('G3763','οὐδέποτε','oudépote','oo-dep\'-ot-eh','from οὐδέ and ποτέ; not even at any time, i.e. never at all:--neither at any time, never, nothing at any time.'),
	('G3764','οὐδέπω','oudépō','oo-dep\'-o','from οὐδέ and -πω; not even yet:--as yet not, never before (yet), (not) yet.'),
	('G3765','οὐκέτι','oukéti','ook et\'-ee','from οὐ and ἔτι; not yet, no longer:--after that (not), (not) any more, henceforth (hereafter) not, no longer (more), not as yet (now), now no more (not), yet (not).'),
	('G3766','οὐκοῦν','oukoûn','ook-oon\'','from οὐ and οὖν; is it not therefore that, i.e. (affirmatively) hence or so:--then.'),
	('G3767','οὖν','oûn','oon','apparently a primary word; (adverbially) certainly, or (conjunctionally) accordingly:--and (so, truly), but, now (then), so (likewise then), then, therefore, verily, wherefore.'),
	('G3768','οὔπω','oúpō','oo\'-po','from οὐ and -πω; not yet:--hitherto not, (no…) as yet, not yet.'),
	('G3769','οὐρά','ourá','oo-rah\'','apparently a primary word; a tail:--tail.'),
	('G3770','οὐράνιος','ouránios','oo-ran\'-ee-os','from οὐρανός; celestial, i.e. belonging to or coming from the sky:--heavenly.'),
	('G3771','οὐρανόθεν','ouranóthen','oo-ran-oth\'-en','from οὐρανός and the enclitic of source; from the sky:--from heaven.'),
	('G3772','οὐρανός','ouranós','oo-ran-os\'','perhaps from the same as ὄρος (through the idea of elevation); the sky; by extension, heaven (as the abode of God); by implication, happiness, power, eternity; specially, the Gospel (Christianity):--air, heaven(-ly), sky.'),
	('G3773','Οὐρβανός','Ourbanós','oor-ban-os\'','of Latin origin; Urbanus (of the city, \"urbane\"), a Christian:--Urbanus.'),
	('G3774','Οὐρίας','Ourías','oo-ree\'-as','of Hebrew origin (אוּרִיָּה); Urias (i.e. Urijah), a Hittite:--Urias.'),
	('G3775','οὖς','oûs','ooce','apparently a primary word; the ear (physically or mentally):--ear.'),
	('G3776','οὐσία','ousía','oo-see\'-ah','from the feminine of ὤν; substance, i.e. property (possessions):--goods, substance.'),
	('G3777','οὔτε','oúte','oo\'-teh','from οὐ and τέ; not too, i.e. neither or nor; by analogy, not even:--neither, none, nor (yet), (no, yet) not, nothing.'),
	('G3778','οὗτος','hoûtos','how\'-tahee','from the article ὁ and αὐτός; the he (she or it), i.e. this or that (often with article repeated):--he (it was that), hereof, it, she, such as, the same, these, they, this (man, same, woman), which, who.'),
	('G3779','οὕτω','hoútō','hoo\'-toce','adverb from οὗτος; in this way (referring to what precedes or follows):--after that, after (in) this manner, as, even (so), for all that, like(-wise), no more, on this fashion(-wise), so (in like manner), thus, what.'),
	('G3780','οὐχί','ouchí','oo-khee\'','intensive of οὐ; not indeed:--nay, not.'),
	('G3781','ὀφειλέτης','opheilétēs','of-i-let\'-ace','from ὀφείλω; an ower, i.e. person indebted; figuratively, a delinquent; morally, a transgressor (against God):--debtor, which owed, sinner.'),
	('G3782','ὀφειλή','opheilḗ','of-i-lay\'','from ὀφείλω; indebtedness, i.e. (concretely) a sum owed; figuratively, obligation, i.e. (conjugal) duty:--debt, due.'),
	('G3783','ὀφείλημα','opheílēma','of-i\'-lay-mah','from (the alternate of) ὀφείλω; something owed, i.e. (figuratively) a due; morally, a fault:--debt.'),
	('G3784','ὀφείλω','opheílō','of-i-leh\'-o','probably from the base of ὄφελος (through the idea of accruing); to owe (pecuniarily); figuratively, to be under obligation (ought, must, should); morally, to fail in duty:--behove, be bound, (be) debt(-or), (be) due(-ty), be guilty (indebted), (must) need(-s), ought, owe, should. See also ὄφελον.'),
	('G3785','ὄφελον','óphelon','of\'-el-on','first person singular of a past tense of ὀφείλω; I ought (wish), i.e. (interjection) oh that!:--would (to God).'),
	('G3786','ὄφελος','óphelos','of\'-el-os','from  (to heap up, i.e. accumulate or benefit); gain:--advantageth, profit.'),
	('G3787','ὀφθαλμοδουλεία','ophthalmodouleía','of-thal-mod-oo-li\'-ah','from ὀφθαλμός and δουλεία; sight-labor, i.e. that needs watching (remissness):--eye-service.'),
	('G3788','ὀφθαλμός','ophthalmós','of-thal-mos\'','from ὀπτάνομαι; the eye (literally or figuratively); by implication, vision; figuratively, envy (from the jealous side-glance):--eye, sight.'),
	('G3789','ὄφις','óphis','of\'-is','probably from ὀπτάνομαι (through the idea of sharpness of vision); a snake, figuratively, (as a type of sly cunning) an artful malicious person, especially Satan:--serpent.'),
	('G3790','ὀφρῦς','ophrŷs','of-roos\'','perhaps from ὀπτάνομαι (through the idea of the shading or proximity to the organ of vision); the eye-\"brow\" or forehead, i.e. (figuratively) the brink of a precipice:--brow.'),
	('G3791','ὀχλέω','ochléō','okh-leh\'-o','from ὄχλος; to mob, i.e. (by implication) to harass:--vex.'),
	('G3792','ὀχλοποιέω','ochlopoiéō','okh-lop-oy-eh\'-o','from ὄχλος and ποιέω; to make a crowd, i.e. raise a public disturbance:--gather a company.'),
	('G3793','ὄχλος','óchlos','okh\'los','from a derivative of ἔχω (meaning a vehicle); a throng (as borne along); by implication, the rabble; by extension, a class of people; figuratively, a riot:--company, multitude, number (of people), people, press.'),
	('G3794','ὀχύρωμα','ochýrōma','okh-oo\'-ro-mah','from a remote derivative of ἔχω (meaning to fortify, through the idea of holding safely); a castle (figuratively, argument):--stronghold.'),
	('G3795','ὀψάριον','opsárion','op-sar\'-ee-on','neuter of a presumed derivative of the base of ὀπτός; a relish to other food (as if cooked sauce), i.e. (specially), fish (presumably salted and dried as a condiment):--fish.'),
	('G3796','ὀψέ','opsé','op-seh\'','from the same as ὀπίσω (through the idea of backwardness); (adverbially) late in the day; by extension, after the close of the day:--(at) even, in the end.'),
	('G3797','ὄψιμος','ópsimos','op\'-sim-os','from ὀψέ; later, i.e. vernal (showering):--latter.'),
	('G3798','ὄψιος','ópsios','op\'-see-os','from ὀψέ; late; feminine (as noun) afternoon (early eve) or nightfall (later eve):--even(-ing, (-tide)).'),
	('G3799','ὄψις','ópsis','op\'-sis','from ὀπτάνομαι; properly, sight (the act), i.e. (by implication) the visage, an external show:--appearance, countenance, face.'),
	('G3800','ὀψώνιον','opsṓnion','op-so\'-nee-on','neuter of a presumed derivative of the same as ὀψάριον; rations for a soldier, i.e. (by extension) his stipend or pay:-- wages.'),
	('G3801','ὁ ὢν καί ὁ ἦν καί ὁ ἐρχόμενος','ho ṑn kaí ho ēn kaí ho erchómenos','ho own kahee ho ane kahee ho er-khom\'-en-os','a phrase combining ὁ with the present participle and imperfect of εἰμί and the present participle of ἔρχομαι by means of καί; the one being and the one that was and the one coming, i.e. the Eternal, as a divine epithet of Christ:--which art (is, was), and (which) wast (is, was), and art (is) to come (shalt be).'),
	('G3802','παγιδεύω','pagideúō','pag-id-yoo\'-o','from παγίς; to ensnare (figuratively):--entangle.'),
	('G3803','παγίς','pagís','pag-ece\'','from πήγνυμι; a trap (as fastened by a noose or notch); figuratively, a trick or statagem (temptation):--snare.'),
	('G3804','πάθημα','páthēma','path\'-ay-mah','from a presumed derivative of πάθος; something undergone, i.e. hardship or pain; subjectively, an emotion or influence:-- affection, affliction, motion, suffering.'),
	('G3805','παθητός','pathētós','path-ay-tos\'','from the same as πάθημα; liable (i.e. doomed) to experience pain:--suffer.'),
	('G3806','πάθος','páthos','path\'-os','from the alternate of πάσχω; properly, suffering (\"pathos\"), i.e. (subjectively) a passion (especially concupiscence):-- (inordinate) affection, lust.'),
	('G3807','παιδαγωγός','paidagōgós','pahee-dag-o-gos\'','from παῖς and a reduplicated form of ἄγω; a boy-leader, i.e. a servant whose office it was to take the children to school; (by implication, (figuratively) a tutor (\"pædagogue\")):-- instructor, schoolmaster.'),
	('G3808','παιδάριον','paidárion','pahee-dar\'-ee-on','neuter of a presumed derivative of παῖς; a little boy:--child, lad.'),
	('G3809','παιδεία','paideía','pahee-di\'-ah','from παιδεύω; tutorage, i.e. education or training; by implication, disciplinary correction:--chastening, chastisement, instruction, nurture.'),
	('G3810','παιδευτής','paideutḗs','pahee-dyoo-tace\'','from παιδεύω; a trainer, i.e. teacher or (by implication) discipliner:--which corrected, instructor.'),
	('G3811','παιδεύω','paideúō','pahee-dyoo\'-o','from παῖς; to train up a child, i.e. educate, or (by implication), discipline (by punishment):--chasten(-ise), instruct, learn, teach.'),
	('G3812','παιδιόθεν','paidióthen','pahee-dee-oth\'-en','adverb (of source) from παιδίον; from infancy:--of a child.'),
	('G3813','παιδίον','paidíon','pahee-dee\'-on','neuter diminutive of παῖς; a childling (of either sex), i.e. (properly), an infant, or (by extension) a half-grown boy or girl; figuratively, an immature Christian:--(little, young) child, damsel.'),
	('G3814','παιδίσκη','paidískē','pahee-dis\'-kay','feminine diminutive of παῖς; a girl, i.e. (specially), a female slave or servant:--bondmaid(-woman), damsel, maid(-en).'),
	('G3815','παίζω','paízō','paheed\'-zo','from παῖς; to sport (as a boy):--play.'),
	('G3816','παῖς','paîs','paheece','perhaps from παίω; a boy (as often beaten with impunity), or (by analogy), a girl, and (genitive case) a child; specially, a slave or servant (especially a minister to a king; and by eminence to God):--child, maid(-en), (man) servant, son, young man.'),
	('G3817','παίω','paíō','pah\'-yo','a primary verb; to hit (as if by a single blow and less violently than τύπτω); specially, to sting (as a scorpion):--smite, strike.'),
	('G3818','Πακατιανή','Pakatianḗ','pak-at-ee-an-ay\'','feminine of an adjective of uncertain derivation; Pacatianian, a section of Phrygia:--Pacatiana.'),
	('G3819','πάλαι','pálai','pal\'-ahee','probably another form for πάλιν (through the idea of retrocession); (adverbially) formerly, or (by relatively) sometime since; (elliptically as adjective) ancient:--any while, a great while ago, (of) old, in time past.'),
	('G3820','παλαιός','palaiós','pal-ah-yos\'','from πάλαι; antique, i.e. not recent, worn out:--old.'),
	('G3821','παλαιότης','palaiótēs','pal-ah-yot\'-ace','from παλαιός; antiquatedness:--oldness.'),
	('G3822','παλαιόω','palaióō','pal-ah-yo\'-o','from παλαιός; to make (passively, become) worn out, or declare obsolete:--decay, make (wax) old.'),
	('G3823','πάλη','pálē','pal\'-ay','from  (to vibrate; another form for βάλλω); wrestling:--+ wrestle.'),
	('G3824','παλιγγενεσία','palingenesía','pal-ing-ghen-es-ee\'-ah','from πάλιν and γένεσις; (spiritual) rebirth (the state or the act), i.e. (figuratively) spiritual renovation; specially, Messianic restoration:--regeneration.'),
	('G3825','πάλιν','pálin','pal\'-in','probably from the same as πάλη (through the idea of oscillatory repetition); (adverbially) anew, i.e. (of place) back, (of time) once more, or (conjunctionally) furthermore or on the other hand:--again.'),
	('G3826','παμπληθεί','pamplētheí','pam-play-thi\'','dative case (adverb) of a compound of πᾶς and πλῆθος; in full multitude, i.e. concertedly or simultaneously:--all at once.'),
	('G3827','πάμπολυς','pámpolys','pam-pol-ooce','from πᾶς and πολύς; full many, i.e. immense:--very great.'),
	('G3828','Παμφυλία','Pamphylía','pam-fool-ee\'-ah','from a compound of πᾶς and πυρά; every-tribal, i.e. heterogeneous (χώρα being implied); Pamphylia, a region of Asia Minor:--Pamphylia.'),
	('G3829','πανδοχεῖον','pandocheîon','pan-dokk-i\'-on','neuter of a presumed compound of πᾶς and a derivative of δέχομαι; all-receptive, i.e. a public lodging-place (caravanserai or khan):--inn.'),
	('G3830','πανδοχεύς','pandocheús','pan-dokh-yoos\'','from the same as πανδοχεῖον; an innkeeper (warden of a caravanserai):--host.'),
	('G3831','πανήγυρις','panḗgyris','pan-ay\'-goo-ris','from πᾶς and a derivative of ἀγορά; a mass-meeting, i.e. (figuratively) universal companionship:--general assembly.'),
	('G3832','πανοικί','panoikí','pan-oy-kee\'','adverb from πᾶς and οἶκος; with the whole family:--with all his house.'),
	('G3833','πανοπλία','panoplía','pan-op-lee\'-ah','from a compound of πᾶς and ὅπλον; full armor (\"panoply\"):--all (whole) armour.'),
	('G3834','πανουργία','panourgía','pan-oorg-ee\'-ah','from πανοῦργος; adroitness, i.e. (in a bad sense) trickery or sophistry:--(cunning) craftiness, subtilty.'),
	('G3835','πανοῦργος','panoûrgos','pan-oor\'-gos','from πᾶς and ἔργον; all-working, i.e. adroit (shrewd):--crafty.'),
	('G3836','πανταχόθεν','pantachóthen','pan-takh-oth\'-en','adverb (of source) from πανταχοῦ; from all directions:--from every quarter.'),
	('G3837','πανταχοῦ','pantachoû','pan-takh-oo\'','genitive case (as adverb of place) of a presumed derivative of πᾶς; universally:--in all places, everywhere.'),
	('G3838','παντελής','pantelḗs','pan-tel-ace\'','from πᾶς and τέλος; full-ended, i.e. entire (neuter as noun, completion):--+ in (no) wise, uttermost.'),
	('G3839','πάντη','pántē','pan\'-tay','adverb (of manner) from πᾶς; wholly:--always.'),
	('G3840','πάντοθεν','pántothen','pan-toth\'-en','adverb (of source) from πᾶς; from (i.e. on) all sides:--on every side, round about.'),
	('G3841','παντοκράτωρ','pantokrátōr','pan-tok-rat\'-ore','from πᾶς and κράτος; the all-ruling, i.e. God (as absolute and universal sovereign):--Almighty, Omnipotent.'),
	('G3842','πάντοτε','pántote','pan\'-tot-eh','from πᾶς and ὅτε; every when, i.e. at all times:--alway(-s), ever(-more).'),
	('G3843','πάντως','pántōs','pan\'-toce','adverb from πᾶς; entirely; specially, at all events, (with negative, following) in no event:--by all means, altogether, at all, needs, no doubt, in (no) wise, surely.'),
	('G3844','παρά','pará','par-ah\'','a primary preposition; properly, near; i.e. (with genitive case) from beside (literally or figuratively), (with dative case) at (or in) the vicinity of (objectively or subjectively), (with accusative case) to the proximity with (local (especially beyond or opposed to) or causal (on account of):--above, against, among, at, before, by, contrary to, X friend, from, + give (such things as they), + that (she) had, X his, in, more than, nigh unto, (out) of, past, save, side…by, in the sight of, than, (there-)fore, with. In compounds it retains the same variety of application.'),
	('G3845','παραβαίνω','parabaínō','par-ab-ah\'-ee-no','from παρά and the base of βάσις; to go contrary to, i.e. violate a command:--(by) transgress(-ion).'),
	('G3846','παραβάλλω','parabállō','par-ab-al\'-lo','from παρά and βάλλω; to throw alongside, i.e. (reflexively) to reach a place, or (figuratively) to liken:--arrive, compare.'),
	('G3847','παράβασις','parábasis','par-ab\'-as-is','from παραβαίνω; violation:--breaking, transgression.'),
	('G3848','παραβάτης','parabátēs','par-ab-at\'-ace','from παραβαίνω; a violator:--breaker, transgress(-or).'),
	('G3849','παραβιάζομαι','parabiázomai','par-ab-ee-ad\'-zom-ahee','from παρά and the middle voice of βιάζω; to force contrary to (nature), i.e. compel (by entreaty):--constrain.'),
	('G3850','παραβολή','parabolḗ','par-ab-ol-ay\'','from παραβάλλω; a similitude (\"parable\"), i.e. (symbolic) fictitious narrative (of common life conveying a moral), apothegm or adage:--comparison, figure, parable, proverb.'),
	('G3851','παραβουλεύομαι','parabouleúomai','par-ab-ool-yoo\'-om-ahee','from παρά and the middle voice of βουλεύω; to misconsult, i.e. disregard:--not (to) regard(-ing).'),
	('G3852','παραγγελία','parangelía','par-ang-gel-ee\'-ah','from παραγγέλλω; a mandate:--charge, command.'),
	('G3853','παραγγέλλω','parangéllō','par-ang-gel\'-lo','from παρά and the base of ἄγγελος; to transmit a message, i.e. (by implication) to enjoin:--(give in) charge, (give) command(-ment), declare.'),
	('G3854','παραγίνομαι','paragínomai','par-ag-in\'-om-ahee','from παρά and γίνομαι; to become near, i.e. approach (have arrived); by implication, to appear publicly:--come, go, be present.'),
	('G3855','παράγω','parágō','par-ag\'-o','from παρά and ἄγω; to lead near, i.e. (reflexively or intransitively) to go along or away:--depart, pass (away, by, forth).'),
	('G3856','παραδειγματίζω','paradeigmatízō','par-ad-igue-mat-id\'-zo','from παρά and δειγματίζω; to show alongside (the public), i.e. expose to infamy:--make a public example, put to an open shame.'),
	('G3857','παράδεισος','parádeisos','par-ad\'-i-sos','of Oriental origin (compare פַּרְדֵּס); a park, i.e. (specially), an Eden (place of future happiness, \"paradise\"):--paradise.'),
	('G3858','παραδέχομαι','paradéchomai','par-ad-ekh\'-om-ahee','from παρά and δέχομαι; to accept near, i.e. admit or (by implication) delight in:--receive.'),
	('G3859','παραδιατριβή','paradiatribḗ','par-ad-ee-at-ree-bay\'','from a compound of παρά and διατρίβω; misemployment, i.e. meddlesomeness:--perverse disputing.'),
	('G3860','παραδίδωμι','paradídōmi','par-ad-id\'-o-mee','from παρά and δίδωμι; to surrender, i.e yield up, intrust, transmit:--betray, bring forth, cast, commit, deliver (up), give (over, up), hazard, put in prison, recommend.'),
	('G3861','παράδοξος','parádoxos','par-ad\'-ox-os','from παρά and δόξα (in the sense of seeming); contrary to expectation, i.e. extraordinary (\"paradox\"):--strange.'),
	('G3862','παράδοσις','parádosis','par-ad\'-os-is','from παραδίδωμι; transmission, i.e. (concretely) a precept; specially, the Jewish traditionary law:--ordinance, tradition.'),
	('G3863','παραζηλόω','parazēlóō','par-ad-zay-lo\'-o','from παρά and ζηλόω; to stimulate alongside, i.e. excite to rivalry:--provoke to emulation (jealousy).'),
	('G3864','παραθαλάσσιος','parathalássios','par-ath-al-as\'-see-os','from παρά and θάλασσα; along the sea, i.e. maritime (lacustrine):--upon the sea coast.'),
	('G3865','παραθεωρέω','paratheōréō','par-ath-eh-o-reh\'-o','from παρά and θεωρέω; to overlook or disregard:--neglect.'),
	('G3866','παραθήκη','parathḗkē','par-ath-ay\'-kay','from παρατίθημι; a deposit, i.e. (figuratively) trust:--committed unto.'),
	('G3867','παραινέω','parainéō','par-ahee-neh\'-o','from παρά and αἰνέω; to mispraise, i.e. recommend or advise (a different course):--admonish, exhort.'),
	('G3868','παραιτέομαι','paraitéomai','par-ahee-teh\'-om-ahee','from παρά and the middle voice of αἰτέω; to beg off, i.e. deprecate, decline, shun:--avoid, (make) excuse, intreat, refuse, reject.'),
	('G3869','παρακαθίζω','parakathízō','par-ak-ath-id\'-zo','from παρά and καθίζω; to sit down near:--sit.'),
	('G3870','παρακαλέω','parakaléō','par-ak-al-eh\'-o','from παρά and καλέω; to call near, i.e. invite, invoke (by imploration, hortation or consolation):--beseech, call for, (be of good) comfort, desire, (give) exhort(-ation), intreat, pray.'),
	('G3871','παρακαλύπτω','parakalýptō','par-ak-al-oop\'-to','from παρά and καλύπτω; to cover alongside, i.e. veil (figuratively):--hide.'),
	('G3872','παρακαταθήκη','parakatathḗkē','par-ak-at-ath-ay\'-kay','from a compound of παρά and κατατίθημι; something put down alongside, i.e. a deposit (sacred trust):--that (thing) which is committed (un-)to (trust).'),
	('G3873','παράκειμαι','parákeimai','par-ak\'-i-mahee','from παρά and κεῖμαι; to lie near, i.e. be at hand (figuratively, be prompt or easy):--be present.'),
	('G3874','παράκλησις','paráklēsis','par-ak\'-lay-sis','from παρακαλέω; imploration, hortation, solace:--comfort, consolation, exhortation, intreaty.'),
