	('G3876','παρακοή','parakoḗ','par-ak-o-ay\'','from παρακούω; inattention, i.e. (by implication) disobedience:--disobedience.'),
	('G3877','παρακολουθέω','parakolouthéō','par-ak-ol-oo-theh\'-o','from παρά and ἀκολουθέω; to follow near, i.e. (figuratively) attend (as a result), trace out, conform to:--attain, follow, fully know, have understanding.'),
	('G3878','παρακούω','parakoúō','par-ak-oo\'-o','from παρά and ἀκούω; to mishear, i.e. (by implication) to disobey:--neglect to hear.'),
