	('G3880','παραλαμβάνω','paralambánō','par-al-am-ban\'-o','from παρά and λαμβάνω; to receive near, i.e. associate with oneself (in any familiar or intimate act or relation); by analogy, to assume an office; figuratively, to learn:--receive, take (unto, with).'),
	('G3881','παραλέγομαι','paralégomai','par-al-eg\'-om-ahee','from παρά and the middle voice of λέγω (in its original sense); (specially), to lay one\'s course near, i.e. sail past:--pass, sail by.'),
	('G3882','παράλιος','parálios','par-al\'-ee-os','from παρά and ἅλς; beside the salt (sea), i.e. maritime:--sea coast.'),
	('G3883','παραλλαγή','parallagḗ','par-al-lag-ay\'','from a compound of παρά and ἀλλάσσω; transmutation (of phase or orbit), i.e. (figuratively) fickleness:--variableness.'),
	('G3884','παραλογίζομαι','paralogízomai','par-al-og-id\'-zom-ahee','from παρά and λογίζομαι; to misreckon, i.e. delude:--beguile, deceive.'),
	('G3885','παραλυτικός','paralytikós','par-al-oo-tee-kos\'','from a derivative of παραλύω; as if dissolved, i.e. \"paralytic\":--that had (sick of) the palsy.'),
