	('G3908','παρατίθημι','paratíthēmi','par-at-ith\'-ay-mee','from παρά and τίθημι; to place alongside, i.e. present (food, truth); by implication, to deposit (as a trust or for protection):--allege, commend, commit (the keeping of), put forth, set before.'),
