	('G3927','παρεπίδημος','parepídēmos','par-ep-id\'-ay-mos','from παρά and the base of ἐπιδημέω; an alien alongside, i.e. a resident foreigner:--pilgrim, stranger.'),
	('G3928','παρέρχομαι','parérchomai','par-er\'-khom-ahee','from παρά and ἔρχομαι; to come near or aside, i.e. to approach (arrive), go by (or away), (figuratively) perish or neglect, (causative) avert:--come (forth), go, pass (away, by, over), past, transgress.'),
