	('G3931','παρηγορία','parēgoría','par-ay-gor-ee\'-ah','from a compound of παρά and a derivative of ἀγορά (meaning to harangue an assembly); an address alongside, i.e. (specially), consolation:--comfort.'),
	('G3932','παρθενία','parthenía','par-then-ee\'-ah','from παρθένος; maidenhood:--virginity.'),
	('G3933','παρθένος','parthénos','par-then\'-os','of unknown origin; a maiden; by implication, an unmarried daughter:--virgin.'),
	('G3934','Πάρθος','Párthos','par\'-thos','probably of foreign origin; a Parthian, i.e. inhabitant of Parthia:--Parthian.'),
	('G3935','παρίημι','paríēmi','par-ee\'-ay-mi','from παρά and hiemi (to send); to let by, i.e. relax:--hang down.'),
