	('G3942','παροιμία','paroimía','par-oy-mee\'-ah','from a compound of παρά and perhaps a derivative of οἴομαι; apparently a state alongside of supposition, i.e. (concretely) an adage; specially, an enigmatical or fictitious illustration:--parable, proverb.'),
