	('G4439','πύλη','pýlē','poo\'-lay','apparently a primary word; a gate, i.e. the leaf or wing of a folding entrance (literally or figuratively):--gate.'),
	('G4440','πυλών','pylṓn','poo-lone\'','from πύλη; a gate-way, door-way of a building or city; by implication, a portal or vestibule:--gate, porch.'),
	('G4441','πυνθάνομαι','pynthánomai','poon-than\'-om-ahee','middle voice prolonged from a primary  (which occurs only as an alternate in certain tenses); to question, i.e. ascertain by inquiry (as a matter of information merely; and thus differing from ἐρωτάω, which properly means a request as a favor; and from αἰτέω, which is strictly a demand for something due; as well as from ζητέω, which implies a search for something hidden; and from δέομαι, which involves the idea of urgent need); by implication, to learn (by casual intelligence):--ask, demand, enquire, understand.'),
	('G4442','πῦρ','pŷr','poor','a primary word; \"fire\" (literally or figuratively, specially, lightning):--fiery, fire.'),
	('G4443','πυρά','pyrá','poo-rah\'','from πῦρ; a fire (concretely):--fire.'),
	('G4444','πύργος','pýrgos','poor\'-gos','apparently a primary word (\"burgh\"); a tower or castle:--tower.'),
	('G4445','πυρέσσω','pyréssō','poo-res\'-so','from πυρά; to be on fire, i.e. (specially), to have a fever:--be sick of a fever.'),
	('G4446','πυρετός','pyretós','poo-ret-os\'','from πυρέσσω; inflamed, i.e. (by implication) feverish (as noun, fever):--fever.'),
	('G4447','πύρινος','pýrinos','poo\'-ree-nos','from πυρά; fiery, i.e. (by implication) flaming:--of fire.'),
	('G4448','πυρόω','pyróō','poo-ro\'-o','from πῦρ; to kindle, i.e. (passively) to be ignited, glow (literally), be refined (by implication), or (figuratively) to be inflamed (with anger, grief, lust):--burn, fiery, be on fire, try.'),
	('G4449','πυῤῥάζω','pyrrházō','poor-hrad\'-zo','from πυῤῥός; to redden (intransitively):--be red.'),
	('G4450','πυῤῥός','pyrrhós','poor-hros\'','from πῦρ; fire-like, i.e. (specially), flame- colored:--red.'),
	('G4451','πύρωσις','pýrōsis','poo\'-ro-sis','from πυρόω; ignition, i.e. (specially), smelting (figuratively, conflagration, calamity as a test):--burning, trial.'),
	('G4452','-πω','-pō','po','another form of the base of -πώς; an enclitic particle of indefiniteness; yet, even; used only in the comparative. See μηδέπω, μήπω, οὐδέπω, οὔπω, πώποτε.'),
	('G4453','πωλέω','pōléō','po-leh\'-o','probably ultimately from  (to be busy, to trade); to barter (as a pedlar), i.e. to sell:--sell, whatever is sold.'),
	('G4454','πῶλος','pōlos','po\'-los','apparently a primary word; a \"foal\" or \"filly\", i.e. (specially), a young ass:--colt.'),
	('G4455','πώποτε','pṓpote','po\'-pot-e','from -πω and ποτέ; at any time, i.e. (with negative particle) at no time:--at any time, + never (…to any man), + yet, never man.'),
	('G4456','πωρόω','pōróō','po-ro\'-o','apparently from  (a kind of stone); to petrify, i.e. (figuratively) to indurate (render stupid or callous):-- blind, harden.'),
	('G4457','πώρωσις','pṓrōsis','po\'-ro-sis','from πωρόω; stupidity or callousness:--blindness, hardness.'),
	('G4458','-πώς','-pṓs','poce','adverb from the base of πού; an enclitic particle of indefiniteness of manner; somehow or anyhow; used only in composition:--haply, by any (some) means, perhaps. See εἴ πως, μήπως. Compare πῶς.'),
	('G4459','πῶς','pōs','poce','adverb from the base of ποῦ; an interrogative particle of manner; in what way? (sometimes the question is indirect, how?); also as exclamation, how much!:--how, after (by) what manner (means), that. (Occasionally unexpressed in English).'),
	('G4460','Ῥαάβ','Rhaáb','hrah-ab\'','of Hebrew origin (רָחָב); Raab (i.e. Rachab), a Canaanitess:--Rahab. See also Ῥαχάβ.'),
	('G4461','ῥαββί','rhabbí','hrab-bee\'','of Hebrew origin (רַב with pronominal suffix); my master, i.e Rabbi, as an official title of honor:--Master, Rabbi.'),
	('G4462','ῥαββονί','rhabboní','hrab-boo-nee\'','of Chaldee origin; corresponding to ῥαββί:--Lord, Rabboni.'),
	('G4463','ῥαβδίζω','rhabdízō','hrab-did\'-zo','from ῥάβδος; to strike with a stick, i.e. bastinado:--beat (with rods).'),
	('G4464','ῥάβδος','rhábdos','hrab\'-dos','from the base of ῥαπίζω; a stick or wand (as a cudgel, a cane or a baton of royalty):--rod, sceptre, staff.'),
	('G4465','ῥαβδοῦχος','rhabdoûchos','hrab-doo\'-khos','from ῥάβδος and ἔχω; a rod- (the Latin fasces) holder, i.e. a Roman lictor (constable or executioner):--serjeant.'),
	('G4466','Ῥαγαῦ','Rhagaû','hrag-ow\'','of Hebrew origin (רְעוּ); Ragau (i.e. Reu), a patriarch:--Ragau.'),
	('G4467','ῥᾳδιούργημα','rhaidioúrgēma','hrad-ee-oorg\'-ay-mah','from a comparative of  (easy, i.e. reckless) and ἔργον; easy-going behavior, i.e. (by extension) a crime:--lewdness.'),
	('G4468','ῥᾳδιουργία','rhaidiourgía','hrad-ee-oorg-ee\'-a','from the same as ῥᾳδιούργημα; recklessness, i.e. (by extension) malignity:--mischief.'),
	('G4469','ῥακά','rhaká','rhak-ah\'','of Chaldee origin (compare רֵיק); O empty one, i.e. thou worthless (as a term of utter vilification):--Raca.'),
	('G4470','ῥάκος','rhákos','hrak\'-os','from ῥήγνυμι; a \"rag,\" i.e. piece of cloth:--cloth.'),
	('G4471','Ῥαμᾶ','Rhamâ','hram-ah\'','of Hebrew origin (רָמָה); Rama (i.e. Ramah), a place in Palestine:--Rama.'),
	('G4472','ῥαντίζω','rhantízō','hran-tid\'-zo','from a derivative of  (to sprinkle); to render besprinkled, i.e. asperse (ceremonially or figuratively):-- sprinkle.'),
	('G4473','ῥαντισμός','rhantismós','hran-tis-mos\'','from ῥαντίζω; aspersion (ceremonially or figuratively):--sprinkling.'),
	('G4474','ῥαπίζω','rhapízō','hrap-id\'-zo','from a derivative of a primary  (to let fall, \"rap\"); to slap:--smite (with the palm of the hand). Compare τύπτω.'),
	('G4475','ῥάπισμα','rhápisma','hrap\'-is-mah','from ῥαπίζω; a slap:--(+ strike with the) palm of the hand, smite with the hand.'),
	('G4476','ῥαφίς','rhaphís','hraf-ece\'','from a primary  (to sew; perhaps rather akin to the base of ῥαπίζω through the idea of puncturing); a needle:-- needle.'),
	('G4477','Ῥαχάβ','Rhacháb','hrakh-ab\'','from the same as Ῥαάβ; Rachab, a Canaanitess:--Rachab.'),
	('G4478','Ῥαχήλ','Rhachḗl','hrakh-ale\'','of Hebrew origin (רָחֵל); Rachel, the wife of Jacob:--Rachel.'),
	('G4479','Ῥεβέκκα','Rhebékka','hreb-bek\'-kah','of Hebrew origin (רִבְקָה); Rebecca (i.e. Ribkah), the wife of Isaac:--Rebecca.'),
	('G4480','ῥέδα','rhéda','hred\'-ah','of Latin origin; a rheda, i.e. four-wheeled carriage (wagon for riding):--chariot.'),
	('G4481','Ῥεμφάν','Rhemphán','hrem-fan\'','by incorrect transliteration for a word of Hebrew origin (כִּיּוּן); Remphan (i.e. Kijun), an Egyptian idol:--Remphan.'),
	('G4482','ῥέω','rhéō','hryoo\'-o','a primary verb; for some tenses of which a prolonged form         is used to flow (\"run\"; as water):--flow.'),
	('G4483','ῥέω','rhéō','er-eh\'-o','ἔπωperhaps akin (or identical) with ῥέω (through the idea of pouring forth); to utter, i.e. speak or say:--command, make, say, speak (of). Compare λέγω.'),
	('G4484','Ῥήγιον','Rhḗgion','hrayg\'-ee-on','of Latin origin; Rhegium, a place in Italy:--Rhegium.'),
	('G4485','ῥῆγμα','rhēgma','hrayg\'-mah','from ῥήγνυμι; something torn, i.e. a fragment (by implication and abstractly, a fall):--ruin.'),
	('G4486','ῥήγνυμι','rhḗgnymi','hrace\'-so','both prolonged forms of  (which appears only in certain forms, and is itself probably a strengthened form of agnumi (see in κατάγνυμι)); to \"break,\" \"wreck\" or \"crack\", i.e. (especially) to sunder (by separation of the parts; κατάγνυμι being its intensive (with the preposition in composition), and θραύω a shattering to minute fragments; but not a reduction to the constituent particles, like λύω) or disrupt, lacerate; by implication, to convulse (with spasms); figuratively, to give vent to joyful emotions:--break (forth), burst, rend, tear.'),
	('G4487','ῥῆμα','rhēma','hray\'-mah','from ῥέω; an utterance (individually, collectively or specially),; by implication, a matter or topic (especially of narration, command or dispute); with a negative naught whatever:--+ evil, + nothing, saying, word.'),
	('G4488','Ῥησά','Rhēsá','hray-sah\'','probably of Hebrew origin (apparently for רְפָיָה); Resa (i.e. Rephajah), an Israelite:--Rhesa.'),
	('G4489','ῥήτωρ','rhḗtōr','hray\'-tore','from ῥέω; a speaker, i.e. (by implication) a forensic advocate:--orator.'),
	('G4490','ῥητῶς','rhētōs','hray-toce\'','adverb from a derivative of ῥέω; out-spokenly, i.e. distinctly:--expressly.'),
	('G4491','ῥίζα','rhíza','hrid\'-zah','apparently a primary word; a \"root\" (literally or figuratively):--root.'),
	('G4492','ῥιζόω','rhizóō','hrid-zo\'-o','from ῥίζα; to root (figuratively, become stable):--root.'),
	('G4493','ῥιπή','rhipḗ','hree-pay\'','from ῥίπτω; a jerk (of the eye, i.e. (by analogy) an instant):--twinkling.'),
	('G4494','ῥιπίζω','rhipízō','hrip-id\'-zo','from a derivative of ῥίπτω (meaning a fan or bellows); to breeze up, i.e. (by analogy) to agitate (into waves):--toss.'),
	('G4495','ῥιπτέω','rhiptéō','hrip-teh\'-o','from a derivative of ῥίπτω; to toss up:--cast off.'),
	('G4496','ῥίπτω','rhíptō','hrip\'-to','a primary verb (perhaps rather akin to the base of ῥαπίζω, through the idea of sudden motion); to fling (properly, with a quick toss, thus differing from βάλλω, which denotes a deliberate hurl; and from  (see in ἐκτείνω), which indicates an extended projection); by qualification, to deposit (as if a load); by extension, to disperse:--cast (down, out), scatter abroad, throw.'),
	('G4497','Ῥοβοάμ','Rhoboám','hrob-o-am\'','of Hebrew origin (רְחַבְעָם); Roboam (i.e. Rechobam), an Israelite:--Roboam.'),
	('G4498','Ῥόδη','Rhódē','hrod\'-ay','probably for rhode (a rose); Rode, a servant girl:--Rhoda.'),
	('G4499','Ῥόδος','Rhódos','hrod\'-os','probably from  (a rose); Rhodus, an island of the Mediterranean:--Rhodes.'),
	('G4500','ῥοιζηδόν','rhoizēdón','hroyd-zay-don\'','adverb from a derivative of  (a whir); whizzingly, i.e. with a crash:--with a great noise.'),
	('G4501','ῥομφαία','rhomphaía','hrom-fah\'-yah','probably of foreign origin; a sabre, i.e. a long and broad cutlass (any weapon of the kind, literally or figuratively):--sword.'),
	('G4502','Ῥουβήν','Rhoubḗn','hroo-bane\'','of Hebrew origin (רְאוּבֵן); Ruben (i.e. Reuben), an Israelite:--Reuben.'),
	('G4503','Ῥούθ','Rhoúth','hrooth','of Hebrew origin (רוּת); Ruth, a Moabitess:--Ruth.'),
	('G4504','Ῥοῦφος','Rhoûphos','hroo\'-fos','of Latin origin; red; Rufus, a Christian:--Rufus.'),
	('G4505','ῥύμη','rhýmē','hroo\'-may','prolongation from ῥύομαι in its original sense; an alley or avenue (as crowded):--lane, street.'),
	('G4506','ῥύομαι','rhýomai','rhoo\'-om-ahee','middle voice of an obsolete verb, akin to ῥέω (through the idea of a current; compare ῥύσις); to rush or draw (for oneself), i.e. rescue:--deliver(-er).'),
	('G4507','ῥυπαρία','rhyparía','hroo-par-ee\'-ah','from ῥυπαρός; dirtiness (morally):--turpitude.'),
	('G4508','ῥυπαρός','rhyparós','rhoo-par-os\'','from ῥύπος; dirty, i.e. (relatively) cheap or shabby; morally, wicked:--vile.'),
	('G4509','ῥύπος','rhýpos','hroo\'-pos','of uncertain affinity; dirt, i.e. (morally) depravity:--filth.'),
	('G4510','ῥυπόω','rhypóō','rhoo-po\'-o','from ῥύπος; to soil, i.e. (intransitively) to become dirty (morally):--be filthy.'),
	('G4511','ῥύσις','rhýsis','hroo\'-sis','from ῥύομαι in the sense of its congener ῥέω; a flux (of blood):--issue.'),
	('G4512','ῥυτίς','rhytís','hroo-tece\'','from ῥύομαι; a fold (as drawing together), i.e. a wrinkle (especially on the face):--wrinkle.'),
	('G4513','Ῥωμαϊκός','Rhōmaïkós','rho-mah-ee-kos\'','from Ῥωμαῖος; Romaic, i.e. Latin:--Latin.'),
	('G4514','Ῥωμαῖος','Rhōmaîos','hro-mah\'-yos','from Ῥώμη; Romæan, i.e. Roman (as noun):--Roman, of Rome.'),
	('G4515','Ῥωμαϊστί','Rhōmaïstí','hro-mah-is-tee\'','adverb from a presumed derivative of Ῥώμη; Romaistically, i.e. in the Latin language:--Latin.'),
	('G4516','Ῥώμη','Rhṓmē','hro\'-may','from the base of ῥώννυμι; strength; Roma, the capital of Italy:--Rome.'),
	('G4517','ῥώννυμι','rhṓnnymi','hrone\'-noo-mee','prolongation from  (to dart; probably akin to ῥύομαι); to strengthen, i.e. (impersonal passive) have health (as a parting exclamation, good-bye):--farewell.'),
	('G4518','σαβαχθάνι','sabachtháni','sab-akh-than-ee\'','of Chaldee or (שְׁבַק with pronominal suffix); thou hast left me; sabachthani (i.e. shebakthani), a cry of distress:--sabachthani.'),
	('G4519','σαβαώθ','sabaṓth','sab-ah-owth\'','of Hebrew origin (צָבָא in feminine plural); armies; sabaoth (i.e. tsebaoth), a military epithet of God:--sabaoth.'),
	('G4520','σαββατισμός','sabbatismós','sab-bat-is-mos\'','from a derivative of σάββατον; a \"sabbatism\", i.e. (figuratively) the repose of Christianity (as a type of heaven):--rest.'),
	('G4521','σάββατον','sábbaton','sab\'-bat-on','of Hebrew origin (שַׁבָּת); the Sabbath (i.e. Shabbath), or day of weekly repose from secular avocations (also the observance or institution itself); by extension, a se\'nnight, i.e. the interval between two Sabbaths; likewise the plural in all the above applications:--sabbath (day), week.'),
	('G4522','σαγήνη','sagḗnē','sag-ay\'-nay','from a derivative of  (to equip) meaning furniture, especially a pack-saddle (which in the East is merely a bag of netted rope); a \"seine\" for fishing:--net.'),
	('G4523','Σαδδουκαῖος','Saddoukaîos','sad-doo-kah\'-yos','probably from Σαδώκ; a Sadducæan (i.e. Tsadokian), or follower of a certain heretical Israelite:--Sadducee.'),
	('G4524','Σαδώκ','Sadṓk','sad-oke\'','of Hebrew origin (צָדוֹק); Sadoc (i.e. Tsadok), an Israelite:--Sadoc.'),
	('G4525','σαίνω','saínō','sah\'-ee-no','akin to σείω; to wag (as a dog its tail fawningly), i.e. (generally) to shake (figuratively, disturb):--move.'),
	('G4526','σάκκος','sákkos','sak\'-kos','of Hebrew origin (שַׂק); \"sack\"-cloth, i.e. mohair (the material or garments made of it, worn as a sign of grief):-- sackcloth.'),
	('G4527','Σαλά','Salá','sal-ah\'','of Hebrew origin (שֶׁלַח); Sala (i.e. Shelach), a patriarch :--Sala.'),
	('G4528','Σαλαθιήλ','Salathiḗl','sal-ath-ee-ale\'','of Hebrew origin (שְׁאַלְתִּיאֵל); Salathiel (i.e. Shealtiel), an Israelite:--Salathiel.'),
	('G4529','Σαλαμίς','Salamís','sal-am-ece\'','probably from σάλος (from the surge on the shore); Salamis, a place in Cyprus:--Salamis.'),
	('G4530','Σαλείμ','Saleím','sal-ime\'','probably from the same as σαλεύω; Salim, a place in Palestine:--Salim.'),
	('G4531','σαλεύω','saleúō','sal-yoo\'-o','from σάλος; to waver, i.e. agitate, rock, topple or (by implication) destroy; figuratively, to disturb, incite:--move, shake (together), which can(-not) be shaken, stir up.'),
	('G4532','Σαλήμ','Salḗm','sal-ame\'','of Hebrew origin (שָׁלֵם); Salem (i.e. Shalem), a place in Palestine:--Salem.'),
	('G4533','Σαλμών','Salmṓn','sal-mone\'','of Hebrew origin (שַׂלְמוֹן); Salmon, an Israelite:--Salmon.'),
	('G4534','Σαλμώνη','Salmṓnē','sal-mo\'-nay','perhaps of similar origin to Σαλαμίς; Salmone, a place in Crete:--Salmone.'),
	('G4535','σάλος','sálos','sal\'-os','probably from the base of σαίνω; a vibration, i.e. (specially), billow:--wave.'),
	('G4536','σάλπιγξ','sálpinx','sal\'-pinx','perhaps from σάλος (through the idea of quavering or reverberation); a trumpet:--trump(-et).'),
	('G4537','σαλπίζω','salpízō','sal-pid\'-zo','from σάλπιγξ; to trumpet, i.e. sound a blast (literally or figuratively):--(which are yet to) sound (a trumpet).'),
	('G4538','σαλπιστής','salpistḗs','sal-pis-tace\'','from σαλπίζω; a trumpeter:--trumpeter.'),
	('G4539','Σαλώμη','Salṓmē','sal-o\'-may','probably of Hebrew origin (feminine from שָׁלוֹם); Salome (i.e. Shelomah), an Israelitess:--Salome.'),
	('G4540','Σαμάρεια','Samáreia','sam-ar\'-i-ah','of Hebrew origin (שֹׁמְרוֹן); Samaria (i.e. Shomeron), a city and region of Palestine:--Samaria.'),
	('G4541','Σαμαρείτης','Samareítēs','sam-ar-i\'-tace','from Σαμάρεια; a Samarite, i.e. inhabitant of Samaria:--Samaritan.'),
	('G4542','Σαμαρεῖτις','Samareîtis','sam-ar-i\'-tis','feminine of Σαμαρείτης; a Samaritess, i.e. woman of Samaria:--of Samaria.'),
	('G4543','Σαμοθρᾴκη','Samothráikē','sam-oth-rak\'-ay','from Σάμος and  (Thrace); Samo-thrace (Samos of Thrace), an island in the Mediterranean:--Samothracia.'),
	('G4544','Σάμος','Sámos','sam\'-os','of uncertain affinity; Samus, an island of the Mediterranean:--Samos.'),
	('G4545','Σαμουήλ','Samouḗl','sam-oo-ale\'','of Hebrew origin (שְׁמוּאֵל); Samuel (i.e. Shemuel), an Israelite:--Samuel.'),
	('G4546','Σαμψών','Sampsṓn','samp-sone\'','of Hebrew origin (שִׁמְשׁוֹן); Sampson (i.e. Shimshon), an Israelite:--Samson.'),
	('G4547','σανδάλιον','sandálion','san-dal\'-ee-on','neuter of a derivative of  (a \"sandal\"; of uncertain origin); a slipper or sole-pad:--sandal.'),
	('G4548','σανίς','sanís','san-ece\'','of uncertain affinity; a plank:--board.'),
	('G4549','Σαούλ','Saoúl','sah-ool\'','of Hebrew origin (שָׁאוּל); Saul (i.e. Shaul), the Jewish name of Paul:--Saul. Compare Σαῦλος.'),
	('G4550','σαπρός','saprós','sap-ros\'','from σήπω; rotten, i.e. worthless (literally or morally):--bad, corrupt. Compare πονηρός.'),
	('G4551','Σαπφείρη','Sappheírē','sap-fi\'-ray','feminine of σάπφειρος; Sapphire, an Israelitess:--Sapphira.'),
	('G4552','σάπφειρος','sáppheiros','sap\'-fi-ros','of Hebrew origin (סַפִּיר); a \"sapphire\" or lapis-lazuli gem:--sapphire.'),
	('G4553','σαργάνη','sargánē','sar-gan\'-ay','apparently of Hebrew origin (שָׂרַג); a basket (as interwoven or wicker-work:--basket.'),
	('G4554','Σάρδεις','Sárdeis','sar\'-dice','plural of uncertain derivation; Sardis, a place in Asia Minor:--Sardis.'),
	('G4555','σάρδινος','sárdinos','sar\'-dee-nos','from the same as σάρδιος; sardine (λίθος being implied), i.e. a gem, so called:--sardine.'),
	('G4556','σάρδιος','sárdios','sar\'-dee-os','properly, an adjective from an uncertain base; sardian (3037 being implied), i.e. (as noun) the gem so called:--sardius.'),
	('G4557','σαρδόνυξ','sardónyx','sar-don\'-oox','from the base of σάρδιος and  (the nail of a finger; hence the \"onyx\" stone); a \"sardonyx\", i.e. the gem so called:-- sardonyx.'),
	('G4558','Σάρεπτα','Sárepta','sar\'-ep-tah','of Hebrew origin (צָרְפַת); Sarepta (i.e. Tsarephath), a place in Palestine:--Sarepta.'),
	('G4559','σαρκικός','sarkikós','sar-kee-kos\'','from σάρξ; pertaining to flesh, i.e. (by extension) bodily, temporal, or (by implication) animal, unregenerate:--carnal, fleshly.'),
	('G4560','σάρκινος','sárkinos','sar\'-kee-nos','from σάρξ; similar to flesh, i.e. (by analogy) soft:--fleshly.'),
	('G4561','σάρξ','sárx','sarx','probably from the base of σαρόω; flesh (as stripped of the skin), i.e. (strictly) the meat of an animal (as food), or (by extension) the body (as opposed to the soul (or spirit), or as the symbol of what is external, or as the means of kindred), or (by implication) human nature (with its frailties (physically or morally) and passions), or (specially), a human being (as such):--carnal(-ly, + -ly minded), flesh(-ly).'),
	('G4562','Σαρούχ','Saroúch','sar-ooch\'','of Hebrew origin (שְׂרוּג); Saruch (i.e. Serug), a patriarch:--Saruch.'),
