	('G4697','σπλαγχνίζομαι','splanchnízomai','splangkh-nid\'-zom-ahee','middle voice from σπλάγχνον; to have the bowels yearn, i.e. (figuratively) feel sympathy, to pity:--have (be moved with) compassion.'),
	('G4698','σπλάγχνον','splánchnon','splangkh\'-non','probably strengthened from  (the \"spleen\"); an intestine (plural); figuratively, pity or sympathy:--bowels, inward affection, + tender mercy.'),
	('G4699','σπόγγος','spóngos','spong\'-gos','perhaps of foreign origin; a \"sponge\":--spunge.'),
	('G4700','σποδός','spodós','spod-os\'','of uncertain derivation; ashes:--ashes.'),
	('G4701','σπορά','sporá','spor-ah\'','from σπείρω; a sowing, i.e. (by implication) parentage:--seed.'),
	('G4702','σπόριμος','spórimos','spor\'-ee-mos','from σπόρος; sown, i.e. (neuter plural) a planted field:--corn(-field).'),
	('G4703','σπόρος','spóros','spro\'-os','from σπείρω; a scattering (of seed), i.e. (concretely) seed (as sown):--seed (X sown).'),
	('G4704','σπουδάζω','spoudázō','spoo-dad\'-zo','from σπουδή; to use speed, i.e. to make effort, be prompt or earnest:--do (give) diligence, be diligent (forward), endeavour, labour, study.'),
	('G4705','σπουδαῖος','spoudaîos','spoo-dah\'-yos','from σπουδή; prompt, energetic, earnest:--diligent.'),
	('G4706','σπουδαιότερον','spoudaióteron','spoo-dah-yot\'-er-on','neuter of σπουδαιότερος as adverb; more earnestly than others), i.e. very promptly:--very diligently.'),
	('G4707','σπουδαιότερος','spoudaióteros','spoo-dah-yot\'-er-os','comparative of σπουδαῖος; more prompt, more earnest:--more diligent (forward).'),
	('G4708','σπουδαιοτέρως','spoudaiotérōs','spoo-dah-yot-er\'-oce','adverb from σπουδαιότερος; more speedily, i.e. sooner than otherwise:--more carefully.'),
	('G4709','σπουδαίως','spoudaíōs','spoo-dah\'-yoce','adverb from σπουδαῖος; earnestly, promptly:--diligently, instantly.'),
	('G4710','σπουδή','spoudḗ','spoo-day\'','from σπεύδω; \"speed\", i.e. (by implication) despatch, eagerness, earnestness:--business, (earnest) care(-fulness), diligence, forwardness, haste.'),
	('G4711','σπυρίς','spyrís','spoo-rece\'','from σπείρω (as woven); a hamper or lunch-receptacle:--basket.'),
	('G4712','στάδιον','stádion','stad\'-ee-os','from the base of ἵστημι (as fixed); a stade or certain measure of distance; by implication, a stadium or race-course:--furlong, race.'),
	('G4713','στάμνος','stámnos','stam\'-nos','from the base of ἵστημι (as stationary); a jar or earthen tank:--pot.'),
	('G4714','στάσις','stásis','stas\'-is','from the base of ἵστημι; a standing (properly, the act), i.e. (by analogy) position (existence); by implication, a popular uprising; figuratively, controversy:--dissension, insurrection, X standing, uproar.'),
	('G4715','στατήρ','statḗr','stat-air\'','from the base of καύχησις; a stander (standard of value), i.e. (specially), a stater or certain coin:--piece of money.'),
	('G4716','σταυρός','staurós','stow-ros\'','from the base of ἵστημι; a stake or post (as set upright), i.e. (specially), a pole or cross (as an instrument of capital punishment); figuratively, exposure to death, i.e. self-denial; by implication, the atonement of Christ:--cross.'),
	('G4717','σταυρόω','stauróō','stow-ro\'-o','from σταυρός; to impale on the cross; figuratively, to extinguish (subdue) passion or selfishness:--crucify.'),
	('G4718','σταφυλή','staphylḗ','staf-oo-lay\'','probably from the base of στέφανος; a cluster of grapes (as if intertwined):--grapes.'),
	('G4719','στάχυς','stáchys','stakh\'-oos','from the base of ἵστημι; a head of grain (as standing out from the stalk):--ear (of corn).'),
	('G4720','Στάχυς','Stáchys','stakh\'-oos','the same as στάχυς; Stachys, a Christian:--Stachys.'),
	('G4721','στέγη','stégē','steg\'-ay','strengthened from a primary  (a \"thatch\" or \"deck\" of a building); a roof:--roof.'),
	('G4722','στέγω','stégō','steg\'-o','from στέγη; to roof over, i.e. (figuratively) to cover with silence (endure patiently):--(for-)bear, suffer.'),
	('G4723','στείρος','steíros','sti\'-ros','a contraction from στερεός (as stiff and unnatural); \"sterile\":--barren.'),
	('G4724','στέλλω','stéllō','stel\'-lo','probably strengthened from the base of ἵστημι; properly, to set fast (\"stall\"), i.e. (figuratively) to repress (reflexively, abstain from associating with):--avoid, withdraw self.'),
	('G4725','στέμμα','stémma','stem\'-mah','from the base of στέφανος; a wreath for show:--garland.'),
	('G4726','στεναγμός','stenagmós','sten-ag-mos\'','from στενάζω; a sigh:--groaning.'),
	('G4727','στενάζω','stenázō','sten-ad\'-zo','from στενός; to make (intransitively, be) in straits, i.e. (by implication) to sigh, murmur, pray inaudibly:--with grief, groan, grudge, sigh.'),
	('G4728','στενός','stenós','sten-os\'','probably from the base of ἵστημι; narrow (from obstacles standing close about):--strait.'),
	('G4729','στενοχωρέω','stenochōréō','sten-okh-o-reh\'-o','from the same as στενοχωρία; to hem in closely, i.e. (figuratively) cramp:--distress, straiten.'),
	('G4730','στενοχωρία','stenochōría','sten-okh-o-ree\'-ah','from a compound of στενός and χώρα; narrowness of room, i.e. (figuratively) calamity:--anguish, distress.'),
	('G4731','στερεός','stereós','ster-eh-os\'','from ἵστημι; stiff, i.e. solid, stable (literally or figuratively):--stedfast, strong, sure.'),
	('G4732','στερεόω','stereóō','ster-eh-o\'-o','from στερεός; to solidify, i.e. confirm (literally or figuratively):--establish, receive strength, make strong.'),
	('G4733','στερέωμα','steréōma','ster-eh\'-o-mah','from στερεόω; something established, i.e. (abstractly) confirmation (stability):--stedfastness.'),
	('G4734','Στεφανᾶς','Stephanâs','stef-an-as\'','probably contraction for  (crowned; from στεφανόω); Stephanas, a Christian:--Stephanas.'),
	('G4735','στέφανος','stéphanos','stef\'-an-os','from an apparently primary  (to twine or wreathe); a chaplet (as a badge of royalty, a prize in the public games or a symbol of honor generally; but more conspicuous and elaborate than the simple fillet, διάδημα), literally or figuratively:--crown.'),
	('G4736','Στέφανος','Stéphanos','stef\'-an-os','the same as στέφανος; Stephanus, a Christian:--Stephen.'),
	('G4737','στεφανόω','stephanóō','stef-an-o\'-o','from στέφανος; to adorn with an honorary wreath (literally or figuratively):--crown.'),
	('G4738','στῆθος','stēthos','stay\'-thos','from ἵστημι (as standing prominently); the (entire external) bosom, i.e. chest:--breast.'),
	('G4739','στήκω','stḗkō','stay\'-ko','from the perfect tense of ἵστημι; to be stationary, i.e. (figuratively) to persevere:--stand (fast).'),
	('G4740','στηριγμός','stērigmós','stay-rig-mos\'','from στηρίζω; stability (figuratively):--stedfastness.'),
	('G4741','στηρίζω','stērízō','stay-rid\'-zo','from a presumed derivative of ἵστημι (like στερεός); to set fast, i.e. (literally) to turn resolutely in a certain direction, or (figuratively) to confirm:--fix, (e-)stablish, stedfastly set, strengthen.'),
	('G4742','στίγμα','stígma','stig\'-mah','from a primary  (to \"stick\", i.e. prick); a mark incised or punched (for recognition of ownership), i.e. (figuratively) scar of service:--mark.'),
	('G4743','στιγμή','stigmḗ','stig-may\'','feminine of στίγμα; a point of time, i.e. an instant:--moment.'),
	('G4744','στίλβω','stílbō','stil\'-bo','apparently a primary verb; to gleam, i.e. flash intensely:--shining.'),
	('G4745','στοά','stoá','sto-ah\'','probably from ἵστημι; a colonnade or interior piazza:--porch.'),
	('G4746','στοιβάς','stoibás','stoy-bas\'','from a primary  (to \"step\" or \"stamp\"); a spread (as if tramped flat) of loose materials for a couch, i.e. (by implication) a bough of a tree so employed:--branch.'),
	('G4747','στοιχεῖον','stoicheîon','stoy-khi\'-on','neuter of a presumed derivative of the base of στοιχέω; something orderly in arrangement, i.e. (by implication) a serial (basal, fundamental, initial) constituent (literally), proposition (figuratively):--element, principle, rudiment.'),
	('G4748','στοιχέω','stoichéō','stoy-kheh\'-o','from a derivative of  (to range in regular line); to march in (military) rank (keep step), i.e. (figuratively) to conform to virtue and piety:--walk (orderly).'),
	('G4749','στολή','stolḗ','stol-ay\'','from στέλλω; equipment, i.e. (specially), a \"stole\" or long-fitting gown (as a mark of dignity):--long clothing (garment), (long) robe.'),
	('G4750','στόμα','stóma','stom\'-a','probably strengthened from a presumed derivative of the base of τομώτερος; the mouth (as if a gash in the face); by implication, language (and its relations); figuratively, an opening (in the earth); specially, the front or edge (of a weapon):--edge, face, mouth.'),
	('G4751','στόμαχος','stómachos','stom\'-akh-os','from στόμα; an orifice (the gullet), i.e. (specially), the \"stomach\":--stomach.'),
	('G4752','στρατεία','strateía','strat-i\'-ah','from στρατεύομαι; military service, i.e. (figuratively) the apostolic career (as one of hardship and danger):--warfare.'),
	('G4753','στράτευμα','stráteuma','strat\'-yoo-mah','from στρατεύομαι; an armament, i.e. (by implication) a body of troops (more or less extensive or systematic):--army, soldier, man of war.'),
	('G4754','στρατεύομαι','strateúomai','strat-yoo\'-om-ahee','middle voice from the base of στρατιά; to serve in a military campaign; figuratively, to execute the apostolate (with its arduous duties and functions), to contend with carnal inclinations:--soldier, (go to) war(-fare).'),
	('G4755','στρατηγός','stratēgós','strat-ay-gos\'','from the base of στρατιά and ἄγω or ἡγέομαι; a general, i.e. (by implication or analogy) a (military) governor (prætor), the chief (præfect) of the (Levitical) temple-wardens:--captain, magistrate.'),
	('G4756','στρατιά','stratiá','strat-ee\'-ah','feminine of a derivative of  (an army; from the base of στρώννυμι, as encamped); camp-likeness, i.e. an army, i.e. (figuratively) the angels, the celestial luminaries:--host.'),
	('G4757','στρατιώτης','stratiṓtēs','strat-ee-o\'-tace','from a presumed derivative of the same as στρατιά; a camper-out, i.e. a (common) warrior (literally or figuratively):--soldier.'),
	('G4758','στρατολογέω','stratologéō','strat-ol-og-eh\'-o','from a compound of the base of στρατιά and λέγω (in its original sense); to gather (or select) as a warrior, i.e. enlist in the army:--choose to be a soldier.'),
	('G4759','στρατοπεδάρχης','stratopedárchēs','strat-op-ed-ar\'-khace','from στρατόπεδον and ἄρχω; a ruler of an army, i.e. (specially), a Prætorian præfect:--captain of the guard.'),
	('G4760','στρατόπεδον','stratópedon','strat-op\'-ed-on','from the base of στρατιά and the same as πεδινός; a camping-ground, i.e. (by implication) a body of troops:--army.'),
	('G4761','στρεβλόω','streblóō','streb-lo\'-o','from a derivative of στρέφω; to wrench, i.e. (specially), to torture (by the rack), but only figuratively, to pervert:-- wrest.'),
	('G4762','στρέφω','stréphō','stref\'-o','strengthened from the base of τροπή; to twist, i.e. turn quite around or reverse (literally or figuratively):--convert, turn (again, back again, self, self about).'),
	('G4763','στρηνιάω','strēniáō','stray-nee-ah\'-o','from a presumed derivative of στρῆνος; to be luxurious:--live deliciously.'),
	('G4764','στρῆνος','strēnos','stray\'-nos','akin to στερεός; a \"straining\", \"strenuousness\" or \"strength\", i.e. (figuratively) luxury (voluptuousness):--delicacy.'),
	('G4765','στρουθίον','strouthíon','stroo-thee\'-on','diminutive of  (a sparrow); a little sparrow:--sparrow.'),
	('G4766','στρώννυμι','strṓnnymi','stro\'-o','prolongation from a still simpler        , (used only as an alternate in certain tenses) (probably akin to στερεός through the idea of positing); to \"strew,\" i.e. spread (as a carpet or couch):--make bed, furnish, spread, strew.'),
	('G4767','στυγνητός','stygnētós','stoog-nay-tos\'','from a derivative of an obsolete apparently primary  (to hate); hated, i.e. odious:--hateful.'),
	('G4768','στυγνάζω','stygnázō','stoog-nad\'-zo','from the same as στυγνητός; to render gloomy, i.e. (by implication) glower (be overcast with clouds, or sombreness of speech):--lower, be sad.'),
	('G4769','στῦλος','stŷlos','stoo\'-los','from  (to stiffen; properly akin to the base of ἵστημι); a post (\"style\"), i.e. (figuratively) support:--pillar.'),
	('G4770','Στωϊκός','Stōïkós','sto-ik-os\'','from στοά; a \"Stoic\" (as occupying a particular porch in Athens), i.e. adherent of a certin philosophy:--Stoick.'),
	('G4771','σύ','sý','soo','the personal pronoun of the second person singular; thou:-- thou. See also σέ, σοί, σοῦ; and for the plural ὑμᾶς, ὑμεῖς, ὑμῖν, ὑμῶν.'),
	('G4772','συγγένεια','syngéneia','soong-ghen\'-i-ah','from συγγενής; relationship, i.e. (concretely) relatives:--kindred.'),
	('G4773','συγγενής','syngenḗs','soong-ghen-ace\'','from σύν and γένος; a relative (by blood); by extension, a fellow countryman:--cousin, kin(-sfolk, -sman).'),
	('G4774','συγγνώμη','syngnṓmē','soong-gno\'-may','from a compound of σύν and γινώσκω; fellow knowledge, i.e. concession:--permission.'),
	('G4775','συγκάθημαι','synkáthēmai','soong-kath\'-ay-mahee','from σύν and κάθημαι; to seat oneself in company with:--sit with.'),
	('G4776','συγκαθίζω','synkathízō','soong-kath-id\'-zo','from σύν and καθίζω; to give (or take) a seat in company with:--(make) sit (down) together.'),
	('G4777','συγκακοπαθέω','synkakopathéō','soong-kak-op-ath-eh\'-o','from σύν and κακοπαθέω; to suffer hardship in company with:--be partaker of afflictions.'),
	('G4778','συγκακουχέω','synkakouchéō','soong-kak-oo-kheh\'-o','from σύν and κακουχέω; to maltreat in company with, i.e. (passively) endure persecution together:--suffer affliction with.'),
	('G4779','συγκαλέω','synkaléō','soong-kal-eh\'-o','from σύν and καλέω; to convoke:--call together.'),
	('G4780','συγκαλύπτω','synkalýptō','soong-kal-oop\'-to','from σύν and καλύπτω; to conceal altogether:--cover.'),
	('G4781','συγκάμπτω','synkámptō','soong-kamp\'-to','from σύν and κάμπτω; to bend together, i.e. (figuratively) to afflict:--bow down.'),
	('G4782','συγκαταβαίνω','synkatabaínō','soong-kat-ab-ah\'-ee-no','from σύν and καταβαίνω; to descend in company with:--go down with.'),
	('G4783','συγκατάθεσις','synkatáthesis','soong-kat-ath\'-es-is','from συγκατατίθεμαι; a deposition (of sentiment) in company with, i.e. (figuratively) accord with:--agreement.'),
	('G4784','συγκατατίθεμαι','synkatatíthemai','soong-kat-at-ith\'-em-ahee','middle from σύν and κατατίθημι; to deposit (one\'s vote or opinion) in company with, i.e. (figuratively) to accord with:--consent.'),
	('G4785','συγκαταψηφίζω','synkatapsēphízō','soong-kat-aps-ay-fid\'-zo','from σύν and a compound of κατά and ψηφίζω; to count down in company with, i.e. enroll among:--number with.'),
	('G4786','συγκεράννυμι','synkeránnymi','soong-ker-an\'-noo-mee','from σύν and κεράννυμι; to commingle, i.e. (figuratively) to combine or assimilate:--mix with, temper together.'),
	('G4787','συγκινέω','synkinéō','soong-kin-eh\'-o','from σπαράσσω and κινέω; to move together, i.e. (specially), to excite as a mass (to sedition):--stir up.'),
	('G4788','συγκλείω','synkleíō','soong-kli\'-o','from σύν and κλείω; to shut together, i.e. include or (figuratively) embrace in a common subjection to:--conclude, inclose, shut up.'),
	('G4789','συγκληρονόμος','synklēronómos','soong-klay-ron-om\'-os','from σύν and κληρονόμος; a co-heir, i.e. (by analogy) participant in common:--fellow (joint)-heir, heir together, heir with.'),
	('G4790','συγκοινωνέω','synkoinōnéō','soong-koy-no-neh\'-o','from σύν and κοινωνέω; to share in company with, i.e. co-participate in:--communicate (have fellowship) with, be partaker of.'),
	('G4791','συγκοινωνός','synkoinōnós','soong-koy-no-nos\'','from σύν and κοινωνός; a co-participant:--companion, partake(-r, -r with).'),
	('G4792','συγκομίζω','synkomízō','soong-kom-id\'-zo','from σύν and κομίζω; to convey together, i.e. collect or bear away in company with others:--carry.'),
	('G4793','συγκρίνω','synkrínō','soong-kree\'-no','from σύν and κρίνω; to judge of one thing in connection with another, i.e. combine (spiritual ideas with appropriate expressions) or collate (one person with another by way of contrast or resemblance):--compare among (with).'),
	('G4794','συγκύπτω','synkýptō','soong-koop\'-to','from σύν and κύπτω; to stoop altogether, i.e. be completely overcome by:--bow together.'),
	('G4795','συγκυρία','synkyría','soong-koo-ree\'-ah','from a comparative of σύν and  (to light or happen; from the base of κύριος); concurrence, i.e. accident:--chance.'),
	('G4796','συγχαίρω','synchaírō','soong-khah\'-ee-ro','from σύν and χαίρω; to sympathize in gladness, congratulate:--rejoice in (with).'),
	('G4797','συγχέω','synchéō','soong-khoo\'-no','from σύν and  (to pour) or its alternate; to commingle promiscuously, i.e. (figuratively) to throw (an assembly) into disorder, to perplex (the mind):--confound, confuse, stir up, be in an uproar.'),
	('G4798','συγχράομαι','synchráomai','soong-khrah\'-om-ahee','from σύν and χράομαι; to use jointly, i.e. (by implication) to hold intercourse in common:--have dealings with.'),
	('G4799','σύγχυσις','sýnchysis','soong\'-khoo-sis','from συγχέω; commixture, i.e. (figuratively) riotous disturbance:--confusion.'),
	('G4800','συζάω','syzáō','sood-zah\'-o','from σύν and ζάω; to continue to live in common with, i.e. co-survive (literally or figuratively):--live with.'),
	('G4801','συζεύγνυμι','syzeúgnymi','sood-zyoog\'-noo-mee','from σύν and the base of ζεῦγος; to yoke together, i.e. (figuratively) conjoin (in marriage):--join together.'),
	('G4802','συζητέω','syzētéō','sood-zay-teh\'-o','from σύν and ζητέω; to investigate jointly, i.e. discuss, controvert, cavil:--dispute (with), enquire, question (with), reason (together).'),
	('G4803','συζήτησις','syzḗtēsis','sood-zay\'-tay-sis','from συζητέω; mutual questioning, i.e. discussion:--disputation(-ting), reasoning.'),
	('G4804','συζητητής','syzētētḗs','sood-zay-tay-tace\'','from συζητέω; a disputant, i.e. sophist:--disputer.'),
	('G4805','σύζυγος','sýzygos','sood\'-zoo-gos','from συζεύγνυμι; co-yoked, i.e. (figuratively) as noun, a colleague; probably rather as a proper name; Syzygus, a Christian:--yokefellow.'),
	('G4806','συζωοποιέω','syzōopoiéō','sood-zo-op-oy-eh\'-o','from σύν and ζωοποιέω; to reanimate conjointly with (figuratively):--quicken together with.'),
	('G4807','συκάμινος','sykáminos','soo-kam\'-ee-nos','of Hebrew origin (שִׁקְמָה) in imitation of συκομωραία; a sycamore-fig tree:--sycamine tree.'),
	('G4808','συκῆ','sykē','soo-kay\'','from σῦκον; a fig-tree:--fig tree.'),
	('G4809','συκομωραία','sykomōraía','soo-kom-o-rah\'-yah','from σῦκον and  (the mulberry); the \"sycamore\"-fig tree:--sycamore tree. Compare συκάμινος.'),
	('G4810','σῦκον','sŷkon','soo\'-kon','apparently a primary word; a fig:--fig.'),
	('G4811','συκοφαντέω','sykophantéō','soo-kof-an-teh\'-o','from a compound of σῦκον and a derivative of φαίνω; to be a fig-informer (reporter of the law forbidding the exportation of figs from Greece), \"sycophant\", i.e. (genitive and by extension) to defraud (exact unlawfully, extort):--accuse falsely, take by false accusation.'),
	('G4812','συλαγωγέω','sylagōgéō','soo-lag-ogue-eh\'-o','from the base of συλάω and (the reduplicated form of) ἄγω; to lead away as booty, i.e. (figuratively) seduce:--spoil.'),
	('G4813','συλάω','syláō','soo-lah\'-o','from a derivative of  (to strip; probably akin to αἱρέομαι; compare σκῦλον); to despoil:--rob.'),
	('G4814','συλλαλέω','syllaléō','sool-lal-eh\'-o','from σύν and λαλέω; to talk together, i.e. converse:--commune (confer, talk) with, speak among.'),
	('G4815','συλλαμβάνω','syllambánō','sool-lam-ban\'-o','from σύν and λαμβάνω; to clasp, i.e. seize (arrest, capture); specially, to conceive (literally or figuratively); by implication, to aid:--catch, conceive, help, take.'),
	('G4816','συλλέγω','syllégō','sool-leg\'-o','from σύν and λέγω in its original sense; to collect:--gather (together, up).'),
	('G4817','συλλογίζομαι','syllogízomai','sool-log-id\'-zom-ahee','from σύν and λογίζομαι; to reckon together (with oneself), i.e. deliberate:--reason with.'),
	('G4818','συλλυπέω','syllypéō','sool-loop-eh\'-o','from σύν and λυπέω; to afflict jointly, i.e. (passive) sorrow at (on account of) someone:--be grieved.'),
	('G4819','συμβαίνω','symbaínō','soom-bah\'-ee-no','from σύν and the base of βάσις; to walk (figuratively, transpire) together, i.e. concur (take place):--be(-fall), happen (unto).'),
	('G4820','συμβάλλω','symbállō','soom-bal\'-lo','from σύν and βάλλω; to combine, i.e. (in speaking) to converse, consult, dispute, (mentally) to consider, (by implication) to aid, (personally) to join, attack:--confer, encounter, help, make, meet with, ponder.'),
	('G4821','συμβασιλεύω','symbasileúō','soom-bas-il-yoo\'-o','from σύν and βασιλεύω; to be co-regent (figuratively):--reign with.'),
	('G4822','συμβιβάζω','symbibázō','soom-bib-ad\'-zo','from σύν and  (to force; causative (by reduplication) of the base of βάσις); to drive together, i.e. unite (in association or affection), (mentally) to infer, show, teach:--compact, assuredly gather, intrust, knit together, prove.'),
	('G4823','συμβουλεύω','symbouleúō','soom-bool-yoo\'-o','from σύν and βουλεύω; to give (or take) advice jointly, i.e. recommend, deliberate or determine:--consult, (give, take) counsel (together).'),
	('G4824','συμβούλιον','symboúlion','soom-boo\'-lee-on','neuter of a presumed derivative of σύμβουλος; advisement; specially, a deliberative body, i.e. the provincial assessors or lay-court:--consultation, counsel, council.'),
	('G4825','σύμβουλος','sýmboulos','soom\'-boo-los','from σύν and βουλή; a consultor, i.e. adviser:--counsellor.'),
	('G4826','Συμεών','Symeṓn','soom-eh-one\'','from the same as Σίμων; Symeon (i.e. Shimon), the name of five Israelites:--Simeon, Simon.'),
	('G4827','συμμαθητής','symmathētḗs','soom-math-ay-tace\'','from a compound of σύν and μανθάνω; a co-learner (of Christianity):--fellow disciple.'),
	('G4828','συμμαρτυρέω','symmartyréō','soom-mar-too-reh\'-o','from σύν and μαρτυρέω; to testify jointly, i.e. corroborate by (concurrent) evidence:--testify unto, (also) bear witness (with).'),
	('G4829','συμμερίζομαι','symmerízomai','soom-mer-id\'-zom-ahee','middle voice from σύν and μερίζω; to share jointly, i.e. participate in:--be partaker with.'),
	('G4830','συμμέτοχος','symmétochos','soom-met\'-okh-os','from σύν and μέτοχος; a co-participant:--partaker.'),
	('G4831','συμμιμητής','symmimētḗs','soom-mim-ay-tace\'','from a presumed compound of σύν and μιμέομαι; a co-imitator, i.e. fellow votary:--follower together.'),
	('G4832','σύμμορφος','sýmmorphos','soom-mor-fos\'','from σύν and μορφή; jointly formed, i.e. (figuratively) similar:--conformed to, fashioned like unto.'),
	('G4833','συμμορφόω','symmorphóō','soom-mor-fo\'-o','from σύμμορφος; to render like, i.e. (figuratively) to assimilate:--make conformable unto.'),
	('G4834','συμπαθέω','sympathéō','soom-path-eh\'-o','from συμπαθής; to feel \"sympathy\" with, i.e. (by implication) to commiserate:--have compassion, be touched with a feeling of.'),
	('G4835','συμπαθής','sympathḗs','soom-path-ace\'','from συμπάσχω; having a fellow-feeling (\"sympathetic\"), i.e. (by implication) mutually commiserative:--having compassion one of another.'),
	('G4836','συμπαραγίνομαι','symparagínomai','soom-par-ag-in\'-om-ahee','from σύν and παραγίνομαι; to be present together, i.e. to convene; by implication, to appear in aid:--come together, stand with.'),
	('G4837','συμπαρακαλέω','symparakaléō','soom-par-ak-al-eh\'-o','from σύν and παρακαλέω; to console jointly:--comfort together.'),
	('G4838','συμπαραλαμβάνω','symparalambánō','soom-par-al-am-ban\'-o','from σύν and παραλαμβάνω; to take along in company:--take with.'),
	('G4839','συμπαραμένω','symparaménō','soom-par-am-en\'-o','from σύν and παραμένω; to remain in company, i.e. still live:--continue with.'),
	('G4840','συμπάρειμι','sympáreimi','soom-par\'-i-mee','from σύν and πάρειμι; to be at hand together, i.e. now present:--be here present with.'),
	('G4841','συμπάσχω','sympáschō','soom-pas\'-kho','from σύν and πάσχω (including its alternate); to experience pain jointly or of the same kind (specially, persecution; to \"sympathize\"):--suffer with.'),
	('G4842','συμπέμπω','sympémpō','soom-pem\'-po','from σύν and πέμπω; to despatch in company:--send with.'),
	('G4843','συμπεριλαμβάνω','symperilambánō','soom-per-ee-lam-ban\'-o','from σύν and a compound of περί and λαμβάνω; to take by enclosing altogether, i.e. earnestly throw the arms about one:--embrace.'),
	('G4844','συμπίνω','sympínō','soom-pee\'-no','from σύν and πίνω; to partake a beverage in company:--drink with.'),
	('G4845','συμπληρόω','symplēróō','soom-play-ro\'-o','from σύν and πληρόω; to implenish completely, i.e. (of space) to swamp (a boat), or (of time) to accomplish (passive, be complete):--(fully) come, fill up.'),
	('G4846','συμπνίγω','sympnígō','soom-pnee\'-go','from σύν and πνίγω; to strangle completely, i.e. (literally) to drown, or (figuratively) to crowd:--choke, throng.'),
	('G4847','συμπολίτης','sympolítēs','soom-pol-ee\'-tace','from σύν and πολίτης; a native of the same town, i.e. (figuratively) co-religionist (fellow-Christian):--fellow- citizen.'),
	('G4848','συμπορεύομαι','symporeúomai','soom-por-yoo\'-om-ahee','from σύν and πορεύομαι; to journey together; by implication, to assemble:--go with, resort.'),
	('G4849','συμπόσιον','sympósion','soom-pos\'-ee-on','neuter of a derivative of the alternate of συμπίνω; a drinking-party (\"symposium\"), i.e. (by extension) a room of guests:--company.'),
	('G4850','συμπρεσβύτερος','sympresbýteros','soom-pres-boo\'-ter-os','from σύν and πρεσβύτερος; a co-presbyter:--presbyter, also an elder.'),
	('G4851','συμφέρω','symphérō','soom-fer\'-o','from σύν and φέρω (including its alternate); to bear together (contribute), i.e. (literally) to collect, or (figuratively) to conduce; especially (neuter participle as a noun) advantage:--be better for, bring together, be expedient (for), be good, (be) profit(-able for).'),
	('G4852','σύμφημι','sýmphēmi','soom\'-fay-mee','from σύν and φημί; to say jointly, i.e. assent to:--consent unto.'),
	('G4853','συμφυλέτης','symphylétēs','soom-foo-let\'-ace','from σύν and a derivative of φυλή; a co-tribesman, i.e. native of the same country:--countryman.'),
	('G4854','σύμφυτος','sýmphytos','soom\'-foo-tos','from σύν and a derivative of φύω; grown along with (connate), i.e. (figuratively) closely united to:--planted together.'),
	('G4855','συμφύω','symphýō','soom-foo\'-o','from σύν and φύω; passive, to grow jointly:--spring up with.'),
	('G4856','συμφωνέω','symphōnéō','soom-fo-neh\'-o','from σύμφωνος; to be harmonious, i.e. (figuratively) to accord (be suitable, concur) or stipulate (by compact):--agree (together, with).'),
	('G4857','συμφώνησις','symphṓnēsis','soom-fo\'-nay-sis','from συμφωνέω; accordance:--concord.'),
	('G4858','συμφωνία','symphōnía','soom-fo-nee\'-ah','from σύμφωνος; unison of sound (\"symphony\"), i.e. a concert of instruments (harmonious note):--music.'),
	('G4859','σύμφωνος','sýmphōnos','soom\'-fo-nos','from σύν and φωνή; sounding together (alike), i.e. (figuratively) accordant (neuter as noun, agreement):-- consent.'),
	('G4860','συμψηφίζω','sympsēphízō','soom-psay-fid\'-zo','from σύν and ψηφίζω; to compute jointly:--reckon.'),
	('G4861','σύμψυχος','sýmpsychos','soom\'-psoo-khos','from σύν and ψυχή; co-spirited, i.e. similar in sentiment:--like-minded.'),
	('G4862','σύν','sýn','soon','a primary preposition denoting union; with or together (but much closer than μετά or παρά), i.e. by association, companionship, process, resemblance, possession, instrumentality, addition, etc.:--beside, with. In composition it has similar applications, including completeness.'),
	('G4863','συνάγω','synágō','soon-ag\'-o','from σύν and ἄγω; to lead together, i.e. collect or convene; specially, to entertain (hospitably):--+ accompany, assemble (selves, together), bestow, come together, gather (selves together, up, together), lead into, resort, take in.'),
	('G4864','συναγωγή','synagōgḗ','soon-ag-o-gay\'','from (the reduplicated form of) συνάγω; an assemblage of persons; specially, a Jewish \"synagogue\" (the meeting or the place); by analogy, a Christian church:--assembly, congregation, synagogue.'),
	('G4865','συναγωνίζομαι','synagōnízomai','soon-ag-o-nid\'-zom-ahee','from σύν and ἀγωνίζομαι; to struggle in company with, i.e. (figuratively) to be a partner (assistant):--strive together with.'),
	('G4866','συναθλέω','synathléō','soon-ath-leh\'-o','from σύν and ἀθλέω; to wrestle in company with, i.e. (figuratively) to seek jointly:--labour with, strive together for.'),
	('G4867','συναθροίζω','synathroízō','soon-ath-royd\'-zo','from σύν and  (to hoard); to convene:--call (gather) together.'),
