	('G4869','συναιχμάλωτος','synaichmálōtos','soon-aheekh-mal\'-o-tos','from σύν and αἰχμάλωτος; a co-captive:--fellowprisoner.'),
	('G4870','συνακολουθέω','synakolouthéō','soon-ak-ol-oo-theh\'-o','from σύν and ἀκολουθέω; to accompany:--follow.'),
	('G4871','συναλίζω','synalízō','soon-al-id\'-zo','from σύν and  (to throng); to accumulate, i.e. convene:--assemble together.'),
	('G4872','συναναβαίνω','synanabaínō','soon-an-ab-ah\'-ee-no','from σύν and ἀναβαίνω; to ascend in company with:--come up with.'),
	('G4873','συνανάκειμαι','synanákeimai','soon-an-ak\'-i-mahee','from σύν and ἀνακεῖμαι; to recline in company with (at a meal):--sit (down, at the table, together) with (at meat).'),
	('G4874','συναναμίγνυμι','synanamígnymi','soon-an-am-ig\'-noo-mee','from σύν and a compound of ἀνά and μίγνυμι; to mix up together, i.e. (figurative) associate with:--(have, keep) company (with).'),
	('G4875','συναναπαύομαι','synanapaúomai','soon-an-ap-ow\'-om-ahee','middle from σύν and ἀναπαύω; to recruit oneself in company with:--refresh with.'),
	('G4876','συναντάω','synantáō','soon-an-tah\'-o','from σύν and a derivative of ἀντί; to meet with; figuratively, to occur:--befall, meet.'),
	('G4877','συνάντησις','synántēsis','soon-an\'-tay-sis','from συναντάω; a meeting with:--meet.'),
	('G4878','συναντιλαμβάνομαι','synantilambánomai','soon-an-tee-lam-ban\'-om-ahee','from σύν and ἀντιλαμβάνομαι; to take hold of opposite together, i.e. co-operate (assist):--help.'),
