	('G4880','συναποθνήσκω','synapothnḗskō','soon-ap-oth-nace\'-ko','from σύν and ἀποθνήσκω; to decease (literally) in company with, or (figuratively), similarly to:--be dead (die) with.'),
	('G4881','συναπόλλυμι','synapóllymi','soon-ap-ol\'-loo-mee','from σύν and ἀπόλλυμι; to destroy (middle voice or passively, be slain) in company with:--perish with.'),
	('G4882','συναποστέλλω','synapostéllō','soon-ap-os-tel\'-lo','from σύν and ἀποστέλλω; to despatch (on an errand) in company with:--send with.'),
	('G4883','συναρμολογέω','synarmologéō','soon-ar-mol-og-eh\'-o','from σύν and a derivative of a compound of ἁρμός and λέγω (in its original sense of laying); to render close-jointed together, i.e. organize compactly:--be fitly framed (joined) together.'),
	('G4884','συναρπάζω','synarpázō','soon-ar-pad\'-zo','from σύν and ἁρπάζω; to snatch together, i.e. seize:--catch.'),
	('G4885','συναυξάνω','synauxánō','soon-owx-an\'-o','from σύν and αὐξάνω; to increase (grow up) together:--grow together.'),
	('G4886','σύνδεσμος','sýndesmos','soon\'-des-mos','from σύν and δεσμόν; a joint tie, i.e. ligament, (figuratively) uniting principle, control:--band, bond.'),
