	('G4891','συνεγείρω','synegeírō','soon-eg-i\'-ro','from σύν and ἐγείρω; to rouse (from death) in company with, i.e. (figuratively) to revivify (spirtually) in resemblance to:--raise up together, rise with.'),
	('G4892','συνέδριον','synédrion','soon-ed\'-ree-on','neuter of a presumed derivative of a compound of σύν and the base of ἑδραῖος; a joint session, i.e. (specially), the Jewish Sanhedrin; by analogy, a subordinate tribunal:--council.'),
	('G4893','συνείδησις','syneídēsis','soon-i\'-day-sis','from a prolonged form of συνείδω; co-perception, i.e. moral consciousness:--conscience.'),
