	('G4895','σύνειμι','sýneimi','soon\'-i-mee','from σύν and εἰμί (including its various inflections); to be in company with, i.e. present at the time:--be with.'),
	('G4896','σύνειμι','sýneimi','soon\'-i-mee','from σύν and  (to go); to assemble:--gather together.'),
	('G4897','συνεισέρχομαι','syneisérchomai','soon-ice-er\'-khom-ahee','from σύν and εἰσέρχομαι; to enter in company with:--go in with, go with into.'),
	('G4898','συνέκδημος','synékdēmos','soon-ek\'-day-mos','from σύν and the base of ἐκδημέω; a co-absentee from home, i.e. fellow-traveller:--companion in travel, travel with.'),
	('G4899','συνεκλεκτός','syneklektós','soon-ek-lek-tos\'','from a compound of σύν and ἐκλέγομαι; chosen in company with, i.e. co-elect (fellow Christian):--elected together with.'),
