	('G4902','συνέπομαι','synépomai','soon-ep\'-om-ahee','middle voice from σύν and a primary  (to follow); to attend (travel) in company with:--accompany.'),
	('G4903','συνεργέω','synergéō','soon-erg-eh\'-o','from συνεργός; to be a fellow-worker, i.e. co-operate:--help (work) with, work(-er) together.'),
