	('G4905','συνέρχομαι','synérchomai','soon-er\'-khom-ahee','from σύν and ἔρχομαι; to convene, depart in company with, associate with, or (specially), cohabit (conjugally):--accompany, assemble (with), come (together), come (company, go) with, resort.'),
	('G4906','συνεσθίω','synesthíō','soon-es-thee\'-o','from σύν and ἐσθίω (including its alternate); to take food in company with:--eat with.'),
	('G4907','σύνεσις','sýnesis','soon\'-es-is','from συνίημι; a mental putting together, i.e. intelligence or (concretely) the intellect:--knowledge, understanding.'),
	('G4908','συνετός','synetós','soon-et\'-os','from συνίημι; mentally put (or putting) together, i.e. sagacious:--prudent. Compare φρόνιμος.'),
	('G4909','συνευδοκέω','syneudokéō','soon-yoo-dok-eh\'-o','from σύν and εὐδοκέω; to think well of in common, i.e. assent to, feel gratified with:--allow, assent, be pleased, have pleasure.'),
	('G4910','συνευωχέω','syneuōchéō','soon-yoo-o-kheh\'-o','from σύν and a derivative of a presumed compound of εὖ and a derivative of ἔχω (meaning to be in good condition, i.e. (by implication) to fare well, or feast); to entertain sumptuously in company with, i.e. (middle voice or passive) to revel together:--feast with.'),
	('G4911','συνεφίστημι','synephístēmi','soon-ef-is\'-tay-mee','from σύν and ἐφίστημι; to stand up together, i.e. to resist (or assault) jointly:--rise up together.'),
