	('G4915','συνηλικιώτης','synēlikiṓtēs','soon-ay-lik-ee-o\'-tace','from σύν and a derivative of ἡλικία; a co-aged person, i.e. alike in years:--equal.'),
	('G4916','συνθάπτω','syntháptō','soon-thap\'-to','from σύν and θάπτω; to inter in company with, i.e. (figuratively) to assimilate spiritually (to Christ by a sepulture as to sin):--bury with.'),
	('G4917','συνθλάω','synthláō','soon-thlah\'-o','from σύν and thlao (to crush); to dash together, i.e. shatter:--break.'),
	('G4918','συνθλίβω','synthlíbō','soon-thlee\'-bo','from σύν and θλίβω; to compress, i.e. crowd on all sides:--throng.'),
	('G4919','συνθρύπτω','synthrýptō','soon-throop\'-to','from σύν and  (to crumble); to crush together, i.e. (figuratively) to dispirit:--break.'),
	('G4920','συνίημι','syníēmi','soon-ee\'-ay-mee','from σύν and  (to send); to put together, i.e. (mentally) to comprehend; by implication, to act piously:-- consider, understand, be wise.'),
	('G4921','συνιστάω','synistáō','soon-is\'-tay-mee','from σύν and ἵστημι (including its collateral forms); to set together, i.e. (by implication) to introduce (favorably), or (figuratively) to exhibit; intransitively, to stand near, or (figuratively) to constitute:--approve, commend, consist, make, stand (with).'),
	('G4922','συνοδεύω','synodeúō','soon-od-yoo\'-o','from σύν and ὁδεύω; to travel in company with:--journey with.'),
	('G4923','συνοδία','synodía','soon-od-ee\'-ah','from a compound of σύν and ὁδός (\"synod\"); companionship on a journey, i.e. (by implication), a caravan:--company.'),
	('G4924','συνοικέω','synoikéō','soon-oy-keh\'-o','from σύν and οἰκέω; to reside together (as a family):--dwell together.'),
	('G4925','συνοικοδομέω','synoikodoméō','soon-oy-kod-om-eh\'-o','from σύν and οἰκοδομέω; to construct, i.e. (passively) to compose (in company with other Christians, figuratively):--build together.'),
	('G4926','συνομιλέω','synomiléō','soon-om-il-eh\'-o','from σύν and ὁμιλέω; to converse mutually:--talk with.'),
	('G4927','συνομορέω','synomoréō','soon-om-or-eh\'-o','from σύν and a derivative of a compound of the base of 3674 and the base of ὅριον; to border together, i.e. adjoin:--join hard.'),
	('G4928','συνοχή','synochḗ','soon-okh-ay\'','from συνέχω; restraint, i.e. (figuratively) anxiety:--anguish, distress.'),
