	('G5088','τίκτω','tíktō','tek\'-o','a strengthened form of a primary   (which is used only as alternate in certain tenses); to produce (from seed, as a mother, a plant, the earth, etc.), literally or figuratively:--bear, be born, bring forth, be delivered, be in travail.'),
