	('G5176','τρώγω','trṓgō','tro\'-go','probably strengthened from a collateral form of the base of τραῦμα and τρίβος through the idea of corrosion or wear; or perhaps rather of a base of τρυγών and τρίζω through the idea of a craunching sound; to gnaw or chew, i.e. (generally) to eat:--eat.'),
	('G5177','τυγχάνω','tynchánō','toong-khan\'-o','probably for an obsolete  (for which the middle voice of another alternate  (to make ready or bring to pass) is used in certain tenses; akin to the base of τίκτω through the idea of effecting; properly, to affect; or (specially), to hit or light upon (as a mark to be reached), i.e. (transitively) to attain or secure an object or end, or (intransitively) to happen (as if meeting with); but in the latter application only impersonal (with εἰ), i.e. perchance; or (present participle) as adjective, usual (as if commonly met with, with οὐ, extraordinary), neuter (as adverb) perhaps; or (with another verb) as adverb, by accident (as it were):--be, chance, enjoy, little, obtain, X refresh…self, + special. Compare τύπτω.'),
	('G5178','τυμπανίζω','tympanízō','toom-pan-id\'-zo','from a derivative of τύπτω (meaning a drum, \"tympanum\"); to stretch on an instrument of torture resembling a drum, and thus beat to death:--torture.'),
	('G5179','τύπος','týpos','too\'-pos','from τύπτω; a die (as struck), i.e. (by implication) a stamp or scar; by analogy, a shape, i.e. a statue, (figuratively) style or resemblance; specially, a sampler (\"type\"), i.e. a model (for imitation) or instance (for warning):--en-(ex-)ample, fashion, figure, form, manner, pattern, print.'),
	('G5180','τύπτω','týptō','toop\'-to','a primary verb (in a strengthened form); to \"thump\", i.e. cudgel or pummel (properly, with a stick or bastinado), but in any case by repeated blows; thus differing from παίω and πατάσσω, which denote a (usually single) blow with the hand or any instrument, or πλήσσω with the fist (or a hammer), or ῥαπίζω with the palm; as well as from τυγχάνω, an accidental collision); by implication, to punish; figuratively, to offend (the conscience):--beat, smite, strike, wound.'),
	('G5181','Τύραννος','Týrannos','too\'-ran-nos','a provincial form of the derivative of the base of κύριος; a \"tyrant\"; Tyrannus, an Ephesian:--Tyrannus.'),
	('G5182','τυρβάζω','tyrbázō','toor-bad\'-zo','from  (Latin turba, a crowd; akin to θόρυβος); to make \"turbid\", i.e. disturb:--trouble.'),
	('G5183','Τύριος','Týrios','too\'-ree-os','from Τύρος; a Tyrian, i.e. inhabitant of Tyrus:--of Tyre.'),
	('G5184','Τύρος','Týros','too\'-ros','of Hebrew origin (צֹר): Tyrus (i.e. Tsor), a place in Palestine:--Tyre.'),
	('G5185','τυφλός','typhlós','toof-los\'','from, τυφόω; opaque (as if smoky), i.e. (by analogy) blind (physically or mentally):--blind.'),
	('G5186','τυφλόω','typhlóō','toof-lo\'-o','from τυφλός; to make blind, i.e. (figuratively) to obscure:--blind.'),
	('G5187','τυφόω','typhóō','toof-o\'-o','from a derivative of τύφω; to envelop with smoke, i.e. (figuratively) to inflate with self-conceit:--high-minded, be lifted up with pride, be proud.'),
	('G5188','τύφω','týphō','too\'-fo','apparently a primary verb; to make a smoke, i.e. slowly consume without flame:--smoke.'),
	('G5189','τυφωνικός','typhōnikós','too-fo-nee-kos\'','from a derivative of τύφω; stormy (as if smoky):--tempestuous.'),
	('G5190','Τυχικός','Tychikós','too-khee-kos\'','from a derivative of τυγχάνω; fortuitous, i.e. fortunate; Tychicus, a Christian:--Tychicus.'),
	('G5191','ὑακίνθινος','hyakínthinos','hoo-ak-in\'-thee-nos','from ὑάκινθος; \"hyacinthine\" or \"jacinthine\", i.e. deep blue:--jacinth.'),
	('G5192','ὑάκινθος','hyákinthos','hoo-ak\'-in-thos','of uncertain derivation; the \"hyacinth\" or \"jacinth\", i.e. some gem of a deep blue color, probably the zirkon:-- jacinth.'),
	('G5193','ὑάλινος','hyálinos','hoo-al\'-ee-nos','from ὕαλος; glassy, i.e. transparent:--of glass.'),
	('G5194','ὕαλος','hýalos','hoo\'-al-os','perhaps from the same as ὑετός (as being transparent like rain); glass:--glass.'),
	('G5195','ὑβρίζω','hybrízō','hoo-brid\'-zo','from ὕβρις; to exercise violence, i.e. abuse:--use despitefully, reproach, entreat shamefully (spitefully).'),
	('G5196','ὕβρις','hýbris','hoo\'-bris','from ὑπέρ; insolence (as over-bearing), i.e. insult, injury:--harm, hurt, reproach.'),
	('G5197','ὑβριστής','hybristḗs','hoo-bris-tace\'','from ὑβρίζω; an insulter, i.e. maltreater:--despiteful, injurious.'),
	('G5198','ὑγιαίνω','hygiaínō','hoog-ee-ah\'-ee-no','from ὑγιής; to have sound health, i.e. be well (in body); figuratively, to be uncorrupt (true in doctrine):--be in health, (be safe and) sound, (be) whole(-some).'),
	('G5199','ὑγιής','hygiḗs','hoog-ee-ace\'','from the base of αὐξάνω; healthy, i.e. well (in body); figuratively, true (in doctrine):--sound, whole.'),
	('G5200','ὑγρός','hygrós','hoo-gros\'','from the base of ὑετός; wet (as if with rain), i.e. (by implication) sappy (fresh):--green.'),
	('G5201','ὑδρία','hydría','hoo-dree-ah\'','from ὕδωρ; a water-jar, i.e. receptacle for family supply:--water-pot.'),
	('G5202','ὑδροποτέω','hydropotéō','hoo-drop-ot-eh\'-o','from a compound of ὕδωρ and a derivative of πίνω; to be a water-drinker, i.e. to abstain from vinous beverages:--drink water.'),
	('G5203','ὑδρωπικός','hydrōpikós','hoo-dro-pik-os\'','from a compound of ὕδωρ and a derivative of ὀπτάνομαι (as if looking watery); to be \"dropsical\":--have the dropsy.'),
	('G5204','ὕδωρ','hýdōr','hoo\'-dat-os','from the base of ὑετός; water (as if rainy) literally or figuratively:--water.'),
	('G5205','ὑετός','hyetós','hoo-et-os\'','from a primary  (to rain); rain, especially a shower:--rain.'),
	('G5206','υἱοθεσία','huiothesía','hwee-oth-es-ee\'-ah','from a presumed compound of υἱός and a derivative of τίθημι; the placing as a son, i.e. adoption (figuratively, Christian sonship in respect to God):--adoption (of children, of sons).'),
	('G5207','υἱός','huiós','hwee-os\'','apparently a primary word; a \"son\" (sometimes of animals), used very widely of immediate, remote or figuratively, kinship:--child, foal, son.'),
	('G5208','ὕλη','hýlē','hoo-lay\'','perhaps akin to ξύλον; a forest, i.e. (by implication) fuel:--matter.'),
	('G5209','ὑμᾶς','hymâs','hoo-mas\'','accusative case of ὑμεῖς; you (as the objective of a verb or preposition):--ye, you (+ -ward), your (+ own).'),
	('G5210','ὑμεῖς','hymeîs','hoo-mice\'','irregular plural of σύ; you (as subjective of verb):--ye (yourselves), you.'),
	('G5211','Ὑμεναῖος','Hymenaîos','hoo-men-ah\'-yos','from  (the god of weddings); \"hymenæal\"; Hymenæus, an opponent of Christianity:--Hymenæus.'),
	('G5212','ὑμέτερος','hyméteros','hoo-met\'-er-os','from ὑμεῖς; yours, i.e. pertaining to you:--your (own).'),
	('G5213','ὑμῖν','hymîn','hoo-min\'','irregular dative case of ὑμεῖς; to (with or by) you:--ye, you, your(-selves).'),
	('G5214','ὑμνέω','hymnéō','hoom-neh\'-o','from ὕμνος; to hymn, i.e. sing a religious ode; by implication, to celebrate (God) in song:--sing a hymn (praise unto).'),
	('G5215','ὕμνος','hýmnos','hoom\'-nos','apparently from a simpler (obsolete) form of  (to celebrate; probably akin to ᾄδω; compare עֲבוֹט); a \"hymn\" or religious ode (one of the Psalms):--hymn.'),
	('G5216','ὑμῶν','hymōn','hoo-mone\'','genitive case of ὑμεῖς; of (from or concerning) you:--ye, you, your (own, -selves).'),
	('G5217','ὑπάγω','hypágō','hoop-ag\'-o','from ὑπό and ἄγω; to lead (oneself) under, i.e. withdraw or retire (as if sinking out of sight), literally or figuratively:--depart, get hence, go (a-)way.'),
	('G5218','ὑπακοή','hypakoḗ','hoop-ak-o-ay\'','from ὑπακούω; attentive hearkening, i.e. (by implication) compliance or submission:--obedience, (make) obedient, obey(-ing).'),
	('G5219','ὑπακούω','hypakoúō','hoop-ak-oo\'-o','from ὑπό and ἀκούω; to hear under (as a subordinate), i.e. to listen attentively; by implication, to heed or conform to a command or authority:--hearken, be obedient to, obey.'),
	('G5220','ὕπανδρος','hýpandros','hoop\'-an-dros','from ὑπό and ἀνήρ; in subjection under a man, i.e. a married woman:--which hath an husband.'),
	('G5221','ὑπαντάω','hypantáō','hoop-an-tah\'-o','from ὑπό and a derivative of ἀντί; to go opposite (meet) under (quietly), i.e. to encounter, fall in with:--(go to) meet.'),
	('G5222','ὑπάντησις','hypántēsis','hoop-an\'-tay-sis','from ὑπαντάω; an encounter or concurrence (with εἰς for infinitive, in order to fall in with):--meeting.'),
	('G5223','ὕπαρξις','hýparxis','hoop\'-arx-is','from ὑπάρχω; existency or proprietorship, i.e. (concretely) property, wealth:--goods, substance.'),
	('G5224','ὑπάρχοντα','hypárchonta','hoop-ar\'-khon-tah','neuter plural of present participle active of ὑπάρχω as noun; things extant or in hand, i.e. property or possessions:--goods, that which one has, things which (one) possesseth, substance, that hast.'),
	('G5225','ὑπάρχω','hypárchō','hoop-ar\'-kho','from ὑπό and ἄρχομαι; to begin under (quietly), i.e. come into existence (be present or at hand); expletively, to exist (as copula or subordinate to an adjective, participle, adverb or preposition, or as an auxiliary to a principal (verb):--after, behave, live.'),
	('G5226','ὑπείκω','hypeíkō','hoop-i\'-ko','from ὑπό and  (to yield, be \"weak\"); to surrender:--submit self.'),
	('G5227','ὑπεναντίος','hypenantíos','hoop-en-an-tee\'-os','from ὑπό and ἐναντίος; under (covertly) contrary to, i.e. opposed or (as noun) an opponent:--adversary, against.'),
	('G5228','ὑπέρ','hypér','hoop-er\'','a primary preposition; \"over\", i.e. (with the genitive case) of place, above, beyond, across, or causal, for the sake of, instead, regarding; with the accusative case superior to, more than:--(+ exceeding, abundantly) above, in (on) behalf of, beyond, by, + very chiefest, concerning, exceeding (above, -ly), for, + very highly, more (than), of, over, on the part of, for sake of, in stead, than, to(-ward), very. In the comparative, it retains many of the above applications.'),
	('G5229','ὑπεραίρομαι','hyperaíromai','hoop-er-ah\'-ee-rom-ahee','middle voice from ὑπέρ and αἴρω; to raise oneself over, i.e. (figuratively) to become haughty:--exalt self, be exalted above measure.'),
	('G5230','ὑπέρακμος','hypérakmos','hoop-er\'-ak-mos','from ὑπέρ and the base of ἀκμήν; beyond the \"acme\", i.e. figuratively (of a daughter) past the bloom (prime) of youth:--+ pass the flower of (her) age.'),
	('G5231','ὑπεράνω','hyperánō','hoop-er-an\'-o','from ὑπέρ and ἄνω; above upward, i.e. greatly higher (in place or rank):--far above, over.'),
	('G5232','ὑπεραυξάνω','hyperauxánō','hoop-er-owx-an\'-o','from ὑπέρ and αὐξάνω; to increase above ordinary degree:--grow exceedingly.'),
	('G5233','ὑπερβαίνω','hyperbaínō','hoop-er-bah\'-ee-no','from ὑπέρ and the base of βάσις; to transcend, i.e. (figuratively) to overreach:--go beyond.'),
	('G5234','ὑπερβαλλόντως','hyperballóntōs','hoop-er-bal-lon\'-toce','adverb from present participle active of ὑπερβάλλω; excessively:--beyond measure.'),
	('G5235','ὑπερβάλλω','hyperbállō','hoop-er-bal\'-lo','from ὑπέρ and βάλλω; to throw beyod the usual mark, i.e. (figuratively) to surpass (only active participle supereminent):--exceeding, excel, pass.'),
	('G5236','ὑπερβολή','hyperbolḗ','hoop-er-bol-ay\'','from ὑπερβάλλω; a throwing beyond others, i.e. (figuratively) supereminence; adverbially (with εἰς or κατά) pre- eminently:--abundance, (far more) exceeding, excellency, more excellent, beyond (out of) measure.'),
	('G5237','ὑπερείδω','hypereídō','hoop-er-i\'-do','from ὑπέρ and εἴδω; to overlook, i.e. not punish:--wink at.'),
	('G5238','ὑπερέκεινα','hyperékeina','hoop-er-ek\'-i-nah','from ὑπέρ and the neuter plural of ἐκεῖνος; above those parts, i.e. still farther:--beyond.'),
	('G5239','ὑπερεκτείνω','hyperekteínō','hoop-er-ek-ti\'-no','from ὑπέρ and ἐκτείνω; to extend inordinately:--stretch beyond.'),
	('G5240','ὑπερεκχύνω','hyperekchýnō','hoop-er-ek-khoo\'-no','from ὑπέρ and the alternate form of ἐκχέω; to pour out over, i.e. (passively) to overflow:--run over.'),
	('G5241','ὑπερεντυγχάνω','hyperentynchánō','hoop-er-en-toong-khan\'-o','from ὑπέρ and ἐντυγχάνω; to intercede in behalf of:--make intercession for.'),
	('G5242','ὑπερέχω','hyperéchō','hoop-er-ekh\'-o','from ὑπέρ and ἔχω; to hold oneself above, i.e. (figuratively) to excel; participle (as adjective, or neuter as noun) superior, superiority:--better, excellency, higher, pass, supreme.'),
	('G5243','ὑπερηφανία','hyperēphanía','hoop-er-ay-fan-ee\'-ah','from ὑπερήφανος; haughtiness:--pride.'),
	('G5244','ὑπερήφανος','hyperḗphanos','hoop-er-ay\'-fan-os','from ὑπέρ and φαίνω; appearing above others (conspicuous), i.e. (figuratively) haughty:--proud.'),
	('G5245','ὑπερνικάω','hypernikáō','hoop-er-nik-ah\'-o','from ὑπέρ and νικάω; to vanquish beyond, i.e. gain a decisive victory:--more than conquer.'),
	('G5246','ὑπέρογκος','hypéronkos','hoop-er\'-ong-kos','from ὑπέρ and ὄγκος; bulging over, i.e. (figuratively) insolent:--great swelling.'),
	('G5247','ὑπεροχή','hyperochḗ','hoop-er-okh-ay\'','from ὑπερέχω; prominence, i.e. (figuratively) superiority (in rank or character):--authority, excellency.'),
	('G5248','ὑπερπερισσεύω','hyperperisseúō','hoop-er-per-is-syoo\'-o','from ὑπέρ and περισσεύω; to super-abound:--abound much more, exceeding.'),
	('G5249','ὑπερπερισσῶς','hyperperissōs','hoop-er-per-is-soce\'','from ὑπέρ and περισσῶς; superabundantly, i.e. exceedingly:--beyond measure.'),
	('G5250','ὑπερπλεονάζω','hyperpleonázō','hoop-er-pleh-on-ad\'-zo','from ὑπέρ and πλεονάζω; to superabound:--be exceeding abundant.'),
	('G5251','ὑπερυψόω','hyperypsóō','hoop-er-oop-so\'-o','from ὑπέρ and ὑψόω; to elevate above others, i.e. raise to the highest position:--highly exalt.'),
	('G5252','ὑπερφρονέω','hyperphronéō','hoop-er-fron-eh\'-o','from ὑπέρ and φρονέω; to esteem oneself overmuch, i.e. be vain or arrogant:--think more highly.'),
	('G5253','ὑπερῷον','hyperōion','hoop-er-o\'-on','neuter of a derivative of ὑπέρ; a higher part of the house, i.e. apartment in the third story:--upper chamber (room).'),
	('G5254','ὑπέχω','hypéchō','hoop-ekh\'-o','from ὑπό and ἔχω; to hold oneself under, i.e. endure with patience:--suffer.'),
	('G5255','ὑπήκοος','hypḗkoos','hoop-ay\'-ko-os','from ὑπακούω; attentively listening, i.e. (by implication) submissive:--obedient.'),
	('G5256','ὑπηρετέω','hypēretéō','hoop-ay-ret-eh\'-o','from ὑπηρέτης; to be a subordinate, i.e. (by implication) subserve:--minister (unto), serve.'),
	('G5257','ὑπηρέτης','hypērétēs','hoop-ay-ret\'-ace','from ὑπό and a derivative of  (to row); an under-oarsman, i.e. (generally) subordinate (assistant, sexton, constable):--minister, officer, servant.'),
	('G5258','ὕπνος','hýpnos','hoop\'-nos','from an obsolete primary (perhaps akin to ὑπό through the idea of subsilience); sleep, i.e. (figuratively) spiritual torpor:--sleep.'),
	('G5259','ὑπό','hypó','hoop-o\'','a primary preposition; under, i.e. (with the genitive case) of place (beneath), or with verbs (the agency or means, through); (with the accusative case) of place (whither (underneath) or where (below) or time (when (at)):--among, by, from, in, of, under, with. In the comparative, it retains the same general applications, especially of inferior position or condition, and specially, covertly or moderately.'),
	('G5260','ὑποβάλλω','hypobállō','hoop-ob-al\'-lo','from ὑπό and βάλλω; to throw in stealthily, i.e. introduce by collusion:--suborn.'),
	('G5261','ὑπογραμμός','hypogrammós','hoop-og-ram-mos\'','from a compound of ὑπό and γράφω; an underwriting, i.e. copy for imitation (figuratively):--example.'),
	('G5262','ὑπόδειγμα','hypódeigma','hoop-od\'-igue-mah','from ὑποδείκνυμι; an exhibit for imitation or warning (figuratively, specimen, adumbration):--en-(ex-)ample, pattern.'),
	('G5263','ὑποδείκνυμι','hypodeíknymi','hoop-od-ike\'-noo-mee','from ὑπό and δεικνύω; to exhibit under the eyes, i.e. (figuratively) to exemplify (instruct, admonish):--show, (fore-)warn.'),
	('G5264','ὑποδέχομαι','hypodéchomai','hoop-od-ekh\'-om-ahee','from ὑπό and δέχομαι; to admit under one\'s roof, i.e. entertain hospitably:--receive.'),
	('G5265','ὑποδέω','hypodéō','hoop-od-eh\'-o','from ὑπό and δέω; to bind under one\'s feet, i.e. put on shoes or sandals:--bind on, (be) shod.'),
	('G5266','ὑπόδημα','hypódēma','hoop-od\'-ay-mah','from ὑποδέω; something bound under the feet, i.e. a shoe or sandal:--shoe.'),
	('G5267','ὑπόδικος','hypódikos','hoop-od\'-ee-kos','from ὑπό and δίκη; under sentence, i.e. (by implication) condemned:--guilty.'),
	('G5268','ὑποζύγιον','hypozýgion','hoop-od-zoog\'-ee-on','neuter of a compound of ὑπό and ζυγός; an animal under the yoke (draught-beast), i.e. (specially), a donkey:--ass.'),
	('G5269','ὑποζώννυμι','hypozṓnnymi','hoop-od-zone\'-noo-mee','from ὑπό and ζώννυμι; to gird under, i.e. frap (a vessel with cables across the keel, sides and deck):--undergirt.'),
	('G5270','ὑποκάτω','hypokátō','hoop-ok-at\'-o','from ὑπό and κάτω; down under, i.e. beneath:--under.'),
	('G5271','ὑποκρίνομαι','hypokrínomai','hoop-ok-rin\'-om-ahee','middle voice from ὑπό and κρίνω; to decide (speak or act) under a false part, i.e. (figuratively) dissemble (pretend):--feign.'),
	('G5272','ὑπόκρισις','hypókrisis','hoop-ok\'-ree-sis','from ὑποκρίνομαι; acting under a feigned part, i.e. (figuratively) deceit (\"hypocrisy\"):--condemnation, dissimulation, hypocrisy.'),
	('G5273','ὑποκριτής','hypokritḗs','hoop-ok-ree-tace\'','from ὑποκρίνομαι; an actor under an assumed character (stage-player), i.e. (figuratively) a dissembler (\"hypocrite\":--hypocrite.'),
	('G5274','ὑπολαμβάνω','hypolambánō','hoop-ol-am-ban\'-o','from ὑπό and λαμβάνω; to take from below, i.e. carry upward; figuratively, to take up, i.e. continue a discourse or topic; mentally, to assume (presume):--answer, receive, suppose.'),
	('G5275','ὑπολείπω','hypoleípō','hoop-ol-i\'-po','from ὑποτρέχω and λείπω; to leave under (behind), i.e. (passively) to remain (survive):--be left.'),
	('G5276','ὑπολήνιον','hypolḗnion','hoop-ol-ay\'-nee-on','neuter of a presumed compound of ὑπό and ληνός; vessel or receptacle under the press, i.e. lower wine-vat:--winefat.'),
	('G5277','ὑπολιμπάνω','hypolimpánō','hoop-ol-im-pan\'-o','a prolonged form for ὑπολείπω; to leave behind, i.e. bequeath:--leave.'),
	('G5278','ὑπομένω','hypoménō','hoop-om-en\'-o','from ὑπό and μένω; to stay under (behind), i.e. remain; figuratively, to undergo, i.e. bear (trials), have fortitude, persevere:--abide, endure, (take) patient(-ly), suffer, tarry behind.'),
	('G5279','ὑπομιμνήσκω','hypomimnḗskō','hoop-om-im-nace\'-ko','from ὑπό and μιμνήσκω; to remind quietly, i.e. suggest to the (middle voice, one\'s own) memory:--put in mind, remember, bring to (put in) remembrance.'),
	('G5280','ὑπόμνησις','hypómnēsis','hoop-om\'-nay-sis','from ὑπομιμνήσκω; a reminding or (reflexively) recollection:--remembrance.'),
	('G5281','ὑπομονή','hypomonḗ','hoop-om-on-ay\'','from ὑπομένω; cheerful (or hopeful) endurance, constancy:--enduring, patience, patient continuance (waiting).'),
	('G5282','ὑπονοέω','hyponoéō','hoop-on-o-eh\'-o','from ὑπό and νοιέω; to think under (privately), i.e. to surmise or conjecture:--think, suppose, deem.'),
	('G5283','ὑπόνοια','hypónoia','hoop-on\'-oy-ah','from ὑπονοέω; suspicion:--surmising.'),
	('G5284','ὑποπλέω','hypopléō','hoop-op-leh\'-o','from ὑπό and πλέω; to sail under the lee of:--sail under.'),
	('G5285','ὑποπνέω','hypopnéō','hoop-op-neh\'-o','from ὑπό and πνέω; to breathe gently, i.e. breeze:--blow softly.'),
	('G5286','ὑποπόδιον','hypopódion','hoop-op-od\'-ee-on','neuter of a compound of ὑπό and πούς; something under the feet, i.e. a foot-rest (figuratively):--footstool.'),
	('G5287','ὑπόστασις','hypóstasis','hoop-os\'-tas-is','from a compound of ὑπό and ἵστημι; a setting under (support), i.e. (figuratively) concretely, essence, or abstractly, assurance (objectively or subjectively):--confidence, confident, person, substance.'),
	('G5288','ὑποστέλλω','hypostéllō','hoop-os-tel\'-lo','from ὑπό and στέλλω; to withhold under (out of sight), i.e. (reflexively) to cower or shrink, (figuratively) to conceal (reserve):--draw (keep) back, shun, withdraw.'),
	('G5289','ὑποστολή','hypostolḗ','hoop-os-tol-ay\'','from ὑποστέλλω; shrinkage (timidity), i.e. (by implication) apostasy:--draw back.'),
	('G5290','ὑποστρέφω','hypostréphō','hoop-os-tref\'-o','from ὑπό and στρέφω; to turn under (behind), i.e. to return (literally or figuratively):--come again, return (again, back again), turn back (again).'),
	('G5291','ὑποστρώννυμι','hypostrṓnnymi','hoop-os-trone\'-noo-mee','from ὑπό and στρώννυμι; to strew underneath (the feet as a carpet):--spread.'),
	('G5292','ὑποταγή','hypotagḗ','hoop-ot-ag-ay\'','from ὑποτάσσω; subordination:--subjection.'),
	('G5293','ὑποτάσσω','hypotássō','hoop-ot-as\'-so','from ὑπό and τάσσω; to subordinate; reflexively, to obey:--be under obedience (obedient), put under, subdue unto, (be, make) subject (to, unto), be (put) in subjection (to, under), submit self unto.'),
	('G5294','ὑποτίθημι','hypotíthēmi','hoop-ot-ith\'-ay-mee','from ὑπό and τίθημι; to place underneath, i.e. (figuratively) to hazard, (reflexively) to suggest:--lay down, put in remembrance.'),
	('G5295','ὑποτρέχω','hypotréchō','hoop-ot-rekh\'-o','from ὑπό and τρέχω (including its alternate); to run under, i.e. (specially), to sail past:--run under.'),
