	('G5297','ὑποφέρω','hypophérō','hoop-of-er\'-o','from ὑπό and φέρω; to bear from underneath, i.e. (figuratively) to undergo hardship:--bear, endure.'),
	('G5298','ὑποχωρέω','hypochōréō','hoop-okh-o-reh\'-o','from ὑπό and χωρέω; to vacate down, i.e. retire quietly:--go aside, withdraw self.'),
	('G5299','ὑπωπιάζω','hypōpiázō','hoop-o-pee-ad\'-zo','from a compound of ὑπό and a derivative of ὀπτάνομαι; to hit under the eye (buffet or disable an antagonist as a pugilist), i.e. (figuratively) to tease or annoy (into compliance), subdue (one\'s passions):--keep under, weary.'),
	('G5300','ὗς','hŷs','hoos','apparently a primary word; a hog (\"swine\"):--sow.'),
	('G5301','ὕσσωπος','hýssōpos','hoos\'-so-pos','of foreign origin (אֵזוֹב); \"hyssop\":--hyssop.'),
	('G5302','ὑστερέω','hysteréō','hoos-ter-eh\'-o','from ὕστερος; to be later, i.e. (by implication) to be inferior; generally, to fall short (be deficient):--come behind (short), be destitute, fail, lack, suffer need, (be in) want, be the worse.'),
	('G5303','ὑστέρημα','hystérēma','hoos-ter\'-ay-mah','from ὑστερέω; a deficit; specially, poverty:--that which is behind, (that which was) lack(-ing), penury, want.'),
	('G5304','ὑστέρησις','hystérēsis','hoos-ter\'-ay-sis','from ὑστερέω; a falling short, i.e. (specially), penury:--want.'),
	('G5305','ὕστερον','hýsteron','hoos\'-ter-on','neuter of ὕστερος as adverb; more lately, i.e. eventually:--afterward, (at the) last (of all).'),
	('G5306','ὕστερος','hýsteros','hoos\'-ter-os','comparative from ὑπό (in the sense of behind); later:--latter.'),
	('G5307','ὑφαντός','hyphantós','hoo-fan-tos\'','from  to weave; woven, i.e. (perhaps) knitted:--woven.'),
	('G5308','ὑψηλός','hypsēlós','hoop-say-los\'','from ὕψος; lofty (in place or character):--high(-er, -ly) (esteemed).'),
	('G5309','ὑψηλοφρονέω','hypsēlophronéō','hoop-say-lo-fron-eh\'-o','from a compound of ὑψηλός and φρήν; to be lofty in mind, i.e. arrogant:--be highminded.'),
	('G5310','ὕψιστος','hýpsistos','hoop\'-sis-tos','superlative from the base of ὕψος; highest, i.e. (masculine singular) the Supreme (God), or (neuter plural) the heavens:--most high, highest.'),
	('G5311','ὕψος','hýpsos','hoop\'-sos','from a derivative of ὑπέρ; elevation, i.e. (abstractly) altitude, (specially), the sky, or (figuratively) dignity:--be exalted, height, (on) high.'),
