	('G5313','ὕψωμα','hýpsōma','hoop\'-so-mah','from ὑψόω; an elevated place or thing, i.e. (abstractly) altitude, or (by implication) a barrier (figuratively):-- height, high thing.'),
	('G5314','φάγος','phágos','fag\'-os','from φάγω; a glutton:--gluttonous.'),
	('G5315','φάγω','phágō','fag\'-o','a primary verb (used as an alternate of ἐσθίω in certain tenses); to eat (literally or figuratively):--eat, meat.'),
	('G5316','φαίνω','phaínō','fah\'-ee-no','prolongation for the base of φῶς; to lighten (shine), i.e. show (transitive or intransitive, literal or figurative):-- appear, seem, be seen, shine, X think.'),
