	('G5318','φανερός','phanerós','fan-er-os\'','from φαίνω; shining, i.e. apparent (literally or figuratively); neuter (as adverb) publicly, externally:--abroad, + appear, known, manifest, open (+ -ly), outward (+ -ly).'),
	('G5319','φανερόω','phaneróō','fan-er-o\'-o','from φανερός; to render apparent (literally or figuratively):--appear, manifestly declare, (make) manifest (forth), shew (self).'),
