	('G5330','Φαρισαῖος','Pharisaîos','far-is-ah\'-yos','of Hebrew origin (compare פָּרָשׁ); a separatist, i.e. exclusively religious; a Pharisean, i.e. Jewish sectary:--Pharisee.'),
	('G5331','φαρμακεία','pharmakeía','far-mak-i\'-ah','from φαρμακεύς; medication (\"pharmacy\"), i.e. (by extension) magic (literally or figuratively):--sorcery, witchcraft.'),
	('G5332','φαρμακεύς','pharmakeús','far-mak-yoos\'','from  (a drug, i.e. spell-giving potion); a druggist (\"pharmacist\") or poisoner, i.e. (by extension) a magician:--sorcerer.'),
	('G5333','φάρμακος','phármakos','far-mak-os\'','the same as 5332:--sorcerer.'),
	('G5334','φάσις','phásis','fas\'-is','from φημί (not the same as \"phase\", which is from φαίνω); a saying, i.e. report:--tidings.'),
	('G5335','φάσκω','pháskō','fas\'-ko','prolongation from the same as φημί; to assert:--affirm, profess, say.'),
	('G5336','φάτνη','phátnē','fat\'-nay','from  (to eat); a crib (for fodder):--manager, stall.'),
	('G5337','φαῦλος','phaûlos','fow\'-los','apparently a primary word; \"foul\" or \"flawy\", i.e. (figuratively) wicked:--evil.'),
	('G5338','φέγγος','phéngos','feng\'-gos','probably akin to the base of φῶς (compare φθέγγομαι); brilliancy:--light.'),
