	('G5368','φιλέω','philéō','fil-eh\'-o','from φίλος; to be a friend to (fond of (an individual or an object)), i.e. have affection for (denoting personal attachment, as a matter of sentiment or feeling; while ἀγαπάω is wider, embracing especially the judgment and the deliberate assent of the will as a matter of principle, duty and propriety: the two thus stand related very much as θέλω and βούλομαι, or as θυμός and νοῦς respectively; the former being chiefly of the heart and the latter of the head); specially, to kiss (as a mark of tenderness):--kiss, love.'),
