	('G5412','φορτίζω','phortízō','for-tid\'-zo','from φόρτος; to load up (properly, as a vessel or animal), i.e. (figuratively) to overburden with ceremony (or spiritual anxiety):--lade, by heavy laden.'),
	('G5413','φορτίον','phortíon','for-tee\'-on','diminutive of φόρτος; an invoice (as part of freight), i.e. (figuratively) a task or service:--burden.'),
	('G5414','φόρτος','phórtos','for\'-tos','from φέρω; something carried, i.e. the cargo of a ship:--lading.'),
	('G5415','Φορτουνᾶτος','Phortounâtos','for-too-nat\'-os','of Latin origin; \"fortunate\"; Fortunatus, a Christian:--Fortunatus.'),
	('G5416','φραγέλλιον','phragéllion','frag-el\'-le-on','neuter of a derivative from the base of φραγελλόω; a whip, i.e. Roman lash as a public punishment:--scourge.'),
	('G5417','φραγελλόω','phragellóō','frag-el-lo\'-o','from a presumed equivalent of the Latin flagellum; to whip, i.e. lash as a public punishment:--scourge.'),
	('G5418','φραγμός','phragmós','frag-mos\'','from φράσσω; a fence, or inclosing barrier (literally or figuratively):--hedge (+ round about), partition.'),
	('G5419','φράζω','phrázō','frad\'-zo','probably akin to φράσσω through the idea of defining; to indicate (by word or act), i.e. (specially), to expound:-- declare.'),
	('G5420','φράσσω','phrássō','fras\'-so','apparently a strengthening form of the base of φρήν; to fence or inclose, i.e. (specially), to block up (figuratively, to silence):--stop.'),
	('G5421','φρέαρ','phréar','freh\'-ar','of uncertain derivation; a hole in the ground (dug for obtaining or holding water or other purposes), i.e. a cistern or well; figuratively, an abyss (as a prison):--well, pit.'),
	('G5422','φρεναπατάω','phrenapatáō','fren-ap-at-ah\'-o','from φρεναπάτης; to be a mind-misleader, i.e. delude:--deceive.'),
	('G5423','φρεναπάτης','phrenapátēs','fren-ap-at\'-ace','from φρήν and ἀπάτη; a mind-misleader, i.e. seducer:--deceiver.'),
	('G5424','φρήν','phrḗn','frane','probably from an obsolete  (to rein in or curb; compare φράσσω); the midrif (as a partition of the body), i.e. (figuratively and by implication, of sympathy) the feelings (or sensitive nature; by extension (also in the plural) the mind or cognitive faculties):--understanding.'),
	('G5425','φρίσσω','phríssō','fris\'-so','apparently a primary verb; to \"bristle\" or chill, i.e. shudder (fear):--tremble.'),
	('G5426','φρονέω','phronéō','fron-eh\'-o','from φρήν; to exercise the mind, i.e. entertain or have a sentiment or opinion; by implication, to be (mentally) disposed (more or less earnestly in a certain direction); intensively, to interest oneself in (with concern or obedience):--set the affection on, (be) care(-ful), (be like-, + be of one, + be of the same, + let this) mind(-ed), regard, savour, think.'),
	('G5427','φρόνημα','phrónēma','fron\'-ay-mah','from φρονέω; (mental) inclination or purpose:--(be, + be carnally, + be spiritually) mind(-ed).'),
	('G5428','φρόνησις','phrónēsis','fron\'-ay-sis','from φρονέω; mental action or activity, i.e. intellectual or moral insight:--prudence, wisdom.'),
	('G5429','φρόνιμος','phrónimos','fron\'-ee-mos','from φρήν; thoughtful, i.e. sagacious or discreet (implying a cautious character; while σοφός denotes practical skill or acumen; and συνετός indicates rather intelligence or mental acquirement); in a bad sense conceited (also in the comparative):--wise(-r).'),
	('G5430','φρονίμως','phronímōs','fron-im\'-oce','adverb from φρόνιμος; prudently:--wisely.'),
	('G5431','φροντίζω','phrontízō','fron-tid\'-zo','from a derivative of φρήν; to exercise thought, i.e. be anxious:--be careful.'),
	('G5432','φρουρέω','phrouréō','froo-reh\'-o','from a compound of πρό and ὁράω; to be a watcher in advance, i.e. to mount guard as a sentinel (post spies at gates); figuratively, to hem in, protect:--keep (with a garrison). Compare τηρέω.'),
	('G5433','φρυάσσω','phryássō','froo-as\'-so','akin to βρύω, βρύχω; to snort (as a spirited horse), i.e. (figuratively) to make a tumult:--rage.'),
	('G5434','φρύγανον','phrýganon','froo\'-gan-on','neuter of a presumed derivative of  (to roast or parch; akin to the base of φλόξ); something desiccated, i.e. a dry twig:--stick.'),
	('G5435','Φρυγία','Phrygía','froog-ee\'-ah','probably of foreign origin; Phrygia, a region of Asia Minor:--Phrygia.'),
	('G5436','Φύγελλος','Phýgellos','foog\'-el-los','probably from φεύγω; fugitive; Phygellus, an apostate Christian:--Phygellus.'),
	('G5437','φυγή','phygḗ','foog-ay\'','from φεύγω; a fleeing, i.e. escape:--flight.'),
	('G5438','φυλακή','phylakḗ','foo-lak-ay\'','from φυλάσσω; a guarding or (concretely, guard), the act, the person; figuratively, the place, the condition, or (specially), the time (as a division of day or night), literally or figuratively:--cage, hold, (im-)prison(-ment), ward, watch.'),
	('G5439','φυλακίζω','phylakízō','foo-lak-id\'-zo','from φύλαξ; to incarcerate:--imprison.'),
	('G5440','φυλακτήριον','phylaktḗrion','foo-lak-tay\'-ree-on','neuter of a derivative of φυλάσσω; a guard-case, i.e. \"phylactery\" for wearing slips of Scripture texts:-- phylactery.'),
	('G5441','φύλαξ','phýlax','foo\'-lax','from φυλάσσω; a watcher or sentry:--keeper.'),
	('G5442','φυλάσσω','phylássō','foo-las\'-so','probably from φυλή through the idea of isolation; to watch, i.e. be on guard (literally of figuratively); by implication, to preserve, obey, avoid:--beward, keep (self), observe, save. Compare τηρέω.'),
	('G5443','φυλή','phylḗ','foo-lay\'','from φύω (compare φύλλον); an offshoot, i.e. race or clan:--kindred, tribe.'),
	('G5444','φύλλον','phýllon','fool\'-lon','from the same as φυλή; a sprout, i.e. leaf:--leaf.'),
	('G5445','φύραμα','phýrama','foo\'-ram-ah','from a prolonged form of  (to mix a liquid with a solid; perhaps akin to φύω through the idea of swelling in bulk), mean to knead; a mass of dough:--lump.'),
	('G5446','φυσικός','physikós','foo-see-kos\'','from φύσις; \"physical\", i.e. (by implication) instinctive:--natural. Compare ψυχικός.'),
	('G5447','φυσικῶς','physikōs','foo-see-koce\'','adverb from φυσικός; \"physically\", i.e. (by implication) instinctively:--naturally.'),
	('G5448','φυσιόω','physióō','foo-see-o\'-o','from φύσις in the primary sense of blowing; to inflate, i.e. (figuratively) make proud (haughty):--puff up.'),
	('G5449','φύσις','phýsis','foo\'-sis','from φύω; growth (by germination or expansion), i.e. (by implication) natural production (lineal descent); by extension, a genus or sort; figuratively, native disposition, constitution or usage:--(man-)kind, nature(-al).'),
	('G5450','φυσίωσις','physíōsis','foo-see\'-o-sis','from φυσιόω; inflation, i.e. (figuratively) haughtiness:--swelling.'),
	('G5451','φυτεία','phyteía','foo-ti\'-ah','from φυτεύω; trans-planting, i.e. (concretely) a shrub or vegetable:--plant.'),
	('G5452','φυτεύω','phyteúō','foot-yoo\'-o','from a derivative of φύω; to set out in the earth, i.e. implant; figuratively, to instil doctrine:--plant.'),
	('G5453','φύω','phýō','foo\'-o','a primary verb; probably originally, to \"puff\" or blow, i.e. to swell up; but only used in the implied sense, to germinate or grow (sprout, produce), literally or figuratively:--spring (up).'),
	('G5454','φωλεός','phōleós','fo-leh-os\'','of uncertain derivative; a burrow or lurking-place:--hole.'),
	('G5455','φωνέω','phōnéō','fo-neh\'-o','from φωνή; to emit a sound (animal, human or instrumental); by implication, to address in words or by name, also in imitation:--call (for), crow, cry.'),
	('G5456','φωνή','phōnḗ','fo-nay\'','probably akin to φαίνω through the idea of disclosure; a tone (articulate, bestial or artificial); by implication, an address (for any purpose), saying or language:--noise, sound, voice.'),
	('G5457','φῶς','phōs','foce','from an obsolete  (to shine or make manifest, especially by rays; compare φαίνω, φημί); luminousness (in the widest application, natural or artificial, abstract or concrete, literal or figurative):--fire, light.'),
	('G5458','φωστήρ','phōstḗr','foce-tare\'','from φῶς; an illuminator, i.e. (concretely) a luminary, or (abstractly) brilliancy:--light.'),
	('G5459','φωσφόρος','phōsphóros','foce-for\'-os','from φῶς and φέρω; light-bearing (\"phosphorus\"), i.e. (specially), the morning-star (figuratively):--day star.'),
	('G5460','φωτεινός','phōteinós','fo-ti-nos\'','from φῶς; lustrous, i.e. transparent or well-illuminated (figuratively):--bright, full of light.'),
	('G5461','φωτίζω','phōtízō','fo-tid\'-zo','from φῶς; to shed rays, i.e. to shine or (transitively) to brighten up (literally or figuratively):--enlighten, illuminate, (bring to, give) light, make to see.'),
	('G5462','φωτισμός','phōtismós','fo-tis-mos\'','from φωτίζω; illumination (figuratively):--light.'),
	('G5463','χαίρω','chaírō','khah\'-ee-ro','a primary verb; to be \"cheer\"ful, i.e. calmly happy or well-off; impersonally, especially as salutation (on meeting or parting), be well:--farewell, be glad, God speed, greeting, hall, joy(- fully), rejoice.'),
	('G5464','χάλαζα','chálaza','khal\'-ad-zah','probably from χαλάω; hail:--hail.'),
	('G5465','χαλάω','chaláō','khal-ah\'-o','from the base of χάσμα; to lower (as into a void):--let down, strike.'),
	('G5466','Χαλδαῖος','Chaldaîos','khal-dah\'-yos','probably of Hebrew or (כַּשְׂדִּי); a Chaldæan (i.e. Kasdi), or native or the region of the lower Euphrates:--Chaldæan.'),
	('G5467','χαλεπός','chalepós','khal-ep-os\'','perhaps from χαλάω through the idea of reducing the strength; difficult, i.e. dangerous, or (by implication) furious:--fierce, perilous.'),
	('G5468','χαλιναγωγέω','chalinagōgéō','khal-in-ag-ogue-eh\'-o','from a compound of χαλινός and the reduplicated form of ἄγω; to be a bit-leader, i.e. to curb (figuratively):--bridle.'),
	('G5469','χαλινός','chalinós','khal-ee-nos\'','from χαλάω; a curb or head-stall (as curbing the spirit):--bit, bridle.'),
	('G5470','χάλκεος','chálkeos','khal\'-keh-os','from χαλκός; coppery:--brass.'),
	('G5471','χαλκεύς','chalkeús','khalk-yooce\'','from χαλκός; a copper-worker or brazier:--coppersmith.'),
	('G5472','χαλκηδών','chalkēdṓn','khal-kay-dohn\'','from χαλκός and perhaps εἶδος; copper-like, i.e. \"chalcedony\":--chalcedony.'),
	('G5473','χαλκίον','chalkíon','khal-kee\'-on','diminutive from χαλκός; a copper dish:--brazen vessel.'),
	('G5474','χαλκολίβανον','chalkolíbanon','khal-kol-ib\'-an-on','neuter of a compound of χαλκός and λίβανος (in the implied mean of whiteness or brilliancy); burnished copper, an alloy of copper (or gold) and silver having a brilliant lustre:--fine brass.'),
	('G5475','χαλκός','chalkós','khal-kos\'','perhaps from χαλάω through the idea of hollowing out as a vessel (this metal being chiefly used for that purpose); copper (the substance, or some implement or coin made of it):--brass, money.'),
	('G5476','χαμαί','chamaí','kham-ah\'-ee','adverb perhaps from the base of χάσμα through the idea of a fissure in the soil; earthward, i.e. prostrate:--on (to) the ground.'),
	('G5477','Χαναάν','Chanaán','khan-ah-an\'','of Hebrew origin (כְּנַעַן); Chanaan (i.e. Kenaan), the early name of Palestine:--Chanaan.'),
	('G5478','Χανααναῖος','Chanaanaîos','khan-ah-an-ah\'-yos','from Χαναάν; a Chanaanæan (i.e. Kenaanite), or native of gentile Palestine:--of Canaan.'),
	('G5479','χαρά','chará','khar-ah\'','from χαίρω; cheerfulness, i.e. calm delight:--gladness, X greatly, (X be exceeding) joy(-ful, -fully, -fulness, -ous).'),
	('G5480','χάραγμα','cháragma','khar\'-ag-mah','from the same as χάραξ; a scratch or etching, i.e. stamp (as a badge of servitude), or scupltured figure (statue):--graven, mark.'),
	('G5481','χαρακτήρ','charaktḗr','khar-ak-tare\'','from the same as χάραξ; a graver (the tool or the person), i.e. (by implication) engraving ((\"character\"), the figure stamped, i.e. an exact copy or (figuratively) representation):--express image.'),
	('G5482','χάραξ','chárax','khar\'-ax','from  (to sharpen to a point; akin to γράφω through the idea of scratching); a stake, i.e. (by implication) a palisade or rampart (military mound for circumvallation in a siege):--trench.'),
	('G5483','χαρίζομαι','charízomai','khar-id\'-zom-ahee','middle voice from χάρις; to grant as a favor, i.e. gratuitously, in kindness, pardon or rescue:--deliver, (frankly) forgive, (freely) give, grant.'),
	('G5484','χάριν','chárin','khar\'-in','accusative case of χάρις as preposition; through favor of, i.e. on account of:--be-(for) cause of, for sake of, +…fore, X reproachfully.'),
	('G5485','χάρις','cháris','khar\'-ece','from χαίρω; graciousness (as gratifying), of manner or act (abstract or concrete; literal, figurative or spiritual; especially the divine influence upon the heart, and its reflection in the life; including gratitude):--acceptable, benefit, favour, gift, grace(- ious), joy, liberality, pleasure, thank(-s, -worthy).'),
	('G5486','χάρισμα','chárisma','khar\'-is-mah','from χαρίζομαι; a (divine) gratuity, i.e. deliverance (from danger or passion); (specially), a (spiritual) endowment, i.e. (subjectively) religious qualification, or (objectively) miraculous faculty:--(free) gift.'),
	('G5487','χαριτόω','charitóō','khar-ee-to\'-o','from χάρις; to grace, i.e. indue with special honor:--make accepted, be highly favoured.'),
	('G5488','Χαῤῥάν','Charrhán','khar-hran\'','of Hebrew origin (חָרָן); Charrhan (i.e. Charan), a place in Mesopotamia:--Charran.'),
	('G5489','χάρτης','chártēs','khar\'-tace','from the same as χάραξ; a sheet (\"chart\") of writing-material (as to be scribbled over):--paper.'),
	('G5490','χάσμα','chásma','khas\'-mah','from a form of an obsolete primary  (to \"gape\" or \"yawn\"); a \"chasm\" or vacancy (impassable interval):--gulf.'),
	('G5491','χεῖλος','cheîlos','khi\'-los','from a form of the same as χάσμα; a lip (as a pouring place); figuratively, a margin (of water):--lip, shore.'),
	('G5492','χειμάζω','cheimázō','khi-mad\'-zo','from the same as χειμών; to storm, i.e. (passively) to labor under a gale:--be tossed with tempest.'),
	('G5493','χείμαῤῥος','cheímarrhos','khi\'-mar-hros','from the base of χειμών and ῥέω; a storm-runlet, i.e. winter-torrent:--brook.'),
	('G5494','χειμών','cheimṓn','khi-mone\'','from a derivative of  (to pour; akin to the base of 5490 through the idea of a channel), meaning a storm (as pouring rain); by implication, the rainy season, i.e. winter:--tempest, foul weather, winter.'),
	('G5495','χείρ','cheír','khire','perhaps from the base of χειμών in the sense of its congener the base of χάσμα (through the idea of hollowness for grasping); the hand (literally or figuratively (power); especially (by Hebraism) a means or instrument):--hand.'),
	('G5496','χειραγωγέω','cheiragōgéō','khi-rag-ogue-eh\'-o','from χειραγωγός; to be a hand-leader, i.e. to guide (a blind person):--lead by the hand.'),
	('G5497','χειραγωγός','cheiragōgós','khi-rag-o-gos\'','from χείρ and a reduplicated form of ἄγω; a hand-leader, i.e. personal conductor (of a blind person):--some to lead by the hand.'),
	('G5498','χειρόγραφον','cheirógraphon','khi-rog\'-raf-on','neuter of a compound of χείρ and γράφω; something hand-written (\"chirograph\"), i.e. a manuscript (specially, a legal document or bond (figuratively)):--handwriting.'),
	('G5499','χειροποίητος','cheiropoíētos','khi-rop-oy\'-ay-tos','from χείρ and a derivative of ποιέω; manufactured, i.e. of human construction:--made by (make with) hands.'),
	('G5500','χειροτονέω','cheirotonéō','khi-rot-on-eh\'-o','from a comparative of χείρ and  (to stretch); to be a hand-reacher or voter (by raising the hand), i.e. (generally) to select or appoint:--choose, ordain.'),
	('G5501','χείρων','cheírōn','khi\'-rone','irregular comparative of κακός; from an obsolete equivalent  (of uncertain derivation); more evil or aggravated (physically, mentally or morally):--sorer, worse.'),
	('G5502','χερουβίμ','cheroubím','kher-oo-beem\'','plural of Hebrew origin (כְּרוּב); \"cherubim\" (i.e. cherubs or kerubim):--cherubims.'),
	('G5503','χήρα','chḗra','khay\'-rah','feminine of a presumed derivative apparently from the base of χάσμα through the idea of deficiency; a widow (as lacking a husband), literally or figuratively:--widow.'),
	('G5504','χθές','chthés','khthes','of uncertain derivation; \"yesterday\"; by extension, in time past or hitherto:--yesterday.'),
	('G5505','χιλιάς','chiliás','khil-ee-as\'','from χίλιοι; one thousand (\"chiliad\"):--thousand.'),
	('G5506','χιλίαρχος','chilíarchos','khil-ee\'-ar-khos','from χίλιοι and ἄρχω; the commander of a thousand soldiers (\"chiliarch\"; i.e. colonel:--(chief, high) captain.'),
	('G5507','χίλιοι','chílioi','khil\'-ee-oy','plural of uncertain affinity; a thousand:--thousand.'),
	('G5508','Χίος','Chíos','khee\'-os','of uncertain derivation; Chios, an island in the Mediterranean:--Chios.'),
	('G5509','χιτών','chitṓn','khee-tone\'','of foreign origin (כְּתֹנֶת); a tunic or shirt:--clothes, coat, garment.'),
	('G5510','χιών','chiṓn','khee-one\'','perhaps akin to the base of χάσμα (χαλάω) or χειμών (as descending or empty); snow:--snow.'),
	('G5511','χλαμύς','chlamýs','khlam-ooce\'','of uncertain derivation; a military cloak:--robe.'),
	('G5512','χλευάζω','chleuázō','khlyoo-ad\'-zo','from a derivative probably of χεῖλος; to throw out the lip, i.e. jeer at:--mock.'),
	('G5513','χλιαρός','chliarós','khlee-ar-os\'','from  (to warm); tepid:--lukewarm.'),
	('G5514','Χλόη','Chlóē','khlo\'-ay','feminine of apparently a primary word; \"green\"; Chloë, a Christian female:--Chloe.'),
	('G5515','χλωρός','chlōrós','khlo-ros\'','from the same as Χλόη; greenish, i.e. verdant, dun-colored:--green, pale.'),
	('G5516','χξϛ','chx stigma','khee xee stig\'-ma','the 22nd, 14th and an obsolete letter (στίγμα as a cross) of the Greek alphabet (intermediate between the 5th and 6th), used as numbers; denoting respectively 600, 60 and 6; 666 as a numeral:--six hundred threescore and six.'),
	('G5517','χοϊκός','choïkós','kho-ik-os\'','from χόος; dusty or dirty (soil-like), i.e. (by implication) terrene:--earthy.'),
	('G5518','χοῖνιξ','choînix','khoy\'-nix','of uncertain derivation; a chœnix or certain dry measure:--measure.'),
	('G5519','χοῖρος','choîros','khoy\'-ros','of uncertain derivation; a hog:--swine.'),
	('G5520','χολάω','choláō','khol-ah\'-o','from χολή; to be bilious, i.e. (by implication) irritable (enraged, \"choleric\"):--be angry.'),
	('G5521','χολή','cholḗ','khol-ay\'','feminine of an equivalent perhaps akin to the same as 5514 (from the greenish hue); \"gall\" or bile, i.e. (by analogy) poison or an anodyne (wormwood, poppy, etc.):--gall.'),
	('G5522','χόος','chóos','kho\'-os','from the base of χειμών; a heap (as poured out), i.e. rubbish; loose dirt:--dust.'),
	('G5523','Χοραζίν','Chorazín','khor-ad-zin\'','of uncertain derivation; Chorazin, a place in Palestine:--Chorazin.'),
	('G5524','χορηγέω','chorēgéō','khor-ayg-eh\'-o','from a compound of χορός and ἄγω; to be a dance-leader, i.e. (generally) to furnish:--give, minister.'),
	('G5525','χορός','chorós','khor-os\'','of uncertain derivation; a ring, i.e. round dance (\"choir\":--dancing.'),
	('G5526','χορτάζω','chortázō','khor-tad\'-zo','from χόρτος; to fodder, i.e. (generally) to gorge (supply food in abundance):--feed, fill, satisfy.'),
	('G5527','χόρτασμα','chórtasma','khor\'-tas-mah','from χορτάζω; forage, i.e. food:--sustenance.'),
	('G5528','χόρτος','chórtos','khor\'-tos','apparently a primary word; a \"court\" or \"garden\", i.e. (by implication, of pasture) herbage or vegetation:--blade, grass, hay.'),
	('G5529','Χουζᾶς','Chouzâs','khood-zas\'','of uncertain origin; Chuzas, an officer of Herod:--Chuza.'),
	('G5530','χράομαι','chráomai','khrah\'-om-ahee','middle voice of a primary verb (perhaps rather from χείρ, to handle); to furnish what is needed; (give an oracle, \"graze\" (touch slightly), light upon, etc.), i.e. (by implication) to employ or (by extension) to act towards one in a given manner:--entreat, use. Compare χράω; χρή.'),
	('G5531','χράω','chráō','khrah\'-o','probably the same as the base of χράομαι; to loan:--lend.'),
	('G5532','χρεία','chreía','khri\'-ah','from the base of χράομαι or χρή; employment, i.e. an affair; also (by implication) occasion, demand, requirement or destitution:--business, lack, necessary(-ity), need(-ful), use, want.'),
	('G5533','χρεωφειλέτης','chreōpheilétēs','khreh-o-fi-let\'-ace','from a derivative of χράω and ὀφειλέτης; a loan-ower, i.e. indebted person:--debtor.'),
	('G5534','χρή','chrḗ','khray','third person singular of the same as χράομαι or χράω used impersonally; it needs (must or should) be:--ought.'),
	('G5535','χρῄζω','chrḗizō','khrade\'-zo','from χρεία; to make (i.e. have) necessity, i.e. be in want of:--(have) need.'),
	('G5536','χρῆμα','chrēma','khray\'-mah',''),
	('G5537','χρηματίζω','chrēmatízō','khray-mat-id\'-zo','from χρῆμα; to utter an oracle (compare the original sense of χράομαι), i.e. divinely intimate; by implication, (compare the secular sense of χρεία) to constitute a firm for business, i.e. (generally) bear as a title:--be called, be admonished (warned) of God, reveal, speak.'),
	('G5538','χρηματισμός','chrēmatismós','khray-mat-is-mos\'','from χρηματίζω; a divine response or revelation:--answer of God.'),
	('G5539','χρήσιμος','chrḗsimos','khray\'-see-mos','from χρῆσις; serviceable:--profit.'),
	('G5540','χρῆσις','chrēsis','khray\'-sis','from χράομαι; employment, i.e. (specially), sexual intercourse (as an occupation of the body):--use.'),
	('G5541','χρηστεύομαι','chrēsteúomai','khraste-yoo\'-om-ahee','middle voice from χρηστός; to show oneself useful, i.e. act benevolently:--be kind.'),
	('G5542','χρηστολογία','chrēstología','khrase-tol-og-ee\'-ah','from a compound of χρηστός and λέγω; fair speech, i.e. plausibility:--good words.'),
	('G5543','χρηστός','chrēstós','khrase-tos\'','from χράομαι; employed, i.e. (by implication) useful (in manner or morals):--better, easy, good(-ness), gracious, kind.'),
	('G5544','χρηστότης','chrēstótēs','khray-stot\'-ace','from χρηστός; usefulness, i.e. morally, excellence (in character or demeanor):--gentleness, good(-ness), kindness.'),
	('G5545','χρῖσμα','chrîsma','khris\'-mah','from χρίω; an unguent or smearing, i.e. (figuratively) the special endowment (\"chrism\") of the Holy Spirit:--anointing, unction.'),
	('G5546','Χριστιανός','Christianós','khris-tee-an-os\'','from Χριστός; a Christian, i.e. follower of Christ:--Christian.'),
	('G5547','Χριστός','Christós','khris-tos\'','from χρίω; anointed, i.e. the Messiah, an epithet of Jesus:--Christ.'),
	('G5548','χρίω','chríō','khree\'-o','probably akin to χράομαι through the idea of contact; to smear or rub with oil, i.e. (by implication) to consecrate to an office or religious service:--anoint.'),
	('G5549','χρονίζω','chronízō','khron-id\'-zo','from χρόνος; to take time, i.e. linger:--delay, tarry.'),
	('G5550','χρόνος','chrónos','khron\'-os','of uncertain derivation; a space of time (in general, and thus properly distinguished from καιρός, which designates a fixed or special occasion; and from αἰών, which denotes a particular period) or interval; by extension, an individual opportunity; by implication, delay:--+ years old, season, space, (X often-)time(-s), (a) while.'),
	('G5551','χρονοτριβέω','chronotribéō','khron-ot-rib-eh\'-o','from a presumed compound of χρόνος and the base of τρίβος; to be a time-wearer, i.e. to procrastinate (linger):--spend time.'),
	('G5552','χρύσεος','chrýseos','khroo\'-seh-os','from χρυσός; made of gold:--of gold, golden.'),
	('G5553','χρυσίον','chrysíon','khroo-see\'-on','diminutive of χρυσός; a golden article, i.e. gold plating, ornament, or coin:--gold.'),
	('G5554','χρυσοδακτύλιος','chrysodaktýlios','khroo-sod-ak-too\'-lee-os','from χρυσός and δακτύλιος; gold-ringed, i.e. wearing a golden finger-ring or similar jewelry:--with a gold ring.'),
	('G5555','χρυσόλιθος','chrysólithos','khroo-sol\'-ee-thos','from χρυσός and λίθος; gold-stone, i.e. a yellow gem (\"chrysolite\"):--chrysolite.'),
	('G5556','χρυσόπρασος','chrysóprasos','khroo-sop\'-ras-os','from χρυσός and  (a leek); a greenish-yellow gem (\"chrysoprase\"):--chrysoprase.'),
	('G5557','χρυσός','chrysós','khroo-sos\'','perhaps from the base of χράομαι (through the idea of the utility of the metal); gold; by extension, a golden article, as an ornament or coin:--gold.'),
	('G5558','χρυσόω','chrysóō','khroo-so\'-o','from χρυσός; to gild, i.e. bespangle with golden ornaments:--deck.'),
	('G5559','χρώς','chrṓs','khroce','probably akin to the base of χράομαι through the idea of handling; the body (properly, its surface or skin):--body.'),
	('G5560','χωλός','chōlós','kho-los\'','apparently a primary word; \"halt\", i.e. limping:--cripple, halt, lame.'),
	('G5561','χώρα','chṓra','kho\'-rah','feminine of a derivative of the base of χάσμα through the idea of empty expanse; room, i.e. a space of territory (more or less extensive; often including its inhabitants):--coast, county, fields, ground, land, region. Compare τόπος.'),
	('G5562','χωρέω','chōréō','kho-reh\'-o','from χώρα; to be in (give) space, i.e. (intransitively) to pass, enter, or (transitively) to hold, admit (literally or figuratively):--come, contain, go, have place, (can, be room to) receive.'),
	('G5563','χωρίζω','chōrízō','kho-rid\'-zo','from χώρα; to place room between, i.e. part; reflexively, to go away:--depart, put asunder, separate.'),
	('G5564','χωρίον','chōríon','kho-ree\'-on','diminutive of χώρα; a spot or plot of ground:--field, land, parcel of ground, place, possession.'),
	('G5565','χωρίς','chōrís','kho-rece\'','adverb from χώρα; at a space, i.e. separately or apart from (often as preposition):--beside, by itself, without.'),
	('G5566','χῶρος','chōros','kho\'-ros','of Latin origin; the north-west wind:--north west.'),
	('G5567','ψάλλω','psállō','psal\'-lo','probably strengthened from  (to rub or touch the surface; compare ψώχω); to twitch or twang, i.e. to play on a stringed instrument (celebrate the divine worship with music and accompanying odes):--make melody, sing (psalms).'),
	('G5568','ψαλμός','psalmós','psal-mos\'','from ψάλλω; a set piece of music, i.e. a sacred ode (accompanied with the voice, harp or other instrument; a \"psalm\"); collectively, the book of the Psalms:--psalm. Compare ᾠδή.'),
	('G5569','ψευδάδελφος','pseudádelphos','psyoo-dad\'-el-fos','from ψευδής and ἀδελφός; a spurious brother, i.e. pretended associate:--false brethren.'),
	('G5570','ψευδαπόστολος','pseudapóstolos','psyoo-dap-os\'-tol-os','from ψευδής and ἀπόστολος; a spurious apostle, i.e. pretended pracher:--false teacher.'),
	('G5571','ψευδής','pseudḗs','psyoo-dace\'','from ψεύδομαι; untrue, i.e. erroneous, deceitful, wicked:--false, liar.'),
	('G5572','ψευδοδιδάσκαλος','pseudodidáskalos','psyoo-dod-id-as\'-kal-os','from ψευδής and διδάσκαλος; a spurious teacher, i.e. propagator of erroneous Christian doctrine:--false teacher.'),
	('G5573','ψευδολόγος','pseudológos','psyoo-dol-og\'-os','from ψευδής and λέγω; mendacious, i.e. promulgating erroneous Christian doctrine:--speaking lies.'),
	('G5574','ψεύδομαι','pseúdomai','psyoo\'-dom-ahee','middle voice of an apparently primary verb; to utter an untruth or attempt to deceive by falsehood:--falsely, lie.'),
	('G5575','ψευδομάρτυρ','pseudomártyr','psyoo-dom-ar\'-toor','from ψευδής and a kindred form of μάρτυς; a spurious witness, i.e. bearer of untrue testimony:--false witness.'),
	('G5576','ψευδομαρτυρέω','pseudomartyréō','psyoo-dom-ar-too-reh\'-o','from ψευδομάρτυρ; to be an untrue testifier, i.e. offer falsehood in evidence:--be a false witness.'),
	('G5577','ψευδομαρτυρία','pseudomartyría','psyoo-dom-ar-too-ree\'-ah','from ψευδομάρτυρ; untrue testimony:--false witness.'),
	('G5578','ψευδοπροφήτης','pseudoprophḗtēs','psyoo-dop-rof-ay\'-tace','from ψευδής and προφήτης; a spurious prophet, i.e. pretended foreteller or religious impostor:--false prophet.'),
	('G5579','ψεῦδος','pseûdos','psyoo\'-dos','from ψεύδομαι; a falsehood:--lie, lying.'),
	('G5580','ψευδόχριστος','pseudóchristos','psyoo-dokh\'-ris-tos','from ψευδής and Χριστός; a spurious Messiah:--false Christ.'),
	('G5581','ψευδώνυμος','pseudṓnymos','psyoo-do\'-noo-mos','from ψευδής and ὄνομα; untruly named:--falsely so called.'),
	('G5582','ψεῦσμα','pseûsma','psyoos\'-mah','from ψεύδομαι; a fabrication, i.e. falsehood:--lie.'),
	('G5583','ψεύστης','pseústēs','psyoos-tace\'','from ψεύδομαι; a falsifier:--liar.'),
	('G5584','ψηλαφάω','psēlapháō','psay-laf-ah\'-o','from the base of ψάλλω (compare ψῆφος); to manipulate, i.e. verify by contact; figuratively, to search for:--feel after, handle, touch.'),
	('G5585','ψηφίζω','psēphízō','psay-fid\'-zo','from ψῆφος; to use pebbles in enumeration, i.e. (generally) to compute:--count.'),
	('G5586','ψῆφος','psēphos','psay\'-fos','from the same as ψηλαφάω; a pebble (as worn smooth by handling), i.e. (by implication, of use as a counter or ballot) a verdict (of acquittal) or ticket (of admission); a vote:--stone, voice.'),
	('G5587','ψιθυρισμός','psithyrismós','psith-oo-ris-mos\'','from a derivative of  (a whisper; by implication, a slander; probably akin to ψεύδομαι); whispering, i.e. secret detraction:--whispering.'),
	('G5588','ψιθυριστής','psithyristḗs','psith-oo-ris-tace\'','from the same as ψιθυρισμός; a secret calumniator:--whisperer.'),
	('G5589','ψιχίον','psichíon','psikh-ee\'-on','diminutive from a derivative of the base of ψάλλω (meaning a crumb); a little bit or morsel:--crumb.'),
	('G5590','ψυχή','psychḗ','psoo-khay\'','from ψύχω; breath, i.e. (by implication) spirit, abstractly or concretely (the animal sentient principle only; thus distinguished on the one hand from πνεῦμα, which is the rational and immortal soul; and on the other from ζωή, which is mere vitality, even of plants: these terms thus exactly correspond respectively to the Hebrew נֶפֶשׁ, רוּחַ and חַי):--heart (+ -ily), life, mind, soul, + us, + you.'),
	('G5591','ψυχικός','psychikós','psoo-khee-kos\'','from ψυχή; sensitive, i.e. animate (in distinction on the one hand from πνευματικός, which is the higher or renovated nature; and on the other from φυσικός, which is the lower or bestial nature):--natural, sensual.'),
	('G5592','ψύχος','psýchos','psoo\'-khos','from ψύχω; coolness:--cold.'),
	('G5593','ψυχρός','psychrós','psoo-chros\'','from ψύχος; chilly (literally or figuratively):--cold.'),
	('G5594','ψύχω','psýchō','psoo\'-kho','a primary verb; to breathe (voluntarily but gently, thus differing on the one hand from πνέω, which denotes properly a forcible respiration; and on the other from the base of ἀήρ, which refers properly to an inanimate breeze), i.e. (by implication, of reduction of temperature by  evaporation) to chill (figuratively):--wax cold.'),
	('G5595','ψωμίζω','psōmízō','pso-mid\'-zo','from the base of ψωμίον; to supply with bits, i.e. (generally) to nourish:--(bestow to) feed.'),
	('G5596','ψωμίον','psōmíon','pso-mee\'-on','diminutive from a derivative of the base of ψώχω; a crumb or morsel (as if rubbed off), i.e. a mouthful:--sop.'),
	('G5597','ψώχω','psṓchō','pso\'-kho','prolongation from the same base as ψάλλω; to triturate, i.e. (by analogy) to rub out (kernels from husks with the fingers or hand):--rub.'),
	('G5598','Ω','Ō','o\'-meg-ah',''),
	('G5599','ὦ','ō','o','a primary interjection; as a sign of the vocative case, O; as a note of exclamation, oh:--O.'),
	('G5600','ὦ','ō','ay','the subjunctive of εἰμί; (may, might, can, could, would, should, must, etc.; also with εἰ and its comparative, as well as with other particles) be:--+ appear, are, (may, might,  should) be, X have, is, + pass the flower of her age, should stand, were.'),
	('G5601','Ὠβήδ','Ōbḗd','o-bade\'','of Hebrew origin (עוֹבֵד); Obed, an Israelite:--Obed.'),
	('G5602','ὧδε','hōde','ho\'-deh','from an adverb form of ὅδε; in this same spot, i.e. here or hither:--here, hither, (in) this place, there.'),
	('G5603','ᾠδή','ōidḗ','o-day\'','from ᾄδω; a chant or \"ode\" (the general term for any words sung; while ὕμνος denotes especially a religious metrical composition, and ψαλμός still more specially, a Hebrew cantillation):--song.'),
	('G5604','ὠδίν','ōdín','o-deen\'','akin to ὀδύνη; a pang or throe, especially of childbirth:--pain, sorrow, travail.'),
	('G5605','ὠδίνω','ōdínō','o-dee\'-no','from ὠδίν; to experience the pains of parturition (literally or figuratively):--travail in (birth).'),
	('G5606','ὦμος','ōmos','o\'-mos','perhaps from the alternate of φέρω; the shoulder (as that on which burdens are borne):--shoulder.'),
	('G5607','ὤν','ṓn','on','present participle of εἰμί; being:--be, come, have.'),
	('G5608','ὠνέομαι','ōnéomai','o-neh\'-om-ahee','middle voice from an apparently primary  (a sum or price); to purchase (synonymous with the earlier πίμπρημι):-- buy.'),
	('G5609','ὠόν','ōón','o-on\'','apparently a primary word; an \"egg\":--egg.'),
	('G5610','ὥρα','hṓra','ho\'-rah','apparently a primary word; an \"hour\" (literally or figuratively):--day, hour, instant, season, X short, (even-)tide, (high) time.'),
	('G5611','ὡραῖος','hōraîos','ho-rah\'-yos','from ὥρα; belonging to the right hour or season (timely), i.e. (by implication) flourishing (beauteous (figuratively)):--beautiful.'),
	('G5612','ὠρύομαι','ōrýomai','o-roo\'-om-ahee','middle voice of an apparently primary verb; to \"roar\":--roar.'),
	('G5613','ὡς','hōs','hoce','probably adverb of comparative from ὅς; which how, i.e. in that manner (very variously used, as follows):--about, after (that), (according) as (it had been, it were), as soon (as), even as (like), for, how (greatly), like (as, unto), since, so (that), that, to wit, unto, when(-soever), while, X with all speed.'),
	('G5614','ὡσαννά','hōsanná','ho-san-nah\'','of Hebrew origin (יָשַׁע and נָא); oh save!; hosanna (i.e. hoshia-na), an exclamation of adoration:--hosanna.'),
	('G5615','ὡσαύτως','hōsaútōs','ho-sow\'-toce','from ὡς and an adverb from αὐτός; as thus, i.e. in the same way:--even so, likewise, after the same (in like) manner.'),
	('G5616','ὡσεί','hōseí','ho-si\'','from ὡς and εἰ; as if:--about, as (it had been, it were), like (as).'),
	('G5617','Ὡσηέ','Hōsēé','ho-say-eh\'','of Hebrew origin (הוֹשֵׁעַ); Hosee (i.e. Hoshea), an Israelite:--Osee.'),
	('G5618','ὥσπερ','hṓsper','hoce\'-per','from ὡς and περ; just as, i.e. exactly like:--(even, like) as.'),
	('G5619','ὡσπερεί','hōspereí','hoce-per-i\'','from ὥσπερ and εἰ; just as if, i.e. as it were:--as.'),
	('G5620','ὥστε','hṓste','hoce\'-teh','from ὡς and τέ; so too, i.e. thus therefore (in various relations of consecution, as follow):--(insomuch) as, so that (then), (insomuch) that, therefore, to, wherefore.'),
	('G5621','ὠτίον','ōtíon','o-tee\'-on','diminutive of οὖς; an earlet, i.e. one of the ears, or perhaps the lobe of the ear:--ear.'),
	('G5622','ὠφέλεια','ōphéleia','o-fel\'-i-ah','from a derivative of the base of ὠφέλιμος; usefulness, i.e. benefit:--advantage, profit.'),
	('G5623','ὠφελέω','ōpheléō','o-fel-eh\'-o','from the same as ὠφέλεια; to be useful, i.e. to benefit:--advantage, better, prevail, profit.'),
	('G5624','ὠφέλιμος','ōphélimos','o-fel\'-ee-mos','from a form of ὄφελος; helpful or serviceable, i.e. advantageous:--profit(-able).');
